.  \u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05d9\u05d5\u05d0\u05d1 \u05d0\u05d1\u05df\u05d1\u05e2\u05e7\u05d1\u05d5\u05ea \u05ea\u05d5\u05e6\u05d0\u05d5\u05ea \u05de\u05d9\u05e7\u05e8\u05d5\u05d1\u05d9\u05d0\u05dc\u05d9\u05d5\u05ea \u05e9\u05d4\u05ea\u05e7\u05d1\u05dc\u05d5 \u05d1\u05de\u05e1\u05d2\u05e8\u05ea \u05d3\u05d9\u05d2\u05d5\u05dd \u05e9\u05d2\u05e8\u05ea\u05d9, \u05de\u05e9\u05e8\u05d3 \u05d4\u05d1\u05e8\u05d9\u05d0\u05d5\u05ea \u05d4\u05d5\u05e8\u05d4 \u05dc\u05d4\u05e8\u05ea\u05d9\u05d7 \u05de\u05d9\u05dd \u05d1\u05de\u05ea\u05d7\u05dd \u05d7\u05d5\u05d5\u05ea \u05e8\u05d5\u05e0\u05d9\u05ea \u05dc\u05e4\u05e0\u05d9 \u05e9\u05ea\u05d9\u05d9\u05d4, \u05d1\u05d9\u05e9\u05d5\u05dc, \u05d4\u05db\u05e0\u05ea \u05de\u05d6\u05d5\u05df, \u05d4\u05db\u05e0\u05ea \u05ea\u05e8\u05d5\u05e4\u05d5\u05ea \u05d5\u05e6\u05d7\u05e6\u05d5\u05d7 \u05e9\u05d9\u05e0\u05d9\u05d9\u05dd. \u05e0\u05d9\u05ea\u05df \u05dc\u05d4\u05e9\u05ea\u05de\u05e9 \u05d1\u05de\u05d9\u05dd \u05dc\u05e6\u05d5\u05e8\u05db\u05d9 \u05e8\u05d7\u05e6\u05d4 \u05d5\u05e1\u05e0\u05d9\u05d8\u05e6\u05d9\u05d4. \u05d4\u05d4\u05e0\u05d7\u05d9\u05d4 \u05ea\u05e7\u05e4\u05d4 \u05e2\u05d3 \u05dc\u05d4\u05d5\u05d3\u05e2\u05d4 \u05d7\u05d3\u05e9\u05d4@N12chat",false,30,"\u05d9\u05d5\u05d0\u05d1 \u05d0\u05d1\u05df\u05d1\u05e2\u05e7\u05d1\u05d5\u05ea \u05ea\u05d5\u05e6\u05d0\u05d5\u05ea \u05de\u05d9\u05e7\u05e8\u05d5\u05d1\u05d9\u05d0\u05dc\u05d9\u05d5\u05ea \u05e9\u05d4\u05ea\u05e7\u05d1\u05dc\u05d5 \u05d1\u05de\u05e1\u05d2\u05e8\u05ea \u05d3\u05d9\u05d2\u05d5\u05dd \u05e9\u05d2\u05e8\u05ea\u05d9, \u05de\u05e9\u05e8\u05d3 \u05d4\u05d1\u05e8\u05d9\u05d0\u05d5\u05ea \u05d4\u05d5\u05e8\u05d4 \u05dc\u05d4\u05e8\u05ea\u05d9\u05d7 \u05de\u05d9\u05dd \u05d1\u05de\u05ea\u05d7\u05dd \u05d7\u05d5\u05d5\u05ea \u05e8\u05d5\u05e0\u05d9\u05ea \u05dc\u05e4\u05e0\u05d9 \u05e9\u05ea\u05d9\u05d9\u05d4, \u05d1\u05d9\u05e9\u05d5\u05dc, \u05d4\u05db\u05e0\u05ea \u05de\u05d6\u05d5\u05df, \u05d4\u05db\u05e0\u05ea \u05ea\u05e8\u05d5\u05e4\u05d5\u05ea \u05d5\u05e6\u05d7\u05e6\u05d5\u05d7 \u05e9\u05d9\u05e0\u05d9\u05d9\u05dd. \u05e0\u05d9\u05ea\u05df \u05dc\u05d4\u05e9\u05ea\u05de\u05e9 \u05d1\u05de\u05d9\u05dd \u05dc\u05e6\u05d5\u05e8\u05db\u05d9 \u05e8\u05d7\u05e6\u05d4 \u05d5\u05e1\u05e0\u05d9\u05d8\u05e6\u05d9\u05d4. \u05d4\u05d4\u05e0\u05d7\u05d9\u05d4 \u05ea\u05e7\u05e4\u05d4 \u05e2\u05d3 \u05dc\u05d4\u05d5\u05d3\u05e2\u05d4 \u05d7\u05d3\u05e9\u05d4@N12chat"],["\u05de\u05d6\u05d2 \u05d4\u05d0\u05d5\u05d5\u05d9\u05e8 \u05d4\u05e0\u05d5\u05db\u05d7\u05d9 \u05dc\u05d0 \u05de\u05d9\u05d8\u05d9\u05d1 \u05e2\u05dd \u05d3\u05e8\u05d9 \u05d4\u05d0\u05d5\u05d4\u05dc\u05d9\u05dd \u05d1\u05d3\u05e8\u05d5\u05dd \u05d4\u05e8\u05e6\u05d5\u05e2\u05d4. \u05e8\u05d1\u05d9\u05dd \u05de\u05d0\u05d5\u05d4\u05dc\u05d9 \u05d4\u05e2\u05e7\u05d5\u05e8\u05d9\u05dd \u05d4\u05d5\u05e6\u05e4\u05d5 \u05d4\u05dc\u05d9\u05dc\u05d4.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,31,"\u05de\u05d6\u05d2 \u05d4\u05d0\u05d5\u05d5\u05d9\u05e8 \u05d4\u05e0\u05d5\u05db\u05d7\u05d9 \u05dc\u05d0 \u05de\u05d9\u05d8\u05d9\u05d1 \u05e2\u05dd \u05d3\u05e8\u05d9 \u05d4\u05d0\u05d5\u05d4\u05dc\u05d9\u05dd \u05d1\u05d3\u05e8\u05d5\u05dd \u05d4\u05e8\u05e6\u05d5\u05e2\u05d4. \u05e8\u05d1\u05d9\u05dd \u05de\u05d0\u05d5\u05d4\u05dc\u05d9 \u05d4\u05e2\u05e7\u05d5\u05e8\u05d9\u05dd \u05d4\u05d5\u05e6\u05e4\u05d5 \u05d4\u05dc\u05d9\u05dc\u05d4.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05d1\u05ea\u05de\u05d5\u05e0\u05ea\u05d5 \u05e9\u05dc \u05d4\u05e8\u05d1 \u05dc\u05d6\u05e8, \u05d0\u05d7\u05e8\u05d9 \u05e9\u05e2\u05d1\u05e8\u05d4 \u05e4\u05d5\u05d8\u05d5\u05e9\u05d5\u05e4, \u05d4\u05e9\u05ea\u05de\u05e9\u05d5 \u05d1\u05d7\u05d5\u05d3\u05e9 \u05e9\u05e2\u05d1\u05e8 \u05db\u05dc\u05d9 \u05ea\u05e7\u05e9\u05d5\u05e8\u05ea \u05d0\u05d9\u05e8\u05d0\u05e0\u05d9\u05dd \u05e8\u05e9\u05de\u05d9\u05d9\u05dd \u05db\u05d3\u05d9 \u05dc\u05e0\u05e1\u05d5\u05ea \u05dc\u05d4\u05e4\u05dc\u05d9\u05dc \u05d0\u05d9\u05e9 \u05e2\u05e1\u05e7\u05d9\u05dd \u05db\u05d5\u05e8\u05d3\u05d9 \u05d1\u05e7\u05e9\u05e8\u05d9\u05dd \u05d3\u05de\u05d9\u05d5\u05e0\u05d9\u05d9\u05dd \u05e2\u05dd \"\u05d4\u05de\u05d5\u05e1\u05d3 \u05d4\u05d9\u05e9\u05e8\u05d0\u05dc\u05d9\"..\ud83d\udc46\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,32,"\u05d1\u05ea\u05de\u05d5\u05e0\u05ea\u05d5 \u05e9\u05dc \u05d4\u05e8\u05d1 \u05dc\u05d6\u05e8, \u05d0\u05d7\u05e8\u05d9 \u05e9\u05e2\u05d1\u05e8\u05d4 \u05e4\u05d5\u05d8\u05d5\u05e9\u05d5\u05e4, \u05d4\u05e9\u05ea\u05de\u05e9\u05d5 \u05d1\u05d7\u05d5\u05d3\u05e9 \u05e9\u05e2\u05d1\u05e8 \u05db\u05dc\u05d9 \u05ea\u05e7\u05e9\u05d5\u05e8\u05ea \u05d0\u05d9\u05e8\u05d0\u05e0\u05d9\u05dd \u05e8\u05e9\u05de\u05d9\u05d9\u05dd \u05db\u05d3\u05d9 \u05dc\u05e0\u05e1\u05d5\u05ea \u05dc\u05d4\u05e4\u05dc\u05d9\u05dc \u05d0\u05d9\u05e9 \u05e2\u05e1\u05e7\u05d9\u05dd \u05db\u05d5\u05e8\u05d3\u05d9 \u05d1\u05e7\u05e9\u05e8\u05d9\u05dd \u05d3\u05de\u05d9\u05d5\u05e0\u05d9\u05d9\u05dd \u05e2\u05dd \"\u05d4\u05de\u05d5\u05e1\u05d3 \u05d4\u05d9\u05e9\u05e8\u05d0\u05dc\u05d9\"..\ud83d\udc46\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05d1\u05d4\u05de\u05e9\u05da \u05dc\u05d4\u05ea\u05e8\u05e2\u05ea \u05e6\u05d1\u05e2 \u05d0\u05d3\u05d5\u05dd \u05d1\u05d2\u05d5\u05dc\u05df \u05de\u05e2\u05d8 \u05dc\u05e4\u05e0\u05d9 \u05d4\u05e9\u05e2\u05d4 20:00, \u05de\u05d3\u05d5\u05d5\u05d7\u05d9\u05dd \u05de\u05e7\u05d5\u05e8\u05d5\u05ea \u05d1\u05d2\u05d5\u05dc\u05df \u05d4\u05e1\u05d5\u05e8\u05d9 \u05db\u05d9 \u05d4\u05de\u05d9\u05dc\u05d9\u05e6\u05d9\u05d5\u05ea \u05d4\u05e4\u05e8\u05d5 \u05d0\u05d9\u05e8\u05d0\u05e \u05e9\u05d4\u05e6\u05d4\u05d9\u05e8 \u05db\u05d9 \u05de\u05d3\u05d5\u05d1\u05e8 \u05d1\u05d0\u05e8\u05d9\u05d6\u05d5\u05ea \u05e9\u05dc \u05e0\u05d5\u05d3\u05dc\u05e1. \u05e2\u05dc \u05e4\u05d9 \u05d4\u05d7\u05e9\u05d3, \u05db\u05da \u05d4\u05d5\u05d0 \u05e0\u05d9\u05e1\u05d4 \u05dc\u05d4\u05ea\u05d7\u05de\u05e7 \u05de\u05ea\u05e9\u05dc\u05d5\u05dd \u05de\u05e1\u05d9\u05dd \u05d1\u05e1\u05da \u05e9\u05dc \u05db-14 \u05de\u05d9\u05dc\u05d9\u05d5\u05df \u05e9\u05e7\u05dc\u05d9\u05dd. \u05d4\u05d7\u05e9\u05d5\u05d3 \u05d4\u05d5\u05d1\u05d0 \u05d1\u05e4\u05e0\u05d9 \u05d1\u05d9\u05ea \u05de\u05e9\u05e4\u05d8 \u05d5\u05e9\u05d5\u05d7\u05e8\u05e8 \u05d1\u05ea\u05e0\u05d0\u05d9\u05dd \u05de\u05d2\u05d1\u05d9\u05dc\u05d9\u05dd. \u05e6\u05d9\u05dc\u05d5\u05dd: \u05d3\u05d5\u05d1\u05e8\u05d5\u05ea \u05e8\u05e9\u05d5\u05ea \u05d4\u05de\u05d9\u05e1\u05d9\u05dd@N12chat"],["\u05d0\u05e1\u05e3 \u05e8\u05d5\u05d6\u05e0\u05e6\u05d5\u05d9\u05d9\u05d2\u05de\u05e0\u05d4\u05d9\u05d2 \u05d0\u05d9\u05e8\u05d0\u05df \u05e2\u05dc\u05d9 \u05d7'\u05d0\u05de\u05e0\u05d0\u05d9 \u05d1\u05e4\u05d2\u05d9\u05e9\u05d4 \u05e2\u05dd \u05d1\u05e0\u05d9 \u05de\u05e9\u05e4\u05d7\u05ea\u05d5 \u05e9\u05dc \u05e7\u05d0\u05e1\u05dd \u05e1\u05d5\u05dc\u05d9\u05de\u05d0\u05e0\u05d9 \u05dc\u05e6\u05d9\u05d5\u05df \u05d0\u05e8\u05d1\u05e2 \u05e9\u05e0\u05d9\u05dd \u05dc\u05d7\u05d9\u05e1\u05d5\u05dc\u05d5 \u05d4\u05e9\u05d1\u05d5\u05e2: \"\u05ea\u05e4\u05e7\u05d9\u05d3 \u05d7\u05d9\u05d9\u05d5 \u05d4\u05d9\u05d4 \u05d4\u05d7\u05d9\u05d9\u05d0\u05ea \u05d7\u05d6\u05d9\u05ea \u05d4\u05d4\u05ea\u05e0\u05d2\u05d3\u05d5\u05ea \u05d1\u05d0\u05d6\u05d5\u05e8. \u05d4\u05d4\u05ea\u05e0\u05d2\u05d3\u05d5\u05ea \u05d1\u05e2\u05d6\u05d4 \u05d1\u05e9\u05dc\u05d5\u05e9\u05ea \u05d4\u05d7\u05d5\u05d3\u05e9\u05d9\u05dd \u05d4\u05d0\u05d7\u05e8\u05d5\u05e0\u05d9\u05dd \u05de\u05d2\u05d9\u05e2\u05d4 \u05d1\u05e2\u05e7\u05d1\u05d5\u05ea \u05e7\u05d9\u05d5\u05dd \u05d7\u05d6\u05d9\u05ea \u05d4\u05d4\u05ea\u05e0\u05d2\u05d3\u05d5\u 05d9\u05e0\u05d4 \u05e9\u05dc\u05db\u05dd \u05e2\u05dd\u05e0\u05d5\u05d7\u05d5\u05ea \u05e9\u05d0\u05d9\u05df \u05db\u05de\u05d5\u05ea\u05d4\u05d5\u05e2\u05d9\u05e6\u05d5\u05d1\u05d9\u05d5\u05e6\u05d0 \u05de\u05df \u05d4\u05db\u05dc\u05dc.\u05de\u05d6\u05e8\u05df Hyatt Hotel\u2013 \u05d4\u05de\u05d6\u05e8\u05df \u05d4\u05e8\u05e9\u05de\u05d9 \u05e9\u05dc\u05e1\u05d5\u05d5\u05d9\u05d8\u05d5\u05ea \u05d4\u05d9\u05d5\u05e7\u05e8\u05d4\u05d1\u05de\u05dc\u05d5\u05e0\u05d5\u05ea Hyatt \u05d1\u05e2\u05d5\u05dc\u05dd!\ud83d\udca4\u05d8\u05db\u05e0\u05d5\u05dc\u05d5\u05d2\u05d9\u05d9\u05ea\u2122Posturpedic\u05dc\u05ea\u05de\u05d9\u05db\u05d4 \u05de\u05d5\u05e9\u05dc\u05de\u05ea \u05d1\u05d2\u05d1.\u2744\ufe0f\u05e9\u05db\u05d1\u05eaSealy Visco Gel\u05dc\u05d5\u05d5\u05d9\u05e1\u05d5\u05ea \u05d8\u05de\u05e4\u05e8\u05d8\u05d5\u05e8\u05d4 \u05d5\u05de\u05e0\u05d9\u05e2\u05ea \u05d4\u05d6\u05e2\u05d4 \u05d1\u05dc\u05d9\u05dc\u05d4.\ud83d\udd17\u05dc\u05d4\u05d6\u05de\u05e0\u05d4 \u05de\u05d4\u05d9\u05e8\u05d4 \u05d1\u05d0\u05ea\u05e8\u003e\u003ehttps:\u002f\u002fbit.ly\u002f4eEsyZk\ud83d\ude9b\u05e2\u05dc\u05d5\u05ea \u05d4\u05d5\u05d1\u05dc\u05d4 \u05d5\u05d4\u05e8\u05db\u05d1\u05d4 \u2013450 \u20aa(\u05db\u05dc\u05d5\u05dc \u05d1\u05de\u05d7\u05d9\u05e8)\ud83d\udccf\u05d4\u05de\u05d7\u05d9\u05e8 \u05de\u05ea\u05d9\u05d9\u05d7\u05e1 \u05dc\u05de\u05d9\u05d3\u05d4160\u002f200(\u05e7\u05d9\u05d9\u05de\u05d5\u05ea \u05de\u05d9\u05d3\u05d5\u05ea \u05e0\u05d5\u05e1\u05e4\u05d5\u05ea).\u05d0\u05dc \u05ea\u05d7\u05db\u05d5 \u2013 \u05e9\u05d3\u05e8\u05d2\u05d5 \u05d0\u05ea \u05d7\u05d3\u05e8 \u05d4\u05e9\u05d9\u05e0\u05d4 \u05e9\u05dc\u05db\u05dd \u05e2\u05db\u05e9\u05d9\u05d5!\ud83d\udd25"],["\u05de\u05d1\u05d6\u05e7\u05df 12\u05e8\u05d0\u05e9 \u05d4\u05d0\u05d5\u05e4\u05d5\u05d6\u05d9\u05e6\u05d9\u05d4 \u05dc\u05e4\u05d9\u05d3: \"\u05db\u05dc \u05d3\u05d1\u05e8 \u05e9\u05d1\u05d5 \u05d4\u05de\u05de\u05e9\u05dc\u05d4 \u05de\u05db\u05e8\u05e1\u05de\u05ea \u05d1\u05e2\u05e6\u05de\u05d0\u05d5\u05ea \u05d4\u05e9\u05d9\u05e4\u05d5\u05d8\u05d9\u05ea \u05d1\u05d9\u05e9\u05e8\u05d0\u05dc, \u05de\u05db\u05e8\u05e1\u05dd \u05d1\u05d9\u05db\u05d5\u05dc\u05ea \u05dc\u05d4\u05d2\u05df \u05e2\u05dc \u05d4\u05dc\u05d5\u05d7\u05de\u05d9\u05dd \u05e9\u05dc\u05e0\u05d5 \u05d1\u05d4\u05d0\u05d2. \u05d4\u05d8\u05e2\u05e0\u05d4 \u05d4\u05d9\u05e9\u05e8\u05d0\u05dc\u05d9\u05ea \u05d4\u05d9\u05d9\u05ea\u05d4, '\u05d0\u05e0\u05d5 \u05d9\u05d5\u05d3\u05e2\u05d9\u05dd \u05dc\u05e4\u05e7\u05d7 \u05de\u05e9\u05e4\u05d8\u05d9\u05ea \u05e2\u05dc \u05e2\u05e6\u05de\u05e0\u05d5'. \u05de\u05d4\u05d1\u05d7\u05d9\u05e0\u05d4 \u05d4\u05d6\u05d5, \u05d4\u05d9\u05db\u05d5\u05dc\u05ea \u05dc\u05d4\u05d2\u05df \u05e2\u05dc \u05d4\u05dc\u05d5\u05d7\u05de\u05d9\u05dd \u05e9\u05dc\u05e0\u05d5 \u05d4\u05e9\u05ea\u05e4\u05e8\u05d4 \u05d0\u05ea\u05de\u05d5\u05dc \u05d1\u05e2\u05e8\u05d1 \u05d1\u05d0\u05d5\u05e4\u05df \u05de\u05e9\u05de\u05e2\u05d5\u05ea\u05d9\". \u05d0\u05ea \u05d4\u05d3\u05d1\u05e8\u05d9\u05dd \u05d0\u05de\u05e8 \u05d1\u05ea\u05d5\u05db\u05e0\u05d9\u05ea \u05e9\u05d1\u05e2 \u05ea\u05e9\u05e2 \u05e2\u05dd \u05d0\u05d5\u05d3\u05d9 \u05e1\u05d2\u05dc \u05d5\u05e2\u05e0\u05ea \u05d3\u05d5\u05d9\u05d3\u05d5\u05d1 \u05d1-103FM@N12chat",false,61,"\u05de\u05d1\u05d6\u05e7\u05df 12\u05e8\u05d0\u05e9 \u05d4\u05d0\u05d5\u05e4\u05d5\u05d6\u05d9\u05e6\u05d9\u05d4 \u05dc\u05e4\u05d9\u05d3: \"\u05db\u05dc \u05d3\u05d1\u05e8 \u05e9\u05d1\u05d5 \u05d4\u05de\u05de\u05e9\u05dc\u05d4 \u05de\u05db\u05e8\u05e1\u05de\u05ea \u05d1\u05e2\u05e6\u05de\u05d0\u05d5\u05ea \u05d4\u05e9\u05d9\u05e4\u05d5\u05d8\u05d9\u05ea \u05d1\u05d9\u05e9\u05e8\u05d0\u05dc, \u05de\u05db\u05e8\u05e1\u05dd \u05d1\u05d9\u05db\u05d5\u05dc\u05ea \u05dc\u05d4\u05d2\u05df \u05e2\u05dc \u05d4\u05dc\u05d5\u05d7\u05de\u05d9\u05dd \u05e9\u05dc\u05e0\u05d5 \u05d1\u05d4\u05d0\u05d2. \u05d4\u05d8\u05e2\u05e0\u05d4 \u05d4\u05d9\u05e9\u05e8\u05d0\u05dc\u05d9\u05ea \u05d4\u05d9\u05d9\u05ea\u05d4, '\u05d0\u05e0\u05d5 \u05d9\u05d5\u05d3\u05e2\u05d9\u05dd \u05dc\u05e4\u05e7\u05d7 \u05de\u05e9\u05e4\u05d8\u05d9\u05ea \u05e2\u05dc \u05e2\u05e6\u05de\u05e0\u05d5'. \u05de\u05d4\u05d1\u05d7\u05d9\u05e0\u05d4 \u05d4\u05d6\u05d5, \u05d4\u05d9\u05db\u05d5\u05dc\u05ea \u05dc\u05d4\u05d2\u05df \u05e2\u05dc \u05d4\u05dc\u05d5\u05d7\u05de\u05d9\u05dd \u05e9\u05dc\u05e0\u05d5 \u05d4\u05e9\u05ea\u05e4\u05e8\u05d4 \u05d0\u05ea\u05de\u05d5\u05dc \u05d1\u05e2\u05e8\u05d1 \u05d1\u05d0\u05d5\u05e4\u05df \u05de\u05e9\u05de\u05e2\u05d5\u05ea\u05d9\". \u05d0\u05ea \u05d4\u05d3\u05d1\u05e8\u05d9\u05dd \u05d0\u05de\u05e8 \u05d1\u05ea\u05d5\u05db\u05e0\u05d9\u05ea \u05e9\u05d1\u05e2 \u05ea\u05e9\u05e2 \u05e2\u05dd \u05d0\u05d5\u05d3\u05d9 \u05e1\u05d2\u05dc \u05d5\u05e2\u05e0\u05ea \u05d3\u05d5\u05d9\u05d3\u05d5\u05d1 \u05d1-103FM@N12chat"],["\u05de\u05d1\u05d6\u05e7\u05df 12\u05ea\u05d9\u05e2\u05d5\u05d3 \u05de\u05e7\u05e8\u05d9\u05d9\u05ea \u05d9\u05dd. \u05e6\u05d9\u05dc\u05d5\u05dd: \u05d0\u05d9\u05ea\u05df \u05e9\u05e7\u05d3@N12chat",false,62,"\u05de\u05d1\u05d6\u05e7\u05df 12\u05ea\u05d9\u05e2\u05d5\u05d3 \u05de\u05e7\u05e8\u05d9\u05d9\u05ea \u05d9\u05dd. \u05e6\u05d9\u05dc\u05d5\u05dd: \u05d0\u05d9\u05ea\u05df \u05e9\u05e7\u05d3@N12chat"],["\u05d0\u05e8\u05d4\"\u05d1: \u05de\u05e4\u05d2\u05d9\u05e0\u05d9\u05dd \u05d0\u05e0\u05d8\u05d9 \u05d9\u05e9\u05e8\u05d0\u05dc\u05d9\u05dd \u05d4\u05e6\u05dc\u05d9\u05d7\u05d5 \u05dc\u05d4\u05e1\u05ea\u05e0\u05df \u05dc\u05d1\u05e0\u05d9\u05d9\u05df \u05d4\u05e7\u05e4\u05d9\u05d8\u05d5\u05dc \u05d5\u05dc\u05e7\u05d9\u05d9\u05dd \u05d4\u05e4\u05d2\u05e0\u05d4 \u05d1\u05dc\u05ea\u05d9 \u05d7\u05d5\u05e7\u05d9\u05ea \u05d1\u05e7\u05e8\u05d9\u05d0\u05d4 \u05dc\u05d4\u05e4\u05e1\u05e7\u05ea \u05d0\u05e9 \u05d1\u05e2\u05d6\u05d4.User sent a document",false,63,"\u05d0\u05e8\u05d4\"\u05d1: \u05de\u05e4\u05d2\u05d9\u05e0\u05d9\u05dd \u05d0\u05e0\u05d8\u05d9 \u05d9\u05e9\u05e8\u05d0\u05dc\u05d9\u05dd \u05d4\u05e6\u05dc\u05d9\u05d7\u05d5 \u05dc\u05d4\u05e1\u05ea\u05e0\u05df \u05dc\u05d1\u05e0\u05d9\u05d9\u05df \u05d4\u05e7\u05e4\u05d9\u05d8\u05d5\u05dc \u05d5\u05dc\u05e7\u05d9\u05d9\u05dd \u05d4\u05e4\u05d2\u05e0\u05d4 \u05d1\u05dc\u05ea\u05d9 \u05d7\u05d5\u05e7\u05d9\u05ea \u05d1\u05e7\u05e8\u05d9\u05d0\u05d4 \u05dc\u05d4\u05e4\u05e1\u05e7\u05ea \u05d0\u05e9 \u05d1\u05e2\u05d6\u05d4.User sent a document"],["\u05d0\u05dc\u05de\u05d9\u05d0\u05d3\u05d9\u05df \u05d4\u05dc\u05d1\u05e0\u05d5\u05e0\u05d9: \u05ea\u05e7\u05d9\u05e4\u05d5\u05ea \u05d0\u05de\u05e8\u05d9\u05e7\u05d0\u05d9\u05d5\u05ea - \u05d1\u05e8\u05d9\u05d8\u05d9\u05d5\u05ea \u05e2\u05dc \u05d0\u05d6\u05d5\u05e8 \u05d0\u05dc\u05db\u05ea'\u05d9\u05d1 \u05d1\u05de\u05d7\u05d5\u05d6 \u05d7\u05d5\u05d3\u05d9\u05d3\u05d4 \u05d1\u05ea\u05d9\u05de\u05df (\u05d0\u05d6\u05d5\u05e8 \u05d4\u05e0\u05de\u05e6\u05d0 \u05d1\u05e9\u05dc\u05d9\u05d8\u05ea \u05d4\u05d7\u05d5\u05ea'\u05d9\u05dd).  \u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,64,"\u05d0\u05dc\u05de\u05d9\u05d0\u05d3\u05d9\u05df \u05d4\u05dc\u05d1\u05e0\u05d5\u05e0\u05d9: \u05ea\u05e7\u05d9\u05e4\u05d5\u05ea \u05d0\u05de\u05e8\u05d9\u05e7\u05d0\u05d9\u05d5\u05ea - \u05d1\u05e8\u05d9\u05d8\u05d9\u05d5\u05ea \u05e2\u05dc \u05d0\u05d6\u05d5\u05e8 \u05d0\u05dc\u05db\u05ea'\u05d9\u05d1 \u05d1\u05de\u05d7\u05d5\u05d6 \u05d7\u05d5\u05d3\u05d9\u05d3\u05d4 \u05d1\u05ea\u05d9\u05de\u05df (\u05d0\u05d6\u05d5\u05e8 \u05d4\u05e0\u05de\u05e6\u05d0 \u05d1\u05e9\u05dc\u05d9\u05d8\u05ea \u05d4\u05d7\u05d5\u05ea'\u05d9\u05dd).  \u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05e2\u05d5\u05d3 \u05d1\u05d4\u05e7\u05e9\u05e8 \u05d3\u05d9\u05dc\u05d5\u05dc \u05d4\u05db\u05d5\u05d7\u05d5\u05ea \u05d1\u05e8\u05e6\u05d5\u05e2\u05d4, \u05e2\u05d3\u05db\u05df \u05e2\u05e8\u05d5\u05e5 \u05d0\u05dc\u05e7\u05d3\u05e1 \u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9 \u05db\u05d9 \u05d4\u05d9\u05d5\u05dd \u05e0\u05d9\u05ea\u05df \u05d4\u05d9\u05d4 \u05dc\u05d4\u05d1\u05d7\u05d9\u05df \u05d1\u05d9\u05e6\u05d9\u05d0\u05ea \u05db\u05d5\u05d7\u05d5\u05ea \u05de\u05ea\u05de\u05e8\u05e0\u05d9\u05dd \u05de\u05e6\u05e4\u05d5\u05df \u05de\u05e2\u05e8\u05d1 \u05d4\u05e2\u05d9\u05e8 \u05e2\u05d6\u05d4 \u05d5\u05d1\u05db\u05dc\u05dc \u05d6\u05d4 \u05de\u05e9\u05db\u05d5\u05e0\u05ea \u05e0\u05e6\u05e8, \u05d0\u05d6\u05d5\u05e8 \u05de\u05e7\u05d5\u05e1\u05d9, \u05d0\u05d6\u05d5\u05e8 \u05d1\u05d9\u05ea \u05d4\u05d7\u05d5\u05dc\u05d9\u05dd \u05e8\u05e0\u05ea\u05d9\u05e1\u05d9 \u05d5\u05e6\u05e4\u05d5\u05df \u05de\u05d7\u05e0\u05d4 \u05d4\u05e4\u05dc\u05d9\u05d8\u05d9\u05dd \u05e9\u05d0\u05d8\u05d9 (\u05db\u05d5\u05dc\u05dd \u05d1\u05e2\u05d9\u05e8 \u05e2\u05d6\u05d4), \u05d6\u05d0\u05ea \u05dc\u05e6\u05d3 \u05ea\u05e0\u05d5\u05e2\u05d4 \u05de\u05d5\u05e8\u05d2\u05e9\u05ea \u05e9\u05dc \u05db\u05d8\u05d1\"\u05de\u05d9\u05dd \u05d1\u05e9\u05de\u05d9 \u05d4\u05e2\u05d9\u05e8 \u05e9\u05d0\u05e3 \u05d1\u05d9\u05e6\u05e2\u05d5 \u05de\u05e2\u05ea \u05dc\u05e2\u05ea \u05d9\u05e8\u05d9 \u05dc\u05e2\u05d1\u05e8 \u05d4\u05ea\u05d5\u05e9\u05d1\u05d9\u05dd \u05d4\u05e2\u05d6\u05ea\u05d9\u05d9\u05dd.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,65,"\u05e2\u05d5\u05d3 \u05d1\u05d4\u05e7\u05e9\u05e8 \u05d3\u05d9\u05dc\u05d5\u05dc \u05d4\u05db\u05d5\u05d7\u05d5\u05ea \u05d1\u05e8\u05e6\u05d5\u05e2\u05d4, \u05e2\u05d3\u05db\u05df \u05e2\u05e8\u05d5\u05e5 \u05d0\u05dc\u05e7\u05d3\u05e1 \u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9 \u05db\u05d9 \u05d4\u05d9\u05d5\u05dd \u05e0\u05d9\u05ea\u05df \u05d4\u05d9\u05d4 \u05dc\u05d4\u05d1\u05d7\u05d9\u05df \u05d1\u05d9\u05e6\u05d9\u05d0\u05ea \u05db\u05d5\u05d7\u05d5\u05ea \u05de\u05ea\u05de\u05e8\u05e0\u05d9\u05dd \u05de\u05e6\u05e4\u05d5\u05df \u05de\u05e2\u05e8\u05d1 \u05d4\u05e2\u05d9\u05e8 \u05e2\u05d6\u05d4 \u05d5\u05d1\u05db\u05dc\u05dc \u05d6\u05d4 \u05de\u05e9\u05db\ u05d8\u05d9\u05e0\u05d9\u05ea\" \u05d9\u05d0\u05e1\u05e8 \u05e2\u05e8\u05e4\u05d0\u05ea.\u05d4\u05d9\u05d5\u05dd \u05e6\u05e4\u05d5\u05d9\u05d4 \u05dc\u05d4\u05e2\u05e8\u05da \u05d1\u05e1\u05e2\u05d5\u05d3\u05d9\u05d4 \u05d5\u05e2\u05d9\u05d3\u05d4 \u05d2\u05d3\u05d5\u05dc\u05d4 \u05e9\u05dc \u05e8\u05d0\u05e9\u05d9 \u05de\u05d3\u05d9\u05e0\u05d5\u05ea \u05e2\u05e8\u05d1 \u05d1\u05e2\u05e0\u05d9\u05d9\u05df \u05d4\u05de\u05dc\u05d7\u05de\u05d4 \u05d1\u05e2\u05d6\u05d4.\u05d4\u05d9\u05d5\u05dd \u05d1 15:00 \u05e6\u05e4\u05d5\u05d9 \u05e0\u05e1\u05e8\u05d0\u05dc\u05dc\u05d4 \u05dc\u05e0\u05d0\u05d5\u05dd \u05dc\u05e8\u05d2\u05dc \"\u05d9\u05d5\u05dd \u05d4\u05e9\u05d4\u05d9\u05d3\".\n",false,118,"11.11\u05d4\u05d9\u05d5\u05dd \u05de\u05e6\u05d9\u05d9\u05e0\u05d9\u05dd \u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd 19 \u05e9\u05e0\u05d4 \u05dc\u05de\u05d5\u05ea\u05d5 \u05e9\u05dc \"\u05de\u05e0\u05d4\u05d9\u05d2 \u05d4\u05d0\u05d5\u05de\u05d4 \u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05ea\" \u05d9\u05d0\u05e1\u05e8 \u05e2\u05e8\u05e4\u05d0\u05ea.\u05d4\u05d9\u05d5\u05dd \u05e6\u05e4\u05d5\u05d9\u05d4 \u05dc\u05d4\u05e2\u05e8\u05da \u05d1\u05e1\u05e2\u05d5\u05d3\u05d9\u05d4 \u05d5\u05e2\u05d9\u05d3\u05d4 \u05d2\u05d3\u05d5\u05dc\u05d4 \u05e9\u05dc \u05e8\u05d0\u05e9\u05d9 \u05de\u05d3\u05d9\u05e0\u05d5\u05ea \u05e2\u05e8\u05d1 \u05d1\u05e2\u05e0\u05d9\u05d9\u05df \u05d4\u05de\u05dc\u05d7\u05de\u05d4 \u05d1\u05e2\u05d6\u05d4.\u05d4\u05d9\u05d5\u05dd \u05d1 15:00 \u05e6\u05e4\u05d5\u05d9 \u05e0\u05e1\u05e8\u05d0\u05dc\u05dc\u05d4 \u05dc\u05e0\u05d0\u05d5\u05dd \u05dc\u05e8\u05d2\u05dc \"\u05d9\u05d5\u05dd \u05d4\u05e9\u05d4\u05d9\u05d3\".\n"],["\u05d1\u05d4\u05de\u05e9\u05da \u05dc\u05d3\u05d9\u05d5\u05d5\u05d7\u05d9\u05dd \u05e2\u05dc \u05d4\u05ea\u05e7\u05d9\u05e4\u05d4 \u05d4\u05d9\u05e9\u05e8\u05d0\u05dc\u05d9\u05ea \u05d1\u05d1\u05d9\u05ea \u05d9\u05d0\u05d7\u05d5\u05df \u05de\u05d5\u05e7\u05d3\u05dd \u05d9\u05d5\u05ea\u05e8, \u05d7\u05d6\u05d1\u05d0\u05dc\u05dc\u05d4 \u05de\u05d5\u05d3\u05d9\u05e2 \u05e2\u05dc \u05de\u05d5\u05ea\u05dd \u05e9\u05dc 3 \u05de\u05e4\u05e2\u05d9\u05dc\u05d9\u05d5:\u05e2\u05d1\u05d0\u05e1 \u05de\u05d7\u05de\u05d3 \u05e8\u05e2\u05d3 (\u05de\u05db\u05d5\u05e0\u05d4 \u05e1\u05e8\u05d0\u05d2')\u05d7'\u05dc\u05d9\u05dc \u05d2'\u05d5\u05d0\u05d3 \u05e9\u05d7\u05d9\u05de\u05d9 (\u05de\u05db\u05d5\u05e0\u05d4 \u05e1\u05e8\u05d0\u05d2')\u05d0\u05d7\u05de\u05d3 \u05de\u05e6\u05d8\u05e4\u05d0 (\u05de\u05db\u05d5\u05e0\u05d4 \u05de\u05dc\u05d0\u05db \u05d7\u05d5\u05dc\u05d0)\u05e1\u05d4\"\u05db 82 \u05d4\u05e8\u05d5\u05d2\u05d9\u05dd \u05e2\u05d3 \u05db\u05d4.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,119,"\u05d1\u05d4\u05de\u05e9\u05da \u05dc\u05d3\u05d9\u05d5\u05d5\u05d7\u05d9\u05dd \u05e2\u05dc \u05d4\u05ea\u05e7\u05d9\u05e4\u05d4 \u05d4\u05d9\u05e9\u05e8\u05d0\u05dc\u05d9\u05ea \u05d1\u05d1\u05d9\u05ea \u05d9\u05d0\u05d7\u05d5\u05df \u05de\u05d5\u05e7\u05d3\u05dd \u05d9\u05d5\u05ea\u05e8, \u05d7\u05d6\u05d1\u05d0\u05dc\u05dc\u05d4 \u05de\u05d5\u05d3\u05d9\u05e2 \u05e2\u05dc \u05de\u05d5\u05ea\u05dd \u05e9\u05dc 3 \u05de\u05e4\u05e2\u05d9\u05dc\u05d9\u05d5:\u05e2\u05d1\u05d0\u05e1 \u05de\u05d7\u05de\u05d3 \u05e8\u05e2\u05d3 (\u05de\u05db\u05d5\u05e0\u05d4 \u05e1\u05e8\u05d0\u05d2')\u05d7'\u05dc\u05d9\u05dc \u05d2'\u05d5\u05d0\u05d3 \u05e9\u05d7\u05d9\u05de\u05d9 (\u05de\u05db\u05d5\u05e0\u05d4 \u05e1\u05e8\u05d0\u05d2')\u05d0\u05d7\u05de\u05d3 \u05de\u05e6\u05d8\u05e4\u05d0 (\u05de\u05db\u05d5\u05e0\u05d4 \u05de\u05dc\u05d0\u05db \u05d7\u05d5\u05dc\u05d0)\u05e1\u05d4\"\u05db 82 \u05d4\u05e8\u05d5\u05d2\u05d9\u05dd \u05e2\u05d3 \u05db\u05d4.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05d1 25.12 \u05db\u05ea\u05d1\u05ea\u05d9 \u05dc\u05db\u05dd \u05db\u05d0\u05df\ud83d\udc46\u05e2\u05dc \u05e1\u05e8\u05d8\u05d5\u05df \u05e9\u05e4\u05e8\u05e1\u05de\u05d4 \u05d4\u05d6\u05e8\u05d5\u05e2 \u05d4\u05e6\u05d1\u05d0\u05d9\u05ea \u05e9\u05dc \u05d7\u05de\u05d0\u05e1 \u05d5\u05d1\u05d5 \u05e0\u05e8\u05d0\u05d4 \u05d9\u05e8\u05d9 \u05d8\u05d9\u05dc \u05dc\u05e2\u05d1\u05e8 \u05de\u05d1\u05e0\u05d4 \u05d1\u05d5 \u05e9\u05d4\u05d5 \u05d7\u05d9\u05d9\u05dc\u05d9 \u05e6\u05d4\"\u05dc \u05d1\u05e8\u05e6\u05d5\u05e2\u05d4 \u05d5\u05d1\u05e1\u05d5\u05e4\u05d5 \u05e7\u05d5\u05e8\u05d0 \u05d0\u05d7\u05d3 \u05de\u05de\u05d7\u05d1\u05dc\u05d9 \u05d7\u05de\u05d0\u05e1:\u062d\u0644\u0644 \u064a\u0627 \u062f\u0648\u064a\u0631\u064a!\u05ea\u05df \u05e4\u05e8\u05e9\u05e0\u05d5\u05ea \u05d9\u05d0 \u05d3\u05d5\u05d5\u05d9\u05e8\u05d9(\u05d4\u05d5\u05d0 \u05d4\u05ea\u05db\u05d5\u05d5\u05df \u05dc\u05e4\u05e8\u05e9\u05df \u05d4\u05e6\u05d1\u05d0\u05d9 \u05e9\u05dc \u05d0\u05dc\u05d2'\u05d6\u05d9\u05e8\u05d4 \u05e9\u05de\u05e4\u05e8\u05d2\u05df \u05d1\u05d4\u05d2\u05d6\u05de\u05d4 \u05dc\u05d7\u05de\u05d0\u05e1).\u05de\u05d0\u05d6 \u05d4\u05d1\u05d9\u05d8\u05d5\u05d9 \u05ea\u05e4\u05e1 \u05d1\u05e8\u05e9\u05ea\u05d5\u05ea \u05d4\u05d7\u05d1\u05e8\u05ea\u05d9\u05d5\u05ea \u05d1\u05e6\u05d5\u05e8\u05d4 \u05d7\u05e1\u05e8\u05ea \u05ea\u05e7\u05d3\u05d9\u05dd \u05d5\u05d6\u05db\u05d4 \u05dc\u05e2\u05e9\u05e8\u05d5\u05ea \u05de\u05d9\u05dc\u05d9\u05d5\u05e0\u05d9 \u05e9\u05d9\u05de\u05d5\u05e9\u05d9\u05dd \u05d1\u05d7\u05d5\u05d3\u05e9 \u05d4\u05d0\u05d7\u05e8\u05d5\u05df.\u05d4\u05d9\u05d5\u05dd \u05de\u05d3\u05d5\u05d5\u05d7\u05d9\u05dd \u05de\u05e7\u05d5\u05e8\u05d5\u05ea \u05e2\u05d6\u05ea\u05d9\u05d9\u05dd \u05db\u05d9 \u05e4\u05e2\u05d9\u05dc \u05d4\u05d7\u05de\u05d0\u05e1 \u05d4\u05d0\u05d7\u05e8\u05d0\u05d9 \u05dc\"\u05d4\u05de\u05e6\u05d0\u05ea \u05d4\u05d1\u05d9\u05d8\u05d5\u05d9\" \u05e9\u05e9\u05de\u05d5 \u05d4\u05d5\u05d0 \u05de\u05d4\u05e0\u05d3 \u05d2'\u05d9\u05d1\u05e8\u05d9\u05dc, \u05e0\u05d4\u05e8\u05d2 \u05d1\u05e7\u05e8\u05d1\u05d5\u05ea \u05de\u05d5\u05dc \u05e6\u05d4\"\u05dc.\u05d5\u05e2\u05dc \u05d6\u05d4 \u05e0\u05d0\u05de\u05e8:\u062d\u0644\u0644 \u064a\u0627 \u062f\u0648\u064a\u0631\u064a \u05ea\u05df \u05e4\u05e8\u05e9\u05e0\u05d5\u05ea \u05d9\u05d0 \u05d3\u05d5\u05d5\u05d9\u05e8\u05d9.\u05d4\u05de\u05d7\u05d1\u05dc \u05dc\u05d0 \u05d4\u05d7\u05d6\u05d9\u05e7 \u05de\u05e2\u05de\u05d3 \u05d7\u05d5\u05d3\u05e9 \u05de\u05d0\u05d6 \u05e9\u05d4\u05e4\u05da \u05e1\u05dc\u05d1 \u05d5\u05e2\u05d3 \u05e9\u05d7\u05d5\u05e1\u05dc \u05d1\u05d9\u05d3\u05d9 \u05e6\u05d4\"\u05dc...\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,120,"\u05d1 25.12 \u05db\u05ea\u05d1\u05ea\u05d9 \u05dc\u05db\u05dd \u05db\u05d0\u05df\ud83d\udc46\u05e2\u05dc \u05e1\u05e8\u05d8\u05d5\u05df \u05e9\u05e4\u05e8\u05e1\u05de\u05d4 \u05d4\u05d6\u05e8\u05d5\u05e2 \u05d4\u05e6\u05d1\u05d0\u05d9\u05ea \u05e9\u05dc \u05d7\u05de\u05d0\u05e1 \u05d5\u05d1\u05d5 \u05e0\u05e8\u05d0\u05d4 \u05d9\u05e8\u05d9 \u05d8\u05d9\u05dc \u05dc\u05e2\u05d1\u05e8 \u05de\u05d1\u05e0\u05d4 \u05d1\u05d5 \u05e9\u05d4\u05d5 \u05d7\u05d9\u05d9\u05dc\u05d9 \u05e6\u05d4\"\u05dc \u05d1\u05e8\u05e6\u05d5\u05e2\u05d4 \u05d5\u05d1\u05e1\u05d5\u05e4\u05d5 \u05e7\u05d5\u05e8\u05d0 \u05d0\u05d7\u05d3 \u05de\u05de\u05d7\u05d1\u05dc\u05d9 \u05d7\u05de\u05d0\u05e1:\u062d\u0644\u0644 \u064a\u0627 \u062f\u0648\u064a\u0631\u064a!\u05ea\u05df \u05e4\u05e8\u05e9\u05e0\u05d5\u05ea \u05d9\u05d0 \u05d3\u05d5\u05d5\u05d9\u05e8\u05d9(\u05d4\u05d5\u05d0 \u05d4\u05ea\u05db\u05d5\u05d5\u05df \u05dc\u05e4\u05e8\u05e9\u05df \u05d4\u05e6\u05d1\u05d0\u05d9 \u05e9\u05dc \u05d0\u05dc\u05d2'\u05d6\u05d9\u05e8\u05d4 \u05e9\u05de\u05e4\u05e8\u05d2\u05df \u05d1\u05d4\u05d2\u05d6\u05de\u05d4 \u05dc\u05d7\u05de\u05d0\u05e1).\u05de\u05d0\u05d6 \u05d4\u05d1\u05d9\u05d8\u05d5\u05d9 \u05ea\u05e4\u05e1 \u05d1\u05e8\u05e9\u05ea\u05d5\u05ea \u05d4\u05d7\u05d1\u05e8\u05ea\u05d9\u05d5\u05ea \u05d1\u05e6\u05d5\u05e8\u05d4 \u05d7\u05e1\u05e8\u05ea \u05ea\u05e7\u05d3\u05d9\u05dd \u05d5\u05d6\u05db\u05d4 \u05dc\u05e2\u05e9\u05e8\u05d5\u05ea \u05de\u05d9\u05dc\u05d9\u05d5\u05e0\u05d9 \u05e9\u05d9\u05de\u05d5\u05e9\u05d9\u05dd \u05d1\u05d7\u05d5\u05d3\u05e9 \u05d4\u05d0\u05d7\u05e8\u05d5\u05df.\u05d4\u05d9\u05d5\u05dd \u05de\u05d3\u05d5\u05d5\u05d7\u05d9\u05dd \u05de\u05e7\u05d5\u05e8\u05d5\u05ea \u05e2\u05d6\u05ea\u05d9\u05d9\u05dd \u05db\u05d9 \u05e4\u05e2\u05d9\u05dc \u05d4\u05d7\u05de\u05d0\u05e1 \u05d4\u05d0\u05d7\u05e8\u05d0\u05d9 \u05dc\"\u05d4\u05de\u05e6\u05d0\u05ea \u05d4\u05d1\u05d9\u05d8\u05d5\u05d9\" \u05e9\u05e9\u05de\u05d5 \u05d4\u05d5\u05d0 \u05de\u05d4\u05e0\u05d3 \u05d2'\u05d9\u05d1\u05e8\u05d9\u05dc, \u05e0\u05d4\u05e8\u05d2 \u05d1\u05e7\u05e8\u05d1\u05d5\u05ea \u05de\u05d5\u05dc \u05e6\u05d4\"\u05dc.\u05d5\u05e2\u05dc \u05d6\u05d4 \u05e0\u05d0\u05de\u05e8:\u062d\u0644\u0644 \u064a\u0627 \u062f\u0648\u064a\u0631\u064a \u05ea\u05df \u05e4\u05e8\u05e9\u05e0\u05d5\u05ea \u05d9\u05d0 \u05d3\u05d5\u05d5\u05d9\u05e8\u05d9.\u05d4\u05de\u05d7\u05d1\u05dc \u05dc\u05d0 \u05d4\u05d7\u05d6\u05d9\u05e7 \u05de\u05e2\u05de\u05d3 \u05d7\u05d5\u05d3\u05e9 \u05de\u05d0\u05d6 \u05e9\u05d4\u05e4\u05da \u05e1\u05dc\u05d1 \u05d5\u05e2\u05d3 \u05e9\u05d7\u05d5\u05e1\u05dc \u05d1\u05d9\u05d3\u05d9 \u05e6\u05d4\"\u05dc...\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05d0\u05d5\u05e0\u05e8\"\u05d0: \u05db\u05e0\u05d9\u05e1\u05ea \u05d4\u05e1\u05d9\u05d5\u05e2 \u05d4\u05d4\u05d5\u05de\u05e0\u05d9\u05d8\u05e8\u05d9 \u05dc\u05e8\u05e6\u05d5\u05e2\u05d4 \u05e0\u05de\u05e6\u05d0\u05ea \u05d1\u05e8\u05de\u05ea\u05d4 \u05d4\u05e0\u05de\u05d5\u05db\u05d4 \u05d1\u05d9\u05d5\u05ea\u05e8 \u05de\u05d6\u05d4 \u05d7\u05d5\u05d3\u05e9\u05d9\u05dd.\u05ea\u05d2\u05d5\u05d1\u05d4 \u05d0\u05d7\u05ea",false,121,"\u05d0\u05d5\u05e0\u05e8\"\u05d0: \u05db\u05e0\u05d9\u05e1\u05ea \u05d4\u05e1\u05d9\u05d5\u05e2 \u05d4\u05d4\u05d5\u05de\u05e0\u05d9\u05d8\u05e8\u05d9 \u05dc\u05e8\u05e6\u05d5\u05e2\u05d4 \u05e0\u05de\u05e6\u05d0\u05ea \u05d1\u05e8\u05de\u05ea\u05d4 \u05d4\u05e0\u05de\u05d5\u05db\u05d4 \u05d1\u05d9\u05d5\u05ea\u05e8 \u05de\u05d6\u05d4 \u05d7\u05d5\u05d3\u05e9\u05d9\u05dd.\u05ea\u05d2\u05d5\u05d1\u05d4 \u05d0\u05d7\u05ea"],["\u05d9\u05d0\u05e7\u05d5\u05d8\u05d9\u05d4, \u05e8\u05d5\u05e1\u05d9\u05d4: \u05e0\u05d7\u05e9\u05e3 \u05e4\u05d2\u05e8 \u05e9\u05dc \u05de\u05de\u05d5\u05ea\u05d4 \u05e6\u05e2\u05d9\u05e8\u05d4 \u05e9\u05d4\u05e9\u05ea\u05de\u05e8 \u05d1\u05de\u05e6\u05d1 \u05db\u05de\u05e2\u05d8 \u05e9\u05dc\u05dd.\u05e2\"\u05e4 \u05d4\u05e2\u05e8\u05db\u05d5\u05ea \u05d4\u05d7\u05d5\u05e7\u05e8\u05d9\u05dd \u05d1\u05e8\u05d5\u05e1\u05d9\u05d4 \u05d2\u05d9\u05dc\u05d4 \u05e9\u05dc \u05d4\u05de\u05de\u05d5\u05ea\u05d4 \u05d4\u05d5\u05d0 \u05db 50 \u05d0\u05dc\u05e3 \u05e9\u05e0\u05d4.\u05d1\u05e2\u05d5\u05dc\u05dd \u05d4\u05ea\u05d2\u05dc\u05d5 \u05e2\u05d3 \u05db\u05d4 6 \u05e4\u05d2\u05e8\u05d9 \u05de\u05de\u05d5\u05ea\u05d4 \u05de\u05ea\u05d5\u05db\u05dd 5 \u05d1\u05e8\u05d5\u05e1\u05d9\u05d4 \u05d5\u05d0\u05d7\u05d3 \u05d1\u05e7\u05e0\u05d3\u05d4.5 \u05ea\u05d2\u05d5\u05d1\u05d5\u05ea",false,122,"\u05d9\u05d0\u05e7\u05d5\u05d8\u05d9\u05d4, \u05e8\u05d5\u05e1\u05d9\u05d4: \u05e0\u05d7\u05e9\u05e3 \u05e4\u05d2\u05e8 \u05e9\u05dc \u05de\u05de\u05d5\u05ea\u05d4 \u05e6\u05e2\u05d9\u05e8\u05d4 \u05e9\u05d4\u05e9\u05ea\u05de\u05e8 \u05d1\u05de\u05e6\u05d1 \u05db\u05de\u05e2\u05d8 \u05e9\u05dc\u05dd.\u05e2\"\u05e4 \u05d4\u05e2\u05e8\u05db\u05d5\u05ea \u05d4\u05d7\u05d5\u05e7\u05e8\u05d9\u05dd \u05d1\u05e8\u05d5\u05e1\u05d9\u05d4 \u05d2\u05d9\u05dc\u05d4 \u05e9\u05dc \u05d4\u05de\u05de\u05d5\u05ea\u05d4 \u05d4\u05d5\u05d0 \u05db 50 \u05d0\u05dc\u05e3 \u05e9\u05e0\u05d4.\u05d1\u05e2\u05d5\u05dc\u05dd \u05d4\u05ea\u05d2\u05dc\u05d5 \u05e2\u05d3 \u05db\u05d4 6 \u05e4\u05d2\u05e8\u05d9 \u05de\u05de\u05d5\u05ea\u05d4 \u05de\u05ea\u05d5\u05db\u05dd 5 \u05d1\u05e8\u05d5\u05e1\u05d9\u05d4 \u05d5\u05d0\u05d7\u05d3 \u05d1\u05e7\u05e0\u05d3\u05d4.5 \u05ea\u05d2\u05d5\u05d1\u05d5\u05ea"],["\u05d7\u05de\u05d0\u05e1 \u05d1\u05db\u05e8\u05d5\u05d6 \u05d1\u05e2\u05e7\u05d1\u05d5\u05ea \u05d4\u05e4\u05e1\u05e7\u05ea \u05d4\u05d0\u05e9 \u05d1\u05dc\u05d1\u05e0\u05d5\u05df:\u05de\u05e9\u05d1\u05d7\u05d9\u05dd \u05d0\u05ea \u05d4\u05ea\u05e4\u05e7\u05d9\u05d3 \u05d4\u05de\u05e8\u05db\u05d6\u05d9 \u05e9\u05dc \"\u05d4\u05d4\u05ea\u05e0\u05d2\u05d3\u05d5\u05ea\" \u05d1\u05dc\u05d1\u05e0\u05d5\u05df \u05d1\u05ea\u05de\u05d9\u05db\u05d4 \u05d1\u05e2\u05d6\u05d4 \u05d5\u05d0\u05ea \u05d4\u05e7\u05d5\u05e8\u05d1\u05e0\u05d5\u05ea \u05e9\u05d4\u05e7\u05e8\u05d9\u05d1\u05d4 \u05d5\u05d1\u05e8\u05d0\u05e9\u05dd \u05d7\u05e1\u05df \u05e0\u05e1\u05e8\u05d0\u05dc\u05dc\u05d4.\u05d0\u05e0\u05d5 \u05de\u05d7\u05d5\u05d9\u05d9\u05d1\u05d9\u05dd \u05dc\u05e9\u05ea\u05e3 \u05e4\u05e2\u05d5\u05dc\u05d4 \u05e2\u05dd \u05db\u05dc \u05de\u05d0\u05de\u05e5 \u05dc\u05d4\u05e9\u05d2\u05ea \u05d4\u05e4\u05e1\u05e7\u05ea \u05d0\u05e9 \u05d1\u05e2\u05d6\u05d4 \u05d1\u05de\u05e1\u05d2\u05e8\u05ea \u05d4\u05ea\u05e0\u05d0\u05d9\u05dd \u05d4\u05d1\u05d0\u05d9\u05dd \u05e2\u05dc\u05d9\u05d4\u05dd \u05d9\u05e9 \u05d4\u05e1\u05db\u05de\u05d4 \u05dc\u05d0\u05d5\u05de\u05d9\u05ea:\u0648\u0647\u064a \u0648\u0642\u0641 \u0625\u0637\u0644\u0627\u0642 \u0627\u0644\u0646\u0627\u0631\u060c \u0648\u0627\u0646\u0633\u062d\u0627\u0628 \u0642\u0648\u0627\u062a \u0627\u0644\u0627\u062d\u062a\u0644\u0627\u0644\u060c \u0648\u0639\u0648\u062f\u0629 \u0627\u0644\u0646\u0627\u0632\u062d\u064a\u0646\u060c \u0648\u0627\u0646\u062c\u0627\u0632 \u0635\u0641\u0642\u0629 \u062a\u0628\u0627\u062f\u0644 \u0644\u0644\u0627\u0633\u0631\u0649 \u062d\u0642\u064a\u0642\u0629 \u0648\u0643\u0627\u0645\u0644\u0629.\u05d4\u05e4\u05e1\u05e7\u05ea \u05d0\u05e9, \u05e0\u05e1\u05d9\u05d2\u05ea \u05db\u05d5\u05d7\u05d5\u05ea \u05d4\u05db\u05d9\u05d1\u05d5\u05e9, \u05e9\u05d9\u05d1\u05ea \u05d4\u05e2\u05e7\u05d5\u05e8\u05d9\u05dd \u05d5\u05e2\u05e1\u05e7\u05ea \u05d0\u05e1\u05d9\u05e8\u05d9\u05dd \u05d0\u05de\u05d9\u05ea\u05d9\u05ea \u05d5\u05de\u05dc\u05d0\u05d4.###\u05d0\u05d9\u05df \u05e9\u05d9\u05e0\u05d5\u05d9 \u05d1\u05e8\u05d8\u05d5\u05e8\u05d9\u05e7\u05d4\u05d4\u05e4\u05d5\u05de\u05d1\u05d9\u05ea \u05e9\u05dc \u05d7\u05de\u05d0\u05e1 \u05d0\u05d5 \u05d1\u05de\u05d9\u05e0\u05d5\u05d7\u05d9\u05dd \u05d1\u05d4\u05dd \u05d4\u05d9\u05d0 \u05de\u05e9\u05ea\u05de\u05e9\u05ea \u05d5\u05d0\u05d9\u05df \u05e0\u05e1\u05d9\u05d2\u05d4 \u05de\u05d4\u05ea\u05e0\u05d0\u05d9\u05dd \u05d0\u05d5\u05ea\u05dd \u05d3\u05e8\u05e9\u05d4 \u05d1\u05e2\u05d1\u05e8.10 \u05ea\u05d2\u05d5\u05d1\u05d5\u05ea",false,123,"\u05d7\u05de\u05d0\u05e1 \u05d1\u05db\u05e8\u05d5\u05d6 \u05d1\u05e2\u05e7\u05d1\u05d5\u05ea \u05d4\u05e4\u05e1\u05e7\u05ea \u05d4\u05d0\u05e9 \u05d1\u05dc\u05d1\u05e0\u05d5\u05df:\u05de\u05e9\u05d1\u05d7\u05d9\u05dd \u05d0\u05ea \u05d4\u05ea\u05e4\u05e7\u05d9\u05d3 \u05d4\u05de\u05e8\u05db\u05d6\u05d9 \u05e9\u05dc \"\u05d4\u05d4\u05ea\u05e0\u05d2\u05d3\u05d5\u05ea\" \u05d1\u05dc\u05d1\u05e0\u05d5\u05df \u05d1\u05ea\u05de\u05d9\u05db\u05d4 \u05d1\u05e2\u05d6\u05d4 \u05d5\u05d0\u05ea \u05d4\u05e7\u05d5\u05e8\u05d1\u05e0\u05d5\u05ea \u05e9\u05d4\u05e7\u05e8\u05d9\u05d1\u05d4 \u05d5\u05d1\u05e8\u05d0\u05e9\u05dd \u05d7\u05e1\u05df \u05e0\u05e1\u05e8\u05d0\u05dc\u05dc\u05d4.\u05d0\u05e0\u05d5 \u05de\u05d7\u05d5\u05d9\u05d9\u05d1\u05d9\u05dd \u05dc\u05e9\u05ea\u05e3 \u05e4\u05e2\u05d5\u05dc\u05d4 \u05e2\u05dd \u05db\u05dc \u05de\u05d0\u05de\u05e5 \u05dc\u05d4\u05e9\u05d2\u05ea \u05d4\u05e4\u05e1\u05e7\u05ea \u05d0\u05e9 \u05d1\u05e2\u05d6\u05d4 \u05d1\u05de\u05e1\u05d2\u05e8\u05ea \u05d4\u05ea\u05e0\u05d0\u05d9\u05dd \u05d4\u05d1\u05d0\u05d9\u05dd \u05e2\u05dc\u05d9\u05d4\u05dd \u05d9\u05e9 \u05d4\u05e1\u05db\u05de\u05d4 \u05dc\u05d0\u05d5\u05de\u05d9\u05ea:\u0648\u0647\u064a \u0648\u0642\u0641 \u0625\u0637\u0644\u0627\u0642 \u0627\u0644\u0646\u0627\u0631\u060c \u0648\u0627\u0646\u0633\u062d\u0627\u0628 \u0642\u0648\u0627\u062a \u0627\u0644\u0627\u062d\u062a\u0644\u0627\u0644\u060c \u0648\u0639\u0648\u062f\u0629 \u0627\u0644\u0646\u0627\u0632\u062d\u064a\u0646\u060c \u0648\u0627\u0646\u062c\u0627\u0632 \u0635\u0641\u0642\u0629 \u062a\u0628\u0627\u062f\u0644 \u0644\u0644\u0627\u0633\u0631\u0649 \u062d\u0642\u064a\u0642\u0629 \u0648\u0643\u0627\u0645\u0644\u0629.\u05d4\u05e4\u05e1\u05e7\u05ea \u05d0\u05e9, \u05e0\u05e1\u05d9\u05d2\u05ea \u05db\u05d5\u05d7\u05d5\u05ea \u05d4\u05db\u05d9\u05d1\u05d5\u05e9, \u05e9\u05d9\u05d1\u05ea \u05d4\u05e2\u05e7\u05d5\u05e8\u05d9\u05dd \u05d5\u05e2\u05e1\u05e7\u05ea \u05d0\u05e1\u05d9\u05e8\u05d9\u05dd \u05d0\u05de\u05d9\u05ea\u05d9\u05ea \u05d5\u05de\u05dc\u05d0\u05d4.###\u05d0\u05d9\u05df \u05e9\u05d9\u05e0\u05d5\u05d9 \u05d1\u05e8\u05d8\u05d5\u05e8\u05d9\u05e7\u05d4\u05d4\u05e4\u05d5\u05de\u05d1\u05d9\u05ea \u05e9\u05dc \u05d7\u05de\u05d0\u05e1 \u05d0\u05d5 \u05d1\u05de\u05d9\u05e0\u05d5\u05d7\u05d9\u05dd \u05d1\u05d4\u05dd \u05d4\u05d9\u05d0 \u05de\u05e9\u05ea\u05de\u05e9\u05ea \u05d5\u05d0\u05d9\u05df \u05e0\u05e1\u05d9\u05d2\u05d4 \u05de\u05d4\u05ea\u05e0\u05d0\u05d9\u05dd \u05d0\u05d5\u05ea\u05dd \u05d3\u05e8\u05e9\u05d4 \u05d1\u05e2\u05d1\u05e8.10 \u05ea\u05d2\u05d5\u05d1\u05d5\u05ea"],["\u05de\u05d1\u05d6\u05e7\u05df 12\u05d7\u05d1\u05e8\u05ea \u05e0\u05ea\u05d9\u05d1\u05d9 \u05d0\u05d9\u05d9\u05dc\u05d5\u05df \u05d4\u05d5\u05d3\u05d9\u05e2\u05d4 \u05db\u05d9 \u05db\u05d1\u05d9\u05e9 20 \u05dc\u05db\u05d9\u05d5\u05d5\u05df \u05d3\u05e8\u05d5\u05dd \u05d9\u05d9\u05d7\u05e1\u05dd \u05d4\u05e8\u05de\u05d8\u05d9\u05ea \u05de\u05d7\u05e6\u05d5\u05ea \u05d5\u05e2\u05d3 \u05d4\u05e9\u05e2\u05d4 5 \u05d1\u05d1\u05d5\u05e7\u05e8 \u05de\u05de\u05d7\u05dc\u05e3 \u05d7\u05d5\u05e3 \u05d4\u05e9\u05e8\u05d5\u05df \u05d5\u05e2\u05d3 \u05dc\u05de\u05d7\u05dc\u05e3 \u05e9\u05de\u05e8\u05d9\u05d4\u05d5 \u05de\u05d6\u05e8\u05d7, \u05d1\u05e2\u05e7\u05d1\u05d5\u05ea \u05e2\u05d1\u05d5\u05d3\u05d5\u05ea \u05dc\u05d4\u05e0\u05e4\u05ea \u05de\u05e7\u05d8\u05e2\u05d9 \u05d2\u05e9\u05e8. \u05db\u05d1\u05d9\u05e9 2 \u05d9\u05d9\u05e9\u05d0\u05e8 \u05e4\u05ea\u05d5\u05d7 \u05dc\u05ea\u05e0\u05d5\u05e2\u05d4, \u05d5\u05d4\u05db\u05e0\u05d9\u05e1\u05d4 \u05dc\u05d0\u05d9\u05d9\u05dc\u05d5\u05df \u05d3\u05e8\u05d5\u05dd \u05de\u05db\u05d1\u05d9\u05e9 531 \u05ea\u05d9\u05e9\u05d0\u05e8 \u05e4\u05ea\u05d5\u05d7\u05d4 \u05d1\u05d6\u05de\u05df \u05d4\u05d7\u05e1\u05d9\u05de\u05d4. \u05d4\u05de\u05e4\u05d4 \u05d1\u05d0\u05d3\u05d9\u05d1\u05d5\u05ea \u05d7\u05d1\u05e8\u05ea \u05e0\u05ea\u05d9\u05d1\u05d9 \u05d0\u05d9\u05d9\u05dc\u05d5\u05df@N12chat",false,124,"\u05de\u05d1\u05d6\u05e7\u05df 12\u05d7\u05d1\u05e8\u05ea \u05e0\u05ea\u05d9\u05d1\u05d9 \u05d0\u05d9\u05d9\u05dc\u05d5\u05df \u05d4\u05d5\u05d3\u05d9\u05e2\u05d4 \u05db\u05d9 \u05db\u05d1\u05d9\u05e9 20 \u05dc\u05db\u05d9\u05d5\u05d5\u05df \u05d3\u05e8\u05d5\u05dd \u05d9\u05d9\u05d7\u05e1\u05dd \u05d4\u05e8\u05de\u05d8\u05d9\u05ea \u05de\u05d7\u05e6\u05d5\u05ea \u05d5\u05e2\u05d3 \u05d4\u05e9\u05e2\u05d4 5 \u05d1\u05d1\u05d5\u05e7\u05e8 \u05de\u05de\u05d7\u05dc\u05e3 \u05d7\u05d5\u05e3 \u05d4\u05e9\u05e8\u05d5\u05df \u05d5\u05e2\u05d3 \u05dc\u05de\u05d7\u05dc\u05e3 \u05e9\u05de\u05e8\u05d9\u05d4\u05d5 \u05de\u05d6\u05e8\u05d7, \u05d1\u05e2\u05e7\u05d1\u05d5\u05ea \u05e2\u05d1\u05d5\u05d3\u05d5\u05ea \u05dc\u05d4\u05e0\u05e4\u05ea \u05de\u05e7\u05d8\u05e2\u05d9 \u05d2\u05e9\u05e8. \u05db\u05d1\u05d9\u05e9 2 \u05d9\u05d9\u05e9\u05d0\u05e8 \u05e4\u05ea\u05d5\u05d7 \u05dc\u05ea\u05e0\u05d5\u05e2\u05d4, \u05d5\u05d4\u05db\u05e0\u05d9\u05e1\u05d4 \u05dc\u05d0\u05d9\u05d9\u05dc\u05d5\u05df \u05d3\u05e8\u05d5\u05dd \u05de\u05db\u05d1\u05d9\u05e9 531 \u05ea\u05d9\u05e9\u05d0\u05e8 \u05e4\u05ea\u05d5\u05d7\u05d4 \u05d1\u05d6\u05de\u05df \u05d4\u05d7\u05e1\u05d9\u05de\u05d4. \u05d4\u05de\u05e4\u05d4 \u05d1\u05d0\u05d3\u05d9\u05d1\u05d5\u05ea \u05d7\u05d1\u05e8\u05ea \u05e0\u05ea\u05d9\u05d1\u05d9 \u05d0\u05d9\u05d9\u05dc\u05d5\u05df@N12chat"],["\u05d1\u05df \u05d2\u05d5\u05dc\u05d3\u05e4\u05e8\u05d9\u05d9\u05e0\u05d3\u05db\u05d3\u05d5\u05e8\u05e1\u05dc: \u05dc\u05dc\u05d0 \u05d4\u05d6\u05e8\u05d9\u05dd \u05e9\u05e1\u05d9\u05e8\u05d1\u05d5 \u05dc\u05d7\u05d6\u05d5\u05e8 \u05dc\u05d9\u05e9\u05e8\u05d0\u05dc, \u05de\u05db\u05d1\u05d9 \u05ea\"\u05d0 \u05d4\u05e4\u05e1\u05d9\u05d3\u05d4 104:96 \u05dc\u05d4\u05e4\u05d5\u05e2\u05dc \u05d7\u05d9\u05e4\u05d4 \u05d1\u05dc\u05d9\u05d2\u05ea \u05d4\u05e2\u05dc@N12chat",false,125,"\u05d1\u05df \u05d2\u05d5\u05dc\u05d3\u05e4\u05e8\u05d9\u05d9\u05e0\u05d3\u05db\u05d3\u05d5\u05e8\u05e1\u05dc: \u05dc\u05dc\u05d0 \u05d4\u05d6\u05e8\u05d9\u05dd \u05e9\u05e1\u05d9\u05e8\u05d1\u05d5 \u05dc\u05d7\u05d6\u05d5\u05e8 \u05dc\u05d9\u05e9\u05e8\u05d0\u05dc, \u05de\u05db\u05d1\u05d9 \u05ea\"\u05d0 \u05d4\u05e4\u05e1\u05d9\u05d3\u05d4 104:96 \u05dc\u05d4\u05e4\u05d5\u05e2\u05dc \u05d7\u05d9\u05e4\u05d4 \u05d1\u05dc\u05d9\u05d2\u05ea \u05d4\u05e2\u05dc@N12chat"],["\u05e0\u05d9\u05e8 \u05d3\u05d1\u05d5\u05e8\u05d9\ud83d\udcdd\u05e4\u05e8\u05d8\u05d9\u05dd \u05d7\u05d3\u05e9\u05d9\u05dd \u05e2\u05dc \u05ea\u05e7\u05d9\u05e4\u05ea \u05d4\u05e1\u05e4\u05d9\u05e0\u05d4 \u05dc\u05d9\u05d3 \u05d4\u05d5\u05d3\u05d5 | \u05dc\u05e4\u05d9 \u05d4\u05e2\u05e8\u05db\u05d5\u05ea, \u05de\u05d3\u05d5\u05d1\u05e8 \u05d1\u05db\u05d8\u05d1\"\u05dd \u05e9\u05e9\u05d5\u05d2\u05e8 \u05d9\u05e9\u05d9\u05e8\u05d5\u05ea \u05de\u05d0\u05d9\u05e8\u05d0\u05df, \u05d5\u05dc\u05d0 \u05e2\u05dc \u05d9\u05d3\u05d9 \u05d4\u05d7\u05d5\u05ea'\u05d9\u05dd \u05de\u05de\u05e8\u05d7\u05d1 \u05d1\u05d0\u05d1 \u05d0\u05dc-\u05de\u05e0\u05d3\u05d1 \u05db\u05de\u05d5 \u05d1\u05d0\u05d9\u05e8\u05d5\u05e2\u05d9 \u05d4\u05ea\u05e7\u05d9\u05e4\u05d4 \u05d4\u05e7\u05d5\u05d3\u05de\u05d9\u05dd.\u00a0\u05d4\u05d0\u05d9\u05e8\u05d5\u05e2, \u05e9\u05e7\u05e8\u05d4 \u05d1\u05de\u05d4\u05dc\u05da \u05d4\u05dc\u05d9\u05dc\u05d4, \u05d4\u05d5\u05d0 \u05d4\u05de\u05e9\u05da \u05d9\u05e9\u05d9\u05e8 \u05dc\u05de\u05d0\u05de\u05e5 \u05d4\u05d0\u05d9\u05e8\u05d0\u05e0\u05d9-\u05d7\u05d5\u05ea'\u05d9 \u05dc\u05e9\u05d1\u05e9 \u05d0\u05ea \u05e0\u05ea\u05d9\u05d1\u05d9 \u05d4\u05e9\u05d9\u05d8 \u05d4\u05e2\u05d5\u05dc\u05de\u05d9\u05d9\u05dd@N12chat",false,126,"\u05e0\u05d9\u05e8 \u05d3\u05d1\u05d5\u05e8\u05d9\ud83d\udcdd\u05e4\u05e8\u05d8\u05d9\u05dd \u05d7\u05d3\u05e9\u05d9\u05dd \u05e2\u05dc \u05ea\u05e7\u05d9\u05e4\u05ea \u05d4\u05e1\u05e4\u05d9\u05e0\u05d4 \u05dc\u05d9\u05d3 \u05d4\u05d5\u05d3\u05d5 | \u05dc\u05e4\u05d9 \u05d4\u05e2\u05e8\u05db\u05d5\u05ea, \u05de\u05d3\u05d5\u05d1\u05e8 \u05d1\u05db\u05d8\u05d1\"\u05dd \u05e9\u05e9\u05d5\u05d2\u05e8 \u05d9\u05e9\u05d9\u05e8\u05d5\u05ea \u05de\u05d0\u05d9\u05e8\u05d0\u05df, \u05d5\u05dc\u05d0 \u05e2\u05dc \u05d9\u05d3\u05d9 \u05d4\u05d7\u05d5\u05ea'\u05d9\u05dd \u05de\u05de\u05e8\u05d7\u05d1 \u05d1\u05d0\u05d1 \u05d0\u05dc-\u05de\u05e0\u05d3\u05d1 \u05db\u05de\u05d5 \u05d1\u05d0\u05d9\u05e8\u05d5\u05e2\u05d9 \u05d4\u05ea\u05e7\u05d9\u05e4\u05d4 \u05d4\u05e7\u05d5\u05d3\u05de\u05d9\u05dd.\u00a0\u05d4\u05d0\u05d9\u05e8\u05d5\u05e2, \u05e9\u05e7\u05e8\u05d4 \u05d1\u05de\u05d4\u05dc\u05da \u05d4\u05dc\u05d9\u05dc\u05d4, \u05d4\u05d5\u05d0 \u05d4\u05de\u05e9\u05da \u05d9\u05e9\u05d9\u05e8 \u05dc\u05de\u05d0\u05de\u05e5 \u05d4\u05d0\u05d9\u05e8\u05d0\u05e0\u05d9-\u05d7\u05d5\u05ea'\u05d9 \u05dc\u05e9\u05d1\u05e9 \u05d0\u05ea \u05e0\u05ea\u05d9\u05d1\u05d9 \u05d4\u05e9\u05d9\u05d8 \u05d4\u05e2\u05d5\u05dc\u05de\u05d9\u05d9\u05dd@N12chat"],["\u05de\u05e7\u05d5\u05e8\u05d5\u05ea \u05dc\u05d1\u05e0\u05d5\u05e0\u05d9\u05d9\u05dd: \u05d9\u05e9\u05e8\u05d0\u05dc \u05ea\u05e7\u05e4\u05d4 \u05de\u05d4\u05d0\u05d5\u05d5\u05d9\u05e8 \u05d1\u05e9\u05e2\u05d4 \u05d4\u05d0\u05d7\u05e8\u05d5\u05e0\u05d4 \u05dc\u05d9\u05d3 \u05d4\u05db\u05e4\u05e8\u05d9\u05dd \u05d1\u05e1\u05ea\u05d0\u05df \u05d5\u05d9\u05d0\u05e8\u05d9\u05df \u05d1\u05d2\u05d6\u05e8\u05d4 \u05d4\u05de\u05e2\u05e8\u05d1\u05d9\u05ea \u05d1\u05d3\u05e8\u05d5\u05dd \u05dc\u05d1\u05e0\u05d5\u05df.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d 8\u05d4, \u05db\u05db\u05dc \u05d4\u05e0\u05e8\u05d0\u05d4 \u05d1\u05d0\u05de\u05e6\u05e2\u05d5\u05ea \u05e9\u05d0\u05e8\u05d9\u05d5\u05ea \u05de\u05d6\u05d5\u05df. \u05e2\u05dc \u05d1\u05e1\u05d9\u05e1 \u05ea\u05d7\u05e7\u05d9\u05e8 \u05d4\u05d0\u05d9\u05e8\u05d5\u05e2 \u05d1\u05e9\u05d8\u05d7, \u05e0\u05e8\u05d0\u05d4 \u05db\u05d9 \u05e9\u05dc\u05d5\u05e9\u05ea \u05d4\u05d7\u05d8\u05d5\u05e4\u05d9\u05dd \u05e9\u05d4\u05d5 \u05d1\u05de\u05d1\u05e0\u05d4 \u05d1\u05d5 \u05d0\u05d5\u05ea\u05e8\u05d5 \u05d4\u05e9\u05dc\u05d8\u05d9\u05dd, \u05dc\u05e4\u05d7\u05d5\u05ea \u05d7\u05dc\u05e7 \u05de\u05d4\u05d6\u05de\u05df.\u05ea\u05d7\u05e7\u05d9\u05e8 \u05d4\u05d0\u05d9\u05e8\u05d5\u05e2 \u05e0\u05de\u05e9\u05da.\u05e6\u05d4\"\u05dc \u05e2\u05d3\u05db\u05df \u05d0\u05ea \u05d4\u05de\u05e9\u05e4\u05d7\u05d5\u05ea \u05d1\u05de\u05de\u05e6\u05d0\u05d9\u05dd \u05d4\u05e0\u05d5\u05e1\u05e4\u05d9\u05dd \u05e9\u05d0\u05d5\u05ea\u05e8\u05d5 \u05e2\u05d3 \u05db\u05d4, \u05d5\u05d9\u05de\u05e9\u05d9\u05da \u05dc\u05e2\u05e9\u05d5\u05ea \u05db\u05df.\n",false,131,"\u05d3\u05d5\u05d1\u05e8 \u05e6\u05d4\u05f4\u05dc:\u05d1\u05d4\u05de\u05e9\u05da \u05dc\u05d0\u05d9\u05e8\u05d5\u05e2 \u05d4\u05d8\u05e8\u05d0\u05d2\u05d9 \u05d1\u05d5 \u05e0\u05d5\u05e8\u05d5 \u05d1\u05e9\u05d5\u05d2\u05d2 \u05e9\u05dc\u05d5\u05e9\u05d4 \u05d7\u05d8\u05d5\u05e4\u05d9\u05dd \u05d9\u05e9\u05e8\u05d0\u05dc\u05d9\u05dd \u05e2\u05dc \u05d9\u05d3\u05d9 \u05db\u05d5\u05d7 \u05e6\u05d4\"\u05dc, \u05d1\u05d5\u05e6\u05e2\u05d5 \u05e1\u05e8\u05d9\u05e7\u05d5\u05ea \u05d1\u05de\u05d1\u05e0\u05d4 \u05d4\u05e1\u05de\u05d5\u05da \u05dc\u05de\u05e7\u05d5\u05dd \u05d4\u05d0\u05d9\u05e8\u05d5\u05e2, \u05d5\u05d1\u05d5 \u05e9\u05dc\u05d8\u05d9\u05dd \u05e2\u05dc\u05d9\u05d4\u05dd \u05e0\u05db\u05ea\u05d1\u05d5 \u05e7\u05e8\u05d9\u05d0\u05d5\u05ea \u05dc\u05e2\u05d6\u05e8\u05d4, \u05db\u05db\u05dc \u05d4\u05e0\u05e8\u05d0\u05d4 \u05d1\u05d0\u05de\u05e6\u05e2\u05d5\u05ea \u05e9\u05d0\u05e8\u05d9\u05d5\u05ea \u05de\u05d6\u05d5\u05df. \u05e2\u05dc \u05d1\u05e1\u05d9\u05e1 \u05ea\u05d7\u05e7\u05d9\u05e8 \u05d4\u05d0\u05d9\u05e8\u05d5\u05e2 \u05d1\u05e9\u05d8\u05d7, \u05e0\u05e8\u05d0\u05d4 \u05db\u05d9 \u05e9\u05dc\u05d5\u05e9\u05ea \u05d4\u05d7\u05d8\u05d5\u05e4\u05d9\u05dd \u05e9\u05d4\u05d5 \u05d1\u05de\u05d1\u05e0\u05d4 \u05d1\u05d5 \u05d0\u05d5\u05ea\u05e8\u05d5 \u05d4\u05e9\u05dc\u05d8\u05d9\u05dd, \u05dc\u05e4\u05d7\u05d5\u05ea \u05d7\u05dc\u05e7 \u05de\u05d4\u05d6\u05de\u05df.\u05ea\u05d7\u05e7\u05d9\u05e8 \u05d4\u05d0\u05d9\u05e8\u05d5\u05e2 \u05e0\u05de\u05e9\u05da.\u05e6\u05d4\"\u05dc \u05e2\u05d3\u05db\u05df \u05d0\u05ea \u05d4\u05de\u05e9\u05e4\u05d7\u05d5\u05ea \u05d1\u05de\u05de\u05e6\u05d0\u05d9\u05dd \u05d4\u05e0\u05d5\u05e1\u05e4\u05d9\u05dd \u05e9\u05d0\u05d5\u05ea\u05e8\u05d5 \u05e2\u05d3 \u05db\u05d4, \u05d5\u05d9\u05de\u05e9\u05d9\u05da \u05dc\u05e2\u05e9\u05d5\u05ea \u05db\u05df.\n"],["\u05e2\u05de\u05d9\u05ea \u05d0\u05d8\u05d9\u05d0\u05e1\u05e1\u05e7\u05d5\u05d8\u05e8 \u05d1\u05e8\u05d0\u05d5\u05df, \u05d0\u05d7\u05d3 \u05d4\u05de\u05e0\u05d4\u05dc\u05d9\u05dd \u05d4\u05de\u05e9\u05e4\u05d9\u05e2\u05d9\u05dd \u05d1\u05ea\u05e2\u05e9\u05d9\u05d9\u05ea \u05d4\u05de\u05d5\u05d6\u05d9\u05e7\u05d4 \u05d4\u05e2\u05d5\u05dc\u05de\u05d9\u05ea, \u05e0\u05d7\u05ea \u05d1\u05d9\u05e9\u05e8\u05d0\u05dc \u05d5\u05d1\u05d9\u05e7\u05e8 \u05d1\u05db\u05e4\u05e8 \u05e2\u05d6\u05d4. \"\u05d1\u05d0\u05ea\u05d9 \u05dc\u05e8\u05d0\u05d5\u05ea \u05d0\u05ea \u05d6\u05d4 \u05d1\u05e2\u05e6\u05de\u05d9\", \u05db\u05ea\u05d1 \u05e2\u05dc \u05d2\u05d1\u05d9 \u05ea\u05d9\u05e2\u05d5\u05d3 \u05d0\u05d7\u05d3 \u05d4\u05d1\u05ea\u05d9\u05dd \u05d4\u05d7\u05e8\u05d1\u05d9\u05dd \u05e9\u05d4\u05e2\u05dc\u05d4 \u05dc\u05d7\u05e9\u05d1\u05d5\u05df \u05d4\u05d0\u05d9\u05e0\u05e1\u05d8\u05d2\u05e8\u05dd \u05e9\u05dc\u05d5@N12chat",false,132,"\u05e2\u05de\u05d9\u05ea \u05d0\u05d8\u05d9\u05d0\u05e1\u05e1\u05e7\u05d5\u05d8\u05e8 \u05d1\u05e8\u05d0\u05d5\u05df, \u05d0\u05d7\u05d3 \u05d4\u05de\u05e0\u05d4\u05dc\u05d9\u05dd \u05d4\u05de\u05e9\u05e4\u05d9\u05e2\u05d9\u05dd \u05d1\u05ea\u05e2\u05e9\u05d9\u05d9\u05ea \u05d4\u05de\u05d5\u05d6\u05d9\u05e7\u05d4 \u05d4\u05e2\u05d5\u05dc\u05de\u05d9\u05ea, \u05e0\u05d7\u05ea \u05d1\u05d9\u05e9\u05e8\u05d0\u05dc \u05d5\u05d1\u05d9\u05e7\u05e8 \u05d1\u05db\u05e4\u05e8 \u05e2\u05d6\u05d4. \"\u05d1\u05d0\u05ea\u05d9 \u05dc\u05e8\u05d0\u05d5\u05ea \u05d0\u05ea \u05d6\u05d4 \u05d1\u05e2\u05e6\u05de\u05d9\", \u05db\u05ea\u05d1 \u05e2\u05dc \u05d2\u05d1\u05d9 \u05ea\u05d9\u05e2\u05d5\u05d3 \u05d0\u05d7\u05d3 \u05d4\u05d1\u05ea\u05d9\u05dd \u05d4\u05d7\u05e8\u05d1\u05d9\u05dd \u05e9\u05d4\u05e2\u05dc\u05d4 \u05dc\u05d7\u05e9\u05d1\u05d5\u05df \u05d4\u05d0\u05d9\u05e0\u05e1\u05d8\u05d2\u05e8\u05dd \u05e9\u05dc\u05d5@N12chat"],["\u05d1\u05df \u05d2\u05d5\u05dc\u05d3\u05e4\u05e8\u05d9\u05d9\u05e0\u05d313 \u05e9\u05e0\u05d4 \u05dc\u05d0\u05d7\u05e8 \u05e9\u05e2\u05d6\u05d1 \u05d0\u05d5\u05ea\u05d4 \u05dc\u05e7\u05e8\u05d9\u05d9\u05e8\u05d4 \u05d0\u05d9\u05e8\u05d5\u05e4\u05d9\u05ea - \u05ea\u05d5\u05de\u05e8 \u05d7\u05de\u05d3 \u05d7\u05ea\u05dd \u05d1\u05de\u05db\u05d1\u05d9 \u05d7\u05d9\u05e4\u05d4 \u05e2\u05d3 \u05dc\u05ea\u05d5\u05dd \u05d4\u05e2\u05d5\u05e0\u05d4@N12chat",false,133,"\u05d1\u05df \u05d2\u05d5\u05dc\u05d3\u05e4\u05e8\u05d9\u05d9\u05e0\u05d313 \u05e9\u05e0\u05d4 \u05dc\u05d0\u05d7\u05e8 \u05e9\u05e2\u05d6\u05d1 \u05d0\u05d5\u05ea\u05d4 \u05dc\u05e7\u05e8\u05d9\u05d9\u05e8\u05d4 \u05d0\u05d9\u05e8\u05d5\u05e4\u05d9\u05ea - \u05ea\u05d5\u05de\u05e8 \u05d7\u05de\u05d3 \u05d7\u05ea\u05dd \u05d1\u05de\u05db\u05d1\u05d9 \u05d7\u05d9\u05e4\u05d4 \u05e2\u05d3 \u05dc\u05ea\u05d5\u05dd \u05d4\u05e2\u05d5\u05e0\u05d4@N12chat"],["\u05d3\u05e8\u05d5\u05dd \u05dc\u05d1\u05e0\u05d5\u05df: \u05de\u05d8\u05d5\u05e1\u05d9 \u05e7\u05e8\u05d1 \u05d9\u05e9\u05e8\u05d0\u05dc\u05d9\u05dd \u05ea\u05d5\u05e7\u05e4\u05d9\u05dd \u05d1\u05de\u05e8\u05db\u05d1\u05d0 \u05d5\u05d1\u05d9\u05ea \u05dc\u05d9\u05e3.\n",false,134,"\u05d3\u05e8\u05d5\u05dd \u05dc\u05d1\u05e0\u05d5\u05df: \u05de\u05d8\u05d5\u05e1\u05d9 \u05e7\u05e8\u05d1 \u05d9\u05e9\u05e8\u05d0\u05dc\u05d9\u05dd \u05ea\u05d5\u05e7\u05e4\u05d9\u05dd \u05d1\u05de\u05e8\u05db\u05d1\u05d0 \u05d5\u05d1\u05d9\u05ea \u05dc\u05d9\u05e3.\n"],["\u05d3\u05e1\u05e7 \u05d4\u05d7\u05d5\u05e5\u05e1\u05d2\u05df \u05e9\u05e8 \u05d4\u05d4\u05d2\u05e0\u05d4 \u05d4\u05d1\u05e8\u05d9\u05d8\u05d9: \u05d4\u05de\u05ea\u05e7\u05e4\u05d4 \u05d0\u05de\u05e9 \u05d4\u05d9\u05d9\u05ea\u05d4 \u05e4\u05e2\u05d5\u05dc\u05d4 \u05e0\u05d2\u05d3 \u05d4\u05d7\u05d5\u05ea'\u05d9\u05dd, \u05d4\u05e2\u05d9\u05df \u05e4\u05e7\u05d5\u05d7\u05d4 \u05e2\u05dc \u05d4\u05e6\u05d5\u05e8\u05da \u05e9\u05d4\u05d3\u05d1\u05e8 \u05dc\u05d0 \u05d9\u05d1\u05d9\u05d0 \u05dc\u05d4\u05e1\u05dc\u05de\u05d4@N12chat",false,135,"\u05d3\u05e1\u05e7 \u05d4\u05d7\u05d5\u05e5\u05e1\u05d2\u05df \u05e9\u05e8 \u05d4\u05d4\u05d2\u05e0\u05d4 \u05d4\u05d1\u05e8\u05d9\u05d8\u05d9: \u05d4\u05de\u05ea\u05e7\u05e4\u05d4 \u05d0\u05de\u05e9 \u05d4\u05d9\u05d9\u05ea\u05d4 \u05e4\u05e2\u05d5\u05dc\u05d4 \u05e0\u05d2\u05d3 \u05d4\u05d7\u05d5\u05ea'\u05d9\u05dd, \u05d4\u05e2\u05d9\u05df \u05e4\u05e7\u05d5\u05d7\u05d4 \u05e2\u05dc \u05d4\u05e6\u05d5\u05e8\u05da \u05e9\u05d4\u05d3\u05d1\u05e8 \u05dc\u05d0 \u05d9\u05d1\u05d9\u05d0 \u05dc\u05d4\u05e1\u05dc\u05de\u05d4@N12chat"],["\u05de\u05d1\u05d6\u05e7\u05df 12\ud83d\udcdd\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9 \u05e0\u05d4\u05e8\u05d2 \u05d5\u05e9\u05dc\u05d5\u05e9\u05d4 \u05e4\u05e6\u05d5\u05e2\u05d9\u05dd \u05e7\u05dc \u05d1\u05ea\u05d0\u05d5\u05e0\u05d4 \u05d1\u05d9\u05df \u05db\u05de\u05d4 \u05db\u05dc\u05d9 \u05e8\u05db\u05d1 \u05d1\u05db\u05d1\u05d9\u05e9 60, \u05e1\u05de\u05d5\u05da \u05dc\u05e0\u05d5\u05d5\u05d4 \u05d3\u05e0\u05d9\u05d0\u05dc \u05e9\u05d1\u05d2\u05d5\u05e9 \u05e2\u05e6\u05d9\u05d5\u05df. \u05d1\u05e2\u05e7\u05d1\u05d5\u05ea \u05d4\u05ea\u05d0\u05d5\u05e0\u05d4 \u05db\u05d1\u05d9\u05e9 60 \u05e0\u05e1\u05d2\u05e8 \u05dc\u05ea\u05e0\u05d5\u05e2\u05d4 \u0 05e0\u05e6\u05d5\u05d9\u05d9\u05d2\u05d1\u05e9\u05d1\u05d5\u05e2 \u05e9\u05e2\u05d1\u05e8 \u05d4\u05d5\u05d7\u05dc\u05d8 \u05e9\u05e0\u05d5\u05e9\u05d0\u05ea \u05d4\u05de\u05d8\u05d5\u05e1\u05d9\u05dd \"\u05d4\u05e0\u05e1\u05d9\u05da \u05de\u05d5\u05d5\u05d9\u05d9\u05dc\u05e1\" \u05ea\u05e6\u05d0 \u05dc\u05ea\u05e8\u05d2\u05d9\u05dc \u05dc\u05d0\u05d7\u05e8 \u05e9\u05d4\u05e4\u05dc\u05d2\u05ea\u05d4 \u05e9\u05dc \u05e0\u05d5\u05e9\u05d0\u05ea \u05d4\u05de\u05d8\u05d5\u05e1\u05d9\u05dd \"\u05d4\u05de\u05dc\u05db\u05d4 \u05d0\u05dc\u05d9\u05d6\u05d1\u05ea\" \u05d1\u05d5\u05d8\u05dc\u05d4 \u05d1\u05e8\u05d2\u05e2 \u05d4\u05d0\u05d7\u05e8\u05d5\u05df \u05d1\u05e9\u05dc \u05db\u05e9\u05dc \u05d8\u05db\u05e0\u05d9. \u05de\u05e9\u05e8\u05d3 \u05d4\u05d4\u05d2\u05e0\u05d4 \u05d4\u05d1\u05e8\u05d9\u05d8\u05d9 \u05dc\u05d0 \u05d7\u05e9\u05e3 \u05d0\u05ea \u05d4\u05e1\u05d9\u05d1\u05d4 \u05dc\u05d1\u05d9\u05d8\u05d5\u05dc \u05d4\u05e4\u05dc\u05d2\u05ea\u05d4 \u05e9\u05dc \"\u05d4\u05e0\u05e1\u05d9\u05da \u05de\u05d5\u05d5\u05d9\u05d9\u05dc\u05e1\", \u05d0\u05da \u05d0\u05de\u05e8 \u05db\u05d9 \u05d4\u05d9\u05d0 \u05e6\u05e4\u05d5\u05d9\u05d4 \u05dc\u05d4\u05e4\u05dc\u05d9\u05d2 \"\u05d1\u05e7\u05e8\u05d5\u05d1\"@N12chat",false,160,"\u05d0\u05e1\u05e3 \u05e8\u05d5\u05d6\u05e0\u05e6\u05d5\u05d9\u05d9\u05d2\u05d1\u05e9\u05d1\u05d5\u05e2 \u05e9\u05e2\u05d1\u05e8 \u05d4\u05d5\u05d7\u05dc\u05d8 \u05e9\u05e0\u05d5\u05e9\u05d0\u05ea \u05d4\u05de\u05d8\u05d5\u05e1\u05d9\u05dd \"\u05d4\u05e0\u05e1\u05d9\u05da \u05de\u05d5\u05d5\u05d9\u05d9\u05dc\u05e1\" \u05ea\u05e6\u05d0 \u05dc\u05ea\u05e8\u05d2\u05d9\u05dc \u05dc\u05d0\u05d7\u05e8 \u05e9\u05d4\u05e4\u05dc\u05d2\u05ea\u05d4 \u05e9\u05dc \u05e0\u05d5\u05e9\u05d0\u05ea \u05d4\u05de\u05d8\u05d5\u05e1\u05d9\u05dd \"\u05d4\u05de\u05dc\u05db\u05d4 \u05d0\u05dc\u05d9\u05d6\u05d1\u05ea\" \u05d1\u05d5\u05d8\u05dc\u05d4 \u05d1\u05e8\u05d2\u05e2 \u05d4\u05d0\u05d7\u05e8\u05d5\u05df \u05d1\u05e9\u05dc \u05db\u05e9\u05dc \u05d8\u05db\u05e0\u05d9. \u05de\u05e9\u05e8\u05d3 \u05d4\u05d4\u05d2\u05e0\u05d4 \u05d4\u05d1\u05e8\u05d9\u05d8\u05d9 \u05dc\u05d0 \u05d7\u05e9\u05e3 \u05d0\u05ea \u05d4\u05e1\u05d9\u05d1\u05d4 \u05dc\u05d1\u05d9\u05d8\u05d5\u05dc \u05d4\u05e4\u05dc\u05d2\u05ea\u05d4 \u05e9\u05dc \"\u05d4\u05e0\u05e1\u05d9\u05da \u05de\u05d5\u05d5\u05d9\u05d9\u05dc\u05e1\", \u05d0\u05da \u05d0\u05de\u05e8 \u05db\u05d9 \u05d4\u05d9\u05d0 \u05e6\u05e4\u05d5\u05d9\u05d4 \u05dc\u05d4\u05e4\u05dc\u05d9\u05d2 \"\u05d1\u05e7\u05e8\u05d5\u05d1\"@N12chat"],["\u05db\u05da \u05e0\u05e8\u05d0\u05d4 \u05d0\u05d6\u05d5\u05e8 \u05d4\u05e4\u05e8\u05d5\u05d9\u05e7\u05d8 \u05d4\u05de\u05e4\u05d5\u05e8\u05e1\u05dd \u05e9\u05dc \u05de\u05d2\u05d3\u05dc\u05d9 \u05d4\u05de\u05d2\u05d5\u05e8\u05d9\u05dd \u05e2\u05dc \u05e9\u05dd \u05e9\u05d9\u05d7' \u05d6\u05d0\u05d9\u05d3 \u05d1\u05e6\u05e4\u05d5\u05df \u05d4\u05e8\u05e6\u05d5\u05e2\u05d4.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,161,"\u05db\u05da \u05e0\u05e8\u05d0\u05d4 \u05d0\u05d6\u05d5\u05e8 \u05d4\u05e4\u05e8\u05d5\u05d9\u05e7\u05d8 \u05d4\u05de\u05e4\u05d5\u05e8\u05e1\u05dd \u05e9\u05dc \u05de\u05d2\u05d3\u05dc\u05d9 \u05d4\u05de\u05d2\u05d5\u05e8\u05d9\u05dd \u05e2\u05dc \u05e9\u05dd \u05e9\u05d9\u05d7' \u05d6\u05d0\u05d9\u05d3 \u05d1\u05e6\u05e4\u05d5\u05df \u05d4\u05e8\u05e6\u05d5\u05e2\u05d4.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,162,"\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05d0\u05e1\u05e3 \u05e8\u05d5\u05d6\u05e0\u05e6\u05d5\u05d9\u05d9\u05d2\u05e9\u05dc\u05d5\u05e9\u05d4 \u05d9\u05de\u05d9\u05dd \u05d0\u05d7\u05e8\u05d9: \u05d8\u05e8\u05d0\u05de\u05e4 \u05de\u05ea\u05d9\u05d9\u05d7\u05e1 \u05dc\u05e8\u05d0\u05e9\u05d5\u05e0\u05d4 \u05dc\u05de\u05d5\u05ea\u05d5 \u05e9\u05dc \u05e0\u05d1\u05dc\u05e0\u05d9, \u05d0\u05da \u05dc\u05d0 \u05de\u05d1\u05d9\u05e2 \u05e6\u05e2\u05e8 \u05d0\u05d5 \u05de\u05d5\u05ea\u05d7 \u05d1\u05d9\u05e7\u05d5\u05e8\u05ea \u05e2\u05dc \u05e8\u05d5\u05e1\u05d9\u05d4 - \u05d0\u05dc\u05d0 \u05de\u05e0\u05e6\u05dc \u05d6\u05d0\u05ea \u05dc\u05ea\u05d9\u05d0\u05d5\u05e8\u05d9\u05d5\u05ea \u05e7\u05d5\u05e0\u05e1\u05e4\u05d9\u05e8\u05e6\u05d9\u05d4 \u05d1\u05d6\u05d9\u05e8\u05d4 \u05d4\u05d0\u05de\u05e8\u05d9\u05e7\u05e0\u05d9\u05ea@N12chat",false,163,"\u05d0\u05e1\u05e3 \u05e8\u05d5\u05d6\u05e0\u05e6\u05d5\u05d9\u05d9\u05d2\u05e9\u05dc\u05d5\u05e9\u05d4 \u05d9\u05de\u05d9\u05dd \u05d0\u05d7\u05e8\u05d9: \u05d8\u05e8\u05d0\u05de\u05e4 \u05de\u05ea\u05d9\u05d9\u05d7\u05e1 \u05dc\u05e8\u05d0\u05e9\u05d5\u05e0\u05d4 \u05dc\u05de\u05d5\u05ea\u05d5 \u05e9\u05dc \u05e0\u05d1\u05dc\u05e0\u05d9, \u05d0\u05da \u05dc\u05d0 \u05de\u05d1\u05d9\u05e2 \u05e6\u05e2\u05e8 \u05d0\u05d5 \u05de\u05d5\u05ea\u05d7 \u05d1\u05d9\u05e7\u05d5\u05e8\u05ea \u05e2\u05dc \u05e8\u05d5\u05e1\u05d9\u05d4 - \u05d0\u05dc\u05d0 \u05de\u05e0\u05e6\u05dc \u05d6\u05d0\u05ea \u05dc\u05ea\u05d9\u05d0\u05d5\u05e8\u05d9\u05d5\u05ea \u05e7\u05d5\u05e0\u05e1\u05e4\u05d9\u05e8\u05e6\u05d9\u05d4 \u05d1\u05d6\u05d9\u05e8\u05d4 \u05d4\u05d0\u05de\u05e8\u05d9\u05e7\u05e0\u05d9\u05ea@N12chat"],["\u05d3\u05d5\u05d1\u05e8 \u05e6\u05d4\"\u05dc \u05d4\u05d5\u05d3\u05d9\u05e2 \u05e2\u05dc \u05e0\u05e4\u05d9\u05dc\u05ea\u05d5 \u05e9\u05dc \u05dc\u05d5\u05d7\u05dd \u05e9\u05e0\u05e4\u05e6\u05e2 \u05d1\u05e7\u05e8\u05d1 \u05d1\u05de\u05e8\u05db\u05d6 \u05e8\u05e6\u05d5\u05e2\u05ea \u05e2\u05d6\u05d4 \u05d1 29.12.\u05d9\u05d4\u05d9 \u05d6\u05db\u05e8\u05d5 \u05d1\u05e8\u05d5\u05da.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,164,"\u05d3\u05d5\u05d1\u05e8 \u05e6\u05d4\"\u05dc \u05d4\u05d5\u05d3\u05d9\u05e2 \u05e2\u05dc \u05e0\u05e4\u05d9\u05dc\u05ea\u05d5 \u05e9\u05dc \u05dc\u05d5\u05d7\u05dd \u05e9\u05e0\u05e4\u05e6\u05e2 \u05d1\u05e7\u05e8\u05d1 \u05d1\u05de\u05e8\u05db\u05d6 \u05e8\u05e6\u05d5\u05e2\u05ea \u05e2\u05d6\u05d4 \u05d1 29.12.\u05d9\u05d4\u05d9 \u05d6\u05db\u05e8\u05d5 \u05d1\u05e8\u05d5\u05da.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05d3\u05e1\u05e7 \u05d4\u05e2\u05d5\u05dc\u05dd \u05d4\u05e2\u05e8\u05d1\u05d9\u05d4\u05de\u05dc\u05da \u05e2\u05d1\u05d3\u05d0\u05dc\u05dc\u05d4: \u05dc\u05d0 \u05d9\u05d4\u05d9\u05d4 \u05e4\u05ea\u05e8\u05d5\u05df \u05dc\u05e1\u05d5\u05d2\u05d9\u05d4 \u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05ea \u05e2\u05dc \u05d7\u05e9\u05d1\u05d5\u05df \u05d9\u05e8\u05d3\u05df. \u05e2\u05d6\u05d4 \u05d5\u05d4\u05d2\u05d3\u05d4 \u05d7\u05d9\u05d9\u05d1\u05d5\u05ea \u05dc\u05d4\u05d9\u05d5\u05ea \u05d7\u05dc\u05e7 \u05de\u05d4\u05de\u05d3\u05d9\u05e0\u05d4 \u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05ea@N12chat",false,165,"\u05d3\u05e1\u05e7 \u05d4\u05e2\u05d5\u05dc\u05dd \u05d4\u05e2\u05e8\u05d1\u05d9\u05d4\u05de\u05dc\u05da \u05e2\u05d1\u05d3\u05d0\u05dc\u05dc\u05d4: \u05dc\u05d0 \u05d9\u05d4\u05d9\u05d4 \u05e4\u05ea\u05e8\u05d5\u05df \u05dc\u05e1\u05d5\u05d2\u05d9\u05d4 \u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05ea \u05e2\u05dc \u05d7\u05e9\u05d1\u05d5\u05df \u05d9\u05e8\u05d3\u05df. \u05e2\u05d6\u05d4 \u05d5\u05d4\u05d2\u05d3\u05d4 \u05d7\u05d9\u05d9\u05d1\u05d5\u05ea \u05dc\u05d4\u05d9\u05d5\u05ea \u05d7\u05dc\u05e7 \u05de\u05d4\u05de\u05d3\u05d9\u05e0\u05d4 \u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05ea@N12chat"],["\u05ea\u05d9\u05e2\u05d5\u05d3 \u05de\u05e8\u05d4\u05d9\u05d1 \u05e9\u05dc \u05d4\u05ea\u05e4\u05e8\u05e6\u05d5\u05ea \u05d4\u05e8 \u05d4\u05d2\u05e2\u05e9 \u05d8\u05d0\u05d0\u05dc \u05d1\u05e4\u05d9\u05dc\u05d9\u05e4\u05d9\u05e0\u05d9\u05dd \u05d1\u05d9\u05de\u05de\u05d4 \u05d4\u05d0\u05d7\u05e8\u05d5\u05e0\u05d4.\u05e2\u05e0\u05df \u05d4\u05d0\u05e4\u05e8 \u05d4\u05b4\u05ea\u05bc\u05b7\u05de\u05bc\u05b5\u05e8 \u05dc\u05d2\u05d5\u05d1\u05d4 \u05e9\u05dc 2.8 \u05e7\"\u05de.4 \u05ea\u05d2\u05d5\u05d1\u05d5\u05ea",false,166,"\u05ea\u05d9\u05e2\u05d5\u05d3 \u05de\u05e8\u05d4\u05d9\u05d1 \u05e9\u05dc \u05d4\u05ea\u05e4\u05e8\u05e6\u05d5\u05ea \u05d4\u05e8 \u05d4\u05d2\u05e2\u05e9 \u05d8\u05d0\u05d0\u05dc \u05d1\u05e4\u05d9\u05dc\u05d9\u05e4\u05d9\u05e0\u05d9\u05dd \u05d1\u05d9\u05de\u05de\u05d4 \u05d4\u05d0\u05d7\u05e8\u05d5\u05e0\u05d4.\u05e2\u05e0\u05df \u05d4\u05d0\u05e4\u05e8 \u05d4\u05b4\u05ea\u05bc\u05b7\u05de\u05bc\u05b5\u05e8 \u05dc\u05d2\u05d5\u05d1\u05d4 \u05e9\u05dc 2.8 \u05e7\"\u05de.4 \u05ea\u05d2\u05d5\u05d1\u05d5\u05ea"],["\u05d0\u05e1\u05e3 \u05e8\u05d5\u05d6\u05e0\u05e6\u05d5\u05d9\u05d9\u05d2\u05e0\u05e9\u05d9\u05d0 \u05e6\u05e8\u05e4\u05ea \u05e2\u05de\u05e0\u05d5\u05d0\u05dc \u05de\u05e7\u05e8\u05d5\u05df \u05d0\u05de\u05e8 \u05d0\u05de\u05e9 \u05db\u05d9 \"\u05ea\u05d1\u05d5\u05e1\u05d4 \u05e9\u05dc \u05e8\u05d5\u05e1\u05d9\u05d4 \u05d1\u05d0\u05d5\u05e7\u05e8\u05d0\u05d9\u05e0\u05d4 \u05d4\u05d9\u05d0 \u05d4\u05db\u05e8\u05d7\u05d9\u05ea \u05dc\u05d1\u05d9\u05d8\u05d7\u05d5\u05e0\u05d4 \u05d5\u05d9\u05e6\u05d9\u05d1\u05d5\u05ea\u05d4 \u05e9\u05dc \u05d0\u05d9\u05e8\u05d5\u05e4\u05d4\". \u05d4\u05d5\u05d0 \u05d0\u05de\u05e8 \u05e9\u05e6\u05e8\u05e4\u05ea \u05ea\u05e2\u05e9\u05d4 \u05db\u05dc \u05de\u05d4 \u05e9\u05e0\u05d3\u05e8\u05e9 \u05db\u05d3\u05d9 \u05dc\u05e1\u05d9\u05d9\u05e2 \u05dc\u05d0\u05d5\u05e7\u05e8\u05d0\u05d9\u05e0\u05d4, \u05d5\u05db\u05d9 \u05d4\u05d5\u05d0 \"\u05dc\u05d0 \u05e9\u05d5\u05dc\u05dc\" \u05e9\u05dc\u05d9\u05d7\u05ea \u05d7\u05d9\u05d9\u05dc\u05d9\u05dd \u05de\u05e2\u05e8\u05d1\u05d9\u05d9\u05dd \u05dc\u05d0\u05d5\u05e7\u05e8\u05d0\u05d9\u05e0\u05d4, \u05dc\u05de\u05e8\u05d5\u05ea \u05e9\u05d1\u05e9\u05dc\u05d1 \u05d6\u05d4 \"\u05d0\u05d9\u05df \u05e7\u05d5\u05e0\u05e6\u05e0\u05d6\u05d5\u05e1\" \u05d1\u05e0\u05d5\u05e9\u05d0@N12chat",false,167,"\u05d0\u05e1\u05e3 \u05e8\u05d5\u05d6\u05e0\u05e6\u05d5\u05d9\u05d9\u05d2\u05e0\u05e9\u05d9\u05d0 \u05e6\u05e8\u05e4\u05ea \u05e2\u05de\u05e0\u05d5\u05d0\u05dc \u05de\u05e7\u05e8\u05d5\u05df \u05d0\u05de\u05e8 \u05d0\u05de\u05e9 \u05db\u05d9 \"\u05ea\u05d1\u05d5\u05e1\u05d4 \u05e9\u05dc \u05e8\u05d5\u05e1\u05d9\u05d4 \u05d1\u05d0\u05d5\u05e7\u05e8\u05d0\u05d9\u05e0\u05d4 \u05d4\u05d9\u05d0 \u05d4\u05db\u05e8\u05d7\u05d9\u05ea \u05dc\u05d1\u05d9\u05d8\u05d7\u05d5\u05e0\u05d4 \u05d5\u05d9\u05e6\u05d9\u05d1\u05d5\u05ea\u05d4 \u05e9\u05dc \u05d0\u05d9\u05e8\u05d5\u05e4\u05d4\". \u05d4\u05d5\u05d0 \u05d0\u05de\u05e8 \u05e9\u05e6\u05e8\u05e4\u05ea \u05ea\u05e2\u05e9\u05d4 \u05db\u05dc \u05de\u05d4 \u05e9\u05e0\u05d3\u05e8\u05e9 \u05db\u05d3\u05d9 \u05dc\u05e1\u05d9\u05d9\u05e2 \u05dc\u05d0\u05d5\u05e7\u05e8\u05d0\u05d9\u05e0\u05d4, \u05d5\u05db\u05d9 \u05d4\u05d5\u05d0 \"\u05dc\u05d0 \u05e9\u05d5\u05dc\u05dc\" \u05e9\u05dc\u05d9\u05d7\u05ea \u05d7\u05d9\u05d9\u05dc\u05d9\u05dd \u05de\u05e2\u05e8\u05d1\u05d9\u05d9\u05dd \u05dc\u05d0\u05d5\u05e7\u05e8\u05d0\u05d9\u05e0\u05d4, \u05dc\u05de\u05e8\u05d5\u05ea \u05e9\u05d1\u05e9\u05dc\u05d1 \u05d6\u05d4 \"\u05d0\u05d9\u05df \u05e7\u05d5\u05e0\u05e6\u05e0\u05d6\u05d5\u05e1\" \u05d1\u05e0\u05d5\u05e9\u05d0@N12chat"],["\u05d4\u05ea\u05de\u05d5\u05e0\u05d5\u05ea \u05d4\u05dc\u05dc\u05d5 \u05e9\u05e4\u05d5\u05e8\u05e1\u05de\u05d5 \u05e7\u05d5\u05d3\u05dd \u05d1\u05d9\u05e9\u05e8\u05d0\u05dc \u05de\u05e6\u05d9\u05e4\u05d5\u05ea \u05db\u05e2\u05ea \u05d2\u05dd \u05d0\u05ea \u05d4\u05e2\u05e8\u05d5\u05e6\u05d9\u05dd \u05d4\u05e2\u05e8\u05d1\u05d9\u05dd \u05d5\u05dc\u05d0 \u05e8\u05e7 \u05d0\u05ea \u05d0\u05dc\u05d4 \u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd.\u05ea\u05e4\u05d5\u05e6\u05d4 \u05e8\u05d7\u05d1\u05d4 \u05d1\u05de\u05d9\u05d5\u05d7\u05d3-\u05d4\u05ea\u05de\u05d5\u05e0\u05d5\u05ea \u05d7\u05d6\u05e7\u05d5\u05ea \u05d5\u05de\u05e2\u05d1\u05d9\u05e8\u05d5\u05ea \u0 1gBxe5\u05e4\u05e0\u05d9\u05de\u05d4-\u05de\u05e0\u05e6\u05d7\u05d5\u05ea \u05d1\u05d9\u05d7\u05d3\ud83e\ude84"],["\u05e9\u05e0\u05d9 \u05d1\u05d9\u05e8\u05e0\u05d1\u05d5\u05d9\u05dd\u05d4\u05e2\u05d5\u05dc\u05d9\u05dd \u05de\u05d0\u05e8\u05d2\u05e0\u05d8\u05d9\u05e0\u05d4 \u05e9\u05d7\u05d5\u05d2\u05d2\u05d9\u05dd \u05d7\u05e0\u05d5\u05db\u05d4 \u05e8\u05d0\u05e9\u05d5\u05df \u05d1\u05d9\u05e9\u05e8\u05d0\u05dc: \u05d3\u05e0\u05d9\u05d0\u05dc \u05d1\u05dc\u05d9\u05d9\u05d5\u05d5\u05d9\u05e1 \u05d5\u05d1\u05e0\u05d5 \u05d0\u05de\u05d9\u05dc\u05d9\u05d0\u05e0\u05d5 \u05e2\u05dc\u05d5 \u05d1\u05d7\u05d5\u05d3\u05e9 \u05e9\u05e2\u05d1\u05e8 \u05d1\u05e1\u05d9\u05d5\u05e2 \u05d4\u05e7\u05e8\u05df \u05dc\u05d9\u05d3\u05d9\u05d3\u05d5\u05ea \u05de\u05e2\u05d9\u05e8 \u05d4\u05d5\u05dc\u05d3\u05ea\u05dd \u05d1\u05d5\u05d0\u05e0\u05d5\u05e1 \u05d0\u05d9\u05d9\u05e8\u05e1. \"\u05d1\u05d7\u05d2 \u05d1\u05d5 \u05d0\u05e0\u05d7\u05e0\u05d5 \u05d6\u05d5\u05db\u05e8\u05d9\u05dd \u05d0\u05ea \u05e0\u05e1 \u05d7\u05e0\u05d5\u05db\u05d4, \u05d0\u05e0\u05d7\u05e0\u05d5 \u05d0\u05dc\u05d4 \u05e9\u05d9\u05db\u05d5\u05dc\u05d9\u05dd \u05dc\u05d1\u05d7\u05d5\u05e8 \u05d1\u05d9\u05df \u05d0\u05d5\u05e8 \u05dc\u05d7\u05d5\u05e9\u05da\", \u05d0\u05de\u05e8 \u05d3\u05e0\u05d9\u05d0\u05dc. \u05e6\u05d9\u05dc\u05d5\u05dd: \u05d4\u05e7\u05e8\u05df \u05dc\u05d9\u05d3\u05d9\u05d3\u05d5\u05ea@N12chat",false,194,"\u05e9\u05e0\u05d9 \u05d1\u05d9\u05e8\u05e0\u05d1\u05d5\u05d9\u05dd\u05d4\u05e2\u05d5\u05dc\u05d9\u05dd \u05de\u05d0\u05e8\u05d2\u05e0\u05d8\u05d9\u05e0\u05d4 \u05e9\u05d7\u05d5\u05d2\u05d2\u05d9\u05dd \u05d7\u05e0\u05d5\u05db\u05d4 \u05e8\u05d0\u05e9\u05d5\u05df \u05d1\u05d9\u05e9\u05e8\u05d0\u05dc: \u05d3\u05e0\u05d9\u05d0\u05dc \u05d1\u05dc\u05d9\u05d9\u05d5\u05d5\u05d9\u05e1 \u05d5\u05d1\u05e0\u05d5 \u05d0\u05de\u05d9\u05dc\u05d9\u05d0\u05e0\u05d5 \u05e2\u05dc\u05d5 \u05d1\u05d7\u05d5\u05d3\u05e9 \u05e9\u05e2\u05d1\u05e8 \u05d1\u05e1\u05d9\u05d5\u05e2 \u05d4\u05e7\u05e8\u05df \u05dc\u05 u05e0\u05d9\u05e8 \u05d3\u05d1\u05d5\u05e8\u05d9\ud83d\udcdd\u05dc\u05e1\u05d9\u05d5\u05dd \u05d4\u05d1\u05d4\u05d9\u05e8\u05d5 \u05d4\u05d0\u05d9\u05de\u05d4\u05d5\u05ea: \"\u05d0\u05e0\u05d5 \u05de\u05d7\u05d6\u05e7\u05d5\u05ea \u05d0\u05d5\u05ea\u05db\u05dd \u05dc\u05d4\u05de\u05e9\u05d9\u05da \u05d5\u05dc\u05d0 \u05dc\u05e2\u05e6\u05d5\u05e8 \u2013 \u05e2\u05d3 \u05d4\u05e0\u05d9\u05e6\u05d7\u05d5\u05df. \u05e9\u05dc\u05d7\u05e0\u05d5 \u05d0\u05ea \u05d1\u05e0\u05d9\u05e0\u05d5 \u05dc\u05e9\u05d3\u05d4 \u05d4\u05e7\u05e8\u05d1 \u05de\u05ea\u05d5\u05da \u05d0\u05de\u05d5\u05e0\u05d4 \u05d1\u05e8\u05d5\u05e8\u05d4 \u05d1\u05e6\u05d3\u05e7\u05ea \u05d4\u05d3\u05e8\u05da - \u05d0\u05e0\u05d0 \u05d4\u05d7\u05d6\u05d9\u05e8\u05d5 \u05dc\u05e0\u05d5 \u05d0\u05d5\u05ea\u05dd, \u05e8\u05e7 \u05d1\u05e1\u05d9\u05d5\u05dd \u05d4\u05de\u05e9\u05d9\u05de\u05d4, \u05e8\u05e7 \u05dc\u05d0\u05d7\u05e8 \u05d4\u05e9\u05de\u05d3\u05ea \u05db\u05dc \u05d0\u05d5\u05d9\u05d1\u05d9\u05e0\u05d5 \u05dc\u05d0 \u05d3\u05e7\u05d4 \u05dc\u05e4\u05e0\u05d9. \u05d7\u05d9\u05d9\u05dc\u05e0\u05d5 \u05d7\u05d6\u05e7\u05d9\u05dd, \u05d4\u05de\u05e9\u05e4\u05d7\u05d5\u05ea \u05d7\u05d6\u05e7\u05d5\u05ea, \u05d4\u05e2\u05d5\u05e8\u05e3 \u05d0\u05d9\u05ea\u05df, \u05d4\u05e2\u05dd \u05e0\u05d7\u05d5\u05e9\"@N12chat"],["\u05d4\u05e2\u05d9\u05ea\u05d5\u05e0\u05d0\u05d9\u05ea \u05d4\u05dc\u05d1\u05e0\u05d5\u05e0\u05d9\u05ea \u05d4\u05e9\u05d9\u05e2\u05d9\u05ea (\u05de\u05ea\u05e0\u05d2\u05d3\u05ea \u05d1\u05d5\u05dc\u05d8\u05ea \u05e9\u05dc \u05d7\u05d6\u05d1\u05d0\u05dc\u05dc\u05d4) \u05de\u05e2\u05de\u05ea\u05ea \u05d0\u05ea \u05d1\u05db\u05d9\u05e8\u05d9 \u05d7\u05d6\u05d1\u05d0\u05dc\u05dc\u05d4 \u05d4\u05de\u05d3\u05d1\u05e8\u05d9\u05dd \u05e2\u05dc \u05e0\u05d9\u05e6\u05d7\u05d5\u05e0\u05d5\u05ea, \u05e2\u05dd \u05d4\u05de\u05e6\u05d9\u05d0\u05d5\u05ea \u05d4\u05de\u05e8\u05d4.\u05ea\u05d2\u05d5\u05d1\u05d4 \u05d0\u05d7\u05ea",false,196,"\u05d4\u05e2\u05d9\u05ea\u05d5\u05e0\u05d0\u05d9\u05ea \u05 9\u05d1\"\u05db \u05e8\u05d5\u05e0\u05df \u05d1\u05e8, \u05e1\u05d2\u05e0\u05d5 \u05d5\u05e8\u05d0\u05e9\u05d9 \u05d4\u05d6\u05d9\u05e8\u05d5\u05ea \u05e9\u05dc \u05d4\u05d0\u05e8\u05d2\u05d5\u05df. \u05e8\u05d0\u05e9 \u05d4\u05de\u05de\u05e9\u05dc\u05d4 \u05e1\u05d9\u05d9\u05e8 \u05d1\u05d7\u05de\"\u05dc \u05d4\u05de\u05d1\u05e6\u05e2\u05d9\u05dd \u05d4\u05de\u05d9\u05d5\u05d7\u05d3\u05d9\u05dd \u05d5\u05e7\u05d9\u05d1\u05dc \u05e1\u05e7\u05d9\u05e8\u05d4 \u05d0\u05d5\u05d3\u05d5\u05ea \u05d4\u05d4\u05d9\u05e9\u05d2\u05d9\u05dd \u05e9\u05dc \u05e9\u05d1\"\u05db \u05d5\u05e6\u05d4\"\u05dc \u05e2\u05d3 \u05db\u05d4 \u05d1\u05dc\u05d7\u05d9\u05de\u05d4. \u05e0\u05ea\u05e0\u05d9\u05d4\u05d5: \"\u05d0\u05e0\u05d9 \u05e8\u05d5\u05e6\u05d4 \u05dc\u05d4\u05d1\u05d9\u05e2 \u05d4\u05e2\u05e8\u05db\u05d4 \u05e2\u05e6\u05d5\u05de\u05d4 \u05d2\u05dd \u05dc\u05d4\u05e7\u05e8\u05d1\u05d4, \u05d2\u05dd \u05dc\u05e0\u05d5\u05e4\u05dc\u05d9\u05dd \u05d5\u05d2\u05dd \u05dc\u05e2\u05d1\u05d5\u05d3\u05d4 \u05e9\u05d0\u05ea\u05dd \u05e2\u05d5\u05e9\u05d9\u05dd. \u05d0\u05e0\u05d9 \u05e8\u05d5\u05d0\u05d4 \u05d5\u05e7\u05d5\u05e8\u05d0 \u05d0\u05ea \u05d6\u05d4 \u05d9\u05d5\u05dd \u05d9\u05d5\u05dd, \u05d5\u05d0\u05e0\u05d9 \u05d9\u05d5\u05d3\u05e2 \u05e9\u05d4\u05e9\u05d9\u05dc\u05d5\u05d1 \u05d1\u05d9\u05df \u05d4\u05e2\u05d1\u05d5\u05d3\u05d4 \u05e9\u05dc\u05db\u05dd \u05dc\u05e6\u05d4\"\u05dc \u05e0\u05d5\u05ea\u05e0\u05ea \u05dc\u05e0\u05d5 \u05d0\u05ea \u05d4\u05d0\u05e4\u05e9\u05e8\u05d5\u05ea \u05dc\u05d4\u05ea\u05e7\u05d3\u05dd \u05dc\u05d4\u05e9\u05d2\u05ea \u05d4\u05d9\u05e2\u05d3\u05d9\u05dd\"\u003cbr \u002f\u003e@N12chat",false,202,"\u05d9\u05e8\u05d5\u05df \u05d0\u05d1\u05e8\u05d4\u05dd\u05e8\u05d0\u05e9 \u05d4\u05de\u05de\u05e9\u05dc\u05d4 \u05d1\u05e0\u05d9\u05de\u05d9\u05df \u05e0\u05ea\u05e0\u05d9\u05d4\u05d5 \u05e7\u05d9\u05d9\u05dd \u05d4\u05e2\u05e8\u05db\u05ea \u05de\u05e6\u05d1 \u05d1\u05e9\u05d9\u05e8\u05d5\u05ea \u05d4\u05d1\u05d9\u05d8\u05d7\u05d5\u05df \u05d4\u05db\u05dc\u05dc\u05d9 \u05d9\u05d7\u05d3 \u05e2\u05dd \u05e8\u05d0\u05e9 \u05d4\u05e9\u05d1\"\u05db \u05e8\u05d5\u05e0\u05df \u05d1\u05e8, \u05e1\u05d2\u05e0\u05d5 \u05d5\u05e8\u05d0\u05e9\u05d9 \u05d4\u05d6\u05d9\u05e8\u05d5\u05ea \u05e9\u05dc \u05d4\u05d0\u05e8\u05d2\u05d5\u05df. \u05e8\u05d0\u05e9 \u05d4\u05de\u05de\u05e9\u05dc\u05d4 \u05e1\u05d9\u05d9\u05e8 \u05d1\u05d7\u05de\"\u05dc \u05d4\u05de\u05d1\u05e6\u05e2\u05d9\u05dd \u05d4\u05de\u05d9\u05d5\u05d7\u05d3\u05d9\u05dd \u05d5\u05e7\u05d9\u05d1\u05dc \u05e1\u05e7\u05d9\u05e8\u05d4 \u05d0\u05d5\u05d3\u05d5\u05ea \u05d4\u05d4\u05d9\u05e9\u05d2\u05d9\u05dd \u05e9\u05dc \u05e9\u05d1\"\u05db \u05d5\u05e6\u05d4\"\u05dc \u05e2\u05d3 \u05db\u05d4 \u05d1\u05dc\u05d7\u05d9\u05de\u05d4. \u05e0\u05ea\u05e0\u05d9\u05d4\u05d5: \"\u05d0\u05e0\u05d9 \u05e8\u05d5\u05e6\u05d4 \u05dc\u05d4\u05d1\u05d9\u05e2 \u05d4\u05e2\u05e8\u05db\u05d4 \u05e2\u05e6\u05d5\u05de\u05d4 \u05d2\u05dd \u05dc\u05d4\u05e7\u05e8\u05d1\u05d4, \u05d2\u05dd \u05dc\u05e0\u05d5\u05e4\u05dc\u05d9\u05dd \u05d5\u05d2\u05dd \u05dc\u05e2\u05d1\u05d5\u05d3\u05d4 \u05e9\u05d0\u05ea\u05dd \u05e2\u05d5\u05e9\u05d9\u05dd. \u05d0\u05e0\u05d9 \u05e8\u05d5\u05d0\u05d4 \u05d5\u05e7\u05d5\u05e8\u05d0 \u05d0\u05ea \u05d6\u05d4 \u05d9\u05d5\u05dd \u05d9\u05d5\u05dd, \u05d5\u05d0\u05e0\u05d9 \u05d9\u05d5\u05d3\u05e2 \u05e9\u05d4\u05e9\u05d9\u05dc\u05d5\u05d1 \u05d1\u05d9\u05df \u05d4\u05e2\u05d1\u05d5\u05d3\u05d4 \u05e9\u05dc\u05db\u05dd \u05dc\u05e6\u05d4\"\u05dc \u05e0\u05d5\u05ea\u05e0\u05ea \u05dc\u05e0\u05d5 \u05d0\u05ea \u05d4\u05d0\u05e4\u05e9\u05e8\u05d5\u05ea \u05dc\u05d4\u05ea\u05e7\u05d3\u05dd \u05dc\u05d4\u05e9\u05d2\u05ea \u05d4\u05d9\u05e2\u05d3\u05d9\u05dd\"\u003cbr \u002f\u003e@N12chat"],["\u05e2\u05e8\u05d5\u05e6\u05d9\u05dd \u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd: \u05e6\u05d4\"\u05dc \u05ea\u05e7\u05e3 \u05dc\u05e4\u05e0\u05d9 \u05d6\u05de\u05df \u05e7\u05e6\u05e8 \u05d3\u05d9\u05e8\u05d4 \u05d1\u05e8\u05d7\u05d5\u05d1 \u05d0\u05dc\u05de\u05e2'\u05e8\u05d1\u05d9 \u05d1\u05e9\u05db\u05d5\u05e0\u05ea \u05e6\u05d1\u05e8\u05d4 \u05d1\u05e2\u05d9\u05e8 \u05e2\u05d6\u05d4.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,203,"\u05e2\u05e8\u05d5\u05e6\u05d9\u05dd \u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd: \u05e6\u05d4\"\u05dc \u05ea\u05e7\u05e3 \u05dc\u05e4\u05e0\u05d9 \u05d6\u05de\u05df \u05e7\u05e6\u05e8 \u05d3\u05d9\u05e8\u05d4 \u05d1\u05e8\u05d7\u05d5\u05d1 \u05d0\u05dc\u05de\u05e2'\u05e8\u05d1\u05d9 \u05d1\u05e9\u05db\u05d5\u05e0\u05ea \u05e6\u05d1\u05e8\u05d4 \u05d1\u05e2\u05d9\u05e8 \u05e2\u05d6\u05d4.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05de\u05d1\u05d6\u05e7\u05df 12\u05d0\u05d9\u05e8\u05d5\u05e2 \u05d0\u05dc\u05d9\u05de\u05d5\u05ea \u05d1\u05d7\u05d9\u05e4\u05d4: \u05d2\u05d1\u05e8 \u05d1\u05df 28 \u05e0\u05e4\u05e6\u05e2 \u05e7\u05e9\u05d4 - \u05e6\u05d5\u05d5\u05ea\u05d9 \u05de\u05d3\"\u05d0 \u05d4\u05e2\u05e0\u05d9\u05e7\u05d5 \u05dc\u05d5 \u05d8\u05d9\u05e4\u05d5\u05dc \u05e8\u05e4\u05d5\u05d0\u05d9 \u05d5\u05e4\u05d9\u05e0\u05d5 \u05d0\u05d5\u05ea\u05d5 \u05dc\u05d1\u05d9\u05ea \u05d4\u05d7\u05d5\u05dc\u05d9\u05dd \u05e8\u05de\u05d1\"\u05dd, \u05db\u05d0\u05e9\u05e8 \u05d4\u05d5\u05d0 \u05e1\u05d5\u05d1\u05dc \u05de\u05e4\u05e6\u05d9\u05e2\u05d4 \u05d7\u05d5\u05d3\u05e8\u05ea@N12chat",false,204,"\u05de\u05d1\u05d6\u05e7\u05df 12\u05d0\u05d9\u05e8\u05d5\u05e2 \u05d0\u05dc\u05d9\u05de\u05d5\u05ea \u05d1\u05d7\u05d9\u05e4\u05d4: \u05d2\u05d1\u05e8 \u05d1\u05df 28 \u05e0\u05e4\u05e6\u05e2 \u05e7\u05e9\u05d4 - \u05e6\u05d5\u05d5\u05ea\u05d9 \u05de\u05d3\"\u05d0 \u05d4\u05e2\u05e0\u05d9\u05e7\u05d5 \u05dc\u05d5 \u05d8\u05d9\u05e4\u05d5\u05dc \u05e8\u05e4\u05d5\u05d0\u05d9 \u05d5\u05e4\u05d9\u05e0\u05d5 \u05d0\u05d5\u05ea\u05d5 \u05dc\u05d1\u05d9\u05ea \u05d4\u05d7\u05d5\u05dc\u05d9\u05dd \u05e8\u05de\u05d1\"\u05dd, \u05db\u05d0\u05e9\u05e8 \u05d4\u05d5\u05d0 \u05e1\u05d5\u05d1\u05dc \u05de\u05e4\u05e6\u05d9\u05e2\u05d4 \u05d7\u05d5\u05d3\u05e8\u05ea@N12chat"],["\u05d2\u05d9\u05d0 \u05d5\u05e8\u05d5\u05df\u05d4\u05d4\u05ea\u05e8\u05e2\u05d5\u05ea \u05d1\u05e6\u05e4\u05d5\u05df - \u05e9\u05d5\u05d5\u05d0. \u05d1\u05e6\u05d4\"\u05dc \u05ea\u05e7\u05e4\u05d5 \u05de\u05d8\u05e8\u05d5\u05ea \u05d7\u05d9\u05d6\u05d1\u05d0\u05dc\u05dc\u05d4 \u05d1\u05d1\u05d9\u05e0\u05ea \u05d2'\u05d1\u05dc@N12chat",false,205,"\u05d2\u05d9\u05d0 \u05d5\u05e8\u05d5\u05df\u05d4\u05d4\u05ea\u05e8\u05e2\u05d5\u05ea \u05d1\u05e6\u05e4\u05d5\u05df - \u05e9\u05d5\u05d5\u05d0. \u05d1\u05e6\u05d4\"\u05dc \u05ea\u05e7\u05e4\u05d5 \u05de\u05d8\u05e8\u05d5\u05ea \u05d7\u05d9\u05d6\u05d1\u05d0\u05dc\u05dc\u05d4 \u05d1\u05d1\u05d9\u05e0\u05ea \u05d2'\u05d1\u05dc@N12chat"],["\u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd: \u05de\u05d8\u05d5\u05e1 \u05e7\u05e8\u05d1 \u05d9\u05e9\u05e8\u05d0\u05dc\u05d9 \u05ea\u05d5\u05e7\u05e3 \u05d1\u05d7'\u05d0\u05df \u05d9\u05d5\u05e0\u05e1 \u05d1\u05d3\u05e8\u05d5\u05dd \u05d4\u05e8\u05e6\u05d5\u05e2\u05d4.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,206,"\u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd: \u05de\u05d8\u05d5\u05e1 \u05e7\u05e8\u05d1 \u05d9\u05e9\u05e8\u05d0\u05dc\u05d9 \u05ea\u05d5\u05e7\u05e3 \u05d1\u05d7'\u05d0\u05df \u05d9\u05d5\u05e0\u05e1 \u05d1\u05d3\u05e8\u05d5\u05dd \u05d4\u05e8\u05e6\u05d5\u05e2\u05d4.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05d4\u05dc\u05d5\u05d5\u05d9\u05ea \u05d4\u05e8\u05d5\u05d2\u05d9 \u05ea\u05e7\u05d9\u05e4\u05ea \u05e6\u05d4\"\u05dc \u05d1\u05db\u05e4\u05e8 \u05d2'\u05d5\u05df\ud83d\udc46\u05d0\u05ea\u05de\u05d5\u05dc.\u05d2\u05dd \u05db\u05d0\u05df \u05e0\u05d9\u05db\u05e8 \u05d4\u05e7\u05e9\u05e8 \u05d4\u05d4\u05d3\u05d5\u05e7 \u05e9\u05dc \u05d4\u05 05d5 \u05d1\u05d7\u05d9\u05d9\u05dd \u05e9\u05dc \u05d0\u05d4\u05d5\u05d1\u05d9\u05e0\u05d5 \u05e2\u05d5\u05e4\u05e8 \u05e7\u05dc\u05d3\u05e8\u05d5\u05df \u05e9\u05e2\u05d3\u05d9\u05d9\u05df \u05e0\u05de\u05e6\u05d0 \u05d1\u05e1\u05db\u05e0\u05d4\"@N12chat",false,254,"\u05d9\u05d5\u05d0\u05d1 \u05d0\u05d1\u05df\u05e2\u05d9\u05d3\u05d5 \u05d3\u05df, \u05d1\u05df \u05d4\u05d3\u05d5\u05d3 \u05e9\u05dc \u05d4\u05d3\u05e1 \u05e7\u05dc\u05d3\u05e8\u05d5\u05df \u05e9\u05d9\u05dc\u05d3\u05d9\u05d4 \u05e1\u05d4\u05e8 \u05d5\u05d0\u05e8\u05d6 \u05e0\u05d7\u05d8\u05e4\u05d5 \u05d1\u05d9\u05d3\u05d9 \u05d7\u05de\u05d0\u05e1 \u05d5\u05e9\u05d5\u05d7\u05e8\u05e8\u05d5 \u05d4\u05e2\u05e8\u05d1: \"\u05d6\u05d4 \u05d9\u05d5\u05dd \u05de\u05db\u05d5\u05e0\u05df \u05d1\u05d7\u05d9\u05d9\u05e0\u05d5, \u05e2\u05d5\u05d3 \u05dc\u05d0 \u05e2\u05d9\u05db\u05dc\u05e0\u05d5 \u05d0\u05ea \u05d4\u05d4\u05ea\u05e8\u05d7\u05e9\u05d5\u05d9\u05d5\u05ea. \u05d0\u05e0\u05d5 \u05de\u05d9\u05d9\u05d7\u05dc\u05d9\u05dd \u05dc\u05d7\u05d6\u05e8\u05ea\u05d5 \u05d1\u05d7\u05d9\u05d9\u05dd \u05e9\u05dc \u05d0\u05d4\u05d5\u05d1\u05d9\u05e0\u05d5 \u05e2\u05d5\u05e4\u05e8 \u05e7\u05dc\u05d3\u05e8\u05d5\u05df \u05e9\u05e2\u05d3\u05d9\u05d9\u05df \u05e0\u05de\u05e6\u05d0 \u05d1\u05e1\u05db\u05e0\u05d4\"@N12chat"],["\u05e0\u05d9\u05e8 \u05d3\u05d1\u05d5\u05e8\u05d9\u05e2\u05d5\u05d3 \u05de\u05e9\u05d9\u05d7\u05ea \u05e8\u05d0\u05e9 \u05d4\u05de\u05de\u05e9\u05dc\u05d4 \u05e0\u05ea\u05e0\u05d9\u05d4\u05d5 \u05e2\u05dd \u05e8\u05d0\u05e9 \u05d4-CIA: \u05e7\u05d8\u05d0\u05e8 \u05d1\u05d9\u05e7\u05e9\u05d4 \u05de\u05d7\u05d5\u05d5\u05ea \u05d4\u05d5\u05de\u05e0\u05d9\u05d8\u05e8\u05d9\u05d5\u05ea \u05e0\u05d5\u05e1\u05e4\u05d5\u05ea \u05dc\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd \u05db\u05d3\u05d9 \u05dc\u05e7\u05d3\u05dd \u05d0\u05ea \u05d4\u05e2\u05e1\u05e7\u05d4. \u05e0\u05ea\u05e0\u05d9\u05d4\u05d5 \u05e1\u05e8\u05d1 \u05dc\u05d3\u05d5\u05df \u05d1\u05e0\u05d5\u05e9\u05d0 \u05e2\u05d3 \u05e9\u05d9\u05ea\u05e7\u05d1\u05dc\u05d5 \u05d4\u05d5\u05db\u05d7\u05d5\u05ea \u05dc\u05db\u05da \u05e9\u05d4\u05d7\u05d8\u05d5\u05e4\u05d9\u05dd \u05e7\u05d9\u05d1\u05dc\u05d5 \u05d0\u05ea \u05d4\u05ea\u05e8\u05d5\u05e4\u05d5\u05ea \u05e9\u05e0\u05e9\u05dc\u05d7\u05d5@N12chat",false,255,"\u05e0\u05d9\u05e8 \u05d3\u05d1\u05d5\u05e8\u05d9\u05e2\u05d5\u05d3 \u05de\u05e9\u05d9\u05d7\u05ea \u05e8\u05d0\u05e9 \u05d4\u05de\u05de\u05e9\u05dc\u05d4 \u05e0\u05ea\u05e0\u05d9\u05d4\u05d5 \u05e2\u05dd \u05e8\u05d0\u05e9 \u05d4-CIA: \u05e7\u05d8\u05d0\u05e8 \u05d1\u05d9\u05e7\u05e9\u05d4 \u05de\u05d7\u05d5\u05d5\u05ea \u05d4\u05d5\u05de\u05e0\u05d9\u05d8\u05e8\u05d9\u05d5\u05ea \u05e0\u05d5\u05e1\u05e4\u05d5\u05ea \u05dc\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd \u05db\u05d3\u05d9 \u05dc\u05e7\u05d3\u05dd \u05d0\u05ea \u05d4\u05e2\u05e1\u05e7\u05d4. \u05e0\u05ea\u05e0\u05d9\u05d4\u05d5 \u05e1\u05e8\u05d1 \u05dc\u05d3\u05d5\u05df \u05d1\u05e0\u05d5\u05e9\u05d0 \u05e2\u05d3 \u05e9\u05d9\u05ea\u05e7\u05d1\u05dc\u05d5 \u05d4\u05d5\u05db\u05d7\u05d5\u05ea \u05dc\u05db\u05da \u05e9\u05d4\u05d7\u05d8\u05d5\u05e4\u05d9\u05dd \u05e7\u05d9\u05d1\u05dc\u05d5 \u05d0\u05ea \u05d4\u05ea\u05e8\u05d5\u05e4\u05d5\u05ea \u05e9\u05e0\u05e9\u05dc\u05d7\u05d5@N12chat"],["\u05de\u05d1\u05d6\u05e7\u05df 12\u05d2\u05d1\u05e8 \u05db\u05d1\u05df 35 \u05e0\u05e4\u05e6\u05e2 \u05e7\u05e9\u05d4 \u05d1\u05d0\u05d9\u05e8\u05d5\u05e2 \u05d0\u05dc\u05d9\u05de\u05d5\u05ea \u05d1\u05d0\u05e9\u05d3\u05d5\u05d3. \u05e6\u05d5\u05d5\u05ea\u05d9 \u05de\u05d3\"\u05d0 \u05d8\u05d9\u05e4\u05dc\u05d5 \u05d1\u05d5 \u05d5\u05e4\u05d9\u05e0\u05d5 \u05d0\u05d5\u05ea\u05d5 \u05dc\u05d1\u05d9\u05ea \u05d4\u05d7\u05d5\u05dc\u05d9\u05dd \u05d0\u05e1\u05d5\u05ea\u05d0 \u05e2\u05dd \u05e4\u05e6\u05d9\u05e2\u05d5\u05ea \u05d7\u05d5\u05d3\u05e8\u05d5\u05ea@N12chat",false,256,"\u05de\u05d1\u05d6\u05e7\u05df 12\u05d2\u05d1\u05e8 \u05db\u05d1\u05df 35 \u05e0\u05e4\u05e6\u05e2 \u05e7\u05e9\u05d4 \u05d1\u05d0\u05d9\u05e8\u05d5\u05e2 \u05d0\u05dc\u05d9\u05de\u05d5\u05ea \u05d1\u05d0\u05e9\u05d3\u05d5\u05d3. \u05e6\u05d5\u05d5\u05ea\u05d9 \u05de\u05d3\"\u05d0 \u05d8\u05d9\u05e4\u05dc\u05d5 \u05d1\u05d5 \u05d5\u05e4\u05d9\u05e0\u05d5 \u05d0\u05d5\u05ea\u05d5 \u05dc\u05d1\u05d9\u05ea \u05d4\u05d7\u05d5\u05dc\u05d9\u05dd \u05d0\u05e1\u05d5\u05ea\u05d0 \u05e2\u05dd \u05e4\u05e6\u05d9\u05e2\u05d5\u05ea \u05d7\u05d5\u05d3\u05e8\u05d5\u05ea@N12chat"],["\"\u05e6\u05e2\u05d9\u05e8\u05d9 \u05d8\u05d5\u05dc\u05db\u05e8\u05dd\" \u05d1\u05d6\u05d9\u05e0\u05d6\u05d0\u05e0\u05d4\u05d0\u05d7\u05d3 \u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd \u05e9\u05e0\u05e2\u05e6\u05e8\u05d5 \u05d1\u05de\u05d1\u05e6\u05e2 \u05d4\u05e0\u05e2\u05e8\u05da \u05d1\u05d8\u05d5\u05dc\u05db\u05e8\u05dd \u05d4\u05e6\u05dc\u05d9\u05d7 \u05dc\u05d4\u05d1\u05e8\u05d9\u05d7 \u05d8\u05dc\u05e4\u05d5\u05df \u05e0\u05d9\u05d9\u05d3 \u05dc\u05e8\u05db\u05d1 \u05e9\u05dc\u05e7\u05d7 \u05d0\u05d5\u05ea\u05d5 \u05d5\u05d0\u05ea \u05d7\u05d1\u05e8\u05d9\u05d5 \u05dc\u05de\u05e2\u05e6\u05e8 \u05d5\u05e1\u05d9\u05e4\u05e7 \u05dc\u05e0\u05d5 \u05d4\u05e6\u05e6\u05d4 \u05e7\u05d8\u05e0\u05d4 \u05dc\u05de\u05ea\u05e8\u05d7\u05e9 \u05d1\u05e4\u05e0\u05d9\u05dd...\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,257,"\"\u05e6\u05e2\u05d9\u05e8\u05d9 \u05d8\u05d5\u05dc\u05db\u05e8\u05dd\" \u05d1\u05d6\u05d9\u05e0\u05d6\u05d0\u05e0\u05d4\u05d0\u05d7\u05d3 \u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd \u05e9\u05e0\u05e2\u05e6\u05e8\u05d5 \u05d1\u05de\u05d1\u05e6\u05e2 \u05d4\u05e0\u05e2\u05e8\u05da \u05d1\u05d8\u05d5\u05dc\u05db\u05e8\u05dd \u05d4\u05e6\u05dc\u05d9\u05d7 \u05dc\u05d4\u05d1\u05e8\u05d9\u05d7 \u05d8\u05dc\u05e4\u05d5\u05df \u05e0\u05d9\u05d9\u05d3 \u05dc\u05e8\u05db\u05d1 \u05e9\u05dc\u05e7\u05d7 \u05d0\u05d5\u05ea\u05d5 \u05d5\u05d0\u05ea \u05d7\u05d1\u05e8\u05d9\u05d5 \u05dc\u05de\u05e2\u05e6\u05e8 \u05d5\u05e1\u05d9\u05e4\u05e7 \u05dc\u05e0\u05d5 \u05d4\u
