\u05d4\u05d7\u05d5\u05e5\u05e8\u05d0\u05e9 \u05de\u05de\u05e9\u05dc\u05ea \u05e7\u05e0\u05d3\u05d4 \u05d8\u05e8\u05d5\u05d3\u05d5 \u05d0\u05de\u05e8 \u05db\u05d9 \u05d4\u05de\u05d3\u05d9\u05e0\u05d4 \u05d1\u05d5\u05d7\u05e0\u05ea \u05d4\u05d8\u05dc\u05ea \u05e1\u05e0\u05e7\u05e6\u05d9\u05d5\u05ea \u05e2\u05dc \u05de\u05ea\u05e0\u05d7\u05dc\u05d9\u05dd \"\u05d0\u05dc\u05d9\u05de\u05d9\u05dd\" \u05de\u05d4\u05d2\u05d3\u05d4 \u05d4\u05de\u05e2\u05e8\u05d1\u05d9\u05ea@N12chat"],["\u05d0\u05d5\u05e8 \u05e8\u05d1\u05d9\u05d3\ud83d\udcdd\u05e4\u05e8\u05e9\u05ea \u05d3\u05e8\u05d9\u05e1\u05ea \u05e8\u05e4\u05d0\u05dc \u05d0\u05d3\u05e0\u05d4 \u05d6\"\u05dc: \u05d4\u05e0\u05d4\u05d2\u05ea \u05e7\u05e8\u05d5\u05dc \u05e4\u05e1\u05dc\u05e8 \u05d1\u05ea \u05d4-80 \u05d4\u05d5\u05e8\u05e9\u05e2\u05d4 \u05d1\u05d4\u05ea\u05d0\u05dd \u05dc\u05d4\u05d5\u05d3\u05d0\u05ea\u05d4 \u05d1\u05d4\u05e4\u05e7\u05e8\u05ea\u05d5 \u05e9\u05dc \u05d4\u05d9\u05dc\u05d3@N12chat",false,283,"\u05d0\u05d5\u05e8 \u05e8\u05d1\u05d9\u05d3\ud83d\udcdd\u05e4\u05e8\u05e9\u05ea \u05d3\u05e8\u05d9\u05e1\u05ea \u05e8\u05e4\u05d0\u05dc \u05d0\u05d3\u05e0\u05d4 \u05d6\"\u05dc: \u05d4\u05e0\u05d4\u05d2\u05ea \u05e7\u05e8\u05d5\u05dc \u05e4\u05e1\u05dc\u05e8 \u05d1\u05ea \u05d4-80 \u05d4\u05d5\u05e8\u05e9\u05e2\u05d4 \u05d1\u05d4\u05ea\u05d0\u05dd \u05dc\u05d4\u05d5\u05d3\u05d0\u05ea\u05d4 \u05d1\u05d4\u05e4\u05e7\u05e8\u05ea\u05d5 \u05e9\u05dc \u05d4\u05d9\u05dc\u05d3@N12chat"],["\u05de\u05d1\u05d6\u05e7\u05df 12\u05e0\u05d7\u05dc \u05d7\u05ea\u05d9\u05e8\u05d4 \u05e9\u05d1\u05e0\u05d2\u05d1 \u05d4\u05d1\u05d5\u05e7\u05e8. \u05e6\u05d9\u05dc\u05d5\u05dd: \u05d2\u05f3\u05de\u05d9\u05dc \u05d0\u05d8\u05e8\u05e9, \u05e8\u05e9\u05d5\u05ea \u05d4\u05d8\u05d1\u05e2 \u05d5\u05d4\u05d2\u05e0\u05d9\u05dd@N12chat",false,284,"\u05de\u05d1\u05d6\u05e7\u05df 12\u05e0\u05d7\u05dc \u05d7\u05ea\u05d9\u05e8\u05d4 \u05e9\u05d1\u05e0\u05d2\u05d1 \u05d4\u05d1\u05d5\u05e7\u05e8. \u05e6\u05d9\u05dc\u05d5\u05dd: \u05d2\u05f3\u05de\u0 e4\u05e0\u05d9 \u05d4\u05d1\u05db\u05d9\u05e8\u05d9\u05dd \u05d1\u05de\u05e7\u05d5\u05dd. \"\u05dc\u05d0 \u05e0\u05d0\u05e4\u05e9\u05e8 \u05d7\u05d6\u05e8\u05d4 \u05dc\u05de\u05e6\u05d1 \u05d1\u05d5 \u05d4\u05d9\u05d9\u05e0\u05d5 \u05e2\u05d3 6 \u05d1\u05d0\u05d5\u05e7\u05d8\u05d5\u05d1\u05e8. \u05de\u05d2\u05d1\u05d9\u05e8\u05d9\u05dd \u05d0\u05ea \u05d4\u05de\u05d0\u05de\u05e6\u05d9\u05dd \u05e0\u05d2\u05d3 \u05d7\u05d9\u05d6\u05d1\u05d0\u05dc\u05dc\u05d4\", \u05d0\u05de\u05e8. \u05e6\u05d9\u05dc\u05d5\u05dd: \u05d0\u05dc\u05e2\u05d3 \u05de\u05dc\u05db\u05d4@N12chat",false,311,"\u05e0\u05d9\u05e8 \u05d3\u05d1\u05d5\u05e8\u05d9\u05e9\u05e8 \u05d4\u05d1\u05d9\u05d8\u05d7\u05d5\u05df \u05d9\u05d5\u05d0\u05d1 \u05d2\u05dc\u05e0\u05d8 \u05e7\u05d9\u05d1\u05dc \u05e1\u05e7\u05d9\u05e8\u05d4 \u05d1\u05d9\u05d8\u05d7\u05d5\u05e0\u05d9\u05ea \u05d1\u05e4\u05d9\u05e7\u05d5\u05d3 \u05d4\u05e6\u05e4\u05d5\u05df \u05d5\u05d4\u05d1\u05d9\u05e2 \u05d0\u05ea \u05d4\u05e2\u05e8\u05db\u05ea\u05d5 \u05d1\u05e4\u05e0\u05d9 \u05d4\u05d1\u05db\u05d9\u05e8\u05d9\u05dd \u05d1\u05de\u05e7\u05d5\u05dd. \"\u05dc\u05d0 \u05e0\u05d0\u05e4\u05e9\u05e8 \u05d7\u05d6\u05e8\u05d4 \u05dc\u05de\u05e6\u05d1 \u05d1\u05d5 \u05d4\u05d9\u05d9\u05e0\u05d5 \u05e2\u05d3 6 \u05d1\u05d0\u05d5\u05e7\u05d8\u05d5\u05d1\u05e8. \u05de\u05d2\u05d1\u05d9\u05e8\u05d9\u05dd \u05d0\u05ea \u05d4\u05de\u05d0\u05de\u05e6\u05d9\u05dd \u05e0\u05d2\u05d3 \u05d7\u05d9\u05d6\u05d1\u05d0\u05dc\u05dc\u05d4\", \u05d0\u05de\u05e8. \u05e6\u05d9\u05dc\u05d5\u05dd: \u05d0\u05dc\u05e2\u05d3 \u05de\u05dc\u05db\u05d4@N12chat"],["\u05ea\u05d9\u05e2\u05d5\u05d3 \u05de\u05d4\u05db\u05e4\u05e8 \u05d1\u05e0\u05ea \u05d2'\u05d1\u05d9\u05dc \u05d1\u05d3\u05e8\u05d5\u05dd \u05dc\u05d1\u05e0\u05d5\u05df \u05d0\u05d7\u05e8\u05d9 \u05db\u05e0\u05d9\u05e1\u05ea \u05d4\u05e4\u05e1\u05e7\u05ea \u05d4\u05d0\u05e9 \u05dc\u05ea\u05d5\u05e7\u05e4\u05d4.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,312,"\u05ea\u05d9\u05e2\u05d5\u05d3 \u05de\u05d4\u05db\u05e4\u05e8 \u05d1\u05e0\u05ea \u05d2'\u05d1\u05d9\u05dc \u05d1\u05d3\u05e8\u05d5\u05dd \u05dc\u05d1\u05e0\u05d5\u05df \u05d0\u05d7\u05e8\u05d9 \u05db\u05e0\u05d9\u05e1\u05ea \u05d4\u05e4\u05e1\u05e7\u05ea \u05d4\u05d0\u05e9 \u05dc\u05ea\u05d5\u05e7\u05e4\u05d4.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05e9\u05d5\u05e9\u05d9 \u05d7\u05ea\u05d5\u05e7\u05d4\u05e6\u05d5\u05d5\u05ea \u05d4\u05e7\u05e8\u05d1 \u05e9\u05dc \u05d7\u05d8\u05d9\u05d1\u05ea \u05d4\u05e0\u05d7\"\u05dc \u05e4\u05d5\u05e2\u05dc \u05d1\u05d9\u05de\u05d9\u05dd \u05d0\u05dc\u05d4 \u05d1\u05e4\u05d0\u05ea\u05d9 \u05d2'\u05d1\u05d0\u05dc\u05d9\u05d4 \u05db\u05d7\u05dc\u05e7 \u05de\u05d4\u05ea\u05de\u05e8\u05d5\u05df \u05d4\u05e7\u05e8\u05e7\u05e2\u05d9. \u05d1\u05de\u05d4\u05dc\u05da \u05d4\u05e4\u05e9\u05d9\u05d8\u05d4, \u05d0\u05d9\u05ea\u05e8\u05d5 \u05d4\u05dc\u05d5\u05d7\u05de\u05d9\u05dd \u05e9\u05d9\u05e9\u05d4 \u05e4\u05d9\u05e8\u05d9 \u05de\u05e0\u05d4\u05e8\u05d5\u05ea \u05d8\u05e8\u05d5\u05e8, \u05d0\u05d7\u05d3 \u05de\u05d4\u05dd \u05d1\u05ea\u05d5\u05da \u05de\u05e1\u05d2\u05d3 - \u05db\u05da \u05dc\u05e4\u05d9 \u05d3\u05d5\u05d1\u05e8 \u05e6\u05d4\"\u05dc. \u05d1\u05e4\u05e8\u05d3\u05e1 \u05e1\u05de\u05d5\u05da \u05dc\u05de\u05e1\u05d2\u05d3, \u05d0\u05d5\u05ea\u05e8\u05d5 \u05de\u05e9\u05d2\u05e8\u05d9 \u05e8\u05e7\u05d8\u05d5\u05ea \u05d5\u05d0\u05de\u05e6\u05e2\u05d9 \u05dc\u05d7\u05d9\u05de\u05d4. \u05db\u05dc\u05dc \u05d0\u05de\u05e6\u05e2\u05d9 \u05d4\u05dc\u05d7\u05d9\u05de\u05d4 \u05d5\u05d4\u05e8\u05e7\u05d8\u05d5\u05ea \u05d0\u05d5\u05ea\u05e8\u05d5 \u05d1\u05e7\u05e8\u05d1\u05ea \u05de\u05d1\u05e0\u05d9\u05dd \u05d0\u05d6\u05e8\u05d7\u05d9\u05d9\u05dd, \u05d1\u05ea\u05d9 \u05e1\u05e4\u05e8 \u05d5\u05d1\u05ea\u05d9 \u05de\u05d2\u05d5\u05e8\u05d9\u05dd \u05d1\u05de\u05e8\u05d7\u05d1@N12chat",false,313,"\u05e9\u05d5\u05e9\u05d9 \u05d7\u05ea\u05d5\u05e7\u05d4\u05e6\u05d5\u05d5\u05ea \u05d4\u05e7\u05e8\u05d1 \u05e9\u05dc \u05d7\u05d8\u05d9\u05d1\u05ea \u05d4\u05e0\u05d7\"\u05dc \u05e4\u05d5\u05e2\u05dc \u05d1\u05d9\u05de\u05d9\u05dd \u05d0\u05dc\u05d4 \u05d1\u05e4\u05d0\u05ea\u05d9 \u05d2'\u05d1\u05d0\u05dc\u05d9\u05d4 \u05db\u05d7\u05dc\u05e7 \u05de\u05d4\u05ea\u05de\u05e8\u05d5\u05df \u05d4\u05e7\u05e8\u05e7\u05e2\u05d9. \u05d1\u05de\u05d4\u05dc\u05da \u05d4\u05e4\u05e9\u05d9\u05d8\u05d4, \u05d0\u05d9\u05ea\u05e8\u05d5 \u05d4\u05dc\u05d5\u05d7\u05de\u05d9\u05dd \u05e9\u05d9\u05e9\u05d4 \u05e4\u05d9\u05e8\u05d9 \u05de\u05e0\u05d4\u05e8\u05d5\u05ea \u05d8\u05e8\u05d5\u05e8, \u05d0\u05d7\u05d3 \u05de\u05d4\u05dd \u05d1\u05ea\u05d5\u05da \u05de\u05e1\u05d2\u05d3 - \u05db\u05da \u05dc\u05e4\u05d9 \u05d3\u05d5\u05d1\u05e8 \u05e6\u05d4\"\u05dc. \u05d1\u05e4\u05e8\u05d3\u05e1 \u05e1\u05de\u05d5\u05da \u05dc\u05de\u05e1\u05d2\u05d3, \u05d0\u05d5\u05ea\u05e8\u05d5 \u05de\u05e9\u05d2\u05e8\u05d9 \u05e8\u05e7\u05d8\u05d5\u05ea \u05d5\u05d0\u05de\u05e6\u05e2\u05d9 \u05dc\u05d7\u05d9\u05de\u05d4. \u05db\u05dc\u05dc \u05d0\u05de\u05e6\u05e2\u05d9 \u05d4\u05dc\u05d7\u05d9\u05de\u05d4 \u05d5\u05d4\u05e8\u05e7\u05d8\u05d5\u05ea \u05d0\u05d5\u05ea\u05e8\u05d5 \u05d1\u05e7\u05e8\u05d1\u05ea \u05de\u05d1\u05e0\u05d9\u05dd \u05d0\u05d6\u05e8\u05d7\u05d9\u05d9\u05dd, \u05d1\u05ea\u05d9 \u05e1\u05e4\u05e8 \u05d5\u05d1\u05ea\u05d9 \u05de\u05d2\u05d5\u05e8\u05d9\u05dd \u05d1\u05de\u05e8\u05d7\u05d1@N12chat"],["\u05de\u05d1\u05d6\u05e7\u05df 12\u05d4\u05e9\u05e8 \u05dc\u05d1\u05d9\u05d8\u05d7\u05d5\u05df \u05dc\u05d0\u05d5\u05de\u05d9 \u05d1\u05df \u05d2\u05d1\u05d9\u05e8 \u05ea\u05e7\u05e3 \u05d0\u05ea \u05e9\u05e8 \u05d4\u05d1\u05d9\u05d8\u05d7\u05d5\u05df \u05d2\u05dc\u05e0\u05d8, \u05e2\u05dc \u05e8\u05e7\u05e2 \u05e6\u05d5 \u05de\u05e0\u05d4\u05dc\u05d9 \u05e9\u05d4\u05d5\u05e6\u05d0 \u05e0\u05d2\u05d3 \u05e4\u05e2\u05d9\u05dc \u05d9\u05de\u05d9\u05df \u05e7\u05d9\u05e6\u05d5\u05e0\u05d9. \u05d1\u05df \u05d2\u05d1\u05d9\u05e8 \u05e6\u05d9\u05d9\u05e5 \u05d1\u05e2\u05de\u05d5\u05d3 \u05d4-X \u05e9\u05dc\u05d5 (\u05d8\u05d5\u05d5\u05d9\u05d8\u05e8 \u05dc\u05e9\u05e2\u05d1\u05e8): \"\u05de\u05d9\u05e9\u05d4\u05d5 \u05d4\u05ea\u05d1\u05dc\u05d1\u05dc \u05d5\u05e9\u05db\u05d7 \u05de\u05d9 \u05d4\u05d0\u05d5\u05d9\u05d1 \u05d5\u05de\u05d9 \u05d4\u05d0\u05d5\u05d4\u05d1\"@N12chat",false,314,"\u05de\u05d1\u05d6\u05e7\u05df 12\u05d4\u05e9\u05e8 \u05dc\u05d1\u05d9\u05d8\u05d7\u05d5\u05df \u05dc\u05d0\u05d5\u05de\u05d9 \u05d1\u05df \u05d2\u05d1\u05d9\u05e8 \u05ea\u05e7\u05e3 \u05d0\u05ea \u05e9\u05e8 \u05d4\u05d1\u05d9\u05d8\u05d7\u05d5\u05df \u05d2\u05dc\u05e0\u05d8, \u05e2\u05dc \u05e8\u05e7\u05e2 \u05e6\u05d5 \u05de\u05e0\u05d4\u05dc\u05d9 \u05e9\u05d4\u05d5\u05e6\u05d0 \u05e0\u05d2\u05d3 \u05e4\u05e2\u05d9\u05dc \u05d9\u05de\u05d9\u05df \u05e7\u05d9\u05e6\u05d5\u05e0\u05d9. \u05d1\u05df \u05d2\u05d1\u05d9\u05e8 \u05e6\u05d9\u05d9\u05e5 \u05d1\u05e2\u05de\u05d5\u05d3 \u05d4-X \u05e9\u05dc\u05d5 (\u05d8\u05d5\u05d5\u05d9\u05d8\u05e8 \u05dc\u05e9\u05e2\u05d1\u05e8): \"\u05de\u05d9\u05e9\u05d4\u05d5 \u05d4\u05ea\u05d1\u05dc\u05d1\u05dc \u05d5\u05e9\u05db\u05d7 \u05de\u05d9 \u05d4\u05d0\u05d5\u05d9\u05d1 \u05d5\u05de\u05d9 \u05d4\u05d0\u05d5\u05d4\u05d1\"@N12chat"],["\u05d0\u05d5\u05e8 \u05e8\u05d1\u05d9\u05d3\u05d4\u05e4\u05d9\u05d2\u05d5\u05e2 \u05d1\u05e8\u05e2\u05e0\u05e0\u05d4: \u05d0\u05d7\u05d3 \u05d4\u05de\u05d7\u05d1\u05dc\u05d9\u05dd \u05e0\u05dc\u05db\u05d3 \u05e2\u05dd \u05ea\u05e2\u05d5\u05d3\u05ea \u05d6\u05d4\u05d5\u05ea \u05de\u05d6\u05d5\u05d9\u05e4\u05ea. \u05d4\u05d4\u05e2\u05e8\u05db\u05d4 - \u05d4\u05de\u05d7\u05d1\u05dc\u05d9\u05dd \u05d4\u05e9\u05ea\u05db\u05e0\u05d5 \u05d1\u05d9\u05d7\u05d9\u05d3\u05ea \u05d3\u05d9\u05d5\u05e8 \u05d1\u05d0\u05d6\u05d5\u05e8@N12chat",false,315,"\u05d0\u05d5\u05e8 \u05e8\u05d1\u05d9\u05d3\u05d4\u05e4\u05d9\u05d2\u05d5\u05e2 \u05d1\u05e8\u05e2\u05e0\u05e0\u05d4: \u05d0\u05d7\u05d3 \u05d4\u05de\u05d7\u05d1\u05dc\u05d9\u05dd \u05e0\u05dc\u05db\u05d3 \u05e2\u05dd \u05ea\u05e2\u05d5\u05d3\u05ea \u05d6\u05d4\u05d5\u05ea \u05de\u05d6\u05d5\u05d9\u05e4\u05ea. \u05d4\u05d4\u05e2\u05e8\u05db\u05d4 - \u05d4\u05de\u05d7\u05d1\u05dc\u05d9\u05dd \u05d4\u05e9\u05ea\u05db\u05e0\u05d5 \u05d1\u05d9\u05d7\u05d9\u05d3\u05ea \u05d3\u05d9\u05d5\u05e8 \u05d1\u05d0\u05d6\u05d5\u05e8@N12chat"],["2. \u05d8\u05e7\u05e1\u05d8\u05d5\u05e8\u05d5\u05ea \u05d9\u05dd \u05d4\u05de\u05dc\u05d7\ud83e\udd0d\u05de\u05dc\u05d7 \u05d5\u05d1\u05d5\u05e5 \u05e9\u05de\u05ea\u05d2\u05d1\u05e9\u05d9\u05dd \u05dc\u05d9\u05e6\u05d9\u05e8\u05ea \u05d0\u05de\u05e0\u05d5\u05ea \u05e9\u05dc \u05d4\u05d8\u05d1\u05e2.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,316,"2. \u05d8\u05e7\u05e1\u05d8\u05d5\u05e8\u05d5\u05ea \u05d9\u05dd \u05d4\u05de\u05dc\u05d7\ud83e\udd0d\u05de\u05dc\u05d7 \u05d5\u05d1\u05d5\u05e5 \u05e9\u05de\u05ea\u05d2\u05d1\u05e9\u05d9\u05dd \u05dc\u05d9\u05e6\u05d9\u05e8\u05ea \u05d0\u05de\u05e0\u05d5\u05ea \u05e9\u05dc \u05d4\u05d8\u05d1\u05e2.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05de\u05d7\u05e0\u05d4 \u05d0\u05d5\u05d4\u05dc\u05d9\u05dd \u05d7\u05d3\u05e9 \u05d4\u05d5\u05e7\u05dd \u05d1\u05d3\u05d9\u05e8 \u05d0\u05dc\u05d1\u05dc\u05d7 \u05d1\u05de\u05e8\u05db\u05d6 \u05d4\u05e8\u05e6\u05d5\u05e2\u05d4 \u05e2\u05d1\u05d5\u05e8 \u05d4\u05e2\u05e7\u05d5\u05e8\u05d9\u05dd \u05d4\u05d8\u05e8\u05d9\u05d9\u05dd \u05e9\u05d4\u05d2\u05d9\u05e2\u05d5 \u05de\u05e0\u05e6\u05d9\u05e8\u05d0\u05ea \u05d5\u05d0\u05dc\u05d1\u05e8\u05d9\u05d2'.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,317,"\u05de\u05d7\u05e0\u05d4 \u05d0\u05d5\u05d4\u05dc\u05d9\u05dd \u05d7\u05d3\u05e9 \u05d4\u05d5\u05e7\u05dd \u05d1\u05d3\u05d9\u05e8 \u05d0\u05dc\u05d1\u05dc\u05d7 \u05d1\u05de\u05e8\u05db\u05d6 \u05d4\u05e8\u05e6\u05d5\u05e2\u05d4 \u05e2\u05d1\u05d5\u05e8 \u05d4\u05e2\u05e7\u05d5\u05e8\u05d9\u05dd \u05d4\u05d8\u05e8\u05d9\u05d9\u05dd \u05e9\u05d4\u05d2\u05d9\u05e2\u05d5 \u05de\u05e0\u05e6\u05d9\u05e8\u05d0\u05ea \u05d5\u05d0\u05dc\u05d1\u05e8\u05d9\u05d2'.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05d1\u05e8\u05d4\u05e0\u05d5 \u05d8\u05d2\u05e0\u05d9\u05d4\u05d3\u05d9\u05d5\u05d5\u05d7 \u05e2\u05dc \u05e9\u05e8\u05e4\u05d4 \u05d1\u05e7\u05e8\u05d5\u05df \u05e8\u05db\u05d1\u05ea \u05d1\u05ea\u05d7\u05e0\u05ea \u05e8\u05db\u05d1\u05ea \u05e7\u05dc\u05d4 \u05d0\u05dc\u05d9\u05e4\u05dc\u05d8 \u05d1\u05ea\u05dc \u05d0\u05d1\u05d9\u05d1. \u05db\u05db\u05dc \u05d4\u05e0\u05e8\u05d0\u05d4 \u05db\u05dc\u05dc \u05d4\u05e0\u05d5\u05e1\u05e2\u05d9\u05dd \u05d7\u05d5\u05dc\u05e6\u05d5 \u05de\u05d4\u05e7\u05e8\u05d5\u05df \u05d5\u05d0\u05d9\u05df \u05e0\u05e4\u05d2\u05e2\u05d9\u05dd@N12chat",false,318,"\u05d1\u05e8\u05d4\u05e0\u05d5 \u05d8\u05d2\u05e0\u05d9\u05d4\u05d3\u05d9\u05d5\u05d5\u05d7 \u05e2\u05dc \u05e9\u05e8\u05e4\u05d4 \u05d1\u05e7\u05e8\u05d5\u05df \u05e8\u05db\u05d1\u05ea \u05d1\u05ea\u05d7\u05e0\u05ea \u05e8\u05db\u05d1\u05ea \u05e7\u05dc\u05d4 \u05d0\u05dc\u05d9\u05e4\u05dc\u05d8 \u05d1\u05ea\u05dc \u05d0\u05d1\u05d9\u05d1. \u05db\u05db\u05dc \u05d4\u05e0\u05e8\u05d0\u05d4 \u05db\u05dc\u05dc \u05d4\u05e0\u05d5\u05e1\u05e2\u05d9\u05dd \u05d7\u05d5\u05dc\u05e6\u05d5 \u05de\u05d4\u05e7\u05e8\u05d5\u05df \u05d5\u05d0\u05d9\u05df \u05e0\u05e4\u05d2\u05e2\u05d9\u05dd@N12chat"],["\u05de\u05d1\u05d6\u05e7\u05df 12\u05ea\u05d5\u05e9\u05d1 \u05de\u05d6\u05e8\u05d7 \u05d9\u05e8\u05d5\u05e9\u05dc\u05d9\u05dd \u05d1\u05df 18 \u05e0\u05e2\u05e6\u05e8 \u05d1\u05d7\u05e9\u05d3 \u05e9\u05ea\u05e7\u05e3 \u05d0\u05ea \u05d1\u05ea \u05d6\u05d5\u05d2\u05d5 - \u05e9\u05e0\u05d6\u05e7\u05e7\u05d4 \u05dc\u05d8\u05d9\u05e4\u05d5\u05dc \u05e8\u05e4\u05d5\u05d0\u05d9 \u05d1\u05d1\u05d9\u05ea \u05d4\u05d7\u05d5\u05dc\u05d9\u05dd. \u05e2\u05dc \u05e4\u05d9 \u05d4\u05d7\u05e9\u05d3, \u05d1\u05e2\u05e7\u05d1\u05d5\u05ea \u05d5\u05d9\u05db\u05d5\u05d7 \u05e9\u05d4\u05ea\u05d2\u05dc\u05e2 \u05d1\u05d9\u05df \u05d4\u05e9\u05e0\u05d9\u05d9\u05dd, \u05d4\u05e6\u05e2\u05d9\u05e8 \u05d6\u05e8\u05e7 \u05e2\u05dc\u05d9\u05d4 \u05db\u05d9\u05e1\u05d0 \u05d5\u05db\u05d5\u05e1\u05d5\u05ea \u05e7\u05e4\u05d4, \u05e9\u05d1\u05e8 \u05d0\u05ea \u05d4\u05de\u05db\u05e9\u05d9\u05e8 \u05d4\u05e1\u05dc\u05d5\u05dc\u05e8\u05d9 \u05e9\u05d1\u05e8\u05e9\u05d5\u05ea\u05d4 \u05d5\u05d0\u05d9\u05d9\u05dd \u05e9\u05d9\u05e8\u05e6\u05d7 \u05d0\u05d5\u05ea\u05d4. \u05de\u05e2\u05e6\u05e8\u05d5 \u05d4\u05d5\u05d0\u05e8\u05da \u05e2\u05d3 \u05dc\u05d9\u05d5\u05dd \u05e9\u05dc\u05d9\u05e9\u05d9 \u05d5\u05d4\u05d7\u05e7\u05d9\u05e8\u05d4 \u05e0\u05de\u05e9\u05db\u05ea@N12chat",false,319,"\u05de\u05d1\u05d6\u05e7\u05df 12\u05ea\u05d5\u05e9\u05d1 \u05de\u05d6\u05e8\u05d7 \u05d9\u05e8\u05d5\u05e9\u05dc\u05d9\u05dd \u05d1\u05df 18 \u05e0\u05e2\u05e6\u05e8 \u05d1\u05d7\u05e9\u05d3 \u05e9\u05ea\u05e7\u05e3 \u05d0\u05ea \u05d1\u05ea \u05d6\u05d5\u05d2\u05d5 - \u05e9\u05e0\u05d6\u05e7\u05e7\u05d4 \u05dc\u05d8\u05d9\u05e4\u05d5\u05dc \u05e8\u05e4\u05d5\u05d0\u05d9 \u05d1\u05d1\u05d9\u05ea \u05d4\u05d7\u05d5\u05dc\u05d9\u05dd. \u05e2\u05dc \u05e4\u05d9 \u05d4\u05d7\u05e9\u05d3, \u05d1\u05e2\u05e7\u05d1\u05d5\u05ea \u05d5\u05d9\u05db\u05d5\u05d7 \u05e9\u05d4\u05ea\u05d2\u05dc\u05e2 \u05d1\u05d9\u05df \u05d4\u05e9\u05e0\u05d9\u05d9\u05dd, \u05d4\u05e6\u05e2\u05d9\u05e8 \u05d6\u05e8\u05e7 \u05e2\u05dc\u05d9\u05d4 \u05db\u05d9\u05e1\u05d0 \u05d5\u05db\u05d5\u05e1\u05d5\u05ea \u05e7\u05e4\u05d4, \u05e9\u05d1\u05e8 \u05d0\u05ea \u05d4\u05de\u05db\u05e9\u05d9\u05e8 \u05d4\u05e1\u05dc\u05d5\u05dc\u05e8\u05d9 \u05e9\u05d1\u05e8\u05e9\u05d5\u05ea\u05d4 \u05d5\u05d0\u05d9\u05d9\u05dd \u05e9\u05d9\u05e8\u05e6\u05d7 \u05d0\u05d5\u05ea\u05d4. \u05de\u05e2\u05e6\u05e8\u05d5 \u05d4\u05d5\u05d0\ u05d7\u05d9\u05e1\u05d5\u05dc \u05d0\u05dc-\u05e2\u05d0\u05e8\u05d5\u05e8\u05d9: \"\u05d4\u05ea\u05d2\u05d5\u05d1\u05d4 \u05d4\u05d9\u05d0 \u05d5\u05d3\u05d0\u05d9\u05ea, \u05dc\u05d0 \u05e0\u05e9\u05ea\u05d5\u05e7 \u05e2\u05dc \u05d4\u05d7\u05d9\u05e1\u05d5\u05dc \u05d1\u05e8\u05d5\u05d1\u05e2 \u05d4\u05d3\u05d0\u05d7\u05d9\u05d4 - \u05d0\u05d7\u05e8\u05ea \u05db\u05dc \u05dc\u05d1\u05e0\u05d5\u05df \u05ea\u05d4\u05d9\u05d4 \u05d7\u05e9\u05d5\u05e4\u05d4\". \u05e2\u05d5\u05d3 \u05dc\u05d3\u05d1\u05e8\u05d9\u05d5, \"\u05de\u05d9 \u05e9\u05dc\u05d5\u05d7\u05e6\u05d9\u05dd \u05dc\u05d1\u05e6\u05e2 \u05de\u05ea\u05e7\u05e4\u05d4 \u05d1\u05dc\u05d1\u05e0\u05d5\u05df - \u05d0\u05e0\u05d9 \u05d0\u05d5\u05de\u05e8 \u05dc\u05db\u05dd \u05e9\u05d6\u05d5 \u05e9\u05d2\u05d9\u05d0\u05d4. \u05d0\u05ea\u05dd \u05ea\u05e9\u05dc\u05de\u05d5 \u05d0\u05ea \u05d4\u05de\u05d7\u05d9\u05e8, \u05d4\u05e4\u05ea\u05e8\u05d5\u05df \u05d4\u05d5\u05d0 \u05dc\u05d1\u05e7\u05e9 \u05de\u05d4\u05de\u05de\u05e9\u05dc\u05d4 \u05d4\u05d9\u05e9\u05e8\u05d0\u05dc\u05d9\u05ea \u05dc\u05d4\u05e4\u05e1\u05d9\u05e7 \u05d0\u05ea \u05d4\u05de\u05dc\u05d7\u05de\u05d4 \u05d1\u05e2\u05d6\u05d4\"@N12chat",false,353,"\u05d9\u05e8\u05d5\u05df \u05e9\u05e0\u05d9\u05d9\u05d3\u05e8\ud83d\udcdd\u05e0\u05e1\u05e8\u05d0\u05dc\u05dc\u05d4 \u05de\u05ea\u05d9\u05d9\u05d7\u05e1 \u05d1\u05e0\u05d0\u05d5\u05de\u05d5 \u05dc\u05d7\u05d9\u05e1\u05d5\u05dc \u05d0\u05dc-\u05e2\u05d0\u05e8\u05d5\u05e8\u05d9: \"\u05d4\u05ea\u05d2\u05d5\u05d1\u05d4 \u05d4\u05d9\u05d0 \u05d5\u05d3\u05d0\u05d9\u05ea, \u05dc\u05d0 \u05e0\u05e9\u05ea\u05d5\u05e7 \u05e2\u05dc \u05d4\u05d7\u05d9\u05e1\u05d5\u05dc \u05d1\u05e8\u05d5\u05d1\u05e2 \u05d4\u05d3\u05d0\u05d7\u05d9\u05d4 - \u05d0\u05d7\u05e8\u05ea \u05db\u05dc \u05dc\u05d1\u05e0\u05d5\u05df \u05ea\u05d4\u05d9\u05d4 \u05d7\u05e9\u05d5\u05e4\u05d4\". \u05e2\u05d5\u05d3 \u05dc\u05d3\u05d1\u05e8\u05d9\u05d5, \"\u05de\u05d9 \u05e9\u05dc\u05d5\u05d7\u05e6\u05d9\u05dd \u05dc\u05d1\u05e6\u05e2 \u05de\u05e ea \u05d4\u05d7\u05d8\u05d5\u05e4\u05d9\u05dd \u05dc\u05d9\u05d3\u05d9 \u05d4\u05e6\u05dc\u05d1 \u05d4\u05d0\u05d3\u05d5\u05dd \u05d1\u05de\u05e8\u05db\u05d6 \u05d4\u05e2\u05d9\u05e8 \u05e2\u05d6\u05d4, \u05db\u05e4\u05d9 \u05e9\u05e9\u05d5\u05d3\u05e8 \u05d1\u05e2\u05e8\u05d5\u05e5 \u05d0\u05dc\u05d2'\u05d6\u05d9\u05e8\u05d4.\n"],["\u05de\u05d1\u05d6\u05e7\u05df 12\ud83d\udcdd\u05d0\u05d6\u05e2\u05e7\u05d4 \u05d1\u05d9\u05e4\u05ea\u05d7 \u05e9\u05d1\u05d2\u05dc\u05d9\u05dc \u05d4\u05e2\u05dc\u05d9\u05d5\u05df. \u05d1\u05de\u05e7\u05d1\u05d9\u05dc, \u05d4\u05d5\u05e4\u05e2\u05dc\u05d4 \u05d4\u05ea\u05e8\u05e2\u05ea \u05d7\u05d3\u05d9\u05e8\u05ea \u05db\u05dc\u05d9 \u05d8\u05d9\u05e1 \u05e2\u05d5\u05d9\u05df \u05d1\u05d0\u05e6\u05d1\u05e2 \u05d4\u05d2\u05dc\u05d9\u05dc@N12chat",false,359,"\u05de\u05d1\u05d6\u05e7\u05df 12\ud83d\udcdd\u05d0\u05d6\u05e2\u05e7\u05d4 \u05d1\u05d9\u05e4\u05ea\u05d7 \u05e9\u05d1\u05d2\u05dc\u05d9\u05dc \u05d4\u05e2\u05dc\u05d9\u05d5\u05df. \u05d1\u05de\u05e7\u05d1\u05d9\u05dc, \u05d4\u05d5\u05e4\u05e2\u05dc\u05d4 \u05d4\u05ea\u05e8\u05e2\u05ea \u05d7\u05d3\u05d9\u05e8\u05ea \u05db\u05dc\u05d9 \u05d8\u05d9\u05e1 \u05e2\u05d5\u05d9\u05df \u05d1\u05d0\u05e6\u05d1\u05e2 \u05d4\u05d2\u05dc\u05d9\u05dc@N12chat"],["\u05de\u05d1\u05d6\u05e7\u05df 12\u05d0\u05d7\u05d5\u05ea\u05d4 \u05e9\u05dc \u05e9\u05e0\u05d9 \u05d2\u05d5\u05e8\u05df, \u05d4\u05de\u05d8\u05e4\u05dc\u05ea \u05de\u05e0\u05d9\u05e8 \u05e2\u05d5\u05d6 \u05e9\u05e0\u05d7\u05d8\u05e4\u05d4 \u05dc\u05e2\u05d6\u05d4 \u05d5\u05e9\u05d1\u05d4 \u05d0\u05de\u05e9 \u05d4\u05d1\u05d9\u05ea\u05d4, \u05d1\u05e4\u05d5\u05e1\u05d8 \u05d1\u05e4\u05d9\u05d9\u05e1\u05d1\u05d5\u05e7: \"\u05d6\u05db\u05d9\u05e0\u05d5 \u05dc\u05d7\u05d9\u05d9\u05da, \u05e9\u05e0\u05d9 \u05d7\u05d6\u05e8\u05d4 \u05d0\u05dc\u05d9\u05e0\u05d5. \u05d4\u05de\u05d0\u05d1\u05e7 \u05e9\u05dc\u05e0\u05d5 \u05dc\u05d0 \u05d4\u05e1\u05ea\u05d9\u05d9\u05dd. \u05e2\u05d3 \u05e9\u05d0\u05d7\u05e8\u05d5\u05df \u05d4\u05d7\u05d8\u05d5\u05e4\u05d9\u05dd \u05d7\u05d5\u05d6\u05e8\"@N12chat",false,360,"\u05de\u05d1\u05d6\u05e7\u05df 12\u05d0\u05d7\u05d5\u05ea\u05d4 \u05e9\u05dc \u05e9\u05e0\u05d9 \u05d2\u05d5\u05e8\u05df, \u05d4\u05de\u05d8\u05e4\u05dc\u05ea \u05de\u05e0\u05d9\u05e8 \u05e2\u05d5\u05d6 \u05e9\u05e0\u05d7\u05d8\u05e4\u05d4 \u05dc\u05e2\u05d6\u05d4 \u05d5\u05e9\u05d1\u05d4 \u05d0\u05de\u05e9 \u05d4\u05d1\u05d9\u05ea\u05d4, \u05d1\u05e4\u05d5\u05e1\u05d8 \u05d1\u05e4\u05d9\u05d9\u05e1\u05d1\u05d5\u05e7: \"\u05d6\u05db\u05d9\u05e0\u05d5 \u05dc\u05d7\u05d9\u05d9\u05da, \u05e9\u05e0\u05d9 \u05d7\u05d6\u05e8\u05d4 \u05d0\u05dc\u05d9\u05e0\u05d5. \u05d4\u05de\u05d0\u05d1\u05e7 \u05e9\u05dc\u05e0\u05d5 \u05dc\u05d0 \u05d4\u05e1\u05ea\u05d9\u05d9\u05dd. \u05e2\u05d3 \u05e9\u05d0\u05d7\u05e8\u05d5\u05df \u05d4\u05d7\u05d8\u05d5\u05e4\u05d9\u05dd \u05d7\u05d5\u05d6\u05e8\"@N12chat"],["\u05d0\u05d5\u05e8 \u05e8\u05d1\u05d9\u05d3\u05ea\u05d5\u05e9\u05d1 \u05d8\u05d9\u05d9\u05d1\u05d4 \u05db\u05d1\u05df 21 \u05e0\u05e2\u05e6\u05e8 \u05dc\u05d0\u05d7\u05e8 \u05e9\u05d4\u05d1\u05d9\u05e2 \u05d1\u05e8\u05e9\u05ea\u05d5\u05ea \u05d4\u05d7\u05d1\u05e8\u05ea\u05d9\u05d5\u05ea \u05ea\u05de\u05d9\u05db\u05d4 \u05d1\u05d7\u05de\u05d0\u05e1. \u05d4\u05d5\u05d0 \u05e4\u05e8\u05e1\u05dd \u05db\u05de\u05d4 \u05ea\u05de\u05d5\u05e0\u05d5\u05ea \u05d5\u05d1\u05d4\u05df \u05db\u05d9\u05ea\u05d5\u05d1 \u05d4\u05de\u05d4\u05dc\u05dc \u05d1\u05d9\u05df \u05d4\u05e9\u05d0\u05e8 \u05d0\u05ea \u05d4\u05de\u05d7\u05d1\u05dc\u05d9\u05dd \u05d5\u05e7\u05e8\u05d0 \u05dc\u05d4\u05e6\u05d8\u05e8\u05e3 \u05d0\u05dc\u05d9\u05d4\u05dd. \u05db\u05de\u05d5 \u05db\u05df, \u05d4\u05d5\u05d0 \u05db\u05ea\u05d1: \"\u05ea\u05d4\u05d9\u05d4 \u05de\u05e2\u05d5\u05e8\u05d1 \u05d5\u05de\u05d5\u05e8\u05d3... \u05de\u05d9 \u05e9\u05de\u05d5\u05e1\u05dc\u05de\u05d9 \u05d5\u05dc\u05d0 \u05de\u05e6\u05d8\u05e8\u05e3 \u05dc\u05d4\u05ea\u05e0\u05d2\u05d3\u05d5\u05ea \u05e0\u05d2\u05d3 \u05d9\u05e9\u05e8\u05d0\u05dc \u05e6\u05e8\u05d9\u05da \u05dc\u05d1\u05d3\u05d5\u05e7 \u05d0\u05ea \u05d4\u05d0\u05d9\u05e1\u05dc\u05d0\u05dd \u05e9\u05dc\u05d5\"@N12chat",false,361,"\u05d0\u05d5\u05e8 \u05e8\u05d1\u05d9\u05d3\u05ea\u05d5\u05e9\u05d1 \u05d8\u05d9\u05d9\u05d1\u05d4 \u05db\u05d1\u05df 21 \u05e0\u05e2\u05e6\u05e8 \u05dc\u05d0\u05d7\u05e8 \u05e9\u05d4\u05d1\u05d9\u05e2 \u05d1\u05e8\u05e9\u05ea\u05d5\u05ea \u05d4\u05d7\u05d1\u05e8\u05ea\u05d9\u05d5\u05ea \u05ea\u05de\u05d9\u05db\u05d4 \u05d1\u05d7\u05de\u05d0\u05e1. \u05d4\u05d5\u05d0 \u05e4\u05e8\u05e1\u05dd \u05db\u05de\u05d4 \u05ea\u05de\u05d5\u05e0\u05d5\u05ea \u05d5\u05d1\u05d4\u05df \u05db\u05d9\u05ea\u05d5\u05d1 \u05d4\u05de\u05d4\u05dc\u05dc \u05d1\u05d9\u05df \u05d4\u05e9\u05d0\u05e8 \u05d0\u05ea \u05d4\u05de\u05d7\u05d1\u05dc\u05d9\u05dd \u05d5\u05e7\u05e8\u05d0 \u05dc\u05d4\u05e6\u05d8\u05e8\u05e3 \u05d0\u05dc\u05d9\u05d4\u05dd. \u05db\u05de\u05d5 \u05db\u05df, \u05d4\u05d5\u05d0 \u05db\u05ea\u05d1: \"\u05ea\u05d4\u05d9\u05d4 \u05de\u05e2\u05d5\u05e8\u05d1 \u05d5\u05de\u05d5\u05e8\u05d3... \u05de\u05d9 \u05e9\u05de\u05d5\u05e1\u05dc\u05de\u05d9 \u05d5\u05dc\u05d0 \u05de\u05e6\u05d8\u05e8\u05e3 \u05dc\u05d4\u05ea\u05e0\u05d2\u05d3\u05d5\u05ea \u05e0\u05d2\u05d3 \u05d9\u05e9\u05e8\u05d0\u05dc \u05e6\u05e8\u05d9\u05da \u05dc\u05d1\u05d3\u05d5\u05e7 \u05d0\u05ea \u05d4\u05d0\u05d9\u05e1\u05dc\u05d0\u05dd \u05e9\u05dc\u05d5\"@N12chat"],["\u05d4\u05e2\u05e8\u05d5\u05e6\u05d9\u05dd \u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd \u05de\u05ea\u05e2\u05d3\u05d9\u05dd \u05d1\u05d4\u05e8\u05d7\u05d1\u05d4 (\u05d5\u05d1\u05e9\u05de\u05d7\u05d4) \u05d0\u05ea \u05d4\u05de\u05ea\u05e8\u05d7\u05e9 \u05d1\u05ea\u05dc \u05d0\u05d1\u05d9\u05d1.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,362,"\u05d4\u05e2\u05e8\u05d5\u05e6\u05d9\u05dd \u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd \u05de\u05ea\u05e2\u05d3\u05d9\u05dd \u05d1\u05d4\u05e8\u05d7\u05d1\u05d4 (\u05d5\u05d1\u05e9\u05de\u05d7\u05d4) \u05d0\u05ea \u05d4\u05de\u05ea\u05e8\u05d7\u05e9 \u05d1\u05ea\u05dc \u05d0\u05d1\u05d9\u05d1.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05d3\u05e1\u05e7 \u05d4\u05e2\u05d5\u05dc\u05dd \u05d4\u05e2\u05e8\u05d1\u05d9\u05d3\u05d5\u05d1\u05e8 \u05d4\u05d7\u05d5\u05ea'\u05d9\u05dd: \u05d7\u05de\u05d9\u05e9\u05d4 \u05dc\u05d5\u05d7\u05de\u05d9\u05dd \u05de\u05db\u05d5\u05d7\u05d5\u05ea\u05d9\u05e0\u05d5 \u05e0\u05d4\u05e8\u05d2\u05d5 \u05d5\u05e9\u05d9\u05e9\u05d4 \u05d0\u05d7\u05e8\u05d9\u05dd \u05e0\u05e4\u05e6\u05e2\u05d5 \u05d1\u05ea\u05e7\u05d9\u05e4\u05d4@N12chat",false,363,"\u05d3\u05e1\u05e7 \u05d4\u05e2\u05d5\u05dc\u05dd \u05d4\u05e2\u05e8\u05d1\u05d9\u05d3\u05d5\u05d1\u05e8 \u05d4\u05d7\u05d5\u05ea'\u05d9\u05dd: \u05d7\u05de\u05d9\u05e9\u05d4 \u05dc\u05d5\u05d7\u05de\u05d9\u05dd \u05de\u05db\u05d5\u05d7\u05d5\u05ea\u05d9\u05e0\u05d5 \u05e0\u05d4\u05e8\u05d2\u05d5 \u05d5\u05e9\u05d9\u05e9\u05d4 \u05d0\u05d7\u05e8\u05d9\u05dd \u05e0\u05e4\u05e6\u05e2\u05d5 \u05d1\u05ea\u05e7\u05d9\u05e4\u05d4@N12chat"],["\u05e0\u05e8\u05d0\u05d4 \u05db\u05de\u05d5 \u05d7\u05d9\u05e1\u05d5\u05dc \u05e2\u05dd \u05d7\u05ea\u05d9\u05de\u05d4 \u05d0\u05de\u05e8\u05d9\u05e7\u05d0\u05d9\u05ea.\u05e0\u05de\u05ea\u05d9\u05df \u05dc\u05e4\u05e8\u05d8\u05d9\u05dd \u05e0\u05d5\u05e1\u05e4\u05d9\u05dd.\n",false,364,"\u05e0\u05e8\u05d0\u05d4 \u05db\u05de\u05d5 \u05d7\u05d9\u05e1\u05d5\u05dc \u05e2\u05dd \u05d7\u05ea\u05d9\u05de\u05d4 \u05d0\u05de\u05e8\u05d9\u05e7\u05d0\u05d9\u05ea.\u05e0\u05de\u05ea\u05d9\u05df \u05dc\u05e4\u05e8\u05d8\u05d9\u05dd \u05e0\u05d5\u05e1\u05e4\u05d9\u05dd.\n"],["\u05de\u05e7\u05d5\u05e8\u05d5\u05ea \u05de\u05e6\u05e8\u05d9\u05d9\u05dd: \u05de\u05e9\u05dc\u05d7\u05ea \u05d1\u05db\u05d9\u05e8\u05d4 \u05e9\u05dc \u05d7\u05de\u05d0\u05e1 \u05e6\u05e4\u05d5\u05d9\u05d4 \u05dc\u05d4\u05d2\u05d9\u05e2 \u05de\u05d7\u05e8 \u05dc\u05e7\u05d4\u05d9\u05e8 \u05dc\u05d3\u05d5\u05df \u05d1\u05de\u05e1\u05d2\u05e8\u05ea \u05dc\u05d4\u05e1\u05db\u05dd \u05e2\u05dc \u05d1\u05e1\u05d9\u05e1 \u05d4\u05d4\u05e6\u05e2\u05d4 \u05e9\u05d2\u05d5\u05d1\u05e9\u05d4 \u05d1\u05e4\u05e8\u05d9\u05d6.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,365,"\u05de\u05e7\u05d5\u05e8\u05d5\u05ea \u05de\u05e6\u05e8\u05d9\u05d9\u05dd: \u05de\u05e9\u05dc\u05d7\u05ea \u05d1\u05db\u05d9\u05e8\u05d4 \u05e9\u05dc \u05d7\u05de\u05d0\u05e1 \u05e6\u05e4\u05d5\u05d9\u05d4 \u05dc\u05d4\u05d2\u05d9\u05e2 \u05de\u05d7\u05e8 \u05dc\u05e7\u05d4\u05d9\u05e8 \u05dc\u05d3\u05d5\u05df \u05d1\u05de\u05e1\u05d2\u05e8\u05ea \u05dc\u05d4\u05e1\u05db\u05dd \u05e2\u05dc \u05d1\u05e1\u05d9\u05e1 \u05d4\u05d4\u05e6\u05e2\u05d4 \u05e9\u05d2\u05d5\u05d1\u05e9\u05d4 \u05d1\u05e4\u05e8\u05d9\u05d6.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd \u05de\u05d3\u05d5\u05d5\u05d7\u05d9\u05dd \u05e9\u05d1\u05d2\u05dc \u05d4\u05ea\u05e7\u05d9\u05e4\u05d5\u05ea \u05d4\u05e9\u05e0\u05d9 \u05e9\u05d1\u05d9\u05e6\u05e2 \u05e6\u05d4\"\u05dc \u05d4\u05e2\u05e8\u05d1 \u05d1\u05de\u05e8\u05db\u05d6 \u05d4\u05e8\u05e6\u05d5\u05e2\u05d4 \u05d4\u05d5\u05ea\u05e7\u05e4\u05d5 \u05d4\u05d3\u05e8\u05db\u05d9\u05dd \u05d4\u05e8\u05d0\u05e9\u05d9\u05d5\u05ea \u05d1\u05d9\u05df \u05de\u05d7\u05e0\u05d5\u05ea \u05d4\u05e4\u05dc\u05d9\u05d8\u05d9\u05dd \u05d0\u05dc\u05de\u05e2'\u05d0\u05d6\u05d9, \u05d0\u05dc\u05d1\u05e8\u05d9\u05d2' \u05d5\u05e0\u05e6\u05d9\u05e8\u05d0\u05ea \u05d1\u05de\u05e8\u05db\u05d6 \u05d4\u05e8\u05e6\u05d5\u05e2\u05d4 \u05d5\u05db\u05e2\u05ea \u05dc\u05d0 \u05e0\u05d9\u05ea\u05df \u05dc\u05e0\u05e1\u05d5\u05e2 \u05d1\u05d4\u05df.\n",false,366,"\u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd \u05de\u05d3\u05d5\u05d5\u05d7\u05d9\u05dd \u05e9\u05d1\u05d2\u05dc \u05d4\u05 9\u05d0\u05d7\u05de\u05d3 \u05e4\u05d2'\u05dd, \u05d0\u05e1\u05d9\u05e8 \u05de\u05e9\u05d5\u05d7\u05e8\u05e8 \u05de\u05e2\u05e1\u05e7\u05ea \u05e9\u05dc\u05d9\u05d8 \u05e0\u05d4\u05e8\u05d2 \u05dc\u05e4\u05e0\u05d9 \u05d6\u05de\u05df \u05e7\u05e6\u05e8 \u05d1\u05ea\u05e7\u05d9\u05e4\u05d4 \u05d1\u05d0\u05d6\u05d5\u05e8 \u05de\u05e1\u05d2\u05d3 \u05d0-\u05e1\u05e0\u05d9\u05d4 \u05d1\u05d7'\u05d0\u05df \u05d9\u05d5\u05e0\u05e1 (\u05d3\u05e8\u05d5\u05dd \u05d4\u05e8\u05e6\u05d5\u05e2\u05d4).\u05e4\u05d2'\u05dd \u05e0\u05d4\u05d2 \"\u05dc\u05d7\u05e0\u05da\" \u05d0\u05ea \u05d4\u05d0\u05d5\u05db\u05dc\u05d5\u05e1\u05d9\u05d9\u05d4 \u05d4\u05e6\u05e2\u05d9\u05e8\u05d4 \u05d1\u05e8\u05e6\u05d5\u05e2\u05d4 \u05d5\u05d4\u05e8\u05d1\u05d4 \u05dc\u05d4\u05d2\u05d9\u05e2 \u05dc\u05d1\u05ea\u05d9 \u05e1\u05e4\u05e8 \u05d9\u05e1\u05d5\u05d3\u05d9\u05d9\u05dd (\u05d1\u05e2\u05d9\u05e7\u05e8 \u05e9\u05dc \u05d1\u05e0\u05d5\u05ea) \u05db\u05d3\u05d9 \u05dc\u05d4\u05e8\u05e6\u05d5\u05ea \u05e2\u05dc \u05d4\u05d7\u05e9\u05d9\u05d1\u05d5\u05ea \u05e9\u05d1\u05e2\u05e1\u05e7\u05ea \u05e9\u05d7\u05e8\u05d5\u05e8 \u05d0\u05e1\u05d9\u05e8\u05d9\u05dd \u05e0\u05d5\u05e1\u05e4\u05ea \u05db\u05de\u05d5 \u05e2\u05e1\u05e7\u05ea \u05e9\u05dc\u05d9\u05d8 \u05e9\u05ea\u05d5\u05d1\u05d9\u05dc \u05dc\u05e9\u05d7\u05e8\u05d5\u05e8 \u05d4\u05d0\u05e1\u05d9\u05e8\u05d9\u05dd \u05e9\u05e2\u05d3\u05d9\u05d9\u05df \u05db\u05dc\u05d5\u05d0\u05d9\u05dd \u05d1\u05d9\u05e9\u05e8\u05d0\u05dc.\u05d4\u05d5\u05d0 \u05d4\u05d9\u05d4 \u05ea\u05d5\u05e9\u05d1 \u05d1\u05e0\u05d9 \u05e1\u05d4\u05d9\u05dc\u05d0 \u05d1\u05de\u05d6\u05e8\u05d7 \u05d7'\u05d0\u05df \u05d9\u05d5\u05e0\u05e1.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,377,"\u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd \u05de\u05d3\u05d5\u05d5\u05d7\u05d9\u05dd \u05e9\u05d0\u05d7\u05de\u05d3 \u05e4\u05d2'\u05dd, \u05d0\u05e1\u05d9\u05e8 \u05de\u05e9\u05d5\u05d7\u05e8\u05e8 \u05de\u05e2\u05e1\u05e7\u05ea \u05e9\u05dc\u05d9\u05d8 \u05e0\u05d4\u05e8\u05d2 \u05dc\u05e4\u05e0\u05d9 \u05d6\u05de\u05df \u05e7\u05e6\u05e8 \u05d1\u05ea\u05e7\u05d9\u05e4\u05d4 \u05d1\u05d0\u05d6\u05d5\u05e8 \u05de\u05e1\u05d2\u05d3 \u05d0-\u05e1\u05e0\u05d9\u05d4 \u05d1\u05d7'\u05d0\u05df \u05d9\u05d5\u05e0\u05e1 (\u05d3\u05e8\u05d5\u05dd \u05d4\u05e8\u05e6\u05d5\u05e2\u05d4).\u05e4\u05d2'\u05dd \u05e0\u05d4\u05d2 \"\u05dc\u05d7\u05e0\u05da\" \u05d0\u05ea \u05d4\u05d0\u05d5\u05db\u05dc\u05d5\u05e1\u05d9\u05d9\u05d4 \u05d4\u05e6\u05e2\u05d9\u05e8\u05d4 \u05d1\u05e8\u05e6\u05d5\u05e2\u05d4 \u05d5\u05d4\u05e8\u05d1\u05d4 \u05dc\u05d4\u05d2\u05d9\u05e2 \u05dc\u05d1\u05ea\u05d9 \u05e1\u05e4\u05e8 \u05d9\u05e1\u05d5\u05d3\u05d9\u05d9\u05dd (\u05d1\u05e2\u05d9\u05e7\u05e8 \u05e9\u05dc \u05d1\u05e0\u05d5\u05ea) \u05db\u05d3\u05d9 \u05dc\u05d4\u05e8\u05e6\u05d5\u05ea \u05e2\u05dc \u05d4\u05d7\u05e9\u05d9\u05d1\u05d5\u05ea \u05e9\u05d1\u05e2\u05e1\u05e7\u05ea \u05e9\u05d7\u05e8\u05d5\u05e8 \u05d0\u05e1\u05d9\u05e8\u05d9\u05dd \u05e0\u05d5\u05e1\u05e4\u05ea \u05db\u05de\u05d5 \u05e2\u05e1\u05e7\u05ea \u05e9\u05dc\u05d9\u05d8 \u05e9\u05ea\u05d5\u05d1\u05d9\u05dc \u05dc\u05e9\u05d7\u05e8\u05d5\u05e8 \u05d4\u05d0\u05e1\u05d9\u05e8\u05d9\u05dd \u05e9\u05e2\u05d3\u05d9\u05d9\u05df \u05db\u05dc\u05d5\u05d0\u05d9\u05dd \u05d1\u05d9\u05e9\u05e8\u05d0\u05dc.\u05d4\u05d5\u05d0 \u05d4\u05d9\u05d4 \u05ea\u05d5\u05e9\u05d1 \u05d1\u05e0\u05d9 \u05e1\u05d4\u05d9\u05dc\u05d0 \u05d1\u05de\u05d6\u05e8\u05d7 \u05d7'\u05d0\u05df \u05d9\u05d5\u05e0\u05e1.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05e2\"\u05e4 \u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd \u05e4\u05e2\u05d9\u05dc\u05d5\u05ea \u05d3\u05d7\u05e4\u05d5\u05e8\u05d9 \u05e6\u05d4\"\u05dc \u05e0\u05de\u05e9\u05db\u05ea \u05db\u05e2\u05ea \u05d1\u05e9\u05db\u05d5\u05e0\u05ea \u05d0-\u05e9\u05d4\u05d3\u05d0\u05d0' \u05d1\u05de\u05d7\u05e0\u05d4 \u05d4\u05e4\u05dc\u05d9\u05d8\u05d9\u05dd \u05d8\u05d5\u05dc\u05db\u05e8\u05dd.User sent a document",false,378,"\u05e2\"\u05e4 \u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd \u05e4\u05e2\u05d9\u05dc\u05d5\u05ea \u05d3\u05d7\u05e4\u05d5\u05e8\u05d9 \u05e6\u05d4\"\u05dc \u05e0\u05de\u05e9\u05db\u05ea \u05db\u05e2\u05ea \u05d1\u05e9\u05db\u05d5\u05e0\u05ea \u05d0-\u05e9\u05d4\u05d3\u05d0\u05d0' \u05d1\u05de\u05d7\u05e0\u05d4 \u05d4\u05e4\u05dc\u05d9\u05d8\u05d9\u05dd \u05d8\u05d5\u05dc\u05db\u05e8\u05dd.User sent a document"],["\u05d0\u05e1\u05e3 \u05e8\u05d5\u05d6\u05e0\u05e6\u05d5\u05d9\u05d9\u05d2\u05d2\u05d5\u05e8\u05de\u05d9\u05dd \u05e9\u05d5\u05e0\u05d9\u05dd \u05d1\u05e6\u05e8\u05e4\u05ea, \u05db\u05d5\u05dc\u05dc \u05de\u05e1\u05d1\u05d9\u05d1\u05ea\u05d5 \u05e9\u05dc \u05e2\u05de\u05e0\u05d5\u05d0\u05dc \u05de\u05e7\u05e8\u05d5\u05df, \u05de\u05ea\u05d7\u05d5\u00a0 \u05d1\u05d9\u05e7\u05d5\u05e8\u05ea \u05e2\u05dc \u05d4\u05e0\u05e9\u05d9\u05d0 \u05d4\u05e6\u05e8\u05e4\u05ea\u05d9 \u05d1\u05e2\u05e7\u05d1\u05d5\u05ea \u05d4\u05e9\u05ea\u05ea\u05e4\u05d5\u05ea\u05d5 \u05d0\u05de\u05e9 \u05d1\u05d8\u05e7\u05e1 \u05d4\u05d3\u05dc\u05e7\u05ea \u05e0\u05e8 \u05e8\u05d0\u05e9\u05d5\u05df \u05e9\u05dc \u05d7\u05e0\u05d5\u05db\u05d4 \u05d1\u05d0\u05e8\u05de\u05d5\u05df \u05d4\u05d0\u05dc\u05d9\u05d6\u05d4, \u05d5\u05d8\u05e2\u05e0\u05d5 \u05e9\u05d4\u05d5\u05d0 \u05e4\u05d2\u05e2 \u05d1\u05d4\u05d9\u05e1\u05d8\u05d5\u05e8\u05d9\u05d4 \u05d4\u05d0\u05e8\u05d5\u05db\u05d4 \u05e9\u05dc \u05e6\u05e8\u05e4\u05ea \u05db\u05de\u05d3\u05d9\u05e0\u05d4 \u05d7\u05d9\u05dc\u05d5\u05e0\u05d9\u05ea. \u05de\u05e7\u05e8\u05d5\u05df \u05d0\u05de\u05e8 \u05d4\u05d1\u05d5\u05e7\u05e8 \u05d1\u05d1\u05d9\u05e7\u05d5\u05e8 \u05d1\u05db\u05e0\u05e1\u05d9\u05d9\u05ea \u05e0\u05d5\u05d8\u05e8\u05d3\u05d0\u05dd \u05e9\u05d4\u05d5\u05d0 \u05dc\u05d0 \u05de\u05ea\u05d7\u05e8\u05d8 \u05db\u05dc\u05dc \u05e2\u05dc \u05d4\u05e9\u05ea\u05ea\u05e4\u05d5\u05ea\u05d5 \u05d1\u05d0\u05d9\u05e8\u05d5\u05e2, \u05d5\u05d4\u05d5\u05e1\u05d9\u05e3: \"\u05d7\u05d9\u05dc\u05d5\u05e0\u05d9\u05d5\u05ea \u05d4\u05d9\u05d0 \u05dc\u05d0 \u05dc\u05d1\u05d8\u05dc \u05d0\u05ea \u05d4\u05d3\u05ea, \u05d0\u05dc\u05d0 \u05d4\u05e2\u05d5\u05d1\u05d3\u05d4 \u05e9\u05dc\u05db\u05dc \u05d0\u05d7\u05d3 \u05d4\u05d6\u05db\u05d5\u05ea \u05d5\u05d4\u05d7\u05d9\u05e8\u05d5\u05ea \u05dc\u05d4\u05d0\u05de\u05d9\u05df \u05d5\u05d2\u05dd \u05dc\u05d0 \u05dc\u05d4\u05d0\u05de\u05d9\u05df\". \u05d1\u05e1\u05d1\u05d9\u05d1\u05ea\u05d5 \u05e9\u05dc \u05de\u05e7\u05e8\u05d5\u05df \u05d0\u05de\u05e8\u05d5 \u05e9\u05d4\u05e9\u05ea\u05ea\u05e4\u05d5\u05ea\u05d5 \u05d1\u05d8\u05e7\u05e1 \u05e0\u05d5\u05e2\u05d3\u05d4 \u05dc\u05e9\u05d3\u05e8 \u05de\u05e1\u05e8 \u05e0\u05d2\u05d3 \u05d4\u05d0\u05e0\u05d8\u05d9\u05e9\u05de\u05d9\u05d5\u05ea \u05d1\u05de\u05d3\u05d9\u05e0\u05d4@N12chat",false,379,"\u05d0\u05e1\u05e3 \u05e8\u05d5\u05d6\u05e0\u05e6\u05d5\u05d9\u05d9\u05d2\u05d2\u05d5\u05e8\u05de\u05d9\u05dd \u05e9\u05d5\u05e0\u05d9\u05dd \u05d1\u05e6\u05e8\u05e4\u05ea, \u05db\u05d5\u05dc\u05dc \u05de\u05e1\u05d1\u05d9\u05d1\u05ea\u05d5 \u05e9\u05dc \u05e2\u05de\u05e0\u05d5\u05d0\u05dc \u05de\u05e7\u05e8\u05d5\u05df, \u05de\u05ea\u05d7\u05d5\u00a0 \u05d1\u05d9\u05e7\u05d5\u05e8\u05ea \u05e2\u05dc \u05d4\u05e0\u05e9\u05d9\u05d0 \u05d4\u05e6\u05e8\u05e4\u05ea\u05d9 \u05d1\u05e2\u05e7\u05d1\u05d5\u05ea \u05d4\u05e9\u05ea\u05ea\u05e4\u05d5\u05ea\u05d5 \u05d0\u05de\u05e9 \u05d1\u05d8\u05e7\u05e1 \u05d4\u05d3\u05dc\u05e7\u05ea \u05e0\u05e8 \u05e8\u05d0\u05e9\u05d5\u05df \u05e9\u05dc \u05d7\u05e0\u05d5\u05db\u05d4 \u05d1\u05d0\u05e8\u05de\u05d5\u05df \u05d4\u05d0\u05dc\u05d9\u05d6\u05d4, \u05d5\u05d8\u05e2\u05e0\u05d5 \u05e9\u05d4\u05d5\u05d0 \u05e4\u05d2\u05e2 \u05d1\u05d4\u05d9\u05e1\u05d8\u05d5\u05e8\u05d9\u05d4 \u05d4\u05d0\u05e8\u05d5\u05db\u05d4 \u05e9\u05dc \u05e6\u05e8\u05e4\u05ea \u05db\u05de\u05d3\u05d9\u05e0\u05d4 \u05d7\u05d9\u05dc\u05d5\u05e0\u05d9\u05ea. \u05de\u05e7\u05e8\u05d5\u05df \u05d0\u05de\u05e8 \u05d4\u05d1\u05d5\u05e7\u05e8 \u05d1\u05d1\u05d9\u05e7\u05d5\u05e8 \u05d1\u05db\u05e0\u05e1\u05d9\u05d9\u05ea \u05e0\u05d5\u05d8\u05e8\u05d3\u05d0\u05dd \u05e9\u05d4\u05d5\u05d0 \u05dc\u05d0 \u05de\u05ea\u05d7\u05e8\u05d8 \u05db\u05dc\u05dc \u05e2\u05dc \u05d4\u05e9\u05ea\u05ea\u05e4\u05d5\u05ea\u05d5 \u05d1\u05d0\u05d9\u05e8\u05d5\u05e2, \u05d5\u05d4\u05d5\u05e1\u05d9\u05e3: \"\u05d7\u05d9\u05dc\u05d5\u05e0\u05d9\u05d5\u05ea \u05d4\u05d9\u05d0 \u05dc\u05d0 \u05dc\u05d1\u05d8\u05dc \u05d0\u05ea \u05d4\u05d3\u05ea, \u05d0\u05dc\u05d0 \u05d4\u05e2\u05d5\u05d1\u05d3\u05d4 \u05e9\u05dc\u05db\u05dc \u05d0\u05d7\u05d3 \u05d4\u05d6\u05db\u05d5\u05ea \u05d5\u05d4\u05d7\u05d9\u05e8\u05d5\u05ea \u05dc\u05d4\u05d0\u05de\u05d9\u05df \u05d5\u05d2\u05dd \u05dc\u05d0 \u05dc\u05d4\u05d0\u05de\u05d9\u05df\". \u05d1\u05e1\u05d1\u05d9\u05d1\u05ea\u05d5 \u05e9\u05dc \u05de\u05e7\u05e8\u05d5\u05df \u05d0\u05de\u05e8\u05d5 \u05e9\u05d4\u05e9\u05ea\u05ea\u05e4\u05d5\u05ea\u05d5 \u05d1\u05d8\u05e7\u05e1 \u05e0\u05d5\u05e2\u05d3\u05d4 \u05dc\u05e9\u05d3\u05e8 \u05de\u05e1\u05e8 \u05e0\u05d2\u05d3 \u05d4\u05d0\u05e0\u05d8\u05d9\u05e9\u05de\u05d9\u05d5\u05ea \u05d1\u05de\u05d3\u05d9\u05e0\u05d4@N12chat"],["\u05e9\u05e0\u05d9 \u05d1\u05d9\u05e8\u05e0\u05d1\u05d5\u05d9\u05dd\u05de\u05e9\u05dc\u05d7\u05ea \u05e0\u05d9\u05e6\u05d5\u05dc\u05d9\u05dd \u05de\u05de\u05e1\u05d9\u05d1\u05ea \u05d4\u05e0\u05d5\u05d1\u05d4 \u05e0\u05e4\u05d2\u05e9\u05d4 \u05e2\u05dd \u05d0\u05e8\u05ea\u05d5\u05e8 \u05d3\u05e0\u05d5\u05d1\u05d5, \u05e0\u05e9\u05d9\u05d0 \u05d0\u05e8\u05d2\u05d5\u05df \u05e7\u05d5\u05e8\u05d1\u05e0\u05d5\u05ea \u05d4\u05d8\u05d1\u05d7 \u05d1\u05d1\u05d8\u05d0\u05e7\u05dc\u05d0\u05df Life for Paris. \u05d1\u05de\u05e4\u05d2\u05e9, \u05de\u05d8\u05e2\u05dd \u05de\u05e9\u05e8\u05d3 \u05d4\u05ea\u05e4\u05d5\u05e6\u05d5\u05ea \u05d5\u05d1\u05e9\u05d9\u05ea\u05d5\u05e3 \u05de\u05e9\u05e8\u05d3 \u05d4\u05d7\u05d5\u05e5, \u05d4\u05e6\u05e2\u05d9\u05e8\u05d9\u05dd \u05e9\u05d5\u05d7\u05d7\u05d5 \u05e2\u05dd \u05d3\u05e0\u05d5\u05d1\u05d5 \u05e2\u05dc \u05d3\u05e8\u05db\u05d9 \u05d4\u05d4\u05ea\u05de\u05d5\u05d3\u05d3\u05d5\u05ea \u05e2\u05dd \u05d4\u05d8\u05e8\u05d0\u05d5\u05de\u05d4 \u05e9\u05e2\u05d1\u05e8\u05d5 \u05d5\u05e9\u05de\u05e2\u05d5 \u05de\u05de\u05e0\u05d5 \u05e2\u05dc \u05d3\u05e8\u05db\u05d9 \u05d4\u05d4\u05e0\u05e6\u05d7\u05d4 \u05d1\u05e2\u05e7\u05d1\u05d5\u05ea \u05d4\u05d8\u05d1\u05d7 \u05e9\u05d4\u05ea\u05e8\u05d7\u05e9 \u05d1\u05ea\u05d9\u05d0\u05d8\u05e8\u05d5\u05df \u05d1\u05e4\u05e8\u05d9\u05d6 \u05d1-2015. \u05d3\u05e0\u05d5\u05d1\u05d5 \u05d7\u05d9\u05d6\u05e7 \u05d0\u05ea \u05d4\u05e6\u05e2\u05d9\u05e8\u05d9\u05dd \u05d5\u05d0\u05d9\u05d7\u05dc \u05dc\u05d4\u05dd \u05e9\u05d9\u05e7\u05d5\u05dd \u05de\u05d4\u05d9\u05e8@N12chat",false,380,"\u05e9\u05e0\u05d9 \u05d1\u05d9\u05e8\u05e0\u05d1\u05d5\u05d9\u05dd\u05de\u05e9\u05dc\u05d7\u05ea \u05e0\u05d9\u05e6\u05d5\u05dc\u05d9\u05dd \u05de\u05de\u05e1\u05d9\u05d1\u05ea \u05d4\u05e0\u05d5\u05d1\u05d4 \u05e0\u05e4\u05d2\u05e9\u05d4 \u05e2\u05dd \u05d0\u05e8\u05ea\u05d5\u05e8 \u05d3\u05e0\u05d5\u05d1\u05d5, \u05e0\u05e9\u05d9\u05d0 \u05d0\u05e8\u05d2\u05d5\u05df \u05e7\u05d5\u05e8\u05d1\u05e0\u05d5\u05ea \u05d4\u05d8\u05d1\u05d7 \u05d1\u05d1\u05d8\u05d0\u05e7\u05dc\u05d0\u05df Life for Paris. \u05d1\u05de\u05e4\u05d2\u05e9, \u05de\u05d8\u05e2\u05dd \u05de\u05e9\u05e8\u05d3 \u05d4\u05ea\u05e4\u05d5\u05e6\u05d5\u05ea \u05d5\u05d1\u05e9\u05d9\u05ea\u05d5\u05e3 \u05de\u05e9\u05e8\u05d3 \u05d4\u05d7\u05d5\u05e5, \u05d4\u05e6\u05e2\u05d9\u05e8\u05d9\u05dd \u05e9\u05d5\u05d7\u05d7\u05d5 \u05e2\u05dd \u05d3\u05e0\u05d5\u05d1\u05d5 \u05e2\u05dc \u05d3\u05e8\u05db\u05d9 \u05d4\u05d4\u05ea\u05de\u05d5\u05d3\u05d3\u05d5\u05ea \u05e2\u05dd \u05d4\u05d8\u05e8\u05d0\u05d5\u05de\u05d4 \u05e9\u05e2\u05d1\u05e8\u05d5 \u05d5\u05e9\u05de\u05e2\u05d5 \u05de\u05de\u05e0\u05d5 \u05e2\u05dc \u05d3\u05e8\u05db\u05d9 \u05d4\u05d4\u05e0\u05e6\u05d7\u05d4 \u05d1\u05e2\u05e7\u05d1\u05d5\u05ea \u05d4\u05d8\u05d1\u05d7 \u05e9\u05d4\u05ea\u05e8\u05d7\u05e9 \u05d1\u05ea\u05d9\u05d0\u05d8\u05e8\u05d5\u05df \u05d1\u05e4\u05e8\u05d9\u05d6 \u05d1-2015. \u05d3\u05e0\u05d5\u05d1\u05d5 \u05d7\u05d9\u05d6\u05e7 \u05d0\u05ea \u05d4\u05e6\u05e2\u05d9\u05e8\u05d9\u05dd \u05d5\u05d0\u05d9\u05d7\u05dc \u05dc\u05d4\u05dd \u05e9\u05d9\u05e7\u05d5\u05dd \u05de\u05d4\u05d9\u05e8@N12chat"],["\u05de\u05d1\u05d6\u05e7\u05df 12\u05e6\u05d4\"\u05dc: \u05e2\u05dc \u05e8\u05e7\u05e2 \u05de\u05ea\u05d5\u05d5\u05d4 \u05d4\u05e7\u05d3\u05de\u05ea \u05d4\u05d2\u05d9\u05d5\u05e1 \u05dc-1,300 \u05d7\u05e0\u05d9\u05db\u05d9 \u05d4\u05d2\u05d5\u05e4\u05d9\u05dd \u05d4\u05e7\u05d3\u05dd \u05e6\u05d1\u05d0\u05d9\u05d9\u05dd, \u05e8\u05d0\u05e9 \u05d0\u05d2\u05e3 \u05db\u05d5\u05d7 \u05d4\u05d0\u05d3\u05dd, \u05d0\u05dc\u05d5\u05e3 \u05d9\u05e0\u05d9\u05d1 \u05e2\u05e9\u05d5\u05e8, \u05e0\u05e4\u05d2\u05e9 \u05d4\u05d1\u05d5\u05e7\u05e8 \u05e2\u05dd \u05e0\u05e6\u05d9\u05d2\u05d9\u05dd \u05de\u05e7\u05e8\u05d1 \u05e8\u05d0\u05e9\u05d9 \u05d4\u05de\u05db\u05d9\u05e0\u05d5\u05ea \u05d5\u05e9\u05e0\u05d5\u05ea \u05d4\u05e9\u05d9\u05e8\u05d5\u05ea. \u05d1\u05e4\u05d2\u05d9\u05e9\u05d4 \u05d4\u05d5\u05d3\u05d2\u05e9 \u05db\u05d9 \u05d1\u05de\u05d9\u05d3\u05d4 \u05d5\u05d9\u05e9\u05e0\u05dd \u05de\u05e7\u05e8\u05d9\u05dd \u05e4\u05e8\u05d8\u05e0\u05d9\u05d9\u05dd \u05d4\u05d3\u05d5\u05e8\u05e9\u05d9\u05dd \u05d4\u05ea\u05d9\u05d9\u05d7\u05e1\u05d5\u05ea \u05de\u05d9\u05d5\u05d7\u05d3\u05ea, \u05db\u05dc \u05de\u05d9\u05d5\u05e2\u05d3 \u05dc\u05e9\u05d9\u05e8\u05d5\u05ea \u05d1\u05d8\u05d7\u05d5\u05df \u05d9\u05d5\u05db\u05dc \u05dc\u05e4\u05e0\u05d5\u05ea \u05d9\u05e9\u05d9\u05e8\u05d5\u05ea \u05dc\u05d9\u05d7\u05d9\u05d3\u05ea \u05de\u05d9\u05d8\u05d1 \u05d5\u05d1\u05e7\u05e9\u05ea\u05d5 \u05ea\u05d9\u05d1\u05d7\u05df@N12chat",false,381,"\u05de\u05d1\u05d6\u05e7\u05df 12\u05e6\u05d4\"\u05dc: \u05e2\u05dc \u05e8\u05e7\u05e2 \u05de\u05ea\u05d5\u05d5\u05d4 \u05d4\u05e7\u05d3\u05de\u05ea \u05d4\u05d2\u05d9\u05d5\u05e1 \u05dc-1,300 \u05d7\u05e0\u05d9\u05db\u05d9 \u05d4\u05d2\u05d5\u05e4\u05d9\u05dd \u05d4\u05e7\u05d3\u05dd \u05e6\u05d1\u05d0\u05d9\u05d9\u05dd, \u05e8\u05d0\u05e9 \u05d0\u05d2\u05e3 \u05db\u05d5\u05d7 \u05d4\u05d0\u05d3\u05dd, \u05d0\u05dc\u05d5\u05e3 \u05d9\u05e0\u05d9\u05d1 \u05e2\u05e9\u05d5\u05e8, \u05e0\u05e4\u05d2\u05e9 \u05d4\u05d1\u05d5\u05e7\u05e8 \u05e2\u05dd \u05e0\u05e6\u05d9\u05d2\u05d9\u05dd \u05de\u05e7\u05e8\u05d1 \u05e8\u05d0\u05e9\u05d9 \u05d4\u05de\u05db\u05d9\u05e0\u05d5\u05ea \u05d5\u05e9\u05e0\u05d5\u05ea \u05d4\u05e9\u05d9\u05e8\u05d5\u05ea. \u05d1\u05e4\u05d2\u05d9\u05e9\u05d4 \u05d4\u05d5\u05d3\u05d2\u05e9 \u05db\u05d9 \u05d1\u05de\u05d9\u05d3\u05d4 \u05d5\u05d9\u05e9\u05e0\u05dd \u05de\u05e7\u05e8\u05d9\u05dd \u05e4\u05e8\u05d8\u05e0\u05d9\u05d9\u05dd \u05d4\u05d3\u05d5\u05e8\u05e9\u05d9\u05dd \u05d4\u05ea\u05d9\u05d9\u05d7\u05e1\u05d5\u05ea \u05de\u05d9\u05d5\u05d7\u05d3\u05ea, \u05db\u05dc \u05de\u05d9\u05d5\u05e2\u05d3 \u05dc\u05e9\u05d9\u05e8\u05d5\u05ea \u05d1\u05d8\u05d7\u05d5\u05df \u05d9\u05d5\u05db\u05dc \u05dc\u05e4\u05e0\u05d5\u05ea \u05d9\u05e9\u05d9\u05e8\u05d5\u05ea \u05dc\u05d9\u05d7\u05d9\u05d3\u05ea \u05de\u05d9\u05d8\u05d1 \u05d5\u05d1\u05e7\u05e9\u05ea\u05d5 \u05ea\u05d9\u05d1\u05d7\u05df@N12chat"],["\u05e1\u05e4\u05d9\u05e8 \u05dc\u05d9\u05e4\u05e7\u05d9\u05df\u05d1\u05db\u05d9\u05e8 \u05d7\u05de\u05d0\u05e1 \u05de\u05d5\u05d7\u05de\u05d3 \u05e0\u05d6\u05d0\u05dc \u05dc\u05d0\u05dc-\u05d2'\u05d6\u05d9\u05e8\u05d4: \"\u05d0\u05e0\u05d7\u05e0\u05d5 \u05de\u05e0\u05d4\u05dc\u05d9\u05dd \u05de\u05e2\u05e8\u05db\u05d4 \u05e9\u05dc \u05de\u05e9\u05d0 \u05d5\u05de\u05ea\u05df \u05de\u05d3\u05d9\u05e0\u05d9 \u05e7\u05e9\u05d4 - \u05dc\u05d0 \u05e4\u05d7\u05d5\u05ea \u05de\u05d4\u05de\u05e2\u05e8\u05db\u05d4 \u05e9\u05d0\u05e0\u05d7\u05e0\u05d5 \u05de\u05e0\u05d4\u05dc\u05d9\u05dd \u05d1\u05e9\u05d3\u05d4 \u05d4\u05e7\u05e8\u05d1. \u05d1\u05e8\u05d0\u05e9 \u05e1\u05d3\u05e8 \u05d4\u05e2\u05d3\u05d9\u05e4\u05d5 u05de\u05e4 \u05e1\u05d9\u05d9\u05e8\u05d5 \u05d1\u05d4\u05e8\u05d9\u05e1\u05d5\u05ea \u05db\u05e4\u05e8 \u05e2\u05d6\u05d4 \u05e2\u05dd \u05d9\u05d5\"\u05e8 \u05d4\u05db\u05e0\u05e1\u05ea \u05d0\u05de\u05d9\u05e8 \u05d0\u05d5\u05d7\u05e0\u05d4@N12chat"],["\u05d0\u05e1\u05e3 \u05d9\u05d7\u05d6\u05e7\u05d0\u05dc\u05d9\u05de\u05e0\u05d4\u05dc \u05d4\u05de\u05e2\u05e8\u05da \u05d4\u05d0\u05d5\u05e0\u05e7\u05d5\u05dc\u05d5\u05d2\u05d9 \u05d1\u05d0\u05d9\u05db\u05d9\u05dc\u05d5\u05d1 \u05e0\u05d2\u05d3 \u05d9\u05d5\u05d6\u05de\u05ea \u05e7\u05d9\u05e9 \u05d1\u05e4\u05e8\u05e1\u05d9 \u05d9\u05e9\u05e8\u05d0\u05dc: \u05e4\u05e8\u05e1 \u05d9\u05e9\u05e8\u05d0\u05dc \u05e0\u05d5\u05e2\u05d3 \u05dc\u05e6\u05d9\u05d9\u05df \u05d0\u05d9\u05e9\u05d9\u05dd \u05d1\u05e2\u05dc\u05d9 \u05d4\u05d9\u05e9\u05d2\u05d9\u05dd \u05d9\u05d5\u05e6\u05d0\u05d9 \u05d3\u05d5\u05e4\u05df \u05d5\u05de\u05e6\u05d5\u05d9\u05d9\u05e0\u05d5\u05ea \u05d1\u05ea\u05d7\u05d5\u05de\u05d9 \u05d4\u05de\u05d3\u05e2, \u05d4\u05e1\u05e4\u05e8\u05d5\u05ea, \u05d4\u05e8\u05e4\u05d5\u05d0\u05d4, \u05d4\u05de\u05d7\u05e7\u05e8\ud83e\udd47\u05e4\u05e8\u05e1\u05d9 \u05de\u05e4\u05e2\u05dc \u05d7\u05d9\u05d9\u05dd \u05d5\u05ea\u05e8\u05d5\u05de\u05d4 \u05dc\u05d7\u05d1\u05e8\u05d4 \u05d7\u05e9\u05d5\u05d1\u05d9\u05dd \u05de\u05d0\u05d3 \u05d0\u05da \u05d4\u05dd \u05d1\u05d0\u05d9\u05dd \u05d1\u05e0\u05d5\u05e1\u05e3 \u05d5\u05dc\u05d0 \u05d1\u05de\u05e7\u05d5\u05dd.\u05d1\u05d9\u05d8\u05d5\u05dc \u05e4\u05e8\u05e1 \u05d4\u05de\u05e6\u05d5\u05d9\u05d9\u05e0\u05d5\u05ea \u05d4\u05d7\u05e9\u05d5\u05d1 \u05d1\u05d9\u05d5\u05ea\u05e8 \u05e9\u05dc \u05d4\u05de\u05d3\u05d9\u05e0\u05d4 \u05de\u05e9\u05d3\u05e8 \u05de\u05e1\u05e8 \u05e9\u05dc\u05d9\u05dc\u05d9 \u05de\u05d0\u05d3 \u05d1\u05e8\u05d5\u05e8@N12chat",false,390,"\u05d0\u05e1\u05e3 \u05d9\u05d7\u05d6\u05e7\u05d0\u05dc\u05d9\u05de\u05e0\u05d4\u05dc \u05d4\u05de\u05e2\u05e8\u05da \u05d4\u05d0\u05d5\u05e0\u05e7\u05d5\u05dc\u05d5\u05d2\u05d9 \u05d1\u05d0\u05d9\u05db\u05d9\u05dc\u05d5\u05d1 \u05e0\u05d2\u05d3 \u05d9\u05d5\u05d6\u05de\u05ea \u05e7\u05d9\u05e9 \u05d1\u05e4\u05e8\u05e1\u05d9 \u05d9\u05e9\u05e8\u05d0\u05dc: \u05e4\u05e8\u05e1 \u05d9\u05e9\u05e8\u05d0\u05dc \u05e0\u05d5\u05e2\u05d3 \u05dc\u05e6\u05d9\u05d9\u05df \u05d0\u05d9\u05e9\u05d9\u05dd \u05d1\u05e2\u05dc\u05d9 \u05d4\u05d9\u05e9\u05d2\u05d9\u05dd \u05d9\u05d5\u05e6\u05d0\u05d9 \u05d3\u05d5\u05e4\u05df \u05d5\u05de\u05e6\u05d5\u05d9\u05d9\u05e0\u05d5\u05ea \u05d1\u05ea\u05d7\u05d5\u05de\u05d9 \u05d4\u05de\u05d3\u05e2, \u05d4\u05e1\u05e4\u05e8\u05d5\u05ea, \u05d4\u05e8\u05e4\u05d5\u05d0\u05d4, \u05d4\u05de\u05d7\u05e7\u05e8\ud83e\udd47\u05e4\u05e8\u05e1\u05d9 \u05de\u05e4\u05e2\u05dc \u05d7\u05d9\u05d9\u05dd \u05d5\u05ea\u05e8\u05d5\u05de\u05d4 \u05dc\u05d7\u05d1\u05e8\u05d4 \u05d7\u05e9\u05d5\u05d1\u05d9\u05dd \u05de\u05d0\u05d3 \u05d0\u05da \u05d4\u05dd \u05d1\u05d0\u05d9\u05dd \u05d1\u05e0\u05d5\u05e1\u05e3 \u05d5\u05dc\u05d0 \u05d1\u05de\u05e7\u05d5\u05dd.\u05d1\u05d9\u05d8\u05d5\u05dc \u05e4\u05e8\u05e1 \u05d4\u05de\u05e6\u05d5\u05d9\u05d9\u05e0\u05d5\u05ea \u05d4\u05d7\u05e9\u05d5\u05d1 \u05d1\u05d9\u05d5\u05ea\u05e8 \u05e9\u05dc \u05d4\u05de\u05d3\u05d9\u05e0\u05d4 \u05de\u05e9\u05d3\u05e8 \u05de\u05e1\u05e8 \u05e9\u05dc\u05d9\u05dc\u05d9 \u05de\u05d0\u05d3 \u05d1\u05e8\u05d5\u05e8@N12chat"],["\u05d9\u05d5\u05d1\u05dc \u05d0\u05e8\u05d0\u05dc\u05d1\u05d9\u05ea \u05d4\u05de\u05e9\u05e4\u05d8 \u05d4\u05de\u05d7\u05d5\u05d6\u05d9 \u05d1\u05d9\u05e8\u05d5\u05e9\u05dc\u05d9\u05dd \u05d2\u05d6\u05e8 \u05e2\u05dc \u05e0\u05ea\u05e0\u05d0\u05dc \u05d0\u05d5\u05e8\u05e7\u05d9\u05d6\u05d4 8 \u05e9\u05e0\u05d5\u05ea \u05de\u05d0\u05e1\u05e8 \u05d1\u05e4\u05d5\u05e2\u05dc \u05dc\u05d0\u05d7\u05e8 \u05e9\u05d4\u05d5\u05e8\u05e9\u05e2 \u05d1\u05d1\u05d9\u05e6\u05d5\u05e2 \u05e2\u05d1\u05d9\u05e8\u05d5\u05ea \u05de\u05d9\u05df \u05d7\u05de\u05d5\u05e8\u05d5\u05ea \u05d1\u05e7\u05d8\u05d9\u05e0\u05d4 \u05d1\u05ea 5. \u05db\u05de\u05d5 \u05db\u05df, \u05d1\u05d9\u05ea \u05d4\u05de\u05e9\u05e4\u05d8 \u05d7\u05d9\u05d9\u05d1 \u05d0\u05ea \u05d4\u05e0\u05d0\u05e9\u05dd \u05d1\u05e4\u05d9\u05e6\u05d5\u05d9. \u05e2\u05dc \u05e4\u05d9 \u05db\u05ea\u05d1 \u05d4\u05d0\u05d9\u05e9\u05d5\u05dd \u05d0\u05e0\u05e1 \u05d0\u05d5\u05e8\u05e7\u05d9\u05d6\u05d4 \u05d0\u05ea \u05d1\u05ea \u05d4-5 \u05d1\u05d6\u05de\u05df \u05e9\u05d4\u05d9\u05d0 \u05d1\u05d5\u05db\u05d4 \u05d5\u05d6\u05d5\u05e2\u05e7\u05ea@N12chat",false,391,"\u05d9\u05d5\u05d1\u05dc \u05d0\u05e8\u05d0\u05dc\u05d1\u05d9\u05ea \u05d4\u05de\u05e9\u05e4\u05d8 \u05d4\u05de\u05d7\u05d5\u05d6\u05d9 \u05d1\u05d9\u05e8\u05d5\u05e9\u05dc\u05d9\u05dd \u05d2\u05d6\u05e8 \u05e2\u05dc \u05e0\u05ea\u05e0\u05d0\u05dc \u05d0\u05d5\u05e8\u05e7\u05d9\u05d6\u05d4 8 \u05e9\u05e0\u05d5\u05ea \u05de\u05d0\u05e1\u05e8 \u05d1\u05e4\u05d5\u05e2\u05dc \u05dc\u05d0\u05d7\u05e8 \u05e9\u05d4\u05d5\u05e8\u05e9\u05e2 \u05d1\u05d1\u05d9\u05e6\u05d5\u05e2 \u05e2\u05d1\u05d9\u05e8\u05d5\u05ea \u05de\u05d9\u05df \u05d7\u05de\u05d5\u05e8\u05d5\u05ea \u05d1\u05e7\u05d8\u05d9\u05e0\u05d4 \u05d1\u05ea 5. \u05db\u05de\u05d5 \u05db\u05df, \u05d1\u05d9\u05ea \u05d4\u05de\u05e9\u05e4\u05d8 \u05d7\u05d9\u05d9\u05d1 \u05d0\u05ea \u05d4\u05e0\u05d0\u05e9\u05dd \u05d1\u05e4\u05d9\u05e6\u05d5\u05d9. \u05e2\u05dc \u05e4\u05d9 \u05db\u05ea\u05d1 \u05d4\u05d0\u05d9\u05e9\u05d5\u05dd \u05d0\u05e0\u05e1 \u05d0\u05d5\u05e8\u05e7\u05d9\u05d6\u05d4 \u05d0\u05ea \u05d1\u05ea \u05d4-5 \u05d1\u05d6\u05de\u05df \u05e9\u05d4\u05d9\u05d0 \u05d1\u05d5\u05db\u05d4 \u05d5\u05d6\u05d5\u05e2\u05e7\u05ea@N12chat"],["\u05e1\u05e4\u05d9\u05e8 \u05dc\u05d9\u05e4\u05e7\u05d9\u05df\u05de\u05e7\u05d5\u05e8\u05d5\u05ea \u05dc\u05d1\u05e0\u05d5\u05e0\u05d9\u05d9\u05dd \u05dc\u05e1\u05e7\u05d9\u05d9 \u05e0\u05d9\u05d5\u05d6 \u05d1\u05e2\u05e8\u05d1\u05d9\u05ea: \u05e9\u05e8\u05ea \u05d4\u05d7\u05d5\u05e5 \u05e9\u05dc \u05d2\u05e8\u05de\u05e0\u05d9\u05d4, \u05e9\u05d1\u05d9\u05e7\u05e8\u05d4 \u05d0\u05ea\u05de\u05d5\u05dc \u05d1\u05d9\u05e9\u05e8\u05d0\u05dc, \u05d4\u05e2\u05d1\u05d9\u05e8\u05d4 \u05dc\u05dc\u05d1\u05e0\u05d5\u05df \u05d4\u05e6\u05e2\u05d4 \u05d9\u05e9\u05e8\u05d0\u05dc\u05d9\u05ea \u05dc\u05d4\u05e6\u05d1\u05ea \u05db\u05d5\u05d7\u05d5\u05ea \u05d2\u05e8\u05de\u05e0\u05d9\u05d9\u05dd \u05d1\u05d2\u05d1\u05d5\u05dc \u05e2\u05dd \u05e1\u05de\u05db\u05d5\u05d9\u05d5\u05ea \u05e6\u05d1\u05d0\u05d9\u05d5\u05ea. \u05e2\u05dc \u05e4\u05d9 \u05d4\u05d3\u05d9\u05d5\u05d5\u05d7, \u05d4\u05e6\u05d3 \u05d4\u05dc\u05d1\u05e0\u05d5\u05e0\u05d9 \u05de\u05e1\u05e8\u05d1 \u05dc\u05d4\u05e6\u05e2\u05d4@N12chat",false,392,"\u05e1\u05e4\u05d9\u05e8 \u05dc\u05d9\u05e4\u05e7\u05d9\u05df\u05de\u05e7\u05d5\u05e8\u05d5\u05ea \u05dc\u05d1\u05e0\u05d5\u05e0\u05d9\u05d9\u05dd \u05dc\u05e1\u05e7\u05d9\u05d9 \u05e0\u05d9\u05d5\u05d6 \u05d1\u05e2\u05e8\u05d1\u05d9\u05ea: \u05e9\u05e8\u05ea \u05d4\u05d7\u05d5\u05e5 \u05e9\u05dc \u05d2\u05e8\u05de\u05e0\u05d9\u05d4, \u05e9\u05d1\u05d9\u05e7\u05e8\u05d4 \u05d0\u05ea\u05de\u05d5\u05dc \u05d1\u05d9\u05e9\u05e8\u05d0\u05dc, \u05d4\u05e2\u05d1\u05d9\u05e8\u05d4 \u05dc\u05dc\u05d1\u05e0\u05d5\u05df \u05d4\u05e6\u05e2\u05d4 \u05d9\u05e9\u05e8\u05d0\u05dc\u05d9\u05ea \u05dc\u05d4\u05e6\u05d1\u05ea \u05db\u05d5\u05d7\u05d5\u05ea \u05d2\u05e8\u05de\u05e0\u05d9\u05d9\u05dd \u05d1\u05d2\u05d1\u05d5\u05dc \u05e2\u05dd \u05e1\u05de\u05db\u05d5\u05d9\u05d5\u05ea \u05e6\u05d1\u05d0\u05d9\u05d5\u05ea. \u05e2\u05dc \u05e4\u05d9 \u05d4\u05d3\u05d9\u05d5\u05d5\u05d7, \u05d4\u05e6\u05d3 \u05d4\u05dc\u05d1\u05e0\u05d5\u05e0\u05d9 \u05de\u05e1\u05e8\u05d1 \u05dc\u05d4\u05e6\u05e2\u05d4@N12chat"],["\u05e2\u05d5\u05e6' \u05d1\u05e8\u05d1\u05d7', \u05db\u05d5\u05db\u05d1 \u05d4\u05d8\u05d9\u05e7\u05d8\u05d5\u05e7 \u05d4\u05e2\u05d6\u05ea\u05d9 \u05d4\u05e9\u05ea\u05db\u05e4\u05dc: \u05d9\u05e9 \u05dc\u05d5 \u05e2\u05db\u05e9\u05d9\u05d5 \u05dc\u05d4\u05e7\u05ea \u05d9\u05dc\u05d3\u05d9\u05dd \u05d1\u05d3\u05de\u05d5\u05ea\u05d5...\u05d4\u05d5\u05d0 \u05d4\u05d5\u05e1\u05d9\u05e3 \u05d0\u05e4\u05d9\u05dc\u05d5 \u05d0\u05e4\u05e7\u05d8\u05d9\u05dd \u05e9\u05dc \u05e2\u05e9\u05df...#\u05d9\u05d0_\u05e2\u05d0\u05dc\u05dd#\u05e2\u05de\u05d0\u05d3_\u05d0\u05d1\u05d5_\u05d0\u05e1\u05de\u05d0\u05e2\u05d9\u05dc",false,393,"\u05e2\u05d5\u05e6' \u05d1\u05e8\u05d1\u05d7', \u05db\u05d5\u05db\u05d1 \u05d4\u05d8\u05d9\u05e7\u05d8\u05d5\u05e7 \u05d4\u05e2\u05d6\u05ea\u05d9 \u05d4\u05e9\u05ea\u05db\u05e4\u05dc: \u05d9\u05e9 \u05dc\u05d5 \u05e2\u05db\u05e9\u05d9\u05d5 \u05dc\u05d4\u05e7\u05ea \u05d9\u05dc\u05d3\u05d9\u05dd \u05d1\u05d3\u05de\u05d5\u05ea\u05d5...\u05d4\u05d5\u05d0 \u05d4\u05d5\u05e1\u05d9\u05e3 \u05d0\u05e4\u05d9\u05dc\u05d5 \u05d0\u05e4\u05e7\u05d8\u05d9\u05dd \u05e9\u05dc \u05e2\u05e9\u05df...#\u05d9\u05d0_\u05e2\u05d0\u05dc\u05dd#\u05e2\u05de\u05d0\u05d3_\u05d0\u05d1\u05d5_\u05d0\u05e1\u05de\u05d0\u05e2\u05d9\u05dc"],["\u05d0\u05d7\u05d3 \u05de\u05ea\u05d5\u05e9\u05d1\u05d9 \u05d1\u05d9\u05ea \u05dc\u05d0\u05d4\u05d9\u05d0 \u05d1\u05e6\u05e4\u05d5\u05df \u05d4\u05e8\u05e6\u05d5\u05e2\u05d4 \u05e1\u05d5\u05e7\u05e8 \u05d0\u05ea \u05d4\u05e1\u05d1\u05d9\u05d1\u05d4, \u05e0\u05d3\u05d4\u05dd \u05de\u05d4\u05d4\u05e8\u05e1 \u05d5\u05d0\u05d5\u05de\u05e8 :\u05de\u05d4 \u05d4\u05d4\u05e8\u05e1 \u05d4\u05d6\u05d4? \u05d9\u05d0 \u05d0\u05dc\u05dc\u05d4... \u05d6\u05d4 \u05d4\u05e6\u05d5\u05e0\u05d0\u05de\u05d9 \u05e9\u05dc \u05d1\u05d9\u05ea \u05dc\u05d0\u05d4\u05d9\u05d0",false,394,"\u05d0\u05d7\u05d3 \u05de\u05ea\u05d5\u05e9\u05d1\u05d9 \u05d1\u05d9\u05ea \u05dc\u05d0\u05d4\u05d9\u05d0 \u05d1\u05e6\u05e4\u05d5\u05df \u05d4\u05e8\u05e6\u05d5\u05e2\u05d4 \u05e1\u05d5\u05e7\u05e8 \u05d0\u05ea \u05d4\u05e1\u05d1\u05d9\u05d1\u05d4, \u05e0\u05d3\u05d4\u05dd \u05de\u05d4\u05d4\u05e8\u05e1 \u05d5\u05d0\u05d5\u05de\u05e8 :\u05de\u05d4 \u05d4\u05d4\u05e8\u05e1 \u05d4\u05d6\u05d4? \u05d9\u05d0 \u05d0\u05dc\u05dc\u05d4... \u05d6\u05d4 \u05d4\u05e6\u05d5\u05e0\u05d0\u05de\u05d9 \u05e9\u05dc \u05d1\u05d9\u05ea \u05dc\u05d0\u05d4\u05d9\u05d0"],["\u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd \u05de\u05d3\u05d5\u05d5\u05d7\u05d9\u05dd \u05e2\u05dc \u05ea\u05e7\u05d9\u05e4\u05d5\u05ea \u05d7\u05d2\u05d5\u05e8\u05ea \u05d0\u05e9 \u05d1\u05d0\u05d6\u05d5\u05e8  \u05d7'\u05d0\u05df \u05d9\u05d5\u05e0\u05e1 \u05d1\u05d3\u05e8\u05d5\u05dd \u05d4\u05e8\u05e6\u05d5\u05e2\u05d4.\u05d1\u05e8\u05e7\u05e2, \u05d4\u05e2\u05e9\u05df \u05de\u05d4\u05d3\u05dc\u05d9\u05e7\u05d4 \u05d1\u05de\u05e4\u05e2\u05dc \u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e7 \u05e9\u05dc \u05de\u05d7\u05de\u05d3 \u05d0\u05d1\u05d5 \u05d3\u05e7\u05d4 \u05e9\u05d8\u05e8\u05dd \u05db\u05d5\u05d1\u05ea\u05d4. \u05e2\"\u05e4 \u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd \u05d1\u05de\u05e4\u05e2\u05dc \u05d9\u05e9 200 \u05d8\u05d5\u05df \u05e9\u05dc \u05d7\u05d5\u05de\u05e8 \u05d2\u05dc\u05dd \u05dc\u05ea\u05e2\u05e9\u05d9\u05d9\u05ea \u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e7.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,395,"\u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd \u05de\u05d3\u05d5\u05d5\u05d7\u05d9\u05dd \u05e2\u05dc \u05ea\u05e7\u05d9\u05e4\u05d5\u05ea \u05d7\u05d2\u05d5\u05e8\u05ea \u05d0\u05e9 \u05d1\u05d0\u05d6\u05d5\u05e8  \u05d7'\u05d0\u05df \u05d9\u05d5\u05e0\u05e1 \u05d1\u05d3\u05e8\u05d5\u05dd \u05d4\u05e8\u05e6\u05d5\u05e2\u05d4.\u05d1\u05e8\u05e7\u05e2, \u05d4\u05e2\u05e9\u05df \u05de\u05d4\u05d3\u05dc\u05d9\u05e7\u05d4 \u05d1\u05de\u05e4\u05e2\u05dc \u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e7 \u05e9\u05dc \u05de\u05d7\u05de\u05d3 \u05d0\u05d1\u05d5 \u05d3\u05e7\u05d4 \u05e9\u05d8\u05e8\u05dd \u05db\u05d5\u05d1\u05ea\u05d4. \u05e2\"\u05e4 \u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd \u05d1\u05de\u05e4\u05e2\u05dc \u05d9\u05e9 200 \u05d8\u05d5\u05df \u05e9\u05dc \u05d7\u05d5\u05de\u05e8 \u05d2\u05dc\u05dd \u05dc\u05ea\u05e2\u05e9\u05d9\u05d9\u05ea \u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e7.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05d9\u05e8\u05d5\u05df \u05d0\u05d1\u05e8\u05d4\u05dd\u05d0\u05d4\u05e8\u05df \u05d1\u05e8\u05e7 \u05d0\u05d9\u05e9\u05e8 \u05dc-N12: \u05d0\u05d4\u05d9\u05d4 \u05d4\u05e9\u05d5\u05e4\u05d8 \u05de\u05d8\u05e2\u05dd \u05d9\u05e9\u05e8\u05d0\u05dc \u05d1\u05ea\u05d1\u05d9\u05e2\u05d4 \u05e9\u05d4\u05d5\u05d2\u05e9\u05d4 \u05dc\u05d1\u05d9\u05ea \u05d4\u05d3\u05d9\u05df \u05d1\u05d4\u05d0\u05d2@N12chat",false,396,"\u05d9\u05e8\u05d5\u05df \u05d0\u05d1\u05e8\u05d4\u05dd\u05d0\u05d4\u05e8\u05df \u05d1\u05e8\u05e7 \u05d0\u05d9\u05e9\u05e8 \u05dc-N12: \u05d0\u05d4\u05d9\u05d4 \u05d4\u05e9\u05d5\u05e4\u05d8 \u05de\u05d8\u05e2\u05dd \u05d9\u05e9\u05e8\u05d0\u05dc \u05d1\u05ea\u05d1\u05d9\u05e2\u05d4 \u05e9\u05d4\u05d5\u05d2\u05e9\u05d4 \u05dc\u05d1\u05d9\u05ea \u05d4\u05d3\u05d9\u05df \u05d1\u05d4\u05d0\u05d2@N12chat"],["\u05d1\u05db\u05d9\u05e8 \u05d4\u05e4\u05ea\"\u05d7 \u05e2\u05d6\u05d0\u05dd \u05d0\u05dc\u05d0\u05d7\u05de\u05d3: \u05d4\u05e8\u05d0\u05d9\u05e1 \u05d0\u05d1\u05d5 \u05de\u05d0\u05d6\u05df \u05d1\u05d9\u05e7\u05e9 \u05de\u05de\u05e0\u05d9 \u05dc\u05d9\u05e6\u05d5\u05e8 \u05e7\u05e9\u05e8 \u05e2\u05dd \u05d7\u05de\u05d0\u05e1. \u05d1\u05e7\u05e8\u05d5\u05d1 \u05e0\u05d9\u05e6\u05d5\u05e8 \u05e7\u05e9\u05e8 \u05e2\u05dd \u05d0\u05e1\u05de\u05d0\u05e2\u05d9\u05dc \u05d4\u05e0\u05d9\u05d4, \u05d9\u05d5\"\u05e8 \u05d4\u05dc\u05e9\u05db\u05d4 \u05d4\u05de\u05d3\u05d9\u05e0\u05d9\u05ea \u05e9\u05dc \u05d7\u05de\u05d0\u05e1.###\u05d3\u05d1\u05e8\u05d9\u05d5 \u05de\u05d2\u05d9\u05e2\u05d9\u05dd \u05e2\u05dc \u05e8\u05e7\u05e2 \u05d4\u05e8\u05d0\u05d9\u05d5\u05df \u05e9\u05dc \u05d1\u05db\u05d9\u05e8 \u05d4\u05d7\u05de\u05d0\u05e1 \u05de\u05d5\u05e1\u05d0 \u05d0\u05d1\u05d5 \u05de\u05e8\u05d6\u05d5\u05e7 \u05e9\u05d4\u05ea\u05e4\u05e8\u05e1\u05dd \u05d4\u05d9\u05d5\u05dd \u05d1\u05d0\u05dc\u05de\u05d5\u05e0\u05d9\u05d8\u05d5\u05e8, \u05d1\u05d5 \u05e6\u05d9\u05d9\u05df \u05d0\u05d1\u05d5 \u05de\u05e8\u05d6\u05d5\  \u05d4\u05ea\u05d5\u05ea\u05d9\u05dd \u05d5\u05d2\u05d9\u05d6\u05d5\u05dd \u05de\u05d8\u05e2\u05d9\u05dd \u05e0\u05e9\u05d9\u05e8\u05d9\u05dd (\u05db\u05d5\u05dc\u05dc \u05db\u05e8\u05dd \u05dc\u05d9\u05d9\u05df) \u05dc\u05d4\u05d2\u05d9\u05e9 \u05d1\u05e7\u05e9\u05d4 \u05dc\u05d4\u05e2\u05e1\u05e7\u05ea \u05e2\u05d5\u05d1\u05d3\u05d9\u05dd \u05d6\u05e8\u05d9\u05dd \u05d1\u05e9\u05e0\u05ea 2024@N12chat",false,407,"\u05de\u05e2\u05d9\u05d9\u05df \u05e4\u05e8\u05ea\u05d9\u05d4\u05ea\u05d0\u05d7\u05d3\u05d5\u05ea \u05d7\u05e7\u05dc\u05d0\u05d9 \u05d9\u05e9\u05e8\u05d0\u05dc \u05e4\u05e8\u05e1\u05de\u05d4 \u05db\u05d9 \u05d1\u05d4\u05de\u05e9\u05da \u05dc\u05e4\u05e2\u05d9\u05dc\u05d5\u05ea\u05d4 \u05dc\u05de\u05e2\u05df \u05de\u05e6\u05d9\u05d0\u05ea \u05e4\u05ea\u05e8\u05d5\u05e0\u05d5\u05ea \u05dc\u05d7\u05e7\u05dc\u05d0\u05d9\u05dd \u05e9\u05d4\u05e2\u05e1\u05d9\u05e7\u05d5 \u05e2\u05d5\u05d1\u05d3\u05d9\u05dd \u05e2\u05d5\u05e0\u05ea\u05d9\u05d9\u05dd \u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd, \u05de\u05e9\u05e8\u05d3 \u05d4\u05d7\u05e7\u05dc\u05d0\u05d5\u05ea \u05d4\u05d5\u05e6\u05d9\u05d0 \u05d8\u05d9\u05d5\u05d8\u05ea \u05e7\u05d5\u05dc \u05e7\u05d5\u05e8\u05d0 \u05dc\u05d4\u05e2\u05e8\u05d5\u05ea \u05d4\u05e6\u05d9\u05d1\u05d5\u05e8 \u05d4\u05de\u05d0\u05e4\u05e9\u05e8 \u05dc\u05d7\u05e7\u05dc\u05d0\u05d9\u05dd \u05d1\u05e2\u05e0\u05e4\u05d9 \u05d4\u05d4\u05d3\u05e8\u05d9\u05dd, \u05d4\u05ea\u05d5\u05ea\u05d9\u05dd \u05d5\u05d2\u05d9\u05d6\u05d5\u05dd \u05de\u05d8\u05e2\u05d9\u05dd \u05e0\u05e9\u05d9\u05e8\u05d9\u05dd (\u05db\u05d5\u05dc\u05dc \u05db\u05e8\u05dd \u05dc\u05d9\u05d9\u05df) \u05dc\u05d4\u05d2\u05d9\u05e9 \u05d1\u05e7\u05e9\u05d4 \u05dc\u05d4\u05e2\u05e1\u05e7\u05ea \u05e2\u05d5\u05d1\u05d3\u05d9\u05dd \u05d6\u05e8\u05d9\u05dd \u05d1\u05e9\u05e0\u05ea 2024@N12chat"],["\u05d9\u05e2\u05dc \u05d0\u05d5\u05d3\u05dd\u05de\u05e9\u05e8\u05d3 \u05d4\u05d7\u05d9\u05e0\u05d5\u05da \u05d9\u05d7\u05dc \u05d1\u05d7\u05dc\u05d5\u05e7\u05ea \u05de\u05d7\u 5e2\u05d6\u05d4 (\u05db\u05dc\u05d5\u05de\u05e8 \u05d4\u05e4\u05e1\u05e7\u05ea \u05d0\u05e9-\u05d0\"\u05e2) .\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,414,"\u05d4\u05d2'\u05d4\u05d0\u05d3 \u05d4\u05d0\u05e1\u05dc\u05d0\u05de\u05d9 \u05de\u05d9\u05d9\u05e9\u05e8 \u05e7\u05d5 \u05e2\u05dd \u05d4\u05e6\u05d4\u05e8\u05ea \u05d7\u05de\u05d0\u05e1 \u05d1\u05e2\u05e0\u05d9\u05d9\u05df \u05d4\u05d3\u05d9\u05d5\u05d5\u05d7\u05d9\u05dd \u05d1\u05d9\u05e9\u05e8\u05d0\u05dc \u05e2\u05dc \u05de\u05d5\"\u05de \u05dc\u05e2\u05e1\u05e7\u05ea \u05d7\u05d9\u05dc\u05d5\u05e4\u05d9 \u05e9\u05d1\u05d5\u05d9\u05d9\u05dd.\u05d1\u05db\u05d9\u05e8 \u05d4\u05d2'\u05d4\u05d0\u05d3 \u05d4\u05d0\u05e1\u05dc\u05d0\u05de\u05d9 \u05e2\u05dc\u05d9 \u05d0\u05d1\u05d5 \u05e9\u05d0\u05d4\u05d9\u05df:\u05d0\u05d9\u05df \u05e9\u05d9\u05d7 \u05e2\u05dc \u05d4\u05d5\u05d3\u05e0\u05d4 \u05e2\u05dd \u05d9\u05e9\u05e8\u05d0\u05dc.\"\u05d4\u05d4\u05ea\u05e0\u05d2\u05d3\u05d5\u05ea\" \u05d0\u05d5\u05d7\u05d6\u05ea \u05d1\u05e2\u05de\u05d3\u05ea\u05d4 \u05dc\u05e4\u05d9\u05d4 \u05db\u05dc \u05d4\u05d5\u05d3\u05e0\u05d4 \u05ea\u05d4\u05d9\u05d4 \u05e7\u05e9\u05d5\u05e8\u05d4 \u05dc\u05d4\u05e4\u05e1\u05e7\u05ea \u05d4\u05ea\u05d5\u05e7\u05e4\u05e0\u05d5\u05ea \u05e2\u05dc \u05e2\u05d6\u05d4 (\u05db\u05dc\u05d5\u05de\u05e8 \u05d4\u05e4\u05e1\u05e7\u05ea \u05d0\u05e9-\u05d0\"\u05e2) .\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05d0\u05d1\u05d9\u05d1\u05d9\u05ea \u05de\u05d9\u05e1\u05e0\u05d9\u05e7\u05d5\u05d1\u05d4\u05e8\u05db\u05d1\u05ea \u05d4\u05e7\u05dc\u05d4 \u05d1\u05ea\u05dc \u05d0\u05d1\u05d9\u05d1 \u05e9\u05d1\u05d4 \u05dc\u05e4\u05e2\u05d9\u05dc\u05d5\u05ea \u05de\u05dc\u05d0\u05d4 \u05dc\u05d0\u05d7\u05e8 \u05e9\u05e0\u05e2\u05e6\u05e8\u05d4 \u05de\u05e4\u05e2\u05d9\u05dc\u05d5\u05ea \u05d1\u05e9\u05dc \u05ea\u05e7\u05dc\u05d4 \u \u05d5\u05d0\u05ea \u05de\u05e1\u05d9\u05e8\u05d5\u05ea \u05d4\u05e0\u05e4\u05e9 \u05d4\u05de\u05e1\u05de\u05dc\u05d9\u05dd \u05d0\u05ea \u05d7\u05d2 \u05d4\u05d7\u05e0\u05d5\u05db\u05d4\", \u05d0\u05de\u05e8 \u05de\u05e4\u05e7\u05d3 \u05d4\u05de\u05d7\u05d5\u05d6 \u05dc\u05de\u05e9\u05e4\u05d7\u05d5\u05ea. \u05e6\u05d9\u05dc\u05d5\u05dd: \u05d3\u05d5\u05d1\u05e8\u05d5\u05ea \u05d4\u05de\u05e9\u05d8\u05e8\u05d4@N12chat"],["\u05d4\u05d7\u05d5\u05ea'\u05d9\u05dd \u05d1\u05ea\u05d9\u05de\u05df: \u05d0\u05e0\u05d7\u05e0\u05d5 \u05e2\u05e8\u05d5\u05db\u05d9\u05dd \u05dc\u05d7\u05d9\u05d3\u05d5\u05e9 \u05d4\u05e4\u05e2\u05d9\u05dc\u05d5\u05ea \u05d4\u05d4\u05ea\u05e7\u05e4\u05d9\u05ea \u05e9\u05dc\u05e0\u05d5 \u05e0\u05d2\u05d3 \u05d4\u05d0\u05d5\u05d9\u05d1 \u05d4\u05e6\u05d9\u05d5\u05e0\u05d9 \u05db\u05db\u05dc \u05e9\u05d9\u05d7\u05dc\u05d9\u05d8 \u05dc\u05d7\u05d3\u05e9 \u05d0\u05ea \u05ea\u05e7\u05d9\u05e4\u05d5\u05ea\u05d9\u05d5 \u05d1\u05e2\u05d6\u05d4.\n",false,420,"\u05d4\u05d7\u05d5\u05ea'\u05d9\u05dd \u05d1\u05ea\u05d9\u05de\u05df: \u05d0\u05e0\u05d7\u05e0\u05d5 \u05e2\u05e8\u05d5\u05db\u05d9\u05dd \u05dc\u05d7\u05d9\u05d3\u05d5\u05e9 \u05d4\u05e4\u05e2\u05d9\u05dc\u05d5\u05ea \u05d4\u05d4\u05ea\u05e7\u05e4\u05d9\u05ea \u05e9\u05dc\u05e0\u05d5 \u05e0\u05d2\u05d3 \u05d4\u05d0\u05d5\u05d9\u05d1 \u05d4\u05e6\u05d9\u05d5\u05e0\u05d9 \u05db\u05db\u05dc \u05e9\u05d9\u05d7\u05dc\u05d9\u05d8 \u05dc\u05d7\u05d3\u05e9 \u05d0\u05ea \u05ea\u05e7\u05d9\u05e4\u05d5\u05ea\u05d9\u05d5 \u05d1\u05e2\u05d6\u05d4.\n"],["\u05d2\u05d9\u05d0 \u05d5\u05e8\u05d5\u05df\ud83d\udcdd\u05d8\u05d9\u05dc \u05e0\"\u05d8 \u05e9\u05e0\u05d5\u05e8\u05d4 \u05dc\u05d0\u05d6\u05d5\u05e8 \u05d4\u05d2\u05dc\u05d9\u05dc \u05d4\u05e2\u05dc\u05d9\u05d5\u05df \u05de\u05dc\u05d1\u05e0\u05d5\u05df \u05e4\u05d2\u05e2 \u05d1\u05ea\u05e9\u05ea\u05d9\u05d5\u05ea \u05d7\u05e9\u05de\u05dc \u05e1\u05de\u05d5\u05da \u05dc\u05e7\u05d9\u05d1\u05d5\u05e5 \u05de\u05dc\u05db\u05d9\u05d4@N12chat",false,421,"\u05d2\u05d9\u05d0 \u05d5\u05e8\u05d5\u05df\ud83d\udcdd\u05d8\u05d9\u05dc \u05e0\"\u05d8 \u05e9\u05e0\u05d5\u05e8\u05d4 \u05dc\u05d0\u05d6\u05d5\u05e8 \u05d4\u05d2\u05dc\u05d9\u05dc \u05d4\u05e2\u05dc\u05d9\u05d5\u05df \u05de\u05dc\u05d1\u05e0\u05d5\u05df \u05e4\u05d2\u05e2 \u05d1\u05ea\u05e9\u05ea\u05d9\u05d5\u05ea \u05d7\u05e9\u05de\u05dc \u05e1\u05de\u05d5\u05da \u05dc\u05e7\u05d9\u05d1\u05d5\u05e5 \u05de\u05dc\u05db\u05d9\u05d4@N12chat"],["\u05e0\u05d9\u05e6\u05df \u05e9\u05e4\u05d9\u05e8\u05d0\u05e8\u05d0\u05e9 \u05e2\u05d9\u05e8\u05d9\u05d9\u05ea \u05e9\u05d3\u05e8\u05d5\u05ea \u05d0\u05dc\u05d5\u05df \u05d3\u05d5\u05d9\u05d3\u05d9 \u05e7\u05e8\u05d0 \u05d4\u05d9\u05d5\u05dd \u05dc\u05e9\u05e8 \u05d4\u05d7\u05d9\u05e0\u05d5\u05da \u05d9\u05d5\u05d0\u05d1 \u05e7\u05d9\u05e9 \u05d5\u05dc\u05d0\u05e8\u05d2\u05d5\u05e0\u05d9 \u05d4\u05de\u05d5\u05e8\u05d9\u05dd, \u05dc\u05d3\u05d0\u05d5\u05d2 \u05dc\u05db\u05da \u05e9\u05d2\u05dd \u05d1\u05d7\u05d2 \u05d4\u05d7\u05e0\u05d5\u05db\u05d4, \u05e9\u05d9\u05d7\u05dc \u05d1\u05d9\u05d5\u05dd \u05d7\u05de\u05d9\u05e9\u05d9 \u05d1\u05e2\u05e8\u05d1, \u05ea\u05dc\u05de\u05d9\u05d3\u05d9 \u05e9\u05d3\u05e8\u05d5\u05ea \u05d9\u05de\u05e9\u05d9\u05db\u05d5 \u05dc\u05dc\u05de\u05d5\u05d3 \u05d1\u05de\u05e1\u05d2\u05e8\u05d5\u05ea \u05d4\u05d7\u05d9\u05e0\u05d5\u05da \u05d0\u05dc\u05d9\u05d4\u05df \u05e0\u05db\u05e0\u05e1\u05d5 \u05d1\u05e9\u05d1\u05d5\u05e2\u05d5\u05ea \u05d4\u05d0\u05d7\u05e8\u05d5\u05e0\u05d9\u05dd: \"\u05e6\u05e8\u05d9\u05da \u05dc\u05d0\u05e4\u05e9\u05e8 \u05dc\u05d9\u05dc\u05d3\u05d9 \u05e9\u05d3\u05e8\u05d5\u05ea \u05e8\u05e6\u05d9\u05e4\u05d5\u05ea \u05dc\u05d9\u05de\u05d5\u05d3\u05d9\u05ea \u05d1\u05e9\u05dc \u05d4\u05e9\u05d1\u05d5\u05e2\u05d5\u05ea \u05d4\u05e8\u05d1\u05d9\u05dd \u05d1\u05d4\u05dd \u05dc\u05d0 \u05dc\u05de\u05d3\u05d5 \u05d0\u05d5 \u05dc\u05de\u05d3\u05d5 \u05d7\u05dc\u05e7\u05d9\u05ea. \u05d4\u05e4\u05e1\u05e7\u05ea \u05d4\u05dc\u05d9\u05de\u05d5\u05d3\u05d9\u05dd \u05dc\u05de\u05e9\u05da \u05e9\u05d1\u05d5\u05e2 \u05d3\u05d5\u05d5\u05e7\u05d0 \u05e2\u05db\u05e9\u05d9\u05d5 \u05ea\u05d2\u05e8\u05d5\u05dd \u05e0\u05d6\u05e7 \u05dc\u05ea\u05dc\u05de\u05d9\u05d3\u05d9\u05dd \u05e9\u05d1\u05de\u05d9\u05d5\u05d7\u05d3 \u05d1\u05d9\u05de\u05d9\u05dd \u05d0\u05dc\u05d4 \u05e6\u05e8\u05d9\u05db\u05d9\u05dd \u05d1\u05d9\u05d8\u05d7\u05d5\u05df \u05d5\u05e1\u05d3\u05e8 \u05d9\u05d5\u05dd \u05e2\u05dd \u05d4\u05de\u05d5\u05e8\u05d9\u05dd \u05d5\u05d4\u05d2\u05e0\u05e0\u05d5\u05ea \u05e9\u05d4\u05dd \u05de\u05db\u05d9\u05e8\u05d9\u05dd\"@N12chat",false,422,"\u05e0\u05d9\u05e6\u05df \u05e9\u05e4\u05d9\u05e8\u05d0\u05e8\u05d0\u05e9 \u05e2\u05d9\u05e8\u05d9\u05d9\u05ea \u05e9\u05d3\u05e8\u05d5\u05ea \u05d0\u05dc\u05d5\u05df \u05d3\u05d5\u05d9\u05d3\u05d9 \u05e7\u05e8\u05d0 \u05d4\u05d9\u05d5\u05dd \u05dc\u05e9\u05e8 \u05d4\u05d7\u05d9\u05e0\u05d5\u05da \u05d9\u05d5\u05d0\u05d1 \u05e7\u05d9\u05e9 \u05d5\u05dc\u05d0\u05e8\u05d2\u05d5\u05e0\u05d9 \u05d4\u05de\u05d5\u05e8\u05d9\u05dd, \u05dc\u05d3\u05d0\u05d5\u05d2 \u05dc\u05db\u05da \u05e9\u05d2\u05dd \u05d1\u05d7\u05d2 \u05d4\u05d7\u05e0\u05d5\u05db\u05d4, \u05e9\u05d9\u05d7\u05dc \u05d1\u05d9\u05d5\u05dd \u05d7\u05de\u05d9\u05e9\u05d9 \u05d1\u05e2\u05e8\u05d1, \u05ea\u05dc\u05de\u05d9\u05d3\u05d9 \u05e9\u05d3\u05e8\u05d5\u05ea \u05d9\u05de\u05e9\u05d9\u05db\u05d5 \u05dc\u05dc\u05de\u05d5\u05d3 \u05d1\u05de\u05e1\u05d2\u05e8\u05d5\u05ea \u05d4\u05d7\u05d9\u05e0\u05d5\u05da \u05d0\u05dc\u05d9\u05d4\u05df \u05e0\u05db\u05e0\u05e1\u05d5 \u05d1\u05e9\u05d1\u05d5\u05e2\u05d5\u05ea \u05d4\u05d0\u05d7\u05e8\u05d5\u05e0\u05d9\u05dd: \"\u05e6\u05e8\u05d9\u05da \u05dc\u05d0\u05e4\u05e9\u05e8 \u05dc\u05d9\u05dc\u05d3\u05d9 \u05e9\u05d3\u05e8\u05d5\u05ea \u05e8\u05e6\u05d9\u05e4\u05d5\u05ea \u05dc\u05d9\u05de\u05d5\u05d3\u05d9\u05ea \u05d1\u05e9\u05dc \u05d4\u05e9\u05d1\u05d5\u05e2\u05d5\u05ea \u05d4\u05e8\u05d1\u05d9\u05dd \u05d1\u05d4\u05dd \u05dc\u05d0 \u05dc\u05de\u05d3\u05d5 \u05d0\u05d5 \u05dc\u05de\u05d3\u05d5 \u05d7\u05dc\u05e7\u05d9\u05ea. \u05d4\u05e4\u05e1\u05e7\u05ea \u05d4\u05dc\u05d9\u05de\u05d5\u05d3\u05d9\u05dd \u05dc\u05de\u05e9\u05da \u05e9\u05d1\u05d5\u05e2 \u05d3\u05d5\u05d5\u05e7\u05d0 \u05e2\u05db\u05e9\u05d9\u05d5 \u05ea\u05d2\u05e8\u05d5\u05dd \u05e0\u05d6\u05e7 \u05dc\u05ea\u05dc\u05de\u05d9\u05d3\u05d9\u05dd \u05e9\u05d1\u05de\u05d9\u05d5\u05d7\u05d3 \u05d1\u05d9\u05de\u05d9\u05dd \u05d0\u05dc\u05d4 \u05e6\u05e8\u05d9\u05db\u05d9\u05dd \u05d1\u05d9\u05d8\u05d7\u05d5\u05df \u05d5\u05e1\u05d3\u05e8 \u05d9\u05d5\u05dd \u05e2\u05dd \u05d4\u05de\u05d5\u05e8\u05d9\u05dd \u05d5\u05d4\u05d2\u05e0\u05e0\u05d5\u05ea \u05e9\u05d4\u05dd \u05de\u05db\u05d9\u05e8\u05d9\u05dd\"@N12chat"],["\u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd \u05de\u05d3\u05d5\u05d5\u05d7\u05d9\u05dd \u05e2\u05dc \u05e1\u05d3\u05e8\u05ea \u05ea\u05e7\u05d9\u05e4\u05d5\u05ea \u05db\u05e2\u05ea \u05d1\u05d0\u05d6\u05d5\u05e8 \u05e9\u05db\u05d5\u05e0\u05ea \u05d0-\u05ea\u05e0\u05d5\u05e8, \u05d1\u05e8\u05e4\u05d9\u05d7, \u05d1\u05d3\u05e8\u05d5\u05dd \u05d4\u05e8\u05e6\u05d5\u05e2\u05d4.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,423,"\u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd \u05de\u05d3\u05d5\u05d5\u05d7\u05d9\u05dd \u05e2\u05dc \u05e1\u05d3\u05e8\u05ea \u05ea\u05e7\u05d9\u05e4\u05d5\u05ea \u05db\u05e2\u05ea \u05d1\u05d0\u05d6\u05d5\u05e8 \u05e9\u05db\u05d5\u05e0\u05ea \u05d0-\u05ea\u05e0\u05d5\u05e8, \u05d1\u05e8\u05e4\u05d9\u05d7, \u05d1\u05d3\u05e8\u05d5\u05dd \u05d4\u05e8\u05e6\u05d5\u05e2\u05d4.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05e1\u05e4\u05d9\u05e8 \u05dc\u05d9\u05e4\u05e7\u05d9\u05df@N12chat",false,424,"\u05e1\u05e4\u05d9\u05e8 \u05dc\u05d9\u05e4\u05e7\u05d9\u05df@N12chat"],["\u05e6\u05d1\u05e2 \u05d0\u05d3\u05d5\u05dd \u05d1\u05e7\u05e8\u05d9\u05d5\u05ea \u05dc\u05e4\u05e0\u05d9 \u05d3\u05e7\u05d5\u05ea \u05d0\u05d7\u05d3\u05d5\u05ea\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,425,"\u05e6\u05d1\u05e2 \u05d0\u05d3\u05d5\u05dd \u05d1\u05e7\u05e8\u05d9\u05d5\u05ea \u05dc\u05e4\u05e0\u05d9 \u05d3\u05e7\u05d5\u05ea \u05d0\u05d7\u05d3\u05d5\u05ea\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05d0\u05d5\u05e8 \u05e8\u05d1\u05d9\u05d3\u05d1\u05d9\u05d4\"\u05d7 \u05e9\u05de\u05d9\u05e8 \u05d0\u05e1\u05e3 \u05d4\u05e8\u05d5\u05e4\u05d0: \u05dc\u05e4\u05e0\u05d9 \u05d6\u05de\u05df \u05e7\u05e6\u05e8 \u05d4\u05d2\u05d9\u05e2 \u05d1\u05de\u05e6\u05d1 \u05d0\u05e0\u05d5\u05e9 \u05e4\u05e2\u05d5\u05d8 \u05d1\u05df \u05e9\u05e0\u05ea\u05d9\u05d9\u05dd \u05dc\u05d7\u05d3\u05e8 \u05d4\u05d8\u05e8\u05d0\u05d5\u05de\u05d4 \u05d1\u05de\u05d7\u05dc\u05e7\u05d4 \u05dc\u05e8\u05e4\u05d5\u05d0\u05d4 \u05d3\u05d7\u05d5\u05e4\u05d4. \u05d4\u05e8\u05d5\u05e4\u05d0\u05d9\u05dd \u05e0\u05dc\u05d7\u05de\u05d9\u05dd \u05e2\u05dc \u05d7\u05d9\u05d9\u05d5@N12chat",false,426,"\u05d0\u05d5\u05e8 \u05e8\u05d1\u05d9\u05d3\u05d1\u05d9\u05d4\"\u05d7 \u05e9\u05de\u05d9\u05e8 \u05d0\u05e1\u05e3 \u05d4\u05e8\u05d5\u05e4\u05d0: \u05dc\u05e4\u05e0\u05d9 \u05d6\u05de\u05df \u05e7\u05e6\u05e8 \u05d4\u05d2\u05d9\u05e2 \u05d1\u05de\u05e6\u05d1 \u05d0\u05e0\u05d5\u05e9 \u05e4\u05e2\u05d5\u05d8 \u05d1\u05df \u05e9\u05e0\u05ea\u05d9\u05d9\u05dd \u05dc\u05d7\u05d3\u05e8 \u05d4\u05d8\u05e8\u05d0\u05d5\u05de\u05d4 \u05d1\u05de\u05d7\u05dc\u05e7\u05d4 \u05dc\u05e8\u05e4\u05d5\u05d0\u05d4 \u05d3\u05d7\u05d5\u05e4\u05d4. \u05d4\u05e8\u05d5\u05e4\u05d0\u05d9\u05dd \u05e0\u05dc\u05d7\u05de\u05d9\u05dd \u05e2\u05dc \u05d7\u05d9\u05d9\u05d5@N12chat"],["\u05e2\u05e0\u05d1\u05e8 \u05d8\u05d5\u05d9\u05d6\u05e8\u05d3\u05d9\u05d5\u05d5\u05d7 \u05e8\u05d0\u05e9\u05d5\u05e0\u05d9: \u05e9\u05d5\u05d8\u05e8\u05ea \u05e0\u05e4\u05e6\u05e2\u05d4 \u05e7\u05dc \u05d1\u05d0\u05d9\u05e8\u05d5\u05e2 \u05d3\u05e8\u05d9\u05e1\u05d4 \u05e1\u05de\u05d5\u05da \u05dc\u05d2\u05d1\u05e2\u05ea \u05d6\u05d0\u05d1. \u05d4\u05e0\u05d4\u05d2 \u05e0\u05d5\u05d8\u05e8\u05dc@N12chat",false,427,"\u05e2\u05e0\u05d1\u05e8 \u05d8\u05d5\u05d9\u05d6\u05e8\u05d3\u05d9\u05d5\u05d5\u05d7 \u05e8\u05d0\u05e9\u05d5\u05e0\u05d9: \u05e9\u05d5\u05d8\u05e8\u05ea \u05e0\u05e4\u05e6\u05e2\u05d4 \u05e7\u05dc \u05d1\u05d0\u05d9\u05e8\u05d5\u05e2 \u05d3\u05e8\u05d9\u05e1\u05d4 \u05e1\u05de\u05d5\u05da \u05dc\u05d2\u05d1\u05e2\u05ea \u05d6\u05d0\u05d1. \u05d4\u05e0\u05d4\u05d2 \u05e0\u05d5\u05d8\u05e8\u05dc@N12chat"],["\u05e8\u05d0\u05e9 \u05d3\u05e1\u05e7 12\ud83d\udcdd\u05d8\u05e8\u05d2\u05d3\u05d9\u05d4 \u05d1\u05e2\u05d6\u05d4: \u05d4\u05d5\u05ea\u05e8 \u05dc\u05e4\u05e8\u05e1\u05d5\u05dd - \u05d4\u05d7\u05d8\u05d5\u05e4\u05d9\u05dd \u05d9\u05d5\u05ea\u05dd \u05d7\u05d9\u05d9\u05dd \u05de\u05db\u05e4\u05e8 \u05e2\u05d6\u05d4 \u05d5\u05e1\u05d0\u05de\u05e8 \u05e4\u05d5\u05d0\u05d3 \u05d0\u05dc-\u05d8\u05dc\u05d0\u05dc\u05e7\u05d4 \u05de\u05d7\u05d5\u05e8\u05d4 \u05e0\u05d4\u05e8\u05d2\u05d5 \u05de\u05d9\u05e8\u05d9 \u05d1\u05e9\u05d5\u05d2\u05d2 \u05e9\u05dc \u05db\u05d5\u05d7\u05d5\u05ea \u05e6\u05d4\"\u05dc \u05d1\u05e1\u05d2'\u05e2\u05d9\u05d9\u05d4. \u05d7\u05d8\u05d5\u05e3 \u05e0\u05d5\u05e1\u05e3 \u05e0\u05d4\u05e8\u05d2 \u05d2\u05dd \u05d4\u05d5\u05d0, \u05d0\u05da \u05dc\u05d1\u05e7\u05e9\u05ea \u05de\u05e9\u05e4\u05d7\u05ea\u05d5 \u05e9\u05de\u05d5 \u05dc\u05d0 \u05d9\u05d9\u05de\u05e1\u05e8 \u05d1\u05e9\u05dc\u05d1 \u05d6\u05d4@N12chat",false,428,"\u05e8\u05d0\u05e9 \u05d3\u05e1\u05e7 12\ud83d\udcdd\u05d8\u05e8\u05d2\u05d3\u05d9\u05d4 \u05d1\u05e2\u05d6\u05d4: \u05d4\u05d5\u05ea\u05e8 \u05dc\u05e4\u05e8\u05e1\u05d5\u05dd - \u05d4\u05d7\u05d8\u05d5\u05e4\u05d9\u05dd \u05d9\u05d5\u05ea\u05dd \u05d7\u05d9\u05d9\u05dd \u05de\u05db\u05e4\u05e8 \u05e2\u05d6\u05d4 \u05d5\u05e1\u05d0\u05de\u05e8 \u05e4\u05d5\u05d0\u05d3 \u05d0\u05dc-\u05d8\u05dc\u05d0\u05dc\u05e7\u05d4 \u05de\u05d7\u05d5\u05e8\u05d4 \u05e0\u05d4\u05e8\u05d2\u05d5 \u05de\u05d9\u05e8\u05d9 \u05d1\u05e9\u05d5\u05d2\u05d2 \u05e9\u05dc \u05db\u05d5\u05d7\u05d5\u05ea \u05e6\u05d4\"\u05dc \u05d1\u05e1\u05d2'\u05e2\u05d9\u05d9\u05d4. \u05d7\u05d8\u05d5\u05e3 \u05e0\u05d5\u05e1\u05e3 \u05e0\u05d4\u05e8\u05d2 \u05d2\u05dd \u05d4\u05d5\u05d0, \u05d0\u05da \u05dc\u05d1\u05e7\u05e9\u05ea \u05de\u05e9\u05e4\u05d7\u05ea\u05d5 \u05e9\u05de\u05d5 \u05dc\u05d0 \u05d9\u05d9\u05de\u05e1\u05e8 \u05d1\u05e9\u05dc\u05d1 \u05d6\u05d4@N12chat"],["\u05d3\u05d5\u05d1\u05e8 \u05e6\u05d4\"\u05dc \u05d1\u05e2\u05e8\u05d1\u05d9\u05ea \u05de\u05db\u05d7\u05d9\u05e9 \u05dc\u05e4\u05e0\u05d9 \u05d6\u05de\u05df \u05e7\u05e6\u05e8 \u05d0\u05ea \u05d4\u05d3\u05d9\u05d5\u05d5\u05d7\u05d9\u05dd \u05e2\u05dc \u05db\u05da \u05e9\u05db\u05d5\u05d7\u05d5\u05ea \u05e6\u05d4\"\u05dc \u05de\u05ea\u05e7\u05d3\u05de\u05d9\u05dd \u05dc\u05e2\u05d1\u05e8 \u05d3\u05de\u05e9\u05e7.\u05dc\u05d3\u05d1\u05e8\u05d9\u05d5 \u05d4\u05db\u05d5\u05d7\u05d5\u05ea \u05e0\u05de\u05e6\u05d0\u05d9\u05dd \u05d1\u05ea\u05d5\u05da \u05d0\u05d6\u05d5\u05e8 \u05d4\u05d7\u05d9\u05e5 \u05d5\u05d1\"\u05e0\u05e7\u05d5\u05d3\u05d5\u05ea \u05d4\u05d2\u05e0\u05ea\u05d9\u05d5\u05ea \u05d4\u05e7\u05e8\u05d5\u05d1\u05d5\u05ea \u05dc\u05d2\u05d1\u05d5\u05dc\", \u05dc\u05e9\u05dd \u05d4\u05d2\u05e0\u05d4 \u05e2\u05dc \u05d2\u05d1\u05d5\u05dc\u05d5\u05ea \u05d9\u05e9\u05e8\u05d0\u05dc.4 \u05ea\u05d2\u05d5\u05d1\u05d5\u05ea",false,429,"\u05d3\u05d5\u05d1\u05e8 \u05e6\u05d4\"\u05dc \u05d1\u05e2\u05e8\u05d1\u05d9\u05ea \u05de\u05db\u05d7\u05d9\u05e9 \u05dc\u05e4\u05e0\u05d9 \u05d6\u05de\u05df \u05e7\u05e6\u05e8 \u05d0\u05ea \u05d4\u05d3\u05d9\u05d5\u05d5\u05d7\u05d9\u05dd \u05e2\u05dc \u05db\u05da \u05e9\u05db\u05d5\u05d7\u05d5\u05ea \u05e6\u05d4\"\u05dc \u05de\u05ea\u05e7\u05d3\u05de\u05d9\u05dd \u05dc\u05e2\u05d1\u05e8 \u05d3\u05de\u05e9\u05e7.\u05dc\u05d3\u05d1\u05e8\u05d9\u05d5 \u05d4\u05db\u05d5\u05d7\u05d5\u05ea \u05e0\u05de\u05e6\u05 N12chat",false,463,"\u05d0\u05d5\u05e8 \u05e8\u05d1\u05d9\u05d3\u05e8\u05e1\"\u05dc \u05d9\u05d5\u05e1\u05e3 \u05d2\u05d9\u05d8\u05e8\u05e5 \u05d6\"\u05dc, \u05e9\u05e0\u05e4\u05dc \u05d0\u05ea\u05de\u05d5\u05dc \u05d1\u05e7\u05e8\u05d1 \u05d1\u05d3\u05e8\u05d5\u05dd \u05e8\u05e6\u05d5\u05e2\u05ea \u05e2\u05d6\u05d4 \u05d5\u05e2\u05d1\u05d3 \u05d1\u05ea\u05d7\u05d5\u05dd \u05d4\u05e8\u05e4\u05d5\u05d0\u05d4 \u05d5\u05de\u05d3\u05e2\u05d9 \u05d4\u05de\u05d7\u05e9\u05d1, \u05d4\u05e9\u05d0\u05d9\u05e8 \u05de\u05db\u05ea\u05d1 \u05de\u05d5\u05e6\u05e4\u05df \u05dc\u05d4\u05d5\u05e8\u05d9\u05d5 \u05dc\u05d0\u05d7\u05e8 \u05e9\u05d2\u05d5\u05d9\u05d9\u05e1 \u05dc\u05de\u05d9\u05dc\u05d5\u05d0\u05d9\u05dd \u05d1-8 \u05d1\u05d0\u05d5\u05e7\u05d8\u05d5\u05d1\u05e8: \"\u05d0\u05de\u05d0 \u05d5\u05d0\u05d1\u05d0 \u05d4\u05d9\u05e7\u05e8\u05d9\u05dd, \u05d0\u05e0\u05d9 \u05de\u05d0\u05d5\u05d3 \u05d0\u05d5\u05d4\u05d1 \u05d0\u05ea\u05db\u05dd \u05d5\u05d0\u05e0\u05d9 \u05d1\u05e2\u05e6\u05de\u05d9 \u05d1\u05d7\u05e8\u05ea\u05d9 \u05d1\u05d6\u05d4. \u05d4\u05d9\u05d9\u05ea\u05d9 \u05d9\u05db\u05d5\u05dc \u05dc\u05d0 \u05dc\u05dc\u05db\u05ea \u05dc\u05db\u05d0\u05df \u05d5\u05dc\u05d4\u05e1\u05ea\u05ea\u05e8, \u05d0\u05d1\u05dc \u05d6\u05d4 \u05d4\u05d9\u05d4 \u05de\u05e0\u05d5\u05d2\u05d3 \u05dc\u05db\u05dc \u05de\u05d4 \u05e9\u05d0\u05e0\u05d9 \u05de\u05d0\u05de\u05d9\u05df \u05d5\u05de\u05e2\u05e8\u05d9\u05da, \u05d5\u05d1\u05de\u05d9 \u05e9\u05d0\u05e0\u05d9 \u05de\u05d7\u05e9\u05d9\u05d1 \u05d0\u05ea \u05e2\u05e6\u05de\u05d9. \u05dc\u05db\u05df \u05dc\u05d0 \u05d4\u05d9\u05d9\u05ea\u05d4 \u05dc\u05d9 \u05d1\u05e8\u05d9\u05e8\u05d4, \u05d5\u05d4\u05d9\u05d9\u05ea\u05d9 \u05e2\u05d5\u05e9\u05d4 \u05d0\u05ea \u05d0\u05d5\u05ea\u05d5 \u05d3\u05d1\u05e8 \u05d0\u05dd \u05d4\u05d9\u05d9\u05ea\u05d9 \u05d9\u05db\u05d5\u05dc \u05dc\u05d1\u05d7\u05d5\u05e8 \u05e9\u05d5\u05d1. \u05e2\u05e9\u05d9\u05ea\u05d9 \u05d0\u05ea \u05d4\u05d1\u05d7\u05d9\u05e8\u05d4 \u05d4\u05d6\u05d0\u05ea \u0
