u05d8\u05d9\u05ea \u05d5\u05de\u05e9\u05d8\u05e8\u05ea \u05d9\u05e9\u05e8\u05d0\u05dc, \u05d4\u05d5\u05d3\u05d9\u05e2\u05d5 \u05d1\u05d9\u05d5\u05dd \u05d3\u05f3 (29.11.23), \u05e0\u05e6\u05d9\u05d2\u05d9 \u05e6\u05d4\u05f4\u05dc \u05d5\u05de\u05e9\u05d8\u05e8\u05d4 \u05dc\u05de\u05e9\u05e4\u05d7\u05ea\u05d5 \u05e9\u05dc \u05d0\u05d5\u05e4\u05d9\u05e8 \u05e6\u05e8\u05e4\u05ea\u05d9 \u05d6\u05f4\u05dc \u05e9\u05e0\u05d7\u05d8\u05e3 \u05d1\u05d9\u05d5\u05dd \u05e9\u05d1\u05ea \u05d4-7.10.23 \u05de\u05d0\u05d6\u05d5\u05e8 \u05d4\u05de\u05e1\u05d9\u05d1\u05d4 \u05d1\u05e8\u05e2\u05d9\u05dd, \u05e2\u05dc \u05e7\u05d1\u05d9\u05e2\u05ea \u05de\u05d5\u05ea\u05d5.\u05d0\u05e0\u05d5 \u05de\u05e9\u05ea\u05ea\u05e4\u05d9\u05dd \u05d1\u05e6\u05e2\u05e8 \u05d4\u05de\u05e9\u05e4\u05d7\u05d4.\u05d4\u05de\u05e9\u05d9\u05de\u05d4 \u05d4\u05dc\u05d0\u05d5\u05de\u05d9\u05ea \u05e9\u05e2\u05d5\u05de\u05d3\u05ea \u05dc\u05e0\u05d2\u05d3 \u05e2\u05d9\u05e0\u05d9\u05e0\u05d5 \u05d4\u05d9\u05d0 \u05d0\u05d9\u05ea\u05d5\u05e8 \u05d5\u05d4\u05e9\u05d1\u05ea \u05d4\u05d7\u05d8\u05d5\u05e4\u05d5\u05ea \u05d5\u05d4\u05d7\u05d8\u05d5\u05e4\u05d9\u05dd \u05d4\u05d1\u05d9\u05ea\u05d4. \u05e6\u05d4\u05f4\u05dc \u05d5\u05e9\u05d1\"\u05db \u05e4\u05d5\u05e2\u05dc\u05d9\u05dd \u05d1\u05d0\u05d5\u05e4\u05df \u05e6\u05de\u05d5\u05d3 \u05d5\u05d1\u05ea\u05d9\u05d0\u05d5\u05dd \u05de\u05dc\u05d0 \u05e2\u05dd \u05d4\u05d2\u05d5\u05e4\u05d9\u05dd \u05d4\u05dc\u05d0\u05d5\u05de\u05d9\u05d9\u05dd \u05d5\u05d4\u05d1\u05d9\u05d8\u05d7\u05d5\u05e0\u05d9\u05d9\u05dd \u05d4\u05e8\u05dc\u05d5\u05d5\u05e0\u05d8\u05d9\u05d9\u05dd, \u05d5\u05dc\u05d0 \u05e0\u05e8\u05e4\u05d4 \u05e2\u05d3 \u05dc\u05d4\u05e9\u05dc\u05de\u05ea \u05de\u05e9\u05d9\u05de\u05d4 \u05d6\u05d5.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05de\u05d1\u05d6\u05e7\u05df 12\ud83d\udcdd\u05d9\u05e8\u05d5\u05e9\u05dc\u05d9\u05dd: \u05d0\u05d9\u05e9\u05d4 \u05db\u05d1\u05ea 30 \u05d1\u05de\u05e6\u05d1 \u05e7\u05e9\u05d4 \u05d1\u05e2\u05e7\u05d1\u05d5\u05ea \u05e9\u05e8\u05e4\u05d4 \u05e9\u05e4\u05e8\u05e6\u05d4 \u05d1\u05d1\u05e0\u05d9\u05d9\u05df \u05de\u05d2\u05d5\u05e8\u05d9\u05dd \u05d1\u05e9\u05d5\u05e2\u05e4\u05d0\u05d8. \u05e6\u05d5\u05d5\u05ea \u05de\u05d3\"\u05d0 \u05e4\u05d9\u05e0\u05d4 \u05d0\u05d5\u05ea\u05d4 \u05dc\u05d1\u05d9\u05ea \u05d4\u05d7\u05d5\u05dc\u05d9\u05dd \u05d4\u05d3\u05e1\u05d4 \u05e2\u05d9\u05df \u05db\u05e8\u05dd. \u05e4\u05e8\u05de\u05d3\u05d9\u05e7 \u05e9\u05dc \u05de\u05d3\"\u05d0 \u05e4\u05d0\u05d3\u05d9 \u05d3\u05e7\u05d9\u05e7 \u05e1\u05d9\u05e4\u05e8: \"\u05db\u05e9\u05d4\u05d2\u05e2\u05e0\u05d5 \u05dc\u05de\u05e7\u05d5\u05dd \u05e8\u05d0\u05d9\u05e0\u05d5 \u05dc\u05d4\u05d1\u05d5\u05ea \u05d5\u05e2\u05e9\u05df \u05e9\u05d9\u05d5\u05e6\u05d0\u05d9\u05dd \u05de\u05d4\u05d1\u05e0\u05d9\u05d9\u05df, \u05dc\u05d0 \u05d4\u05d9\u05d4 \u05e0\u05d9\u05ea\u05df \u05dc\u05d4\u05ea\u05e7\u05e8\u05d1. \u05db\u05d5\u05d7\u05d5\u05ea \u05d4\u05db\u05d9\u05d1\u05d5\u05d9 \u05d7\u05d9\u05dc\u05e6\u05d5 4 \u05e0\u05e4\u05d2\u05e2\u05d9\u05dd, \u05d1\u05d4\u05dd \u05d0\u05d9\u05e9\u05d4 \u05de\u05d7\u05d5\u05e1\u05e8\u05ea \u05d4\u05db\u05e8\u05d4\"@N12chat",false,467,"\u05de\u05d1\u05d6\u05e7\u05df 12\ud83d\udcdd\u05d9\u05e8\u05d5\u05e9\u05dc\u05d9\u05dd: \u05d0\u05d9\u05e9\u05d4 \u05db\u05d1\u05ea 30 \u05d1\u05de\u05e6\u05d1 \u05e7\u05e9\u05d4 \u05d1\u05e2\u05e7\u05d1\u05d5\u05ea \u05e9\u05e8\u05e4\u05d4 \u05e9\u05e4\u05e8\u05e6\u05d4 \u05d1\u05d1\u05e0\u05d9\u05d9\u05df \u05de\u05d2\u05d5\u05e8\u05d9\u05dd \u05d1\u05e9\u05d5\u05e2\u05e4\u05d0\u05d8. \u05e6\u05d5\u05d5\u05ea \u05de\u05d3\"\u05d0 \u05e4\u05d9\u05e0\u05d4 \u05d0\u05d5\u05ea\u05d4 \u05dc\u05d1\u05d9\u05ea \u05d4\u05d7\u05d5\u05dc\u05d9\u05dd \u05d4\u05d3\u05e1\u05d4 \u05e2\u05d9\u05df \u05db\u05e8\u05dd. \u05e4\u05e8\u05de\u05d3\u05d9\u05e7 \u05e9\u05dc \u05de\u05d3\"\u05d0 \u05e4\u05d0\u05d3\u05d9 \u05d3\u05e7\u05d9\u05e7 \u05e1\u05d9\u05e4\u05e8: \"\u05db\u05e9\u05d4\u05d2\u05e2\u05e0\u05d5 \u05dc\u05de\u05e7\u05d5\u05dd \u05e8\u05d0\u05d9\u05e0\u05d5 \u05dc\u05d4\u05d1\u05d5\u05ea \u05d5\u05e2\u05e9\u05df \u05e9\u05d9\u05d5\u05e6\u05d0\u05d9\u05dd \u05de\u05d4\u05d1\u05e0\u05d9\u05d9\u05df, \u05dc\u05d0 \u05d4\u05d9\u05d4 \u05e0\u05d9\u05ea\u05df \u05dc\u05d4\u05ea\u05e7\u05e8\u05d1. \u05db\u05d5\u05d7\u05d5\u05ea \u05d4\u05db\u05d9\u05d1\u05d5\u05d9 \u05d7\u05d9\u05dc\u05e6\u05d5 4 \u05e0\u05e4\u05d2\u05e2\u05d9\u05dd, \u05d1\u05d4\u05dd \u05d0\u05d9\u05e9\u05d4 \u05de\u05d7\u05d5\u05e1\u05e8\u05ea \u05d4\u05db\u05e8\u05d4\"@N12chat"],["\u05d0\u05d3\u05e8 \u05d2\u05d9\u05e6\u05d9\u05e1\u05d4\u05d0\u05d6\u05e2\u05e7\u05d5\u05ea \u05d1\u05d2\u05dc\u05d9\u05dc \u05d4\u05de\u05e2\u05e8\u05d1\u05d9: \u05de\u05e1\u05ea\u05de\u05df \u05d0\u05d9\u05e8\u05d5\u05e2 \u05e9\u05d5\u05d5\u05d0@N12chat",false,468,"\u05d0\u05d3\u05e8 \u05d2\u05d9\u05e6\u05d9\u05e1\u05d4\u05d0\u05d6\u05e2\u05e7\u05d5\u05ea \u05d1\u05d2\u05dc\u05d9\u05dc \u05d4\u05de\u05e2\u05e8\u05d1\u05d9: \u05de\u05e1\u05ea\u05de\u05df \u05d0\u05d9\u05e8\u05d5\u05e2 \u05e9\u05d5\u05d5\u05d0@N12chat"],["\u05d0\u05d5\u05e4\u05e0\u05ea \u05d4\u05e4\u05dc\u05d0\u05e0\u05dc\u05d9\u05ea \u05d7\u05d5\u05d6\u05e8\u05ea...\u05de\u05d7\u05e0\u05d4 \u05d4\u05e4\u05dc\u05d9\u05d8\u05d9\u05dd \u05d2'\u05e0\u05d9\u05df.User sent a document",false,469,"\u05d0\u05d5\u05e4\u05e0\u05ea \u05d4\u05e4\u05dc\u05d0\u05e0\u05dc\u05d9\u05ea \u05d7\u05d5\u05d6\u05e8\u05ea...\u05de\u05d7\u05e0\u05d4 \u05d4\u05e4\u05dc\u05d9\u05d8\u05d9\u05dd \u05d2'\u05e0\u05d9\u05df.User sent a document"],["\u05e0\u05e8\u05d5\u05ea \u05dc\u05d6\u05db\u05e8\u05dd \u05e9\u05dc \u05d4\u05e9\u05e0\u05d9\u05d9\u05dd \u05dc\u05d9\u05d3 \u05d7\u05d5\u05de\u05ea \u05e9\u05d3\u05d4\"\u05ea \u05e9\u05dc \u05d1\u05d2\u05d3\u05d3, \u05d1\u05e0\u05e7\u05d5\u05d3\u05d4 \u05d1\u05d4 \u05d7\u05d5\u05e1\u05dc\u05d5 \u05e7\u05d0\u05e1\u05dd \u05e1\u05d5\u05dc\u05d9\u05de\u05d0\u05e0\u05d9 \u05d5\u05d0\u05d1\u05d5 \u05de\u05d4\u05d3\u05d9 \u05d0\u05dc\u05de\u05d4\u05e0\u05d3\u05e1.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,470,"\u05e0\u05e8\u05d5\u05ea \u05dc\u05d6\u05db\u05e8\u05dd \u05e9\u05dc \u05d4\u05e9\u05e0\u05d9\u05d9\u05dd \u05dc\u05d9\u05d3 \u05d7\u05d5\u05de\u05ea \u05e9\u05d3\u05d4\"\u05ea \u05e9\u05dc \u05d1\u05d2\u05d3\u05d3, \u05d1\u05e0\u05e7\u05d5\u05d3\u05d4 \u05d1\u05d4 \u05d7\u05d5\u05e1\u05dc\u05d5 \u05e7\u05d0\u05e1\u05dd \u05e1\u05d5\u05dc\u05d9\u05de\u05d0\u05e0\u05d9 \u05d5\u05d0\u05d1\u05d5 \u05de\u05d4\u05d3\u05d9 \u05d0\u05dc\u05de\u05d4\u05e0\u05d3\u05e1.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05e1\u05e4\u05d9\u05e8 \u05dc\u05d9\u05e4\u05e7\u05d9\u05df\u05d0\u05d9\u05e1\u05de\u05e2\u05d9\u05dc \u05d4\u05e0\u05d9\u05d9\u05d4: \u05de\u05d2\u05dc\u05d9\u05dd \u05d2\u05de\u05d9\u05e9\u05d5\u05ea \u05d1\u05de\u05d5\"\u05de \u05e2\u05dd \u05d9\u05e9\u05e8\u05d0\u05dc, \u05d0\u05da \u05de\u05d5\u05db\u05e0\u05d9\u05dd \u05dc\u05d4\u05de\u05e9\u05d9\u05da \u05dc\u05d4\u05d9\u05dc\u05d7\u05dd@N12chat",false,471,"\u05e1\u05e4\u05d9\u05e8 \u05dc\u05d9\u05e4\u05e7\u05d9\u05df\u05d0\u05d9\u05e1\u05de\u05e2\u05d9\u05dc \u05d4\u05e0\u05d9\u05d9\u05d4: \u05de\u05d2\u05dc\u05d9\u05dd \u05d2\u05de\u05d9\u05e9\u05d5\u05ea \u05d1\u05de\u05d5\"\u05de \u05e2\u05dd \u05d9\u05e9\u05e8\u05d0\u05dc, \u05d0\u05da \u05de\u05d5\u05db\u05e0\u05d9\u05dd \u05dc\u05d4\u05de\u05e9\u05d9\u05da \u05dc\u05d4\u05d9\u05dc\u05d7\u05dd@N12chat"],["\u05de\u05d1\u05d6\u05e7\u05df 12\u05d3\u05d5\u05d1\u05e8 \u05e6\u05d4\"\u05dc \u05d4\u05ea\u05d9\u05e8 \u05dc\u05e4\u05e8\u05e1\u05d5\u05dd \u05d0\u05ea \u05e9\u05de\u05d5\u05ea\u05d9\u05d4\u05dd \u05e9\u05dc \u05e9\u05de\u05d5\u05e0\u05d4 \u05d7\u05dc\u05dc\u05d9 \u05e6\u05d4\"\u05dc \u05e9\u05e0\u05e4\u05dc\u05d5 \u05d1\u05e7\u05e8\u05d1\u05d5\u05ea \u05d1\u05e8\u05e6\u05d5\u05e2\u05ea \u05e2\u05d6\u05d4@N12chat",false,472,"\u05de\u05d1\u05d6\u05e7\u05df 12\u05d3\u05d5\u05d1\u05e8 \u05e6\u05d4\"\u05dc \u05d4\u05ea\u05d9\u05e8 \u05dc\u05e4\u05e8\u05e1\u05d5\u05dd \u05d0\u05ea \u05e9\u05de\u05d5\u05ea\u05d9\u05d4\u05dd \u05e9\u05dc \u05e9\u05de\u05d5\u05e0\u05d4 \u05d7\u05dc\u05dc\u05d9 \u05e6\u05d4\"\u05dc \u05e9\u05e0\u05e4\u05dc\u05d5 \u05d1\u05e7\u05e8\u05d1\u05d5\u05ea \u05d1\u05e8\u05e6\u05d5\u05e2\u05ea \u05e2\u05d6\u05d4@N12chat"],["\u05e8\u05e9\u05ea \u05d0\u05dc\u05d2'\u05d6\u05d9\u05e8\u05d4 \u05d4\u05e7\u05d8\u05e8\u05d9\u05ea \u05d3\u05d9\u05d5\u05d5\u05d7\u05d4 \u05dc\u05e4\u05e0\u05d9 \u05db\u05d7\u05e6\u05d9 \u05e9\u05e2\u05d4 \u05e2\u05dc 20 \u05d4\u05e8\u05d5\u05d2\u05d9\u05dd \u05db\u05ea\u05d5\u05e6\u05d0\u05d4 \u05de\u05ea\u05e7\u05d9\u05e4\u05d4 \u05d9\u05e9\u05e8\u05d0\u05dc\u05d9\u05ea \u05e2\u05dc \u05d0\u05d5\u05e0' \u05d0\u05dc\u05d0\u05e7\u05e6\u05d0 (\u05d1\u05e2\u05d9\u05e8) \u05e2\u05d6\u05d4.\u05d3\u05e7\u05d4 \u05dc\u05d0\u05d7\u05e8 \u05de\u05db\u05df \u05d3\u05d9\u05d5\u05d5\u05d7\u05d4 \u05d4\u05e8\u05e9\u05ea \u05e2\u05dc 48 \u05d4\u05e8\u05d5\u05d2\u05d9\u05dd \u05de\u05ea\u05e7\u05d9\u05e4\u05d4 \u05d1\u05e9\u05db\u05d5\u05e0\u05ea \u05d6\u05d9\u05ea\u05d5\u05df \u05d1\u05e2\u05d9\u05e8 \u05e2\u05d6\u05d4.##\u05d7\u05e9\u05d5\u05d1 \u05dc\u05e6\u05d9\u05d9\u05df \u05db\u05d9 \u05d0\u05d5\u05e0' \u05d0\u05dc\u05d0\u05e7\u05e6\u05d0 \u05e0\u05de\u05e6\u05d0\u05ea \u05d1\u05e9\u05db\u05d5\u05e0\u05ea \u05d6\u05d9\u05ea\u05d5\u05df \u05d1\u05e2\u05d9\u05e8 \u05e2\u05d6\u05d4, \u05db\u05da \u05e9\u05dc\u05d0 \u05d1\u05e8\u05d5\u05e8 \u05d0\u05dd \u05d0\u05dc\u05d2'\u05d6\u05d9\u05e8\u05d4 \u05de\u05e0\u05e4\u05d7\u05ea \u05d0\u05ea \u05d0\u05d5\u05ea\u05d5 \u05d4\u05d0\u05d9\u05e8\u05d5\u05e2 \u05e4\u05e2\u05de\u05d9\u05dd (\u05d1\u05de\u05db\u05d5\u05d5\u05df).\u05d9\u05d9\u05ea\u05db\u05df \u05e9\u05de\u05d3\u05d5\u05d1\u05e8 \u05d1\u05ea\u05e7\u05d9\u05e4\u05ea \u05d1\u05d9\u05ea \u05de\u05e9\u05e4\u05d7\u05ea \u05d0\u05e1\u05dc\u05d9\u05dd \u05d0\u05ea\u05de\u05d5\u05dc \u05d1\u05e1\u05de\u05d5\u05da \u05dc\u05de\u05e1\u05d2\u05d3 \u05e2\u05d1\u05d3\u05d0\u05dc\u05dc\u05d4 \u05e2\u05d6\u05d0\u05dd \u05d1\u05d3\u05e8\u05d5\u05dd \u05d4\u05e2\u05d9\u05e8 \u05e2\u05d6\u05d4, \u05dc\u05d0 \u05e8\u05d7\u05d5\u05e7 \u05de\u05d0\u05d5\u05e0\u05d9\u05d1\u05e8\u05e1\u05d9\u05d8\u05ea \u05d0\u05dc\u05d0\u05e7\u05e6\u05d0. \u05e2\"\u05e4 \u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd \u05d1\u05ea\u05e7\u05d9\u05e4\u05d4 \u05d6\u05d5 \u05e0\u05d4\u05e8\u05d2\u05d5 6 \u05d5\u05d9\u05e9\u05e0\u05dd \u05e2\u05d5\u05d3 \u05db 40 \u05e0\u05e2\u05d3\u05e8\u05d9\u05dd.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,473,"\u05e8\u05e9\u05ea \u05d0\u05dc\u05d2'\u05d6\u05d9\u05e8\u05d4 \u05d4\u05e7\u05d8\u05e8\u05d9\u05ea \u05d3\u05d9\u05d5\u05d5\u05d7\u05d4 \u05dc\u05e4\u05e0\u05d9 \u05db\u05d7\u05e6\u05d9 \u05e9\u05e2\u05d4 \u05e2\u05dc 20 \u05d4\u05e8\u05d5\u05d2\u05d9\u05dd \u05db\u05ea\u05d5\u05e6\u05d0\u05d4 \u05de\u05ea\u05e7\u05d9\u05e4\u05d4 \u05d9\u05e9\u05e8\u05d0\u05dc\u05d9\u05ea \u05e2\u05dc \u05d0\u05d5\u05e0' \u05d0\u05dc\u05d0\u05e7\u05e6\u05d0 (\u05d1\u05e2\u05d9\u05e8) \u05e2\u05d6\u05d4.\u05d3\u05e7\u05d4 \u05dc\u05d0\u05d7\u05e8 \u05de\u05db\u05df \u05d3\u05d9\u05d5\u05d5\u05d7\u05d4 \u05d4\u05e8\u05e9\u05ea \u05e2\u05dc 48 \u05d4\u05e8\u05d5\u05d2\u05d9\u05dd \u05de\u05ea\u05e7\u05d9\u05e4\u05d4 \u05d1\u05e9\u05db\u05d5\u05e0\u05ea \u05d6\u05d9\u05ea\u05d5\u05df \u05d1\u05e2\u05d9\u05e8 \u05e2\u05d6\u05d4.##\u05d7\u05e9\u05d5\u05d1 \u05dc\u05e6\u05d9\u05d9\u05df \u05db\u05d9 \u05d0\u05d5\u05e0' \u05d0\u05dc\u05d0\u05e7\u05e6\u05d0 \u05e0\u05de\u05e6\u05d0\u05ea \u05d1\u05e9\u05db\u05d5\u05e0\u05ea \u05d6\u05d9\u05ea\u05d5\u05df \u05d1\u05e2\u05d9\u05e8 \u05e2\u05d6\u05d4, \u05db\u05da \u05e9\u05dc\u05d0 \u05d1\u05e8\u05d5\u05e8 \u05d0\u05dd \u05d0\u05dc\u05d2'\u05d6\u05d9\u05e8\u05d4 \u05de\u05e0\u05e4\u05d7\u05ea \u05d0\u05ea \u05d0\u05d5\u05ea\u05d5 \u05d4\u05d0\u05d9\u05e8\u05d5\u05e2 \u05e4\u05e2\u05de\u05d9\u05dd (\u05d1\u05de\u05db\u05d5\u05d5\u05df).\u05d9\u05d9\u05ea\u05db\u05df \u05e9\u05de\u05d3\u05d5\u05d1\u05e8 \u05d1\u05ea\u05e7\u05d9\u05e4\u05ea \u05d1\u05d9\u05ea \u05de\u05e9\u05e4\u05d7\u05ea \u05d0\u05e1\u05dc\u05d9\u05dd \u05d0\u05ea\u05de\u05d5\u05dc \u05d1\u05e1\u05de\u05d5\u05da \u05dc\u05de\u05e1\u05d2\u05d3 \u05e2\u05d1\u05d3\u05d0\u05dc\u05dc\u05d4 \u05e2\u05d6\u05d0\u05dd \u05d1\u05d3\u05e8\u05d5\u05dd \u05d4\u05e2\u05d9\u05e8 \u05e2\u05d6\u05d4, \u05dc\u05d0 \u05e8\u05d7\u05d5\u05e7 \u05de\u05d0\u05d5\u05e0\u05d9\u05d1\u05e8\u05e1\u05d9\u05d8\u05ea \u05d0\u05dc\u05d0\u05e7\u05e6\u05d0. \u05e2\"\u05e4 \u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd \u05d1\u05ea\u05e7\u05d9\u05e4\u05d4 \u05d6\u05d5 \u05e0\u05d4\u05e8\u05d2\u05d5 6 \u05d5\u05d9\u05e9\u05e0\u05dd \u05e2\u05d5\u05d3 \u05db 40 \u05e0\u05e2\u05d3\u05e8\u05d9\u05dd.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05e0\u05d9\u05e8 \u05d3\u05d1\u05d5\u05e8\u05d9\u05e2\u05d5\u05d3 \u05e6\u05d9\u05d9\u05df: \"\u05d0\u05e0\u05d7\u05e0\u05d5 \u05d1\u05d5\u05d3\u05e7\u05d9\u05dd \u05de\u05d1\u05e0\u05d4 \u05e0\u05d5\u05e1\u05e3 \u05e9\u05e9\u05dc\u05d5\u05e9\u05ea \u05d4\u05d7\u05d8\u05d5\u05e4\u05d9\u05dd \u05d0\u05d5\u05dc\u05d9 \u05e9\u05d4\u05d5 \u05d1\u05d5. \u05dc\u05d9\u05d1\u05e0\u05d5 \u05e2\u05dd \u05d4\u05de\u05e9\u05e4\u05d7\u05d5\u05ea \u05d1\u05e9\u05e2\u05ea\u05df \u05d4\u05e7\u05e9\u05d4 \u05de\u05e0\u05e9\u05d5\u05d0\"@N12chat",false,474,"\u05e0\u05d9\u05e8 \u05d3\u05d1\u05d5\u05e8\u05d9\u05e2\u05d5\u05d3 \u05e6\u05d9\u05d9\u05df: \"\u05d0\u05e0\u05d7\u05e0\u05d5 \u05d1\u05d5\u05d3\u05e7\u05d9\u05dd \u05de\u05d1\u05e0\u05d4 \u05e0\u05d5\u05e1\u05e3 \u05e9\u05e9\u05dc\u05d5\u05e9\u05ea \u05d4\u05d7\u05d8\u05d5\u05e4\u05d9\u05dd \u05d0\u0  \u05d4\u05d5\u05d0\u05e8\u05da \u05d5\u05d4\u05d5\u05d2\u05e9\u05d4 \u05e0\u05d2\u05d3\u05d5 \u05d4\u05e6\u05d4\u05e8\u05ea \u05ea\u05d5\u05d1\u05e2@N12chat",false,478,"\u05d0\u05d5\u05e8 \u05e8\u05d1\u05d9\u05d3\u05ea\u05d5\u05e9\u05d1 \u05d8\u05d9\u05d9\u05d1\u05d4 \u05d1\u05df 33 \u05e0\u05e2\u05e6\u05e8 \u05d1\u05d7\u05e9\u05d3 \u05dc\u05e8\u05e6\u05d7 \u05e9\u05d0\u05d9\u05e8\u05e2 \u05dc\u05e4\u05e0\u05d9 \u05db\u05d7\u05d5\u05d3\u05e9\u05d9\u05d9\u05dd \u05d1\u05ea\u05d7\u05e0\u05ea \u05d3\u05dc\u05e7 \u05d1\u05d8\u05d9\u05d9\u05d1\u05d4. \u05d1\u05ea\u05d5\u05dd \u05d7\u05e7\u05d9\u05e8\u05ea\u05d5 \u05de\u05e2\u05e6\u05e8\u05d5 \u05d4\u05d5\u05d0\u05e8\u05da \u05d5\u05d4\u05d5\u05d2\u05e9\u05d4 \u05e0\u05d2\u05d3\u05d5 \u05d4\u05e6\u05d4\u05e8\u05ea \u05ea\u05d5\u05d1\u05e2@N12chat"],["\u05de\u05d1\u05d6\u05e7\u05df 12\u05d4\u05d5\u05d3\u05e2\u05ea \u05e8\u05db\u05d1\u05ea \u05d9\u05e9\u05e8\u05d0\u05dc: \u05d1\u05e9\u05dc \u05e4\u05d2\u05d9\u05e2\u05d4 \u05d1\u05d1\u05e2\u05dc \u05d7\u05d9\u05d9\u05dd \u05d4\u05d5\u05e4\u05e1\u05e7\u05d4 \u05d6\u05de\u05e0\u05d9\u05ea \u05ea\u05e0\u05d5\u05e2\u05ea \u05d4\u05e8\u05db\u05d1\u05d5\u05ea \u05d1\u05d9\u05df \u05ea\u05d7\u05e0\u05d5\u05ea \u05d1\u05e0\u05d9\u05de\u05d9\u05e0\u05d4 \u05d5\u05d7\u05d3\u05e8\u05d4 \u05de\u05e2\u05e8\u05d1@N12chat",false,479,"\u05de\u05d1\u05d6\u05e7\u05df 12\u05d4\u05d5\u05d3\u05e2\u05ea \u05e8\u05db\u05d1\u05ea \u05d9\u05e9\u05e8\u05d0\u05dc: \u05d1\u05e9\u05dc \u05e4\u05d2\u05d9\u05e2\u05d4 \u05d1\u05d1\u05e2\u05dc \u05d7\u05d9\u05d9\u05dd \u05d4\u05d5\u05e4\u05e1\u05e7\u05d4 \u05d6\u05de\u05e0\u05d9\u05ea \u05ea\u05e0\u05d5\u05e2\u05ea \u05d4\u05e8\u05db\u05d1\u05d5\u05ea \u05d1\u05d9\u05df \u05ea\u05d7\u05e0\u05d5\u05ea \u05d1\u05e0\u05d9\u05de\u05d9\u05e0\u05d4 \u05d5\u05d7\u05d3\u05e8\u05d4 \u05de\u05e2\u05e8\u05d1@N12chat"],["\u05de\u05d1\u05d6\u05e7\u05df 12\u05d1\u05de\u05d3\"\u05d0 \u05e4\u05d5\u05e0\u05d9\u05dd \u05dc\u05e6\u05d9\u05d1\u05d5\u05e8 \u05d1\u05d1\u05e7\u05e9\u05d4 \u05dc\u05d4\u05d2\u05d9\u05e2 \u05de\u05d7\u05e8 \u05d5\u05d1\u05de\u05d4\u05dc\u05da \u05d4\u05e9\u05d1\u05d5\u05e2 \u05d4\u05d1\u05d0 \u05dc\u05e0\u05e7\u05d5\u05d3\u05d5\u05ea \u05d4\u05d4\u05ea\u05e8\u05de\u05d4 \u05e9\u05dc \u05de\u05d3\"\u05d0, \u05d4\u05de\u05e6\u05d5\u05d9\u05e0\u05d5\u05ea \u05d1\u05d0\u05ea\u05e8 \u05d4\u05d0\u05e8\u05d2\u05d5\u05df, \u05d5\u05dc\u05ea\u05e8\u05d5\u05dd \u05d3\u05dd@N12chat",false,480,"\u05de\u05d1\u05d6\u05e7\u05df 12\u05d1\u05de\u05d3\"\u05d0 \u05e4\u05d5\u05e0\u05d9\u05dd \u05dc\u05e6\u05d9\u05d1\u05d5\u05e8 \u05d1\u05d1\u05e7\u05e9\u05d4 \u05dc\u05d4\u05d2\u05d9\u05e2 \u05de\u05d7\u05e8 \u05d5\u05d1\u05de\u05d4\u05dc\u05da \u05d4\u05e9\u05d1\u05d5\u05e2 \u05d4\u05d1\u05d0 \u05dc\u05e0\u05e7\u05d5\u05d3\u05d5\u05ea \u05d4\u05d4\u05ea\u05e8\u05de\u05d4 \u05e9\u05dc \u05de\u05d3\"\u05d0, \u05d4\u05de\u05e6\u05d5\u05d9\u05e0\u05d5\u05ea \u05d1\u05d0\u05ea\u05e8 \u05d4\u05d0\u05e8\u05d2\u05d5\u05df, \u05d5\u05dc\u05ea\u05e8\u05d5\u05dd \u05d3\u05dd@N12chat"],["\u05d7\u05d9\u05e1\u05d5\u05dc \u05d4\u05de\u05d7\u05d1\u05dc\u05d9\u05dd \u05d0\u05ea\u05de\u05d5\u05dc \u05d1\u05d1\u05d9\u05ea \u05d4\u05d7\u05d5\u05dc\u05d9\u05dd \u05d1\u05d2'\u05e0\u05d9\u05df \u05e2\u05dc \u05d9\u05d3\u05d9 \u05db\u05d5\u05d7 \u05de\u05e1\u05ea\u05e2\u05e8\u05d1\u05d9\u05dd: \u05db\u05e0\u05d9\u05e1\u05d4 \u05d7\u05dc\u05e7\u05d4, \u05d9\u05e6\u05d9\u05d0\u05d4 \u05d7\u05dc\u05e7\u05d4.\u05db\u05db\u05d4 \u05e0\u05e8\u05d0\u05d9\u05dd \u05de\u05e7\u05e6\u05d5\u05e2\u05e0\u05d9\u05dd \u05d1\u05dc\u05d9\u05d2\u05d4 \u05d0\u05d7\u05e8\u05ea.\u05d7\u05d5\u05de\u05e8 \u05dc\u05e1\u05e8\u05d8 \u05e7\u05d5\u05dc\u05e0\u05d5\u05e2.User sent a document",false,481,"\u05d7\u05d9\u05e1\u05d5\u05dc \u05d4\u05de\u05d7\u05d1\u05dc\u05d9\u05dd \u05d0\u05ea\u05de\u05d5\u05dc \u05d1\u05d1\u05d9\u05ea \u05d4\u05d7\u05d5\u05dc\u05d9\u05dd \u05d1\u05d2'\u05e0\u05d9\u05df \u05e2\u05dc \u05d9\u05d3\u05d9 \u05db\u05d5\u05d7 \u05de\u05e1\u05ea\u05e2\u05e8\u05d1\u05d9\u05dd: \u05db\u05e0\u05d9\u05e1\u05d4 \u05d7\u05dc\u05e7\u05d4, \u05d9\u05e6\u05d9\u05d0\u05d4 \u05d7\u05dc\u05e7\u05d4.\u05db\u05db\u05d4 \u05e0\u05e8\u05d0\u05d9\u05dd \u05de\u05e7\u05e6\u05d5\u05e2\u05e0\u05d9\u05dd \u05d1\u05dc\u05d9\u05d2\u05d4 \u05d0\u05d7\u05e8\u05ea.\u05d7\u05d5\u05de\u05e8 \u05dc\u05e1\u05e8\u05d8 \u05e7\u05d5\u05dc\u05e0\u05d5\u05e2.User sent a document"],["\u05d3\u05e4\u05e0\u05d4 \u05dc\u05d9\u05d0\u05dc\u05e8\u05d0\u05e9 \u05d4\u05d0\u05d5\u05e4\u05d5\u05d6\u05d9\u05e6\u05d9\u05d4 \u05dc\u05e4\u05d9\u05d3 \u05d1\u05d5\u05d5\u05e2\u05d3\u05ea \u05d4\u05d7\u05d5\u05e5 \u05d5\u05d4\u05d1\u05d9\u05d8\u05d7\u05d5\u05df \u05e9\u05d3\u05e0\u05d4 \u05d1\u05ea\u05e7\u05e0\u05d5\u05ea \u05d4\u05d0\u05e8\u05db\u05ea \u05e9\u05d9\u05e8\u05d5\u05ea \u05de\u05d9\u05dc\u05d5\u05d0\u05d9\u05dd: \"63 \u05d0\u05dc\u05e3 \u05e6\u05e2\u05d9\u05e8\u05d9\u05dd \u05d7\u05e8\u05d3\u05d9\u05dd \u05e0\u05de\u05e6\u05d0\u05d9\u05dd \u05d4\u05d9\u05d5\u05dd \u05d1\u05d2\u05d9\u05dc \u05d4\u05e9\u05d9\u05e8\u05d5\u05ea. \u05d0\u05dd \u05e2\u05e9\u05e8\u05ea \u05d0\u05dc\u05e4\u05d9\u05dd \u05de\u05d4\u05dd \u05d9\u05ea\u05d2\u05d9\u05d9\u05e1\u05d5, \u05dc\u05d0 \u05e6\u05e8\u05d9\u05da \u05d9\u05d4\u05d9\u05d4 \u05dc\u05d4\u05d0\u05e8\u05d9\u05da \u05d0\u05ea \u05d4\u05e9\u05d9\u05e8\u05d5\u05ea \u05d4\u05e1\u05d3\u05d9\u05e8. \u05d0\u05e0\u05d9 \u05e7\u05d5\u05e8\u05d0 \u05dc\u05d5\u05d5\u05e2\u05d3\u05d4 \u05dc\u05d4\u05ea\u05e0\u05d2\u05d3 \u05dc\u05d4\u05e6\u05e2\u05d4. \u05d0\u05d9\u05df \u05d3\u05d1\u05e8 \u05db\u05d6\u05d4 \u05d0\u05d7\u05d3\u05d5\u05ea \u05d0\u05dd \u05db\u05dc \u05d4\u05e2\u05d5\u05de\u05e1, \u05d4\u05de\u05d1\u05e6\u05e2\u05d9 \u05d5\u05d4\u05db\u05dc\u05db\u05dc\u05d9, \u05e0\u05d5\u05e4\u05dc \u05e8\u05e7 \u05e2\u05dc \u05e7\u05d1\u05d5\u05e6\u05d4 \u05d0\u05d7\u05ea \u05d1\u05d7\u05d1\u05e8\u05d4 \u05d4\u05d9\u05e9\u05e8\u05d0\u05dc\u05d9\u05ea\"@N12chat",false,482,"\u05d3\u05e4\u05e0\u05d4 \u05dc\u05d9\u05d0\u05dc\u05e8\u05d0\u05e9 \u05d4\u05d0\u05d5\u05e4\u05d5\u05d6\u05d9\u05e6\u05d9\u05d4 \u05dc\u05e4\u05d9\u05d3 \u05d1\u05d5\u05d5\u05e2\u05d3\u05ea \u05d4\u05d7\u05d5\u05e5 \u05d5\u05d4\u05d1\u05d9\u05d8\u05d7\u05d5\u05df \u05e9\u05d3\u05e0\u05d4 \u05d1\u05ea\u05e7\u05e0\u05d5\u05ea \u05d4\u05d0\u05e8\u05db\u05ea \u05e9\u05d9\u05e8\u05d5\u05ea \u05de\u05d9\u05dc\u05d5\u05d0\u05d9\u05dd: \"63 \u05d0\u05dc\u05e3 \u05e6\u05e2\u05d9\u05e8\u05d9\u05dd \u05d7\u05e8\u05d3\u05d9\u05dd \u05e0\u05de\u05e6\u05d0\u05d9\u05dd \u05d4\u05d9\u05d5\u05dd \u05d1\u05d2\u05d9\u05dc \u05d4\u05e9\u05d9\u05e8\u05d5\u05ea. \u05d0\u05dd \u05e2\u05e9\u05e8\u05ea \u05d0\u05dc\u05e4\u05d9\u05dd \u05de\u05d4\u05dd \u05d9\u05ea\u05d2\u05d9\u05d9\u05e1\u05d5, \u05dc\u05d0 \u05e6\u05e8\u05d9\u05da \u05d9\u05d4\u05d9\u05d4 \u05dc\u05d4\u05d0\u05e8\u05d9\u05da \u05d0\u05ea \u05d4\u05e9\u05d9\u05e8\u05d5\u05ea \u05d4\u05e1\u05d3\u05d9\u05e8. \u05d0\u05e0\u05d9 \u05e7\u05d5\u05e8\u05d0 \u05dc\u05d5\u05d5\u05e2\u05d3\u05d4 \u05dc\u05d4\u05ea\u05e0\u05d2\u05d3 \u05dc\u05d4\u05e6\u05e2\u05d4. \u05d0\u05d9\u05df \u05d3\u05d1\u05e8 \u05db\u05d6\u05d4 \u05d0\u05d7\u05d3\u05d5\u05ea \u05d0\u05dd \u05db\u05dc \u05d4\u05e2\u05d5\u05de\u05e1, \u05d4\u05de\u05d1\u05e6\u05e2\u05d9 \u05d5\u05d4\u05db\u05dc\u05db\u05dc\u05d9, \u05e0\u05d5\u05e4\u05dc \u05e8\u05e7 \u05e2\u05dc \u05e7\u05d1\u05d5\u05e6\u05d4 \u05d0\u05d7\u05ea \u05d1\u05d7\u05d1\u05e8\u05d4 \u05d4\u05d9\u05e9\u05e8\u05d0\u05dc\u05d9\u05ea\"@N12chat"],["\u05d6\u05d4 \u05d4\u05d9\u05d4 \u05d0\u05d7\u05d3 \u05d4\u05e1\u05e8\u05d8\u05d5\u05e0\u05d9\u05dd \u05d4\u05e4\u05d5\u05e4\u05d5\u05dc\u05e8\u05d9\u05dd \u05d0\u05ea\u05de\u05d5\u05dc \u05d1\u05e2\u05e8\u05d5\u05e6\u05d9\u05dd \u05d4\u05dc\u05d1\u05e0\u05d5\u05e0\u05d9\u05dd:\u05e7\u05e9\u05d9\u05e9 \u05e9\"\u05db\u05dc\u05dc \u05d0\u05d9\u05e0\u05d5 \u05de\u05ea\u05e8\u05d2\u05e9\" \u05de\u05e2\u05d5\u05e6\u05de\u05ea \u05d0\u05d7\u05ea \u05d4\u05ea\u05e7\u05d9\u05e4\u05d5\u05ea \u05e9\u05dc \u05e6\u05d4\"\u05dc \u05d1\u05d1\u05d9\u05d9\u05e8\u05d5\u05ea.\u05d4\u05d5\u05d0 \u05d6\u05db\u05d4 \u05dc\u05ea\u05e9\u05d1\u05d5\u05d7\u05d5\u05ea \u05e8\u05d1\u05d5\u05ea - \u05d4\u05ea\u05e7\u05d9\u05e4\u05d5\u05ea \u05d4\u05d9\u05e9\u05e8\u05d0\u05dc\u05d9\u05d5\u05ea \u05dc\u05d0 \u05de\u05d6\u05d9\u05d6\u05d5\u05ea \u05dc\u05d5.\u05d4\u05de\u05e9\u05da\ud83d\udc47\ud83d\udc47\ud83d\udc47\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,483,"\u05d6\u05d4 \u05d4\u05d9\u05d4 \u05d0\u05d7\u05d3 \u05d4\u05e1\u05e8\u05d8\u05d5\u05e0\u05d9\u05dd \u05d4\u05e4\u05d5\u05e4\u05d5\u05dc\u05e8\u05d9\u05dd \u05d0\u05ea\u05de\u05d5\u05dc \u05d1\u05e2\u05e8\u05d5\u05e6\u05d9\u05dd \u05d4\u05dc\u05d1\u05e0\u05d5\u05e0\u05d9\u05dd:\u05e7\u05e9\u05d9\u05e9 \u05e9\"\u05db\u05dc\u05dc \u05d0\u05d9\u05e0\u05d5 \u05de\u05ea\u05e8\u05d2\u05e9\" \u05de\u05e2\u05d5\u05e6\u05de\u05ea \u05d0\u05d7\u05ea \u05d4\u05ea\u05e7\u05d9\u05e4\u05d5\u05ea \u05e9\u05dc \u05e6\u05d4\"\u05dc \u05d1\u05d1\u05d9\u05d9\u05e8\u05d5\u05ea.\u05d4\u05d5\u05d0 \u05d6\u05db\u05d4 \u05dc\u05ea\u05e9\u05d1\u05d5\u05d7\u05d5\u05ea \u05e8\u05d1\u05d5\u05ea - \u05d4\u05ea\u05e7\u05d9\u05e4\u05d5\u05ea \u05d4\u05d9\u05e9\u05e8\u05d0\u05dc\u05d9\u05d5\u05ea \u05dc\u05d0 \u05de\u05d6\u05d9\u05d6\u05d5\u05ea \u05dc\u05d5.\u05d4\u05de\u05e9\u05da\ud83d\udc47\ud83d\udc47\ud83d\udc47\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05ea\u05e4\u05d9\u05dc\u05ea \u05d9\u05d5\u05dd \u05d4\u05e9\u05d9\u05e9\u05d9 \u05d1\u05d4\u05e8 \u05d4\u05d1\u05d9\u05ea-\u05d4\u05d0\u05d6\u05d5\u05e8 \u05de\u05d0\u05d5\u05d5\u05e8\u05e8 \u05dc\u05de\u05d3\u05d9.\u05e2\"\u05e4 \u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd \u05d4\u05e9\u05ea\u05ea\u05e4\u05d5 \u05d1\u05ea\u05e4\u05d9\u05dc\u05d4 \u05d4\u05d9\u05d5\u05dd  \u05db\u05d7\u05de\u05e9\u05ea \u05d0\u05dc\u05e4\u05d9\u05dd \u05d0\u05d9\u05e9 - \u05de\u05e2\u05dc \u05d2\u05d9\u05dc 60.\u05dc\u05e9\u05dd \u05d4\u05e9\u05d5\u05d5\u05d0\u05d4 \u05d1\u05d9\u05de\u05d9 \u05e9\u05d9\u05e9\u05d9 \u05e9\u05dc \u05d7\u05d5\u05d3\u05e9 \u05d4\u05e8\u05de\u05d3\u05d0\u05df \u05de\u05e9\u05ea\u05ea\u05e4\u05d9\u05dd \u05db 250 \u05d0\u05dc\u05e3 \u05d0\u05d9\u05e9 \u05d1\u05ea\u05e4\u05d9\u05dc\u05d4 \u05d6\u05d5, \u05e2\"\u05e4 \u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd \u05d5\u05d1\u05d9\u05de\u05d9 \u05e9\u05d9\u05e9\u05d9 \u05e8\u05d2\u05d9\u05dc\u05d9\u05dd \u05de\u05d2\u05d9\u05e2\u05d9\u05dd \u05e2\u05e9\u05e8\u05d5\u05ea \u05d0\u05dc\u05e4\u05d9\u05dd.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,484,"\u05ea\u05e4\u05d9\u05dc\u05ea \u05d9\u05d5\u05dd \u05d4\u05e9\u05d9\u05e9\u05d9 \u05d1\u05d4\u05e8 \u05d4\u05d1\u05d9\u05ea-\u05d4\u05d0\u05d6\u05d5\u05e8 \u05de\u05d0\u05d5\u05d5\u05e8\u05e8 \u05dc\u05de\u05d3\u05d9.\u05e2\"\u05e4 \u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd \u05d4\u05e9\u05ea\u05ea\u05e4\u05d5 \u05d1\u05ea\u05e4\u05d9\u05dc\u05d4 \u05d4\u05d9\u05d5\u05dd  \u05db\u05d7\u05de\u05e9\u05ea \u05d0\u05dc\u05e4\u05d9\u05dd \u05d0\u05d9\u05e9 - \u05de\u05e2\u05dc \u05d2\u05d9\u05dc 60.\u05dc\u05e9\u05dd \u05d4\u05e9\u05d5\u05d5\u05d0\u05d4 \u05d1\u05d9\u05de\u05d9 \u05e9\u05d9\u05e9\u05d9 \u05e9\u05dc \u05d7\u05d5\u05d3\u05e9 \u05d4\u05e8\u05de\u05d3\u05d0\u05df \u05de\u05e9\u05ea\u05ea\u05e4\u05d9\u05dd \u05db 250 \u05d0\u05dc\u05e3 \u05d0\u05d9\u05e9 \u05d1\u05ea\u05e4\u05d9\u05dc\u05d4 \u05d6\u05d5, \u05e2\"\u05e4 \u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd \u05d5\u05d1\u05d9\u05de\u05d9 \u05e9\u05d9\u05e9\u05d9 \u05e8\u05d2\u05d9\u05dc\u05d9\u05dd \u05de\u05d2\u05d9\u05e2\u05d9\u05dd \u05e2\u05e9\u05e8\u05d5\u05ea \u05d0\u05dc\u05e4\u05d9\u05dd.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05d0\u05d7\u05e8\u05d9 \u05e0\u05d0\u05d5\u05de\u05d5 \u05e9\u05dc \u05d3\u05d5\u05d1\u05e8 \u05d4\u05d6\u05e8\u05d5\u05e2 \u05d4\u05e6\u05d1\u05d0\u05d9\u05ea \u05e9\u05dc \u05d7\u05de\u05d0\u05e1 \u05d4\u05e2\u05e8\u05d1, \u05e0\u05e8\u05e9\u05de\u05d4 \u05d4\u05ea\u05dc\u05d4\u05d1\u05d5\u05ea \u05d1\u05e8\u05e9\u05ea\u05d5\u05ea \u05d4\u05d7\u05d1\u05e8\u05ea\u05d9\u05d5\u05ea \u05d1\u05e7\u05e8\u05d1 \u05d4\u05e2\u05d6\u05ea\u05d9\u05d9\u05dd, \u05d5\u05d1\u05de\u05d9\u05d5\u05d7\u05d3 \u05d1\u05e7\u05e8\u05d1 \u05d0\u05dc\u05d4 \u05ea\u05d5\u05de\u05db\u05d9 \u05d7\u05de\u05d0\u05e1.\u05e2\u05d9\u05ea\u05d5\u05e0\u05d0\u05d9 \u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9 \u05d2\u05d5\u05dc\u05d4 \u05db\u05ea\u05d1 \u05dc\u05e2\u05d6\u05ea\u05d9\u05d9\u05dd \u05ea\u05d5\u05de\u05db\u05d9 \u05d7\u05de\u05d0\u05e1 \u05d1\u05e4\u05d9\u05d9\u05e1\u05d1\u05d5\u05e7:\u05d6\u05d4\u05d5? \u05d0\u05ea\u05d4 \u05de\u05e8\u05d5\u05e6\u05d4 \u05d0\u05d7\u05e8\u05d9 \u05d4\u05d3\u05d1\u05e8\u05d9\u05dd \u05e9\u05dc \u05d0\u05d1\u05d5 \u05e2\u05d1\u05d9\u05d3\u05d4?\u05e2\u05db\u05e9\u05d9\u05d5 \u05dc\u05da \u05ea\u05e2\u05de\u05d5\u05d3 \u05d1\u05ea\u05d5\u05e8 \u05d4\u05d0\u05e8\u05d5\u05da \u05dc\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9\u05dd... \u05d0\u05d5 \u05e9\u05ea\u05de\u05e6\u05d0 \u05dc\u05da \u05d0\u05d9\u05d6\u05d4 \u05e7\u05d9\u05e8 \u05dc\u05d7..\u05d1\u05df \u05dc\u05d9\u05d3\u05d5...\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,485,"\u05d0\u05d7\u05e8\u05d9 \u05e0\u05d0\u05d5\u05de\u05d5 \u05e9\u05dc \u05d3\u05d5\u05d1\u05e8 \u05d4\u05d6\u05e8\u05d5\u05e2 \u05d4\u05e6\u05d1\u05d0\u05d9\u05ea \u05e9\u05dc \u05d7\u05de\u05d0\u05e1 \u05d4\u05e2\u05e8\u05d1, \u05e0\u05e8\u05e9\u05de\u05d4 \u05d4\u05ea\u05dc\u05d4\u05d1\u05d5\u05ea \u05d1\u05e8\u05e9\u05ea\u05d5\u05ea \u05d4\u05d7\u05d1\u05e8\u05ea\u05d9\u05d5\u05ea \u05d1\u05e7\u05e8\u05d1 \u05d4\u05e2\u05d6\u05ea\u05d9\u05d9\u05dd, \u05d5\u05d1\u05de\u05d9\u05d5\u05d7\u05d3 \u05d1\u05e7\u05e8\u05d1 \u05d0\u05dc\u05d4 \u05ea\u05d5\u05de\u05db\u05d9 \u05d7\u05de\u05d0\u05e1.\u05e2\u05d9\u05ea\u05d5\u05e0\u05d0\u05d9 \u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9 \u05d2\u05d5\u05dc\u05d4 \u05db\u05ea\u05d1 \u05dc\u05e2\u05d6\u05ea\u05d9\u05d9\u05dd \u05ea\u05d5\u05de\u05db\u05d9 \u05d7\u05de\u05d0\u05e1 \u05d1\u05e4\u05d9\u05d9\u05e1\u05d1\u05d5\u05e7:\u05d6\u05d4\u05d5? \u05d0\u05ea\u05d4 \u05de\u05e8\u05d5\u05e6\u05d4 \u05d0\u05d7\u05e8\u05d9 \u05d4\u05d3\u05d1\u05e8\u05d9\u05dd \u05e9\u05dc \u05d0\u05d1\u05d5 \u05e2\u05d1\u05d9\u05d3\u05d4?\u05e2\u05db\u05e9\u05d9\u05d5 \u05dc\u05da \u05ea\u05e2\u05de\u05d5\u05d3 \u05d1\u05ea\u05d5\u05e8 \u05d4\u05d0\u05e8\u05d5\u05da \u05dc\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9\u05dd... \u05d0\u05d5 \u05e9\u05ea\u05de\u05e6\u05d0 \u05dc\u05da \u05d0\u05d9\u05d6\u05d4 \u05e7\u05d9\u05e8 \u05dc\u05d7..\u05d1\u05df \u05dc\u05d9\u05d3\u05d5...\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05d3\u05e1\u05e7 \u05d4\u05d7\u05d5\u05e5\u05e9\u05e8 \u05d4\u05e4\u05e0\u05d9\u05dd \u05d4\u05e6\u05e8\u05e4\u05ea\u05d9 \u05d4\u05d5\u05e1\u05d9\u05e3 \u05e4\u05e8\u05d8\u05d9\u05dd \u05e2\u05dc \u05d0\u05d9\u05e8\u05d5\u05e2 \u05d4\u05d3\u05e7\u05d9\u05e8\u05d4 \u05d1\u05e4\u05e8\u05d9\u05d6: \u05d4\u05d7\u05e9\u05d5\u05d3 \u05d1\u05ea\u05e7\u05d9\u05e4\u05d4 \u05d4\u05d9\u05d4 \u05d1\u05e8\u05e9\u05d9\u05de\u05ea \u05d4\u05de\u05e2\u05e7\u05d1 \u05e9\u05dc \u05e9\u05d9\u05e8\u05d5\u05ea\u05d9 \u05d4\u05d1\u05d9\u05d8\u05d7\u05d5\u05df \u05d4\u05e6\u05e8\u05e4\u05ea\u05d9\u05d9\u05dd; \u05e2\u05d5\u05d3 \u05d4\u05d9\u05d4 \u05d9\u05d3\u05d5\u05e2 \u05db\u05d9 \u05e1\u05d1\u05dc \u05de\u05d4\u05e4\u05e8\u05e2\u05d5\u05ea \u05e0\u05e4\u05e9\u05d9\u05d5\u05ea. \u05d1\u05ea\u05e7\u05d9\u05e4\u05ea\u05d5 \u05d4\u05ea\u05de\u05e7\u05d3 \u05d1\u05ea\u05d9\u05d9\u05e8\u05d9\u05dd - \u05d4\u05d5\u05d0 \u05d4\u05e8\u05d2 \u05d0\u05d3\u05dd \u05d1\u05e2\u05dc \u05d0\u05d6\u05e8\u05d7\u05d5\u05ea \u05d2\u05e8\u05de\u05e0\u05d9\u05ea \u05d5\u05e4\u05e6\u05e2 \u05e9\u05e0\u05d9\u05d9\u05dd \u05d0\u05d7\u05e8\u05d9\u05dd@N12chat",false,486,"\u05d3\u05e1\u05e7 \u05d4\u05d7\u05d5\u05e5\u05e9\u05e8 \u05d4\u05e4\u05e0\u05d9\u05dd \u05d4\u05e6\u05e8\u05e4\u05ea\u05d9 \u05d4\u05d5\u05e1\u05d9\u05e3 \u05e4\u05e8\u05d8\u05d9\u05dd \u05e2\u05dc \u05d0\u05d9\u05e8\u05d5\u05e2 \u05d4\u05d3\u05e7\u05d9\u05e8\u05d4 \u05d1\u05e4\u05e8\u05d9\u05d6: \u05d4\u05d7\u05e9\u05d5\u05d3 \u05d1\u05ea\u05e7\u05d9\u05e4\u05d4 \u05d4\u05d9\u05d4 \u05d1\u05e8\u05e9\u05d9\u05de\u05ea \u05d4\u05de\u05e2\u05e7\u05d1 \u05e9\u05dc \u05e9\u05d9\u05e8\u05d5\u05ea\u05d9 \u05d4\u05d1\u05d9\u05d8\u05d7\u05d5\u05df \u05d4\u05e6\u05e8\u05e4\u05ea\u05d9\u05d9\u05dd; \u05e2\u05d5\u05d3 \u05d4\u05d9\u05d4 \u05d9\u05d3\u05d5\u05e2 \u05db\u05d9 \u05e1\u05d1\u05dc \u05de\u05d4\u05e4\u05e8\u05e2\u05d5\u05ea \u05e0\u05e4\u05e9\u05d9\u05d5\u05ea. \u05d1\u05ea\u05e7\u05d9\u05e4\u05ea\u05d5 \u05d4\u05ea\u05de\u05e7\u05d3 \u05d1\u05ea\u05d9\u05d9\u05e8\u05d9\u05dd - \u05d4\u05d5\u05d0 \u05d4\u05e8\u05d2 \u05d0\u05d3\u05dd \u05d1\u05e2\u05dc \u05d0\u05d6\u05e8\u05d7\u05d5\u05ea \u05d2\u05e8\u05de\u05e0\u05d9\u05ea \u05d5\u05e4\u05e6\u05e2 \u05e9\u05e0\u05d9\u05d9\u05dd \u05d0\u05d7\u05e8\u05d9\u05dd@N12chat"],["\u05d0\u05d5\u05e8 \u05e8\u05d1\u05d9\u05d3\u05ea\u05d5\u05e9\u05d1 \u05dc\u05db\u05d9\u05e9, \u05d1\u05e9\u05e0\u05d5\u05ea \u05d4-20 \u05dc\u05d7\u05d9\u05d9\u05d5, \u05e0\u05e2\u05e6\u05e8 \u05d1\u05d7\u05e9\u05d3 \u05dc\u05d1\u05d9\u05e6\u05d5\u05e2 \u05e2\u05d1\u05d9\u05e8\u05d5\u05ea \u05de\u05d9\u05df \u05d1\u05d0\u05d9\u05d5\u05de\u05d9 \u05d0\u05e7\u05d3\u05d7 \u05d1\u05ea\u05d5\u05e9\u05d1\u05ea \u05e8\u05d7\u05d5\u05d1\u05d5\u05ea \u05d1\u05de\u05d4\u05dc\u05da \u05de\u05e4\u05d2\u05e9 \u05e8\u05d0\u05e9\u05d5\u05df \u05d1\u05d9\u05e0\u05d4\u05dd. \u05d1\u05db\u05d5\u05d5\u05e0\u05ea \u05d4\u05de\u05e9\u05d8\u05e8\u05d4 \u05dc\u05d4\u05d1\u05d9\u05d0\u05d5 \u05d4\u05d9\u05d5\u05dd \u05dc\u05d3\u05d9\u05d5\u05df \u05d1\u05d1\u05d9\u05ea \u05d4\u05de\u05e9\u05e4\u05d8, \u05d1\u05d1\u05e7\u05e9\u05d4 \u05dc\u05d4\u05d0\u05e8\u05d9\u05da \u05d0\u05ea \u05de\u05e2\u05e6\u05e8\u05d5 \u05d1\u05d4\u05ea\u05d0\u05dd \u05dc\u05e6\u05d5\u05e8\u05db\u05d9 \u05d4\u05d7\u05e7\u05d9\u05e8\u05d4@N12chat",false,487,"\u05d0\u05d5\u05e8 \u05e8\u05d1\u05d9\u05d3\u05ea\u05d5\u05e9\u05d1 \u05dc\u05db\u05d9\u05e9, \u05d1\u05e9\u05e0\u05d5\u05ea \u05d4-20 \u05dc\u05d7\u05d9\u05d9\u05d5, \u05e0\u05e2\u05e6\u05e8 \u05d1\u05d7\u05e9\u05d3 \u05dc\u05d1\u05d9\u05e6\u05d5\u05e2 \u05e2\u05d1\u05d9\u05e8\u05d5\u05ea \u05de\u05d9\u05df \u05d1\u05d0\u05d9\u05d5\u05de\u05d9 \u05d0\u05e7\u05d3\u05d7 \u05d1\u05ea\u05d5\u05e9\u05d1\u05ea \u05e8\u05d7\u05d5\u05d1\u05d5\u05ea \u05d1\u05de\u05d4\u05dc\u05da \u05de\u05e4\u05d2\u05e9 \u05e8\u05d0\u05e9\u05d5\u05df \u05d1\u05d9\u05e0\u05d4\u05dd. \u05d1\u05db\u05d5\u05d5\u05e0\u05ea \u05d4\u05de\u05e9\u05d8\u05e8\u05d4 \u05dc\u05d4\u05d1\u05d9\u05d0\u05d5 \u05d4\u05d9\u05d5\u05dd \u05dc\u05d3\u05d9\u05d5\u05df \u05d1\u05d1\u05d9\u05ea \u05d4\u05de\u05e9\u05e4\u05d8, \u05d1\u05d1\u05e7\u05e9\u05d4 \u05dc\u05d4\u05d0\u05e8\u05d9\u05da \u05d0\u05ea \u05de\u05e2\u05e6\u05e8\u05d5 \u05d1\u05d4\u05ea\u05d0\u05dd \u05dc\u05e6\u05d5\u05e8\u05db\u05d9 \u05d4\u05d7\u05e7\u05d9\u05e8\u05d4@N12chat"],["\u05e0\u05d9\u05e8 \u05d3\u05d1\u05d5\u05e8\u05d9\u05d4\u05e4\u05e2\u05d9\u05dc\u05d5\u05ea \u05e0\u05d2\u05d3 \u05d8\u05e8\u05d5\u05e8 \u05d1\u05d9\u05d5\"\u05e9: \u05db\u05d5\u05d7\u05d5\u05ea \u05e6\u05d4\"\u05dc \u05d7\u05d9\u05e1\u05dc\u05d5 \u05d0\u05ea \u05d4\u05de\u05d7\u05d1\u05dc \u05e9\u05d9\u05e8\u05d4 \u05dc\u05e2\u05d1\u05e8 \u05e2\u05de\u05d3\u05d4 \u05e6\u05d1\u05d0\u05d9\u05ea \u05e1\u05de\u05d5\u05da \u05dc\u05d7\u05d5\u05e8\u05e1\u05d4 \u05e9\u05d1\u05d7\u05d8\u05d9\u05d1\u05ea \u05d9\u05d4\u05d5\u05d3\u05d4 \u05e9\u05dc\u05e9\u05d5\u05dd. \u05d1\u05e2\u05ea \u05e0\u05d9\u05e1\u05d9\u05d5\u05df \u05de\u05e2\u05e6\u05e8\u05d5, \u05d4\u05de\u05d7\u05d1\u05dc \u05ea\u05e7\u05e3 \u05d0\u05ea \u05d4\u05db\u05d5\u05d7 \u05d1\u05e1\u05db\u05d9\u05df, \u05d4\u05db\u05d5\u05d7\u05d5\u05ea \u05d9\u05e8\u05d5 \u05dc\u05e2\u05d1\u05e8\u05d5 \u05d5\u05d7\u05d9\u05e1\u05dc\u05d5 \u05d0\u05d5\u05ea\u05d5. \u05d0\u05d7\u05d3 \u05de\u05d4\u05dc\u05d5\u05d7\u05de\u05d9\u05dd \u05e0\u05e4\u05e6\u05e2 \u05d1\u05d9\u05e0\u05d5\u05e0\u05d9 \u05d1\u05d9\u05d3\u05d5. \u05db\u05de\u05d5 \u05db\u05df, 8 \u05de\u05d1\u05d5\u05e7\u05e9\u05d9\u05dd \u05e0\u05e2\u05e6\u05e8\u05d5 \u05d4\u05dc\u05d9\u05dc\u05d4 \u05d1\u05e8\u05d7\u05d1\u05d9 \u05d9\u05d5\"\u05e9 \u05e2\u05dc \u05d9\u05d3\u05d9 \u05db\u05d5\u05d7\u05d5\u05ea \u05e6\u05d4\"\u05dc@N12chat",false,488,"\u05e0\u05d9\u05e8 \u05d3\u05d1\u05d5\u05e8\u05d9\u05d4\u05e4\u05e2\u05d9\u05dc\u05d5\u05ea \u05e0\u05d2\u05d3 \u05d8\u05e8\u05d5\u05e8 \u05d1\u05d9\u05d5\"\u05e9: \u05db\u05d5\u05d7\u05d5\u05ea \u05e6\u05d4\"\u05dc \u05d7\u05d9\u05e1\u05dc\u05d5 \u05d0\u05ea \u05d4\u05de\u05d7\u05d1\u05dc \u05e9\u05d9\u05e8\u05d4 \u05dc\u05e2\u05d1\u05e8 \u05e2\u05de\u05d3\u05d4 \u05e6\u05d1\u05d0\u05d9\u05ea \u05e1\u05de\u05d5\u05da \u05dc\u05d7\u05d5\u05e8\u05e1\u05d4 \u05e9\u05d1\u05d7\u05d8\u05d9\u05d1\u05ea \u05d9\u05d4\u05d5\u05d3\u05d4 \u05e9\u05dc\u05e9\u05d5\u05dd. \u05d1\u05e2\u05ea \u05e0\u05d9\u05e1\u05d9\u05d5\u05df \u05de\u05e2\u05e6\u05e8\u05d5, \u05d4\u05de\u05d7\u05d1\u05dc \u05ea\u05e7\u05e3 \u05d0\u05ea \u05d4\u05db\u05d5\u05d7 \u05d1\u05e1\u05db\u05d9\u05df, \u05d4\u05db\u05d5\u05d7\u05d5\u05ea \u05d9\u05e8\u05d5 \u05dc\u05e2\u05d1\u05e8\u05d5 \u05d5\u05d7\u05d9\u05e1\u05dc\u05d5 \u05d0\u05d5\u05ea\u05d5. \u05d0\u05d7\u05d3 \u05de\u05d4\u05dc\u05d5\u05d7\u05de\u05d9\u05dd \u05e0\u05e4\u05e6\u05e2 \u05d1\u05d9\u05e0\u05d5\u05e0\u05d9 \u05d1\u05d9\u05d3\u05d5. \u05db\u05de\u05d5 \u05db\u05df, 8 \u05de\u05d1\u05d5\u05e7\u05e9\u05d9\u05dd \u05e0\u05e2\u05e6\u05e8\u05d5 \u05d4\u05dc\u05 5d5\u05e0\u05d8\u05d5\u05de\u05d0\u05e0\u05d9\u05d4\", \u05e0\u05de\u05e6\u05d0 \u05d0\u05e9\u05dd \u05d1\u05d9\u05d3\u05d9 \u05d7\u05d1\u05e8 \u05de\u05d5\u05e9\u05d1\u05e2\u05d9\u05dd \u05d1\u05e0\u05d9\u05d5 \u05d9\u05d5\u05e8\u05e7 \u05d1\u05ea\u05e7\u05d9\u05e4\u05d4 \u05d5\u05d1\u05d4\u05d8\u05e8\u05d3\u05d4 \u05e9\u05dc \u05d1\u05ea \u05d6\u05d5\u05d2\u05d5 \u05dc\u05e9\u05e2\u05d1\u05e8, \u05d2\u05e8\u05d9\u05d9\u05e1 \u05d2'\u05d1\u05d0\u05e8\u05d9. \u05d1\u05de\u05e8\u05e5 \u05d4\u05d0\u05d7\u05e8\u05d5\u05df \u05d4\u05e9\u05d7\u05e7\u05df \u05e0\u05e2\u05e6\u05e8 \u05dc\u05d0\u05d7\u05e8 \u05e9\u05d4\u05d9\u05d0 \u05e1\u05d1\u05dc\u05d4 \u05de\u05e4\u05d2\u05d9\u05e2\u05d5\u05ea \u05d1\u05e8\u05d0\u05e9\u05d4 \u05d5\u05d1\u05e6\u05d5\u05d5\u05d0\u05e8\u05d4 \u05d1\u05d3\u05d9\u05e8\u05ea\u05dd, \u05d0\u05d5\u05dc\u05dd \u05de\u05d9\u05d9\u05d2'\u05d5\u05e8\u05e1 \u05d4\u05db\u05d7\u05d9\u05e9 \u05d0\u05ea \u05d4\u05de\u05e2\u05e9\u05d9\u05dd \u05d4\u05de\u05d9\u05d5\u05d7\u05e1\u05d9\u05dd \u05dc\u05d5@N12chat"],["\u05e0\u05d9\u05e8 \u05d3\u05d1\u05d5\u05e8\u05d9\u05e9\u05e8 \u05d4\u05d1\u05d9\u05d8\u05d7\u05d5\u05df \u05d2\u05dc\u05e0\u05d8 \u05dc\u05de\u05e9\u05e4\u05d7\u05d5\u05ea \u05d4\u05d7\u05d9\u05d9\u05dc\u05d9\u05dd \u05d4\u05d7\u05d8\u05d5\u05e4\u05d9\u05dd: \"\u05d4\u05e4\u05e2\u05d5\u05dc\u05d4 \u05d4\u05e6\u05d1\u05d0\u05d9\u05ea \u05d1\u05e2\u05d6\u05d4 \u05dc\u05d0 \u05ea\u05e1\u05ea\u05d9\u05d9\u05dd \u05e2\u05d3 \u05dc\u05d4\u05e9\u05d1\u05ea \u05d4\u05d7\u05d8\u05d5\u05e4\u05d9\u05dd\". \u05e6\u05d9\u05dc\u05d5\u05dd: \u05d0\u05e8\u05d9\u05d0\u05dc \u05d7\u05e8\u05de\u05d5\u05e0\u05d9@N12chat",false,518,"\u05e0\u05d9\u05e8 \u05d3\u05d1\u05d5\u05e8\u05d9\u05e9\u05e8 \u05d4\u05d1\u05d9\u05d8\u05d7\u05d5\u05df \u05d2\u05dc\u05e0\u05d8 \u05dc\u05de\u05e9\u05e4\u05d7\u05d5\u05ea \u05d4\u05d7\u05d9\u05d9\u05dc\u05d9\u05dd \u05d4\u05d7\u05d8\u05d5\u05e4\u05d9\u05dd: \"\u05d4\u05e4\u05e2\u05d5\u05dc\u05d4 \u05d4\u05e6\u05d1\u05d0\u05d9\u05ea \u05d1\u05e2\u05d6\u05d4 \u05dc\u05d0 \u05ea\u05e1\u05ea\u05d9\u05d9\u05dd \u05e2\u05d3 \u05dc\u05d4\u05e9\u05d1\u05ea \u05d4\u05d7\u05d8\u05d5\u05e4\u05d9\u05dd\". \u05e6\u05d9\u05dc\u05d5\u05dd: \u05d0\u05e8\u05d9\u05d0\u05dc \u05d7\u05e8\u05de\u05d5\u05e0\u05d9@N12chat"],["\u05de\u05d1\u05d6\u05e7\u05df 12\u05d3\u05d9\u05d5\u05d5\u05d7 \u05d1\u05d5\u05d5\u05dc \u05e1\u05d8\u05e8\u05d9\u05d8 \u05d2'\u05d5\u05e8\u05e0\u05dc: \u05d0\u05e8\u05d4\"\u05d1 \u05de\u05ea\u05db\u05e0\u05e0\u05ea \u05dc\u05e9\u05dc\u05d5\u05d7 \u05e0\u05e9\u05e7 \u05dc\u05d9\u05e9\u05e8\u05d0\u05dc \u05ea\u05d5\u05da \u05d3\u05d7\u05d9\u05e4\u05d4 \u05e9\u05dc \u05d4\u05e0\u05e9\u05d9\u05d0 \u05d1\u05d9\u05d9\u05d3\u05df \u05dc\u05d4\u05e4\u05e1\u05e7\u05ea \u05d0\u05e9@N12chat",false,519,"\u05de\u05d1\u05d6\u05e7\u05df 12\u05d3\u05d9\u05d5\u05d5\u05d7 \u05d1\u05d5\u05d5\u05dc \u05e1\u05d8\u05e8\u05d9\u05d8 \u05d2'\u05d5\u05e8\u05e0\u05dc: \u05d0\u05e8\u05d4\"\u05d1 \u05de\u05ea\u05db\u05e0\u05e0\u05ea \u05dc\u05e9\u05dc\u05d5\u05d7 \u05e0\u05e9\u05e7 \u05dc\u05d9\u05e9\u05e8\u05d0\u05dc \u05ea\u05d5\u05da \u05d3\u05d7\u05d9\u05e4\u05d4 \u05e9\u05dc \u05d4\u05e0\u05e9\u05d9\u05d0 \u05d1\u05d9\u05d9\u05d3\u05df \u05dc\u05d4\u05e4\u05e1\u05e7\u05ea \u05d0\u05e9@N12chat"],["\u05d3\u05e4\u05e0\u05d4 \u05dc\u05d9\u05d0\u05dc\"\u05d0\u05dc\u05e6\u05d4\u05d9\u05d9\u05de\u05e8 - \u05de\u05d7\u05dc\u05d4 \u05e7\u05e9\u05d4 \u05e9\u05e4\u05d5\u05d2\u05e2\u05ea \u05d1\u05ea\u05e4\u05e7\u05d5\u05d3\": \u05d4\u05d1\u05df \u05e9\u05dc \u05d1\u05df \u05d2\u05d1\u05d9\u05e8 \u05d4\u05e9\u05ea\u05dc\u05d7 \u05d1\u05d1\u05d9\u05d9\u05d3\u05df - \u05d5\u05de\u05d7\u05e7@N12chat",false,520,"\u05d3\u05e4\u05e0\u05d4 \u05dc\u05d9\u05d0\u05dc\"\u05d0\u05dc\u05e6\u05d4\u05d9\u05d9\u05de\u05e8 - \u05de\u05d7\u05dc\u05d4 \u05e7\u05e9\u05d4 \u05e9\u05e4\u05d5\u05d2\u05e2\u05ea \u05d1\u05ea\u05e4\u05e7\u05d5\u05d3\": \u05d4\u05d1\u05df \u05e9\u05dc \u05d1\u05df \u05d2\u05d1\u05d9\u05e8 \u05d4\u05e9\u05ea\u05dc\u05d7 \u05d1\u05d1\u05d9\u05d9\u05d3\u05df - \u05d5\u05de\u05d7\u05e7@N12chat"],["\u05d2\u05d3\u05d5\u05d3\u05d9 \u05d0\u05dc\u05de\u05d2'\u05d0\u05d4\u05d3\u05d9\u05df \u05d5\u05d4\u05d6\u05e8\u05d5\u05e2 \u05d4\u05e6\u05d1\u05d0\u05d9\u05ea \u05e9\u05dc \u05d4\u05d2'\u05d4\u05d0\u05d3 \u05d4\u05d0\u05e1\u05dc\u05d0\u05de\u05d9 \u05d1\u05e2\u05d6\u05d4 \u05de\u05e4\u05e8\u05e1\u05de\u05d9\u05dd \u05e1\u05e8\u05d8\u05d5\u05df \u05d1\u05d5 \u05e0\u05e8\u05d0\u05d4 \u05db\u05d9\u05e6\u05d3 \u05e9\u05d9\u05d2\u05e8\u05d5 \u05d1\u05de\u05e9\u05d5\u05ea\u05e3, \u05dc\u05d8\u05e2\u05e0\u05ea\u05dd, 4 \u05e8\u05e7\u05d8\u05d5\u05ea \u05dc\u05e2\u05d1\u05e8 \u05db\u05d5\u05d7\u05d5\u05ea \u05e6\u05d4\"\u05dc \u05d1\u05e6\u05d9\u05e8 \u05e0\u05e6\u05e8\u05d9\u05dd.\u05e9\u05d9\u05de\u05d5 \u05dc\u05d1 - \u05d4\u05e9\u05d9\u05d2\u05d5\u05e8 \u05de\u05ea\u05d5\u05da \u05d0\u05e8\u05d2\u05d6\u05d9 \u05e2\u05e5 \u05d4\u05e0\u05e9\u05e2\u05e0\u05d9\u05dd \u05e2\u05dc \u05d1\u05dc\u05d5\u05e7\u05d9\u05dd.\u05de\u05d3\u05d9\u05d3\u05ea \u05d6\u05d5\u05d5\u05d9\u05ea \u05d4\u05e9\u05d9\u05d2\u05d5\u05e8 \u05dc\u05d0 \u05e0\u05e8\u05d0\u05d9\u05ea \u05e8\u05e6\u05d9\u05e0\u05d9\u05ea... \u05e9\u05d9\u05d2\u05d5\u05e8 \u05e8\u05e7 \u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d3 \u05e9\u05d4\u05e6\u05dc\u05d9\u05d7\u05d5 \u05dc\u05e9\u05d2\u05e8.\u05ea\u05d2\u05d5\u05d1\u05d4 \u05d0\u05d7\u05ea",false,521,"\u05d2\u05d3\u05d5\u05d3\u05d9 \u05d0\u05dc\u05de\u05d2'\u05d0\u05d4\u05d3\u05d9\u05df \u05d5\u05d4\u05d6\u05e8\u05d5\u05e2 \u05d4\u05e6\u05d1\u05d0\u05d9\u05ea \u05e9\u05dc \u05d4\u05d2'\u05d4\u05d0\u05d3 \u05d4\u05d0\u05e1\u05dc\u05d0\u05de\u05d9 \u05d1\u05e2\u05d6\u05d4 \u05de\u05e4\u05e8\u05e1\u05de\u05d9\u05dd \u05e1\u05e8\u05d8\u05d5\u05df \u05d1\u05d5 \u05e0\u05e8\u05d0\u05d4 \u05db\u05d9\u05e6\u05d3 \u05e9\u05d9\u05d2\u05e8\u05d5 \u05d1\u05de\u05e9\u05d5\u05ea\u05e3, \u05dc\u05d8\u05e2\u05e0\u05ea\u05dd, 4 \u05e8\u05e7\u05d8\u05d5\u05ea \u05dc\u05e2\u05d1\u05e8 \u05db\u05d5\u05d7\u05d5\u05ea \u05e6\u05d4\"\u05dc \u05d1\u05e6\u05d9\u05e8 \u05e0\u05e6\u05e8\u05d9\u05dd.\u05e9\u05d9\u05de\u05d5 \u05dc\u05d1 - \u05d4\u05e9\u05d9\u05d2\u05d5\u05e8 \u05de\u05ea\u05d5\u05da \u05d0\u05e8\u05d2\u05d6\u05d9 \u05e2\u05e5 \u05d4\u05e0\u05e9\u05e2\u05e0\u05d9\u05dd \u05e2\u05dc \u05d1\u05dc\u05d5\u05e7\u05d9\u05dd.\u05de\u05d3\u05d9\u05d3\u05ea \u05d6\u05d5\u05d5\u05d9\u05ea \u05d4\u05e9\u05d9\u05d2\u05d5\u05e8 \u05dc\u05d0 \u05e0\u05e8\u05d0\u05d9\u05ea \u05e8\u05e6\u05d9\u05e0\u05d9\u05ea... \u05e9\u05d9\u05d2\u05d5\u05e8 \u05e8\u05e7 \u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d3 \u05e9\u05d4\u05e6\u05dc\u05d9\u05d7\u05d5 \u05dc\u05e9\u05d2\u05e8.\u05ea\u05d2\u05d5\u05d1\u05d4 \u05d0\u05d7\u05ea"],["\u05de\u05d1\u05d6\u05e7\u05df 12\u05e9\u05e0\u05d9 \u05e6\u05e2\u05d9\u05e8\u05d9\u05dd \u05db\u05d1\u05e0\u05d9 20 \u05e0\u05e4\u05e6\u05e2\u05d5 \u05e7\u05e9\u05d4 \u05d5\u05d1\u05d9\u05e0\u05d5\u05e0\u05d9 \u05d1\u05ea\u05d0\u05d5\u05e0\u05d4 \u05d1\u05d9\u05df \u05d0\u05d5\u05e4\u05e0\u05d5\u05e2 \u05dc\u05e8\u05db\u05d1 \u05d1\u05e8\u05d7\u05d5\u05d1 \u05d0\u05d2\u05e8\u05d5\u05df \u05d1\u05d9\u05e8\u05d5\u05e9\u05dc\u05d9\u05dd, \u05e0\u05d4\u05d2 \u05e0\u05d5\u05e1\u05e3 \u05e0\u05e4\u05e6\u05e2 \u05e7\u05dc. \u05e6\u05d5\u05d5\u05ea\u05d9 \u05de\u05d3\"\u05d0 \u05e4\u05d9\u05e0\u05d5 \u05d0\u05d5\u05ea\u05dd \u05dc\u05d1\u05ea\u05d9 \u05d7\u05d5\u05dc\u05d9\u05dd \u05d1\u05e2\u05d9\u05e8. \u05e6\u05d9\u05dc\u05d5\u05dd: \u05ea\u05d9\u05e2\u05d5\u05d3 \u05de\u05d1\u05e6\u05e2\u05d9 \u05de\u05d3\"\u05d0@N12chat",false,522,"\u05de\u05d1\u05d6\u05e7\u05df 12\u05e9\u05e0\u05d9 \u05e6\u05e2\u05d9\u05e8\u05d9\u05dd \u05db\u05d1\u05e0\u05d9 20 \u05e0\u05e4\u05e6\u05e2\u05d5 \u05e7\u05e9\u05d4 \u05d5\u05d1\u05d9\u05e0\u05d5\u05e0\u05d9 \u05d1\u05ea\u05d0\u05d5\u05e0\u05d4 \u05d1\u05d9\u05df \u05d0\u05d5\u05e4\u05e0\u05d5\u05e2 \u05dc\u05e8\u05db\u05d1 \u05d1\u05e8\u05d7\u05d5\u05d1 \u05d0\u05d2\u05e8\u05d5\u05df \u05d1\u05d9\u05e8\u05d5\u05e9\u05dc\u05d9\u05dd, \u05e0\u05d4\u05d2 \u05e0\u05d5\u05e1\u05e3 \u05e0\u05e4\u05e6\u05e2 \u05e7\u05dc. \u05e6\u05d5\u05d5\u05ea\u05d9 \u05de\u05d3\"\u05d0 \u05e4\u05d9\u05e0\u05d5 \u05d0\u05d5\u05ea\u05dd \u05dc\u05d1\u05ea\u05d9 \u05d7\u05d5\u05dc\u05d9\u05dd \u05d1\u05e2\u05d9\u05e8. \u05e6\u05d9\u05dc\u05d5\u05dd: \u05ea\u05d9\u05e2\u05d5\u05d3 \u05de\u05d1\u05e6\u05e2\u05d9 \u05de\u05d3\"\u05d0@N12chat"],["\u05e0\u05d5\u05e2\u05dd \u05db\u05d4\u05df\u05d7\u05d1\u05e8\u05d9 \u05d4\u05e1\u05d9\u05d8\u05e7\u05d5\u05dd \"\u05e7\u05d5\u05e4\u05d4 \u05e8\u05d0\u05e9\u05d9\u05ea\" \u05e0\u05e4\u05e8\u05d3\u05d5 \u05de\u05e9\u05d9 \u05d8\u05e8\u05de\u05d9\u05df, \u05e2\u05d5\u05d6\u05e8 \u05d4\u05e4\u05e7\u05d4 \u05d1\u05e2\u05d5\u05e0\u05d4 \u05d4\u05e8\u05d1\u05d9\u05e2\u05d9\u05ea \u05e9\u05dc \u05d4\u05e1\u05d3\u05e8\u05d4, \u05e9\u05e0\u05d4\u05e8\u05d2 \u05d1\u05e9\u05d9\u05e8\u05d5\u05ea \u05de\u05d9\u05dc\u05d5\u05d0\u05d9\u05dd \u05d1\u05de\u05d4\u05dc\u05da \u05e7\u05e8\u05d1 \u05d1\u05d3\u05e8\u05d5\u05dd \u05e8\u05e6\u05d5\u05e2\u05ea \u05e2\u05d6\u05d4 \u05d1\u05e1\u05d5\u05e3 \u05d4\u05e9\u05d1\u05d5\u05e2: \"\u05e2\u05d5\u05d1\u05d3 \u05de\u05e1\u05d5\u05e8 \u05d5\u05d0\u05d9\u05e9 \u05e9\u05d9\u05d7\u05d4 \u05e9\u05e0\u05d2\u05e2 \u05d1\u05dc\u05d1\u05d1\u05d5\u05ea \u05e9\u05dc \u05db\u05d5\u05dc\u05e0\u05d5. \u05d4\u05e9\u05d7\u05e7\u05e0\u05d9\u05dd, \u05d4\u05e6\u05d5\u05d5\u05ea \u05d5\u05d4\u05d4\u05e4\u05e7\u05d4 \u05db\u05d5\u05dc\u05d4 \u05e2\u05e6\u05d5\u05d1\u05d4 \u05d5\u05d1\u05d5\u05db\u05d4\"@N12chat",false,523,"\u05e0\u05d5\u05e2\u05dd \u05db\u05d4\u05df\u05d7\u05d1\u05e8\u05d9 \u05d4\u05e1\u05d9\u05d8\u05e7\u05d5\u05dd \"\u05e7\u05d5\u05e4\u05d4 \u05e8\u05d0\u05e9\u05d9\u05ea\" \u05e0\u05e4\u05e8\u05d3\u05d5 \u05de\u05e9\u05d9 \u05d8\u05e8\u05de\u05d9\u05df, \u05e2\u05d5\u05d6\u05e8 \u05d4\u05e4\u05e7\u05d4 \u05d1\u05e2\u05d5\u05e0\u05d4 \u05d4\u05e8\u05d1\u05d9\u05e2\u05d9\u05ea \u05e9\u05dc \u05d4\u05e1\u05d3\u05e8\u05d4, \u05e9\u05e0\u05d4\u05e8\u05d2 \u05d1\u05e9\u05d9\u05e8\u05d5\u05ea \u05de\u05d9\u05dc\u05d5\u05d0\u05d9\u05dd \u05d1\u05de\u05d4\u05dc\u05da \u05e7\u05e8\u05d1 \u05d1\u05d3\u05e8\u05d5\u05dd \u05e8\u05e6\u05d5\u05e2\u05ea \u05e2\u05d6\u05d4 \u05d1\u05e1\u05d5\u05e3 \u05d4\u05e9\u05d1\u05d5\u05e2: \"\u05e2\u05d5\u05d1\u05d3 \u05de\u05e1\u05d5\u05e8 \u05d5\u05d0\u05d9\u05e9 \u05e9\u05d9\u05d7\u05d4 \u05e9\u05e0\u05d2\u05e2 \u05d1\u05dc\u05d1\u05d1\u05d5\u05ea \u05e9\u05dc \u05db\u05d5\u05dc\u05e0\u05d5. \u05d4\u05e9\u05d7\u05e7\u05e0\u05d9\u05dd, \u05d4\u05e6\u05d5\u05d5\u05ea \u05d5\u05d4\u05d4\u05e4\u05e7\u05d4 \u05db\u05d5\u05dc\u05d4 \u05e2\u05e6\u05d5\u05d1\u05d4 \u05d5\u05d1\u05d5\u05db\u05d4\"@N12chat"],["\u05e7\u05e8\u05df \u05d1\u05e6\u05dc\u05d0\u05dc\u05d0\u05d7\u05e8\u05d9 \u05d4\u05e4\u05e8\u05e1\u05d5\u05dd \u05d1\u05d7\u05d3\u05e9\u05d5\u05ea 12, \u05e7\u05d8\u05d0\u05e8 \u05de\u05e4\u05e8\u05e1\u05de\u05ea \u05d4\u05d5\u05d3\u05e2\u05ea \u05d2\u05d9\u05e0\u05d5\u05d9 \u05e0\u05d2\u05d3 \u05e0\u05ea\u05e0\u05d9\u05d4\u05d5: \"\u05d0\u05de\u05d9\u05e8\u05d5\u05ea \u05d7\u05e1\u05e8\u05d5\u05ea \u05d0\u05d7\u05e8\u05d9\u05d5\u05ea \u05e9\u05e4\u05d5\u05d2\u05e2\u05d5\u05ea \u05d1\u05e1\u05d9\u05db\u05d5\u05d9\u05d9 \u05d4\u05ea\u05d9\u05d5\u05d5\u05da, \u05de\u05e7\u05d5\u05d5\u05d9\u05dd \u05e9\u05d9\u05ea\u05e8\u05db\u05d6 \u05d1\u05de\u05d0\u05de\u05e6\u05d9\u05dd \u05dc\u05d4\u05e9\u05d1\u05ea \u05d4\u05d7\u05d8\u05d5\u05e4\u05d9\u05dd\"@N12chat",false,524,"\u05e7\u05e8\u05df \u05d1\u05e6\u05dc\u05d0\u05dc\u05d0\u05d7\u05e8\u05d9 \u05d4\u05e4\u05e8\u05e1\u05d5\u05dd \u05d1\u05d7\u05d3\u05e9\u05d5\u05ea 12, \u05e7\u05d8\u05d0\u05e8 \u05de\u05e4\u05e8\u05e1\u05de\u05ea \u05d4\u05d5\u05d3\u05e2\u05ea \u05d2\u05d9\u05e0\u05d5\u05d9 \u05e0\u05d2\u05d3 \u05e0\u05ea\u05e0\u05d9\u05d4\u05d5: \"\u05d0\u05de\u05d9\u05e8\u05d5\u05ea \u05d7\u05e1\u05e8\u05d5\u05ea \u05d0\u05d7\u05e8\u05d9\u05d5\u05ea \u05e9\u05e4\u05d5\u05d2\u05e2\u05d5\u05ea \u05d1\u05e1\u05d9\u05db\u05d5\u05d9\u05d9 \u05d4\u05ea\u05d9\u05d5\u05d5\u05da, \u05de\u05e7\u05d5\u05d5\u05d9\u05dd \u05e9\u05d9\u05ea\u05e8\u05db\u05d6 \u05d1\u05de\u05d0\u05de\u05e6\u05d9\u05dd \u05dc\u05d4\u05e9\u05d1\u05ea \u05d4\u05d7\u05d8\u05d5\u05e4\u05d9\u05dd\"@N12chat"],["\u05e0\u05d9\u05e8 \u05d3\u05d1\u05d5\u05e8\u05d9\u05e9\u05e8 \u05d4\u05d1\u05d9\u05d8\u05d7\u05d5\u05df \u05d2\u05dc\u05e0\u05d8: \"\u05d1\u05e9\u05dc\u05d1 \u05d4\u05d7\u05d3\u05e9 \u05d0\u05dc\u05d9\u05d5 \u05e0\u05db\u05e0\u05e1\u05e0\u05d5 \u05d1\u05de\u05dc\u05d7\u05de\u05d4 \u05d9\u05e9 \u05d4\u05d6\u05d3\u05de\u05e0\u05d5\u05d9\u05d5\u05ea \u05de\u05e9\u05de\u05e2\u05d5\u05ea\u05d9\u05d5\u05ea \u05d0\u05da \u05d2\u05dd \u05e1\u05d9\u05db\u05d5\u05e0\u05d9\u05dd \u05db\u05d1\u05d3\u05d9 \u05de\u05e9\u05e7\u05dc - \u05d7\u05d9\u05d6\u05d1\u05d0\u05dc\u05dc\u05d4 \u05e0\u05de\u05e6\u05d0 \u05d1\u05ea\u05d7\u05d5\u05e9\u05ea \u05e0\u05e8\u05d3\u05e4\u05d5\u05ea, \u05e8\u05e6\u05e3 \u05d4\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05e9\u05dc\u05e0\u05d5 \u05d9\u05d9\u05de\u05e9\u05da. \u05d1\u05de\u05e7\u05d1\u05d9\u05dc, \u05e0\u05de\u05e9\u05d9\u05da \u05d5\u05e0\u05e7\u05d9\u05d9\u05dd \u05d0\u05ea \u05d4\u05de\u05d0\u05de\u05e5 \u05dc\u05d4\u05e9\u05d9\u05d1 \u05d0\u05ea \u05d4\u05d7\u05d8\u05d5\u05e4\u05d9\u05dd \u05d5\u05dc\u05de\u05d5\u05d8\u05d8 \u05d0\u05ea \u05d7\u05de\u05d0\u05e1\". \u05e6\u05d9\u05dc\u05d5\u05dd: \u05d0\u05dc\u05e2\u05d3 \u05de\u05dc\u05db\u05d4@N12chat",false,525,"\u05e0\u05d9\u05e8 \u05d3\u05d1\u05d5\u05e8\u05d9\u05e9\u05e8 \u05d4\u05d1\u05d9\u05d8\u05d7\u05d5\u05df \u05d2\u05dc\u05e0\u05d8: \"\u05d1\u05e9\u05dc\u05d1 \u05d4\u05d7\u05d3\u05e9 \u05d0\u05dc\u05d9\u05d5 \u05e0\u05db\u05e0\u05e1\u05e0\u05d5 \u05d1\u05de\u05dc\u05d7\u05de\u05d4 \u05d9\u05e9 \u05d4\u05d6\u05d3\u05de\u05e0\u05d5\u05d9\u05d5\u05ea \u05de\u05e9\u05de\u05e2\u05d5\u05ea\u05d9\u05d5\u05ea \u05d0\u05da \u05d2\u05dd \u05e1\u05d9\u05db\u05d5\u05e0\u05d9\u05dd \u05db\u05d1\u05d3\u05d9 \u05de\u05e9\u05e7\u05dc - \u05d7\u05d9\u05d6\u05d1\u05d0\u05dc\u05dc\u05d4 \u05e0\u05de\u05e6\u05d0 \u05d1\u05ea\u05d7\u05d5\u05e9\u05ea \u05e0\u05e8\u05d3\u05e4\u05d5\u05ea, \u05e8\u05e6\u05e3 \u05d4\u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05e9\u05dc\u05e0\u05d5 \u05d9\u05d9\u05de\u05e9\u05da. \u05d1\u05de\u05e7\u05d1\u05d9\u05dc, \u05e0\u05de\u05e9\u05d9\u05da \u05d5\u05e0\u05e7\u05d9\u05d9\u05dd \u05d0\u05ea \u05d4\u05de\u05d0\u05de\u05e5 \u05dc\u05d4\u05e9\u05d9\u05d1 \u05d0\u05ea \u05d4\u05d7\u05d8\u05d5\u05e4\u05d9\u05dd \u05d5\u05dc\u05de\u05d5\u05d8\u05d8 \u05d0\u05ea \u05d7\u05de\u05d0\u05e1\". \u05e6\u05d9\u05dc\u05d5\u05dd: \u05d0\u05dc\u05e2\u05d3 \u05de\u05dc\u05db\u05d4@N12chat"],["\u05d3\u05e1\u05e7 \u05d4\u05d7\u05d5\u05e5\u05d8\u05e8\u05d0\u05de\u05e4: \"\u05d0\u05dd \u05d0\u05d1\u05d7\u05e8 \u05de\u05d7\u05d3\u05e9, \u05d0\u05d1\u05d8\u05dc \u05d0\u05ea \u05db\u05dc \u05de\u05d2\u05d1\u05dc\u05d5\u05ea \u05d4\u05e0\u05e9\u05e7 \u05e9\u05d7\u05d5\u05e7\u05e7 \u05d1\u05d9\u05d9\u05d3\u05df\"@N12chat",false,526,"\u05d3\u05e1\u05e7 \u05d4\u05d7\u05d5\u05e5\u05d8\u05e8\u05d0\u05de\u05e4: \"\u05d0\u05dd \u05d0\u05d1\u05d7\u05e8 \u05de\u05d7\u05d3\u05e9, \u05d0\u05d1\u05d8\u05dc \u05d0\u05ea \u05db\u05dc \u05de\u05d2\u05d1\u05dc\u05d5\u05ea \u05d4\u05e0\u05e9\u05e7 \u05e9\u05d7\u05d5\u05e7\u05e7 \u05d1\u05d9\u05d9\u05d3\u05df\"@N12chat"],["\"\u05ea\u05e1\u05e0\u05d9\u05dd\": \u05e0\u05e9\u05d9\u05d0 \u05d0\u05d9\u05e8\u05d0\u05df \u05dc\u05d0 \u05d9\u05e9\u05ea\u05ea\u05e3 \u05d1\u05d5\u05e2\u05d9\u05d3\u05ea \u05d4\u05d0\u05e7\u05dc\u05d9\u05dd \u05d1\u05d0\u05d9\u05d7\u05d5\u05d3 \u05d4\u05d0\u05de\u05d9\u05e8\u05d5\u05d9\u05d5\u05ea \u05d1\u05de\u05d7\u05d0\u05d4 \u05e2\u05dc \u05e0\u05d5\u05db\u05d7\u05ea\u05d5 \u05e9\u05dc \u05d4\u05e0\u05e9\u05d9\u05d0 \u05d4\u05e8\u05e6\u05d5\u05d2 \u05e9\u05dd.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,527,"\"\u05ea\u05e1\u05e0\u05d9\u05dd\": \u05e0\u05e9\u05d9\u05d0 \u05d0\u05d9\u05e8\u05d0\u05df \u05dc\u05d0 \u05d9\u05e9\u05ea\u05ea\u05e3 \u05d1\u05d5\u05e2\u05d9\u05d3\u05ea \u05d4\u05d0\u05e7\u05dc\u05d9\u05dd \u05d1\u05d0\u05d9\u05d7\u05d5\u05d3 \u05d4\u05d0\u05de\u05d9\u05e8\u05d5\u05d9\u05d5\u05ea \u05d1\u05de\u05d7\u05d0\u05d4 \u05e2\u05dc \u05e0\u05d5\u05db\u05d7\u05ea\u05d5 \u05e9\u05dc \u05d4\u05e0\u05e9\u05d9\u05d0 \u05d4\u05e8\u05e6\u05d5\u05d2 \u05e9\u05dd.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05de\u05d1\u05d6\u05e7\u05df 12\ud83d\udcdd\u05e6\u05d1\u05e2 \u05d0\u05d3\u05d5\u05dd \u05d1\u05e2\u05d5\u05d8\u05e3 \u05e2\u05d6\u05d4 \u05d5\u05e9\u05d3\u05e8\u05d5\u05ea@N12chat",false,528,"\u05de\u05d1\u05d6\u05e7\u05df 12\ud83d\udcdd\u05e6\u05d1\u05e2 \u05d0\u05d3\u05d5\u05dd \u05d1\u05e2\u05d5\u05d8\u05e3 \u05e2\u05d6\u05d4 \u05d5\u05e9\u05d3\u05e8\u05d5\u05ea@N12chat"],["\u05e2\u05e0\u05d1\u05e8 \u05d8\u05d5\u05d9\u05d6\u05e8\u05e7\u05e8\u05d9\u05d0\u05d5\u05ea \"\u05d4\u05d3\u05d7\u05d4 \u05e2\u05db\u05e9\u05d9\u05d5\": \u05de\u05d0\u05d5\u05ea \u05de\u05e4\u05d2\u05d9\u05e0\u05d9\u05dd \u05de\u05d5\u05dc \u05de\u05e2\u05d5\u05df \u05e8\u05d4\"\u05de \u05d1\u05e8\u05d7\u05d5\u05d1 \u05e2\u05d6\u05d4 \u05d1\u05d9\u05e8\u05d5\u05e9\u05dc\u05d9\u05dd \u05d4\u05e2\u05e8\u05d1. \u05e6\u05d9\u05dc\u05d5\u05dd: \u05e1\u05e2\u05d9\u05e3 27\u05d0' \u05dc\u05d7\u05d5\u05e7 \u05d6\u05db\u05d5\u05d9\u05d5\u05ea \u05d9\u05d5\u05e6\u05e8\u05d9\u05dd@N12chat",false,529,"\u05e2\u05e0\u05d1\u05e8 \u05d8\u05d5\u05d9\u05d6\u05e8\u05e7\u05e8\u05d9\u05d0\u05d5\u05ea \"\u05d4\u05d3\u05d7\u05d4 \u05e2\u05db\u05e9\u05d9\u05d5\": \u05de\u05d0\u05d5\u05ea \u05de\u05e4\u05d2\u05d9\u05e0\u05d9\u05dd \u05de\u05d5\u05dc \u05de\u05e2\u05d5\u05df \u05e8\u05d4\"\u05de \u05d1\u05e8\u05d7\u05d5\u05d1 \u05e2\u05d6\u05d4 \u05d1\u05d9\u05e8\u05d5\u05e9\u05dc\u05d9\u05dd \u05d4\u05e2\u05e8\u05d1. \u05e6\u05d9\u05dc\u05d5\u05dd: \u05e1\u05e2\u05d9\u05e3 27\u05d0' \u05dc\u05d7\u05d5\u05e7 \u05d6\u05db\u05d5\u05d9\u05d5\u05ea \u05d9\u05d5\u05e6\u05e8\u05d9\u05dd@N12chat"],["\u05d7\u05d6\u05d1\u05d0\u05dc\u05dc\u05d4: \u05d1\u05de\u05e1\u05d2\u05e8\u05ea \u05d4\u05ea\u05d2\u05d5\u05d1\u05d4 \u05dc\u05d7\u05d9\u05e1\u05d5\u05dc  \u05e6\u05d0\u05dc\u05d7 \u05d0\u05dc\u05e2\u05d0\u05e8\u05d5\u05e8\u05d9 \u05d5\u05d7\u05d9\u05e1\u05d5\u05dc \u05d5\u05e1\u05d0\u05dd \u05d0-\u05d8\u05d5\u05d5\u05d9\u05dc (\u05d1\u05db\u05d9\u05e8 \u05d7\u05d6\u05d1\u05d0\u05dc\u05dc\u05d4 \u05e9\u05d7\u05d5\u05e1\u05dc \u05d0\u05ea\u05de\u05d5\u05dc-\u05d0\"\u05e2) \u05ea\u05e7\u05e4\u05e0\u05d5 \u05d0\u05ea \u05de\u05e4\u05e7\u05d3\u05ea \u05e4\u05d9\u05e7\u05d5\u05d3 \u05e6\u05e4\u05d5\u05df \u05e9\u05dc \u05e6\u05d4\"\u05dc \u05d1\u05e6\u05e4\u05ea(\u05d1\u05e1\u05d9\u05e1 \u05d3\u05d3\u05d5) \u05d1\u05de\u05e1\u05e4\u05e8 \u05db\u05d8\u05d1\"\u05de\u05d9\u05dd \u05de\u05ea\u05d0\u05d1\u05d3\u05d9\u05dd.\n",false,530,"\u05d7\u05d6\u05d1\u05d0\u05dc\u05dc\u05d4: \u05d1\u05de\u05e1\u05d2\u05e8\u05ea \u05d4\u05ea\u05d2\u05d5\u05d1\u05d4 \u05dc\u05d7\u05d9\u05e1\u05d5\u05dc  \u05e6\u05d0\u05dc\u05d7 \u05d0\u05dc\u05e2\u05d0\u05e8\u05d5\u05e8\u05d9 \u05d5\u05d7\u05d9\u05e1\u05d5\u05dc \u05d5\u05e1\u05d0\u05dd \u05d0-\u05d8\u05d5\u05d5\u05d9\u05dc (\u05d1\u05db\u05d9\u05e8 \u05d7\u05d6\u05d1\u05d0\u05dc\u05dc\u05d4 \u05e9\u05d7\u05d5\u05e1\u05dc \u05d0\u05ea\u05de\u05d5\u05dc-\u05d0\"\u05e2) \u05ea\u05e7\u05e4\u05e0\u05d5 \u05d0\u05ea \u05de\u05e4\u05e7\u05d3\u05ea \u05e4\u05d9\u05e7\u05d5\u05d3 \u05e6\u05e4\u05d5\u05df \u05e9\u05dc \u05e6\u05d4\"\u05dc \u05d1\u05e6\u05e4\u05ea(\u05d1\u05e1\u05d9\u05e1 \u05d3\u05d3\u05d5) \u05d1\u05de\u05e1\u05e4\u05e8 \u05db\u05d8\u05d1\"\u05de\u05d9\u05dd \u05de\u05ea\u05d0\u05d1\u05d3\u05d9\u05dd.\n"],["\u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd \u05de\u05d3\u05d5\u05d5\u05d7\u05d9\u05dd \u05e9\u05d0\u05d7\u05de\u05d3 \u05e4\u05d2'\u05dd, \u05d0\u05e1\u05d9\u05e8 \u05de\u05e9\u05d5\u05d7\u05e8\u05e8 \u05de\u05e2\u05e1\u05e7\u05ea \u05e9\u05dc\u05d9\u05d8 \u05e0\u05d4\u05e8\u05d2 \u05dc\u05e4\u05e0\u05d9 \u05d6\u05de\u05df \u05e7\u05e6\u05e8 \u05d1\u05ea\u05e7\u05d9\u05e4\u05d4 \u05d1\u05d0\u05d6\u05d5\u05e8 \u05de\u05e1\u05d2\u05d3 \u05d0-\u05e1\u05e0\u05d9\u05d4 \u05d1\u05d7'\u05d0\u05df \u05d9\u05d5\u05e0\u05e1 (\u05d3\u05e8\u05d5\u05dd \u05d4\u05e8\u05e6\u05d5\u05e2\u05d4).\u05e4\u05d2'\u05dd \u05e0\u05d4\u05d2 \"\u05dc\u05d7\u05e0\u05da\" \u05d0\u05ea \u05d4\u05d0\u05d5\u05db\u05dc\u05d5\u05e1\u05d9\u05d9\u05d4 \u05d4\u05e6\u05e2\u05d9\u05e8\u05d4 \u05d1\u05e8\u05e6\u05d5\u05e2\u05d4 \u05d5\u05d4\u05e8\u05d1\u05d4 \u05dc\u05d4\u05d2\u05d9\u05e2 \u05dc\u05d1\u05ea\u05d9 \u05e1\u05e4\u05e8 \u05d9\u05e1\u05d5\u05d3\u05d9\u05d9\u05dd (\u05d1\u05e2\u05d9\u05e7\u05e8 \u05e9\u05dc \u05d1\u05e0\u05d5\u05ea) \u05db\u05d3\u05d9 \u05dc\u05d4\u05e8\u05e6\u05d5\u05ea \u05e2\u05dc \u05d4\u05d7\u05e9\u05d9\u05d1\u05d5\u05ea \u05e9\u05d1\u05e2\u05e1\u05e7\u05ea \u05e9\u05d7\u05e8\u05d5\u05e8 \u05d0\u05e1\u05d9\u05e8\u05d9\u05dd \u05e0\u05d5\u05e1\u05e4\u05ea \u05db\u05de\u05d5 \u05e2\u05e1\u05e7\u05ea \u05e9\u05dc\u05d9\u05d8 \u05e9\u05ea\u05d5\u05d1\u05d9\u05dc \u05dc\u05e9\u05d7\u05e8\u05d5\u05e8 \u05d4\u05d0\u05e1\u05d9\u05e8\u05d9\u05dd \u05e9\u05e2\u05d3\u05d9\u05d9\u05df \u05db\u05dc\u05d5\u05d0\u05d9\u05dd \u05d1\u05d9\u05e9\u05e8\u05d0\u05dc.\u05d4\u05d5\u05d0 \u05d4\u05d9\u05d4 \u05ea\u05d5\u05e9\u05d1 \u05d1\u05e0\u05d9 \u05e1\u05d4\u05d9\u05dc\u05d0 \u05d1\u05de\u05d6\u05e8\u05d7 \u05d7'\u05d0\u05df \u05d9\u05d5\u05e0\u05e1.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,531,"\u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd \u05de\u05d3\u05d5\u05d5\u05d7\u05d9\u05dd \u05e9\u05d0\u05d7\u05de\u05d3 \u05e4\u05d2'\u05dd, \u05d0\u05e1\u05d9\u05e8 \u05de\u05e9\u05d5\u05d7\u05e8\u05e8 \u05de\u05e2\u05e1\u05e7\u05ea \u05e9\u05dc\u05d9\u05d8 \u05e0\u05d4\u05e8\u05d2 \u05dc\u05e4\u05e0\u05d9 \u05d6 dc\u05d9 \u05de\u05dc\u05d7\u05de\u05ea \u05d4\u05e2\u05d5\u05dc\u05dd \u05d4\u05e8\u05d0\u05e9\u05d5\u05e0\u05d4. \u05d1\u05d9\u05df \u05d4\u05e7\u05d1\u05e8\u05d9\u05dd, \u05d4\u05d9\u05d5 \u05e7\u05d1\u05e8\u05d9 \u05d7\u05d9\u05d9\u05dc\u05d9\u05dd \u05d9\u05d4\u05d5\u05d3\u05d9\u05dd, \u05d5\u05de\u05e4\u05e7\u05d3\u05d9 \u05d4\u05d2\u05d3\u05d5\u05d3 \u05e7\u05d9\u05d9\u05de\u05d5 \u05de\u05e2\u05de\u05d3 \u05d4\u05e6\u05d3\u05e2\u05d4 \u05d5\u05e7\u05e8\u05d9\u05d0\u05ea \u05e7\u05d3\u05d9\u05e9@N12chat",false,532,"\u05e0\u05d9\u05e8 \u05d3\u05d1\u05d5\u05e8\u05d9\u05d1\u05de\u05e1\u05d2\u05e8\u05ea \u05dc\u05d7\u05d9\u05de\u05ea \u05d2\u05d3\u05d5\u05d3 74 \u05e9\u05dc \u05d7\u05d8\u05d9\u05d1\u05d4 188 \u05d1\u05d0\u05dc-\u05de\u05e2'\u05d0\u05d6\u05d9, \u05d4\u05d2\u05d9\u05e2\u05d5 \u05de\u05e4\u05e7\u05d3\u05d9 \u05d4\u05d2\u05d3\u05d5\u05d3 \u05dc\u05d1\u05d9\u05ea \u05d4\u05e7\u05d1\u05e8\u05d5\u05ea \u05e9\u05dc \u05d7\u05dc\u05dc\u05d9 \u05de\u05dc\u05d7\u05de\u05ea \u05d4\u05e2\u05d5\u05dc\u05dd \u05d4\u05e8\u05d0\u05e9\u05d5\u05e0\u05d4. \u05d1\u05d9\u05df \u05d4\u05e7\u05d1\u05e8\u05d9\u05dd, \u05d4\u05d9\u05d5 \u05e7\u05d1\u05e8\u05d9 \u05d7\u05d9\u05d9\u05dc\u05d9\u05dd \u05d9\u05d4\u05d5\u05d3\u05d9\u05dd, \u05d5\u05de\u05e4\u05e7\u05d3\u05d9 \u05d4\u05d2\u05d3\u05d5\u05d3 \u05e7\u05d9\u05d9\u05de\u05d5 \u05de\u05e2\u05de\u05d3 \u05d4\u05e6\u05d3\u05e2\u05d4 \u05d5\u05e7\u05e8\u05d9\u05d0\u05ea \u05e7\u05d3\u05d9\u05e9@N12chat"],["\u05e0\u05d9\u05e8 \u05d3\u05d1\u05d5\u05e8\u05d9\u05d4\u05d5\u05ea\u05e8 \u05dc\u05e4\u05e8\u05e1\u05d5\u05dd: \u05e1\u05e8\u05df (\u05de\u05d9\u05dc\u05f3) \u05d4\u05e8\u05d0\u05dc \u05e9\u05e8\u05d1\u05d9\u05d8, \u05d1\u05df 33 \u05de\u05db\u05d5\u05db\u05d1 \u05d9\u05e2\u05e7\u05d1, \u05e7\u05e6\u05d9\u05df \u05dc\u05d5\u05d7\u05dd \u05d1\u05d2\u05d3\u05d5\u05d3 7008, \u05e2\u05d5\u05e6\u05d1\u05ea \u05f3\u05d7\u05e6\u05d9 \u05d4\u05d0\u05e9\u05f3 (551), \u05e0\u05e4\u05dc \u05d1\u05e7\u05e8\u05d1 \u05d1\u05e6\u05e4\u05d5\u05df \u05e8\u05e6\u05d5\u05e2\u05ea \u05e2\u05d6\u05d4@N12chat",false,533,"\u05e0\u05d9\u05e8 \u05d3\u05d1\u05d5\u05e8\u05d9\u05d4\u05d5\u05ea\u05e8 \u05dc\u05e4\u05e8\u05e1\u05d5\u05dd: \u05e1\u05e8\u05df (\u05de\u05d9\u05dc\u05f3) \u05d4\u05e8\u05d0\u05dc \u05e9\u05e8\u05d1\u05d9\u05d8, \u05d1\u05df 33 \u05de\u05db\u05d5\u05db\u05d1 \u05d9\u05e2\u05e7\u05d1, \u05e7\u05e6\u05d9\u05df \u05dc\u05d5\u05d7\u05dd \u05d1\u05d2\u05d3\u05d5\u05d3 7008, \u05e2\u05d5\u05e6\u05d1\u05ea \u05f3\u05d7\u05e6\u05d9 \u05d4\u05d0\u05e9\u05f3 (551), \u05e0\u05e4\u05dc \u05d1\u05e7\u05e8\u05d1 \u05d1\u05e6\u05e4\u05d5\u05df \u05e8\u05e6\u05d5\u05e2\u05ea \u05e2\u05d6\u05d4@N12chat"],["\u05d7\u05e9\u05d1\u05d5\u05e0\u05d5\u05ea \u05d4\u05de\u05d6\u05d5\u05d4\u05d9\u05dd \u05e2\u05dd \u05de\u05e9\u05de\u05e8\u05d5\u05ea \u05d4\u05de\u05d4\u05e4\u05db\u05d4 \u05d4\u05d0\u05d9\u05e8\u05d0\u05e0\u05d9\u05dd \u05de\u05e6\u05d9\u05d9\u05e6\u05d9\u05dd \u05e4\u05e1\u05d5\u05e7\u05d9 \u05e7\u05d5\u05e8\u05d0\u05df \u05d4\u05e2\u05d5\u05e1\u05e7\u05d9\u05dd \u05d1\u05e0\u05e7\u05de\u05d4. \u05d6\u05d0\u05ea \u05dc\u05e6\u05d3 \u05d3\u05d9\u05d5\u05d5\u05d7\u05d9\u05dd \u05dc\u05d0 \u05e8\u05e9\u05de\u05d9\u05d9\u05dd \u05e2\u05dc \u05e9\u05d9\u05d2\u05d5\u05e8 \u05d8\u05d9\u05dc\u05d9\u05dd \u05d1\u05dc\u05d9\u05e1\u05d8\u05d9\u05d9\u05dd \u05de\u05d0\u05d6\u05d5\u05e8 \u05db\u05e8\u05de\u05d0\u05e0\u05e9\u05d0\u05d4 \u05d1\u05d0\u05d9\u05e8\u05d0\u05df, \u05db\u05db\u05dc \u05d4\u05e0\u05e8\u05d0\u05d4 \u05dc\u05e2\u05d1\u05e8 \u05de\u05d8\u05e8\u05d5\u05ea \u05d0\u05de\u05e8\u05d9\u05e7\u05d0\u05d9\u05d5\u05ea \u05d1\u05d0\u05e8\u05d1\u05d9\u05dc.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,534,"\u05d7\u05e9\u05d1\u05d5\u05e0\u05d5\u05ea \u05d4\u05de\u05d6\u05d5\u05d4\u05d9\u05dd \u05e2\u05dd \u05de\u05e9\u05de\u05e8\u05d5\u05ea \u05d4\u05de\u05d4\u05e4\u05db\u05d4 \u05d4\u05d0\u05d9\u05e8\u05d0\u05e0\u05d9\u05dd \u05de\u05e6\u05d9\u05d9\u05e6\u05d9\u05dd \u05e4\u05e1\u05d5\u05e7\u05d9 \u05e7\u05d5\u05e8\u05d0\u05df \u05d4\u05e2\u05d5\u05e1\u05e7\u05d9\u05dd \u05d1\u05e0\u05e7\u05de\u05d4. \u05d6\u05d0\u05ea \u05dc\u05e6\u05d3 \u05d3\u05d9\u05d5\u05d5\u05d7\u05d9\u05dd \u05dc\u05d0 \u05e8\u05e9\u05de\u05d9\u05d9\u05dd \u05e2\u05dc \u05e9\u05d9\u05d2\u05d5\u05e8 \u05d8\u05d9\u05dc\u05d9\u05dd \u05d1\u05dc\u05d9\u05e1\u05d8\u05d9\u05d9\u05dd \u05de\u05d0\u05d6\u05d5\u05e8 \u05db\u05e8\u05de\u05d0\u05e0\u05e9\u05d0\u05d4 \u05d1\u05d0\u05d9\u05e8\u05d0\u05df, \u05db\u05db\u05dc \u05d4\u05e0\u05e8\u05d0\u05d4 \u05dc\u05e2\u05d1\u05e8 \u05de\u05d8\u05e8\u05d5\u05ea \u05d0\u05de\u05e8\u05d9\u05e7\u05d0\u05d9\u05d5\u05ea \u05d1\u05d0\u05e8\u05d1\u05d9\u05dc.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05d3\u05e1\u05e7 \u05d4\u05d7\u05d5\u05e5\u05d0\u05e8\u05de\u05d5\u05df \u05d1\u05e7\u05d9\u05e0\u05d2\u05d4\u05d0\u05dd: \u05d4\u05de\u05dc\u05da \u05e6'\u05d0\u05e8\u05dc\u05e1 \u05d0\u05d5\u05d1\u05d7\u05df \u05db\u05d7\u05d5\u05dc\u05d4 \u05e1\u05e8\u05d8\u05df@N12chat",false,535,"\u05d3\u05e1\u05e7 \u05d4\u05d7\u05d5\u05e5\u05d0\u05e8\u05de\u05d5\u05df \u05d1\u05e7\u05d9\u05e0\u05d2\u05d4\u05d0\u05dd: \u05d4\u05de\u05dc\u05da \u05e6'\u05d0\u05e8\u05dc\u05e1 \u05d0\u05d5\u05d1\u05d7\u05df \u05db\u05d7\u05d5\u05dc\u05d4 \u05e1\u05e8\u05d8\u05df@N12chat"],["\u05d0\u05d9\u05e8\u05d0\u05df : \u05d0\u05d7\u05e8\u05d9 \u05e9\u05e2\u05e9\u05d4 \u05e2\u05e6\u05d9\u05e8\u05d4 \u05d1\u05e2\u05d9\u05e8 \u05e0\u05d2'\u05e3 \u05d4\u05e7\u05d3\u05d5\u05e9\u05d4 \u05dc\u05e9\u05d9\u05e2\u05d9\u05dd \u05d1\u05e2\u05d9\u05e8\u05d0\u05e7, \u05d4\u05d2\u05d9\u05e2 \u05d0\u05de\u05e9 \u05dc\u05d8\u05d4\u05e8\u05df \u05d0\u05e8\u05d5\u05e0\u05d5 \u05e9\u05dc \u05e8\u05d6\u05d9 \u05de\u05d5\u05e1\u05d5\u05d5\u05d9, \u05d4\u05d1\u05db\u05d9\u05e8 \u05d4\u05d0\u05d9\u05e8\u05d0\u05e0\u05d9 \u05e9\u05d7\u05d5\u05e1\u05dc \u05d1\u05ea\u05e7\u05d9\u05e4\u05d4 \u05d1\u05d3\u05de\u05e9\u05e7. \u05d1\u05d8\u05d4\u05e8\u05df \u05e0\u05e2\u05e8\u05da \u05d8\u05e7\u05e1 \u05d4\u05de\u05d5\u05e0\u05d9 \u05d5\u05ea\u05e4\u05d9\u05dc\u05d4 \u05de\u05d9\u05d5\u05d7\u05d3\u05ea \u05d1\u05d4\u05e9\u05ea\u05ea\u05e4\u05d5\u05ea \u05d4\u05de\u05e0\u05d4\u05d9\u05d2 \u05d4\u05e2\u05dc\u05d9\u05d5\u05df \u05e9\u05dc \u05d0\u05d9\u05e8\u05d0\u05df, \u05de\u05e4\u05e7\u05d3 \u05de\u05e9\u05de\u05e8\u05d5\u05ea \u05d4\u05de\u05d4\u05e4\u05db\u05d4 \u05d4\u05d0\u05d9\u05e8\u05d0\u05e0\u05d9\u05dd, \u05de\u05e4\u05e7\u05d3 \u05db\u05d5\u05d7 \u05d0\u05dc\u05e7\u05d3\u05e1 \u05d1\u05de\u05e9\u05de\u05e8\u05d5\u05ea \u05d4\u05de\u05d4\u05e4\u05db\u05d4 \u05d5\u05e2\u05d5\u05d3.\u05d4\u05e8\u05db\u05d1 \u05d7\u05e8\u05d9\u05d2 \u05e9\u05dc \u05d1\u05db\u05d9\u05e8\u05d9\u05dd - \u05d1\u05d4\u05ea\u05d0\u05dd \u05dc\u05d7\u05e9\u05d9\u05d1\u05d5\u05ea\u05d5 \u05e9\u05dc \u05de\u05d5\u05e1\u05d5\u05d5\u05d9 \u05e2\u05d1\u05d5\u05e8 \u05d4\u05d0\u05d9\u05e8\u05d0\u05e0\u05d9\u05dd.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,536,"\u05d0\u05d9\u05e8\u05d0\u05df : \u05d0\u05d7\u05e8\u05d9 \u05e9\u05e2\u05e9\u05d4 \u05e2\u05e6\u05d9\u05e8\u05d4 \u05d1\u05e2\u05d9\u05e8 \u05e0\u05d2'\u05e3 \u05d4\u05e7\u05d3\u05d5\u05e9\u05d4 \u05dc\u05e9\u05d9\u05e2\u05d9\u05dd \u05d1\u05e2\u05d9\u05e8\u05d0\u05e7, \u05d4\u05d2\u05d9\u05e2 \u05d0\u05de\u05e9 \u05dc\u05d8\u05d4\u05e8\u05df \u05d0\u05e8\u05d5\u05e0\u05d5 \u05e9\u05dc \u05e8\u05d6\u05d9 \u05de\u05d5\u05e1\u05d5\u05d5\u05d9, \u05d4\u05d1\u05db\u05d9\u05e8 \u05d4\u05d0\u05d9\u05e8\u05d0\u05e0\u05d9 \u05e9\u05d7\u05d5\u05e1\u05dc \u05d1\u05ea\u05e7\u05d9\u05e4\u05d4 \u05d1\u05d3\u05de\u05e9\u05e7. \u05d1\u05d8\u05d4\u05e8\u05df \u05e0\u05e2\u05e8\u05da \u05d8\u05e7\u05e1 \u05d4\u05de\u05d5\u05e0\u05d9 \u05d5\u05ea\u05e4\u05d9\u05dc\u05d4 \u05de\u05d9\u05d5\u05d7\u05d3\u05ea \u05d1\u05d4\u05e9\u05ea\u05ea\u05e4\u05d5\u05ea \u05d4\u05de\u05e0\u05d4\u05d9\u05d2 \u05d4\u05e2\u05dc\u05d9\u05d5\u05df \u05e9\u05dc \u05d0\u05d9\u05e8\u05d0\u05df, \u05de\u05e4\u05e7\u05d3 \u05de\u05e9\u05de\u05e8\u05d5\u05ea \u05d4\u05de\u05d4\u05e4\u05db\u05d4 \u05d4\u05d0\u05d9\u05e8\u05d0\u05e0\u05d9\u05dd, \u05de\u05e4\u05e7\u05d3 \u05db\u05d5\u05d7 \u05d0\u05dc\u05e7\u05d3\u05e1 \u05d1\u05de\u05e9\u05de\u05e8\u05d5\u05ea \u05d4\u05de\u05d4\u05e4\u05db\u05d4 \u05d5\u05e2\u05d5\u05d3.\u05d4\u05e8\u05db\u05d1 \u05d7\u05e8\u05d9\u05d2 \u05e9\u05dc \u05d1\u05db\u05d9\u05e8\u05d9\u05dd - \u05d1\u05d4\u05ea\u05d0\u05dd \u05dc\u05d7\u05e9\u05d9\u05d1\u05d5\u05ea\u05d5 \u05e9\u05dc \u05de\u05d5\u05e1\u05d5\u05d5\u05d9 \u05e2\u05d1\u05d5\u05e8 \u05d4\u05d0\u05d9\u05e8\u05d0\u05e0\u05d9\u05dd.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05d0\u05e1\u05e3 \u05e8\u05d5\u05d6\u05e0\u05e6\u05d5\u05d9\u05d9\u05d2\u05de\u05e9\u05e8\u05d3 \u05d4\u05d4\u05d2\u05e0\u05d4 \u05e9\u05dc \u05e8\u05d5\u05e1\u05d9\u05d4 \u05d4\u05d5\u05d3\u05d9\u05e2 \u05e9\u05d4\u05e4\u05d9\u05dc 32 \u05db\u05d8\u05d1\"\u05de\u05d9\u05dd \u05d0\u05d5\u05e7\u05e8\u05d0\u05d9\u05e0\u05d9\u05d9\u05dd \u05d1\u05db\u05de\u05d4 \u05de\u05d7\u05d5\u05d6\u05d5\u05ea, \u05db\u05d5\u05dc\u05dc \u05d0\u05d6\u05d5\u05e8 \u05d4\u05d1\u05d9\u05e8\u05d4 \u05de\u05d5\u05e1\u05e7\u05d5\u05d5\u05d4@N12chat",false,537,"\u05d0\u05e1\u05e3 \u05e8\u05d5\u05d6\u05e0\u05e6\u05d5\u05d9\u05d9\u05d2\u05de\u05e9\u05e8\u05d3 \u05d4\u05d4\u05d2\u05e0\u05d4 \u05e9\u05dc \u05e8\u05d5\u05e1\u05d9\u05d4 \u05d4\u05d5\u05d3\u05d9\u05e2 \u05e9\u05d4\u05e4\u05d9\u05dc 32 \u05db\u05d8\u05d1\"\u05de\u05d9\u05dd \u05d0\u05d5\u05e7\u05e8\u05d0\u05d9\u05e0\u05d9\u05d9\u05dd \u05d1\u05db\u05de\u05d4 \u05de\u05d7\u05d5\u05d6\u05d5\u05ea, \u05db\u05d5\u05dc\u05dc \u05d0\u05d6\u05d5\u05e8 \u05d4\u05d1\u05d9\u05e8\u05d4 \u05de\u05d5\u05e1\u05e7\u05d5\u05d5\u05d4@N12chat"],["\u05d3\u05e4\u05e0\u05d4 \u05dc\u05d9\u05d0\u05dc\u05de\u05d8\u05d4 \u05d4\u05de\u05e9\u05e4\u05d7\u05d5\u05ea \u05dc\u05d4\u05d7\u05d6\u05e8\u05ea \u05d4\u05d7\u05d8\u05d5\u05e4\u05d9\u05dd \u05d5\u05d4\u05e0\u05e2\u05d3\u05e8\u05d9\u05dd: \"17 \u05e9\u05e2\u05d5\u05ea \u05d7\u05dc\u05e4\u05d5 \u05d5\u05e2\u05d3\u05d9\u05d9\u05df \u05dc\u05d0 \u05d4\u05ea\u05e7\u05d1\u05dc \u05d0\u05d9\u05e9\u05d5\u05e8 \u05dc\u05e7\u05d9\u05d5\u05dd \u05e4\u05d2\u05d9\u05e9\u05d4 \u05e2\u05dd \u05e7\u05d1\u05d9\u05e0\u05d8 \u05d4\u05de\u05dc\u05d7\u05de\u05d4. \u05d4\u05d3\u05e8\u05d9\u05e9\u05d4 \u05dc\u05e4\u05d2\u05d9\u05e9\u05d4 \u05de\u05d2\u05d9\u05e2\u05d4 \u05e2\u05dc \u05e8\u05e7\u05e2 \u05e1\u05d9\u05d5\u05dd \u05d4\u05e4\u05e1\u05e7\u05ea \u05d4\u05d0\u05e9 \u05d5\u05d4\u05e2\u05d3\u05d5\u05d9\u05d5\u05ea \u05d4\u05de\u05d7\u05e8\u05d9\u05d3\u05d5\u05ea \u05e9\u05dc \u05d0\u05dc\u05d5 \u05e9\u05d7\u05d6\u05e8\u05d5 \u05de\u05e9\u05d1\u05d9 \u05d4\u05d7\u05de\u05d0\u05e1 \u05d4\u05de\u05d1\u05d4\u05d9\u05e8\u05d5\u05ea \u05db\u05d9 \u05d4\u05d6\u05de\u05df \u05d4\u05d5\u05dc\u05da \u05d5\u05d0\u05d5\u05d6\u05dc \u05dc\u05d4\u05e6\u05dc\u05ea \u05d0\u05dc\u05d5 \u05e9\u05e0\u05d5\u05ea\u05e8\u05d5 \u05d1\u05e9\u05d1\u05d9 \u05d7\u05de\u05d0\u05e1-\u05d3\u05e2\u05d0\u05e9\"@N12chat",false,538,"\u05d3\u05e4\u05e0\u05d4 \u05dc\u05d9\u05d0\u05dc\u05de\u05d8\u05d4 \u05d4\u05de\u05e9\u05e4\u05d7\u05d5\u05ea \u05dc\u05d4\u05d7\u05d6\u05e8\u05ea \u05d4\u05d7\u05d8\u05d5\u05e4\u05d9\u05dd \u05d5\u05d4\u05e0\u05e2\u05d3\u05e8\u05d9\u05dd: \"17 \u05e9\u05e2\u05d5\u05ea \u05d7\u05dc\u05e4\u05d5 \u05d5\u05e2\u05d3\u05d9\u05d9\u05df \u05dc\u05d0 \u05d4\u05ea\u05e7\u05d1\u05dc \u05d0\u05d9\u05e9\u05d5\u05e8 \u05dc\u05e7\u05d9\u05d5\u05dd \u05e4\u05d2\u05d9\u05e9\u05d4 \u05e2\u05dd \u05e7\u05d1\u05d9\u05e0\u05d8 \u05d4\u05de\u05dc\u05d7\u05de\u05d4. \u05d4\u05d3\u05e8\u05d9\u05e9\u05d4 \u05dc\u05e4\u05d2\u05d9\u05e9\u05d4 \u05de\u05d2\u05d9\u05e2\u05d4 \u05e2\u05dc \
