\u05e9\u05d4\u05d9\u05d0 \u05d7\u05e4\u05e6\u05d4 \u05d1\u05d5, \u05d0\u05dc\u05d0 \u05d0\u05e3 \u05e2\u05d5\u05d3\u05d3\u05d4 \u05d0\u05d5\u05ea\u05d4 \u05dc\u05d4\u05de\u05e9\u05d9\u05da \u05e2\u05dd \u05d4\u05d4\u05ea\u05d2\u05e8\u05d5\u05d9\u05d5\u05ea (\u05d1\u05e8\u05de\u05d4 \u05d4\u05d0\u05d6\u05d5\u05e8\u05d9\u05ea), \u05db\u05e4\u05d9 \u05e9\u05d1\u05d0 \u05dc\u05d9\u05d3\u05d9 \u05d1\u05d9\u05d8\u05d5\u05d9 \u05d1\u05e4\u05e2\u05d9\u05dc\u05d5\u05ea\u05dd \u05e9\u05dc \u05d4\u05d7\u05d5\u05ea'\u05d9\u05dd (\u05d1\u05ea\u05d9\u05de\u05df) \u05d5\u05d7\u05dc\u05e7 \u05de\u05d4\u05de\u05d9\u05dc\u05d9\u05e6\u05d9\u05d5\u05ea \u05d4\u05e2\u05d9\u05e8\u05d0\u05e7\u05d9\u05d5\u05ea (\u05d2\u05dd) \u05dc\u05d0\u05d7\u05e8 \u05d4\u05d4\u05e4\u05e6\u05e6\u05d5\u05ea \u05d4\u05d0\u05de\u05e8\u05d9\u05e7\u05d0\u05d9\u05d5\u05ea.\u05e8\u05e7 \u05ea\u05e7\u05d9\u05e4\u05d5\u05ea \u05e8\u05e6\u05d9\u05e0\u05d9\u05d5\u05ea \u05d9\u05d5\u05ea\u05e8, \u05db\u05d0\u05dc\u05d4 \u05e9\u05d9\u05e2\u05de\u05d9\u05d3\u05d5 \u05d1\u05de\u05d1\u05d7\u05df \u05d0\u05ea \u05d4\u05d9\u05d5\u05e7\u05e8\u05d4 \u05d4\u05d0\u05d9\u05e8\u05d0\u05e0\u05d9\u05ea \u05d4\u05d9\u05e9\u05d9\u05e8\u05d4, \u05d9\u05d5\u05db\u05dc\u05d5 \u05dc\u05d4\u05e8\u05ea\u05d9\u05e2 \u05d0\u05ea \u05d0\u05d9\u05e8\u05d0\u05df \u05d5\u05dc\u05e2\u05d5\u05d3\u05d3 \u05d0\u05ea \u05d1\u05e2\u05dc\u05d9-\u05d4\u05d1\u05e8\u05d9\u05ea (\u05d4\u05d0\u05d6\u05d5\u05e8\u05d9\u05d9\u05dd) \u05dc\u05d4\u05ea\u05d9\u05d9\u05e6\u05d1 \u05dc\u05e6\u05d9\u05d3\u05d4 \u05e9\u05dc \u05d0\u05e8\u05d4\"\u05d1. \u05db\u05dc \u05d3\u05d1\u05e8 \u05d0\u05d7\u05e8 \u05de\u05dc\u05d1\u05d3 \u05d6\u05d0\u05ea, \u05d4\u05d5\u05d0 \u05d1\u05d2\u05d3\u05e8 \u05de\u05ea\u05db\u05d5\u05df \u05de\u05d5\u05d1\u05d8\u05d7 \u05dc\u05d0\u05d9-\u05d9\u05e6\u05d9\u05d1\u05d5\u05ea \u05d5\u05dc\u05d4\u05e2\u05dc\u05d0\u05ea \u05d3\u05e8\u05d2\u05d5\u05ea \u05d4\u05d4\u05e1\u05dc\u05de\u05d4, \u05d2\u05dd \u05d0\u05dd \u05d4\u05db\u05d5\u05d5\u05e0\u05d4 \u05d4\u05d9\u05d0 \u05dc\u05d4\u05d9\u05e4\u05da \u05d4\u05d2\u05de\u05d5\u05e8.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,549,"\u05ea\u05e8\u05d7\u05d9\u05e9 \u05d6\u05d4 \u05de\u05de\u05d7\u05d9\u05e9 \u05d0\u05ea \u05d4\u05de\u05d5\u05e8\u05db\u05d1\u05d5\u05ea \u05e9\u05dc \u05de\u05dc\u05d7\u05de\u05ea \u05d4\u05e4\u05e8\u05d5\u05e7\u05e1\u05d9 \u05e9\u05d0\u05d9\u05e8\u05d0\u05df \u05de\u05e0\u05d4\u05dc\u05ea, \u05d1\u05d4 \u05d0\u05d7\u05e8\u05d9\u05d5\u05ea\u05d4 \u05d4\u05d9\u05e9\u05d9\u05e8\u05d4 \u05de\u05d5\u05e1\u05ea\u05e8\u05ea \u05d1\u05db\u05d5\u05d5\u05e0\u05ea \u05de\u05db\u05d5\u05d5\u05df. \u05e8\u05d0\u05d5\u05d9 \u05dc\u05e6\u05d9\u05d9\u05df \u05db\u05d9 \u05d4\u05d0\u05e1\u05d8\u05e8\u05d8\u05d2\u05d9\u05d4 \u05d4\u05d6\u05d5 \u05e9\u05dc \u05d0\u05d9\u05e8\u05d0\u05df \u05dc\u05d0 \u05de\u05db\u05d5\u05d5\u05e0\u05ea \u05e8\u05e7 \u05dc\u05e9\u05de\u05d9\u05e8\u05d4 \u05e2\u05dc \u05de\u05e8\u05d7\u05d1 \u05d4\u05db\u05d7\u05e9\u05d4 \u05e1\u05d1\u05d9\u05e8, \u05d0\u05dc\u05d0 \u05d0\u05e3 \u05dc\u05d4\u05d7\u05e6\u05e0\u05ea \u05ea\u05d3\u05de\u05d9\u05ea \u05de\u05d0\u05d5\u05e4\u05e7\u05ea \u05d5\u05e8\u05e6\u05d9\u05d5\u05e0\u05dc\u05d9\u05ea \u05dc\u05de\u05d5\u05dc \u05de\u05d4 \u05e9\u05d4\u05d9\u05d0 \u05de\u05ea\u05d0\u05e8\u05ea \u05db\u05d4\u05ea\u05e0\u05d4\u05d2\u05d5\u05ea \u05d0\u05de\u05e8\u05d9\u05e7\u05d0\u05d9\u05ea \u05e2\u05d5\u05d9\u05e0\u05ea. \u05d0\u05d9\u05df \u05d6\u05d4 \u05e1\u05d5\u05d3 \u05e9\u05dc\u05e0\u05e8\u05d8\u05d9\u05d1 \u05de\u05df \u05d4\u05e1\u05d5\u05d2 \u05d4\u05d6\u05d4 \u05d9\u05e9 \u05d4\u05d3\u05d9\u05dd \u05e8\u05d1\u05d9\u05dd \u05d1\u05d4\u05e7\u05e9\u05e8 \u05d4\u05d2\u05dc\u05d5\u05d1\u05dc\u05d9 (\u05d4\u05e0\u05d5\u05db\u05d7\u05d9) \u05e9\u05d1\u05d5 \u05de\u05ea\u05d2\u05d1\u05e8\u05ea \u05d4\u05e1\u05e4\u05e7\u05e0\u05d5\u05ea \u05db\u05dc\u05e4\u05d9 \u05d4\u05d4\u05e6\u05d3\u05e7\u05d5\u05ea \u05d5\u05d4\u05dc\u05d2\u05d9\u05d8\u05d9\u05de\u05d9\u05d5\u05ea \u05e9\u05dc \u05d4\u05de\u05e2\u05d5\u05e8\u05d1\u05d5\u05ea \u05d4\u05e6\u05d1\u05d0\u05d9\u05ea \u05d4\u05d0\u05de\u05e8\u05d9\u05e7\u05d0\u05d9\u05ea \u05d1\u05d6\u05d9\u05e8\u05d4 \u05d4\u05d1\u05d9\u05e0\u05dc\u05d0\u05d5\u05de\u05d9\u05ea.\u05d4\u05ea\u05d2\u05d5\u05d1\u05d4 \u05d4\u05d0\u05de\u05e8\u05d9\u05e7\u05d0\u05d9\u05ea \u05d4\u05d7\u05d9\u05d5\u05d5\u05e8\u05ea \u05e2\u05dc \u05d4\u05d7\u05e1\u05d5\u05ea \u05d4\u05d9\u05e9\u05d9\u05e8\u05d4 \u05e9\u05d0\u05d9\u05e8\u05d0\u05df \u05de\u05e1\u05e4\u05e7\u05ea \u05dc\u05ea\u05e7\u05d9\u05e4\u05d5\u05ea \u05e9\u05dc \u05e9\u05dc\u05d5\u05d7\u05d9\u05d4 (\u05db\u05e0\u05d2\u05d3 \u05d0\u05d9\u05e0\u05d8\u05e8\u05e1\u05d9\u05dd \u05d0\u05de\u05e8\u05d9\u05e7\u05d0\u05d9\u05d9\u05dd \u05d1\u05d0\u05d6\u05d5\u05e8), \u05de\u05e2\u05d9\u05d3\u05d4 \u05e2\u05dc \u05db\u05d9\u05e9\u05dc\u05d5\u05df \u05d7\u05de\u05d5\u05e8 \u05d1\u05d4\u05d1\u05e0\u05ea \u05d4\u05ea\u05e0\u05d4\u05d2\u05d5\u05ea\u05d4 \u05e9\u05dc \u05d0\u05d9\u05e8\u05d0\u05df \u05d4\u05de\u05d5\u05e0\u05e2\u05ea \u05de\u05e9\u05d0\u05d9\u05e4\u05d5\u05ea\u05d9\u05d4 \u05dc\u05d4\u05d2\u05de\u05d5\u05e0\u05d9\u05d4 \u05d0\u05d6\u05d5\u05e8\u05d9\u05ea \u05d5\u05d4\u05e9\u05e4\u05e2\u05d4 \u05d0\u05d9\u05d3\u05d9\u05d0\u05d5\u05dc\u05d5\u05d2\u05d9\u05ea, \u05d5\u05de\u05de\u05d7\u05d5\u05d9\u05d1\u05d5\u05ea\u05d4 \u05dc\u05e7\u05d9\u05d3\u05d5\u05dd \u05d4\u05d0\u05d9\u05e0\u05d8\u05e8\u05e1\u05d9\u05dd \u05e9\u05dc\u05d4 \u05d1\u05de\u05e7\u05d1\u05d9\u05dc \u05dc\u05e6\u05de\u05e6\u05d5\u05dd \u05d4\u05e1\u05db\u05e0\u05d4 \u05d1\u05e2\u05d9\u05de\u05d5\u05ea \u05d9\u05e9\u05d9\u05e8 \u05e2\u05dd \u05d0\u05e8\u05d4\"\u05d1.\u05d1\u05e1\u05d5\u05e4\u05d5 \u05e9\u05dc \u05d3\u05d1\u05e8, \u05d0\u05e8\u05d4\"\u05d1 \u05dc\u05d0 \u05e8\u05e7 \u05e0\u05ea\u05e0\u05d4 \u05dc\u05d0\u05d9\u05e8\u05d0\u05df \u05d0\u05ea \u05e9\u05d4\u05d9\u05d0 \u05d7\u05e4\u05e6\u05d4 \u05d1\u05d5, \u05d0\u05dc\u05d0 \u05d0\u05e3 \u05e2\u05d5\u05d3\u05d3\u05d4 \u05d0\u05d5\u05ea\u05d4 \u05dc\u05d4\u05de\u05e9\u05d9\u05da \u05e2\u05dd \u05d4\u05d4\u05ea\u05d2\u05e8\u05d5\u05d9\u05d5\u05ea (\u05d1\u05e8\u05de\u05d4 \u05d4\u05d0\u05d6\u05d5\u05e8\u05d9\u05ea), \u05db\u05e4\u05d9 \u05e9\u05d1\u05d0 \u05dc\u05d9\u05d3\u05d9 \u05d1\u05d9\u05d8\u05d5\u05d9 \u05d1\u05e4\u05e2\u05d9\u05dc\u05d5\u05ea\u05dd \u05e9\u05dc \u05d4\u05d7\u05d5\u05ea'\u05d9\u05dd (\u05d1\u05ea\u05d9\u05de\u05df) \u05d5\u05d7\u05dc\u05e7 \u05de\u05d4\u05de\u05d9\u05dc\u05d9\u05e6\u05d9\u05d5\u05ea \u05d4\u05e2\u05d9\u05e8\u05d0\u05e7\u05d9\u05d5\u05ea (\u05d2\u05dd) \u05dc\u05d0\u05d7\u05e8 \u05d4\u05d4\u05e4\u05e6\u05e6\u05d5\u05ea \u05d4\u05d0\u05de\u05e8\u05d9\u05e7\u05d0\u05d9\u05d5\u05ea.\u05e8\u05e7 \u05ea\u05e7\u05d9\u05e4\u05d5\u05ea \u05e8\u05e6\u05d9\u05e0\u05d9\u05d5\u05ea \u05d9\u05d5\u05ea\u05e8, \u05db\u05d0\u05dc\u05d4 \u05e9\u05d9\u05e2\u05de\u05d9\u05d3\u05d5 \u05d1\u05de\u05d1\u05d7\u05df \u05d0\u05ea \u05d4\u05d9\u05d5\u05e7\u05e8\u05d4 \u05d4\u05d0\u05d9\u05e8\u05d0\u05e0\u05d9\u05ea \u05d4\u05d9\u05e9\u05d9\u05e8\u05d4, \u05d9\u05d5\u05db\u05dc\u05d5 \u05dc\u05d4\u05e8\u05ea\u05d9\u05e2 \u05d0\u05ea \u05d0\u05d9\u05e8\u05d0\u05df \u05d5\u05dc\u05e2\u05d5\u05d3\u05d3 \u05d0\u05ea \u05d1\u05e2\u05dc\u05d9-\u05d4\u05d1\u05e8\u05d9\u05ea (\u05d4\u05d0\u05d6\u05d5\u05e8\u05d9\u05d9\u05dd) \u05dc\u05d4\u05ea\u05d9\u05d9\u05e6\u05d1 \u05dc\u05e6\u05d9\u05d3\u05d4 \u05e9\u05dc \u05d0\u05e8\u05d4\"\u05d1. \u05db\u05dc \u05d3\u05d1\u05e8 \u05d0\u05d7\u05e8 \u05de\u05dc\u05d1\u05d3 \u05d6\u05d0\u05ea, \u05d4\u05d5\u05d0 \u05d1\u05d2\u05d3\u05e8 \u05de\u05ea\u05db\u05d5\u05df \u05de\u05d5\u05d1\u05d8\u05d7 \u05dc\u05d0\u05d9-\u05d9\u05e6\u05d9\u05d1\u05d5\u05ea \u05d5\u05dc\u05d4\u05e2\u05dc\u05d0\u05ea \u05d3\u05e8\u05d2\u05d5\u05ea \u05d4\u05d4\u05e1\u05dc\u05de\u05d4, \u05d2\u05dd \u05d0\u05dd \u05d4\u05db\u05d5\u05d5\u05e0\u05d4 \u05d4\u05d9\u05d0 \u05dc\u05d4\u05d9\u05e4\u05da \u05d4\u05d2\u05de\u05d5\u05e8.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05d0\u05e1\u05e3 \u05e8\u05d5\u05d6\u05e0\u05e6\u05d5\u05d9\u05d9\u05d2\u05e0\u05d9\u05e7\u05d9 \u05d4\u05d9\u05d9\u05dc\u05d9 \u05d4\u05dc\u05d9\u05dc\u05d4 \u05d1\u05e2\u05d9\u05de\u05d5\u05ea \u05d4\u05e8\u05e4\u05d5\u05d1\u05dc\u05d9\u05e7\u05e0\u05d9 \u05dc\u05e7\u05e8\u05d0\u05ea \u05d1\u05d7\u05d9\u05e8\u05d5\u05ea 2024: \u05e2\u05dc\u05d9\u05e0\u05d5 \u05dc\u05d0\u05e1\u05d5\u05e8 \u05d0\u05ea \u05d4\u05e9\u05d9\u05de\u05d5\u05e9 \u05d1\u05d8\u05d9\u05e7\u05d8\u05d5\u05e7 \u05de\u05db\u05d9\u05d5\u05d5\u05df \u05e9\u05e2\u05dc \u05db\u05dc 30 \u05d3\u05e7\u05d5\u05ea \u05e9\u05d0\u05d3\u05dd \u05e6\u05d5\u05e4\u05d4 \u05d1\u05d8\u05d9\u05e7\u05d8\u05d5\u05e7 \u05d4\u05d5\u05d0 \u05d4\u05d5\u05e4\u05da \u05dc\u05d4\u05d9\u05d5\u05ea 17% \u05d9\u05d5\u05ea\u05e8 \u05d0\u05e0\u05d8\u05d9\u05e9\u05de\u05d9 \u05d5\u05e4\u05e8\u05d5-\u05d7\u05de\u05d0\u05e1@N12chat",false,550,"\u05d0\u05e1\u05e3 \u05e8\u05d5\u05d6\u05e0\u05e6\u05d5\u05d9\u05d9\u05d2\u05e0\u05d9\u05e7\u05d9 \u05d4\u05d9\u05d9\u05dc\u05d9 \u05d4\u05dc\u05d9\u05dc\u05d4 \u05d1\u05e2\u05d9\u05de\u05d5\u05ea \u05d4\u05e8\u05e4\u05d5\u05d1\u05dc\u05d9\u05e7\u05e0\u05d9 \u05dc\u05e7\u05e8\u05d0\u05ea \u05d1\u05d7\u05d9\u05e8\u05d5\u05ea 2024: \u05e2\u05dc\u05d9\u05e0\u05d5 \u05dc\u05d0\u05e1\u05d5\u05e8 \u05d0\u05ea \u05d4\u05e9\u05d9\u05de\u05d5\u05e9 \u05d1\u05d8\u05d9\u05e7\u05d8\u05d5\u05e7 \u05de\u05db\u05d9\u05d5\u05d5\u05df \u05e9\u05e2\u05dc \u05db\u05dc 30 \u05d3\u05e7\u05d5\u05ea \u05e9\u05d0\u05d3\u05dd \u05e6\u05d5\u05e4\u05d4 \u05d1\u05d8\u05d9\u05e7\u05d8\u05d5\u05e7 \u05d4\u05d5\u05d0 \u05d4\u05d5\u05e4\u05da \u05dc\u05d4\u05d9\u05d5\u05ea 17% \u05d9\u05d5\u05ea\u05e8 \u05d0\u05e0\u05d8\u05d9\u05e9\u05de\u05d9 \u05d5\u05e4\u05e8\u05d5-\u05d7\u05de\u05d0\u05e1@N12chat"],["\u05d0\u05d5\u05e8 \u05e8\u05d1\u05d9\u05d3\u05d0\u05d3\u05dd \u05e0\u05e2\u05e6\u05e8 \u05d1\u05d7\u05e9\u05d3 \u05e9\u05d4\u05e9\u05dc\u05d9\u05da \u05e8\u05d9\u05de\u05d5\u05df \u05e8\u05e1\u05e1 \u05dc\u05e2\u05d1\u05e8 \u05de\u05d2\u05e8\u05e9 \u05dc\u05e1\u05d7\u05e8 \u05d1\u05de\u05db\u05d5\u05e0\u05d9\u05d5\u05ea \u05d1\u05e0\u05ea\u05e0\u05d9\u05d4 - \u05d4\u05d9\u05d5\u05dd \u05d9\u05d5\u05d2\u05e9 \u05e0\u05d2\u05d3\u05d5 \u05db\u05ea\u05d1 \u05d0\u05d9\u05e9\u05d5\u05dd@N12chat",false,551,"\u05d0\u05d5\u05e8 \u05e8\u05d1\u05d9\u05d3\u05d0\u05d3\u05dd \u05e0\u05e2\u05e6\u05e8 \u05d1\u05d7\u05e9\u05d3 \u05e9\u05d4\u05e9\u05dc\u05d9\u05da \u05e8\u05d9\u05de\u05d5\u05df \u05e8\u05e1\u05e1 \u05dc\u05e2\u05d1\u05e8 \u05de\u05d2\u05e8\u05e9 \u05dc\u05e1\u05d7\u05e8 \u05d1\u05de\u05db\u05d5\u05e0\u05d9\u05d5\u05ea \u05d1\u05e0\u05ea\u05e0\u05d9\u05d4 - \u05d4\u05d9\u05d5\u05dd \u05d9\u05d5\u05d2\u05e9 \u05e0\u05d2\u05d3\u05d5 \u05db\u05ea\u05d1 \u05d0\u05d9\u05e9\u05d5\u05dd@N12chat"],["\u05ea\u05de\u05d5\u05e0\u05d5\u05ea \u05de\u05e4\u05dc\u05d9\u05dc\u05d5\u05ea \u05e0\u05d5\u05e1\u05e4\u05d5\u05ea \u05de\u05ea\u05d5\u05da \u05d1\u05d9\u05ea \u05d4\u05d7\u05d5\u05dc\u05d9\u05dd \u05e9\u05e4\u05d0\u05d0 \u05d1 7.10. (\u05e8\u05db\u05d1\u05d9\u05dd \u05e6\u05d1\u05d0\u05d9\u05d9\u05dd \u05e9\u05dc \u05e6\u05d4\"\u05dc \u05d5\u05d7\u05de\u05d5\u05e9\u05d9\u05dd \u05e9\u05dc \u05d7\u05de\u05d0\u05e1)",false,552,"\u05ea\u05de\u05d5\u05e0\u05d5\u05ea \u05de\u05e4\u05dc\u05d9\u05dc\u05d5\u05ea \u05e0\u05d5\u05e1\u05e4\u05d5\u05ea \u05de\u05ea\u05d5\u05da \u05d1\u05d9\u05ea \u05d4\u05d7\u05d5\u05dc\u05d9\u05dd \u05e9\u05e4\u05d0\u05d0 \u05d1 7.10. (\u05e8\u05db\u05d1\u05d9\u05dd \u05e6\u05d1\u05d0\u05d9\u05d9\u05dd \u05e9\u05dc \u05e6\u05d4\"\u05dc \u05d5\u05d7\u05de\u05d5\u05e9\u05d9\u05dd \u05e9\u05dc \u05d7\u05de\u05d0\u05e1)"],["\u05e0\u05d5\u05e2\u05dd \u05db\u05d4\u05df\u05e2\u05d5\u05d3 \u05d1\u05d8\u05e8\u05dd \u05e0\u05d1\u05d7\u05e8 \u05d4\u05e9\u05d9\u05e8, \u05d9\u05e9\u05e8\u05d0\u05dc \u05e2\u05dc\u d4\u05e0\u05de\u05e6\u05d0 \u05de\u05d5\u05dc \u05d4\u05d9\u05e9\u05d5\u05d1 \u05d9\u05e8\u05d0\u05d5\u05df \u05d4\u05d9\u05e9\u05e8\u05d0\u05dc\u05d9).\u05d2\u05d5\u05e8\u05de\u05d9\u05dd \u05dc\u05d1\u05e0\u05d5\u05e0\u05d9\u05d9\u05dd \u05de\u05e0\u05e1\u05d9\u05dd \u05dc\u05d8\u05e2\u05d5\u05df \u05d1\u05ea\u05d5\u05e7\u05e3 \u05e9\u05d4\u05e0\u05e4\u05d9\u05dc\u05d5\u05ea \u05d1\u05e6\u05d3 \u05d4\u05dc\u05d1\u05e0\u05d5\u05e0\u05d9 \u05e0\u05d2\u05de\u05e8\u05d5 \u05db\u05ea\u05d5\u05e6\u05d0\u05d4 \u05de\u05d4\u05d9\u05d9\u05e8\u05d5\u05d8 \u05e9\u05dc \u05db\u05d9\u05e4\u05ea \u05d1\u05e8\u05d6\u05dc.\u05d4\u05ea\u05de\u05d5\u05e0\u05d5\u05ea \u05de\u05e1\u05e4\u05e8\u05d5\u05ea \u05e1\u05d9\u05e4\u05d5\u05e8 \u05d0\u05d7\u05e8...\ud83d\ude01\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,555,"\u05d3\u05e8\u05d5\u05dd \u05dc\u05d1\u05e0\u05d5\u05df: \u05d1\u05e2\u05e7\u05d1\u05d5\u05ea \u05d9\u05e8\u05d9 \u05de\u05d8\u05d7 \u05e8\u05e7\u05d8\u05d5\u05ea \u05d4\u05e7\u05d8\u05d9\u05d5\u05e9\u05d4 \u05d4\u05d2\u05d3\u05d5\u05dc \u05d4\u05d1\u05d5\u05e7\u05e8 \u05e9\u05dc \u05d7\u05d6\u05d1\u05d0\u05dc\u05dc\u05d4 \u05dc\u05e2\u05d1\u05e8 \u05e6\u05e4\u05ea \u05e0\u05d2\u05e8\u05dd \u05e0\u05d6\u05e7 \u05dc\u05de\u05d1\u05e0\u05d9\u05dd \u05d1\u05db\u05e4\u05e8\u05d9\u05dd \u05e8\u05de\u05d9\u05e9, \u05e2\u05d9\u05df \u05d0\u05d1\u05dc \u05d5\u05d9\u05d0\u05e8\u05d5\u05df (\u05db\u05e4\u05e8 \u05d4\u05e0\u05de\u05e6\u05d0 \u05de\u05d5\u05dc \u05d4\u05d9\u05e9\u05d5\u05d1 \u05d9\u05e8\u05d0\u05d5\u05df \u05d4\u05d9\u05e9\u05e8\u05d0\u05dc\u05d9).\u05d2\u05d5\u05e8\u05de\u05d9\u05dd \u05dc\u05d1\u05e0\u05d5\u05e0\u05d9\u05d9\u05dd \u05de\u05e0\u05e1\u05d9\u05dd \u05dc\u05d8\u05e2\u05d5\u05df \u05d1\u05ea\u05d5\u05e7\u05e3 \u05e9\u05d4\u05e0\u05e4\u05d9\u05dc\u05d5\u05ea \u05d1\u05e6\u05d3 \u05d4\u05dc\u05d1\u05e0\u05d5\u05e0\u05d9 \u05e0\u05d2\u05de\u05e8\u05d5 \u05db\u05ea\u05d5\u05e6\u05d0\u05d4 \u05de\u05d4\u05d9\u05d9\u05e8\u05d5\u05d8 \u05e9\u05dc \u05db\u05d9\u05e4\u05ea \u05d1\u05e8\u05d6\u05dc.\u05d4\u05ea\u05de\u05d5\u05e0\u05d5\u05ea \u05de\u05e1\u05e4\u05e8\u05d5\u05ea \u05e1\u05d9\u05e4\u05d5\u05e8 \u05d0\u05d7\u05e8...\ud83d\ude01\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05e1\u05e4\u05d9\u05e8 \u05dc\u05d9\u05e4\u05e7\u05d9\u05df\u05e2\u05dc \u05e4\u05d9 \u05d4\u05d3\u05d9\u05d5\u05d5\u05d7, \u05d6\u05d5 \u05d4\u05e4\u05e2\u05dd \u05d4\u05e9\u05e0\u05d9\u05d9\u05d4 \u05e9\u05d4\u05d5\u05d0 \u05e9\u05d5\u05e8\u05d3 \u05e0\u05d9\u05e1\u05d9\u05d5\u05df \u05d4\u05ea\u05e0\u05e7\u05e9\u05d5\u05ea. \u05d4\u05d5\u05d0 \u05d1\u05db\u05d9\u05e8 \u05d1\u05d7\u05d9\u05d6\u05d1\u05d0\u05dc\u05dc\u05d4 \u05d5\u05d7\u05d1\u05e8 \u05d1\u05de\u05d5\u05e2\u05e6\u05ea \u05d4\u05d2'\u05d9\u05d4\u05d0\u05d3@N12chat",false,556,"\u05e1\u05e4\u05d9\u05e8 \u05dc\u05d9\u05e4\u05e7\u05d9\u05df\u05e2\u05dc \u05e4\u05d9 \u05d4\u05d3\u05d9\u05d5\u05d5\u05d7, \u05d6\u05d5 \u05d4\u05e4\u05e2\u05dd \u05d4\u05e9\u05e0\u05d9\u05d9\u05d4 \u05e9\u05d4\u05d5\u05d0 \u05e9\u05d5\u05e8\u05d3 \u05e0\u05d9\u05e1\u05d9\u05d5\u05df \u05d4\u05ea\u05e0\u05e7\u05e9\u05d5\u05ea. \u05d4\u05d5\u05d0 \u05d1\u05db\u05d9\u05e8 \u05d1\u05d7\u05d9\u05d6\u05d1\u05d0\u05dc\u05dc\u05d4 \u05d5\u05d7\u05d1\u05e8 \u05d1\u05de\u05d5\u05e2\u05e6\u05ea \u05d4\u05d2'\u05d9\u05d4\u05d0\u05d3@N12chat"],["\u05de\u05d1\u05d6\u05e7\u05df 12\u05d1\u05df \u05d2\u05d1\u05d9\u05e8 \u05e2\u05d5\u05e0\u05d4 \u05dc\u05d0\u05d5\u05dc\u05de\u05e8\u05d8: \"\u05d4\u05d9\u05d4 \u05e8\u05d0\u05e9 \u05de\u05de\u05e9\u05dc\u05d4 \u05db\u05d5\u05e9\u05dc \u05d5\u05e2\u05db\u05e9\u05d9\u05d5 \u05d0\u05d6\u05e8\u05d7 \u05db\u05d5\u05e9\u05dc - \u05db\u05ea\u05dd \u05d1\u05e8\u05e9\u05d9\u05de\u05ea \u05e8\u05d0\u05e9\u05d9 \u05d4\u05de\u05de\u05e9\u05dc\u05d4 \u05e9\u05dc\u05e0\u05d5\"@N12chat",false,557,"\u05de\u05d1\u05d6\u05e7\u05df 12\u05d1\u05df \u05d2\u05d1\u05d9\u05e8 \u05e2\u05d5\u05e0\u05d4 \u05dc\u05d0\u05d5\u05dc\u05de\u05e8\u05d8: \"\u05d4\u05d9\u05d4 \u05e8\u05d0\u05e9 \u05de\u05de\u05e9\u05dc\u05d4 \u05db\u05d5\u05e9\u05dc \u05d5\u05e2\u05db\u05e9\u05d9\u05d5 \u05d0\u05d6\u05e8\u05d7 \u05db\u05d5\u05e9\u05dc - \u05db\u05ea\u05dd \u05d1\u05e8\u05e9\u05d9\u05de\u05ea \u05e8\u05d0\u05e9\u05d9 \u05d4\u05de\u05de\u05e9\u05dc\u05d4 \u05e9\u05dc\u05e0\u05d5\"@N12chat"],["\u05d2\u05dd \u05d1\u05d1\u05d9\u05ea \u05d4\u05d7\u05d5\u05dc\u05d9\u05dd \u05e0\u05d0\u05e6\u05e8 \u05d1\u05d0\u05d6\u05d5\u05e8 \u05d1\u05d8\u05df \u05d0-\u05e1\u05de\u05d9\u05df \u05d1\u05de\u05e2\u05e8\u05d1 \u05d7'\u05d0\u05df \u05d9\u05d5\u05e0\u05e1, \u05e0\u05e8\u05e9\u05de\u05ea \"\u05d4\u05ea\u05d0\u05e8\u05d2\u05e0\u05d5\u05ea\" \u05dc\u05e7\u05e8\u05d0\u05ea \u05d4\u05d4\u05ea\u05e4\u05e0\u05d5\u05ea \u05de\u05d4\u05de\u05ea\u05d7\u05dd \u05d5\u05d4\u05d9\u05e6\u05d9\u05d0\u05d4 \u05d3\u05e8\u05d5\u05de\u05d4 \u05dc\u05e8\u05e4\u05d9\u05d7.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,558,"\u05d2\u05dd \u05d1\u05d1\u05d9\u05ea \u05d4\u05d7\u05d5\u05dc\u05d9\u05dd \u05e0\u05d0\u05e6\u05e8 \u05d1\u05d0\u05d6\u05d5\u05e8 \u05d1\u05d8\u05df \u05d0-\u05e1\u05de\u05d9\u05df \u05d1\u05de\u05e2\u05e8\u05d1 \u05d7'\u05d0\u05df \u05d9\u05d5\u05e0\u05e1, \u05e0\u05e8\u05e9\u05de\u05ea \"\u05d4\u05ea\u05d0\u05e8\u05d2\u05e0\u05d5\u05ea\" \u05dc\u05e7\u05e8\u05d0\u05ea \u05d4\u05d4\u05ea\u05e4\u05e0\u05d5\u05ea \u05de\u05d4\u05de\u05ea\u05d7\u05dd \u05d5\u05d4\u05d9\u05e6\u05d9\u05d0\u05d4 \u05d3\u05e8\u05d5\u05de\u05d4 \u05dc\u05e8\u05e4\u05d9\u05d7.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05de\u05d1\u05d6\u05e7\u05df 12\ud83d\udcdd41% \u05de\u05d1\u05e2\u05dc\u05d9 \u05d6\u05db\u05d5\u05ea \u05d4\u05d1\u05d7\u05d9\u05e8\u05d4 \u05d4\u05e6\u05d1\u05d9\u05e2\u05d5 \u05e2\u05d3 \u05d4\u05e9\u05e2\u05d4 19:00, \u05dc\u05e2\u05d5\u05de\u05ea 49% \u05d1-2018@N12chat",false,559,"\u05de\u05d1\u05d6\u05e7\u05df 12\ud83d\udcdd41% \u05de\u05d1\u05e2\u05dc\u05d9 \u05d6\u05db\u05d5\u05ea \u05d4\u05d1\u05d7\u05d9\u05e8\u05d4 \u05d4\u05e6\u05d1\u05d9\u05e2\u05d5 \u05e2\u05d3 \u05d4\u05e9\u05e2\u05d4 19:00, \u05dc\u05e2\u05d5\u05de\u05ea 49% \u05d1-2018@N12chat"],["\u05d4\u05e2\u05e8\u05d5\u05e6\u05d9\u05dd \u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd \u05de\u05ea\u05e2\u05d3\u05d9\u05dd \u05d1\u05d4\u05e8\u05d7\u05d1\u05d4 (\u05d5\u05d1\u05e9\u05de\u05d7\u05d4) \u05d0\u05ea \u05d4\u05de\u05ea\u05e8\u05d7\u05e9 \u05d1\u05ea\u05dc \u05d0\u05d1\u05d9\u05d1.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,560,"\u05d4\u05e2\u05e8\u05d5\u05e6\u05d9\u05dd \u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd \u05de\u05ea\u05e2\u05d3\u05d9\u05dd \u05d1\u05d4\u05e8\u05d7\u05d1\u05d4 (\u05d5\u05d1\u05e9\u05de\u05d7\u05d4) \u05d0\u05ea \u05d4\u05de\u05ea\u05e8\u05d7\u05e9 \u05d1\u05ea\u05dc \u05d0\u05d1\u05d9\u05d1.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05de\u05d1\u05d6\u05e7\u05df 12\u05db\u05ea\u05d1 \u05d0\u05d9\u05e9\u05d5\u05dd \u05d4\u05d5\u05d2\u05e9 \u05e0\u05d2\u05d3 \u05de\u05d0\u05d5\u05e8 \u05d8\u05dc\u05e7\u05e8 (23) \u05d5\u05d0\u05d5\u05e9\u05e8 \u05d6\u05e8\u05d7 (30) \u05de\u05d3\u05d9\u05de\u05d5\u05e0\u05d4 \u05dc\u05d0\u05d7\u05e8 \u05e9\u05d1\u05d2\u05d9\u05df \u05d7\u05d5\u05d1 \u05d1\u05e1\u05da 500 \u05e9\u05e7\u05dc\u05d9\u05dd \u05e2\u05dc \u05e8\u05db\u05d9\u05e9\u05ea \u05e7\u05e0\u05d0\u05d1\u05d9\u05e1 \u05ea\u05e7\u05e4\u05d5 \u05d0\u05ea \u05d1\u05e2\u05dc \u05d4\u05d7\u05d5\u05d1 \u05d5\u05d5\u05dc\u05d9\u05d3 \u05d0\u05dc\u05d0\u05d1\u05d6 \u05d5\u05d0\u05d9\u05d9\u05de\u05d5 \u05e2\u05dc\u05d9\u05d5 \u05d5\u05e2\u05dc \u05d0\u05d9\u05de\u05d5@N12chat",false,561,"\u05de\u05d1\u05d6\u05e7\u05df 12\u05db\u05ea\u05d1 \u05d0\u05d9\u05e9\u05d5\u05dd \u05d4\u05d5\u05d2\u05e9 \u05e0\u05d2\u05d3 \u05de\u05d0\u05d5\u05e8 \u05d8\u05dc\u05e7\u05e8 (23) \u05d5\u05d0\u05d5\u05e9\u05e8 \u05d6\u05e8\u05d7 (30) \u05de\u05d3\u05d9\u05de\u05d5\u05e0\u05d4 \u05dc\u05d0\u05d7\u05e8 \u05e9\u05d1\u05d2\u05d9\u05df \u05d7\u05d5\u05d1 \u05d1\u05e1\u05da 500 \u05e9\u05e7\u05dc\u05d9\u05dd \u05e2\u05dc \u05e8\u05db\u05d9\u05e9\u05ea \u05e7\u05e0\u05d0\u05d1\u05d9\u05e1 \u05ea\u05e7\u05e4\u05d5 \u05d0\u05ea \u05d1\u05e2\u05dc \u05d4\u05d7\u05d5\u05d1 \u05d5\u05d5\u05dc\u05d9\u05d3 \u05d0\u05dc\u05d0\u05d1\u05d6 \u05d5\u05d0\u05d9\u05d9\u05de\u05d5 \u05e2\u05dc\u05d9\u05d5 \u05d5\u05e2\u05dc \u05d0\u05d9\u05de\u05d5@N12chat"],["\"\u05de\u05d1\u05d7\u05df \u05e9\u05d9\u05e8\u05d9\u05df \u05d0\u05d1\u05d5 \u05e2\u05d0\u05e7\u05dc\u05d4\": \u05e2\u05d9\u05ea\u05d5\u05e0\u05d0\u05d9\u05ea \u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05ea \u05e0\u05d4\u05e8\u05d2\u05d4 \u05d0\u05de\u05e9 \u05de\u05d9\u05e8\u05d9 \u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9 \u05d1\u05d2'\u05e0\u05d9\u05df\u05d4\u05e2\u05d9\u05ea\u05d5\u05e0\u05d0\u05d9\u05ea \u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05ea \u05e9\u05d3'\u05d0 \u05e6\u05d1\u05d0\u05e2' \u05e0\u05d4\u05e8\u05d2\u05d4 \u05d0\u05ea\u05de\u05d5\u05dc \u05de\u05d9\u05e8\u05d9 \u05d1\u05e8\u05d0\u05e9 \u05d1\u05e8\u05d7\u05d5\u05d1 \u05de\u05d4\u05d9\u05d5\u05d1 \u05d1\u05de\u05d7\u05e0\u05d4 \u05d4\u05e4\u05dc\u05d9\u05d8\u05d9\u05dd \u05d2'\u05e0\u05d9\u05df, \u05e9\u05dd \u05e4\u05d5\u05e2\u05dc\u05d9\u05dd \u05de\u05d6\u05d4 \u05db\u05e9\u05dc\u05d5\u05e9\u05d4 \u05e9\u05d1\u05d5\u05e2\u05d5\u05ea \u05de\u05e0\u05d2\u05e0\u05d5\u05e0\u05d9 \u05d4\u05d1\u05d9\u05d8\u05d7\u05d5\u05df \u05e9\u05dc \u05d4\u05e8\u05e9\"\u05e4.\u05d2\u05e8\u05e1\u05ea \u05d4\u05e2\u05e8\u05d5\u05e6\u05d9\u05dd \u05de\u05d6\u05d5\u05d4\u05d9 \u05d7\u05de\u05d0\u05e1: \u05de\u05d3\u05d5\u05d1\u05e8 \u05d1\u05d9\u05e8\u05d9 \u05e6\u05dc\u05e3 \u05e9\u05dc \u05de\u05e0\u05d2\u05e0\u05d5\u05e0\u05d9 \u05d4\u05d1\u05d9\u05d8\u05d7\u05d5\u05df \u05e9\u05dc \u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd. \u05d6\u05d4 \u05de\u05e7\u05e8\u05d4 \u05e9\u05d9\u05e8\u05d9\u05df \u05d0\u05d1\u05d5 \u05e2\u05d0\u05e7\u05dc\u05d4 \u05de\u05e1\u05e4\u05e8 2 (\u05e9\u05d9\u05e8\u05d9\u05df \u05d0\u05d1\u05d5 \u05e2\u05d0\u05e7\u05dc\u05d4 \u05d4\u05d9\u05d0 \u05e2\u05d9\u05ea\u05d5\u05e0\u05d0\u05d9\u05ea \u05d0\u05dc\u05d2'\u05d6\u05d9\u05e8\u05d4 \u05e9\u05e0\u05d4\u05e8\u05d2\u05d4 \u05dc\u05e4\u05e0\u05d9 \u05db\u05e9\u05e0\u05ea\u05d9\u05d9\u05dd \u05d1\u05d2'\u05e0\u05d9\u05df \u05d5\u05de\u05d5\u05ea\u05d4 \u05e9\u05d9\u05de\u05e9 \u05db\u05dc\u05d9 \u05d9\u05e2\u05d9\u05dc \u05dc\u05e0\u05d9\u05d2\u05d5\u05d7 \u05d9\u05e9\u05e8\u05d0\u05dc \u05d1\u05e8\u05de\u05d4 \u05d4\u05d1\u05d9\u05e0\"\u05dc-\u05d0\"\u05e2).\u05d2\u05e8\u05e1\u05ea \u05de\u05e0\u05d2\u05e0\u05d5\u05e0\u05d9 \u05d4\u05d1\u05d9\u05d8\u05d7\u05d5\u05df \u05e9\u05dc \u05d4\u05e8\u05e9\"\u05e4:\u05dc\u05d0 \u05d4\u05d9\u05d5 \u05e9\u05dd \u05e4\u05e2\u05d9\u05dc\u05d9 \u05de\u05e0\u05d2\u05e0\u05d5\u05e0\u05d9\u05dd \u05d4\u05d9\u05d0 \u05e0\u05d4\u05e8\u05d2\u05d4 \u05de\u05d0\u05e9 \"\u05d4\u05e2\u05d1\u05e8\u05d9\u05d9\u05e0\u05d9\u05dd\" \u05e9\u05e0\u05d5\u05e9\u05d0\u05d9\u05dd \u05e0\u05e9\u05e7 \u05d1\u05dc\u05ea\u05d9 \u05d7\u05d5\u05e7\u05d9 \u05d5\u05d0\u05d9\u05e0\u05dd \u05de\u05d9\u05d5\u05de\u05e0\u05d9\u05dd \u05d1\u05d9\u05e8\u05d9.\u05e2\u05db\u05e9\u05d9\u05d5 \u05e0\u05d5\u05ea\u05e8 \u05dc\u05e8\u05d0\u05d5\u05ea \u05d0\u05dd \u05d4\u05e8\u05e9\"\u05e4 \u05ea\u05e2\u05d1\u05d5\u05e8 \u05d1\u05e8\u05de\u05d4 \u05d4\u05d1\u05d9\u05e0\"\u05dc \u05d0\u05ea \u05de\u05d4 \u05e9\u05d9\u05e9\u05e8\u05d0\u05dc \u05e2\u05d1\u05e8\u05d4 \u05dc\u05d0\u05d7\u05e8 \u05de\u05d5\u05ea\u05d4 \u05e9\u05dc \u05e9\u05d9\u05e8\u05d9\u05df \u05d0\u05d1\u05d5 \u05e2\u05d0\u05 u05d9\u05e6\u05e2 \u05d0\u05d7\u05d3 \u05de\u05d0\u05e0\u05e9\u05d9\u05d4 \u05dc\u05e2\u05d1\u05e8 \u05de\u05d1\u05e0\u05d4 \u05d1\u05d5 \u05e9\u05d4\u05d5 \u05dc\u05db\u05d0\u05d5\u05e8\u05d4 \u05d7\u05d9\u05d9\u05dc\u05d9 \u05e6\u05d4\"\u05dc. \u05dc\u05d0\u05d7\u05e8 \u05d4\u05d9\u05e8\u05d9 \u05e6\u05d5\u05e2\u05e7 \u05e4\u05e2\u05d9\u05dc \u05d7\u05de\u05d0\u05e1: \u05ea\u05df \u05e4\u05e8\u05e9\u05e0\u05d5\u05ea \u05d9\u05d0 \u05d3\u05d5\u05d5\u05d9\u05e8\u05d9!\u05e4\u05d0\u05d9\u05d6 \u05d0-\u05d3\u05d5\u05d5\u05d9\u05e8\u05d9, \u05d4\u05d5\u05d0 \u05d4\u05e4\u05e8\u05e9\u05df \u05d4\u05e6\u05d1\u05d0\u05d9 \u05d4\u05de\u05d5\u05d1\u05d9\u05dc \u05e9\u05dc \u05d0\u05dc\u05d2'\u05d6\u05d9\u05e8\u05d4 (\u05e7\u05e6\u05d9\u05df \u05d9\u05e8\u05d3\u05e0\u05d9 \u05d1\u05d3\u05d9\u05de\u05d5\u05e1) \u05d1\u05db\u05dc \u05d4\u05e7\u05e9\u05d5\u05e8 \u05dc\u05dc\u05d7\u05d9\u05de\u05d4 \u05d1\u05e2\u05d6\u05d4. \u05d4\u05d5\u05d0 \u05e0\u05d5\u05d8\u05d4 \u05d1\u05e4\u05e8\u05e9\u05e0\u05d5\u05ea\u05d5, \u05d1\u05d0\u05d5\u05e4\u05df \u05de\u05d5\u05d2\u05d6\u05dd \u05d1\u05de\u05d9\u05d5\u05d7\u05d3, \u05dc\u05ea\u05d0\u05e8 \u05d0\u05ea \u05d4\u05de\u05e6\u05d1 \u05db\u05d0\u05d9\u05dc\u05d5 \u05d7\u05de\u05d0\u05e1 \u05e2\u05d5\u05d3 \u05e8\u05d2\u05e2 \u05d1\u05e4\u05d0\u05ea\u05d9 \u05d9\u05e8\u05d5\u05e9\u05dc\u05d9\u05dd...\u05d4\u05e4\u05e8\u05e9\u05e0\u05d5\u05ea \u05e9\u05dc\u05d5 \u05d4\u05e4\u05db\u05d4 \u05dc\u05e9\u05dd \u05d3\u05d1\u05e8  \u05d1\u05d7\u05d5\u05d3\u05e9\u05d9\u05d9\u05dd \u05d4\u05d0\u05d7\u05e8\u05d5\u05e0\u05d9\u05dd: \u05ea\u05d5\u05de\u05db\u05d9 \u05d7\u05de\u05d0\u05e1 \u05de\u05e2\u05e8\u05d9\u05e6\u05d9\u05dd \u05d0\u05d5\u05ea\u05d5 \u05d5\u05de\u05ea\u05e0\u05d2\u05d3\u05d9 \u05d7\u05de\u05d0\u05e1 \u05dc\u05d5\u05e2\u05d2\u05d9\u05dd \u05dc\u05d5 \u05d1\u05d1\u05d5\u05d6 \u05e2\u05dc \u05db\u05da \u05e9\u05d4\u05d5\u05d0 \u05de\u05e9\u05e7\u05e8 \u05d5\u05de\u05e1\u05e4\u05e8 \u05d1\u05d3\u05d9\u05d5\u05ea \u05d1\u05e9\u05e2\u05d4 \u05e9\u05d4\u05d8\u05e0\u05e7\u05d9\u05dd \u05d4\u05d9\u05e9\u05e8\u05d0\u05dc\u05d9\u05dd \u05d1\u05dc\u05d1 \u05e2\u05d6\u05d4.\u05d0-\u05d3\u05d5\u05d5\u05d9\u05e8\u05d9 \u05d4\u05d5\u05d0 \u05d7\u05dc\u05e7 \u05de\u05de\u05e0\u05d2\u05e0\u05d5\u05df \u05e7\u05d9\u05d3\u05d5\u05dd \u05d4\u05d0\u05d2'\u05e0\u05d3\u05d4 \u05e9\u05dc \u05d7\u05de\u05d0\u05e1 \u05e2\u05dc \u05d9\u05d3\u05d9 \u05d0\u05dc\u05d2'\u05d6\u05d9\u05e8\u05d4 \u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d1\u05d9\u05e8 \u05d0\u05ea \u05d4\u05d0\u05d4\u05d3\u05d4 \u05dc\u05d7\u05de\u05d0\u05e1 \u05d1\u05e2\u05d5\u05dc\u05dd \u05d4\u05e2\u05e8\u05d1\u05d9 \u05d5\u05dc\u05d4\u05d0\u05d3\u05d9\u05e8 \u05d0\u05ea \u05d4\u05d9\u05e9\u05d2\u05d9\u05d4 (\u05d1\u05dc\u05d9 \u05e7\u05e9\u05e8 \u05dc\u05de\u05e6\u05d9\u05d0\u05d5\u05ea). \u05d4\u05d5\u05d0 \u05e2\u05d3 \u05db\u05d3\u05d9 \u05db\u05da \u05d0\u05d4\u05d5\u05d3 \u05d5\u05de\u05d5\u05db\u05e8 \u05e2\u05d3 \u05e9\u05e4\u05e2\u05d9\u05dc\u05d9 \u05d7\u05de\u05d0\u05e1 \u05de\u05e8\u05e4\u05e8\u05e8\u05d9\u05dd \u05d0\u05dc\u05d9\u05d5 \u05ea\u05d5\u05da \u05db\u05d3\u05d9 \u05d4\u05e7\u05e8\u05d1\u05d5\u05ea.\u05d4\u05e7\u05e8\u05d9\u05d0\u05d4 \u05e9\u05dc \u05e4\u05e2\u05d9\u05dc \u05d7\u05de\u05d0\u05e1 \u05d1\u05e1\u05e8\u05d8\u05d5\u05df \u05db\u05d0\u05df \u05dc\u05e4\u05e0\u05d9\u05db\u05dd \u05d4\u05e4\u05db\u05d4 \u05dc\u05d4\u05d0\u05e9\u05ea\u05d2 \u05d1\u05e8\u05e9\u05ea\u05d5\u05ea \u05d4\u05d7\u05d1\u05e8\u05ea\u05d9\u05d5\u05ea:#\u062d\u0644\u0644_\u064a\u0627_\u062f\u0648\u064a\u0631\u064aUser sent a document",false,563,"\u05d4\u05d6\u05e8\u05d5\u05e2 \u05d4\u05e6\u05d1\u05d0\u05d9\u05ea \u05e9\u05dc \u05d7\u05de\u05d0\u05e1 \u05de\u05e4\u05e8\u05e1\u05de\u05ea \u05ea\u05d9\u05e2\u05d5\u05d3 \u05e9\u05dc \u05d9\u05e8\u05d9 \u05e9\u05d1\u05d9\u05e6\u05e2 \u05d0\u05d7\u05d3 \u05de\u05d0\u05e0\u05e9\u05d9\u05d4 \u05dc\u05e2\u05d1\u05e8 \u05de\u05d1\u05e0\u05d4 \u05d1\u05d5 \u05e9\u05d4\u05d5 \u05dc\u05db\u05d0\u05d5\u05e8\u05d4 \u05d7\u05d9\u05d9\u05dc\u05d9 \u05e6\u05d4\"\u05dc. \u05dc\u05d0\u05d7\u05e8 \u05d4\u05d9\u05e8\u05d9 \u05e6\u05d5\u05e2\u05e7 \u05e4\u05e2\u05d9\u05dc \u05d7\u05de\u05d0\u05e1: \u05ea\u05df \u05e4\u05e8\u05e9\u05e0\u05d5\u05ea \u05d9\u05d0 \u05d3\u05d5\u05d5\u05d9\u05e8\u05d9!\u05e4\u05d0\u05d9\u05d6 \u05d0-\u05d3\u05d5\u05d5\u05d9\u05e8\u05d9, \u05d4\u05d5\u05d0 \u05d4\u05e4\u05e8\u05e9\u05df \u05d4\u05e6\u05d1\u05d0\u05d9 \u05d4\u05de\u05d5\u05d1\u05d9\u05dc \u05e9\u05dc \u05d0\u05dc\u05d2'\u05d6\u05d9\u05e8\u05d4 (\u05e7\u05e6\u05d9\u05df \u05d9\u05e8\u05d3\u05e0\u05d9 \u05d1\u05d3\u05d9\u05de\u05d5\u05e1) \u05d1\u05db\u05dc \u05d4\u05e7\u05e9\u05d5\u05e8 \u05dc\u05dc\u05d7\u05d9\u05de\u05d4 \u05d1\u05e2\u05d6\u05d4. \u05d4\u05d5\u05d0 \u05e0\u05d5\u05d8\u05d4 \u05d1\u05e4\u05e8\u05e9\u05e0\u05d5\u05ea\u05d5, \u05d1\u05d0\u05d5\u05e4\u05df \u05de\u05d5\u05d2\u05d6\u05dd \u05d1\u05de\u05d9\u05d5\u05d7\u05d3, \u05dc\u05ea\u05d0\u05e8 \u05d0\u05ea \u05d4\u05de\u05e6\u05d1 \u05db\u05d0\u05d9\u05dc\u05d5 \u05d7\u05de\u05d0\u05e1 \u05e2\u05d5\u05d3 \u05e8\u05d2\u05e2 \u05d1\u05e4\u05d0\u05ea\u05d9 \u05d9\u05e8\u05d5\u05e9\u05dc\u05d9\u05dd...\u05d4\u05e4\u05e8\u05e9\u05e0\u05d5\u05ea \u05e9\u05dc\u05d5 \u05d4\u05e4\u05db\u05d4 \u05dc\u05e9\u05dd \u05d3\u05d1\u05e8  \u05d1\u05d7\u05d5\u05d3\u05e9\u05d9\u05d9\u05dd \u05d4\u05d0\u05d7\u05e8\u05d5\u05e0\u05d9\u05dd: \u05ea\u05d5\u05de\u05db\u05d9 \u05d7\u05de\u05d0\u05e1 \u05de\u05e2\u05e8\u05d9\u05e6\u05d9\u05dd \u05d0\u05d5\u05ea\u05d5 \u05d5\u05de\u05ea\u05e0\u05d2\u05d3\u05d9 \u05d7\u05de\u05d0\u05e1 \u05dc\u05d5\u05e2\u05d2\u05d9\u05dd \u05dc\u05d5 \u05d1\u05d1\u05d5\u05d6 \u05e2\u05dc \u05db\u05da \u05e9\u05d4\u05d5\u05d0 \u05de\u05e9\u05e7\u05e8 \u05d5\u05de\u05e1\u05e4\u05e8 \u05d1\u05d3\u05d9\u05d5\u05ea \u05d1\u05e9\u05e2\u05d4 \u05e9\u05d4\u05d8\u05e0\u05e7\u05d9\u05dd \u05d4\u05d9\u05e9\u05e8\u05d0\u05dc\u05d9\u05dd \u05d1\u05dc\u05d1 \u05e2\u05d6\u05d4.\u05d0-\u05d3\u05d5\u05d5\u05d9\u05e8\u05d9 \u05d4\u05 e2\u05e6\u05e8\u05d5@N12chat"],["\u05e0\u05e9\u05d9\u05d0 \u05d1\u05dc\u05d1\u05e0\u05d5\u05df \u05e6\u05e8\u05d9\u05da \u05e9 86 \u05de\u05ea\u05d5\u05da 128 \u05d7\u05d1\u05e8\u05d9 \u05d4\u05e4\u05e8\u05dc\u05de\u05e0\u05d8 \u05d9\u05d1\u05d7\u05e8\u05d5 \u05d1\u05d5 \u05db\u05d3\u05d9 \u05dc\u05d4\u05ea\u05de\u05e0\u05d5\u05ea (\u05e9\u05e0\u05d9 \u05e9\u05dc\u05d9\u05e9\u05d9\u05dd).\n",false,587,"\u05e0\u05e9\u05d9\u05d0 \u05d1\u05dc\u05d1\u05e0\u05d5\u05df \u05e6\u05e8\u05d9\u05da \u05e9 86 \u05de\u05ea\u05d5\u05da 128 \u05d7\u05d1\u05e8\u05d9 \u05d4\u05e4\u05e8\u05dc\u05de\u05e0\u05d8 \u05d9\u05d1\u05d7\u05e8\u05d5 \u05d1\u05d5 \u05db\u05d3\u05d9 \u05dc\u05d4\u05ea\u05de\u05e0\u05d5\u05ea (\u05e9\u05e0\u05d9 \u05e9\u05dc\u05d9\u05e9\u05d9\u05dd).\n"],["\u05e1\u05e4\u05d9\u05e8 \u05dc\u05d9\u05e4\u05e7\u05d9\u05df\u05d3\u05d9\u05d5\u05d5\u05d7 \u05d1\u05e2\u05e8\u05d5\u05e5 \u05d4\u05de\u05e6\u05e8\u05d9 \u05d0\u05dc-\u05e7\u05d0\u05d4\u05e8\u05d4 \u05d0\u05dc-\u05d0\u05d7'\u05d1\u05d0\u05e8\u05d9\u05d4: \"\u05de\u05ea\u05e0\u05d4\u05dc\u05d9\u05dd \u05de\u05d2\u05e2\u05d9\u05dd \u05dc\u05d4\u05d0\u05e8\u05db\u05ea \u05d4\u05e4\u05e1\u05e7\u05ea \u05d4\u05d0\u05e9 \u05d1\u05d9\u05d5\u05dd-\u05d9\u05d5\u05de\u05d9\u05d9\u05dd, \u05db\u05d3\u05d9 \u05dc\u05e9\u05d7\u05e8\u05e8 \u05e2\u05d5\u05d3 \u05d7\u05d8\u05d5\u05e4\u05d9\u05dd \u05de\u05e2\u05d6\u05d4 \u05d5\u05d0\u05e1\u05d9\u05e8\u05d9\u05dd \u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd\". \u05dc\u05d3\u05d9\u05d5\u05d5\u05d7 \u05d0\u05d9\u05df \u05db\u05e8\u05d2\u05e2 \u05d0\u05d9\u05e9\u05d5\u05e8 \u05de\u05de\u05e7\u05d5\u05e8 \u05d0\u05d7\u05e8@N12chat",false,588,"\u05e1\u05e4\u05d9\u05e8 \u05dc\u05d9\u05e4\u05e7\u05d9\u05df\u05d3\u05d9\u05d5\u05d5\u05d7 \u05d1\u05e2\u05e8\u05d5\u05e5 \u05d4\u05de\u05e6\u05e8\u05d9 \u05d0\u05dc-\u05e7\u05d0\u05d4\u05e8\u05d4 \u05d0\u05dc-\u05d0\u05d7'\u05d1\u05d0\u05e8\u05d9\u05d4: \"\u05de\u05ea\u05e0\u05d4\u05dc\u05d9\u05dd \u05de\u05d2\u05e2\u05d9\u05dd \u05dc\u05d4\u05d0\u05e8\u05db\u05ea \u05d4\u05e4\u05e1\u05e7\u05ea \u05d4\u05d0\u05e9 \u05d1\u05d9\u05d5\u05dd-\u05d9\u05d5\u05de\u05d9\u05d9\u05dd, \u05db\u05d3\u05d9 \u05dc\u05e9\u05d7\u05e8\u05e8 \u05e2\u05d5\u05d3 \u05d7\u05d8\u05d5\u05e4\u05d9\u05dd \u05de\u05e2\u05d6\u05d4 \u05d5\u05d0\u05e1\u05d9\u05e8\u05d9\u05dd \u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd\". \u05dc\u05d3\u05d9\u05d5\u05d5\u05d7 \u05d0\u05d9\u05df \u05db\u05e8\u05d2\u05e2 \u05d0\u05d9\u05e9\u05d5\u05e8 \u05de\u05de\u05e7\u05d5\u05e8 \u05d0\u05d7\u05e8@N12chat"],["\u05d3\u05d5\u05d1\u05e8 \u05d4\u05d4\u05d2\u05e0\u05d4 \u05d4\u05d0\u05d6\u05e8\u05d7\u05d9\u05ea \u05d1\u05e2\u05d6\u05d4:1.\u05de\u05d0\u05d6 \u05ea\u05d7\u05d9\u05dc\u05ea \u05d4\u05d4\u05d5\u05d3\u05e0\u05d4 \u05d7\u05d9\u05dc\u05e6\u05e0\u05d5 \u05d9\u05d5\u05ea\u05e8 \u05de 150 \u05d2\u05d5\u05e4\u05d5\u05ea \u05de\u05ea\u05d7\u05ea \u05dc\u05de\u05d1\u05e0\u05d9\u05dd \u05d5\u05de\u05d4\u05e8\u05d7\u05d5\u05d1\u05d5\u05ea (\u05d0\u05d6\u05db\u05d9\u05e8 \u05db\u05d9 \u05e2\"\u05e4 \u05dc\u05e9\u05db\u05ea \u05d4\u05d4\u05e1\u05d1\u05e8\u05d4 \u05e9\u05dc \u05d7\u05de\u05d0\u05e1 \u05d9\u05e9 \u05db 7000 \u05e0\u05e2\u05d3\u05e8\u05d9\u05dd \u05de\u05ea\u05d7\u05ea \u05dc\u05d4\u05e8\u05d9\u05e1\u05d5\u05ea - \u05d0\"\u05e2).2. \u05d0\u05d9\u05e0\u05e0\u05d5 \u05de\u05e1\u05d5\u05d2\u05dc\u05d9\u05dd \u05dc\u05d4\u05ea\u05de\u05d5\u05d3\u05d3 \u05e2\u05dd \u05de\u05d9 \u05d3\u05d9 \u05d4\u05d4\u05e8\u05e1 \u05d0\u05e0\u05d5 \u05d6\u05e7\u05d5\u05e7\u05d9\u05dd \u05dc\u05e1\u05d9\u05d5\u05e2 \u05de\u05e6\u05d5\u05d5\u05ea\u05d9 \u05d4\u05d2\u05e0\u05d4 \u05d0\u05d6\u05e8\u05d7\u05d9\u05ea \u05d1\u05d9\u05e0\"\u05dc.3. \u05de\u05d0\u05d5\u05ea \u05d2\u05d5\u05e4\u05d5\u05ea \u05de\u05d5\u05d8\u05dc\u05d5\u05ea \u05d1\u05e8\u05d7\u05d5\u05d1\u05d5\u05ea \u05d1\u05d0\u05d6\u05d5\u05e8\u05d9\u05dd \u05de\u05d4\u05dd \u05dc\u05d0 \u05d4\u05ea\u05e4\u05e0\u05d5 \u05d4\u05db\u05d5\u05d7\u05d5\u05ea \u05d4\u05d9\u05e9\u05e8\u05d0\u05dc\u05d9\u05dd.4. \u05de\u05d0\u05d5\u05ea \u05d2\u05d5\u05e4\u05d5\u05ea \u05de\u05d5\u05d8\u05dc\u05d5\u05ea \u05d1\u05e8\u05d7\u05d5\u05d1\u05d5\u05ea \u05d1\u05d0\u05d6\u05d5\u05e8 \u05ea\u05dc \u05d0\u05dc\u05d4\u05d5\u05d0 \u05d5\u05d1\u05d9\u05ea \u05d4\u05d7\u05d5\u05dc\u05d9\u05dd \u05d0\u05dc\u05e7\u05d3\u05e1 (\u05d3\u05e8\u05d5\u05dd \u05d4\u05e2\u05d9\u05e8 \u05e2\u05d6\u05d4).\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,589,"\u05d3\u05d5\u05d1\u05e8 \u05d4\u05d4\u05d2\u05e0\u05d4 \u05d4\u05d0\u05d6\u05e8\u05d7\u05d9\u05ea \u05d1\u05e2\u05d6\u05d4:1.\u05de\u05d0\u05d6 \u05ea\u05d7\u05d9\u05dc\u05ea \u05d4\u05d4\u05d5\u05d3\u05e0\u05d4 \u05d7\u05d9\u05dc\u05e6\u05e0\u05d5 \u05d9\u05d5\u05ea\u05e8 \u05de 150 \u05d2\u05d5\u05e4\u05d5\u05ea \u05de\u05ea\u05d7\u05ea \u05dc\u05de\u05d1\u05e0\u05d9\u05dd \u05d5\u05de\u05d4\u05e8\u05d7\u05d5\u05d1\u05d5\u05ea (\u05d0\u05d6\u05db\u05d9\u05e8 \u05db\u05d9 \u05e2\"\u05e4 \u05dc\u05e9\u05db\u05ea \u05d4\u05d4\u05e1\u05d1\u05e8\u05d4 \u05e9\u05dc \u05d7\u05de\u05d0\u05e1 \u05d9\u05e9 \u05db 7000 \u05e0\u05e2\u05d3\u05e8\u05d9\u05dd \u05de\u05ea\u05d7\u05ea \u05dc\u05d4\u05e8\u05d9\u05e1\u05d5\u05ea - \u05d0\"\u05e2).2. \u05d0\u05d9\u05e0\u05e0\u05d5 \u05de\u05e1\u05d5\u05d2\u05dc\u05d9\u05dd \u05dc\u05d4\u05ea\u05de\u05d5\u05d3\u05d3 \u05e2\u05dd \u05de\u05d9 \u05d3\u05d9 \u05d4\u05d4\u05e8\u05e1 \u05d0\u05e0\u05d5 \u05d6\u05e7\u05d5\u05e7\u05d9\u05dd \u05dc\u05e1\u05d9\u05d5\u05e2 \u05de\u05e6\u05d5\u05d5\u05ea\u05d9 \u05d4\u05d2\u05e0\u05d4 \u05d0\u05d6\u05e8\u05d7\u05d9\u05ea \u05d1\u05d9\u05e0\"\u05dc.3. \u05de\u05d0\u05d5\u05ea \u05d2\u05d5\u05e4\u05d5\u05ea \u05de\u05d5\u05d8\u05dc\u05d5\u05ea \u05d1\u05e8\u05d7\u05d5\u05d1\u05d5\u05ea \u05d1\u05d0\u05d6\u05d5\u05e8\u05d9\u05dd \u05de\u05d4\u05dd \u05dc\u05d0 \u05d4\u05ea\u05e4\u05e0\u05d5 \u05d4\u05db\u05d5\u05d7\u05d5\u05ea \u05d4\u05d9\u05e9\u05e8\u05d0\u05dc\u05d9\u05dd.4. \u05de\u05d0\u05d5\u05ea \u05d2\u05d5\u05e4\u05d5\u05ea \u05de\u05d5\u05d8\u05dc\u05d5\u05ea \u05d1\u05e8\u05d7\u05d5\u05d1\u05d5\u05ea \u05d1\u05d0\u05d6\u05d5\u05e8 \u05ea\u05dc \u05d0\u05dc\u05d4\u05d5\u05d0 \u05d5\u05d1\u05d9\u05ea \u05d4\u05d7\u05d5\u05dc\u05d9\u05dd \u05d0\u05dc\u05e7\u05d3\u05e1 (\u05d3\u05e8\u05d5\u05dd \u05d4\u05e2\u05d9\u05e8 \u05e2\u05d6\u05d4).\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05ea\u05de\u05d9\u05e8 \u05e1\u05d8\u05d9\u05d9\u05e0\u05de\u05df\u05e6\u05d1\u05e2 \u05d0\u05d3\u05d5\u05dd \u05d1\u05db\u05d9\u05e1\u05d5\u05e4\u05d9\u05dd, \u05e0\u05d9\u05e8\u05d9\u05dd \u05d5\u05e2\u05d9\u05df \u05d4\u05e9\u05dc\u05d5\u05e9\u05d4 \u05e9\u05d1\u05de\u05d5\u05e2\u05e6\u05d4 \u05d4\u05d0\u05d6\u05d5\u05e8\u05d9\u05ea \u05d0\u05e9\u05db\u05d5\u05dc@N12chat",false,590,"\u05ea\u05de\u05d9\u05e8 \u05e1\u05d8\u05d9\u05d9\u05e0\u05de\u05df\u05e6\u05d1\u05e2 \u05d0\u05d3\u05d5\u05dd \u05d1\u05db\u05d9\u05e1\u05d5\u05e4\u05d9\u05dd, \u05e0\u05d9\u05e8\u05d9\u05dd \u05d5\u05e2\u05d9\u05df \u05d4\u05e9\u05dc\u05d5\u05e9\u05d4 \u05e9\u05d1\u05de\u05d5\u05e2\u05e6\u05d4 \u05d4\u05d0\u05d6\u05d5\u05e8\u05d9\u05ea \u05d0\u05e9\u05db\u05d5\u05dc@N12chat"],["\u05d0\u05e8\u05d2\u05d5\u05df \u05d4\u05e1\u05d7\u05e8 \u05d4\u05d9\u05de\u05d9 \u05d4\u05d1\u05e8\u05d9\u05d8\u05d9 \u05dc\u05e4\u05e0\u05d9 \u05d6\u05de\u05df \u05e7\u05e6\u05e8: \u05ea\u05e7\u05e8\u05d9\u05ea \u05e0\u05d5\u05e1\u05e4\u05ea \u05dc\u05d9\u05d3 \u05d1\u05d0\u05d1 \u05d0\u05dc\u05de\u05e0\u05d3\u05d1 - \u05d4\u05e2\u05e0\u05d9\u05d9\u05df \u05e0\u05d7\u05e7\u05e8.\n",false,591,"\u05d0\u05e8\u05d2\u05d5\u05df \u05d4\u05e1\u05d7\u05e8 \u05d4\u05d9\u05de\u05d9 \u05d4\u05d1\u05e8\u05d9\u05d8\u05d9 \u05dc\u05e4\u05e0\u05d9 \u05d6\u05de\u05df \u05e7\u05e6\u05e8: \u05ea\u05e7\u05e8\u05d9\u05ea \u05e0\u05d5\u05e1\u05e4\u05ea \u05dc\u05d9\u05d3 \u05d1\u05d0\u05d1 \u05d0\u05dc\u05de\u05e0\u05d3\u05d1 - \u05d4\u05e2\u05e0\u05d9\u05d9\u05df \u05e0\u05d7\u05e7\u05e8.\n"],["\u05d8\u05dc \u05e9\u05d2\u05d9\u05d0\u05e4\u05d9\u05d9\u05e0\u05e0\u05e9\u05dc \u05d8\u05d9\u05d9\u05de\u05e1: \u05d0\u05e8\u05d4\"\u05d1 \u05d1\u05d9\u05e7\u05e9\u05d4 \u05de\u05e1\u05d9\u05df \u05dc\u05d4\u05e4\u05e2\u05d9\u05dc \u05d0\u05ea \u05d4\u05e9\u05e4\u05e2\u05ea\u05d4 \u05e2\u05dc \u05d0\u05d9\u05e8\u05d0\u05df \u05db\u05d3\u05d9 \u05e9\u05d6\u05d5 \u05ea\u05e8\u05e1\u05df \u05d0\u05ea \u05d4\u05d7\u05d5\u05ea'\u05d9\u05dd \u05e9\u05ea\u05d5\u05e7\u05e4\u05d9\u05dd \u05e1\u05e4\u05d9\u05e0\u05d5\u05ea \u05d1\u05d9\u05dd \u05d4\u05d0\u05d3\u05d5\u05dd. \u05d4\u05e0\u05d5\u05e9\u05d0 \u05d4\u05d5\u05e2\u05dc\u05d4 \u05d1\u05e4\u05d2\u05d9\u05e9\u05d5\u05ea \u05e9\u05dc \u05d4\u05d9\u05d5\u05e2\u05e5 \u05dc\u05d1\u05d9\u05d8\u05d7\u05d5\u05df \u05dc\u05d0\u05d5\u05de\u05d9 \u05d2'\u05d9\u05d9\u05e7 \u05e1\u05d0\u05dc\u05d9\u05d1\u05df \u05d5\u05e1\u05d2\u05e0\u05d5 \u05e2\u05dd \u05d1\u05db\u05d9\u05e8\u05d9\u05dd \u05e1\u05d9\u05e0\u05d9\u05d9\u05dd \u05db\u05de\u05d5 \u05d2\u05dd \u05d1\u05e9\u05d9\u05d7\u05d5\u05ea \u05e9\u05dc \u05de\u05d6\u05db\u05d9\u05e8 \u05d4\u05de\u05d3\u05d9\u05e0\u05d4 \u05d1\u05dc\u05d9\u05e0\u05e7\u05df. \u05d1\u05d9\u05e0\u05ea\u05d9\u05d9\u05dd \u05e0\u05e8\u05d0\u05d9\u05dd \u05e1\u05d9\u05de\u05e0\u05d9\u05dd \u05de\u05d5\u05e2\u05d8\u05d9\u05dd \u05e9\u05dc \u05e2\u05d6\u05e8\u05d4 \u05de\u05e1\u05d9\u05df@N12chat",false,592,"\u05d8\u05dc \u05e9\u05d2\u05d9\u05d0\u05e4\u05d9\u05d9\u05e0\u05e0\u05e9\u05dc \u05d8\u05d9\u05d9\u05de\u05e1: \u05d0\u05e8\u05d4\"\u05d1 \u05d1\u05d9\u05e7\u05e9\u05d4 \u05de\u05e1\u05d9\u05df \u05dc\u05d4\u05e4\u05e2\u05d9\u05dc \u05d0\u05ea \u05d4\u05e9\u05e4\u05e2\u05ea\u05d4 \u05e2\u05dc \u05d0\u05d9\u05e8\u05d0\u05df \u05db\u05d3\u05d9 \u05e9\u05d6\u05d5 \u05ea\u05e8\u05e1\u05df \u05d0\u05ea \u05d4\u05d7\u05d5\u05ea'\u05d9\u05dd \u05e9\u05ea\u05d5\u05e7\u05e4\u05d9\u05dd \u05e1\u05e4\u05d9\u05e0\u05d5\u05ea \u05d1\u05d9\u05dd \u05d4\u05d0\u05d3\u05d5\u05dd. \u05d4\u05e0\u05d5\u05e9\u05d0 \u05d4\u05d5\u05e2\u05dc\u05d4 \u05d1\u05e4\u05d2\u05d9\u05e9\u05d5\u05ea \u05e9\u05dc \u05d4\u05d9\u05d5\u05e2\u05e5 \u05dc\u05d1\u05d9\u05d8\u05d7\u05d5\u05df \u05dc\u05d0\u05d5\u05de\u05d9 \u05d2'\u05d9\u05d9\u05e7 \u05e1\u05d0\u05dc\u05d9\u05d1\u05df \u05d5\u05e1\u05d2\u05e0\u05d5 \u05e2\u05dd \u05d1\u05db\u05d9\u05e8\u05d9\u05dd \u05e1\u05d9\u05e0\u05d9\u05d9\u05dd \u05db\u05de\u05d5 \u05d2\u05dd \u05d1\u05e9\u05d9\u05d7\u05d5\u05ea \u05e9\u05dc \u05de\u05d6\u05db\u05d9\u05e8 \u05d4\u05de\u05d3\u05d9\u05e0\u05d4 \u05d1\u05dc\u05d9\u05e0\u05e7\u05df. \u05d1\u05d9\u05e0\u05ea\u05d9\u05d9\u05dd \u05e0\u05e8\u05d0\u05d9\u05dd \u05e1\u05d9\u05de\u05e0\u05d9\u05dd \u05de\u05d5\u05e2\u05d8\u05d9\u05dd \u05e9\u05dc \u05e2\u05d6\u05e8\u05d4 \u05de\u05e1\u05d9\u05df@N12chat"],["\u05d2\u05d9\u05d0 \u05d5\u05e8\u05d5\u05df\ud83d\udcdd\u05e1\u05e8\u05d9\u05e7\u05d5\u05ea \u05d1\u05d0\u05d6\u05d5\u05e8 \u05d7\u05e0\u05d9\u05ea\u05d4 \u05e9\u05d1\u05d2\u05dc\u05d9\u05dc \u05d4\u05de\u05e2\u05e8\u05d1\u05d9 \u05d1\u05e2\u05e7\u05d1\u05d5\u05ea \u05d7\u05e9\u05e9 \u05dc\u05d7\u05d3\u05d9\u05e8\u05d4: \u05dc\u05d0\u05d7\u05e8 \u05d6\u05d9\u05d4\u05d5\u05d9 \u05d7\u05e9\u05d5\u05d3 \u05d1\u05de\u05e8\u05d7\u05d1 \u05d4\u05d2\u05d1\u05d5\u05dc, \u05d4\u05d5\u05e7\u05de\u05d5 \u05de\u05d7\u05e1\u05d5\u05de\u05d9\u05dd \u05d5\u05d4\u05ea\u05d5\u05e9\u05d1\u05d9\u05dd \u05d4\u05d5\u05e0\u05d7\u05d5 \u05dc\u05d4\u05d9\u05e9\u05d0\u05e8 \u05d1\u05d1\u05ea\u05d9\u05dd@N12chat",false,593,"\u05d2\u05d9\u05d0 \u05d5\u05e8\u05d5\u05df\ud83d\udcdd\u05e1\u05e8\u05d9\u05e7\u05d5\u05ea \u05d1\u05d0\u05d6\u05d5\u05e8 \u05d7\u05e0\u05d9\u05ea\u05d4 \u05e9\u05d1\u05d2\u05dc\u05d9\u05dc \u05d4\u05de\u05e2\u05e8\u05d1\u05d9 \u05d1\u05e2\u05e7\u05d1\u05d5\u05ea \u05d7\u05e9\u05e9 \u05dc\u05d7\u05d3\u05d9\u05e8\u05d4: \u05dc\u05d0\u05d7\u05e8 \u05d6\u05d9\u05d4\u05d5\u05d9 \u05d7\u05e9\u05d5\u05d3 \u05d1\u05de\u05e8\u05d7\u05d1 \u05d4\u05d2\u05d1\u05d5\u05dc, \u05d4\u05d5\u05e7\u05de\u05d5 \u05de\u05d7\u05e1\u05d5\u05de\u05d9\u05dd \u05d5\u05d4\u05ea\u05d5\u05e9\u05d1\u05d9\u05dd \u05d4\u05d5\u05e0\u05d7\u05d5 \u05dc\u05d4\u05d9\u05e9\u05d0\u05e8 \u05d1\u05d1\u05ea\u05d9\u05dd@N12chat"],["\u05d0\u05d9\u05e8\u05d0\u05df : \u05d0\u05d7\u05e8\u05d9 \u05e9\u05e2\u05e9\u05d4 \u05e2\u05e6\u05d9\u05e8\u05d4 \u05d1\u05e2\u05d9\u05e8 \u05e0\u05d2'\u05e3 \u05d4\u05e7\u05d3\u05d5\u05e9\u05d4 \u05dc\u05e9\u05d9\u05e2\u05d9\u05dd \u05d1\u05e2\u05d9\u05e8\u05d0\u05e7, \u05d4\u05d2\u05d9\u05e2 \u05d0\u05de\u05e9 \u05dc\u05d8\u05d4\u05e8\u05df \u05d0\u05e8\u05d5\u05e0\u05d5 \u05e9\u05dc \u05e8\u05d6\u05d9 \u05de\u05d5\u05e1\u05d5\u05d5\u05d9, \u05d4\u05d1\u05db\u05d9\u05e8 \u05d4\u05d0\u05d9\u05e8\u05d0\u05e0\u05d9 \u05e9\u05d7\u05d5\u05e1\u05dc \u05d1\u05ea\u05e7\u05d9\u05e4\u05d4 \u05d1\u05d3\u05de\u05e9\u05e7. \u05d1\u05d8\u05d4\u05e8\u05df \u05e0\u05e2\u05e8\u05da \u05d8\u05e7\u05e1 \u05d4\u05de\u05d5\u05e0\u05d9 \u05d5\u05ea\u05e4\u05d9\u05dc\u05d4 \u05de\u05d9\u05d5\u05d7\u05d3\u05ea \u05d1\u05d4\u05e9\u05ea\u05ea\u05e4\u05d5\u05ea \u05d4\u05de\u05e0\u05d4\u05d9\u05d2 \u05d4\u05e2\u05dc\u05d9\u05d5\u05df \u05e9\u05dc \u05d0\u05d9\u05e8\u05d0\u05df, \u05de\u05e4\u05e7\u05d3 \u05de\u05e9\u05de\u05e8\u05d5\u05ea \u05d4\u05de\u05d4\u05e4\u05db\u05d4 \u05d4\u05d0\u05d9\u05e8\u05d0\u05e0\u05d9\u05dd, \u05de\u05e4\u05e7\u05d3 \u05db\u05d5\u05d7 \u05d0\u05dc\u05e7\u05d3\u05e1 \u05d1\u05de\u05e9\u05de\u05e8\u05d5\u05ea \u05d4\u05de\u05d4\u05e4\u05db\u05d4 \u05d5\u05e2\u05d5\u05d3.\u05d4\u05e8\u05db\u05d1 \u05d7\u05e8\u05d9\u05d2 \u05e9\u05dc \u05d1\u05db\u05d9\u05e8\u05d9\u05dd - \u05d1\u05d4\u05ea\u05d0\u05dd \u05dc\u05d7\u05e9\u05d9\u05d1\u05d5\u05ea\u05d5 \u05e9\u05dc \u05de\u05d5\u05e1\u05d5\u05d5\u05d9 \u05e2\u05d1\u05d5\u05e8 \u05d4\u05d0\u05d9\u05e8\u05d0\u05e0\u05d9\u05dd.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,594,"\u05d0\u05d9\u05e8\u05d0\u05df : \u05d0\u05d7\u05e8\u05d9 \u05e9\u05e2\u05e9\u05d4 \u05e2\u05e6\u05d9\u05e8\u05d4 \u05d1\u05e2\u05d9\u05e8 \u05e0\u05d2'\u05e3 \u05d4\u05e7\u05d3\u05d5\u05e9\u05d4 \u05dc\u05e9\u05d9\u05e2\u05d9\u05dd \u05d1\u05e2\u05d9\u05e8\u05d0\u05e7, \u05d4\u05d2\u05d9\u05e2 \u05d0\u05de\u05e9 \u05dc\u05d8\u05d4\u05e8\u05df \u05d0\u05e8\u05d5\u05e0\u05d5 \u05e9\u05dc \u05e8\u05d6\u05d9 \u05de\u05d5\u05e1\u05d5\u05d5\u05d9, \u05d4\u05d1\u05db\u05d9\u05e8 \u05d4\u05d0\u05d9\u05e8\u05d0\u05e0\u05d9 \u05e9\u05d7\u05d5\u05e1\u05dc \u05d1\u05ea\u05e7\u05d9\u05e4\u05d4 \u05d1\u05d3\u05de\u05e9\u05e7. \u05d1\u05d8\u05d4\u05e8\u05df \u05e0\u05e2\u05e8\u05da \u05d8\u05e7\u05e1 \u05d4\u05de\u05d5\u05e0\u05d9 \u05d5\u05ea\u05e4\u05d9\u05dc\u05d4 \u05de\u05d9\u05d5\u05d7\u05d3\u05ea \u05d1\u05d4\u05e9\u05ea\u05ea\u05e4\u05d5\u05ea \u05d4\u05de\u05e0\u05d4\u05d9\u05d2 \u05d4\u05e2\u05dc\u05d9\u05d5\u05df \u05e9\u05dc \u05d0\u05d9\u05e8\u05d0\u05df, \u05de\u05e4\u05e7\u05d3 \u05de\u05e9\u05de\u05e8\u05d5\u05ea \u05d4\u05de\u05d4\u05e4\u05db\u05d4 \u05d4\u05d0\u05d9\u05e8\u05d0\u05e0\u05d9\u05dd, \u05de\u05e4\u05e7\u05d3 \u05db\u05d5\u05d7 \u05d0\u05dc\u05e7\u05d3\u05e1 \u05d1\u05de\u05e9\u05de\u05e8\u05d5\u05ea \u05d4\u05de\u05d4\u05e4\u05db\u05d4 \u05d5\u05e2\u05d5\u05d3.\u05d4\u05e8\u05db\u05d1 \u05d7\u05e8\u05d9\u05d2 \u05e9\u05dc \u05d1\u05db\u05d9\u05e8\u05d9\u05dd - \u05d1\u05d4\u05ea\u05d0\u05dd \u05dc\u05d7\u05e9\u05d9\u05d1\u05d5\u05ea\u05d5 \u05e9\u05dc \u05de\u05d5\u05e1\u05d5\u05d5\u05d9 \u05e2\u05d1\u05d5\u05e8 \u05d4\u05d0\u05d9\u05e8\u05d0\u05e0\u05d9\u05dd.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05de\u05d1\u05d6\u05e7\u05df 12\u05d3\u05d5\u05d1\u05e8 \u05e6\u05d4\"\u05dc \u05ea\u05ea-\u05d0\u05dc\u05d5\u05e3 \u05d3\u05e0\u05d9\u05d0\u05dc \u05d4\u05d2\u05e8\u05d9 \u05d9\u05de\u05e1\u05d5\u05e8 \u05d4\u05e6\u05d4\u05e8\u05d4 \u05dc\u05ea\u05e7\u05e9\u05d5\u05e8\u05ea \u05d1\u05e9\u05e2\u05d4 21:00@N12chat",false,595,"\u05de\u05d1\u05d6\u05e7\u05df 12\u05d3\u05d5\u05d1\u05e8 \u05e6\u05d4\"\u05dc \u05ea\u05ea-\u05d0\u05dc\u05d5\u05e3 \u05d3\u05e0\u05d9\u05d0\u05dc \u05d4\u05d2\u05e8\u05d9 \u05d9\u05de\u05e1\u05d5\u05e8 \u05d4\u05e6\u05d4\u05e8\u05d4 \u05dc\u05ea\u05e7\u05e9\u05d5\u05e8\u05ea \u05d1\u05e9\u05e2\u05d4 21:00@N12chat"],["\u05e6\u05d4\"\u05dc \u05ea\u05e7\u05e3 \u05dc\u05e4\u05e0\u05d9 \u05d6\u05de\u05df \u05e7\u05e6\u05e8 \u05d1\u05d0\u05dc\u05d7'\u05d9\u05d0\u05dd \u05d1\u05d3\u05e8\u05d5\u05dd \u05dc\u05d1\u05e0\u05d5\u05df.\n",false,596,"\u05e6\u05d4\"\u05dc \u05ea\u05e7\u05e3 \u05dc\u05e4\u05e0\u05d9 \u05d6\u05de\u05df \u05e7\u05e6\u05e8 \u05d1\u05d0\u05dc\u05d7'\u05d9\u05d0\u05dd \u05d1\u05d3\u05e8\u05d5\u05dd \u05dc\u05d1\u05e0\u05d5\u05df.\n"],["\u05d1\u05e0\u05d9\u05d9\u05df \u05d1\u05df 7 \u05e7\u05d5\u05de\u05d5\u05ea \u05d4\u05d5\u05ea\u05e7\u05e3 \u05dc\u05e4\u05e0\u05d9 \u05d6\u05de\u05df \u05e7\u05e6\u05e8 \u05d1\u05e2\u05d9\u05e8 \u05e6\u05d5\u05e8 \u05d1\u05d3\u05e8\u05d5\u05dd \u05dc\u05d1\u05e0\u05d5\u05df, \u05dc\u05dc\u05d0 \u05d4\u05ea\u05e8\u05e2\u05ea \u05e4\u05d9\u05e0\u05d5\u05d9 \u05de\u05d5\u05e7\u05d3\u05de\u05ea.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,597,"\u05d1\u05e0\u05d9\u05d9\u05df \u05d1\u05df 7 \u05e7\u05d5\u05de\u05d5\u05ea \u05d4\u05d5\u05ea\u05e7\u05e3 \u05dc\u05e4\u05e0\u05d9 \u05d6\u05de\u05df \u05e7\u05e6\u05e8 \u05d1\u05e2\u05d9\u05e8 \u05e6\u05d5\u05e8 \u05d1\u05d3\u05e8\u05d5\u05dd \u05dc\u05d1\u05e0\u05d5\u05df, \u05dc\u05dc\u05d0 \u05d4\u05ea\u05e8\u05e2\u05ea \u05e4\u05d9\u05e0\u05d5\u05d9 \u05de\u05d5\u05e7\u05d3\u05de\u05ea.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05e4\u05d9\u05e7\u05d5\u05d3 \u05de\u05e8\u05db\u05d6 \u05d4\u05d0\u05de\u05e8\u05d9\u05e7\u05d0\u05d9 \u05de\u05d3\u05d5\u05d5\u05d7 \u05e9\u05d0\u05ea\u05de\u05d5\u05dc \u05d1\u05e2\u05e8\u05d1 \u05d9\u05d9\u05e8\u05d8\u05d5 \u05db\u05dc\u05d9 \u05e9\u05d9\u05d8 \u05e9\u05dc \u05d4\u05e6\u05d9 \u05d4\u05d0\u05de\u05e8\u05d9\u05e7\u05d0\u05d9 \u05d1\u05d4\u05d5\u05d1\u05dc\u05ea \u05e0\u05d5\u05e9\u05d0\u05ea \u05d4\u05de\u05d8\u05d5\u05e1\u05d9\u05dd \u05d0\u05d9\u05d9\u05d6\u05e0\u05d4\u05d0\u05d5\u05e8, \u05de\u05ea\u05e7\u05e4\u05d4 \u05de\u05d5\u05e8\u05db\u05d1\u05ea \u05e9\u05dc \u05d4\u05d7\u05d5\u05ea'\u05d9\u05dd \u05d1\u05ea\u05d9\u05de\u05df \u05e2\u05dc \u05e7\u05d5\u05d5\u05d9 \u05d4\u05e9\u05d9\u05d8 \u05d4\u05d1\u05d9\u05e0\u05dc\u05d0\u05d5\u05de\u05d9\u05dd \u05d1\u05d9\u05dd \u05d4\u05d0\u05d3\u05d5\u05dd \u05d1\u05d0\u05d6\u05d5\u05e8 \u05d1\u05d5 \u05e0\u05de\u05e6\u05d0\u05d5 \u05e1\u05e4\u05d9\u05e0\u05d5\u05ea \u05e1\u05d5\u05d7\u05e8.\u05e2\"\u05e4 \u05d4\u05d3\u05d9\u05d5\u05d5\u05d7 \u05db\u05dc\u05d9 \u05d4\u05e9\u05d9\u05d8 \u05d4\u05d0\u05de\u05e8\u05d9\u05e7\u05d0\u05d9\u05dd \u05d5\u05db\u05df \u05db\u05dc\u05d9 \u05e9\u05d9\u05d8 \u05d1\u05e8\u05d9\u05d8\u05d9 (HMS Diamond) \u05d9\u05d9\u05e8\u05d8\u05d5 \u05d0\u05ea\u05de\u05d5\u05dc \u05d1\u05e2\u05e8\u05d1 18 \u05db\u05d8\u05d1\"\u05de\u05d9\u05dd \u05de\u05ea\u05d0\u05d1\u05d3\u05d9\u05dd, \u05e9\u05e0\u05d9 \u05d8\u05d9\u05dc\u05d9 \u05e9\u05d9\u05d5\u05d8 \u05d9\u05de\u05d9\u05d9\u05dd \u05d5\u05d8\u05d9\u05dc \u05d1\u05dc\u05d9\u05e1\u05d8\u05d9 \u05d0\u05d7\u05d3 - \u05db\u05d5\u05dc\u05dd \u05e9\u05d5\u05d2\u05e8\u05d5 \u05e2\u05dc \u05d9\u05d3\u05d9 \u05d4\u05d7\u05d5\u05ea'\u05d9\u05dd.\u05e2\"\u05e4 \u05d4\u05d3\u05d9\u05d5\u05d5\u05d7 \u05dc\u05d0 \u05e0\u05d2\u05e8\u05dd \u05e0\u05d6\u05e7 \u05d5\u05dc\u05d0 \u05d4\u05d9\u05d5 \u05e0\u05e4\u05d2\u05e2\u05d9\u05dd \u05d1\u05ea\u05e7\u05d9\u05e4\u05d4 \u05d6\u05d5 \u05e9\u05d4\u05d9\u05d0 \u05d4\u05ea\u05e7\u05d9\u05e4\u05d4 \u05d4 26 \u05e9\u05dc \u05d4\u05d7\u05d5\u05ea'\u05d9\u05dd \u05de\u05d0\u05d6 \u05d7\u05d5\u05d3\u05e9 \u05e0\u05d5\u05d1\u05de\u05d1\u05e8 \u05d4\u05d0\u05d7\u05e8\u05d5\u05df.\u05d4\u05d9\u05d5\u05dd \u05e6\u05e4\u05d5\u05d9\u05d4 \u05d0\u05e8\u05d4\"\u05d1 \u05dc\u05d4\u05e2\u05d1\u05d9\u05e8 \u05d1\u05d0\u05d5\"\u05dd \u05d4\u05e6\u05e2\u05ea \u05d2\u05d9\u05e0\u05d5\u05d9 \u05e0\u05d2\u05d3 \u05d4\u05d7\u05d5\u05ea'\u05d9\u05dd.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,598,"\u05e4\u05d9\u05e7\u05d5\u05d3 \u05de\u05e8\u05db\u05d6 \u05d4\u05d0\u05de\u05e8\u05d9\u05e7\u05d0\u05d9 \u05de\u05d3\u05d5\u05d5\u05d7 \u05e9\u05d0\u05ea\u05de\u05d5\u05dc \u05d1\u05e2\u05e8\u05d1 \u05d9\u05d9\u05e8\u05d8\u05d5 \u05db\u05dc\u05d9 \u05e9\u05d9\u05d8 \u05e9\u05dc \u05d4\u05e6\u05d9 \u05d4\u05d0\u05de\u05e8\u05d9\u05e7\u05d0\u05d9 \u05d1\u05d4\u05d5\u05d1\u05dc\u05ea \u05e0\u05d5\u05e9\u05d0\u05ea \u05d4\u05de\u05d8\u05d5\u05e1\u05d9\u05dd \u05d0\u05d9\u05d9\u05d6\u05e0\u05d4\u05d0\u05d5\u05e8, \u05de\u05ea\u05e7\u05e4\u05d4 \u05de\u05d5\u05e8\u05db\u05d1\u05ea \u05e9\u05dc \u05d4\u05d7\u05d5\u05ea'\u05d9\u05dd \u05d1\u05ea\u05d9\u05de\u05df \u05e2\u05dc \u05e7\u05d5\u05d5\u05d9 \u05d4\u05e9\u05d9\u05d8 \u05d4\u05d1\u05d9\u05e0\u05dc\u05d0\u05d5\u05de\u05d9\u05dd \u05d1\u05d9\u05dd \u05d4\u05d0\u05d3\u05d5\u05dd \u05d1\u05d0\u05d6\u05d5\u05e8 \u05d1\u05d5 \u05e0\u05de\u05e6\u05d0\u05d5 \u05e1\u05e4\u05d9\u05e0\u05d5\u05ea \u05e1\u05d5\u05d7\u05e8.\u05e2\"\u05e4 \u05d4\u05d3\u05d9\u05d5\u05d5\u05d7 \u05db\u05dc\u05d9 \u05d4\u05e9\u05d9\u05d8 \u05d4\u05d0\u05de\u05e8\u05d9\u05e7\u05d0\u05d9\u05dd \u05d5\u05db\u05df \u05db\u05dc\u05d9 \u05e9\u05d9\u05d8 \u05d1\u05e8\u05d9\u05d8\u05d9 (HMS Diamond) \u05d9\u05d9\u05e8\u05d8\u05d5 \u05d0\u05ea\u05de\u05d5\u05dc \u05d1\u05e2\u05e8\u05d1 18 \u05db\u05d8\u05d1\"\u05de\u05d9\u05dd \u05de\u05ea\u05d0\u05d1\u05d3\u05d9\u05dd, \u05e9\u05e0\u05d9 \u05d8\u05d9\u05dc\u05d9 \u05e9\u05d9\u05d5\u05d8 \u05d9\u05de\u05d9\u05d9\u05dd \u05d5\u05d8\u05d9\u05dc \u05d1\u05dc\u05d9\u05e1\u05d8\u05d9 \u05d0\u05d7\u05d3 - \u05db\u05d5\u05dc\u05dd \u05e9\u05d5\u05d2\u05e8\u05d5 \u05e2\u05dc \u05d9\u05d3\u05d9 \u05d4\u05d7\u05d5\u05ea'\u05d9\u05dd.\u05e2\"\u05e4 \u05d4\u05d3\u05d9\u05d5\u05d5\u05d7 \u05dc\u05d0 \u05e0\u05d2\u05e8\u05dd \u05e0\u05d6\u05e7 \u05d5\u05dc\u05d0 \u05d4\u05d9\u05d5 \u05e0\u05e4\u05d2\u05e2\u05d9\u05dd \u05d1\u05ea\u05e7\u05d9\u05e4\u05d4 \u05d6\u05d5 \u05e9\u05d4\u05d9\u05d0 \u05d4\u05ea\u05e7\u05d9\u05e4\u05d4 \u05d4 26 \u05e9\u05dc \u05d4\u05d7\u05d5\u05ea'\u05d9\u05dd \u05de\u05d0\u05d6 \u05d7\u05d5\u05d3\u05e9 \u05e0\u05d5\u05d1\u05de\u05d1\u05e8 \u05d4\u05d0\u05d7\u05e8\u05d5\u05df.\u05d4\u05d9\u05d5\u05dd \u05e6\u05e4\u05d5\u05d9\u05d4 \u05d0\u05e8\u05d4\"\u05d1 \u05dc\u05d4\u05e2\u05d1\u05d9\u05e8 \u05d1\u05d0\u05d5\"\u05dd \u05d4\u05e6\u05e2\u05ea \u05d2\u05d9\u05e0\u05d5\u05d9 \u05e0\u05d2\u05d3 \u05d4\u05d7\u05d5\u05ea'\u05d9\u05dd.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05e0\u05e9\u05d9\u05d0 \u05d0\u05d9\u05e8\u05d0\u05df, \u05d0\u05d1\u05e8\u05d0\u05d4\u05d9\u05dd \u05e8\u05d0\u05d9\u05e1\u05d9, \u05e0\u05d7\u05ea \u05d1\u05de\u05d5\u05e1\u05e7\u05d1\u05d4 \u05dc\u05d1\u05d9\u05e7\u05d5\u05e8 \u05e8\u05e9\u05de\u05d9.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,599,"\u05e0\u05e9\u05d9\u05d0 \u05d0\u05d9\u05e8\u05d0\u05df, \u05d0\u05d1\u05e8\u05d0\u05d4\u05d9\u05dd \u05e8\u05d0\u05d9\u05e1\u05d9, \u05e0\u05d7\u05ea \u05d1\u05de\u05d5\u05e1\u05e7\u05d1\u05d4 \u05dc\u05d1\u05d9\u05e7\u05d5\u05e8 \u05e8\u05e9\u05de\u05d9.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05db\u05da \u05e0\u05e8\u05d0\u05d4 \u05d4\u05d9\u05d5\u05dd \u05d0\u05d7\u05d3 \u05d4\u05de\u05d1\u05e0\u05d9\u05dd \u05d4\u05de\u05e8\u05db\u05d6\u05d9\u05d9\u05dd \u05d1\u05d0\u05d5\u05e0' \u05d4\u05d0\u05e1\u05dc\u05d0\u05de\u05d9\u05ea \u05d1\u05e2\u05d9\u05e8 \u05e2\u05d6\u05d4, \u05d9\u05e2\u05d3 \u05e9\u05dc\u05d0 \u05d4\u05d5\u05ea\u05e7\u05e3  \u05d1\u05e1\u05d1\u05d1\u05d9 \u05d4\u05dc\u05d7\u05d9\u05de\u05d4 \u05d4\u05e7\u05d5\u05d3\u05de\u05d9\u05dd \u05d1\u05e8\u05e6\u05d5\u05e2\u05d4 (\u05d2\u05dd \u05dc\u05d0 \u05d1\u05e9\u05d5\u05de\u05e8 \u05d4\u05d7\u05d5\u05de\u05d5\u05ea).User sent a document",false,600,"\u05db\u05da \u05e0\u05e8\u05d0\u05d4 \u05d4\u05d9\u05d5\u05dd \u05d0\u05d7\u05d3 \u05d4\u05de\u05d1\u05e0\u05d9\u05dd \u05d4\u05de\u05e8\u05db\u05d6\u05d9\u05d9\u05dd \u05d1\u05d0\u05d5\u05e0' \u05d4\u05d0\u05e1\u05dc\u05d0\u05de\u05d9\u05ea \u05d1\u05e2\u05d9\u05e8 \u05e2\u05d6\u05d4, \u05d9\u05e2\u05d3 \u05e9\u05dc\u05d0 \u05d4\u05d5\u05ea\u05e7\u05e3  \u05d1\u05e1\u05d1\u05d1\u05d9 \u05d4\u05dc\u05d7\u05d9\u05de\u05d4 \u05d4\u05e7\u05d5\u05d3\u05de\u05d9\u05dd \u05d1\u05e8\u05e6\u05d5\u05e2\u05d4 (\u05d2\u05dd \u05dc\u05d0 \u05d1\u05e9\u05d5\u05de\u05e8 \u05d4\u05d7\u05d5\u05de\u05d5\u05ea).User sent a document"],["\u05e2\u05e0\u05d1\u05e8 \u05d8\u05d5\u05d9\u05d6\u05e8\u05e9\u05d9\u05e2\u05d5\u05e8 \u05d4\u05d4\u05e6\u05d1\u05e2\u05d4 \u05dc\u05e4\u05d9 \u05e9\u05db\u05d5\u05e0\u05d5\u05ea \u05d1\u05d9\u05e8\u05d5\u05e9\u05dc\u05d9\u05dd \u05e2\u05d3 \u05dc\u05e9\u05e2\u05d4 19:30:  \u05d2\u05d1\u05e2\u05ea \u05de\u05e9\u05d5\u05d0\u05d4 \u05d4\u05de\u05e2\u05d5\u05e8\u05d1\u05ea 44%; \u05d2\u05d1\u05e2\u05ea \u05e9\u05d0\u05d5\u05dc \u05d4\u05d7\u05e8\u05d3\u05d9\u05ea 49.5%; \u05e8\u05de\u05ea \u05e9\u05e8\u05ea \u05d4\u05de\u05e2\u05d5\u05e8\u05d1\u05ea 37.9%; \u05e8\u05de\u05ea \u05e9\u05dc\u05de\u05d4 \u05d4\u05d7\u05e8\u05d3\u05d9\u05ea 52%. \u05d4\u05e0\u05ea\u05d5\u05e0\u05d9\u05dd \u05de\u05d5\u05d5\u05e2\u05d3\u05ea \u05d4\u05d1\u05d7\u05d9\u05e8\u05d5\u05ea \u05d1\u05e0\u05d9\u05ea\u05d5\u05d7 \u05e9\u05dc \u05ea\u05e0\u05d5\u05e2\u05ea \u05d4\u05ea\u05e2\u05d5\u05e8\u05e8\u05d5\u05ea@N12chat",false,601,"\u05e2\u05e0\u05d1\u05e8 \u05d8\u05d5\u05d9\u05d6\u05e8\u05e9\u05d9\u05e2\u05d5\u05e8 \u05d4\u05d4\u05e6\u05d1\u05e2\u05d4 \u05dc\u05e4\u05d9 \u05e9\u05db\u05d5\u05e0\u05d5\u05ea \u05d1\u05d9\u05e8\u05d5\u05e9\u05dc\u05d9\u05dd \u05e2\u05d3 \u05dc\u05e9\u05e2\u05d4 19:30:  \u05d2\u05d1\u05e2\u05ea \u05de\u05e9\u05d5\u05d0\u05d4 \u05d4\u05de\u05e2\u05d5\u05e8\u05d1\u05ea 44%; \u05d2\u05d1\u05e2\u05ea \u05e9\u05d0\u05d5\u05dc \u05d4\u05d7\u05e8\u05d3\u05d9\u05ea 49.5%; \u05e8\u05de\u05ea \u05e9\u05e8\u05ea \u05d4\u05de\u05e2\u05d5\u05e8\u05d1\u05ea 37.9%; \u05e8\u05de\u05ea \u05e9\u05dc\u05de\u05d4 \u05d4\u05d7\u05e8\u05d3\u05d9\u05ea 52%. \u05d4\u05e0\u05ea\u05d5\u05e0\u05d9\u05dd \u05de\u05d5\u05d5\u05e2\u05d3\u05ea \u05d4\u05d1\u05d7\u05d9\u05e8\u05d5\u05ea \u05d1\u05e0\u05d9\u05ea\u05d5\u05d7 \u05e9\u05dc \u05ea\u05e0\u05d5\u05e2\u05ea \u05d4\u05ea\u05e2\u05d5\u05e8\u05e8\u05d5\u05ea@N12chat"],["\u05d0\u05d6\u05d5\u05e8 \u05de\u05e1\u05d2\u05d3 \u05d0\u05dc\u05d1\u05d5\u05e8\u05e0\u05d5, \u05e1\u05de\u05d5\u05da \u05dc\u05d1\u05d9\u05ea \u05d4\u05d7\u05d5\u05dc\u05d9\u05dd \u05e9\u05e4\u05d0\u05d0 \u05d1\u05e2\u05d9\u05e8 \u05e2\u05d6\u05d4. \u05d0\u05d6\u05d5\u05e8 \u05de\u05d0\u05d5\u05d1\u05d8\u05d7 \u05d4\u05d9\u05d8\u05d1 (:\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,602,"\u05d0\u05d6\u05d5\u05e8 \u05de\u05e1\u05d2\u05d3 \u05d0\u05dc\u05d1\u05d5\u05e8\u05e0\u05d5, \u05e1\u05de\u05d5\u05da \u05dc\u05d1\u05d9\u05ea \u05d4\u05d7\u05d5\u05dc\u05d9\u05dd \u05e9\u05e4\u05d0\u05d0 \u05d1\u05e2\u05d9\u05e8 \u05e2\u05d6\u05d4. \u05d0\u05d6\u05d5\u05e8 \u05de\u05d0\u05d5\u05d1\u05d8\u05d7 \u05d4\u05d9\u05d8\u05d1 (:\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05d0\u05d3\u05e8 \u05d2\u05d9\u05e6\u05d9\u05e1\ud83d\udcdd\u05d3\u05d5\u05d1\u05e8 \u05e6\u05d4\"\u05dc \u05e2\u05d3\u05db\u05df \u05e9\u05de\u05d8\u05d5\u05e1 \u05e7\u05e8\u05d1 \u05e9\u05dc \u05d7\u05d9\u05dc \u05d4\u05d0\u05d5\u05d5\u05d9\u05e8 \u05ea\u05e7\u05e3 \u05ea\u05e9\u05ea\u05d9\u05ea \u05d8\u05e8\u05d5\u05e8 \u05e9\u05dc \u05d7\u05d9\u05d6\u05d1\u05d0\u05dc\u05dc\u05d4 \u05d1\u05e9\u05d8\u05d7 \u05dc\u05d1\u05e0\u05d5\u05df \u05d5\u05d8\u05e0\u05e7 \u05d9\u05e8\u05d4 \u05dc\u05e2\u05d1\u05e8 \u05de\u05d8\u05e8\u05d4 \u05d1\u05db\u05d3\u05d9 \u05dc\u05d4\u05e1\u05d9\u05e8 \u05d0\u05d9\u05d5\u05dd \u05e9\u05e0\u05e9\u05e7\u05e3 \u05de\u05dc\u05d1\u05e0\u05d5\u05df.\u00a0\u05de\u05d5\u05e7\u05d3\u05dd \u05d9\u05d5\u05ea\u05e8 \u05d4\u05d1\u05d5\u05e7\u05e8, \u05e9\u05d5\u05d2\u05e8 \u05d8\u05d9\u05dc \u05e7\u05e8\u05e7\u05e2 \u05d0\u05d5\u05d5\u05d9\u05e8 \u05de\u05e9\u05d8\u05d7 \u05dc\u05d1\u05e0\u05d5\u05df \u05dc\u05e2\u05d1\u05e8 \u05db\u05dc\u05d9 \u05d8\u05d9\u05e1 \u05e9\u05dc \u05d7\u05d9\u05dc \u05d4\u05d0\u05d5\u05d5\u05d9\u05e8 \u05e9\u05e4\u05e2\u05dc \u05d1\u05de\u05e8\u05d7\u05d1. \u05d4\u05d8\u05d9\u05dc \u05dc\u05d0 \u05e4\u05d2\u05e2 \u05d1\u05db\u05dc\u05d9 \u05e9\u05e1\u05d9\u05d9\u05dd \u05d0\u05ea \u05de\u05e9\u05d9\u05de\u05ea\u05d5 \u05d1\u05d4\u05e6\u05dc\u05d7\u05d4@N12chat",false,603,"\u05d0\u05d3\u05e8 \u05d2\u05d9\u05e6\u05d9\u05e1\ud83d\udcdd\u05d3\u05d5\u05d1\u05e8 \u05e6\u05d4\"\u05dc \u05e2\u05d3\u05db\u05df \u05e9\u05de\u05d8\u05d5\u05e1 \u05e7\u05e8\u05d1 \u05e9\u05dc \u05d7\u05d9\u05dc \u05d4\u05d0\u05d5\u05d5\u05d9\u05e8 \u05ea\u05e7\u05e3 \u05ea\u05e9\u05ea\u05d9\u05ea \u05d8\u05e8\u05d5\u05e8 \u05e9\u05dc \u05d7\u05d9\u05d6\u05d1\u05d0\u05dc\u05dc\u05d4 \u05d1\u05e9\u05d8\u05d7 \u05dc\u05d1\u05e0\u05d5\u05df \u05d5\u05d8\u05e0\u05e7 \u05d9\u05e8\u05d4 \u05dc\u05e2\u05d1\u05e8 \u05de\u05d8\u05e8\u05d4 \u05d1\u05db\u05d3\u05d9 \u05dc\u05d4\u05e1\u05d9\u05e8 \u05d0\u05d9\u05d5\u05dd \u05e9\u05e0\u05e9\u05e7\u05e3 \u05de\u05dc\u05d1\u05e0\u05d5\u05df.\u00a0\u05de\u05d5\u05e7\u05d3\u05dd \u05d9\u05d5\u05ea\u05e8 \u05d4\u05d1\u05d5\u05e7\u05e8, \u05e9\u05d5\u05d2\u05e8 \u05d8\u05d9\u05dc \u05e7\u05e8\u05e7\u05e2 \u05d0\u05d5\u05d5\u05d9\u05e8 \u05de\u05e9\u05d8\u05d7 \u05dc\u05d1\u05e0\u05d5\u05df \u05dc\u05e2\u05d1\u05e8 \u05db\u05dc\u05d9 \u05d8\u05d9\u05e1 \u05e9\u05dc \u05d7\u05d9\u05dc \u05d4\u05d0\u05d5\u05d5\u05d9\u05e8 \u05e9\u05e4\u05e2\u05dc \u05d1\u05de\u05e8\u05d7\u05d1. \u05d4\u05d8\u05d9\u05dc \u05dc\u05d0 \u05e4\u05d2\u05e2 \u05d1\u05db\u05dc\u05d9 \u05e9\u05e1\u05d9\u05d9\u05dd \u05d0\u05ea \u05de\u05e9\u05d9\u05de\u05ea\u05d5 \u05d1\u05d4\u05e6\u05dc\u05d7\u05d4@N12chat"],["\u05e2\u05e8\u05d5\u05e5 \u05d0\u05dc\u05d0\u05e7\u05e6\u05d0 \u05e9\u05dc \u05d7\u05de\u05d0\u05e1: \u05d7\u05d1\u05e8\u05ea \u05d4\u05dc\u05d5\u05d5\u05d9\u05d9\u05df \u05d4\u05e6\u05e8\u05e4\u05ea\u05d9\u05ea \u05d1\u05d0\u05de\u05e6\u05e2\u05d5\u05ea\u05d4 \u05d0\u05e0\u05d7\u05e0\u05d5 \u05de\u05e9\u05d3\u05e8\u05d9\u05dd \u05d7\u05e1\u05de\u05d4 \u05d0\u05d5\u05ea\u05e0\u05d5.\n",false,604,"\u05e2\u05e8\u05d5\u05e5 \u05d0\u05dc\u05d0\u05e7\u05e6\u05d0 \u05e9\u05dc \u05d7\u05de\u05d0\u05e1: \u05d7\u05d1\u05e8\u05ea \u05d4\u05dc\u05d5\u05d5\u05d9\u05d9\u05df \u05d4\u05e6\u05e8\u05e4\u05ea\u05d9\u05ea \u05d1\u05d0\u05de\u05e6\u05e2\u05d5\u05ea\u05d4 \u05d0\u05e0\u05d7\u05e0\u05d5 \u05de\u05e9\u05d3\u05e8\u05d9\u05dd \u05d7\u05e1\u05de\u05d4 \u05d0\u05d5\u05ea\u05e0\u05d5.\n"],["\u05e2\u05e8\u05d5\u05e5 \u05d0\u05dc\u05de\u05d9\u05d0\u05d3\u05d9\u05df \u05d4\u05dc\u05d1\u05e0\u05d5\u05e0\u05d9: \u05d9\u05e9\u05e8\u05d0\u05dc \u05de\u05db\u05ea\u05e8\u05ea \u05e7\u05d1\u05d5\u05e6\u05d4 \u05e9\u05dc 9 \u05d0\u05e0\u05e9\u05d9\u05dd, \u05de\u05ea\u05d5\u05db\u05dd 6 \u05e2\u05d9\u05ea\u05d5\u05e0\u05d0\u05d9\u05dd \u05d5 3 \u05d0\u05d6\u05e8\u05d7\u05d9\u05dd \u05e1\u05de\u05d5\u05da \u05dc\u05de\u05d5\u05e6\u05d1 \u05e2\u05dc \u05d2\u05d1\u05d5\u05dc \u05dc\u05d1\u05e0\u05d5\u05df.\u05e2\"\u05e4 \u05d3\u05d9\u05d5\u05d5\u05d7 \u05e0\u05d5\u05e1\u05e3 \u05e9\u05e0\u05d9\u05d9\u05dd \u05de\u05d1\u05d9\u05df \u05d4 9 \u05e4\u05e6\u05d5\u05e2\u u05d5. \u05d0\u05dd \u05d4\u05de\u05e9\u05e4\u05d7\u05d5\u05ea \u05dc\u05d0 \u05d9\u05d2\u05d9\u05d9\u05e1\u05d5 \u05d0\u05ea \u05ea\u05de\u05d9\u05db\u05ea \u05d4\u05e2\u05d5\u05dc\u05dd \u05d5\u05d4\u05e6\u05d9\u05d1\u05d5\u05e8 \u05dc\u05e9\u05d7\u05e8\u05d5\u05e8 \u05d4\u05d7\u05d8\u05d5\u05e4\u05d9\u05dd, \u05d4\u05dd \u05d9\u05e1\u05d9\u05d9\u05de\u05d5 \u05db\u05de\u05d5 \u05e8\u05d5\u05df \u05d0\u05e8\u05d3. \u05d2\u05dd \u05dc\u05d4\u05dd \u05d4\u05de\u05dc\u05e6\u05ea\u05dd \u05e9\u05dc\u05d0 \u05dc\u05d4\u05e4\u05d2\u05d9\u05df, \u05dc\u05d0 \u05dc\u05e6\u05e2\u05d5\u05e7 \u05d5\u05dc\u05d0 \u05dc\u05d4\u05e2\u05dc\u05d5\u05ea \u05d0\u05ea \u05d4\u05de\u05d7\u05d9\u05e8. \u05d5\u05d0\u05d6 \u05e9\u05db\u05d7\u05ea\u05dd \u05d0\u05d5\u05ea\u05d5. \u05dc\u05d5 \u05d4\u05d9\u05d5 \u05e0\u05e2\u05d4, \u05d9\u05d0\u05d9\u05e8 \u05d5\u05d0\u05d1\u05e0\u05e8 \u05de\u05d5\u05d7\u05d6\u05e7\u05d9\u05dd \u05db\u05e2\u05ea \u05d1\u05d9\u05d3\u05d9 \u05d7\u05de\u05d0\u05e1 \u05d1\u05de\u05e0\u05d4\u05e8\u05d5\u05ea \u05e2\u05d6\u05d4 \u05d1\u05d9\u05d3\u05d9 \u05de\u05e8\u05e6\u05d7\u05d9\u05dd \u05de\u05ea\u05d5\u05e2\u05d1\u05d9\u05dd, \u05d4\u05d9\u05d5 \u05de\u05e8 \u05e0\u05ea\u05e0\u05d9\u05d4\u05d5 \u05d5\u05e8\u05e2\u05d9\u05d9\u05ea\u05d5 \u05d0\u05d9\u05ea\u05e0\u05d5 \u05d1\u05de\u05ea\u05d7\u05dd \u05d4\u05de\u05e9\u05e4\u05d7\u05d5\u05ea \u05d1\u05db\u05d9\u05db\u05e8 \u05d4\u05d7\u05d8\u05d5\u05e4\u05d9\u05dd \u05e0\u05dc\u05d7\u05de\u05d9\u05dd \u05e2\u05dc \u05d7\u05d9\u05d9\u05d4\u05dd\"@N12chat",false,618,"\u05d3\u05e4\u05e0\u05d4 \u05dc\u05d9\u05d0\u05dc\ud83d\udcdd\u05de\u05d8\u05d4 \u05de\u05e9\u05e4\u05d7\u05d5\u05ea \u05d4\u05d7\u05d8\u05d5\u05e4\u05d9\u05dd \u05dc\u05d0\u05d7\u05e8 \u05de\u05e1\u05d9\u05d1\u05ea \u05d4\u05e2\u05d9\u05ea\u05d5\u05e0\u05d0\u05d9\u05dd \u05e9\u05dc \u05e8\u05d4\"\u05de: \"\u05de\u05e6\u05e4\u05d9\u05dd \u05de\u05e8\u05d4\"\u05de \u05dc\u05d6\u05db\u05d5\u05e8 \u05e9\u05d4\u05d5\u05d0 \u05e0\u05d1\u05d7\u05e8 \u05e6\u05d9\u05d1\u05d5\u05e8 \u05e9\u05ea\u05e4\u05e7\u05d9\u05d3\u05d5 \u05dc\u05ea\u05e7\u05df \u05d0\u05ea \u05d4\u05de\u05d7\u05d3\u05dc, \u05d5\u05dc\u05d0 \u05dc\u05e0\u05d6\u05d5\u05e3 \u05d1\u05de\u05d9 \u05e9\u05d1\u05e0\u05d9 \u05de\u05e9\u05e4\u05d7\u05ea\u05dd \u05e0\u05d7\u05d8\u05e4\u05d5. \u05d0\u05dd \u05d4\u05de\u05e9\u05e4\u05d7\u05d5\u05ea \u05dc\u05d0 \u05d9\u05d2\u05d9\u05d9\u05e1\u05d5 \u05d0\u05ea \u05ea\u05de\u05d9\u05db\u05ea \u05d4\u05e2\u05d5\u05dc\u05dd \u05d5\u05d4\u05e6\u05d9\u05d1\u05d5\u05e8 \u05dc\u05e9\u05d7\u05e8\u05d5\u05e8 \u05d4\u05d7\u05d8\u05d5\u05e4\u05d9\u05dd, \u05d4\u05dd \u05d9\u05e1\u05d9\u05d9\u05de\u05d5 \u05db\u05de\u05d5 \u05e8\u05d5\u05df \u05d0\u05e8\u05d3. \u05d2\u05dd \u05dc\u05d4\u05dd \u05d4\u05de\u05dc\u05e6\u05ea\u05dd \u05e9\u05dc\u05d0 \u05dc\u05d4\u05e4\u05d2\u05d9\u05df, \u05dc\u05d0 \u05dc\u05e6\u05e2\u05d5\u05e7 \u05d5\u05dc\u05d0 \u05dc\u05d4\u05e2\u05dc\u05d5\u05ea \u05d0\u05ea \u05d4\u05de\u05d7\u05d9\u05e8. \u05d5\u05d0\u05d6 \u05e9\u05db\u05d7\u05ea\u05dd \u05d0\u05d5\u05ea\u05d5. \u05dc\u05d5 \u05d4\u05d9\u05d5 \u05e0\u05e2\u05d4, \u05d9\u05d0\u05d9\u05e8 \u05d5\u05d0\u05d1\u05e0\u05e8 \u05de\u05d5\u05d7\u05d6\u05e7\u05d9\u05dd \u05db\u05e2\u05ea \u05d1\u05d9\u05d3\u05d9 \u05d7\u05de\u05d0\u05e1 \u05d1\u05de\u05e0\u05d4\u05e8\u05d5\u05ea \u05e2\u05d6\u05d4 \u05d1\u05d9\u05d3\u05d9 \u05de\u05e8\u05e6\u05d7\u05d9\u05dd \u05de\u05ea\u05d5\u05e2\u05d1\u05d9\u05dd, \u05d4\u05d9\u05d5 \u05de\u05e8 \u05e0\u05ea\u05e0\u05d9\u05d4\u05d5 \u05d5\u05e8\u05e2\u05d9\u05d9\u05ea\u05d5 \u05d0\u05d9\u05ea\u05e0\u05d5 \u05d1\u05de\u05ea\u05d7\u05dd \u05d4\u05de\u05e9\u05e4\u05d7\u05d5\u05ea \u05d1\u05db\u05d9\u05db\u05e8 \u05d4\u05d7\u05d8\u05d5\u05e4\u05d9\u05dd \u05e0\u05dc\u05d7\u05de\u05d9\u05dd \u05e2\u05dc \u05d7\u05d9\u05d9\u05d4\u05dd\"@N12chat"],["\u05e1\u05e8\u05d8\u05d5\u05df \u05dc\u05d0 \u05e1\u05d9\u05de\u05e4\u05d8\u05d9 \u05de\u05d5\u05e4\u05e5 \u05d1\u05e8\u05e9\u05ea\u05d5\u05ea \u05d4\u05d7\u05d1\u05e8\u05ea\u05d9\u05d5\u05ea \u05d1\u05d5 \u05e0\u05e8\u05d0\u05d9\u05ea \u05e2\"\u05e4 \u05d4\u05d8\u05e2\u05e0\u05d4 \u05d4\u05d5\u05e6\u05d0\u05ea\u05d5 \u05dc\u05d4\u05d5\u05e8\u05d2 \u05d1\u05ea\u05dc\u05d9\u05d4 \u05e9\u05dc \u05e1\u05dc\u05d9\u05de\u05d0\u05df \u05d4\u05dc\u05d0\u05dc \u05d0\u05dc\u05d0\u05e1\u05d3, \u05d0\u05d7\u05d9\u05d9\u05e0\u05d5 \u05e9\u05dc \u05d4\u05e0\u05e9\u05d9\u05d0 \u05d1\u05e9\u05d0\u05e8 \u05d0\u05e1\u05d3, \u05d1\u05e2\u05d9\u05e8 \u05dc\u05d8\u05e7\u05d9\u05d4, \u05dc\u05e2\u05d9\u05e0\u05d9 \u05d4\u05d4\u05de\u05d5\u05df.\u05e6\u05d9\u05e8\u05e4\u05ea\u05d9 \u05e6\u05d9\u05dc\u05d5\u05dd \u05de\u05e6\u05d5\u05e0\u05d6\u05e8 \u05de\u05ea\u05d5\u05da \u05d4\u05e1\u05e8\u05d8\u05d5\u05df \u05d5\u05db\u05df \u05ea\u05de\u05d5\u05e0\u05d5\u05ea \u05e9\u05dc \u05d4\u05d0\u05d7\u05d9\u05d9\u05df.2 \u05ea\u05d2\u05d5\u05d1\u05d5\u05ea\t\u05e1\u05e8\u05d8\u05d5\u05df \u05dc\u05d0 \u05e1\u05d9\u05de\u05e4\u05d8\u05d9 \u05de\u05d5\u05e4\u05e5 \u05d1\u05e8\u05e9\u05ea\u05d5\u05ea \u05d4\u05d7\u05d1\u05e8\u05ea\u05d9\u05d5\u05ea \u05d1\u05d5 \u05e0\u05e8\u05d0\u05d9\u05ea \u05e2\"\u05e4 \u05d4\u05d8\u05e2\u05e0\u05d4 \u05d4\u05d5\u05e6\u05d0\u05ea\u05d5 \u05dc\u05d4\u05d5\u05e8\u05d2 \u05d1\u05ea\u05dc\u05d9\u05d4 \u05e9\u05dc \u05e1\u05dc\u05d9\u05de\u05d0\u05df \u05d4\u05dc\u05d0\u05dc \u05d0\u05dc\u05d0\u05e1\u05d3, \u05d0\u05d7\u05d9\u05d9\u05e0\u05d5 \u05e9\u05dc \u05d4\u05e0\u05e9\u05d9\u05d0 \u05d1\u05e9\u05d0\u05e8 \u05d0\u05e1\u05d3, \u05d1\u05e2\u05d9\u05e8 \u05dc\u05d8\u05e7\u05d9\u05d4, \u05dc\u05e2\u05d9\u05e0\u05d9 \u05d4\u05d4\u05de\u05d5\u05df.\u05e6\u05d9\u05e8\u05e4\u05ea\u05d9 \u05e6\u05d9\u05dc\u05d5\u05dd \u05de\u05e6\u05d5\u05e0\u05d6\u05e8 \u05de\u05ea\u05d5\u05da \u05d4\u05e1\u05e8\u05d8\u05d5\u05df \u05d5\u05db\u05df \u05ea\u05de\u05d5\u05e0\u05d5\u05ea \u05e9\u05dc \u05d4\u05d0\u05d7\u05d9\u05d9\u05df.2 \u05ea\u05d2\u05d5\u05d1\u05d5\u05ea",false,619,"\u05e1\u05e8\u05d8\u05d5\u05df \u05dc\u05d0 \u05e1\u05d9\u05 9\u05e0\u05d0\u05d9, \u05d4\u05de\u05e0\u05d4\u05d9\u05d2 \u05d4\u05e2\u05dc\u05d9\u05d5\u05df \u05e9\u05dc \u05d0\u05d9\u05e8\u05d0\u05df \u05dc\u05e7\u05e8\u05d0\u05ea \u05e0\u05d0\u05d5\u05de\u05d5 \u05d4\u05d1\u05d5\u05e7\u05e8 \u05e9\u05d9\u05e2\u05e1\u05d5\u05e7 \u05d2\u05dd \u05d1\u05d6\u05d9\u05e8\u05d4 \u05d4\u05e1\u05d5\u05e8\u05d9\u05ea.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05e1\u05e4\u05d9\u05e8 \u05dc\u05d9\u05e4\u05e7\u05d9\u05df\u05d3\u05d9\u05d5\u05d5\u05d7 \u05d1\u05dc\u05d1\u05e0\u05d5\u05df: \u05d0\u05d7\u05e8\u05d9 \u05d7\u05d9\u05e1\u05d5\u05dc \u05e1\u05d2\u05df \u05de\u05e0\u05d4\u05d9\u05d2 \u05d7\u05de\u05d0\u05e1 \u05e1\u05d0\u05dc\u05d7 \u05d0\u05dc-\u05e2\u05d0\u05e8\u05d5\u05e8\u05d9 \u05e0\u05ea\u05dc\u05ea\u05d4 \u05d1\u05d1\u05d9\u05d9\u05e8\u05d5\u05ea \u05db\u05e8\u05d6\u05ea \u05e2\u05e0\u05e7 \u05e9\u05dc \u05de\u05e0\u05d4\u05d9\u05d2 \u05d7\u05d9\u05d6\u05d1\u05d0\u05dc\u05dc\u05d4 \u05d7\u05e1\u05df \u05e0\u05e1\u05e8\u05d0\u05dc\u05dc\u05d4 \u05e9\u05e2\u05d5\u05e8\u05e8\u05d4 \u05e1\u05e2\u05e8\u05d4. \u05d4\u05e1\u05d9\u05d1\u05d4: \u05d4\u05d1\u05d9\u05d8\u05d5\u05d9 \u05e9\u05e0\u05db\u05ea\u05d1 \u05d1\u05d4 \u05d4\u05ea\u05e4\u05e8\u05e9 \u05d1\u05e7\u05e8\u05d1 \u05d4\u05ea\u05d5\u05e9\u05d1\u05d9\u05dd \u05db\"\u05d4\u05e7\u05e8\u05d1\u05d4 \u05dc\u05e0\u05e2\u05dc\u05d9\u05da\" - \u05d5\u05d4\u05ea\u05e7\u05d1\u05dc \u05d1\u05d1\u05d5\u05d6@N12chat",false,637,"\u05e1\u05e4\u05d9\u05e8 \u05dc\u05d9\u05e4\u05e7\u05d9\u05df\u05d3\u05d9\u05d5\u05d5\u05d7 \u05d1\u05dc\u05d1\u05e0\u05d5\u05df: \u05d0\u05d7\u05e8\u05d9 \u05d7\u05d9\u05e1\u05d5\u05dc \u05e1\u05d2\u05df \u05de\u05e0\u05d4\u05d9\u05d2 \u05d7\u05de\u05d0\u05e1 \u05e1\u05d0\u05dc\u05d7 \u05d0\u05dc-\u05e2\u05d0\u05e8\u05d5\u05e8\u05d9 \u05e0\u05ea\u05dc\u05ea\u05d4 \u05d1\u05d1\u05d9\u05d9\u05e8\u05d5\u05ea \u05db\u05e8\u05d6\u05ea \u05e2\u05e0\u05e7 \u05e9\u05dc \u05de\u d2\u05d3\u05e8\u05ea\u05dd, \"\u05ea\u05e7\u05d9\u05e4\u05ea \u05d7\u05d2\u05d5\u05e8\u05ea \u05d0\u05e9\".\u05db\u05db\u05dc \u05d4\u05e0\u05e8\u05d0\u05d4 \u05e6\u05d5\u05dc\u05dd \u05d1\u05e6\u05e4\u05d5\u05df \u05d4\u05e8\u05e6\u05d5\u05e2\u05d4.User sent a document",false,660,"\u05e2\u05e8\u05d5\u05e6\u05d9\u05dd \u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd \u05de\u05e4\u05e8\u05e1\u05de\u05d9\u05dd \u05ea\u05d9\u05e2\u05d5\u05d3 \u05de\u05e8\u05d0\u05e9\u05d9\u05ea \u05d4\u05de\u05dc\u05d7\u05de\u05d4 \u05d1\u05d5 \u05e0\u05e8\u05d0\u05d9\u05ea, \u05dc\u05d4\u05d2\u05d3\u05e8\u05ea\u05dd, \"\u05ea\u05e7\u05d9\u05e4\u05ea \u05d7\u05d2\u05d5\u05e8\u05ea \u05d0\u05e9\".\u05db\u05db\u05dc \u05d4\u05e0\u05e8\u05d0\u05d4 \u05e6\u05d5\u05dc\u05dd \u05d1\u05e6\u05e4\u05d5\u05df \u05d4\u05e8\u05e6\u05d5\u05e2\u05d4.User sent a document"],["\u05de\u05d1\u05d6\u05e7\u05df 12\u05d4\u05de\u05e9\u05e8\u05d3 \u05dc\u05d4\u05d2\u05e0\u05ea \u05d4\u05e1\u05d1\u05d9\u05d1\u05d4 \u05d4\u05d8\u05d9\u05dc \u05e9\u05e0\u05d9 \u05e2\u05d9\u05e6\u05d5\u05de\u05d9\u05dd \u05db\u05e1\u05e4\u05d9\u05d9\u05dd \u05e2\u05dc \u05d7\u05d1\u05e8\u05ea \u05ea\u05e2\u05e9\u05d9\u05d5\u05ea \u05db\u05d9\u05de\u05d9\u05d5\u05ea \u05ea\u05e4\u05d6\u05d5\u05dc \u05de\u05d1\u05d9\u05ea \u05e9\u05de\u05e9 \u05d1\u05e1\u05db\u05d5\u05dd \u05e9\u05dc \u05db\u05de\u05d9\u05dc\u05d9\u05d5\u05df \u05d5\u05d7\u05e6\u05d9 \u05e9\u05e7\u05dc\u05d9\u05dd \u05d1\u05d2\u05d9\u05df \u05d4\u05e4\u05e8\u05d5\u05ea \u05e9\u05dc \u05d4\u05d9\u05ea\u05e8\u05d9 \u05e8\u05e2\u05dc\u05d9\u05dd \u05d5\u05d0\u05d9\u05e8\u05d5\u05e2 \u05d7\u05d5\u05de\u05e8\u05d9\u05dd \u05de\u05e1\u05d5\u05db\u05e0\u05d9\u05dd. \u05d6\u05d0\u05ea \u05dc\u05d0\u05d7\u05e8 \u05e9\u05d1\u05e1\u05d9\u05d5\u05e8 \u05e9\u05e0\u05e2\u05e8\u05da \u05d1\u05de\u05d7\u05e1\u05df \u05d4\u05d7\u05d1\u05e8\u05d4 \u05e2\u05dc\u05d5 \u05d4\u05e4\u05e8\u05d5\u05ea \u05e9\u05d5\u05e0\u05d5\u05ea \u05e9\u05db\u05dc\u05dc\u05d5, \u05d1\u05d9\u05df \u05d4
