: \"\u05db\u05db\u05dc \u05e9\u05d9\u05d5\u05ea\u05e8 \u05e0\u05d4\u05d2\u05d9\u05dd \u05d7\u05d5\u05d6\u05e8\u05d9\u05dd \u05dc\u05db\u05d1\u05d9\u05e9\u05d9\u05dd, \u05d0\u05e0\u05d7\u05e0\u05d5 \u05de\u05e2\u05d3\u05db\u05e0\u05d9\u05dd \u05d0\u05ea \u05de\u05e4\u05d5\u05ea Google \u05d5-Waze \u05db\u05da \u05e9\u05d4\u05de\u05e9\u05ea\u05de\u05e9\u05d9\u05dd \u05d9\u05d5\u05db\u05dc\u05d5 \u05dc\u05e8\u05d0\u05d5\u05ea \u05d0\u05ea \u05de\u05e6\u05d1 \u05d4\u05ea\u05e0\u05d5\u05e2\u05d4 \u05d1\u05d6\u05de\u05df \u05d0\u05de\u05ea \u05dc\u05d0\u05d5\u05e8\u05da \u05d4\u05de\u05e1\u05dc\u05d5\u05dc \u05e9\u05dc\u05d4\u05dd \u05db\u05e9\u05d4\u05dd \u05de\u05e0\u05d5\u05d5\u05d8\u05d9\u05dd. \u05e2\u05d5\u05de\u05e1\u05d9 \u05ea\u05e0\u05d5\u05e2\u05d4 \u05d5\u05e9\u05db\u05d1\u05ea \u05d4\u05de\u05d9\u05d3\u05e2 \u05e2\u05dc\u05d9\u05d4\u05dd \u05d1\u05de\u05e4\u05d5\u05ea Google \u05e2\u05d3\u05d9\u05d9\u05df \u05de\u05d5\u05e9\u05d1\u05ea\u05ea\"@N12chat",false,673,"\u05de\u05d1\u05d6\u05e7\u05df 12\u05d3\u05d9\u05d5\u05d5\u05d7\u05d9 \u05d4\u05ea\u05e0\u05d5\u05e2\u05d4 \u05d5\u05d4\u05e4\u05e7\u05e7\u05d9\u05dd \u05d7\u05d6\u05e8\u05d5 \u05dc-Waze. \u05de\u05d4\u05d7\u05d1\u05e8\u05d4 \u05e0\u05de\u05e1\u05e8: \"\u05db\u05db\u05dc \u05e9\u05d9\u05d5\u05ea\u05e8 \u05e0\u05d4\u05d2\u05d9\u05dd \u05d7\u05d5\u05d6\u05e8\u05d9\u05dd \u05dc\u05db\u05d1\u05d9\u05e9\u05d9\u05dd, \u05d0\u05e0\u05d7\u05e0\u05d5 \u05de\u05e2\u05d3\u05db\u05e0\u05d9\u05dd \u05d0\u05ea \u05de\u05e4\u05d5\u05ea Google \u05d5-Waze \u05db\u05da \u05e9\u05d4\u05de\u05e9\u05ea\u05de\u05e9\u05d9\u05dd \u05d9\u05d5\u05db\u05dc\u05d5 \u05dc\u05e8\u05d0\u05d5\u05ea \u05d0\u05ea \u05de\u05e6\u05d1 \u05d4\u05ea\u05e0\u05d5\u05e2\u05d4 \u05d1\u05d6\u05de\u05df \u05d0\u05de\u05ea \u05dc\u05d0\u05d5\u05e8\u05da \u05d4\u05de\u05e1\u05dc\u05d5\u05dc \u05e9\u05dc\u05d4\u05dd \u05db\u05e9\u05d4\u05dd \u05de\u05e0\u05d5\u05d5\u05d8\u05d9\u05dd. \u05e2\u05d5\u05de\u05e1\u05d9 \u05ea\u05e0\u05d5\u05e2\u05d4 \u05d5\u05e9\u05db\u05d1\u05ea \u05d4\u05de\u05d9\u05d3\u05e2 \u05e2\u05dc\u05d9\u05d4\u05dd \u05d1\u05de\u05e4\u05d5\u05ea Google \u05e2\u05d3\u05d9\u05d9\u05df \u05de\u05d5\u05e9\u05d1\u05ea\u05ea\"@N12chat"],["\u05e0\u05d9\u05e8 \u05d3\u05d1\u05d5\u05e8\u05d9\u05d4\u05ea\u05e8\u05d5\u05e4\u05d5\u05ea \u05dc\u05d7\u05d8\u05d5\u05e4\u05d9\u05dd \u05e9\u05d0\u05d5\u05ea\u05e8\u05d5 \u05d1\u05d1\u05d9\u05d4\"\u05d7 \u05e0\u05d0\u05e1\u05e8 \u05d1\u05e2\u05d6\u05d4: \u05de\u05e1\u05e4\u05e8 \u05d0\u05e8\u05d2\u05d6\u05d9 \u05ea\u05e8\u05d5\u05e4\u05d5\u05ea \u05dc\u05d0 \u05d4\u05d2\u05d9\u05e2\u05d5 \u05dc\u05d9\u05e2\u05d3\u05df \u05d5\u05dc\u05d0 \u05e0\u05e2\u05e9\u05d4 \u05d1\u05d4\u05df \u05e9\u05d9\u05de\u05d5\u05e9. \u05e2\u05dc \u05d4\u05ea\u05e8\u05d5\u05e4\u05d5\u05ea \u05d4\u05de\u05de\u05d5\u05e2\u05e0\u05d5\u05ea \u05d4\u05d9\u05d5 \u05e9\u05de\u05d5\u05ea \u05d5\u05ea\u05de\u05d5\u05e0\u05d5\u05ea \u05e9\u05dc \u05d7\u05d8\u05d5\u05e4\u05d9\u05dd, \u05e9\u05d7\u05dc\u05e7\u05dd \u05db\u05d1\u05e8 \u05e9\u05d5\u05d7\u05e8\u05e8\u05d5. \u05d9\u05e9\u05e8\u05d0\u05dc \u05de\u05d1\u05e8\u05e8\u05ea \u05db\u05e2\u05ea \u05de\u05ea\u05d9 \u05d4\u05ea\u05e8\u05d5\u05e4\u05d5\u05ea \u05d4\u05d5\u05e2\u05d1\u05e8\u05d5 \u05dc\u05d9\u05d3\u05d9 \u05d4\u05e6\u05dc\u05d1 \u05d4\u05d0\u05d3\u05d5\u05dd \u05db\u05d0\u05e9\u05e8 \u05d1\u05de\u05e2\u05e8\u05db\u05ea \u05d4\u05d1\u05d9\u05d8\u05d7\u05d5\u05df \u05d9\u05d5\u05d3\u05e2\u05d9\u05dd \u05db\u05d9 \u05d1\u05d1\u05d9\u05d4\"\u05d7 \u05d4\u05d5\u05d7\u05d6\u05e7\u05d5 \u05d7\u05d8\u05d5\u05e4\u05d9\u05dd \u05e2\u05d3 \u05e9\u05dc\u05d1 \u05de\u05e1\u05d5\u05d9\u05dd. \u05e0\u05ea\u05e4\u05e1\u05d5 \u05d1\u05d5 \u05db-30 \u05e9\u05d1\u05d5\u05d9\u05d9\u05dd \u05e9\u05e0\u05d7\u05e7\u05e8\u05d9\u05dd \u05db\u05e2\u05ea@N12chat",false,674,"\u05e0\u05d9\u05e8 \u05d3\u05d1\u05d5\u05e8\u05d9\u05d4\u05ea\u05e8\u05d5\u05e4\u05d5\u05ea \u05dc\u05d7\u05d8\u05d5\u05e4\u05d9\u05dd \u05e9\u05d0\u05d5\u05ea\u05e8\u05d5 \u05d1\u05d1\u05d9\u05d4\"\u05d7 \u05e0\u05d0\u05e1\u05e8 \u05d1\u05e2\u05d6\u05d4: \u05de\u05e1\u05e4\u05e8 \u05d0\u05e8\u05d2\u05d6\u05d9 \u05ea\u05e8\u05d5\u05e4\u05d5\u05ea \u05dc\u05d0 \u05d4\u05d2\u05d9\u05e2\u05d5 \u05dc\u05d9\u05e2\u05d3\u05df \u05d5\u05dc\u05d0 \u05e0\u05e2\u05e9\u05d4 \u05d1\u05d4\u05df \u05e9\u05d9\u05de\u05d5\u05e9. \u05e2\u05dc \u05d4\u05ea\u05e8\u05d5\u05e4\u05d5\u05ea \u05d4\u05de\u05de\u05d5\u05e2\u05e0\u05d5\u05ea \u05d4\u05d9\u05d5 \u05e9\u05de\u05d5\u05ea \u05d5\u05ea\u05de\u05d5\u05e0\u05d5\u05ea \u05e9\u05dc \u05d7\u05d8\u05d5\u05e4\u05d9\u05dd, \u05e9\u05d7\u05dc\u05e7\u05dd \u05db\u05d1\u05e8 \u05e9\u05d5\u05d7\u05e8\u05e8\u05d5. \u05d9\u05e9\u05e8\u05d0\u05dc \u05de\u05d1\u05e8\u05e8\u05ea \u05db\u05e2\u05ea \u05de\u05ea\u05d9 \u05d4\u05ea\u05e8\u05d5\u05e4\u05d5\u05ea \u05d4\u05d5\u05e2\u05d1\u05e8\u05d5 \u05dc\u05d9\u05d3\u05d9 \u05d4\u05e6\u05dc\u05d1 \u05d4\u05d0\u05d3\u05d5\u05dd \u05db\u05d0\u05e9\u05e8 \u05d1\u05de\u05e2\u05e8\u05db\u05ea \u05d4\u05d1\u05d9\u05d8\u05d7\u05d5\u05df \u05d9\u05d5\u05d3\u05e2\u05d9\u05dd \u05db\u05d9 \u05d1\u05d1\u05d9\u05d4\"\u05d7 \u05d4\u05d5\u05d7\u05d6\u05e7\u05d5 \u05d7\u05d8\u05d5\u05e4\u05d9\u05dd \u05e2\u05d3 \u05e9\u05dc\u05d1 \u05de\u05e1\u05d5\u05d9\u05dd. \u05e0\u05ea\u05e4\u05e1\u05d5 \u05d1\u05d5 \u05db-30 \u05e9\u05d1\u05d5\u05d9\u05d9\u05dd \u05e9\u05e0\u05d7\u05e7\u05e8\u05d9\u05dd \u05db\u05e2\u05ea@N12chat"],["\u05d3\u05e1\u05e7 \u05d4\u05d7\u05d5\u05e5\u05e1\u05e7\u05e8 \u05e8\u05d5\u05d9\u05d8\u05e8\u05e1: \u05d0\u05d7\u05d5\u05d6\u05d9 \u05d4\u05ea\u05de\u05d9\u05db\u05d4 \u05e9\u05dc \u05d4\u05e6\u05d9\u05d1\u05d5\u05e8 \u05d1\u05e0\u05e9\u05d9\u05d0 \u05d1\u05d9\u05d9\u05d3\u05df \u05e2\u05d5\u05de\u05d3\u05d9\u05dd \u05e2\u05dc 40% - \u05e2\u05dc\u05d9\u05d4 \u05e9\u05dc \u05d0\u05d7\u05d5\u05d6 \u05d0\u05d7\u05d3 \u05de\u05d7\u05d5\u05d3\u05e9 \u05e9\u05e2\u05d1\u05e8@N12chat",false,675,"\u05d3\u05e1\u05e7 \u05d4\u05d7\u05d5\u05e5\u05e1\u05e7\u05e8 \u05e8\u05d5\u05d9\u05d8\u05e8\u05e1: \u05d0\u05d7\u05d5\u05d6\u05d9 \u05d4\u05ea\u05de\u05d9\u05db\u05d4 \u05e9\u05dc \u05d4\u05e6\u05d9\u05d1\u05d5\u05e8 \u05d1\u05e0\u05e9\u05d9\u05d0 \u05d1\u05d9\u05d9\u05d3\u05df \u05e2\u05d5\u05de\u05d3\u05d9\u05dd \u05e2\u05dc 40% - \u05e2\u05dc\u05d9\u05d4 \u05e9\u05dc \u05d0\u05d7\u05d5\u05d6 \u05d0\u05d7\u05d3 \u05de\u05d7\u05d5\u05d3\u05e9 \u05e9\u05e2\u05d1\u05e8@N12chat"],["\u05e9\u05d5\u05e9\u05d9 \u05d7\u05ea\u05d5\u05e7\u05d4\u05d8\u05d0\u05e8\u05e7 \u05d0\u05d1\u05d5 \u05e2\u05e8\u05d0\u05e8, \u05e8\u05d5\u05e4\u05d0 \u05d1\u05d1\u05d9\u05ea \u05d4\u05d7\u05d5\u05dc\u05d9\u05dd \u05d1\u05e8\u05d6\u05d9\u05dc\u05d9, \u05e0\u05e4\u05d2\u05e9 \u05e2\u05dd \u05e0\u05e9\u05d9\u05d0 \u05d4\u05de\u05d3\u05d9\u05e0\u05d4 \u05d4\u05e8\u05e6\u05d5\u05d2. \u05d0\u05d1\u05d5 \u05e2\u05e8\u05d0\u05e8, \u05e9\u05d4\u05d5\u05d7\u05d6\u05e7 \u05e2\u05dc \u05d9\u05d3\u05d9 \u05d7\u05de\u05d0\u05e1 \u05db\u05d1\u05df \u05e2\u05e8\u05d5\u05d1\u05d4 \u05d1-7 \u05d1\u05d0\u05d5\u05e7\u05d8\u05d5\u05d1\u05e8, \u05e9\u05d7\u05d6\u05e8 \u05d1\u05e4\u05e0\u05d9 \u05d4\u05e0\u05e9\u05d9\u05d0 \u05d0\u05ea \u05e8\u05d2\u05e2\u05d9 \u05d4\u05d0\u05d9\u05de\u05d4 \u2013 \u05d1\u05e9\u05e2\u05d4 \u05e9\u05e0\u05d9\u05e1\u05d4 \u05dc\u05d4\u05e6\u05d9\u05dc \u05d7\u05d9\u05d9\u05dd: \"\u05db\u05e9\u05e0\u05d5\u05e8\u05d4 \u05d4\u05db\u05d3\u05d5\u05e8 \u05e8\u05d0\u05e9\u05d5\u05df \u05e0\u05e4\u05dc\u05ea\u05d9 \u05d0\u05d7\u05d5\u05e8\u05d4 \u05de\u05d4\u05d4\u05d3\u05e3 \u05d5\u05db\u05d0\u05d1 \u05dc\u05d9 \u05d1\u05d7\u05d6\u05d4, \u05d7\u05e9\u05d1\u05ea\u05d9 \u05dc\u05e2\u05e6\u05de\u05d9 \u05e9\u05d6\u05d4\u05d5 - \u05d0\u05e0\u05d9 \u05de\u05ea. \u05e4\u05ea\u05d0\u05d5\u05dd \u05d9\u05e6\u05d0\u05d5 \u05de\u05d1\u05d9\u05df \u05d4\u05e9\u05d9\u05d7\u05d9\u05dd \u05e2\u05e9\u05e8\u05d4 \u05de\u05d7\u05d1\u05dc\u05d9\u05dd \u05e9\u05e7\u05e9\u05e8\u05d5 \u05d0\u05d5\u05ea\u05d9 \u05d1\u05d0\u05de\u05e6\u05e2 \u05d4\u05e6\u05d5\u05de\u05ea. \u05e0\u05e9\u05d0\u05e8 \u05dc\u05d9 \u05e8\u05e7 \u05dc\u05d4\u05ea\u05e4\u05dc\u05dc\". \u05e6\u05d9\u05dc\u05d5\u05dd: \u05e2\u05de\u05d5\u05e1 \u05d1\u05df \u05d2\u05e8\u05e9\u05d5\u05dd, \u05dc\u05e2\"\u05de@N12chat",false,676,"\u05e9\u05d5\u05e9\u05d9 \u05d7\u05ea\u05d5\u05e7\u05d4\u05d8\u05d0\u05e8\u05e7 \u05d0\u05d1\u05d5 \u05e2\u05e8\u05d0\u05e8, \u05e8\u05d5\u05e4\u05d0 \u05d1\u05d1\u05d9\u05ea \u05d4\u05d7\u05d5\u05dc\u05d9\u05dd \u05d1\u05e8\u05d6\u05d9\u05dc\u05d9, \u05e0\u05e4\u05d2\u05e9 \u05e2\u05dd \u05e0\u05e9\u05d9\u05d0 \u05d4\u05de\u05d3\u05d9\u05e0\u05d4 \u05d4\u05e8\u05e6\u05d5\u05d2. \u05d0\u05d1\u05d5 \u05e2\u05e8\u05d0\u05e8, \u05e9\u05d4\u05d5\u05d7\u05d6\u05e7 \u05e2\u05dc \u05d9\u05d3\u05d9 \u05d7\u05de\u05d0\u05e1 \u05db\u05d1\u05df \u05e2\u05e8\u05d5\u05d1\u05d4 \u05d1-7 \u05d1\u05d0\u05d5\u05e7\u05d8\u05d5\u05d1\u05e8, \u05e9\u05d7\u05d6\u05e8 \u05d1\u05e4\u05e0\u05d9 \u05d4\u05e0\u05e9\u05d9\u05d0 \u05d0\u05ea \u05e8\u05d2\u05e2\u05d9 \u05d4\u05d0\u05d9\u05de\u05d4 \u2013 \u05d1\u05e9\u05e2\u05d4 \u05e9\u05e0\u05d9\u05e1\u05d4 \u05dc\u05d4\u05e6\u05d9\u05dc \u05d7\u05d9\u05d9\u05dd: \"\u05db\u05e9\u05e0\u05d5\u05e8\u05d4 \u05d4\u05db\u05d3\u05d5\u05e8 \u05e8\u05d0\u05e9\u05d5\u05df \u05e0\u05e4\u05dc\u05ea\u05d9 \u05d0\u05d7\u05d5\u05e8\u05d4 \u05de\u05d4\u05d4\u05d3\u05e3 \u05d5\u05db\u05d0\u05d1 \u05dc\u05d9 \u05d1\u05d7\u05d6\u05d4, \u05d7\u05e9\u05d1\u05ea\u05d9 \u05dc\u05e2\u05e6\u05de\u05d9 \u05e9\u05d6\u05d4\u05d5 - \u05d0\u05e0\u05d9 \u05de\u05ea. \u05e4\u05ea\u05d0\u05d5\u05dd \u05d9\u05e6\u05d0\u05d5 \u05de\u05d1\u05d9\u05df \u05d4\u05e9\u05d9\u05d7\u05d9\u05dd \u05e2\u05e9\u05e8\u05d4 \u05de\u05d7\u05d1\u05dc\u05d9\u05dd \u05e9\u05e7\u05e9\u05e8\u05d5 \u05d0\u05d5\u05ea\u05d9 \u05d1\u05d0\u05de\u05e6\u05e2 \u05d4\u05e6\u05d5\u05de\u05ea. \u05e0\u05e9\u05d0\u05e8 \u05dc\u05d9 \u05e8\u05e7 \u05dc\u05d4\u05ea\u05e4\u05dc\u05dc\". \u05e6\u05d9\u05dc\u05d5\u05dd: \u05e2\u05de\u05d5\u05e1 \u05d1\u05df \u05d2\u05e8\u05e9\u05d5\u05dd, \u05dc\u05e2\"\u05de@N12chat"],["\u05d3\u05e0\u05d9 \u05e7\u05d5\u05e9\u05de\u05e8\u05d5\u05de\u05d9\u05d9\u05d4 \u05e9\u05dd \u05de\u05d3\u05d1\u05e8\u05ea: \"54 \u05d9\u05d5\u05dd \u05dc\u05d1\u05d3 \u05d1\u05d7\u05d3\u05e8, \u05e2\u05dd \u05de\u05d7\u05d1\u05dc \u05e9\u05dc\u05d0 \u05d4\u05d5\u05e8\u05d9\u05d3 \u05de\u05de\u05e0\u05d9 \u05d0\u05ea \u05d4\u05e2\u05d9\u05e0\u05d9\u05d9\u05dd \u05dc\u05e8\u05d2\u05e2\" | \u05d4\u05e2\u05e8\u05d1 \u05d1\"\u05d0\u05d5\u05dc\u05e4\u05df \u05e9\u05d9\u05e9\u05d9\"@N12chat",false,677,"\u05d3\u05e0\u05d9 \u05e7\u05d5\u05e9\u05de\u05e8\u05d5\u05de\u05d9\u05d9\u05d4 \u05e9\u05dd \u05de\u05d3\u05d1\u05e8\u05ea: \"54 \u05d9\u05d5\u05dd \u05dc\u05d1\u05d3 \u05d1\u05d7\u05d3\u05e8, \u05e2\u05dd \u05de\u05d7\u05d1\u05dc \u05e9\u05dc\u05d0 \u05d4\u05d5\u05e8\u05d9\u05d3 \u05de\u05de\u05e0\u05d9 \u05d0\u05ea \u05d4\u05e2\u05d9\u05e0\u05d9\u05d9\u05dd \u05dc\u05e8\u05d2\u05e2\" | \u05d4\u05e2\u05e8\u05d1 \u05d1\"\u05d0\u05d5\u05dc\u05e4\u05df \u05e9\u05d9\u05e9\u05d9\"@N12chat"],["\u05d3\u05e1\u05e7 \u05d4\u05e2\u05d5\u05dc\u05dd \u05d4\u05e2\u05e8\u05d1\u05d9\u05d3\u05d9\u05d5\u05d5\u05d7\u05d9\u05dd \u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05d9\u05dd: \u05ea\u05e7\u05d9\u05e4\u05d5\u05ea \u05e2\u05e6\u05d9\u05de\u05d5\u05ea \u05e9\u05dc \u05e6\u05d4\"\u05dc \u05d1\u05de\u05d7\u05e0\u05d4 \u05d4\u05e4\u05dc\u05d9\u05d8\u05d9\u05dd \u05d0\u05dc-\u05de\u05e2'\u05d0\u05d6\u05d9 \u05e9\u05d1\u05de\u05e8\u05db\u05d6 \u05e8\u05e6\u05d5\u05e2\u05ea \u05e2\u05d6\u05d4@N12chat",false,678,"\u05d3\u05e1\u05e7 \u05d4\u05e2\u05d5\u05dc\u05dd \u05d4\u05e2\u05e8\u05d1\u05d9\u05d3\u05d9\u05d5\u05d5\u05d7\u05d9\u05dd \u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05d9\u05dd: \u05ea\u05e7\u05d9\u05e4\u05d5\u05ea \u05e2\u05e6\u05d9\u05de\u05d5\u05ea \u05e9\u05dc \u05e6\u05d4\"\u05dc \u05d1\u05de\u05d7\u05e0\u05d4 \u05d4\u05e4\u05dc\u05d9\u05d8\u05d9\u05dd \u05d0\u05dc-\u05de\u05e2'\u05d0\u05d6\u05d9 \u05e9\u05d1\u05de\u05e8\u05db\u05d6 \u05e8\u05e6\u05d5\u05e2\ 5e4\u05e7\u05d3\u05d5\u05ea \u05e9\u05dc \u05de\u05e0\u05d2\u05e0\u05d5\u05e0\u05d9 \u05d4\u05d1\u05d9\u05d8\u05d7\u05d5\u05df \u05e9\u05dc \u05d7\u05de\u05d0\u05e1 \u05d5\u05d1\u05e1\u05d1\u05d9\u05e8\u05d5\u05ea \u05d2\u05d1\u05d5\u05d4\u05d4 \u05de\u05d0\u05d5\u05d3 \u05de\u05ea\u05d7\u05ea\u05d9\u05d5 \u05e0\u05de\u05e6\u05d0\u05d9\u05dd \u05d9\u05e2\u05d3\u05d9 \u05ea\u05ea \u05e7\u05e8\u05e7\u05e2 \u05d1\u05e2\u05dc\u05d9 \u05d7\u05e9\u05d9\u05d1\u05d5\u05ea - \u05d0\u05d9\u05df \u05d6\u05d4 \u05d7\u05d3\u05e9 \u05e9\u05d7\u05de\u05d0\u05e1 \u05de\u05e9\u05ea\u05de\u05e9\u05ea \u05d1\u05d1\u05ea\u05d9 \u05d7\u05d5\u05dc\u05d9\u05dd \u05db\u05de\u05d2\u05df \u05d0\u05e0\u05d5\u05e9\u05d9 \u05de\u05e4\u05e0\u05d9 \u05ea\u05e7\u05d9\u05e4\u05d5\u05ea \u05d9\u05e9\u05e8\u05d0\u05dc\u05d9\u05d5\u05ea.\u05d0\u05dd \u05d0\u05db\u05df \u05d9\u05e4\u05d5\u05e0\u05d4 \u05d1\u05d9\u05ea \u05d4\u05d7\u05d5\u05dc\u05d9\u05dd \u05d0\u05dc\u05e7\u05d3\u05e1 \u05d6\u05d4 \u05d9\u05d4\u05d9\u05d4 \u05ea\u05e7\u05d3\u05d9\u05dd \u05de\u05e2\u05e0\u05d9\u05d9\u05df \u05dc\u05e7\u05e8\u05d0\u05ea \u05e4\u05d9\u05e0\u05d5\u05d9 \u05e9\u05dc \u05d1\u05ea\u05d9 \u05d7\u05d5\u05dc\u05d9\u05dd \u05e0\u05d5\u05e1\u05e4\u05d9\u05dd \u05e2\u05dd \u05de\u05d0\u05e4\u05d9\u05d9\u05e0\u05d9\u05dd \u05d3\u05d5\u05de\u05d9\u05dd.\n"],["\u05d3\u05d5\u05d1\u05e8 \u05e6\u05d4\u05f4\u05dc:*\u05e6\u05d4\u05f4\u05dc \u05d7\u05d9\u05e1\u05dc \u05d1\u05e1\u05d5\u05e8\u05d9\u05d4 \u05d0\u05ea \u05d4\u05d0\u05d7\u05e8\u05d0\u05d9 \u05dc\u05e9\u05d9\u05d2\u05d5\u05e8\u05d9 \u05d4\u05e8\u05e7\u05d8\u05d5\u05ea \u05e9\u05dc \u05d0\u05e8\u05d2\u05d5\u05df \u05d4\u05d8\u05e8\u05d5\u05e8 \u05d7\u05de\u05d0\u05e1 \u05de\u05e1\u05d5\u05e8\u05d9\u05d4 \u05dc\u05e9\u05d8\u05d7 \u05d9\u05e9\u05e8\u05d0\u05dc*\u05e6\u05d4\u05f4\u05dc \u05d7\u05d9\u05e1\u05dc \u05d4\u05d9\u05d5\u05dd (\u05d1\u05f3) \u05d1\u05d1\u05d9\u05ea \u05d2\u05f3\u05df \u05d1\u05e1\u05d5\u05e8\u05d9\u05d4 \u05d0\u05ea \u05d7\u05e1\u05df \u05e2\u05db\u05d0\u05e9\u05d4, \u05e9\u05d4\u05d9\u05d4 \u05d0\u05d7\u05e8\u05d0\u05d9 \u05de\u05e8\u05db\u05d6\u05d9 \u05dc\u05e9\u05d9\u05d2\u05d5\u05e8\u05d9 \u05d4\u05e8\u05e7\u05d8\u05d5\u05ea \u05e9\u05dc \u05d0\u05e8\u05d2\u05d5\u05df \u05d4\u05d8\u05e8\u05d5\u05e8 \u05d7\u05de\u05d0\u05e1 \u05de\u05e9\u05d8\u05d7 \u05e1\u05d5\u05e8\u05d9\u05d4 \u05dc\u05e2\u05d1\u05e8 \u05e2\u05d5\u05e8\u05e3 \u05de\u05d3\u05d9\u05e0\u05ea \u05d9\u05e9\u05e8\u05d0\u05dc \u05d1\u05e9\u05d1\u05d5\u05e2\u05d5\u05ea \u05d4\u05d0\u05d7\u05e8\u05d5\u05e0\u05d9\u05dd.\u05de\u05ea\u05d7\u05d9\u05dc\u05ea \u05d4\u05de\u05dc\u05d7\u05de\u05d4 \u05d7\u05e1\u05df \u05d4\u05db\u05d5\u05d5\u05d9\u05df \u05d7\u05d5\u05dc\u05d9\u05d5\u05ea \u05d8\u05e8\u05d5\u05e8 \u05e9\u05dc \u05d7\u05de\u05d0\u05e1 \u05d0\u05e9\u05e8 \u05d1\u05d9\u05e6\u05e2\u05d5 \u05d9\u05e8\u05d9 \u05e8\u05e7\u05d8\u05d9 \u05de\u05e1\u05d5\u05e8\u05d9\u05d4 \u05dc\u05e2\u05d1\u05e8 \u05e9\u05d8\u05d7\u05d9 \u05de\u05d3\u05d9\u05e0\u05ea \u05d9\u05e9\u05e8\u05d0\u05dc.\u05dc\u05d0 \u05e0\u05d0\u05e4\u05e9\u05e8 \u05d8\u05e8\u05d5\u05e8 \u05de\u05e9\u05d8\u05d7 \u05e1\u05d5\u05e8\u05d9\u05d4 \u05d5\u05d4\u05d9\u05d0 \u05d0\u05d7\u05e8\u05d0\u05d9\u05ea \u05dc\u05db\u05dc \u05e4\u05e2\u05d5\u05dc\u05d4 \u05d4\u05d9\u05d5\u05e6\u05d0\u05ea \u05de\u05e9\u05d8\u05d7\u05d4. \u05e0\u05de\u05e9\u05d9\u05da \u05dc\u05e4\u05e2\u05d5\u05dc \u05db\u05e0\u05d2\u05d3 \u05db\u05dc \u05d0\u05d9\u05d5\u05dd.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,699,"\u05d3\u05d5\u05d1\u05e8 \u05e6\u05d4\u05f4\u05dc:*\u05e6\u05d4\u05f4\u05dc \u05d7\u05d9\u05e1\u05dc \u05d1\u05e1\u05d5\u05e8\u05d9\u05d4 \u05d0\u05ea \u05d4\u05d0\u05d7\u05e8\u05d0\u05d9 \u05dc\u05e9\u05d9\u05d2\u05d5\u05e8\u05d9 \u05d4\u05e8\u05e7\u05d8\u05d5\u05ea \u05e9\u05dc \u05d0\u05e8\u05d2\u05d5\u05df \u05d4\u05d8\u05e8\u05d5\u05e8 \u05d7\u05de\u05d0\u05e1 \u05de\u05e1\u05d5\u05e8\u05d9\u05d4 \u05dc\u05e9\u05d8\u05d7 \u05d9\u05e9\u05e8\u05d0\u05dc*\u05e6\u05d4\u05f4\u05dc \u05d7\u05d9\u05e1\u05dc \u05d4\u05d9\u05d5\u05dd (\u05d1\u05f3) \u05d1\u05d1\u05d9\u05ea \u05d2\u05f3\u05df \u05d1\u05e1\u05d5\u05e8\u05d9\u05d4 \u05d0\u05ea \u05d7\u05e1\u05df \u05e2\u05db\u05d0\u05e9\u05d4, \u05e9\u05d4\u05d9\u05d4 \u05d0\u05d7\u05e8\u05d0\u05d9 \u05de\u05e8\u05db\u05d6\u05d9 \u05dc\u05e9\u05d9\u05d2\u05d5\u05e8\u05d9 \u05d4\u05e8\u05e7\u05d8\u05d5\u05ea \u05e9\u05dc \u05d0\u05e8\u05d2\u05d5\u05df \u05d4\u05d8\u05e8\u05d5\u05e8 \u05d7\u05de\u05d0\u05e1 \u05de\u05e9\u05d8\u05d7 \u05e1\u05d5\u05e8\u05d9\u05d4 \u05dc\u05e2\u05d1\u05e8 \u05e2\u05d5\u05e8\u05e3 \u05de\u05d3\u05d9\u05e0\u05ea \u05d9\u05e9\u05e8\u05d0\u05dc \u05d1\u05e9\u05d1\u05d5\u05e2\u05d5\u05ea \u05d4\u05d0\u05d7\u05e8\u05d5\u05e0\u05d9\u05dd.\u05de\u05ea\u05d7\u05d9\u05dc\u05ea \u05d4\u05de\u05dc\u05d7\u05de\u05d4 \u05d7\u05e1\u05df \u05d4\u05db\u05d5\u05d5\u05d9\u05df \u05d7\u05d5\u05dc\u05d9\u05d5\u05ea \u05d8\u05e8\u05d5\u05e8 \u05e9\u05dc \u05d7\u05de\u05d0\u05e1 \u05d0\u05e9\u05e8 \u05d1\u05d9\u05e6\u05e2\u05d5 \u05d9\u05e8\u05d9 \u05e8\u05e7\u05d8\u05d9 \u05de\u05e1\u05d5\u05e8\u05d9\u05d4 \u05dc\u05e2\u05d1\u05e8 \u05e9\u05d8\u05d7\u05d9 \u05de\u05d3\u05d9\u05e0\u05ea \u05d9\u05e9\u05e8\u05d0\u05dc.\u05dc\u05d0 \u05e0\u05d0\u05e4\u05e9\u05e8 \u05d8\u05e8\u05d5\u05e8 \u05de\u05e9\u05d8\u05d7 \u05e1\u05d5\u05e8\u05d9\u05d4 \u05d5\u05d4\u05d9\u05d0 \u05d0\u05d7\u05e8\u05d0\u05d9\u05ea \u05dc\u05db\u05dc \u05e4\u05e2\u05d5\u05dc\u05d4 \u05d4\u05d9\u05d5\u05e6\u05d0\u05ea \u05de\u05e9\u05d8\u05d7\u05d4. \u05e0\u05de\u05e9\u05d9\u05da \u05dc\u05e4\u05e2\u05d5\u05dc \u05db\u05e0\u05d2\u05d3 \u05db\u05dc \u05d0\u05d9\u05d5\u05dd.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05de\u05e0\u05d9\u05d9\u05df \u05d4\u05d4\u05e8\u05d5\u05d2\u05d9\u05dd \u05d1\u05ea\u05e7\u05d9\u05e4\u05ea \u05d1\u05e0\u05d9\u05d9\u05df \u05d0-\u05ea\u05d0\u05d2', \u05d1\u05e8\u05d7\u05d5\u05d1 \u05d0\u05dc\u05d2'\u05dc\u05d0\u05d0 \u05d1\u05e2\u05d9\u05e8 \u05e2\u05d6\u05d4 \u05e2\u05dc\u05d4 \u05dc 40.\u05dc\u05d0 \u05e1\u05d5\u05e4\u05d9.\n",false,700,"\u05de\u05e0\u05d9\u05d9\u05df \u05d4\u05d4\u05e8\u05d5\u05d2\u05d9\u05dd \u05d1\u05ea\u05e7\u05d9\u05e4\u05ea \u05d1\u05e0\u05d9\u05d9\u05df \u05d0-\u05ea\u05d0\u05d2', \u05d1\u05e8\u05d7\u05d5\u05d1 \u05d0\u05dc\u05d2'\u05dc\u05d0\u05d0 \u05d1\u05e2\u05d9\u05e8 \u05e2\u05d6\u05d4 \u05e2\u05dc\u05d4 \u05dc 40.\u05dc\u05d0 \u05e1\u05d5\u05e4\u05d9.\n"],["\u05e6\u05d4\"\u05dc \u05ea\u05e7\u05e3 \u05d0\u05ea \u05d1\u05d9\u05ea \u05de\u05e9\u05e4\u05d7\u05ea \u05d0\u05d1\u05d5 \u05e8\u05d1\u05d9\u05e2 \u05d1\u05de\u05d7\u05e0\u05d4 \u05d0-\u05e9\u05e2\u05d5\u05ea' \u05d1\u05de\u05e2\u05e8\u05d1 \u05e8\u05e4\u05d9\u05d7 (\u05d3\u05e8\u05d5\u05dd \u05d4\u05e8\u05e6\u05d5\u05e2\u05d4). \u05d4\u05e8\u05d5\u05d2\u05d9\u05dd \u05d5\u05e4\u05e6\u05d5\u05e2\u05d9\u05dd \u05d1\u05de\u05e7\u05d5\u05dd.\n",false,701,"\u05e6\u05d4\"\u05dc \u05ea\u05e7\u05e3 \u05d0\u05ea \u05d1\u05d9\u05ea \u05de\u05e9\u05e4\u05d7\u05ea \u05d0\u05d1\u05d5 \u05e8\u05d1\u05d9\u05e2 \u05d1\u05de\u05d7\u05e0\u05d4 \u05d0-\u05e9\u05e2\u05d5\u05ea' \u05d1\u05de\u05e2\u05e8\u05d1 \u05e8\u05e4\u05d9\u05d7 (\u05d3\u05e8\u05d5\u05dd \u05d4\u05e8\u05e6\u05d5\u05e2\u05d4). \u05d4\u05e8\u05d5\u05d2\u05d9\u05dd \u05d5\u05e4\u05e6\u05d5\u05e2\u05d9\u05dd \u05d1\u05de\u05e7\u05d5\u05dd.\n"],["\u05d2'\u05d1\u05e2, \u05e0\u05e4\u05ea \u05d2'\u05e0\u05d9\u05df: \u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9 \u05de\u05ea\u05e2\u05d3 \u05de\u05d7\u05dc\u05d5\u05df \u05d1\u05d9\u05ea \u05db\u05d5\u05d7 \u05d9\u05e9\u05e8\u05d0\u05dc\u05d9 \u05e9\u05d4\u05d2\u05d9\u05e2 \u05db\u05d3\u05d9 \u05dc\u05db\u05ea\u05e8 \u05de\u05d1\u05e0\u05d4.\u05e2\"\u05e4 \u05d3\u05d9\u05d5\u05d5\u05d7\u05d9\u05dd \u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd \u05d1\u05d7\u05d9\u05dc\u05d5\u05e4\u05d9 \u05d4\u05d0\u05e9 \u05d1\u05de\u05e7\u05d5\u05dd \u05e0\u05d4\u05e8\u05d2 \u05de\u05d2'\u05d3\u05d9 \u05e4\u05e9\u05d0\u05e4\u05e9\u05d4, \u05de\u05e4\u05e7\u05d3 \u05e9\u05d8\u05d7 \u05d1\u05d6\u05e8\u05d5\u05e2 \u05d4\u05e6\u05d1\u05d0\u05d9\u05ea \u05e9\u05dc \u05d4\u05d2'\u05d4\u05d0\u05d3 \u05d4\u05d0\u05e1\u05dc\u05d0\u05de\u05d9 \u05d1\u05d2'\u05e0\u05d9\u05df.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,702,"\u05d2'\u05d1\u05e2, \u05e0\u05e4\u05ea \u05d2'\u05e0\u05d9\u05df: \u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9 \u05de\u05ea\u05e2\u05d3 \u05de\u05d7\u05dc\u05d5\u05df \u05d1\u05d9\u05ea \u05db\u05d5\u05d7 \u05d9\u05e9\u05e8\u05d0\u05dc\u05d9 \u05e9\u05d4\u05d2\u05d9\u05e2 \u05db\u05d3\u05d9 \u05dc\u05db\u05ea\u05e8 \u05de\u05d1\u05e0\u05d4.\u05e2\"\u05e4 \u05d3\u05d9\u05d5\u05d5\u05d7\u05d9\u05dd \u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd \u05d1\u05d7\u05d9\u05dc\u05d5\u05e4\u05d9 \u05d4\u05d0\u05e9 \u05d1\u05de\u05e7\u05d5\u05dd \u05e0\u05d4\u05e8\u05d2 \u05de\u05d2'\u05d3\u05d9 \u05e4\u05e9\u05d0\u05e4\u05e9\u05d4, \u05de\u05e4\u05e7\u05d3 \u05e9\u05d8\u05d7 \u05d1\u05d6\u05e8\u05d5\u05e2 \u05d4\u05e6\u05d1\u05d0\u05d9\u05ea \u05e9\u05dc \u05d4\u05d2'\u05d4\u05d0\u05d3 \u05d4\u05d0\u05e1\u05dc\u05d0\u05de\u05d9 \u05d1\u05d2'\u05e0\u05d9\u05df.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05d1\u05de\u05e1\u05d2\u05e8\u05ea \u05d4\u05e9\u05d9\u05d7 \u05d4\u05de\u05ea\u05d2\u05d1\u05e8 \u05e2\u05dc \u05d4\u05e2\u05d9\u05ea\u05d5\u05e0\u05d0\u05d9\u05dd \u05d4\u05e2\u05d6\u05ea\u05d9\u05d9\u05dd \u05dc\u05d0 \u05dc\u05e9\u05db\u05d5\u05d7 \u05d0\u05ea \u05de\u05ea'\u05e0\u05d0 \u05d0-\u05e0\u05d2'\u05d0\u05e8 \ud83d\udc46 \u05e9\u05e7\u05d9\u05d1\u05dc \u05e8\u05e7 \u05dc\u05e4\u05e0\u05d9 \u05e9\u05e0\u05d4 \u05d5\u05e7\u05e6\u05ea \u05dc\u05e8\u05d0\u05e9\u05d5\u05e0\u05d4  \u05ea\u05e2\u05d5\u05d3\u05ea \u  \u05d3\u05d5\u05e8 \u05ea\u05d5\u05e8\u05d2'\u05de\u05df \u05d4\u05e9\u05d5\u05d5\u05d4@N12chat",false,704,"\u05d1\u05df \u05d2\u05d5\u05dc\u05d3\u05e4\u05e8\u05d9\u05d9\u05e0\u05d3\u05d0\u05d9\u05d1\u05d5\u05d3 \u05e0\u05e7\u05d5\u05d3\u05d5\u05ea \u05e9\u05e0\u05d9 \u05d1\u05dc\u05d1\u05d3 \u05d4\u05e2\u05d5\u05e0\u05d4: \u05de\u05db\u05d1\u05d9 \u05ea\"\u05d0 \u05e1\u05d9\u05d9\u05de\u05d4 \u05d1-1:1 \u05de\u05e4\u05ea\u05d9\u05e2 \u05de\u05d0\u05d5\u05d3 \u05e2\u05dd \u05d4\u05e4\u05d5\u05e2\u05dc \u05d7\u05d3\u05e8\u05d4. \u05d0\u05dc\u05e2\u05d3 \u05de\u05d3\u05de\u05d5\u05df \u05d4\u05e2\u05dc\u05d4 \u05d0\u05ea \u05d7\u05d3\u05e8\u05d4 \u05dc\u05d9\u05ea\u05e8\u05d5\u05df, \u05d3\u05d5\u05e8 \u05ea\u05d5\u05e8\u05d2'\u05de\u05df \u05d4\u05e9\u05d5\u05d5\u05d4@N12chat"],["\u05de\u05d1\u05d6\u05e7\u05df 12\u05dc\u05d0\u05d7\u05e8 \u05e4\u05e2\u05d9\u05dc\u05d5\u05ea \u05e9\u05dc \u05e1\u05d5\u05db\u05df \u05e1\u05de\u05d5\u05d9, \u05e9\u05e0\u05de\u05e9\u05db\u05d4 \u05db-10 \u05d7\u05d5\u05d3\u05e9\u05d9\u05dd, \u05e4\u05e9\u05d8\u05d5 \u05d4\u05d1\u05d5\u05e7\u05e8 \u05d9\u05d5\u05ea\u05e8 \u05de-450 \u05e9\u05d5\u05d8\u05e8\u05d9\u05dd \u05e2\u05dc \u05d1\u05ea\u05d9\u05d4\u05dd \u05e9\u05dc \u05d7\u05e9\u05d5\u05d3\u05d9\u05dd \u05d1\u05e1\u05d7\u05e8 \u05d1\u05e1\u05de\u05d9\u05dd \u05d5\u05d1\u05e0\u05e9\u05e7 \u05d1\u05dc\u05ea\u05d9 \u05d7\u05d5\u05e7\u05d9 \u05d1\u05e8\u05d7\u05d1\u05d9 \u05d4\u05d0\u05e8\u05e5. 35 \u05d7\u05e9\u05d5\u05d3\u05d9\u05dd \u05e0\u05e2\u05e6\u05e8\u05d5 \u05d5\u05d4\u05d5\u05d1\u05d0\u05d5 \u05dc\u05d7\u05e7\u05d9\u05e8\u05d4@N12chat",false,705,"\u05de\u05d1\u05d6\u05e7\u05df 12\u05dc\u05d0\u05d7\u05e8 \u05e4\u05e2\u05d9\u05dc\u05d5\u05ea \u05e9\u05dc \u05e1\u05d5\u05db\u05df \u05e1\u05de\u05d5\u05d9, \u05e9\u05e0\u05de\u05e9\u05db\u05d4 \u05db-10 \u05d7\u05d5\u05d3\u05e9\u05d9\u05dd, \u05e4\u05e9\u05d8\u05d5 \u05d4\u05d1\u05d5\u05e7\u05e8 \u05d9\u05d5\u05ea\u05e8 \u05de-450 \u05e9\u05d5\u05d8\u05e8\u05d9\u05dd \u05e2\u05  \u05d4\u05d9\u05d5\u05dd (\u05d2\u05f3) \u05d1\u05d0\u05d5\u05e8\u05d7 \u05e7\u05e9\u05d4 \u05d1\u05e7\u05e8\u05d1 \u05d1\u05de\u05e8\u05db\u05d6 \u05e8\u05e6\u05d5\u05e2\u05ea \u05e2\u05d6\u05d4.\u05d1\u05d0\u05d9\u05e8\u05d5\u05e2 \u05e0\u05d5\u05e1\u05e3, \u05db\u05dc\u05d9 \u05d8\u05d9\u05e1 \u05d1\u05dc\u05ea\u05d9 \u05de\u05d0\u05d5\u05d9\u05e9 \u05e9\u05e9\u05d5\u05d2\u05e8 \u05de\u05dc\u05d1\u05e0\u05d5\u05df \u05e0\u05e4\u05dc \u05de\u05d5\u05e7\u05d3\u05dd \u05d9\u05d5\u05ea\u05e8 \u05d4\u05d9\u05d5\u05dd (\u05d2'), \u05d1\u05de\u05e8\u05d7\u05d1 \u05d4\u05d7\u05e8\u05de\u05d5\u05df. \u05db\u05ea\u05d5\u05e6\u05d0\u05d4 \u05de\u05d4\u05e0\u05e4\u05d9\u05dc\u05d4 \u05d7\u05d9\u05d9\u05dc\u05ea \u05e6\u05d4\"\u05dc \u05e0\u05e4\u05e6\u05e2\u05d4 \u05d1\u05d0\u05d5\u05e8\u05d7 \u05e7\u05e9\u05d4, \u05d4\u05d0\u05d9\u05e8\u05d5\u05e2 \u05de\u05ea\u05d5\u05d7\u05e7\u05e8.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05de\u05d1\u05d6\u05e7\u05df 12\u05e6\u05d1\u05e2 \u05d0\u05d3\u05d5\u05dd \u05d1\u05e2\u05d5\u05d8\u05e3 \u05e2\u05d6\u05d4@N12chat",false,707,"\u05de\u05d1\u05d6\u05e7\u05df 12\u05e6\u05d1\u05e2 \u05d0\u05d3\u05d5\u05dd \u05d1\u05e2\u05d5\u05d8\u05e3 \u05e2\u05d6\u05d4@N12chat"],["\u05e0\u05d9\u05e8 \u05d3\u05d1\u05d5\u05e8\u05d9\u05d4\u05e6\u05d9\u05dc\u05d5\u05de\u05d9\u05dd \u05de\u05d4\u05d8\u05e7\u05e1: \u05d3\u05d5\u05d1\u05e8 \u05e6\u05d4\"\u05dc@N12chat",false,708,"\u05e0\u05d9\u05e8 \u05d3\u05d1\u05d5\u05e8\u05d9\u05d4\u05e6\u05d9\u05dc\u05d5\u05de\u05d9\u05dd \u05de\u05d4\u05d8\u05e7\u05e1: \u05d3\u05d5\u05d1\u05e8 \u05e6\u05d4\"\u05dc@N12chat"],["\u05e9\u05e0\u05d9 \u05d1\u05d9\u05e8\u05e0\u05d1\u05d5\u05d9\u05dd\u05d0\u05d5\u05e1\u05d8\u05e8\u05dc\u05d9\u05d4: \u05e0\u05e6\u05d9\u05d2\u05d9 \u05de\u05e9\u05e4\u05d7\u05d5\u05ea \u05d4\u05d7\u05d8\u05d5\u05e4\u05d9\u05dd \u05d4\u05d2\u05d9\u05e2\u05d5 \u05dc\u05d1\u05d9\u05ea \u05d4\u05e4\u05e8\u05dc\u05de\u05e0\u05d8 \u05d1\u05de\u05dc\u05d1\u05d5\u05e8\u05df, \u05dc\u05d4\u05d9\u05e4\u05d2\u05e9 \u05e2\u05dd \u05de\u05e0\u05d4\u05d9\u05d2\u05d9\u05dd \u05d5\u05e4\u05d5\u05dc\u05d9\u05d8\u05d9\u05e7\u05d0\u05d9\u05dd. \u05d0\u05e8\u05d2\u05d5\u05df United With Israel \u05d4\u05e7\u05d9\u05dd \u05de\u05d9\u05e6\u05d2 \u05dc\u05de\u05e2\u05df \u05d4\u05d7\u05d8\u05d5\u05e4\u05d9\u05dd \u05d1\u05e7\u05e8\u05d9\u05d0\u05d4 \u05dc\u05d4\u05e9\u05d1\u05ea\u05dd \u05d0\u05e8\u05e6\u05d4. \u05d4\u05e0\u05e6\u05d9\u05d2\u05d9\u05dd \u05e1\u05d9\u05e4\u05e8\u05d5 \u05d0\u05ea \u05d4\u05e1\u05d9\u05e4\u05d5\u05e8\u05d9\u05dd \u05d4\u05d0\u05d9\u05e9\u05d9\u05d9\u05dd \u05e7\u05d5\u05e8\u05e2\u05d9 \u05d4\u05dc\u05d1 \u05d5\u05d4\u05d6\u05db\u05d9\u05e8\u05d5 \u05e9\u05d0\u05d9 \u05d0\u05e4\u05e9\u05e8 \u05dc\u05d4\u05de\u05e9\u05d9\u05da \u05d4\u05dc\u05d0\u05d4 \u05d1\u05dc\u05e2\u05d3\u05d9\u05d4\u05dd. \u05e6\u05d9\u05dc\u05d5\u05dd: \u05e0\u05d9\u05e8\u05d9\u05ea \u05d0\u05d9\u05d9\u05dc\u05d5\u05df@N12chat",false,709,"\u05e9\u05e0\u05d9 \u05d1\u05d9\u05e8\u05e0\u05d1\u05d5\u05d9\u05dd\u05d0\u05d5\u05e1\u05d8\u05e8\u05dc\u05d9\u05d4: \u05e0\u05e6\u05d9\u05d2\u05d9 \u05de\u05e9\u05e4\u05d7\u05d5\u05ea \u05d4\u05d7\u05d8\u05d5\u05e4\u05d9\u05dd \u05d4\u05d2\u05d9\u05e2\u05d5 \u05dc\u05d1\u05d9\u05ea \u05d4\u05e4\u05e8\u05dc\u05de\u05e0\u05d8 \u05d1\u05de\u05dc\u05d1\u05d5\u05e8\u05df, \u05dc\u05d4\u05d9\u05e4\u05d2\u05e9 \u05e2\u05dd \u05de\u05e0\u05d4\u05d9\u05d2\u05d9\u05dd \u05d5\u05e4\u05d5\u05dc\u05d9\u05d8\u05d9\u05e7\u05d0\u05d9\u05dd. \u05d0\u05e8\u05d2\u05d5\u05df United With Israel \u05d4\u05e7\u05d9\u05dd \u05de\u05d9\u05e6\u05d2 \u05dc\u05de\u05e2\u05df \u05d4\u05d7\u05d8\u05d5\u05e4\u05d9\u05dd \u05d1\u05e7\u05e8\u05d9\u05d0\u05d4 \u05dc\u05d4\u05e9\u05d1\u05ea\u05dd \u05d0\u05e8\u05e6\u05d4. \u05d4\u05e0\u05e6\u05d9\u05d2\u05d9\u05dd \u05e1\u05d9\u05e4\u05e8\u05d5 \u05d0\u05ea \u05d4\u05e1\u05d9\u05e4\u05d5\u05e8\u05d9\u05dd \u05d4\u05d0\u05d9\u05e9\u05d9\u0 d \u05d1\u05d9\u05d3\u05d9\u05d4, \u05d1\u05d9\u05e6\u05e2\u05d4 \u05e9\u05e8\u05d7 \u05db\u05d4\u05df \u05e2\u05e1\u05e7\u05d0\u05d5\u05ea \u05d1\u05e1\u05d3\u05e8 \u05d2\u05d5\u05d3\u05dc \u05e9\u05dc \u05db-450 \u05d0\u05dc\u05e3 \u05e9\u05e7\u05dc\u05d9\u05dd \u05e9\u05d4\u05e0\u05d9\u05d1\u05d5 \u05dc\u05d4 \u05e8\u05d5\u05d5\u05d7 \u05db\u05d5\u05dc\u05dc \u05d1\u05e9\u05d5\u05d5\u05d9 \u05db-180 \u05d0\u05dc\u05e3 \u05e9\u05e7\u05dc\u05d9\u05dd.@N12chat"],["\u05d0\u05d5\u05e8 \u05e8\u05d1\u05d9\u05d3\u05d1\u05ea\u05d5\u05dd \u05d7\u05e7\u05d9\u05e8\u05d4 \u05e1\u05de\u05d5\u05d9\u05d4: 3 \u05e6\u05e2\u05d9\u05e8\u05d9\u05dd, \u05d1\u05e9\u05e0\u05d5\u05ea \u05d4-20 \u05dc\u05d7\u05d9\u05d9\u05d4\u05dd, \u05ea\u05d5\u05e9\u05d1\u05d9 \u05e8\u05de\u05dc\u05d4 \u05d5\u05dc\u05d5\u05d3 \u05e0\u05e2\u05e6\u05e8\u05d5 \u05d1\u05d7\u05e9\u05d3 \u05dc\u05de\u05e1\u05e4\u05e8 \u05d0\u05d9\u05e8\u05d5\u05e2\u05d9 \u05e9\u05d5\u05d3 \u05d1\u05db\u05e4\u05e8 \u05e1\u05d1\u05d0 \u05d5\u05d1\u05d7\u05d5\u05dc\u05d5\u05df. \u05de\u05d4\u05d7\u05e7\u05d9\u05e8\u05d4 \u05e2\u05d5\u05dc\u05d4 \u05db\u05d9 \u05d4\u05d7\u05e9\u05d5\u05d3\u05d9\u05dd \u05e0\u05d4\u05d2\u05d5 \u05dc\u05e7\u05d1\u05d5\u05e2 \u05e4\u05d2\u05d9\u05e9\u05d4 \u05e2\u05dd \u05e7\u05d5\u05e8\u05d1\u05e0\u05d5\u05ea \u05dc\u05e8\u05db\u05d9\u05e9\u05ea \u05de\u05d5\u05e6\u05e8 \u05d5\u05d1\u05e9\u05e2\u05ea \u05d4\u05de\u05e4\u05d2\u05e9 \u05ea\u05e7\u05e4\u05d5 \u05ea\u05e7\u05e4\u05d5 \u05d0\u05d5\u05ea\u05dd, \u05d2\u05e0\u05d1\u05d5 \u05e8\u05db\u05d5\u05e9 \u05d5\u05e0\u05de\u05dc\u05d8\u05d5 \u05de\u05d4\u05de\u05e7\u05d5\u05dd. \u05d1\u05e1\u05d9\u05d5\u05dd \u05d7\u05e7\u05d9\u05e8\u05ea\u05dd \u05e0\u05db\u05dc\u05d0\u05d5 \u05d4\u05d7\u05e9\u05d5\u05d3\u05d9\u05dd \u05d5\u05de\u05e2\u05e6\u05e8\u05dd \u05d4\u05d5\u05d0\u05e8\u05da \u05e2\u05d3 \u05dc\u05d9\u05d5\u05dd \u05e9\u05e0\u05d9@N12chat",false,719,"\u05d0\u05d5\u05e8 \u05e8\u05d1\u05d9\u05d3\u05d1\u05ea\u05d5\u05dd \u05d7\u05e7\u05d9\u05 u05d9\u05d9\u05df \u05e4\u05e6\u05d5\u05e2\u05d9\u05dd \u05e7\u05e9\u05d4 \u05d5\u05d7\u05d5\u05dc\u05d9\u05dd \u05e9\u05e0\u05de\u05e6\u05d0\u05d9\u05dd \u05e9\u05dd\", \u05d0\u05de\u05e8 \u05d3\u05d5\u05d1\u05e8 \u05d4\u05d0\u05e8\u05d2\u05d5\u05df \u05d8\u05d0\u05e8\u05d9\u05e7 \u05d2'\u05e1\u05e8\u05d1\u05d9\u05e5'@N12chat"],["\u05d1\u05d4\u05de\u05e9\u05da \u05dc\u05ea\u05e7\u05d9\u05e4\u05ea \u05e6\u05d4\"\u05dc \u05d1\u05e2\u05d9\u05ea\u05e8\u05d5\u05df\ud83d\udc46\u05d7\u05d6\u05d1\u05d0\u05dc\u05dc\u05d4 \u05de\u05d5\u05d3\u05d9\u05e2 \u05e2\u05dc \u05d4\u05e8\u05d5\u05d2 \u05d1\u05e9\u05d5\u05e8\u05d5\u05ea\u05d9\u05d5:\u05d7\u05e1\u05d9\u05df \u05e1\u05dc\u05d0\u05de\u05d4, \u05ea\u05d5\u05e9\u05d1 \u05e2\u05d9\u05ea\u05e8\u05d5\u05df.\u05de\u05e1\u05e4\u05e8 124\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,727,"\u05d1\u05d4\u05de\u05e9\u05da \u05dc\u05ea\u05e7\u05d9\u05e4\u05ea \u05e6\u05d4\"\u05dc \u05d1\u05e2\u05d9\u05ea\u05e8\u05d5\u05df\ud83d\udc46\u05d7\u05d6\u05d1\u05d0\u05dc\u05dc\u05d4 \u05de\u05d5\u05d3\u05d9\u05e2 \u05e2\u05dc \u05d4\u05e8\u05d5\u05d2 \u05d1\u05e9\u05d5\u05e8\u05d5\u05ea\u05d9\u05d5:\u05d7\u05e1\u05d9\u05df \u05e1\u05dc\u05d0\u05de\u05d4, \u05ea\u05d5\u05e9\u05d1 \u05e2\u05d9\u05ea\u05e8\u05d5\u05df.\u05de\u05e1\u05e4\u05e8 124\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05d3\u05e1\u05e7 \u05d4\u05d7\u05d5\u05e5\ud83d\udcdd\u05d2\u05d5\u05e8\u05dd \u05e8\u05e9\u05de\u05d9 \u05d1\u05e6\u05d1\u05d0 \u05d0\u05e8\u05d4\"\u05d1 \u05d0\u05d9\u05e9\u05e8 \u05dc-CNN \u05db\u05d9 \u05d7\u05d9\u05dc \u05d4\u05d9\u05dd \u05d4\u05d0\u05de\u05e8\u05d9\u05e7\u05e0\u05d9 \u05d4\u05e4\u05d9\u05dc \u05d8\u05d9\u05dc\u05d9\u05dd \u05d5\u05db\u05d8\u05d1\"\u05de\u05d9\u05dd \u05d7\u05d5\u05ea'\u05d9\u05d9\u05dd \u05e9\u05e9\u05d5\u05d2\u05e8\u05d5 \u05de\u05ea\u05d9\u05de\u05df. 24 \u05d4\u05d8\u05d9\u05dc\u05d9\u05dd \u05d5\u05d4\u05db\u05d8\u05d1\"\u05de\u05d9\u05dd \u05d9\u05d5\u05e8\u05d8\u05d5 \u05de\u05e2\u05dc \u05d9\u05dd \u05e1\u05d5\u05e3 \u05d1\u05ea\u05d2\u05d5\u05d1\u05d4 \u05dc\u05d0\u05d7\u05ea \u05de\u05d4\u05de\u05ea\u05e7\u05e4\u05d5\u05ea \u05d4\u05d7\u05d5\u05ea'\u05d9\u05d5\u05ea \u05d4\u05d2\u05d3\u05d5\u05dc\u05d5\u05ea \u05e9\u05d4\u05ea\u05e8\u05d7\u05e9\u05d5 \u05d1\u05d0\u05d6\u05d5\u05e8 \u05d1\u05d7\u05d5\u05d3\u05e9\u05d9\u05dd \u05d4\u05d0\u05d7\u05e8\u05d5\u05e0\u05d9\u05dd. \u05dc\u05e4\u05d9 \u05d4\u05e2\u05e8\u05db\u05d5\u05ea \u05e8\u05d0\u05e9\u05d5\u05e0\u05d9\u05d5\u05ea, \u05dc\u05d0 \u05e0\u05e4\u05d2\u05e2\u05d5 \u05e1\u05e4\u05d9\u05e0\u05d5\u05ea \u05d1\u05de\u05ea\u05e7\u05e4\u05d4@N12chat",false,728,"\u05d3\u05e1\u05e7 \u05d4\u05d7\u05d5\u05e5\ud83d\udcdd\u05d2\u05d5\u05e8\u05dd \u05e8\u05e9\u05de\u05d9 \u05d1\u05e6\u05d1\u05d0 \u05d0\u05e8\u05d4\"\u05d1 \u05d0\u05d9\u05e9\u05e8 \u05dc-CNN \u05db\u05d9 \u05d7\u05d9\u05dc \u05d4\u05d9\u05dd \u05d4\u05d0\u05de\u05e8\u05d9\u05e7\u05e0\u05d9 \u05d4\u05e4\u05d9\u05dc \u05d8\u05d9\u05dc\u05d9\u05dd \u05d5\u05db\u05d8\u05d1\"\u05de\u05d9\u05dd \u05d7\u05d5\u05ea'\u05d9\u05d9\u05dd \u05e9\u05e9\u05d5\u05d2\u05e8\u05d5 \u05de\u05ea\u05d9\u05de\u05df. 24 \u05d4\u05d8\u05d9\u05dc\u05d9\u05dd \u05d5\u05d4\u05db\u05d8\u05d1\"\u05de\u05d9\u05dd \u05d9\u05d5\u05e8\u05d8\u05d5 \u05de\u05e2\u05dc \u05d9\u05dd \u05e1\u05d5\u05e3 \u05d1\u05ea\u05d2\u05d5\u05d1\u05d4 \u05dc\u05d0\u05d7\u05ea \u05de\u05d4\u05de\u05ea\u05e7\u05e4\u05d5\u05ea \u05d4\u05d7\u05d5\u05ea'\u05d9\u05d5\u05ea \u05d4\u05d2\u05d3\u05d5\u05dc\u05d5\u05ea \u05e9\u05d4\u05ea\u05e8\u05d7\u05e9\u05d5 \u05d1\u05d0\u05d6\u05d5\u05e8 \u05d1\u05d7\u05d5\u05d3\u05e9\u05d9\u05dd \u05d4\u05d0\u05d7\u05e8\u05d5\u05e0\u05d9\u05dd. \u05dc\u05e4\u05d9 \u05d4\u05e2\u05e8\u05db\u05d5\u05ea \u05e8\u05d0\u05e9\u05d5\u05e0\u05d9\u05d5\u05ea, \u05dc\u05d0 \u05e0\u05e4\u05d2\u05e2\u05d5 \u05e1\u05e4\u05d9\u05e0\u05d5\u05ea \u05d1\u05de\u05ea\u05e7\u05e4\u05d4@N12chat"],["\u05d2\u05d9\u05d0 \u05d5\u05e8\u05d5\u05df\ud83d\udcdd\u05e8\u05d0\u05e9\u05d9 \u05d4\u05e8\u05e9\u05d5\u05d9\u05d5\u05ea \u05d1\u05e7\u05d5 \u05d4\u05e2\u05d9\u05de\u05d5\u05ea \u05d1\u05e6\u05e4\u05d5\u05df \u05d4\u05d5\u05d6\u05de\u05e0\u05d5 \u05dc\u05e7\u05d1\u05d9\u05e0\u05d8 \u05d4\u05d1\u05d9\u05d8\u05d7\u05d5\u05e0\u05d9 \u05de\u05d3\u05d9\u05e0\u05d9 \u05e9\u05de\u05ea\u05db\u05e0\u05e1 \u05de\u05d7\u05e8 \u05d1\u05d0\u05d6\u05d5\u05e8 \u05e2\u05de\u05e7 \u05d9\u05d6\u05e8\u05e2\u05d0\u05dc. \u05d1\u05d4\u05d7\u05dc\u05d8\u05d4 \u05de\u05e9\u05d5\u05ea\u05e4\u05ea \u05d4\u05dd \u05d4\u05d5\u05d3\u05d9\u05e2\u05d5 \u05e9\u05d0\u05dd \u05d4\u05e7\u05d1\u05d9\u05e0\u05d8 \u05de\u05e4\u05d7\u05d3 \u05dc\u05d4\u05d2\u05d9\u05e2 \u05d0\u05dc\u05d9\u05d4\u05dd - \u05d0\u05d9\u05df \u05d1\u05db\u05d5\u05d5\u05e0\u05ea\u05dd \u05dc\u05d4\u05d2\u05d9\u05e2 \u05dc\u05d9\u05e9\u05d9\u05d1\u05d4@N12chat",false,729,"\u05d2\u05d9\u05d0 \u05d5\u05e8\u05d5\u05df\ud83d\udcdd\u05e8\u05d0\u05e9\u05d9 \u05d4\u05e8\u05e9\u05d5\u05d9\u05d5\u05ea \u05d1\u05e7\u05d5 \u05d4\u05e2\u05d9\u05de\u05d5\u05ea \u05d1\u05e6\u05e4\u05d5\u05df \u05d4\u05d5\u05d6\u05de\u05e0\u05d5 \u05dc\u05e7\u05d1\u05d9\u05e0\u05d8 \u05d4\u05d1\u05d9\u05d8\u05d7\u05d5\u05e0\u05d9 \u05de\u05d3\u05d9\u05e0\u05d9 \u05e9\u05de\u05ea\u05db\u05e0\u05e1 \u05de\u05d7\u05e8 \u05d1\u05d0\u05d6\u05d5\u05e8 \u05e2\u05de\u05e7 \u05d9\u05d6\u05e8\u05e2\u05d0\u05dc. \u05d1\u05d4\u05d7\u05dc\u05d8\u05d4 \u05de\u05e9\u05d5\u05ea\u05e4\u05ea \u05d4\u05dd \u05d4\u05d5\u05d3\u05d9\u05e2\u05d5 \u05e9\u05d0\u05dd \u05d4\u05e7\u05d1\u05d9\u05e0\u05d8 \u05de\u05e4\u05d7\u05d3 \u05dc\u05d4\u05d2\u05d9\u05e2 \u05d0\u05dc\u05d9\u05d4\u05dd - \u05d0\u05d9\u05df \u05d1\u05db\u05d5\u05d5\u05e0\u05ea\u05dd \u05dc\u05d4\u05d2\u05d9\u05e2 \u05dc\u05d9\u05e9\u05d9\u05d1\u05d4@N12chat"],["\u05db\u05de\u05d4 \u05de\u05d9\u05dc\u05d9\u05dd \u05e2\u05dc \u05e7\u05d8\u05e8\u05d0\u05d9\u05da \u05de\u05d3\u05d9\u05e0\u05ea \u05d7\u05e6\u05d9 \u05d0\u05d9 \u05db\u05dc \u05db\u05da \u05e7\u05d8\u05e0\u05d4 \u05de\u05e6\u05dc\u05d9\u05d7\u05d4 \u05dc\u05e1\u05d5\u05d1\u05d1 \u05e2\u05dc \u05d4\u05d0\u05e6\u05d1\u05e2 \u05d0\u05ea \u05d9\u05e9\u05e8\u05d0\u05dc, \u05d0\u05e8\u05d4\"\u05d1 \u05d5\u05de\u05d3\u05d9\u05e0\u05d5\u05ea \u05d4\u05de\u05e2\u05e8\u05d1 \u05d5\u05d1\u05de\u05e7\u05d1\u05d9\u05dc \u05dc\u05ea\u05de\u05d5\u05da \u05d1\u05d7\u05de\u05d0\u05e1 \u05db\u05e9\u05d4\u05d9\u05d0 \u05e2\u05d5\u05de\u05d3\u05ea \u05e2\u05dc \u05d4\u05de\u05e7\u05e4\u05e6\u05d4....\u05d4\u05e8\u05d1\u05d4 \u05d9\u05d2\u05d9\u05d3\u05d5 - \u05d6\u05d4 \u05d1\u05d2\u05dc\u05dc \u05e9\u05d4\u05d9\u05d0 \u05de\u05d3\u05d9\u05e0\u05d4 \u05e2\u05e9\u05d9\u05e8\u05d4 \u05d1\u05e0\u05e4\u05d8.\u05d9\u05e9 \u05e2\u05d5\u05d3 \u05d4\u05e8\u05d1\u05d4 \u05de\u05d3\u05d9\u05e0\u05d5\u05ea \u05e2\u05e9\u05d9\u05e8\u05d5\u05ea \u05d1\u05e0\u05e4\u05d8 \u05d5\u05d4\u05df \u05dc\u05d0 \u05e0\u05de\u05e6\u05d0\u05d5\u05ea \u05d1\u05de\u05e2\u05de\u05d3 \u05db\u05d6\u05d4 \u05d2\u05d1\u05d5\u05d4 - \u05d0\u05e8\u05d4\"\u05d1 \u05dc\u05de\u05e9\u05dc \u05e8\u05d5\u05d0\u05d4 \u05d1\u05e7\u05d8\u05e8 \u05d0\u05d7\u05ea \u05de\u05d1\u05e2\u05dc\u05d5\u05ea \u05d4\u05d1\u05e8\u05d9\u05ea \u05d4\u05d7\u05e9\u05d5\u05d1\u05d5\u05ea \u05d1\u05d0\u05d6\u05d5\u05e8 \u05d4\u05de\u05d6\u05e8\u05d7 \u05d4\u05ea\u05d9\u05db\u05d5\u05df \u05d5\u05d0\u05e3 \u05de\u05d7\u05d6\u05d9\u05e7\u05d4 \u05d1\u05e9\u05d8\u05d7\u05d4 \u05d1\u05e1\u05d9\u05e1 \u05d0\u05d5\u05d5\u05d9\u05e8\u05d9 \u05d2\u05d3\u05d5\u05dc.\u05d0\u05d6 \u05de\u05d4 \u05d4\u05e1\u05d5\u05d3 \u05e9\u05dc\u05d4\u05dd?\u05d0\u05ea \u05e7\u05d8\u05e8 \u05d0\u05e4\u05e9\u05e8 \u05dc\u05d4\u05e7\u05d1\u05d9\u05dc \u05dc\u05db\u05d1\u05d0\u05d9 \u05e9\u05de\u05e6\u05d9\u05ea \u05e9\u05e8\u05d9\u05e4\u05d5\u05ea \u05d1\u05db\u05dc \u05e8\u05d7\u05d1\u05d9 \u05d4\u05e2\u05d5\u05dc\u05dd \u05d5\u05de\u05e7\u05d1\u05dc \u05ea\u05e2\u05d5\u05d3\u05d5\u05ea \u05d4\u05d5\u05e7\u05e8\u05d4 \u05e2\u05dc \u05db\u05da \u05e9\u05d6\u05d9\u05d4\u05d4 \u05d0\u05ea \u05d4\u05e9\u05e8\u05d9\u05e4\u05d5\u05ea \u05e8\u05d0\u05e9\u05d5\u05df \u05d5\u05d4\u05e6\u05dc\u05d9\u05d7 \u05dc\u05db\u05d1\u05d5\u05ea \u05d0\u05d5\u05ea\u05df \u05d5\u05dc\u05de\u05e0\u05d5\u05e2 \u05d0\u05e1\u05d5\u05df. \u05d6\u05d5 \u05d4\u05d0\u05e1\u05d8\u05e8\u05d8\u05d2\u05d9\u05d4 \u05d4\u05e7\u05d8\u05e8\u05d9\u05ea.\u05dc\u05d8\u05d5\u05d1\u05ea \u05e7\u05d9\u05d3\u05d5\u05dd \u05d4\u05d0\u05e1\u05d8\u05e8\u05d8\u05d2\u05d9\u05d4 \u05d4\u05d6\u05d5 \u05de\u05d7\u05d6\u05d9\u05e7\u05d4 \u05e7\u05d8\u05e8 \u05d0\u05ea \u05e8\u05e9\u05ea \u05d4\u05ea\u05e7\u05e9\u05e8\u05d5\u05ea \u05d4\u05de\u05e9\u05e4\u05d9\u05e2\u05d4 \u05d1\u05d9\u05d5\u05ea\u05e8 \u05d1\u05e2\u05d5\u05dc\u05dd \u05d4\u05e2\u05e8\u05d1\u05d9 \u05d5\u05d0\u05d7\u05ea \u05d4\u05de\u05e9\u05e4\u05d9\u05e2\u05d5\u05ea \u05d1\u05e2\u05d5\u05dc\u05dd \u05db\u05d5\u05dc\u05d5-\u05d0\u05dc\u05d2'\u05d6\u05d9\u05e8\u05d4.\u05db\u05da \u05d1\u05d0\u05de\u05e6\u05e2\u05d5\u05ea, \u05db\u05e1\u05e3, \u05d0\u05e1\u05d8\u05e8\u05d8\u05d2\u05d9\u05d9\u05ea \u05d4\u05db\u05d1\u05d0\u05d9 \u05e9\u05de\u05e6\u05d9\u05ea \u05e9\u05e8\u05d9\u05e4\u05d5\u05ea \u05d5\u05e2\u05e8\u05d5\u05e5 \u05ea\u05e7\u05e9\u05d5\u05e8\u05ea \u05de\u05e9\u05e4\u05d9\u05e2 \u05d1\u05de\u05d9\u05d5\u05d7\u05d3 \u05e7\u05d8\u05e8 \u05de\u05e1\u05d5\u05d1\u05d1\u05ea \u05d0\u05ea \u05d4\u05e2\u05d5\u05dc\u05dd \u05e2\u05dc \u05d4\u05d0\u05e6\u05d1\u05e2.\u05d5\u05db\u05da \u05d2\u05dd \u05d1\u05db\u05e4\u05d9\u05e4\u05d4 \u05d0\u05d7\u05ea \u05de\u05e9\u05de\u05e9\u05ea \u05e7\u05d8\u05e8 \u05de\u05e6\u05d3 \u05d0\u05d7\u05d3 \u05dc\u05d0\u05d9\u05e8\u05d5\u05d7 \u05d0\u05d7\u05d3 \u05d4\u05d1\u05e1\u05d9\u05e1\u05d9\u05dd \u05d4\u05d0\u05de\u05e8\u05d9\u05e7\u05d0\u05d9\u05dd \u05d4\u05d2\u05d3\u05d5\u05dc\u05d9\u05dd \u05d1\u05de\u05d6\u05d4\"\u05ea \u05d5\u05de\u05e6\u05d3 \u05e9\u05e0\u05d9 \u05de\u05d4\u05d5\u05d5\u05d4 \u05d0\u05ea \u05d1\u05d9\u05ea\u05dd \u05d4\u05de\u05d5\u05e2\u05d3\u05e3 \u05e9\u05dc \u05d1\u05db\u05d9\u05e8\u05d9 \u05d7\u05de\u05d0\u05e1 -(\u05e9\u05e2\u05dc \u05e8\u05d0\u05e9\u05dd \u05d0\u05e8\u05d4\"\u05d1 \u05d4\u05d8\u05d9\u05dc\u05d4 \u05e4\u05e8\u05e1\u05d9\u05dd \u05db\u05e1\u05e4\u05d9\u05d9\u05dd).\n",false,730,"\u05db\u05de\u05d4 \u05de\u05d9\u05dc\u05d9\u05dd \u05e2\u05dc \u05e7\u05d8\u05e8\u05d0\u05d9\u05da \u05de\u05d3\u05d9\u05e0\u05ea \u05d7\u05e6\u05d9 \u05d0\u05d9 \u05db\u05dc \u05db\u05da \u05e7\u05d8\u05e0\u05d4 \u05de\u05e6\u05dc\u05d9\u05d7\u05d4 \u05dc\u05e1\u05d5\u05d1\u05d1 \u05e2\u05dc \u05d4\u05d0\u05e6\u05d1\u05e2 \u05d0\u05ea \u05d9\u05e9\u05e8\u05d0\u05dc, \u05d0\u05e8\u05d4\"\u05d1 \u05d5\u05de\u05d3\u05d9\u05e0\u05d5\u05ea \u05d4\u05de\u05e2\u05e8\u05d1 \u05d5\u05d1\u05de\u05e7\u05d1\u05d9\u05dc \u05dc\u05ea\u05de\u05d5\u05da \u05d1\u05d7\u05de\u05d0\u05e1 \u05db\u05e9\u05d4\u05d9\u05d0 \u05e2\u05d5\u05de\u05d3\u05ea \u05e2\u05dc \u05d4\u05de\u05e7\u05e4\u05e6\u05d4....\u05d4\u05e8\u05d1\u05d4 \u05d9\u05d2\u05d9\u05d3\u05d5 - \u05d6\u05d4 \u05d1\u05d2\u05dc\u05dc \u05e9\u05d4\u05d9\u05d0 \u05de\u05d3\u05d9\u05e0\u05d4 \u05e2\u05e9\u05d9\u05e8\u05d4 \u05d1\u05e0\u05e4\u05d8.\u05d9\u05e9 \u05e2\u05d5\u05d3 \u05d4\u05e8\u05d1\u05d4 \u05de\u05d3\u05d9\u05e0\u05d5\u05ea \u05e2\u05e9\u05d9\u05e8\u05d5\u05ea \u05d1\u05e0\u05e4\u05d8 \u05d5\u05d4\u05df \u05dc\u05d0 \u05e0\u05de\u05e6\u05d0\u05d5\u05ea \u05d1\u05de\u05e2\u05de\u05d3 \u05db\u05d6\u05d4 \u05d2\u05d1\u05d5\u05d4 - \u05d0\u05e8\u05d4\"\u05d1 \u05dc\u05de\u05e9\u05dc \u05e8\u05d5\u05d0\u05d4 \u05d1\u05e7\u05d8\u05e8 \u05d0\u05d7\u05ea \u05de\u05d1\u05e2\u05dc\u05d5\u05ea \u05d4\u05d1\u05e8\u05d9\u05ea \u05d4\u05d7\u05e9\u05d5\u05d1\u05d5\u05ea \u05d1\u05d0\u05d6\u05d5\u05e8 \u05d4\u05de\u05d6\u05e8\u05d7 \u05d4\u05ea\u05d9\u05db\u05d5\u05df \u05d5\u05d0\u05e3 \u05de\u05d7\u05d6\u05d9\u05e7\u05d4 \u05d1\u05e9\u05d8\u05d7\u05d4 \u05d1\u05e1\u05d9\u05e1 \u05d0\u05d5\u05d5\u05d9\u05e8\u05d9 \u05d2\u05d3\u05d5\u05dc.\u05d0\u05d6 \u05de\u05d4 \u05d4\u05e1\u05d5\u05d3 \u05e9\u05dc\u05d4\u05dd?\u05d0\u05ea \u05e7\u05d8\u05e8 \u05d0\u05e4\u05e9\u05e8 \u05dc\u05d4\u05e7\u05d1\u05d9\u05dc \u05dc\u05db\u05d1\u05d0\u05d9 \u05e9\u05de\u05e6\u05d9\u05ea \u05e9\u05e8\u05d9\u05e4\u05d5\u05ea \u05d1\u05db\u05dc \u05e8\u05d7\u05d1\u05d9 \u05d4\u05e2\u05d5\u05dc\u05dd \u05d5\u05de\u05e7\u05d1\u05dc \u05ea\u05e2\u05d5\u05d3\u05d5\u05ea \u05d4\u05d5\u05e7\u05e8\u05d4 \u05e2\u05dc \u05db\u05da \u05e9\u05d6\u05d9\u05d4\u05d4 \u05d0\u05ea \u05d4\u05e9\u05e8\u05d9\u05e4\u05d5\u05ea \u05e8\u05d0\u05e9\u05d5\u05df \u05d5\u05d4\u05e6\u05dc\u05d9\u05d7 \u05dc\u05db\u05d1\u05d5\u05ea \u05d0\u05d5\u05ea\u05df \u05d5\u05dc\u05de\u05e0\u05d5\u05e2 \u05d0\u05e1\u05d5\u05df. \u05d6\u05d5 \u05d4\u05d0\u05e1\u05d8\u05e8\u05d8\u05d2\u05d9\u05d4 \u05d4\u05e7\u05d8\u05e8\u05d9\u05ea.\u05dc\u05d8\u05d5\u05d1\u05ea \u05e7\u05d9\u05d3\u05d5\u05dd \u05d4\u05d0\u05e1\u05d8\u05e8\u05d8\u05d2\u05d9\u05d4 \u05d4\u05d6\u05d5 \u05de\u05d7\u05d6\u05d9\u05e7\u05d4 \u05e7\u05d8\u05e8 \u05d0\u05ea \u05e8\u05e9\u05ea \u05d4\u05ea\u05e7\u05e9\u05e8\u05d5\u05ea \u05d4\u05de\u05e9\u05e4\u05d9\u05e2\u05d4 \u05d1\u05d9\u05d5\u05ea\u05e8 \u05d1\u05e2\u05d5\u05dc\u05dd \u05d4\u05e2\u05e8\u05d1\u05d9 \u05d5\u05d0\u05d7\u05ea \u05d4\u05de\u05e9\u05e4\u05d9\u05e2\u05d5\u05ea \u05d1\u05e2\u05d5\u05dc\u05dd \u05db\u05d5\u05dc\u05d5-\u05d0\u05dc\u05d2'\u05d6\u05d9\u05e8\u05d4.\u05db\u05da \u05d1\u05d0\u05de\u05e6\u05e2\u05d5\u05ea, \u05db\u05e1\u05e3, \u05d0\u05e1\u05d8\u05e8\u05d8\u05d2\u05d9\u05d9\u05ea \u05d4\u05db\u05d1\u05d0\u05d9 \u05e9\u05de\u05e6\u05d9\u05ea \u05e9\u05e8\u05d9\u05e4\u05d5\u05ea \u05d5\u05e2\u05e8\u05d5\u05e5 \u05ea\u05e7\u05e9\u05d5\u05e8\u05ea \u05de\u05e9\u05e4\u05d9\u05e2 \u05d1\u05de\u05d9\u05d5\u05d7\u05d3 \u05e7\u05d8\u05e8 \u05de\u05e1\u05d5\u05d1\u05d1\u05ea \u05d0\u05ea \u05d4\u05e2\u05d5\u05dc\u05dd \u05e2\u05dc \u05d4\u05d0\u05e6\u05d1\u05e2.\u05d5\u05db\u05da \u05d2\u05dd \u05d1\u05db\u05e4\u05d9\u05e4\u05d4 \u05d0\u05d7\u05ea \u05de\u05e9\u05de\u05e9\u05ea \u05e7\u05d8\u05e8 \u05de\u05e6\u05d3 \u05d0\u05d7\u05d3 \u05dc\u05d0\u05d9\u05e8\u05d5\u05d7 \u05d0\u05d7\u05d3 \u05d4\u05d1\u05e1\u05d9\u05e1\u05d9\u05dd \u05d4\u05d0\u05de\u05e8\u05d9\u05e7\u05d0\u05d9\u05dd \u05d4\u05d2\u05d3\u05d5\u05dc\u05d9\u05dd \u05d1\u05de\u05d6\u05d4\"\u05ea \u05d5\u05de\u05e6\u05d3 \u05e9\u05e0\u05d9 \u05de\u05d4\u05d5\u05d5\u05d4 \u05d0\u05ea \u05d1\u05d9\u05ea\u05dd \u05d4\u05de\u05d5\u05e2\u05d3\u05e3 \u05e9\u05dc \u05d1\u05db\u05d9\u05e8\u05d9 \u05d7\u05de\u05d0\u05e1 -(\u05e9\u05e2\u05dc \u05e8\u05d0\u05e9\u05dd \u05d0\u05e8\u05d4\"\u05d1 \u05d4\u05d8\u05d9\u05dc\u05d4 \u05e4\u05e8\u05e1\u05d9\u05dd \u05db\u05e1\u05e4\u05d9\u05d9\u05dd).\n"],["\u05dc\u05d9\u05d0\u05d5\u05e8 \u05d1\u05d0\u05e7\u05d0\u05dc\u05d5\u05d4\u05e0\u05e6\u05d9\u05d1\u05d5\u05ea \u05d4\u05d0\u05d9\u05e8\u05d5\u05e4\u05d9\u05ea \u05e4\u05ea\u05d7\u05d4 \u05d1\u05d4\u05dc\u05d9\u05db\u05d9\u05dd \u05e8\u05e9\u05de\u05d9\u05d9\u05dd \u05e0\u05d2\u05d3 TikTok \u05dc\u05e4\u05d9 \u05d7\u05d5\u05e7 \u05d4\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9\u05dd \u05d4\u05d3\u05d9\u05d2\u05d9\u05d8\u05dc\u05d9\u05d9\u05dd (DSA), \u05e2\u05dc \u05e4\u05d9 \u05de\u05e1\u05de\u05da \u05e9\u05e0\u05d7\u05e9\u05e3 \u05e2\u05dc \u05d9\u05d3\u05d9 \u05e8\u05d5\u05d9\u05d8\u05e8\u05e1, \u05db\u05d3\u05d9 \u05dc\u05d1\u05d3\u05d5\u05e7 \u05d4\u05d0\u05dd \u05e4\u05dc\u05d8\u05e4\u05d5\u05e8\u05de\u05ea \u05d4\u05de\u05d3\u05d9\u05d4 \u05d4\u05d7\u05d1\u05e8\u05ea\u05d9\u05ea \u05e2\u05d5\u05e9\u05d4 \u05de\u05e1\u05e4\u05d9\u05e7 \u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05df \u05e2\u05dc \u05d9\u05dc\u05d3\u05d9\u05dd. \"\u05d4\u05d4\u05d2\u05e0\u05d4 \u05e2\u05dc \u05e7\u05d8\u05d9\u05e0\u05d9\u05dd \u05d4\u05d9\u05d0 \u05d1\u05e8\u05d0\u05e9 \u05e1\u05d3\u05e8 \u05d4\u05e2\u05d3\u05d9\u05e4\u05d5\u05d9\u05d5\u05ea \u05dc\u05d0\u05db\u05d9\u05e4\u05ea \u05d7\u05d5\u05e7 \u05d4-DSA. \u05db\u05e4\u05dc\u05d8\u05e4\u05d5\u05e8\u05de\u05d4 \u05e9\u05de\u05d2\u05d9\u05e2\u05d4 \u05dc\u05de\u05d9\u05dc\u05d9\u05d5\u05e0\u05d9 \u05d9\u05dc\u05d3\u05d9\u05dd \u05d5\u05e0\u05d5\u05e2\u05e8, TikTok \u05d7\u05d9\u05d9\u05d1\u05ea \u05dc\u05e6\u05d9\u05d9\u05ea \u05d1\u05d0\u05d5\u05e4\u05df \u05de\u05dc\u05d0 \u05dc-DSA \u05d5\u05d9\u05e9 \u05dc\u05d4 \u05ea\u05e4\u05e7\u05d9\u05d3 \u05de\u05d9\u05d5\u05d7\u05d3 \u05d1\u05d4\u05d2\u05e0\u05d4 \u05e2\u05dc \u05e7\u05d8\u05d9\u05e0\u05d9\u05dd \u05d1\u05e8\u05e9\u05ea\", \u05d0\u05de\u05e8 \u05e0\u05e6\u05d9\u05d1 \u05d4\u05d0\u05d9\u05d7\u05d5\u05d3 \u05d4\u05d0\u05d9\u05e8\u05d5\u05e4\u05d9, \u05ea\u05d9\u05d9\u05e8\u05d9 \u05d1\u05e8\u05d8\u05d5\u05df@N12chat",false,731,"\u05dc\u05d9\u05d0\u05d5\u05e8 \u05d1\u05d0\u05e7\u05d0\u05dc\u05d5\u05d4\u05e0\u05e6\u05d9\u05d1\u05d5\u05ea \u05d4\u05d0\u05d9\u05e8\u05d5\u05e4\u05d9\u05ea \u05e4\u05ea\u05d7\u05d4 \u05d1\u05d4\u05dc\u05d9\u05db\u05d9\u05dd \u05e8\u05e9\u05de\u05d9\u05d9\u05dd \u05e0\u05d2\u05d3 TikTok \u05dc\u05e4\u05d9 \u05d7\u05d5\u05e7 \u05d4\u05e9\u05d9\u05e8\u05d5\u05ea\u05d9\u05dd \u05d4\u05d3\u05d9\u05d2\u05d9\u05d8\u05dc\u05d9\u05d9\u05dd (DSA), \u05e2\u05dc \u05e4\u05d9 \u05de\u05e1\u05de\u05da \u05e9\u05e0\u05d7\u05e9\u05e3 \u05e2\u05dc \u05d9\u05d3\u05d9 \u05e8\u05d5\u05d9\u05d8\u05e8\u05e1, \u05db\u05d3\u05d9 \u05dc\u05d1\u05d3\u05d5\u05e7 \u05d4\u05d0\u05dd \u05e4\u05dc\u05d8\u05e4\u05d5\u05e8\u05de\u05ea \u05d4\u05de\u05d3\u05d9\u05d4 \u05d4\u05d7\u05d1\u05e8\u05ea\u05d9\u05ea \u05e2\u05d5\u05e9\u05d4 \u05de\u05e1\u05e4\u05d9\u05e7 \u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05df \u05e2\u05dc \u05d9\u05dc\u05d3\u05d9\u05dd. \"\u05d4\u05d4\u05d2\u05e0\u05d4 \u05e2\u05dc \u05e7\u05d8\u05d9\u05e0\u05d9\u05dd \u05d4\u05d9\u05d0 \u05d1\u05e8\u05d0\u05e9 \u05e1\u05d3\u05e8 \u05d4\u05e2\u05d3\u05d9\u05e4\u05d5\u05d9\u05d5\u05ea \u05dc\u05d0\u05db\u05d9\u05e4\u05ea \u05d7\u05d5\u05e7 \u05d4-DSA. \u05db\u05e4\u05dc\u05d8\u05e4\u05d5\u05e8\u05de\u05d4 \u05e9\u05de\u05d2\u05d9\u05e2\u05d4 \u05dc\u05de\u05d9\u05dc\u05d9\u05d5\u05e0\u05d9 \u05d9\u05dc\u05d3\u05d9\u05dd \u05d5\u05e0\u05d5\u05e2\u05e8, TikTok \u05d7\u05d9\u05d9\u05d1\u05ea \u05dc\u05e6\u05d9\u05d9\u05ea \u05d1\u05d0\u05d5\u05e4\u05df \u05de\u05dc\u05d0 \u05dc-DSA \u05d5\u05d9\u05e9 \u05dc\u05d4 \u05ea\u05e4\u05e7\u05d9\u05d3 \u05de\u05d9\u05d5\u05d7\u05d3 \u05d1\u05d4\u05d2\u05e0\u05d4 \u05e2\u05dc \u05e7\u05d8\u05d9\u05e0\u05d9\u05dd \u05d1\u05e8\u05e9\u05ea\", \u05d0\u05de\u05e8 \u05e0\u05e6\u05d9\u05d1 \u05d4\u05d0\u05d9\u05d7\u05d5\u05d3 \u05d4\u05d0\u05d9\u05e8\u05d5\u05e4\u05d9, \u05ea\u05d9\u05d9\u05e8\u05d9 \u05d1\u05e8\u05d8\u05d5\u05df@N12chat"],["\u05d7\u05d9\u05dc \u05d4\u05d0\u05d5\u05d5\u05d9\u05e8 \u05ea\u05d5\u05e7\u05e3 \u05d1\u05d7'\u05d0\u05df \u05d9\u05d5\u05e0\u05e1 \u05d1\u05d3\u05e8\u05d5\u05dd \u05d4\u05e8\u05e6\u05d5\u05e2\u05d4.\n",false,732,"\u05d7\u05d9\u05dc \u05d4\u05d0\u05d5\u05d5\u05d9\u05e8 \u05ea\u05d5\u05e7\u05e3 \u05d1\u05d7'\u05d0\u05df \u05d9\u05d5\u05e0\u05e1 \u05d1\u05d3\u05e8\u05d5\u05dd \u05d4\u05e8\u05e6\u05d5\u05e2\u05d4.\n"],["\u05de\u05e9\u05e8\u05d3 \u05d4\u05d1\u05e8\u05d9\u05d0\u05d5\u05ea \u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9: 109 \u05d4\u05e8\u05d5\u05d2\u05d9\u05dd \u05d5\u05de\u05d0\u05d5\u05ea \u05e4\u05e6\u05d5\u05e2\u05d9\u05dd \u05de\u05d0\u05d6 \u05d4\u05d1\u05d5\u05e7\u05e8 \u05d1\u05e8\u05d7\u05d1\u05d9 \u05d4\u05e8\u05e6\u05d5\u05e2\u05d4.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,733,"\u05de\u05e9\u05e8\u05d3 \u05d4\u05d1\u05e8\u05d9\u05d0\u05d5\u05ea \u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9: 109 \u05d4\u05e8\u05d5\u05d2\u05d9\u05dd \u05d5\u05de\u05d0\u05d5\u05ea \u05e4\u05e6\u05d5\u05e2\u05d9\u05dd \u05de\u05d0\u05d6 \u05d4\u05d1\u05d5\u05e7\u05e8 \u05d1\u05e8\u05d7\u05d1\u05d9 \u05d4\u05e8\u05e6\u05d5\u05e2\u05d4.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05d0\u05e1\u05e3 \u05e8\u05d5\u05d6\u05e0\u05e6\u05d5\u05d9\u05d9\u05d2\u05d6\u05e2\u05dd \u05d1\u05d0\u05d5\u05e7\u05e8\u05d0\u05d9\u05e0\u05d4 \u05d1\u05e2\u05e7\u05d1\u05d5\u05ea \u05ea\u05d9\u05e2\u05d5\u05d3 \u05e9\u05dc \u05d7\u05d9\u05d9\u05dc \u05e8\u05d5\u05e1\u05d9 \u05de\u05d5\u05e6\u05d9\u05d0 \u05dc\u05d4\u05d5\u05e8\u05d2 \u05e9\u05e0\u05d9 \u05e9\u05d1\u05d5\u05d9\u05d9 \u05de\u05dc\u05d7\u05de\u05d4 \u05d0\u05d5\u05e7\u05e8\u05d0\u05d9\u05e0\u05d9\u05dd \u05d1\u05dc\u05d7\u05d9\u05de\u05d4 \u05d1\u05d7\u05d6\u05d9\u05ea \u05d4\u05de\u05d6\u05e8\u05d7@N12chat",false,734,"\u05d0\u05e1\u05e3 \u05e8\u05d5\u05d6\u05e0\u05e6\u05d5\u05d9\u05d9\u05d2\u05d6\u05e2\u05dd \u05d1\u05d0\u05d5\u05e7\u05e8\u05d0\u05d9\u05e0\u05d4 \u05d1\u05e2\u05e7\u05d1\u05d5\u05ea \u05ea\u05d9\u05e2\u05d5\u05d3 \u05e9\u05dc \u05d7\u05d9\u05d9\u05dc \u05e8\u05d5\u05e1\u05d9 \u05de\u05d5\u05e6\u05d9\u05d0 \u05dc\u05d4\u05d5\u05e8\u05d2 \u05e9\u05e0\u05d9 \u05e9\u05d1\u05d5\u05d9\u05d9 \u05de\u05dc\u05d7\u05de\u05d4 \u05d0\u05d5\u05e7\u05e8\u05d0\u05d9\u05e0\u05d9\u05dd \u05d1\u05dc\u05d7\u05d9\u05de\u05d4 \u05d1\u05d7\u05d6\u05d9\u05ea \u05d4\u05de\u05d6\u05e8\u05d7@N12chat"],["\u05d0\u05d5\u05e8 \u05e8\u05d1\u05d9\u05d3\u05d2\u05dd \u05d1\u05e0\u05d9\u05d9\u05df \u05e2\u05d9\u05e8\u05d9\u05d9\u05ea \u05ea\u05dc \u05d0\u05d1\u05d9\u05d1-\u05d9\u05e4\u05d5 \u05d4\u05d5\u05d0\u05e8 \u05d1\u05db\u05ea\u05d5\u05dd \u05dc\u05e6\u05d9\u05d5\u05df \u05d9\u05d5\u05dd \u05d4\u05d5\u05dc\u05d3\u05ea\u05d5 \u05d4\u05e8\u05d0\u05e9\u05d5\u05df \u05e9\u05dc \u05db\u05e4\u05d9\u05e8 \u05d1\u05d9\u05d1\u05e1, \u05e6\u05e2\u05d9\u05e8 \u05d4\u05d7\u05d8\u05d5\u05e4\u05d9\u05dd \u05d1\u05e2\u05d6\u05d4. \u05e6\u05d9\u05dc\u05d5\u05dd: \u05d0\u05d9\u05dc\u05df \u05e1\u05e4\u05d9\u05e8\u05d0@N12chat",false,735,"\u05d0\u05d5\u05e8 \u05e8\u05d1\u05d9\u05d3\u05d2\u05dd \u05d1\u05e0\u05d9\u05d9\u05df \u05e2\u05d9\u05e8\u05d9\u05d9\u05ea \u05ea\u05dc \u05d0\u05d1\u05d9\u05d1-\u05d9\u05e4\u05d5 \u05d4\u05d5\u05d0\u05e8 \u05d1\u05db\u05ea\u05d5\u05dd \u05dc\u05e6\u05d9\u05d5\u05df \u05d9\u05d5\u05dd \u05d4\u05d5\u05dc\u05d3\u05ea\u05d5 \u05d4\u05e8\u05d0\u05e9\u05d5\u05df \u05e9\u05dc \u05db\u05e4\u05d9\u05e8 \u05d1\u05d9\u05d1\u05e1, \u05e6\u05e2\u05d9\u05e8 \u05d4\u05d7\u05d8\u05d5\u05e4\u05d9\u05dd \u05d1\u05e2\u05d6\u05d4. \u05e6\u05d9\u05dc\u05d5\u05dd: \u05d0\u05d9\u05dc\u05df \u05e1\u05e4\u05d9\u05e8\u05d0@N12chat"],["\u05e7\u05e8\u05df \u05d1\u05e6\u05dc\u05d0\u05dc\u05e9\u05e8 \u05d4\u05d7\u05d5\u05e5 \u05d1\u05dc\u05d9\u05e0\u05e7\u05df \u05dc\u05de\u05e9\u05e4\u05d7\u05d5\u05ea \u05d4\u05d7\u05d8\u05d5\u05e4\u05d9\u05dd: \u05d0\u05e0\u05d5 \u05e2\u05d5\u05d1\u05d3\u05d9\u05dd \u05d1\u05de\u05e8\u05e5 \u05db\u05d3\u05d9 \u05dc\u05d4\u05e9\u05d9\u05d2 \u05e2\u05e1\u05e7\u05d4 \u05e0\u05d5\u05e1\u05e4\u05ea, \u05d9\u05e9 \u05db\u05e8\u05d2\u05e2 \u05de\u05e1\u05dc\u05d5\u05dc \u05e9\u05d0\u05d5\u05dc\u05d9 \u05d9\u05d1\u05d9\u05d0 \u05dc\u05ea\u05d5\u05e6\u05d0\u05d5\u05ea \u05d5\u05d9\u05e9\u05e0\u05d4 \u05de\u05e2\u05d5\u05e8\u05d1\u05d5\u05ea \u05e9\u05dc \u05db\u05dc \u05d4\u05d2\u05d5\u05e8\u05de\u05d9\u05dd \u05d4\u05e8\u05dc\u05d5\u05d5\u05e0\u05d8\u05d9\u05dd. \u05d0\u05e0\u05d9 \u05de\u05e6\u05d9\u05e2 \u05dc\u05de\u05e9\u05e4\u05d7\u05d5\u05ea \u05dc\u05d4\u05de\u05e9\u05d9\u05da \u05d0\u05ea \u05d4\u05dc\u05d7\u05e5 \u05d4\u05d1\u05d9\u05df-\u05dc\u05d0\u05d5\u05de\u05d9, \u05ea\u05de\u05e9\u05d9\u05db\u05d5 \u05dc\u05d4\u05e9\u05de\u05d9\u05e2 \u05d0\u05ea \u05e7\u05d5\u05dc\u05db\u05dd \u05d5\u05ea\u05e9\u05d0\u05d9\u05e8\u05d5 \u05d0\u05ea \u05d4\u05e0\u05d5\u05e9\u05d0 \u05d1\u05e8\u05d0\u05e9 \u05e1\u05d3\u05e8 \u05d4\u05d9\u05d5\u05dd@N12chat",false,736,"\u05e7\u05e8\u05df \u05d1\u05e6\u05dc\u05d0\u05dc\u05e9\u05e8 \u05d4\u05d7\u05d5\u05e5 \u05d1\u05dc\u05d9\u05e0\u05e7\u05df \u05dc\u05de\u05e9\u05e4\u05d7\u05d5\u05ea \u05d4\u05d7\u05d8\u05d5\u05e4\u05d9\u05dd: \u05d0\u05e0\u05d5 \u05e2\u05d5\u05d1\u05d3\u05d9\u05dd \u05d1\u05de\u05e8\u05e5 \u05db\u05d3\u05d9 \u05dc\u05d4\u05e9\u05d9\u05d2 \u05e2\u05e1\u05e7\u05d4 \u05e0\u05d5\u05e1\u05e4\u05ea, \u05d9\u05e9 \u05db\u05e8\u05d2\u05e2 \u05de\u05e1\u05dc\u05d5\u05dc \u05e9\u05d0\u05d5\u05dc\u05d9 \u05d9\u05d1\u05d9\u05d0 \u05dc\u05ea\u05d5\u05e6\u05d0\u05d5\u05ea \u05d5\u05d9\u05e9\u05e0\u05d4 \u05de\u05e2\u05d5\u05e8\u05d1\u05d5\u05ea \u05e9\u05dc \u05db\u05dc \u05d4\u05d2\u05d5\u05e8\u05de\u05d9\u05dd \u05d4\u05e8\u05dc\u05d5\u05d5\u05e0\u05d8\u05d9\u05dd. \u05d0\u05e0\u05d9 \u05de\u05e6\u05d9\u05e2 \u05dc\u05de\u05e9\u05e4\u05d7\u05d5\u05ea \u05dc\u05d4\u05de\u05e9\u05d9\u05da \u05d0\u05ea \u05d4\u05dc\u05d7\u05e5 \u05d4\u05d1\u05d9\u05df-\u05dc\u05d0\u05d5\u05de\u05d9, \u05ea\u05de\u05e9\u05d9\u05db\u05d5 \u05dc\u05d4\u05e9\u05de\u05d9\u05e2 \u05d0\u05ea \u05e7\u05d5\u05dc\u05db\u05dd \u05d5\u05ea\u05e9\u05d0\u05d9\u05e8\u05d5 \u05d0\u05ea \u05d4\u05e0\u05d5\u05e9\u05d0 \u05d1\u05e8\u05d0\u05e9 \u05e1\u05d3\u05e8 \u05d4\u05d9\u05d5\u05dd@N12chat"],["\u05d3\u05e4\u05e0\u05d4 \u05dc\u05d9\u05d0\u05dc\u05e0\u05e9\u05d9\u05d0\u05ea \u05d1\u05d9\u05ea \u05d4\u05d3\u05d9\u05df \u05de\u05de\u05e9\u05d9\u05db\u05d4: \u05d4\u05e4\u05e2\u05d5\u05dc\u05d4 \u05d4\u05e6\u05d1\u05d0\u05d9\u05ea \u05d4\u05d1\u05d9\u05d0\u05d4 \u05dc\u05de\u05e7\u05e8\u05d9 \u05de\u05d5\u05d5\u05ea \u05d5\u05d4\u05e8\u05e1 \u05e8\u05d1\u05d9\u05dd \u05d5\u05d4\u05d6\u05d6\u05ea \u05d0\u05d5\u05db\u05dc\u05d5\u05e1\u05d9\u05d4. \u05d4\u05d0\u05d9\u05e0\u05d3\u05d9\u05e7\u05e6\u05d9\u05d4 \u05d4\u05d0\u05d7\u05e8\u05d5\u05e0\u05d4 \u05d4\u05d9\u05d0 \u05e9\u05d9\u05d5\u05ea\u05e8 \u05de-27 \u05d0\u05dc\u05e3 \u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd \u05e0\u05d4\u05e8\u05d2\u05d5 \u05d5\u05e2\u05e9\u05e8\u05d5\u05ea \u05d0\u05dc\u05e4\u05d9 \u05d1\u05ea\u05d9\u05dd \u05e0\u05d4\u05e8\u05e1\u05d5@N12chat",false,737,"\u05d3\u05e4\u05e0\u05d4 \u05dc\u05d9\u05d0\u05dc\u05e0\u05e9\u05d9\u05d0\u05ea \u05d1\u05d9\u05ea \u05d4\u05d3\u05d9\u05df \u05de\u05de\u05e9\u05d9\u05db\u05d4: \u05d4\u05e4\u05e2\u05d5\u05dc\u05d4 \u05d4\u05e6\u05d1\u05d0\u05d9\u05ea \u05d4\u05d1\u05d9\u05d0\u05d4 \u05dc\u05de\u05e7\u05e8\u05d9 \u05de\u05d5\u05d5\u05ea \u05d5\u05d4\u05e8\u05e1 \u05e8\u05d1\u05d9\u05dd \u05d5\u05d4\u05d6\u05d6\u05ea \u05d0\u05d5\u05db\u05dc\u05d5\u05e1\u05d9\u05d4. \u05d4\u05d0\u05d9\u05e0\u05d3\u05d9\u05e7\u05e6\u05d9\u05d4 \u05d4\u05d0\u05d7\u05e8\u05d5\u05e0\u05d4 \u05d4\u05d9\u05d0 \u05e9\u05d9\u05d5\u05ea\u05e8 \u05de-27 \u05d0\u05dc\u05e3 \u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd \u05e0\u05d4\u05e8\u05d2\u05d5 \u05d5\u05e2\u05e9\u05e8\u05d5\u05ea \u05d0\u05dc\u05e4\u05d9 \u05d1\u05ea\u05d9\u05dd \u05e0\u05d4\u05e8\u05e1\u05d5@N12chat"],["\u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd \u05de\u05d3\u05d5\u05d5\u05d7\u05d9\u05dd \u05e2\u05dc \u05dc\u05de\u05e2\u05dc\u05d4 \u05de 12 \u05d4\u05e8\u05d5\u05d2\u05d9\u05dd \u05d1\u05ea\u05e7\u05d9\u05e4\u05ea \u05d0\u05d6\u05d5\u05e8 \u05d4\u05e9\u05d5\u05e7 \u05d1\u05e0\u05e6\u05d9\u05e8\u05d0\u05ea (\u05de\u05e8\u05db\u05d6 \u05d4\u05e8\u05e6\u05d5\u05e2\u05d4).\u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9 \u05d4\u05d7\u05d1\u05d9\u05d1 \u05d1\u05e1\u05e8\u05d8\u05d5\u05df \u05d4\u05de\u05e6\u05d5\u05e8\u05e3 \u05de\u05e1\u05d1\u05d9\u05e8, \u05de\u05ea\u05d5\u05da \u05d1\u05d9\u05ea \u05d4\u05d7\u05d5\u05dc\u05d9\u05dd \u05d1\u05e0\u05e6\u05d9\u05e8\u05d0\u05ea, \u05e2\u05dc \u05d4\u05d0\u05d9\u05e8\u05d5\u05e2 \u05e2\u05e6\u05de\u05d5.\u05d7\u05e9\u05de\u05dc, \u05db\u05e4\u05d9 \u05e9\u05d0\u05ea\u05dd \u05e8\u05d5\u05d0\u05d9\u05dd, \u05dc\u05d0 \u05d7\u05e1\u05e8 \u05d4\u05e2\u05e8\u05d1, \u05d2\u05dd \u05d1\u05d1\u05d9\u05ea \u05d4\u05d7\u05d5\u05dc\u05d9\u05dd \u05d4\u05d6\u05d4.User sent a document",false,738,"\u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd \u05de\u05d3\u05d5\u05d5\u05d7\u05d9\u05dd \u05e2\u05dc \u05dc\u05de\u05e2\u05dc\u05d4 \u05de 12 \u05d4\u05e8\u05d5\u05d2\u05d9\u05dd \u05d1\u05ea\u05e7\u05d9\u05e4\u05ea \u05d0\u05d6\u05d5\u05e8 \u05d4\u05e9\u05d5\u05e7 \u05d1\u05e0\u05e6\u05d9\u05e8\u05d0\u05ea (\u05de\u05e8\u05db\u05d6 \u05d4\u05e8\u05e6\u05d5\u05e2\u05d4).\u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9 \u05d4\u05d7\u05d1\u05d9\u05d1 \u05d1\u05e1\u05e8\u05d8\u05d5\u05df \u05d4\u05de\u05e6\u05d5\u05e8\u05e3 \u05de\u05e1\u05d1\u05d9\u05e8, \u05de\u05ea\u05d5\u05da \u05d1\u05d9\u05ea \u05d4\u05d7\u05d5\u05dc\u05d9\u05dd \u05d1\u05e0\u05e6\u05d9\u05e8\u05d0\u05ea, \u05e2\u05dc \u05d4\u05d0\u05d9\u05e8\u05d5\u05e2 \u05e2\u05e6\u05de\u05d5.\u05d7\u05e9\u05de\u05dc, \u05db\u05e4\u05d9 \u05e9\u05d0\u05ea\u05dd \u05e8\u05d5\u05d0\u05d9\u05dd, \u05dc\u05d0 \u05d7\u05e1\u05e8 \u05d4\u05e2\u05e8\u05d1, \u05d2\u05dd \u05d1\u05d1\u05d9\u05ea \u05d4\u05d7\u05d5\u05dc\u05d9\u05dd \u05d4\u05d6\u05d4.User sent a document"],["\u05e2\u05e0\u05d1\u05e8 \u05d8\u05d5\u05d9\u05d6\u05e8\u05d0\u05d2\u05e3 \u05d4\u05e9\u05d9\u05e7\u05d5\u05dd \u05d1\u05de\u05e9\u05e8\u05d3 \u05d4\u05d1\u05d9\u05d8\u05d7\u05d5\u05df \u05e0\u05e2\u05e8\u05da \u05dc\u05d6\u05d9\u05e0\u05d5\u05e7 \u05d2\u05d3\u05d5\u05dc \u05d1\u05d4\u05d9\u05e7\u05e4\u05dd \u05e9\u05dc \u05e0\u05db\u05d9 \u05e6\u05d4\"\u05dc \u05d5\u05de\u05ea\u05de\u05d5\u05d3\u05d3\u05d9\u05dd \u05e2\u05dd \u05e4\u05d5\u05e1\u05d8-\u05d8\u05e8\u05d0\u05d5\u05de\u05d4 \u05d1\u05e2\u05e7\u05d1\u05d5\u05ea \u05d4\u05de\u05dc\u05d7\u05de\u05d4. \u05d4\u05ea\u05d7\u05d6\u05d9\u05ea: \u05db-20 \u05d0\u05dc\u05e3 \u05de\u05d8\u05d5\u05e4\u05dc\u05d9\u05dd \u05e2\u05d3 \u05e1\u05d5\u05e3 \u05e9\u05e0\u05ea 2024@N12chat",false,739,"\u05e2\u05e0\u05d1\u05e8 \u05d8\u05d5\u05d9\u05d6\u05e8\u05d0\u05d2\u05e3 \u05d4\u05e9\u05d9\u05e7\u05d5\u05dd \u05d1\u05de\u05e9\u05e8\u05d3 \u05d4\u05d1\u05d9\u05d8\u05d7\u05d5\u05df \u05e0\u05e2\u05e8\u05da \u05dc\u05d6\u05d9\u05e0\u05d5\u05e7 \u05d2\u05d3\u05d5\u05dc \u05d1\u05d4\u05d9\u05e7\u05e4\u05dd \u05e9\u05dc \u05e0\u05db\u05d9 \u05e6\u05d4\"\u05dc \u05d5\u05de\u05ea\u05de\u05d5\u05d3\u05d3\u05d9\u05dd \u05e2\u05dd \u05e4\u05d5\u05e1\u05d8-\u05d8\u05e8\u05d0\u05d5\u05de\u05d4 \u05d1\u05e2\u05e7\u05d1\u05d5\u05ea \u05d4\u05de\u05dc\u05d7\u05de\u05d4. \u05d4\u05ea\u05d7\u05d6\u05d9\u05ea: \u05db-20 \u05d0\u05dc\u05e3 \u05de\u05d8\u05d5\u05e4\u05dc\u05d9\u05dd \u05e2\u05d3 \u05e1\u05d5\u05e3 \u05e9\u05e0\u05ea 2024@N12chat"],["\u05e1\u05e4\u05d9\u05e8 \u05dc\u05d9\u05e4\u05e7\u05d9\u05df\ud83d\udcdd\u05d1\u05db\u05d9\u05e8 \u05d7\u05de\u05d0\u05e1 \u05d1\u05d7\u05d5\"\u05dc, \u05de\u05d5\u05e1\u05d0 \u05d0\u05d1\u05d5 \u05de\u05e8\u05d6\u05d5\u05e7, \u05d1\u05d4\u05ea\u05d1\u05d8\u05d0\u05d5\u05ea \u05d7\u05e8\u05d9\u05d2\u05d4, \u05d1\u05e8\u05d9\u05d0\u05d9\u05d5\u05df \u05dc\u05d0\u05dc-\u05de\u05d5\u05e0\u05d9\u05d8\u05d5\u05e8 - \u05d4\u05e6\u05d9\u05e2 \u05e9\u05d7\u05de\u05d0\u05e1 \u05d9\u05db\u05d9\u05e8 \u05d1\u05d9\u05e9\u05e8\u05d0\u05dc, \u05db\u05e6\u05e2\u05d3 \u05dc\u05e7\u05e8\u05d0\u05ea \u05e1\u05d9\u05d5\u05dd \u05d4\u05e4\u05d9\u05dc\u05d5\u05d2 \u05d4\u05e4\u05e0\u05d9\u05dd-\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9. \"\u05d9\u05e9 \u05dc\u05db\u05d1\u05d3 \u05d0\u05ea \u05d4\u05e2\u05de\u05d3\u05d4 \u05d4\u05e8\u05e9\u05de\u05d9\u05ea - \u05d0\u05e9\"\u05e3 \u05d4\u05db\u05d9\u05e8 \u05d1\u05de\u05d3\u05d9\u05e0\u05ea \u05d9\u05e9\u05e8\u05d0\u05dc. \u05d0\u05e0\u05d7\u05e0\u05d5 \u05de\u05d1\u05e7\u05e9\u05d9\u05dd \u05dc\u05d4\u05d9\u05d5\u05ea \u05d7\u05dc\u05e7 \u05de\u05d0\u05e9\"\u05e3, \u05d5\u05d0\u05de\u05e8\u05e0\u05d5 \u05e9\u05e0\u05db\u05d1\u05d3 \u05d0\u05ea \u05d4\u05ea\u05d7\u05d9\u05d9\u05d1\u05d5\u05d9\u05d5\u05ea \u05e9\u05dc\u05d5\". \u05dc\u05d3\u05d1\u05e8\u05d9\u05d5, \u05dc\u05d9\u05e9\u05e8\u05d0\u05dc\u05d9\u05dd \u05e6\u05e8\u05d9\u05db\u05d5\u05ea \u05dc\u05d4\u05d9\u05d5\u05ea \u05d6\u05db\u05d5\u05d9\u05d5\u05ea - \"\u05d0\u05d1\u05dc \u05dc\u05d0 \u05e2\u05dc \u05d7\u05e9\u05d1\u05d5\u05df \u05d0\u05d7\u05e8\u05d9\u05dd\"@N12chat",false,740,"\u05e1\u05e4\u05d9\u05e8 \u05dc\u05d9\u05e4\u05e7\u05d9\u05df\ud83d\udcdd\u05d1\u05db\u05d9\u05e8 \u05d7\u05de\u05d0\u05e1 \u05d1\u05d7\u05d5\"\u05dc, \u05de\u05d5\u05e1\u05d0 \u05d0\u05d1\u05d5 \u05de\u05e8\u05d6\u05d5\u05e7, \u05d1\u05d4\u05ea\u05d1\u05d8\u05d0\u05d5\u05ea \u05d7\u05e8\u05d9\u05d2\u05d4, \u05d1\u05e8\u05d9\u05d0\u05d9\u05d5\u05df \u05dc\u05d0\u05dc-\u05de\u05d5\u05e0\u05d9\u05d8\u05d5\u05e8 - \u05d4\u05e6\u05d9\u05e2 \u05e9\u05d7\u05de\u05d0\u05e1 \u05d9\u05db\u05d9\u05e8 \u05d1\u05d9\u05e9\u05e8\u05d0\u05dc, \u05db\u05e6\u05e2\u05d3 \u05dc\u05e7\u05e8\u05d0\u05ea \u05e1\u05d9\u05d5\u05dd \u05d4\u05e4\u05d9\u05dc\u05d5\u05d2 \u05d4\u05e4\u05e0\u05d9\u05dd-\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9. \"\u05d9\u05e9 \u05dc\u05db\u05d1\u05d3 \u05d0\u05ea \u05d4\u05e2\u05de\u05d3\u05d4 \u05d4\u05e8\u05e9\u05de\u05d9\u05ea - \u05d0\u05e9\"\u05e3 \u05d4\u05db\u05d9\u05e8 \u05d1\u05de\u05d3\u05d9\u05e0\u05ea \u05d9\u05e9\u05e8\u05d0\u05dc. \u05d0\u05e0\u05d7\u05e0\u05d5 \u05de\u05d1\u05e7\u05e9\u05d9\u05dd \u05dc\u05d4\u05d9\u05d5\u05ea \u05d7\u05dc\u05e7 \u05de\u05d0\u05e9\"\u05e3, \u05d5\u05d0\u05de\u05e8\u05e0\u05d5 \u05e9\u05e0\u05db\u05d1\u05d3 \u05d0\u05ea \u05d4\u05ea\u05d7\u05d9\u05d9\u05d1\u05d5\u05d9\u05d5\u05ea \u05e9\u05dc\u05d5\". \u05dc\u05d3\u05d1\u05e8\u05d9\u05d5, \u05dc\u05d9\u05e9\u05e8\u05d0\u05dc\u05d9\u05dd \u05e6\u05e8\u05d9\u05db\u05d5\u05ea \u05dc\u05d4\u05d9\u05d5\u05ea \u05d6\u05db\u05d5\u05d9\u05d5\u05ea - \"\u05d0\u05d1\u05dc \u05dc\u05d0 \u05e2\u05dc \u05d7\u05e9\u05d1\u05d5\u05df \u05d0\u05d7\u05e8\u05d9\u05dd\"@N12chat"],["\u05de\u05e1\u05ea\u05e2\u05e8\u05d1\u05d9\u05dd \u05d7\u05d9\u05e1\u05dc\u05d5 3 \u05de\u05d7\u05d1\u05dc\u05d9\u05dd \u05d1\u05ea\u05d5\u05da \u05d1\u05d9\u05ea \u05d7\u05d5\u05dc\u05d9\u05dd \u05d1\u05d2'\u05e0\u05d9\u05df - \u05ea\u05db\u05e0\u05e0\u05d5 \u05e4\u05d9\u05d2\u05d5\u05e2 \u05d1\u05d8\u05d5\u05d5\u05d7 \u05d4\u05d6\u05de\u05df \u05d4\u05de\u05d9\u05d9\u05d3\u05d9 \u05d1\u05d4\u05e9\u05e8\u05d0\u05ea \u05d0\u05d9\u05e8\u05d5\u05e2\u05d9 \u05d4 7.10\u05db\u05dc\u05d9 \u05ea\u05e7\u05e9\u05d5\u05e8\u05ea \u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd \u05d3\u05d9\u05d5\u05d5\u05d7\u05d5 \u05d4\u05d1\u05d5\u05e7\u05e8 \u05db\u05d9 \u05d1\u05e1\u05de\u05d5\u05da \u05dc\u05e9\u05e2\u05d4 05:30 \u05d4\u05e1\u05ea\u05e0\u05df \u05db\u05d5\u05d7 \u05de\u05e1\u05ea\u05e2\u05e8\u05d1\u05d9\u05dd \u05dc\u05d1\u05d5\u05e9 \u05d1\u05d1\u05d2\u05d3\u05d9\u05dd \u05d0\u05d6\u05e8\u05d7\u05d9\u05d9\u05dd, \u05dc\u05e7\u05d5\u05de\u05d4 \u05d4\u05e9\u05dc\u05d9\u05e9\u05d9\u05ea \u05d1\u05d1\u05d9\u05ea \u05d4\u05d7\u05d5\u05dc\u05d9\u05dd \u05d0\u05d1\u05df \u05e1\u05e0\u05d0\u05d0' \u05d1\u05d2'\u05e0\u05d9\u05df \u05d5\u05d7\u05d9\u05e1\u05dc \u05de\u05d8\u05d5\u05d5\u05d7 \u05e7\u05e6\u05e8 \u05d0\u05ea:1. \u05de\u05d7\u05de\u05d3 \u05d2'\u05dc\u05d0\u05de\u05e0\u05d4, \u05de\u05e4\u05e7\u05d3 \u05d1\u05d6\u05e8\u05d5\u05e2 \u05d4\u05e6\u05d1\u05d0\u05d9\u05ea \u05e9\u05dc \u05d7\u05de\u05d0\u05e1 \u05d1\u05d2'\u05e0\u05d9\u05df \u05d5\u05d2\u05dd \u05d4\u05d3\u05d5\u05d1\u05e8 \u05e9\u05dc\u05d4.2. \u05de\u05d7\u05de\u05d3 \u05e2'\u05d6\u05d0\u05d5\u05d9, \u05d0\u05d7\u05d3 \u05de\u05de\u05d9\u05d9\u05e1\u05d3\u05d9 \"\u05d2\u05d3\u05d5\u05d3 \u05d2'\u05e0\u05d9\u05df\" \u05d1\u05d6\u05e8\u05d5\u05e2 \u05d4\u05e6\u05d1\u05d0\u05d9\u05ea \u05e9\u05dc \u05d4\u05d2'\u05d4\u05d0\u05d3 \u05d4\u05d0\u05e1\u05dc\u05d0\u05de\u05d9.3. \u05d1\u05d0\u05e1\u05dc \u05e2'\u05d6\u05d0\u05d5\u05d9, \u05e4\u05e2\u05d9\u05dc \u05d1\u05d6\u05e8\u05d5\u05e2 \u05d4\u05e6\u05d1\u05d0\u05d9\u05ea \u05d4\u05d2'\u05d4\u05d0\u05d3 \u05d4\u05d0\u05e1\u05dc\u05d0\u05de\u05d9 \u05d1\u05d2'\u05e0\u05d9\u05df \u05d5\u05d0\u05d7\u05d9\u05d5 \u05e9\u05dc \u05de\u05d7\u05de\u05d3.\u05e2\"\u05e4 \u05d4\u05d5\u05d3\u05e2\u05ea \u05e6\u05d4\"\u05dc \u05d5\u05d4\u05e9\u05d1\"\u05db, \u05de\u05d7\u05de\u05d3 \u05d2'\u05dc\u05d0\u05de\u05e0\u05d4, \u05d9\u05e2\u05d3 \u05d4\u05e4\u05e2\u05d5\u05dc\u05d4, \u05e2\u05de\u05d3 \u05d1\u05e7\u05e9\u05e8 \u05e2\u05dd \u05d7\u05de\u05d0\u05e1 \u05d7\u05d5\"\u05dc\u05d1\u05de\u05d8\u05e8\u05d4 \u05dc\u05d4\u05d5\u05e6\u05d9\u05d0 \u05e4\u05d9\u05d2\u05d5\u05e2 \u05d1\u05d8\u05d5\u05d5\u05d7 \u05d4\u05d6\u05de\u05df \u05d4\u05de\u05d9\u05d9\u05d3\u05d9 \u05d1\u05d4\u05e9\u05e8\u05d0\u05ea \u05d0\u05d9\u05e8\u05d5\u05e2\u05d9 \u05d4\u05d8\u05d1\u05d7 \u05e9\u05dc \u05d4 7.10\u05e2\"\u05e4 \u05d4\u05d4\u05d5\u05d3\u05e2\u05d4 \u05d7\u05d5\u05e1\u05dc\u05d5 \u05e2\u05de\u05d5 \u05e2\u05d5\u05d3 \u05e9\u05e0\u05d9 \u05de\u05d7\u05d1\u05dc\u05d9 \u05d2'\u05d4\u05d0\u05d3 \u05d0\u05e1\u05dc\u05d0\u05de\u05d9, \u05d0\u05d7\u05d9\u05dd, \u05e9\u05d4\u05e1\u05ea\u05ea\u05e8\u05d5 \u05d1\u05d1\u05d9\u05ea \u05d4\u05d7\u05d5\u05dc\u05d9\u05dd.\u05d2\u05dd \u05db\u05d0\u05df \u05e0\u05d9\u05e6\u05dc\u05d5 \u05d4\u05de\u05d7\u05d1\u05dc\u05d9\u05dd \u05d0\u05ea \u05ea\u05e9\u05ea\u05d9\u05ea \u05d1\u05d9\u05ea \u05d4\u05d7\u05d5\u05dc\u05d9\u05dd \u05db\u05d3\u05d9 \u05db\u05d4\u05d2\u05e0\u05d4 \u05de\u05e4\u05e0\u05d9 \u05db\u05d5\u05d7\u05d5\u05ea \u05d4\u05d1\u05d9\u05d8\u05d7\u05d5\u05df \u05d4\u05d9\u05e9\u05e8\u05d0\u05dc\u05d9\u05dd.\u05e9\u05e8\u05ea \u05d4\u05d1\u05e8\u05d9\u05d0\u05d5\u05ea \u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05ea \u05e7\u05e8\u05d0\u05d4 \u05dc\u05de\u05d5\u05e1\u05d3\u05d5\u05ea \u05d4\u05d1\u05d9\u05e0\"\u05dc \u05dc\u05e1\u05e4\u05e7 \u05d4\u05d4\u05d2\u05e0\u05d4 \u05dc\u05de\u05d5\u05e1\u05d3\u05d5\u05ea \u05d4\u05e8\u05e4\u05d5\u05d0\u05d9\u05d9\u05dd \u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd \u05d1\u05e2\u05e7\u05d1\u05d5\u05ea \u05d4\u05d7\u05d9\u05e1\u05d5\u05dc \u05d1\u05e9\u05d8\u05d7 \u05d1\u05d9\u05ea \u05d4\u05d7\u05d5\u05dc\u05d9\u05dd.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,741,"\u05de\u05e1\u05ea\u05e2\u05e8\u05d1\u05d9\u05dd \u05d7\u05d9\u05e1\u05dc\u05d5 3 \u05de\u05d7\u05d1\u05dc\u05d9\u05dd \u05d1\u05ea\u05d5\u05da \u05d1\u05d9\u05ea \u05d7\u05d5\u05dc\u05d9\u05dd \u05d1\u05d2'\u05e0\u05d9\u05df - \u05ea\u05db\u05e0\u05e0\u05d5 \u05e4\u05d9\u05d2\u05d5\u05e2 \u05d1\u05d8\u05d5\u05d5\u05d7 \u05d4\u05d6\u05de\u05df \u05d4\u05de\u05d9\u05d9\u05d3\u05d9 \u05d1\u05d4\u05e9\u05e8\u05d0\u05ea \u05d0\u05d9\u05e8\u05d5\u05e2\u05d9 \u05d4 7.10\u05db\u05dc\u05d9 \u05ea\u05e7\u05e9\u05d5\u05e8\u05ea \u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd \u05d3\u05d9\u05d5\u05d5\u05d7\u05d5 \u05d4\u05d1\u05d5\u05e7\u05e8 \u05db\u05d9 \u05d1\u05e1\u05de\u05d5\u05da \u05dc\u05e9\u05e2\u05d4 05:30 \u05d4\u05e1\u05ea\u05e0\u05df \u05db\u05d5\u05d7 \u05de\u05e1\u05ea\u05e2\u05e8\u05d1\u05d9\u05dd \u05dc\u05d1\u05d5\u05e9 \u05d1\u05d1\u05d2\u05d3\u05d9\u05dd \u05d0\u05d6\u05e8\u05d7\u05d9\u05d9\u05dd, \u05dc\u05e7\u05d5\u05de\u05d4 \u05d4\u05e9\u05dc\u05d9\u05e9\u05d9\u05ea \u05d1\u05d1\u05d9\u05ea \u05d4\u05d7\u05d5\u05dc\u05d9\u05dd \u05d0\u05d1\u05df \u05e1\u05e0\u05d0\u05d0' \u05d1\u05d2'\u05e0\u05d9\u05df \u05d5\u05d7\u05d9\u05e1\u05dc \u05de\u05d8\u05d5\u05d5\u05d7 \u05e7\u05e6\u05e8 \u05d0\u05ea:1. \u05de\u05d7\u05de\u05d3 \u05d2'\u05dc\u05d0\u05de\u05e0\u05d4, \u05de\u05e4\u05e7\u05d3 \u05d1\u05d6\u05e8\u05d5\u05e2 \u05d4\u05e6\u05d1\u05d0\u05d9\u05ea \u05e9\u05dc \u05d7\u05de\u05d0\u05e1 \u05d1\u05d2'\u05e0\u05d9\u05df \u05d5\u05d2\u05dd \u05d4\u05d3\u05d5\u05d1\u05e8 \u05e9\u05dc\u05d4.2. \u05de\u05d7\u05de\u05d3 \u05e2'\u05d6\u05d0\u05d5\u05d9, \u05d0\u05d7\u05d3 \u05de\u05de\u05d9\u05d9\u05e1\u05d3\u05d9 \"\u05d2\u05d3\u05d5\u05d3 \u05d2'\u05e0\u05d9\u05df\" \u05d1\u05d6\u05e8\u05d5\u05e2 \u05d4\u05e6\u05d1\u05d0\u05d9\u05ea \u05e9\u05dc \u05d4\u05d2'\u05d4\u05d0\u05d3 \u05d4\u05d0\u05e1\u05dc\u05d0\u05de\u05d9.3. \u05d1\u05d0\u05e1\u05dc \u05e2'\u05d6\u05d0\u05d5\u05d9, \u05e4\u05e2\u05d9\u05dc \u05d1\u05d6\u05e8\u05d5\u05e2 \u05d4\u05e6\u05d1\u05d0\u05d9\u05ea \u05d4\u05d2'\u05d4\u05d0\u05d3 \u05d4\u05d0\u05e1\u05dc\u05d0\u05de\u05d9 \u05d1\u05d2'\u05e0\u05d9\u05df \u05d5\u05d0\u05d7\u05d9\u05d5 \u05e9\u05dc \u05de\u05d7\u05de\u05d3.\u05e2\"\u05e4 \u05d4\u05d5\u05d3\u05e2\u05ea \u05e6\u05d4\"\u05dc \u05d5\u05d4\u05e9\u05d1\"\u05db, \u05de\u05d7\u05de\u05d3 \u05d2'\u05dc\u05d0\u05de\u05e0\u05d4, \u05d9\u05e2\u05d3 \u05d4\u05e4\u05e2\u05d5\u05dc\u05d4, \u05e2\u05de\u05d3 \u05d1\u05e7\u05e9\u05e8 \u05e2\u05dd \u05d7\u05de\u05d0\u05e1 \u05d7\u05d5\"\u05dc\u05d1\u05de\u05d8\u05e8\u05d4 \u05dc\u05d4\u05d5\u05e6\u05d9\u05d0 \u05e4\u05d9\u05d2\u05d5\u05e2 \u05d1\u05d8\u05d5\u05d5\u05d7 \u05d4\u05d6\u05de\u05df \u05d4\u05de\u05d9\u05d9\u05d3\u05d9 \u05d1\u05d4\u05e9\u05e8\u05d0\u05ea \u05d0\u05d9\u05e8\u05d5\u05e2\u05d9 \u05d4\u05d8\u05d1\u05d7 \u05e9\u05dc \u05d4 7.10\u05e2\"\u05e4 \u05d4\u05d4\u05d5\u05d3\u05e2\u05d4 \u05d7\u05d5\u05e1\u05dc\u05d5 \u05e2\u05de\u05d5 \u05e2\u05d5\u05d3 \u05e9\u05e0\u05d9 \u05de\u05d7\u05d1\u05dc\u05d9 \u05d2'\u05d4\u05d0\u05d3 \u05d0\u05e1\u05dc\u05d0\u05de\u05d9, \u05d0\u05d7\u05d9\u05dd, \u05e9\u05d4\u05e1\u05ea\u05ea\u05e8\u05d5 \u05d1\u05d1\u05d9\u05ea \u05d4\u05d7\u05d5\u05dc\u05d9\u05dd.\u05d2\u05dd \u05db\u05d0\u05df \u05e0\u05d9\u05e6\u05dc\u05d5 \u05d4\u05de\u05d7\u05d1\u05dc\u05d9\u05dd \u05d0\u05ea \u05ea\u05e9\u05ea\u05d9\u05ea \u05d1\u05d9\u05ea \u05d4\u05d7\u05d5\u05dc\u05d9\u05dd \u05db\u05d3\u05d9 \u05db\u05d4\u05d2\u05e0\u05d4 \u05de\u05e4\u05e0\u05d9 \u05db\u05d5\u05d7\u05d5\u05ea \u05d4\u05d1\u05d9\u05d8\u05d7\u05d5\u05df \u05d4\u05d9\u05e9\u05e8\u05d0\u05dc\u05d9\u05dd.\u05e9\u05e8\u05ea \u05d4\u05d1\u05e8\u05d9\u05d0\u05d5\u05ea \u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05ea \u05e7\u05e8\u05d0\u05d4 \u05dc\u05de\u05d5\u05e1\u05d3\u05d5\u05ea \u05d4\u05d1\u05d9\u05e0\"\u05dc \u05dc\u05e1\u05e4\u05e7 \u05d4\u05d4\u05d2\u05e0\u05d4 \u05dc\u05de\u05d5\u05e1\u05d3\u05d5\u05ea \u05d4\u05e8\u05e4\u05d5\u05d0\u05d9\u05d9\u05dd \u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd \u05d1\u05e2\u05e7\u05d1\u05d5\u05ea \u05d4\u05d7\u05d9\u05e1\u05d5\u05dc \u05d1\u05e9\u05d8\u05d7 \u05d1\u05d9\u05ea \
