2:6, 4:6 \u05e2\u05dc \u05d9\u05dc\u05d4 \u05e1\u05dc\u05e1 \u05d4\u05d4\u05d5\u05dc\u05e0\u05d3\u05d9 (712 \u05d1\u05e2\u05d5\u05dc\u05dd) \u05d1\u05d2\u05de\u05e8@N12chat"],["\u05e2\u05e8\u05d5\u05e5 \u05d0\u05dc\u05de\u05d9\u05d0\u05d3\u05d9\u05df \u05d4\u05dc\u05d1\u05e0\u05d5\u05e0\u05d9: \"\u05db\u05d8\u05d1\"\u05de \u05d9\u05e9\u05e8\u05d0\u05dc\u05d9 \u05e8\u05d3\u05e3 \u05d0\u05d7\u05e8\u05d9 \u05e8\u05db\u05d1 \u05e9\u05d9\u05d3\u05d5\u05e8 \u05e9\u05dc\u05e0\u05d5 \u05d1\u05d3\u05e8\u05d5\u05dd \u05dc\u05d1\u05e0\u05d5\u05df\"",false,759,"\u05e2\u05e8\u05d5\u05e5 \u05d0\u05dc\u05de\u05d9\u05d0\u05d3\u05d9\u05df \u05d4\u05dc\u05d1\u05e0\u05d5\u05e0\u05d9: \"\u05db\u05d8\u05d1\"\u05de \u05d9\u05e9\u05e8\u05d0\u05dc\u05d9 \u05e8\u05d3\u05e3 \u05d0\u05d7\u05e8\u05d9 \u05e8\u05db\u05d1 \u05e9\u05d9\u05d3\u05d5\u05e8 \u05e9\u05dc\u05e0\u05d5 \u05d1\u05d3\u05e8\u05d5\u05dd \u05dc\u05d1\u05e0\u05d5\u05df\""],["\u05d0\u05d5\u05e8 \u05e8\u05d1\u05d9\u05d3\u05ea\u05d5\u05e9\u05d1 \u05d9\u05e4\u05d5 \u05d1\u05df 30 \u05e0\u05e2\u05e6\u05e8 \u05d1\u05d7\u05e9\u05d3 \u05dc\u05d4\u05d7\u05d6\u05e7\u05ea 2 \u05d0\u05e7\u05d3\u05d7\u05d9\u05dd \u05de\u05e1\u05d5\u05d2 \u05d2\u05dc\u05d5\u05e7 \u05d5\u05d0\u05e7\u05d3\u05d7 \u05d0\u05d7\u05d3 \u05de\u05e1\u05d5\u05d2 \u05d9\u05e8\u05d9\u05d7\u05d5. \u05d1\u05e0\u05d5\u05e1\u05e3 \u05dc\u05db\u05dc\u05d9 \u05d4\u05e0\u05e9\u05e7 \u05d0\u05d5\u05ea\u05e8\u05d5 \u05d1\u05de\u05d4\u05dc\u05da \u05d4\u05d7\u05d9\u05e4\u05d5\u05e9 \u05de\u05d7\u05e1\u05e0\u05d9\u05d5\u05ea \u05d5\u05db-30 \u05d0\u05dc\u05e3 \u05e9\u05e7\u05dc\u05d9\u05dd \u05d1\u05de\u05d6\u05d5\u05de\u05df. \u05e6\u05d9\u05dc\u05d5\u05dd: \u05d3\u05d5\u05d1\u05e8\u05d5\u05ea \u05d4\u05de\u05e9\u05d8\u05e8\u05d4@N12chat",false,760,"\u05d0\u05d5\u05e8 \u05e8\u05d1\u05d9\u05d3\u05ea\u05d5\u05e9\u05d1 \u05d9\u05e4\u05d5 \u05d1\u05df 30 \u05e0\u05e2\u05e6\u05e8 \u05d1\u05d7\u05e9\u05d3 \u05dc\u05d4\u05d7\u05d6\u05e7\u05ea 2 \u05d0\u05e7\u05d3\u05d7\u05d9\u05dd \u05de\u05e1\u05d5\u05d2 \u05d2\u05dc\u05d5\u05e7 \u05d5\u05d0\u05e7\u05d3\u05d7 \u05d0\u05d7\u05d3 \u05de\u05e1\u05d5\u05d2 \u05d9\u05e8\u05d9\u05d7\u05d5. \u05d1\u05e0\u05d5\u05e1\u05e3 \u05dc\u05db\u05dc\u05d9 \u05d4\u05e0\u05e9\u05e7 \u05d0\u05d5\u05ea\u05e8\u05d5 \u05d1\u05de\u05d4\u05dc\u05da \u05d4\u05d7\u05d9\u05e4\u05d5\u05e9 \u05de\u05d7\u05e1\u05e0\u05d9\u05d5\u05ea \u05d5\u05db-30 \u05d0\u05dc\u05e3 \u05e9\u05e7\u05dc\u05d9\u05dd \u05d1\u05de\u05d6\u05d5\u05de\u05df. \u05e6\u05d9\u05dc\u05d5\u05dd: \u05d3\u05d5\u05d1\u05e8\u05d5\u05ea \u05d4\u05de\u05e9\u05d8\u05e8\u05d4@N12chat"],["\u05e1\u05e4\u05d9\u05e8 \u05dc\u05d9\u05e4\u05e7\u05d9\u05df\u05d3\u05d5\u05d1\u05e8 \u05de\u05e9\u05e8\u05d3 \u05d4\u05d7\u05d5\u05e5 \u05d4\u05e7\u05d8\u05d0\u05e8\u05d9: \"\u05d4\u05e9\u05d9\u05d7\u05d5\u05ea \u05e9\u05de\u05e7\u05d9\u05d9\u05de\u05d5\u05ea \u05e7\u05d8\u05d0\u05e8 \u05d5\u05de\u05e6\u05e8\u05d9\u05dd \u05e2\u05dc \u05e4\u05e8\u05d8\u05d9 \u05d4\u05ea\u05d5\u05db\u05e0\u05d9\u05ea \u05dc\u05d9\u05d9\u05e9\u05d5\u05dd \u05d4\u05e4\u05e1\u05e7\u05ea \u05d4\u05d0\u05e9-\u05d4\u05d4\u05d5\u05de\u05e0\u05d9\u05d8\u05e8\u05d9\u05ea \u05d1\u05e2\u05d6\u05d4, \u05d1\u05d9\u05df \u05d9\u05e9\u05e8\u05d0\u05dc \u05dc\u05d7\u05de\u05d0\u05e1 - \u05e0\u05de\u05e9\u05db\u05d5\u05ea \u05d5\u05de\u05ea\u05e7\u05d3\u05de\u05d5\u05ea \u05d1\u05d0\u05d5\u05e4\u05df \u05d7\u05d9\u05d5\u05d1\u05d9\". \u05d4\u05d5\u05d0 \u05de\u05e1\u05e8 \u05db\u05d9 \u05d4\u05de\u05d5\u05e2\u05d3 \u05e2\u05dc \u05ea\u05d7\u05d9\u05dc\u05ea \u05d4\u05e4\u05e1\u05e7\u05ea \u05d4\u05d0\u05e9 \u05d9\u05d4\u05d9\u05d4 \u05d1\u05e9\u05e2\u05d5\u05ea \u05d4\u05e7\u05e8\u05d5\u05d1\u05d5\u05ea@N12chat",false,761,"\u05e1\u05e4\u05d9\u05e8 \u05dc\u05d9\u05e4\u05e7\u05d9\u05df\u05d3\u05d5\u05d1\u05e8 \u05de\u05e9\u05e8\u05d3 \u05d4\u05d7\u05d5\u05e5 \u05d4\u05e7\u05d8\u05d0\u05e8\u05d9: \"\u05d4\u05e9\u05d9\u05d7\u05d5\u05ea \u05e9\u05de\u05e7\u05d9\u05d9\u05de\u05d5\u05ea \u05e7\u05d8\u05d0\u05e8 \u05d5\u05de\u05e6\u05e8\u05d9\u05dd \u05e2\u05dc \u05e4\u05e8\u05d8\u05d9 \u05d4\u05ea\u05d5\u05db\u05e0\u05d9\u05ea \u05dc\u05d9\u05d9\u05e9\u05d5\u05dd \u05d4\u05e4\u05e1\u05e7\u05ea \u05d4\u05d0\u05e9-\u05d4\u05d4\u05d5\u05de\u05e0\u05d9\u05d8\u05e8\u05d9\u05ea \u05d1\u05e2\u05d6\u05d4, \u05d1\u05d9\u05df \u05d9\u05e9\u05e8\u05d0\u05dc \u05dc\u05d7\u05de\u05d0\u05e1 - \u05e0\u05de\u05e9\u05db\u05d5\u05ea \u05d5\u05de\u05ea\u05e7\u05d3\u05de\u05d5\u05ea \u05d1\u05d0\u05d5\u05e4\u05df \u05d7\u05d9\u05d5\u05d1\u05d9\". \u05d4\u05d5\u05d0 \u05de\u05e1\u05e8 \u05db\u05d9 \u05d4\u05de\u05d5\u05e2\u05d3 \u05e2\u05dc \u05ea\u05d7\u05d9\u05dc\u05ea \u05d4\u05e4\u05e1\u05e7\u05ea \u05d4\u05d0\u05e9 \u05d9\u05d4\u05d9\u05d4 \u05d1\u05e9\u05e2\u05d5\u05ea \u05d4\u05e7\u05e8\u05d5\u05d1\u05d5\u05ea@N12chat"],["\u05de\u05d1\u05d6\u05e7\u05df 12\u05d1\u05e9\u05d5\u05e8\u05d5\u05ea \u05de\u05e8\u05d2\u05e9\u05d5\u05ea \u05de\u05e1\u05d5\u05e8\u05d5\u05e7\u05d4: \u05e9\u05d9\u05e4\u05d5\u05e8 \u05d1\u05de\u05e6\u05d1\u05d4 \u05e9\u05dc \u05d0\u05dc\u05de\u05d4 \u05d0\u05d1\u05e8\u05d4\u05dd \u05d1\u05ea \u05d4-84 \u05e9\u05e9\u05d5\u05d7\u05e8\u05e8\u05d4 \u05de\u05e9\u05d1\u05d9 \u05d4\u05d7\u05de\u05d0\u05e1 \u05d1\u05de\u05e6\u05d1 \u05e7\u05e9\u05d4. \u05de\u05e0\u05d4\u05dc \u05d4\u05de\u05d7\u05dc\u05e7\u05d4 \u05dc\u05d8\u05d9\u05e4\u05d5\u05dc \u05e0\u05de\u05e8\u05e5 \u05db\u05dc\u05dc\u05d9 \u05d1\u05e1\u05d5\u05e8\u05d5\u05e7\u05d4, \u05e4\u05e8\u05d5\u05e4' \u05de\u05d5\u05d8\u05d9 \u05e7\u05dc\u05d9\u05d9\u05df: \"\u05d1\u05e9\u05e2\u05d5\u05ea \u05d4\u05d0\u05d7\u05e8\u05d5\u05e0\u05d5\u05ea \u05d7\u05dc \u05e9\u05d9\u05e4\u05d5\u05e8 \u05d1\u05de\u05e6\u05d1\u05d4. \u05d4\u05d9\u05d0 \u05d1\u05d4\u05db\u05e8\u05d4, \u05d4\u05d9\u05d0 \u05e0\u05d5\u05e9\u05de\u05ea \u05d1\u05db\u05d5\u05d7\u05d5\u05ea \u05e2\u05e6\u05de\u05d4 \u05d5\u05d0\u05d9\u05e0\u05d4 \u05e0\u05d6\u05e7\u05e7\u05ea \u05dc\u05d0\u05d5\u05ea\u05d4 \u05e8\u05de\u05ea \u05ea\u05de\u05d9\u05db\u05d4 \u05e9\u05dc\u05d4 \u05d4\u05d9\u05d0 \u05e0\u05d6\u05e7\u05e7\u05d4 \u05e2\u05dd \u05d4\u05d2\u05e2\u05ea\u05d4\"@N12chat",false,762,"\u05de\u05d1\u05d6\u05e7\u05df 12\u05d1\u05e9\u05d5\u05e8\u05d5\u05ea \u05de\u05e8\u05d2\u05e9\u05d5\u05ea \u05de\u05e1\u05d5\u05e8\u05d5\u05e7\u05d4: \u05e9\u05d9\u05e4\u05d5\u05e8 \u05d1\u05de\u05e6\u05d1\u05d4 \u05e9\u05dc \u05d0\u05dc\u05de\u05d4 \u05d0\u05d1\u05e8\u05d4\u05dd \u05d1\u05ea \u05d4-84 \u05e9\u05e9\u05d5\u05d7\u05e8\u05e8\u05d4 \u05de\u05e9\u05d1\u05d9 \u05d4\u05d7\u05de\u05d0\u05e1 \u05d1\u05de\u05e6\u05d1 \u05e7\u05e9\u05d4. \u05de\u05e0\u05d4\u05dc \u05d4\u05de\u05d7\u05dc\u05e7\u05d4 \u05dc\u05d8\u05d9\u05e4\u05d5\u05dc \u05e0\u05de\u05e8\u05e5 \u05db\u05dc\u05dc\u05d9 \u05d1\u05e1\u05d5\u05e8\u05d5\u05e7\u05d4, \u05e4\u05e8\u05d5\u05e4' \u05de\u05d5\u05d8\u05d9 \u05e7\u05dc\u05d9\u05d9\u05df: \"\u05d1\u05e9\u05e2\u05d5\u05ea \u05d4\u05d0\u05d7\u05e8\u05d5\u05e0\u05d5\u05ea \u05d7\u05dc \u05e9\u05d9\u05e4\u05d5\u05e8 \u05d1\u05de\u05e6\u05d1\u05d4. \u05d4\u05d9\u05d0 \u05d1\u05d4\u05db\u05e8\u05d4, \u05d4\u05d9\u05d0 \u05e0\u05d5\u05e9\u05de\u05ea \u05d1\u05db\u05d5\u05d7\u05d5\u05ea \u05e2\u05e6\u05de\u05d4 \u05d5\u05d0\u05d9\u05e0\u05d4 \u05e0\u05d6\u05e7\u05e7\u05ea \u05dc\u05d0\u05d5\u05ea\u05d4 \u05e8\u05de\u05ea \u05ea\u05de\u05d9\u05db\u05d4 \u05e9\u05dc\u05d4 \u05d4\u05d9\u05d0 \u05e0\u05d6\u05e7\u05e7\u05d4 \u05e2\u05dd \u05d4\u05d2\u05e2\u05ea\u05d4\"@N12chat"],["\u05e2\u05e8\u05d5\u05e6\u05d9\u05dd \u05dc\u05d1\u05e0\u05d5\u05e0\u05d9\u05d9\u05dd \u05de\u05d3\u05d5\u05d5\u05d7\u05d9\u05dd \u05e2\u05dc 3 \u05d4\u05e8\u05d5\u05d2\u05d9\u05dd \u05d5 9 \u05e4\u05e6\u05d5\u05e2\u05d9\u05dd \u05de\u05e7\u05e8\u05d1 \u05d7\u05d9\u05d9\u05dc\u05d9 \u05e6\u05d1\u05d0 \u05dc\u05d1\u05e0\u05d5\u05df \u05d1\u05ea\u05e7\u05d9\u05e4\u05d4 \u05d9\u05e9\u05e8\u05d0\u05dc\u05d9\u05ea \u05e2\u05dc \u05d4\u05e0\u05de\u05dc \u05d1\u05e6\u05e8\u05e4\u05e0\u05d3.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df\t\u05e2\u05e8\u05d5\u05e6\u05d9\u05dd \u05dc\u05d1\u05e0\u05d5\u05e0\u05d9\u05d9\u05dd \u05de\u05d3\u05d5\u05d5\u05d7\u05d9\u05dd \u05e2\u05dc 3 \u05d4\u05e8\u05d5\u05d2\u05d9\u05dd \u05d5 9 \u05e4\u05e6\u05d5\u05e2\u05d9\u05dd \u05de\u05e7\u05e8\u05d1 \u05d7\u05d9\u05d9\u05dc\u05d9 \u05e6\u05d1\u05d0 \u05dc\u05d1\u05e0\u05d5\u05df \u05d1\u05ea\u05e7\u05d9\u05e4\u05d4 \u05d9\u05e9\u05e8\u05d0\u05dc\u05d9\u05ea \u05e2\u05dc \u05d4\u05e0\u05de\u05dc \u05d1\u05e6\u05e8\u05e4\u05e0\u05d3.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,763,"\u05e2\u05e8\u05d5\u05e6\u05d9\u05dd \u05dc\u05d1\u05e0\u05d5\u05e0\u05d9\u05d9\u05dd \u05de\u05d3\u05d5\u05d5\u05d7\u05d9\u05dd \u05e2\u05dc 3 \u05d4\u05e8\u05d5\u05d2\u05d9\u05dd \u05d5 9 \u05e4\u05e6\u05d5\u05e2\u05d9\u05dd \u05de\u05e7\u05e8\u05d1 \u05d7\u05d9\u05d9\u05dc\u05d9 \u05e6\u05d1\u05d0 \u05dc\u05d1\u05e0\u05d5\u05df \u05d1\u05ea\u05e7\u05d9\u05e4\u05d4 \u05d9\u05e9\u05e8\u05d0\u05dc\u05d9\u05ea \u05e2\u05dc \u05d4\u05e0\u05de\u05dc \u05d1\u05e6\u05e8\u05e4\u05e0\u05d3.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df\t\u05e2\u05e8\u05d5\u05e6\u05d9\u05dd \u05dc\u05d1\u05e0\u05d5\u05e0\u05d9\u05d9\u05dd \u05de\u05d3\u05d5\u05d5\u05d7\u05d9\u05dd \u05e2\u05dc 3 \u05d4\u05e8\u05d5\u05d2\u05d9\u05dd \u05d5 9 \u05e4\u05e6\u05d5\u05e2\u05d9\u05dd \u05de\u05e7\u05e8\u05d1 \u05d7\u05d9\u05d9\u05dc\u05d9 \u05e6\u05d1\u05d0 \u05dc\u05d1\u05e0\u05d5\u05df \u05d1\u05ea\u05e7\u05d9\u05e4\u05d4 \u05d9\u05e9\u05e8\u05d0\u05dc\u05d9\u05ea \u05e2\u05dc \u05d4\u05e0\u05de\u05dc \u05d1\u05e6\u05e8\u05e4\u05e0\u05d3.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05e7\u05e6\u05ea \u05d0\u05e1\u05e7\u05e4\u05d9\u05d6\u05dd: \u05e6\u05d5\u05dc\u05dd \u05d4\u05d9\u05d5\u05dd \u05d1\u05d0\u05de\u05dc\u05e4\u05d9, \u05d0\u05d9\u05d8\u05dc\u05d9\u05d4\u05e7\u05e8\u05d3\u05d9\u05d8: \u05e4\u05d9\u05dc\u05d9\u05e4\u05d5 \u05d0\u05de\u05d8\u05d5.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,764,"\u05e7\u05e6\u05ea \u05d0\u05e1\u05e7\u05e4\u05d9\u05d6\u05dd: \u05e6\u05d5\u05dc\u05dd \u05d4\u05d9\u05d5\u05dd \u05d1\u05d0\u05de\u05dc\u05e4\u05d9, \u05d0\u05d9\u05d8\u05dc\u05d9\u05d4\u05e7\u05e8\u05d3\u05d9\u05d8: \u05e4\u05d9\u05dc\u05d9\u05e4\u05d5 \u05d0\u05de\u05d8\u05d5.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05d9\u05e8\u05d5\u05df \u05d0\u05d1\u05e8\u05d4\u05dd\u05e8\u05d0\u05e9 \u05d4\u05de\u05de\u05e9\u05dc\u05d4 \u05e0\u05ea\u05e0\u05d9\u05d4\u05d5 \u05e0\u05e4\u05d2\u05e9 \u05d4\u05d9\u05d5\u05dd \u05e2\u05dd 32 \u05de\u05e9\u05e4\u05d7\u05d5\u05ea \u05d7\u05d8\u05d5\u05e4\u05d9\u05dd. \u05d4\u05d5\u05d0 \u05d0\u05de\u05e8 \u05dc\u05d4\u05dd: \"\u05d9\u05e9 \u05de\u05d2\u05e2\u05d9\u05dd \u05dc\u05e2\u05e1\u05e7\u05d4, \u05dc\u05d0 \u05d1\u05e8\u05d5\u05e8 \u05de\u05d4 \u05d9\u05d4\u05d9\u05d5 \u05d4\u05e9\u05dc\u05d1\u05d9\u05dd \u05e9\u05dc\u05d4 \u05d0\u05dd \u05d4\u05d9\u05d0 \u05ea\u05e6\u05d0 \u05dc\u05e4\u05d5\u05e2\u05dc\". \u05e0\u05ea\u05e0\u05d9\u05d4\u05d5 \u05d4\u05e1\u05d1\u05d9\u05e8 \u05dc\u05de\u05e9\u05e4\u05d7\u05d5\u05ea \u05e9\u05d4\u05dc\u05d7\u05e5 \u05d4\u05e6\u05d1\u05d0\u05d9 \u05e2\u05dc \u05d7\u05de\u05d0\u05e1 \u05e2\u05d5\u05d1\u05d3, \u05d5\u05d4\u05d5\u05d0 \u05d4\u05d5\u05d3\u05d4 \u05e9\u05d4\u05d5\u05d0 \u05dc\u05d0 \u05de\u05db\u05d9\u05e8 \u05d0\u05ea \u05de\u05dc\u05d5\u05d0 \u05d4\u05e4\u05e8\u05d8\u05d9\u05dd \u05e2\u05dc \u05db\u05dc \u05d7\u05d8\u05d5\u05e3 \u05d5\u05d7\u05d8\u05d5\u05e3. \u05dc\u05de\u05e9\u05dc, \u05d4\u05d5\u05d0 \u05dc\u05d0 \u05d9\u05d3\u05e2 \u05e9\u05d9\u05e9 \u05d7\u05d8\u05d5\u05e3 \u05d1\u05e2\u05dc \u05d0\u05d6\u05e8\u05d7\u05d5\u05ea \u05d4\u05d5\u05e0\u05d2\u05e8\u05d9\u05ea@N12chat",false,765,"\u05d9\u05e8\u05d5\u05df \u05d0\u05d1\u05e8\u05d4\u05dd\u05e8\u05d0\u05e9 \u05d4\u05de\u05de\u05e9\u05dc\u05d4 \u05e0\u05ea\u05e0\u05d9\u05d4\u05d5 \u05e0\u05e4\u05d2\u05e9 \u05d4\u05d9\u05d5\u05dd \u05e2\u05dd 32 \u05de\u05e9\u05e4\u05d7\u05d5\u05ea \u05d7\u05d8\u05d5\u05e4\u05d9\u05dd. \u05d4\u05d5\u05d0 \u05d0\u05de\u05e8 \u05dc\u05d4\u05dd: \"\u05d9\u05e9 \u05de\u05d2\u05e2\u05d9\u05dd \u05dc\u05e2\u05e1\u05e7\u05d4, \u05dc\u05d0 \u05d1\u05e8\u05d5\u05e8 \u05de\u05d4 \u05d9\u05d4\u05d9\u05d5 \u05d4\u05e9\u05dc\u05d1\u05d9\u05dd \u05e9\u05dc\u05d4 \u05d0\u05dd \u05d4\u05d9\u05d0 \u05ea\u05e6\u05d0 \u05dc\u05e4\u05d5\u05e2\u05dc\". \u05e0\u05ea\u05e0\u05d9\u05d4\u05d5 \u05d4\u05e1\u05d1\u05d9\u05e8 \u05dc\u05de\u05e9\u05e4\u05d7\u05d5\u05ea \u05e9\u05d4\u05dc\u05d7\u05e5 \u05d4\u05e6\u05d1\u05d0\u05d9 \u05e2\u05dc \u05d7\u05de\u05d0\u05e1 \u05e2\u05d5\u05d1\u05d3, \u05d5\u05d4\u05d5\u05d0 \u05d4\u05d5\u05d3\u05d4 \u05e9\u05d4\u05d5\u05d0 \u05dc\u05d0 \u05de\u05db\u05d9\u05e8 \u05d0\u05ea \u05de\u05dc\u05d5\u05d0 \u05d4\u05e4\u05e8\u05d8\u05d9\u05dd \u05e2\u05dc \u05db\u05dc \u05d7\u05d8\u05d5\u05e3 \u05d5\u05d7\u05d8\u05d5\u05e3. \u05dc\u05de\u05e9\u05dc, \u05d4\u05d5\u05d0 \u05dc\u05d0 \u05d9\u05d3\u05e2 \u05e9\u05d9\u05e9 \u05d7\u05d8\u05d5\u05e3 \u05d1\u05e2\u05dc \u05d0\u05d6\u05e8\u05d7\u05d5\u05ea \u05d4\u05d5\u05e0\u05d2\u05e8\u05d9\u05ea@N12chat"],["\u05de\u05d1\u05d6\u05e7\u05df 12\u05d1\u05d9\u05ea \u05d4\u05de\u05e9\u05e4\u05d8 \u05d4\u05e8\u05e9\u05d9\u05e2 \u05d0\u05ea \u05d0\u05d9\u05dc\u05e0\u05d4 \u05e1\u05d5\u05d9\u05e1\u05d4 \u05de\u05e9\u05d3\u05e8\u05d5\u05ea, \u05e2\u05dc \u05e4\u05d9 \u05d4\u05d5\u05d3\u05d0\u05ea\u05d4, \u05d1\u05e8\u05d9\u05d1\u05d5\u05d9 \u05e2\u05d1\u05d9\u05e8\u05d5\u05ea \u05e9\u05dc \u05d4\u05ea\u05e2\u05dc\u05dc\u05d5\u05ea \u05d5\u05ea\u05e7\u05d9\u05e4\u05ea \u05ea\u05d9\u05e0\u05d5\u05e7\u05d5\u05ea \u05e9\u05e2\u05dc\u05d9\u05d4\u05dd \u05d4\u05d9\u05d9\u05ea\u05d4 \u05d0\u05d7\u05e8\u05d0\u05d9\u05ea \u05d1\u05de\u05e1\u05d2\u05e8\u05ea \u05e2\u05d1\u05d5\u05d3\u05ea\u05d4 \u05db\u05d2\u05e0\u05e0\u05ea \u05d1\u05ea\u05d9\u05e0\u05d5\u05e7\u05d9\u05d4@N12chat",false,766,"\u05de\u05d1\u05d6\u05e7\u05df 12\u05d1\u05d9\u05ea \u05d4\u05de\u05e9\u05e4\u05d8 \u05d4\u05e8\u05e9\u05d9\u05e2 \u05d0\u05ea \u05d0\u05d9\u05dc\u05e0\u05d4 \u05e1\u05d5\u05d9\u05e1\u05d4 \u05de\u05e9\u05d3\u05e8\u05d5\u05ea, \u05e2\u05dc \u05e4\u05d9 \u05d4\u05d5\u05d3\u05d0\u05ea\u05d4, \u05d1\u05e8\u05d9\u05d1\u05d5\u05d9 \u05e2\u05d1\u05d9\u05e8\u05d5\u05ea \u05e9\u05dc \u05d4\u05ea\u05e2\u05dc\u05dc\u05d5\u05ea \u05d5\u05ea\u05e7\u05d9\u05e4\u05ea \u05ea\u05d9\u05e0\u05d5\u05e7\u05d5\u05ea \u05e9\u05e2\u05dc\u05d9\u05d4\u05dd \u05d4\u05d9\u05d9\u05ea\u05d4 \u05d0\u05d7\u05e8\u05d0\u05d9\u05ea \u05d1\u05de\u05e1\u05d2\u05e8\u05ea \u05e2\u05d1\u05d5\u05d3\u05ea\u05d4 \u05db\u05d2\u05e0\u05e0\u05ea \u05d1\u05ea\u05d9\u05e0\u05d5\u05e7\u05d9\u05d4@N12chat"],["\u05d3\u05e1\u05e7 \u05d4\u05d7\u05d5\u05e5\u05d3\u05d9\u05d5\u05d5\u05d7 \u05d1\"\u05d5\u05d5\u05dc \u05e1\u05d8\u05e8\u05d9\u05d8 \u05d2'\u05d5\u05e8\u05e0\u05dc\": \u05d9\u05e9\u05e8\u05d0\u05dc \u05d1\u05e0\u05ea\u05d4 \u05de\u05e2\u05e8\u05db\u05ea \u05e9\u05dc \u05de\u05e9\u05d0\u05d1\u05d5\u05ea \u05e2\u05e0\u05e7 \u05e9\u05d1\u05d4 \u05d4\u05d9\u05d0 \u05ea\u05d5\u05db\u05dc \u05dc\u05d4\u05e9\u05ea\u05de\u05e9 \u05db\u05d3\u05d9 \u05dc\u05d4\u05e6\u05d9\u05e3 \u05d0\u05ea \u05e8\u05e9\u05ea \u05d4\u05de\u05e0\u05d4\u05e8\u05d5\u05ea \u05e9\u05dc \u05d7\u05de\u05d0\u05e1 \u05de\u05ea\u05d7\u05ea \u05dc\u05e7\u05e8\u05e7\u05e2 \u05d1\u05e8\u05e6\u05d5\u05e2\u05ea \u05e2\u05d6\u05d4 \u05d1\u05de\u05d9 \u05d9\u05dd@N12chat",false,767,"\u05d3\u05e1\u05e7 \u05d4\u05d7\u05d5\u05e5\u05d3\u05d9\u05d5\u05d5\u05d7 \u05d1\"\u05d5\u05d5\u05dc \u05e1\u05d8\u05e8\u05d9\u05d8 \u05d2'\u05d5\u05e8\u05e0\u05dc\": \u05d9\u05e9\u05e8\u05d0\u05dc \u05d1\u05e0\u05ea\u05d4 \u05de\u05e2\u05e8\u05db\u05ea \u05e9\u05dc \u05de\u05e9\u05d0\u05d1\u05d5\u05ea \u05e2\u05e0\u05e7 \u05e9\u05d1\u05d4 \u05d4\u05d9\u05d0 \u05ea\u05d5\u05db\u05dc \u05dc\u05d4\u05e9\u05ea\u05de\u05e9 \u05db\u05d3\u05d9 \u05dc\u05d4\u05e6\u05d9\u05e3 \u05d0\u05ea \u05e8\u05e9\u05ea \u05d4\u05de\u05e0\u05d4\u05e8\u05d5\u05ea \u05e9\u05dc \u05d7\u05de\u05d0\u05e1 \u05de\u05ea\u05d7\u05ea \u05dc\u05e7\u05e8\u05e7\u05e2 \u05d1\u05e8\u05e6\u05d5\u05e2\u05ea \u05e2\u05d6\u05d4 \u05d1\u05de\u05d9 \u05d9\u05dd@N12chat"],["\u05d0\u05d5\u05e8 \u05e8\u05d1\u05d9\u05d3\u05e8\u05d0\u05e9 \u05e2\u05d9\u05e8\u05d9\u05d9\u05ea \u05e8\u05d0\u05e9\u05d5\u05df \u05dc\u05e6\u05d9\u05d5\u05df \u05d1\u05e7\u05dc\u05e4\u05d9: \"\u05d0\u05e0\u05d9 \u05e7\u05d5\u05e8\u05d0 \u05dc\u05ea\u05d5\u05e9\u05d1\u05d5\u05ea \u05d5\u05ea\u05d5\u05e9\u05d1\u05d9 \u05d4\u05e2\u05d9\u05e8 \u05dc\u05e6\u05d0\u05ea \u05d5\u05dc\u05d4\u05e6\u05d1\u05d9\u05e2 \u05db\u05d3\u05d9 \u05e9\u05d0\u05de\u05e9\u05d9\u05da \u05dc\u05e0\u05d4\u05dc \u05d0\u05ea \u05d4\u05e2\u05d9\u05e8 \u05d4\u05d6\u05d5 \u05d1\u05d9\u05d5\u05e9\u05e8\u05d4 \u05d5\u05d0\u05d4\u05d1\u05d4, \u05d1\u05e9\u05d2\u05e8\u05d4 \u05d5\u05d7\u05d9\u05e8\u05d5\u05dd\"@N12chat",false,768,"\u05d0\u05d5\u05e8 \u05e8\u05d1\u05d9\u05d3\u05e8\u05d0\u05e9 \u05e2\u05d9\u05e8\u05d9\u05d9\u05ea \u05e8\u05d0\u05e9\u05d5\u05df \u05dc\u05e6\u05d9\u05d5\u05df \u05d1\u05e7\u05dc\u05e4\u05d9: \"\u05d0\u05e0\u05d9 \u05e7\u05d5\u05e8\u05d0 \u05dc\u05ea\u05d5\u05e9\u05d1\u05d5\u05ea \u05d5\u05ea\u05d5\u05e9\u05d1\u05d9 \u05d4\u05e2\u05d9\u05e8 \u05dc\u05e6\u05d0\u05ea \u05d5\u05dc\u05d4\u05e6\u05d1\u05d9\u05e2 \u05db\u05d3\u05d9 \u05e9\u05d0\u05de\u05e9\u05d9\u05da \u05dc\u05e0\u05d4\u05dc \u05d0\u05ea \u05d4\u05e2\u05d9\u05e8 \u05d4\u05d6\u05d5 \u05d1\u05d9\u05d5\u05e9\u05e8\u05d4 \u05d5\u05d0\u05d4\u05d1\u05d4, \u05d1\u05e9\u05d2\u05e8\u05d4 \u05d5\u05d7\u05d9\u05e8\u05d5\u05dd\"@N12chat"],["\u05de\u05d4\u05e9\u05e2\u05d4 05d9\u05dc\u05d4 \u05e9\u05dc\u05e4\u05e0\u05d9 \u05d4\u05de\u05ea\u05e7\u05e4\u05d4: \u05d1\u05d9\u05e9\u05e8\u05d0\u05dc \u05d6\u05d9\u05d4\u05d5 \u05de\u05d0\u05d5\u05ea \u05d8\u05dc\u05e4\u05d5\u05e0\u05d9\u05dd \u05e2\u05dd \u05e1\u05d9\u05dd \u05d9\u05e9\u05e8\u05d0\u05dc\u05d9 \u05e9\u05d4\u05d5\u05e4\u05e2\u05dc\u05d5 \u05d1\u05e8\u05e6\u05d5\u05e2\u05d4@N12chat",false,782,"\u05e0\u05d9\u05e8 \u05d3\u05d1\u05d5\u05e8\u05d9\u05d1\u05dc\u05d9\u05dc\u05d4 \u05e9\u05dc\u05e4\u05e0\u05d9 \u05d4\u05de\u05ea\u05e7\u05e4\u05d4: \u05d1\u05d9\u05e9\u05e8\u05d0\u05dc \u05d6\u05d9\u05d4\u05d5 \u05de\u05d0\u05d5\u05ea \u05d8\u05dc\u05e4\u05d5\u05e0\u05d9\u05dd \u05e2\u05dd \u05e1\u05d9\u05dd \u05d9\u05e9\u05e8\u05d0\u05dc\u05d9 \u05e9\u05d4\u05d5\u05e4\u05e2\u05dc\u05d5 \u05d1\u05e8\u05e6\u05d5\u05e2\u05d4@N12chat"],["\u05e2\u05e8\u05d5\u05e6\u05d9\u05dd \u05dc\u05d1\u05e0\u05d5\u05e0\u05d9\u05d9\u05dd: \u05ea\u05e7\u05d9\u05e4\u05d4 \u05d0\u05d5\u05d5\u05d9\u05e8\u05d9\u05ea \u05e9\u05dc \u05e6\u05d4\"\u05dc \u05db\u05e2\u05ea \u05d1\u05db\u05e4\u05e8 \u05d7\u05d0\u05e0\u05d9\u05df (\u05de\u05e2\u05d8 \u05e6\u05e4\u05d5\u05e0\u05d9\u05ea \u05dc\u05e8\u05de\u05d9\u05e9) \u05d1\u05d3\u05e8\u05d5\u05dd \u05dc\u05d1\u05e0\u05d5\u05df.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,783,"\u05e2\u05e8\u05d5\u05e6\u05d9\u05dd \u05dc\u05d1\u05e0\u05d5\u05e0\u05d9\u05d9\u05dd: \u05ea\u05e7\u05d9\u05e4\u05d4 \u05d0\u05d5\u05d5\u05d9\u05e8\u05d9\u05ea \u05e9\u05dc \u05e6\u05d4\"\u05dc \u05db\u05e2\u05ea \u05d1\u05db\u05e4\u05e8 \u05d7\u05d0\u05e0\u05d9\u05df (\u05de\u05e2\u05d8 \u05e6\u05e4\u05d5\u05e0\u05d9\u05ea \u05dc\u05e8\u05de\u05d9\u05e9) \u05d1\u05d3\u05e8\u05d5\u05dd \u05dc\u05d1\u05e0\u05d5\u05df.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05d0\u05dc\u05d2'\u05d6\u05d9\u05e8\u05d4, \u05de\u05e4\u05d9 \u0 c\u05d4\u05ea\u05de\u05e7\u05d3 \u05d1\u05e1\u05d9\u05d5\u05e2 \u05dc\u05e0\u05e9\u05d9\u05d0 \u05d1\u05d9\u05d9\u05d3\u05df \u05d1\u05e7\u05de\u05e4\u05d9\u05d9\u05df \u05d4\u05d1\u05d7\u05d9\u05e8\u05d5\u05ea - \u05db\u05da \u05e2\"\u05e4 \u05d3\u05d9\u05d5\u05d5\u05d7 \u05d1\u05d0\u05ea\u05e8 axios@N12chat",false,806,"\u05d8\u05dc \u05e9\u05d2\u05d9\u05d0\u05d2'\u05d5\u05df \u05e7\u05e8\u05d9, \u05d4\u05e9\u05dc\u05d9\u05d7 \u05d4\u05e0\u05e9\u05d9\u05d0\u05d5\u05ea\u05d9 \u05d4\u05de\u05d9\u05d5\u05d7\u05d3 \u05dc\u05e2\u05e0\u05d9\u05d9\u05e0\u05d9 \u05d0\u05e7\u05dc\u05d9\u05dd, \u05e2\u05d5\u05de\u05d3 \u05dc\u05e2\u05d6\u05d5\u05d1 \u05d0\u05ea \u05ea\u05e4\u05e7\u05d9\u05d3\u05d5 \u05d1\u05e7\u05e8\u05d5\u05d1 \u05d5\u05dc\u05d4\u05ea\u05de\u05e7\u05d3 \u05d1\u05e1\u05d9\u05d5\u05e2 \u05dc\u05e0\u05e9\u05d9\u05d0 \u05d1\u05d9\u05d9\u05d3\u05df \u05d1\u05e7\u05de\u05e4\u05d9\u05d9\u05df \u05d4\u05d1\u05d7\u05d9\u05e8\u05d5\u05ea - \u05db\u05da \u05e2\"\u05e4 \u05d3\u05d9\u05d5\u05d5\u05d7 \u05d1\u05d0\u05ea\u05e8 axios@N12chat"],["\u05d4\u05de\u05e0\u05d4\u05d9\u05d2 \u05d4\u05e2\u05dc\u05d9\u05d5\u05df \u05e9\u05dc \u05d0\u05d9\u05e8\u05d0\u05df \u05d4\u05d2\u05d9\u05e2 \u05d4\u05d9\u05d5\u05dd, \u05d1\u05dc\u05d5\u05d5\u05d9\u05ea \u05de\u05e4\u05e7\u05d3 \u05d7\u05d9\u05dc \u05d4\u05d0\u05d5\u05d5\u05d9\u05e8 \u05d5\u05d4\u05d7\u05dc\u05dc \u05e9\u05dc \u05de\u05e9\u05de\u05e8\u05d5\u05ea \u05d4\u05de\u05d4\u05e4\u05db\u05d4 \u05d4\u05d0\u05d9\u05e8\u05d0\u05e0\u05d9\u05dd, \u05db\u05d3\u05d9 \u05dc\u05dc\u05d8\u05e3 \u05d0\u05ea \"\u05d4\u05d8\u05d9\u05dc \u05d4\u05d4\u05d9\u05e4\u05e8\u05e1\u05d5\u05e0\u05d9 \u05d4\u05d0\u05d9\u05e8\u05d0\u05e0\u05d9\"(\u05db\u05da \u05dc\u05e4\u05d7\u05d5\u05ea \u05d4\u05d0\u05d9\u05e8\u05d0\u05e0\u05d9\u05dd \u05d8\u05d5\u05e2\u05e0\u05d9\u05dd) \u05e9\u05e0\u05e7\u05e8\u05d0 \"\u05e4\u05ea\u05d0\u05d7 2\" .\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,807,"\u05d4\u05de\u05e0\u05d4\u05d9\u05d2 \u05d4\u05e2\u05dc\u05d9\u05d5\u05df \u05e9\u05dc \u05d0\u05d9\u05e8\u05d0\u05df \u05d4\u05d2\u05d9\u05e2 \u05d4\u05d9\u05d5\u05dd, \u05d1\u05dc\u05d5\u05d5\u05d9\u05ea \u05de\u05e4\u05e7\u05d3 \u05d7\u05d9\u05dc \u05d4\u05d0\u05d5\u05d5\u05d9\u05e8 \u05d5\u05d4\u05d7\u05dc\u05dc \u05e9\u05dc \u05de\u05e9\u05de\u05e8\u05d5\u05ea \u05d4\u05de\u05d4\u05e4\u05db\u05d4 \u05d4\u05d0\u05d9\u05e8\u05d0\u05e0\u05d9\u05dd, \u05db\u05d3\u05d9 \u05dc\u05dc\u05d8\u05e3 \u05d0\u05ea \"\u05d4\u05d8\u05d9\u05dc \u05d4\u05d4\u05d9\u05e4\u05e8\u05e1\u05d5\u05e0\u05d9 \u05d4\u05d0\u05d9\u05e8\u05d0\u05e0\u05d9\"(\u05db\u05da \u05dc\u05e4\u05d7\u05d5\u05ea \u05d4\u05d0\u05d9\u05e8\u05d0\u05e0\u05d9\u05dd \u05d8\u05d5\u05e2\u05e0\u05d9\u05dd) \u05e9\u05e0\u05e7\u05e8\u05d0 \"\u05e4\u05ea\u05d0\u05d7 2\" .\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05d4\u05e0\u05d4 \u05d4\u05e1\u05e8\u05d8\u05d5\u05df \u05dc\u05dc\u05d0 \u05d5\u05d5\u05d8\u05e8-\u05de\u05d0\u05e8\u05e7 \u05dc\u05e9\u05d9\u05de\u05d5\u05e9\u05db\u05ddUser sent a document",false,808,"\u05d4\u05e0\u05d4 \u05d4\u05e1\u05e8\u05d8\u05d5\u05df \u05dc\u05dc\u05d0 \u05d5\u05d5\u05d8\u05e8-\u05de\u05d0\u05e8\u05e7 \u05dc\u05e9\u05d9\u05de\u05d5\u05e9\u05db\u05ddUser sent a document"],["\u05e1\u05e4\u05d9\u05e8 \u05dc\u05d9\u05e4\u05e7\u05d9\u05df\u05d3\u05d5\u05d1\u05e8 \u05de\u05e9\u05e8\u05d3 \u05d4\u05d7\u05d5\u05e5 \u05e9\u05dc \u05e7\u05d8\u05e8: \u05d4\u05d5\u05e9\u05d2\u05d4 \u05d4\u05e1\u05db\u05de\u05d4 \u05e2\u05dc \u05d4\u05d0\u05e8\u05db\u05ea \u05d4\u05e4\u05e1\u05e7\u05ea \u05d4\u05d0\u05e9 \u05d1\u05d9\u05d5\u05de\u05d9\u05d9\u05dd \u05e0\u05d5\u05e1\u05e4\u05d9\u05dd@N12chat",false,809,"\u05e1\u05e4\u05d9\u05e8 \u05dc\u05d9\u05e4\u05e7\u05d9\u05df\u05d3\u05d5\u05d1\u05e8 \u05de\u05e9\u05e8\u05d3 \u05d4\u05d7\u05d5\u05e5 \u05e9\u05dc \u05e7\u05d8\u05e8: \u05d4\u05d5\u05e9\u05d2\u05d4 \u05d4\u05e1\u05db\u05de\u05d4 \u05e2\u05dc \u05d4\u05d0\u05e8\u05db\u05ea \u05d4\u05e4\u05e1\u05e7\u05ea \u05d4\u05d0\u05e9 \u05d1\u05d9\u05d5\u05de\u05d9\u05d9\u05dd \u05e0\u05d5\u05e1\u05e4\u05d9\u05dd@N12chat"],["\u05d4\u05de\u05e9\u05d8\u05e8 \u05d4\u05d0\u05d9\u05e8\u05d0\u05e0\u05d9 \u05d4\u05e1\u05d9\u05e8 \u05d1\u05d9\u05de\u05d9\u05dd \u05d4\u05d0\u05d7\u05e8\u05d5\u05e0\u05d9\u05dd \u05d0\u05ea \u05d4\u05d7\u05e1\u05d9\u05de\u05d4 \u05de\u05e2\u05dc \u05d0\u05e4\u05dc\u05d9\u05e7\u05e6\u05d9\u05d9\u05ea \u05d5\u05d5\u05d8\u05e1\u05d0\u05e4 \u05d1\u05e8\u05d7\u05d1\u05d9 \u05d4\u05de\u05d3\u05d9\u05e0\u05d4. \u05d4\u05d7\u05e1\u05d9\u05de\u05d4 \u05d4\u05d5\u05e1\u05e8\u05d4 \u05d2\u05dd \u05de\u05e2\u05dc \"\u05d2\u05d5\u05d2\u05dc \u05e4\u05dc\u05d9\u05d9\".\u05d0\u05e4\u05dc\u05d9\u05e7\u05e6\u05d9\u05d5\u05ea \u05d8\u05dc\u05d2\u05e8\u05dd, \u05d8\u05d5\u05d5\u05d9\u05d8\u05e8, \u05e4\u05d9\u05d9\u05e1\u05d1\u05d5\u05e7 \u05d5\u05e2\u05d5\u05d3 - \u05e2\u05d3\u05d9\u05d9\u05df \u05d7\u05e1\u05d5\u05de\u05d5\u05ea \u05d1\u05d0\u05d9\u05e8\u05d0\u05df.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,810,"\u05d4\u05de\u05e9\u05d8\u05e8 \u05d4\u05d0\u05d9\u05e8\u05d0\u05e0\u05d9 \u05d4\u05e1\u05d9\u05e8 \u05d1\u05d9\u05de\u05d9\u05dd \u05d4\u05d0\u05d7\u05e8\u05d5\u05e0\u05d9\u05dd \u05d0\u05ea \u05d4\u05d7\u05e1\u05d9\u05de\u05d4 \u05de\u05e2\u05dc \u05d0\u05e4\u05dc\u05d9\u05e7\u05e6\u05d9\u05d9\u05ea \u05d5\u05d5\u05d8\u05e1\u05d0\u05e4 \u05d1\u05e8\u05d7\u05d1\u05d9 \u05d4\u05de\u05d3\u05d9\u05e0\u05d4. \u05d4\u05d7\u05e1\u05d9\u05de\u05d4 \u05d4\u05d5\u05e1\u05e8\u05d4 \u05d2\u05dd \u05de\u05e2\u05dc \"\u05d2\u05d5\u05d2\u05dc \u05e4\u05dc\u05d9\u05d9\".\u05d0\u05e4\u05dc\u05d9\u05e7\u05e6\u05d9\u05d5\u05ea \u05d8\u05dc\u05d2\u05e8\u05dd, \u05d8\u05d5\u05d5\u05d9\u05d8\u05e8, \u05e4\u05d9\u05d9\u05e1\u05d1\u05d5\u05e7 \u05d5\u05e2\u05d5\u05d3 - \u05e2\u05d3\u05d9\u05d9\u05df \u05d7\u05e1\u05d5\u05de\u05d5\u05ea \u05d1\u05d0\u05d9\u05e8\u05d0\u05df.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u00b0\ud83d\udd25\u05de\u05d1\u05e6\u05e2 \u05d1\u05dc\u05e2\u05d3\u05d9 \u05dc\u05d7\u05d1\u05e8\u05d9 \u05e2\u05e8\u05d5\u05e5 \u05d0\u05d1\u05d5 \u05e2\u05dc\u05d9\ud83d\udd25\u05d4\u05de\u05d1\u05e6\u05e2 \u05d4\u05de\u05d1\u05d5\u05e7\u05e9 \u05d1\u05d9\u05d5\u05ea\u05e8 \u05d7\u05d5\u05d6\u05e8 \u05dc-3 \u05d9\u05de\u05d9\u05dd \u05e0\u05d5\u05e1\u05e4\u05d9\u05dd:\u05de\u05db\u05e9\u05d9\u05e8 \u05e2\u05d9\u05e1\u05d5\u05d9 \u05de\u05e7\u05e6\u05d5\u05e2\u05d9 \u05dc\u05db\u05e4\u05d5\u05ea \u05d4\u05e8\u05d2\u05dc\u05d9\u05d9\u05dd \u05de\u05d1\u05d9\u05ea \u05d0\u05d9\u05e8\u05d5\u05e4\u05dc\u05e7\u05e1 \u05d1-599 \u20aa \u05d1\u05de\u05e7\u05d5\u05dd 1250 \u20aa (\u05d7\u05d9\u05e1\u05db\u05d5\u05df \u05e9\u05dc 651 \u20aa!)\u05de\u05db\u05e9\u05d9\u05e8 \u05e2\u05d9\u05e1\u05d5\u05d9 \u05e8\u05e4\u05dc\u05e7\u05e1\u05d5\u05dc\u05d5\u05d2\u05d9 \u05d4\u05e4\u05d5\u05e2\u05dc \u05d1\u05e9\u05d9\u05d8\u05d4 \u05d4\u05de\u05e1\u05d5\u05e8\u05ea\u05d9\u05ea \u05d1\u05e9\u05d9\u05dc\u05d5\u05d1 \u05d8\u05db\u05e0\u05d5\u05dc\u05d5\u05d2\u05d9\u05d4 \u05d7\u05d3\u05e9\u05e0\u05d9\u05ea \u05d0\u05e9\u05e8 \u05de\u05e4\u05d7\u05d9\u05ea\u05d4 \u05dc\u05d7\u05e6\u05d9\u05dd \u05e0\u05e4\u05e9\u05d9\u05d9\u05dd \u05d5\u05db\u05d0\u05d1\u05d9\u05dd \u05e4\u05d9\u05d6\u05d9\u05d9\u05dd \u05de\u05e7\u05d5\u05de\u05d9\u05d9\u05dd \u05d4\u05de\u05d5\u05e7\u05e8\u05e0\u05d9\u05dd \u05dc\u05d0\u05d9\u05d1\u05e8\u05d9\u05dd \u05d4\u05e4\u05e0\u05d9\u05de\u05d9\u05d9\u05dd \u05d1\u05d2\u05d5\u05e3.\u2714\ufe0f\u05d4\u05e8\u05e4\u05d9\u05d9\u05ea \u05e9\u05e8\u05d9\u05e8\u05d9\u05dd\u2714\ufe0f\u05d4\u05e2\u05dc\u05d0\u05ea \u05de\u05e6\u05d1 \u05d4\u05e8\u05d5\u05d7\u2714\ufe0f\u05e0\u05d9\u05e7\u05d5\u05d9 \u05e8\u05e2\u05dc\u05d9\u05dd \u05d5\u05d4\u05e6\u05d8\u05d1\u05e8\u05d5\u05ea \u05e0\u05d5\u05d6\u05dc\u05d9\u05dd\u2714\ufe0f\u05e9\u05d9\u05e4\u05d5\u05e8 \u05d6\u05e8\u05d9\u05de\u05ea \u05d4\u05d3\u05dd\u2714\ufe0f\u05d4\u05e4\u05d2\u05ea \u05ea\u05d7\u05d5\u05e9\u05ea \u05e2\u05d9\u05d9\u05e4\u05d5\u05ea\u05de\u05d5\u05e6\u05e8 \u05e0\u05e4\u05dc\u05d0 \u05d2\u05dd \u05db\u05de\u05ea\u05e0\u05d4 \u05dc\u05de\u05d9 \u05e9\u05d0\u05ea\u05dd \u05d0\u05d5\u05d4\u05d1\u05d9\u05dd\ud83d\udcab\u05e7\u05d5\u05d3 \u05e7\u05d5\u05e4\u05d5\u05df : spa599\ud83d\udcab\u05dc\u05e8\u05db\u05d9\u05e9\u05d4:https:\u002f\u002fbit.ly\u002f3u3OVpH\u05ea\u05d5\u05e7\u05e3 \u05d4\u05de\u05d1\u05e6\u05e2 \u05e2\u05d3 8.2.24 \u05d0\u05d5 \u05e2\u05d3 \u05d2\u05de\u05e8 \u05d4\u05de\u05dc\u05d0\u05d9",false,811,"\u00b0\ud83d\udd25\u05de\u05d1\u05e6\u05e2 \u05d1\u05dc\u05e2\u05d3\u05d9 \u05dc\u05d7\u05d1\u05e8\u05d9 \u05e2\u05e8\u05d5\u05e5 \u05d0\u05d1\u05d5 \u05e2\u05dc\u05d9\ud83d\udd25\u05d4\u05de\u05d1\u05e6\u05e2 \u05d4\u05de\u05d1\u05d5\u05e7\u05e9 \u05d1\u05d9\u05d5\u05ea\u05e8 \u05d7\u05d5\u05d6\u05e8 \u05dc-3 \u05d9\u05de\u05d9\u05dd \u05e0\u05d5\u05e1\u05e4\u05d9\u05dd:\u05de\u05db\u05e9\u05d9\u05e8 \u05e2\u05d9\u05e1\u05d5\u05d9 \u05de\u05e7\u05e6\u05d5\u05e2\u05d9 \u05dc\u05db\u05e4\u05d5\u05ea \u05d4\u05e8\u05d2\u05dc\u05d9\u05d9\u05dd \u05de\u05d1\u05d9\u05ea \u05d0\u05d9\u05e8\u05d5\u05e4\u05dc\u05e7\u05e1 \u05d1-599 \u20aa \u05d1\u05de\u05e7\u05d5\u05dd 1250 \u20aa (\u05d7\u05d9\u05e1\u05db\u05d5\u05df \u05e9\u05dc 651 \u20aa!)\u05de\u05db\u05e9\u05d9\u05e8 \u05e2\u05d9\u05e1\u05d5\u05d9 \u05e8\u05e4\u05dc\u05e7\u05e1\u05d5\u05dc\u05d5\u05d2\u05d9 \u05d4\u05e4\u05d5\u05e2\u05dc \u05d1\u05e9\u05d9\u05d8\u05d4 \u05d4\u05de\u05e1\u05d5\u05e8\u05ea\u05d9\u05ea \u05d1\u05e9\u05d9\u05dc\u05d5\u05d1 \u05d8\u05db\u05e0\u05d5\u05dc\u05d5\u05d2\u05d9\u05d4 \u05d7\u05d3\u05e9\u05e0\u05d9\u05ea \u05d0\u05e9\u05e8 \u05de\u05e4\u05d7\u05d9\u05ea\u05d4 \u05dc\u05d7\u05e6\u05d9\u05dd \u05e0\u05e4\u05e9\u05d9\u05d9\u05dd \u05d5\u05db\u05d0\u05d1\u05d9\u05dd \u05e4\u05d9\u05d6\u05d9\u05d9\u05dd \u05de\u05e7\u05d5\u05de\u05d9\u05d9\u05dd \u05d4\u05de\u05d5\u05e7\u05e8\u05e0\u05d9\u05dd \u05dc\u05d0\u05d9\u05d1\u05e8\u05d9\u05dd \u05d4\u05e4\u05e0\u05d9\u05de\u05d9\u05d9\u05dd \u05d1\u05d2\u05d5\u05e3.\u2714\ufe0f\u05d4\u05e8\u05e4\u05d9\u05d9\u05ea \u05e9\u05e8\u05d9\u05e8\u05d9\u05dd\u2714\ufe0f\u05d4\u05e2\u05dc\u05d0\u05ea \u05de\u05e6\u05d1 \u05d4\u05e8\u05d5\u05d7\u2714\ufe0f\u05e0\u05d9\u05e7\u05d5\u05d9 \u05e8\u05e2\u05dc\u05d9\u05dd \u05d5\u05d4\u05e6\u05d8\u05d1\u05e8\u05d5\u05ea \u05e0\u05d5\u05d6\u05dc\u05d9\u05dd\u2714\ufe0f\u05e9\u05d9\u05e4\u05d5\u05e8 \u05d6\u05e8\u05d9\u05de\u05ea \u05d4\u05d3\u05dd\u2714\ufe0f\u05d4\u05e4\u05d2\u05ea \u05ea\u05d7\u05d5\u05e9\u05ea \u05e2\u05d9\u05d9\u05e4\u05d5\u05ea\u05de\u05d5\u05e6\u05e8 \u05e0\u05e4\u05dc\u05d0 \u05d2\u05dd \u05db\u05de\u05ea\u05e0\u05d4 \u05dc\u05de\u05d9 \u05e9\u05d0\u05ea\u05dd \u05d0\u05d5\u05d4\u05d1\u05d9\u05dd\ud83d\udcab\u05e7\u05d5\u05d3 \u05e7\u05d5\u05e4\u05d5\u05df : spa599\ud83d\udcab\u05dc\u05e8\u05db\u05d9\u05e9\u05d4:https:\u002f\u002fbit.ly\u002f3u3OVpH\u05ea\u05d5\u05e7\u05e3 \u05d4\u05de\u05d1\u05e6\u05e2 \u05e2\u05d3 8.2.24 \u05d0\u05d5 \u05e2\u05d3 \u05d2\u05de\u05e8 \u05d4\u05de\u05dc\u05d0\u05d9"],["\u05e2\u05e8\u05d5\u05e6\u05d9\u05dd \u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd:\u0642\u0648\u0627\u062a \u0627\u0644\u0627\u062d\u062a\u0644\u0627\u0644 \u0627\u0644\u0625\u0633\u0631\u0627\u0626\u064a\u0644\u064a\u0629 \u062a\u0634\u0627\u0631\u0643 \u0644\u0642\u0637\u0627\u062a \u062a\u0648\u062b\u0642 \u062a\u062f\u0645\u064a\u0631\u0647\u0627 \u0644\u0645\u062c\u0645\u0639 \u0633\u0643\u0646\u064a \u0641\u064a \u0628\u064a\u062a \u0644\u0627\u0647\u064a\u0627 \u060c \u0634\u0645\u0627\u0644 \u063a\u0632\u0629.\u05ea\u05e8\u05d2\u05d5\u05dd: \u05db\u05d5\u05d7\u05d5\u05ea \u05d4\u05db\u05d9\u05d1\u05d5\u05e9 \u05d4\u05d9\u05e9\u05e8\u05d0\u05dc\u05d9\u05dd \u05de\u05e4\u05e8\u05e1\u05de\u05d9\u05dd \u05ea\u05d9\u05e2\u05d5\u05d3 \u05e9\u05dc \u05d4\u05e8\u05e1 \u05de\u05ea\u05d7\u05dd \u05de\u05d2\u05d5\u05e8\u05d9\u05dd \u05d1\u05d1\u05d9\u05ea \u05dc\u05d0\u05d4\u05d9\u05d0 \u05d1\u05e6\u05e4\u05d5\u05df \u05d4\u05e8\u05e6\u05d5\u05e2\u05d4.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,812,"\u05e2\u05e8\u05d5\u05e6\u05d9\u05dd \u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd:\u0642\u0648\u0627\u062a \u0627\u0644\u0627\u062d\u062a\u0644\u0627\u0644 \u0627\u0644\u0625\u0633\u0631\u0627\u0626\u064a\u0644\u064a\u0629 \u062a\u0634\u0627\u0631\u0643 \u0644\u0642\u0637\u0627\u062a \u062a\u0648\u062b\u0642 \u062a\u062f\u0645\u064a\u0631\u0647\u0627 \u0644\u0645\u062c\u0645\u0639 \u0633\u0643\u0646\u064a \u0641\u064a \u0628\u064a\u062a \u0644\u0627\u0647\u064a\u0627 \u060c \u0634\u0645\u0627\u0644 \u063a\u0632\u0629.\u05ea\u05e8\u05d2\u05d5\u05dd: \u05db\u05d5\u05d7\u05d5\u05ea \u05d4\u05db\u05d9\u05d1\u05d5\u05e9 \u05d4\u05d9\u05e9\u05e8\u05d0\u05dc\u05d9\u05dd \u05de\u05e4\u05e8\u05e1\u05de\u05d9\u05dd \u05ea\u05d9\u05e2\u05d5\u05d3 \u05e9\u05dc \u05d4\u05e8\u05e1 \u05de\u05ea\u05d7\u05dd \u05de\u05d2\u05d5\u05e8\u05d9\u05dd \u05d1\u05d1\u05d9\u05ea \u05dc\u05d0\u05d4\u05d9\u05d0 \u05d1\u05e6\u05e4\u05d5\u05df \u05d4\u05e8\u05e6\u05d5\u05e2\u05d4.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05de\u05d1\u05d6\u05e7\u05df 12\u05de\u05d5\u05d6\u05d9\u05d0\u05d5\u05df \u05d1\u05d9\u05ea \u05dc\u05d5\u05d7\u05de\u05d9 \u05d4\u05d2\u05d8\u05d0\u05d5\u05ea \u05d4\u05d0\u05d9\u05e8 \u05d1\u05d0\u05d5\u05e8 \u05e6\u05d4\u05d5\u05d1 \u05d0\u05ea \u05d0\u05de\u05ea \u05d4\u05de\u05d9\u05dd \u05d4\u05e1\u05de\u05d5\u05db\u05d4 \u05dc\u05d0\u05d5\u05ea \u05d4\u05d6\u05d3\u05d4\u05d5\u05ea \u05e2\u05dd 136 \u05d4\u05d7\u05d8\u05d5\u05e4\u05d9\u05dd \u05e9\u05e0\u05de\u05e6\u05d0\u05d9\u05dd 100 \u05d9\u05 05d0\u05d5\u05e8\u05d9\u05d0\u05dc \u05d1\u05d5\u05e1\u05d5. \u05e1\u05e4\u05d5\u05dc\u05d0\u05e8\u05d9\u05e5' \u05d3\u05e0\u05d4 \u05e2\u05d9\u05de\u05dd \u05d1\u05e1\u05d5\u05d2\u05d9\u05d9\u05ea \u05d1\u05d9\u05e7\u05d5\u05e8\u05d9 \u05d4\u05d7\u05d8\u05d5\u05e4\u05d9\u05dd, \u05d5\u05de\u05d7\u05e8 \u05d4\u05d9\u05d0 \u05ea\u05d1\u05e7\u05e8 \u05d2\u05dd \u05d1\u05e6\u05d3 \u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9. \u05e7\u05e8\u05d3\u05d9\u05d8: \u05d1\u05e8\u05d5\u05e0\u05d5 \u05e9\u05e8\u05d1\u05d9\u05d8, \u05de\u05e9\u05e8\u05d3 \u05d4\u05d7\u05d5\u05e5@N12chat"],["\u05d0\u05e4\u05e9\u05e8 \u05dc\u05d5\u05de\u05e8 \u05e9\u05d4\u05d9\u05d5\u05dd \u05d4\u05d9\u05d4 \u05e0\u05e4\u05d7 \u05d7\u05d9\u05dc\u05d5\u05e4\u05d9 \u05d4\u05d0\u05e9 \u05d4\u05d2\u05d1\u05d5\u05d4 \u05d1\u05d9\u05d5\u05ea\u05e8 \u05d1\u05d2\u05d1\u05d5\u05dc \u05d4\u05e6\u05e4\u05d5\u05df \u05de\u05d0\u05d6 \u05d4\u05d7\u05dc\u05d4 \u05d4\u05dc\u05d7\u05d9\u05de\u05d4 \u05de\u05d5\u05dc \u05e2\u05d6\u05d4.\u05d4\u05d9\u05ea\u05d4 \u05d4\u05e1\u05dc\u05de\u05d4 \u05d9\u05d5\u05dd \u05d9\u05d5\u05de\u05d9\u05ea \u05d5\u05db\u05e2\u05ea \u05d0\u05e0\u05d7\u05e0\u05d5 \u05e0\u05de\u05e6\u05d0\u05d9\u05dd \u05d1\u05e9\u05d9\u05d0 \u05dc\u05e2\u05d5\u05de\u05ea \u05d4\u05e9\u05d1\u05d5\u05e2 \u05d4\u05d0\u05d7\u05e8\u05d5\u05df.\n",false,829,"\u05d0\u05e4\u05e9\u05e8 \u05dc\u05d5\u05de\u05e8 \u05e9\u05d4\u05d9\u05d5\u05dd \u05d4\u05d9\u05d4 \u05e0\u05e4\u05d7 \u05d7\u05d9\u05dc\u05d5\u05e4\u05d9 \u05d4\u05d0\u05e9 \u05d4\u05d2\u05d1\u05d5\u05d4 \u05d1\u05d9\u05d5\u05ea\u05e8 \u05d1\u05d2\u05d1\u05d5\u05dc \u05d4\u05e6\u05e4\u05d5\u05df \u05de\u05d0\u05d6 \u05d4\u05d7\u05dc\u05d4 \u05d4\u05dc\u05d7\u05d9\u05de\u05d4 \u05de\u05d5\u05dc \u05e2\u05d6\u05d4.\u05d4\u05d9\u05ea\u05d4 \u05d4\u05e1\u05dc\u05de\u05d4 \u05d9\u05d5\u05dd \u05d9\u05d5\u05de\u05d9\u05ea \u05d5\u05db\u05e2\u05ea \u05d0\u05e0\u05d7\u05e0\u05d5 \u05e0\u05de\u05e6\u05d0\u05d9\u05dd \u05d1\u05e9\u05d9\u05d0 \u05dc\u05e2\u0 05e5, \u05d4\u05de\u05d4\u05d5\u05d5\u05d4 \u05d4\u05db\u05e0\u05e1\u05d4 \u05db\u05dc\u05db\u05dc\u05d9\u05ea \u05de\u05e8\u05db\u05d6\u05d9\u05ea \u05e9\u05dc \u05de\u05e6\u05e8\u05d9\u05dd.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05d0\u05d9\u05ea\u05de\u05e8 \u05de\u05d9\u05e0\u05de\u05e8\u05d0\u05ea\u05e8 \u05d3\u05d5\u05d0\u05e8 \u05d9\u05e9\u05e8\u05d0\u05dc \u05dc\u05d0 \u05d6\u05de\u05d9\u05df \u05d5\u05dc\u05d6\u05de\u05df \u05e7\u05e6\u05e8 \u05d4\u05d5\u05e4\u05d9\u05e2\u05d4 \u05d1\u05d5 \u05ea\u05de\u05d5\u05e0\u05d4 \u05e9\u05dc \u05d2\u05d5\u05e8\u05de\u05d9\u05dd \u05e2\u05d5\u05d9\u05e0\u05d9\u05dd. \u05de\u05d3\u05d5\u05d0\u05e8 \u05d9\u05e9\u05e8\u05d0\u05dc \u05e0\u05de\u05e1\u05e8: \"\u05e0\u05e8\u05d0\u05d4 \u05db\u05d9 \u05de\u05d3\u05d5\u05d1\u05e8 \u05d1\u05d4\u05d5\u05d3\u05e2\u05d4 \u05e9\u05e0\u05e9\u05ea\u05dc\u05d4 \u05e2\u05dc \u05d2\u05d1\u05d9 \u05ea\u05d5\u05e1\u05e3 \u05d7\u05d9\u05e6\u05d5\u05e0\u05d9 \u05dc\u05d0\u05ea\u05e8 \u05d4\u05d3\u05d5\u05d0\u05e8, \u05d5\u05d0\u05d9\u05df \u05d0\u05d9\u05e0\u05d3\u05d9\u05e7\u05e6\u05d9\u05d4 \u05dc\u05e4\u05e8\u05d9\u05e6\u05d4 \u05dc\u05d0\u05ea\u05e8 \u05e2\u05e6\u05de\u05d5. \u05d4\u05e0\u05d5\u05e9\u05d0 \u05d1\u05d8\u05d9\u05e4\u05d5\u05dc\"@N12chat",false,853,"\u05d0\u05d9\u05ea\u05de\u05e8 \u05de\u05d9\u05e0\u05de\u05e8\u05d0\u05ea\u05e8 \u05d3\u05d5\u05d0\u05e8 \u05d9\u05e9\u05e8\u05d0\u05dc \u05dc\u05d0 \u05d6\u05de\u05d9\u05df \u05d5\u05dc\u05d6\u05de\u05df \u05e7\u05e6\u05e8 \u05d4\u05d5\u05e4\u05d9\u05e2\u05d4 \u05d1\u05d5 \u05ea\u05de\u05d5\u05e0\u05d4 \u05e9\u05dc \u05d2\u05d5\u05e8\u05de\u05d9\u05dd \u05e2\u05d5\u05d9\u05e0\u05d9\u05dd. \u05de\u05d3\u05d5\u05d0\u05e8 \u05d9\u05e9\u05e8\u05d0\u05dc \u05e0\u05de\u05e1\u05e8: \"\u05e0\u05e8\u05d0\u05d4 \u05db\u05d9 \u05de\u05d3\u05d5\u05d1\u05e8 \u05d1\u05d4\u05d5\u05d3\u05e2\u05d4 \u05e9\u05e0\u05e9\u05ea\u05dc\u05d4 \u05e2\u05dc \u05d2\u05d1\u05d9 \u05ea\u05d5\u05e1\u05e3 \u05d7\u05d9\u05e6\u05d5\u05e0\u05d9 \u05dc\u05d0\u05ea\u05e8 \u05d4\u05d3\u05d5\u05d0\u05e8, \u05d5\u05d0\u05d9\u05df \u05d0\u05d9\u05e0\u05d3\u05d9\u05e7\u05e6\u05d9\u05d4 \u05dc\u05e4\u05e8\u05d9\u05e6\u05d4 \u05dc\u05d0\u05ea\u05e8 \u05e2\u05e6\u05de\u05d5. \u05d4\u05e0\u05d5\u05e9\u05d0 \u05d1\u05d8\u05d9\u05e4\u05d5\u05dc\"@N12chat"],["\u05d2\u05dc\u05d0\u05de\u05e4\u05d9\u05e0\u05d2 \u05d1\u05e8\u05e4\u05d9\u05d7...\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,854,"\u05d2\u05dc\u05d0\u05de\u05e4\u05d9\u05e0\u05d2 \u05d1\u05e8\u05e4\u05d9\u05d7...\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05de\u05d1\u05d6\u05e7\u05df 12\u05e2\u05db\u05d5: 140 \u05e4\u05e7\u05d8\u05d9\u05dd \u05e9\u05dc \u05e1\u05d9\u05d2\u05e8\u05d9\u05d5\u05ea, \u05d4\u05d7\u05e9\u05d5\u05d3\u05d9\u05dd \u05db\u05de\u05d6\u05d5\u05d9\u05e4\u05d9\u05dd \u05d1\u05e9\u05d5\u05d5\u05d9 \u05e2\u05e9\u05e8\u05d5\u05ea \u05d0\u05dc\u05e4\u05d9 \u05e9\u05e7\u05dc\u05d9\u05dd, \u05d0\u05d5\u05ea\u05e8\u05d5 \u05d1\u05d1\u05d9\u05ea \u05e2\u05e1\u05e7 \u05d1\u05e2\u05d9\u05e8. \u05d4\u05e1\u05d7\u05d5\u05e8\u05d4 \u05e0\u05ea\u05e4\u05e1\u05d4 \u05d5\u05d4\u05d5\u05d7\u05e8\u05de\u05d4, \u05d5\u05d1\u05e2\u05dc \u05d4\u05e2\u05e1\u05e7 \u05d6\u05d5\u05de\u05df \u05dc\u05d7\u05e7\u05d9\u05e8\u05d4. \u05e6\u05d9\u05dc\u05d5\u05dd: \u05d3\u05d5\u05d1\u05e8\u05d5\u05ea \u05d4\u05de\u05e9\u05d8\u05e8\u05d4@N12chat",false,855,"\u05de\u05d1\u05d6\u05e7\u05df 12\u05e2\u05db\u05d5: 140 \u05e4\u05e7\u05d8\u05d9\u05dd \u05e9\u05dc \u05e1\u05d9\u05d2\u05e8\u05d9\u05d5\u05ea, \u05d4\u05d7\u05e9\u05d5\u05d3\u05d9\u05dd \u05db\u05de\u05d6\u05d5\u05d9\u05e4\u05d9\u05dd \u05d1\u05e9\u05d5\u05d5\u05d9 \u05e2\u05e9\u05e8\u05d5\u05ea \u05d0\u05dc\u05e4\u05d9 \u05e9\u05e7\u05dc\u05d9\u05dd, \u05d0\u05d5\u05ea\u05e8\u05d5 \u05d1\u05d1\u05d9\u05ea \u05e2\u05e1\u05e7 \u05d1\u05e2\u05d9\u05e8. \u05d4\u05e1\u05d7\u05d5\u05e8\u05d4 \u05e0\u05ea\u05e4\u05e1\u05d4 \u05d5\u05d4\u05d5\u05d7\u05e8\u05de\u05d4, \u05d5\u05d1\u05e2\u05dc \u05d4\u05e2\u05e1\u05e7 \u05d6\u05d5\u05de\u05df \u05dc\u05d7\u05e7\u05d9\u05e8\u05d4. \u05e6\u05d9\u05dc\u05d5\u05dd: \u05d3\u05d5\u05d1\u05e8\u05d5\u05ea \u05d4\u05de\u05e9\u05d8\u05e8\u05d4@N12chat"],["\u05d0\u05d5\u05e8 \u05e8\u05d1\u05d9\u05d3\u05d0\u05de\u05e9 \u05e4\u05e8\u05e6\u05d5 \u05d7\u05e9\u05d5\u05d3\u05d9\u05dd \u05dc\u05de\u05e9\u05e8\u05d3 \u05d1\u05ea\u05dc \u05d0\u05d1\u05d9\u05d1 \u05d5\u05d2\u05e0\u05d1\u05d5 \u05e9\u05de\u05d5\u05e0\u05d4 \u05d9\u05e6\u05d9\u05e8\u05d5\u05ea \u05d0\u05de\u05e0\u05d5\u05ea, \u05d8\u05dc\u05d5\u05d5\u05d9\u05d6\u05d9\u05d4, \u05e9\u05e2\u05d5\u05df, \u05db\u05e1\u05e3 \u05ea\u05db\u05e9\u05d9\u05d8\u05d9\u05dd, \u05de\u05d7\u05e9\u05d1 \u05e0\u05d9\u05d9\u05d3 \u05d5\u05e8\u05d7\u05e4\u05df. \u05d4\u05de\u05e9\u05d8\u05e8\u05d4 \u05d0\u05d9\u05ea\u05e8\u05d4 \u05d0\u05ea \u05d4\u05d7\u05e9\u05d5\u05d3\u05d9\u05dd \u05d1\u05d1\u05d9\u05e6\u05d5\u05e2 \u05d4\u05e2\u05d1\u05d9\u05e8\u05d5\u05ea \u05ea\u05d5\u05da \u05d6\u05de\u05df \u05e7\u05e6\u05e8 \u05d1\u05d3\u05d9\u05e8\u05ea \u05de\u05e1\u05ea\u05d5\u05e8 \u05d1\u05e2\u05d9\u05e8, \u05e9\u05d1\u05d4 \u05e0\u05de\u05e6\u05d0 \u05d2\u05dd \u05d4\u05e8\u05db\u05d5\u05e9 \u05d4\u05d2\u05e0\u05d5\u05d1. \u05d4\u05d7\u05e9\u05d5\u05d3\u05d9\u05dd, \u05ea\u05d5\u05e9\u05d1 \u05e8\u05d0\u05e9\u05d5\u05df \u05dc\u05e6\u05d9\u05d5\u05df \u05d1\u05df 39 \u05d5\u05e9\u05d5\u05d4\u05d4 \u05d1\u05dc\u05ea\u05d9 \u05d7\u05d5\u05e7\u05d9 \u05d1\u05df 29 \u05de\u05d0\u05d9\u05d5\"\u05e9, \u05d4\u05d5\u05d1\u05d0\u05d5 \u05dc\u05d7\u05e7\u05d9\u05e8\u05d4. \u05e6\u05d9\u05dc\u05d5\u05dd: \u05d3\u05d5\u05d1\u05e8\u05d5\u05ea \u05d4\u05de\u05e9\u05d8\u05e8\u05d4@N12chat",false,856,"\u05d0\u05d5\u05e8 \u05e8\u05d1\u05d9\u05d3\u05d0\u05de\u05e9 \u05e4\u05e8\u05e6\u05d5 \u05d7\u05e9\u05d5\u05d3\u05d9\u05dd \u05dc\u05de\u05e9\u05e8\u05d3 \u05d1\u05ea\u05dc \u05d0\u05d1\u05d9\u05d1 \u05d5\u05d2\u05e0\u05d1\u05d5 \u05e9\u05de\u05d5\u05e0\u05d4 \u05d9\u05e6\u05d9\u05e8\u05d5\u05ea \u05d0\u05de\u05e0\u05d5\u05ea, \u05d8\u05dc\u05d5\u05d5\u05d9\u05d6\u05d9\u05d4, \u05e9\u05e2\u05d5\u05df, \u05db\u05e1\u05e3 \u05ea\u05db\u05e9\u05d9\u05d8\u05d9\u05dd, \u05de\u05d7\u05e9\u05d1 \u05e0\u05d9\u05d9\u05d3 \u05d5\u05e8\u05d7\u05e4\u05df. \u05d4\u05de\u05e9\u05d8\u05e8\u05d4 \u05d0\u05d9\u05ea\u05e8\u05d4 \u05d0\u05ea \u05d4\u05d7\u05e9\u05d5\u05d3\u05d9\u05dd \u05d1\u05d1\u05d9\u05e6\u05d5\u05e2 \u05d4\u05e2\u05d1\u05d9\u05e8\u05d5\u05ea \u05ea\u05d5\u05da \u05d6\u05de\u05df \u05e7\u05e6\u05e8 \u05d1\u05d3\u05d9\u05e8\u05ea \u05de\u05e1\u05ea\u05d5\u05e8 \u05d1\u05e2\u05d9\u05e8, \u05e9\u05d1\u05d4 \u05e0\u05de\u05e6\u05d0 \u05d2\u05dd \u05d4\u05e8\u05db\u05d5\u05e9 \u05d4\u05d2\u05e0\u05d5\u05d1. \u05d4\u05d7\u05e9\u05d5\u05d3\u05d9\u05dd, \u05ea\u05d5\u05e9\u05d1 \u05e8\u05d0\u05e9\u05d5\u05df \u05dc\u05e6\u05d9\u05d5\u05df \u05d1\u05df 39 \u05d5\u05e9\u05d5\u05d4\u05d4 \u05d1\u05dc\u05ea\u05d9 \u05d7\u05d5\u05e7\u05d9 \u05d1\u05df 29 \u05de\u05d0\u05d9\u05d5\"\u05e9, \u05d4\u05d5\u05d1\u05d0\u05d5 \u05dc\u05d7\u05e7\u05d9\u05e8\u05d4. \u05e6\u05d9\u05dc\u05d5\u05dd: \u05d3\u05d5\u05d1\u05e8\u05d5\u05ea \u05d4\u05de\u05e9\u05d8\u05e8\u05d4@N12chat"],["\u05d1\u05df \u05d2\u05d5\u05dc\u05d3\u05e4\u05e8\u05d9\u05d9\u05e0\u05d3\u05d1\u05de\u05d8\u05e8\u05d4 \u05dc\u05e9\u05de\u05d5\u05e8 \u05e2\u05dc \u05d4\u05e1\u05d9\u05db\u05d5\u05d9 \u05dc\u05e7\u05d9\u05d9\u05dd \u05d0\u05ea \u05d4\u05de\u05e9\u05d7\u05e7 \u05d1\u05d0\u05e8\u05e5 \u05d1\u05d4\u05de\u05e9\u05da: \u05d0\u05d9\u05d2\u05d5\u05d3 \u05d4\u05db\u05d3\u05d5\u05e8\u05e1\u05dc \u05d4\u05d7\u05dc\u05d9\u05e3 \u05d1\u05d9\u05ea\u05d9\u05d5\u05ea \u05e2\u05dd \u05e1\u05dc\u05d5\u05d1\u05e0\u05d9\u05d4, \u05db\u05da \u05e9\u05d4\u05de\u05e9\u05d7\u05e7 \u05d4\u05e8\u05d0\u05e9\u05d5\u05df \u05d1\u05d9\u05e0\u05d9\u05d4\u05df \u05d1\u05de\u05e1\u05d2\u05e8\u05ea \u05de\u05d5\u05e7\u05d3\u05de\u05d5\u05ea \u05d0\u05dc\u05d9\u05e4\u05d5\u05ea \u05d0\u05d9\u05e8\u05d5\u05e4\u05d4 \u05d9\u05ea\u05e7\u05d9\u05d9\u05dd \u05d1\u05d7\u05d5\u05e5@N12chat",false,857,"\u05d1\u05df \u05d2\u05d5\u05dc\u05d3\u05e4\u05e8\u05d9\u05d9\u05e0\u05d3\u05d1\u05de\u05d8\u05e8\u05d4 \u05dc\u05e9\u05de\u05d5\u05e8 \u05e2\u05dc \u05d4\u05e1\u05d9\u05db\u05d5\u05d9 \u05dc\u05e7\u05d9\u05d9\u05dd \u05d0\u05ea \u05d4\u05de\u05e9\u05d7\u05e7 \u05d1\u05d0\u05e8\u05e5 \u05d1\u05d4\u05de\u05e9\u05da: \u05d0\u05d9\u05d2\u05d5\u05d3 \u05d4\u05db\u05d3\u05d5\u05e8\u05e1\u05dc \u05d4\u05d7\u05dc\u05d9\u05e3 \u05d1\u05d9\u05ea\u05d9\u05d5\u05ea \u05e2\u05dd \u05e1\u05dc\u05d5\u05d1\u05e0\u05d9\u05d4, \u05db\u05da \u05e9\u05d4\u05de\u05e9\u05d7\u05e7 \u05d4\u05e8\u05d0\u05e9\u05d5\u05df \u05d1\u05d9\u05e0\u05d9\u05d4\u05df \u05d1\u05de\u05e1\u05d2\u05e8\u05ea \u05de\u05d5\u05e7\u05d3\u05de\u05d5\u05ea \u05d0\u05dc\u05d9\u05e4\u05d5\u05ea \u05d0\u05d9\u05e8\u05d5\u05e4\u05d4 \u05d9\u05ea\u05e7\u05d9\u05d9\u05dd \u05d1\u05d7\u05d5\u05e5@N12chat"],["\u05d0\u05dc\u05d2'\u05d6\u05d9\u05e8\u05d4 \u05de\u05e4\u05d9 \u05de\u05e7\u05d5\u05e8\u05d5\u05ea \u05d7\u05d5\u05ea'\u05d9\u05dd: \u05ea\u05e7\u05e4\u05e0\u05d5 \u05e1\u05e4\u05d9\u05e0\u05d4 \u05d0\u05de\u05e8\u05d9\u05e7\u05d0\u05d9\u05ea \u05dc\u05d9\u05d3 \u05e2\u05d9\u05e8 \u05d4\u05e0\u05de\u05dc \u05d0\u05dc\u05de\u05db\u05dc\u05d0 (\u05ea\u05d9\u05de\u05df - \u05d0\"\u05e2).\n",false,858,"\u05d0\u05dc\u05d2'\u05d6\u05d9\u05e8\u05d4 \u05de\u05e4\u05d9 \u05de\u05e7\u05d5\u05e8\u05d5\u05ea \u05d7\u05d5\u05ea'\u05d9\u05dd: \u05ea\u05e7\u05e4\u05e0\u05d5 \u05e1\u05e4\u05d9\u05e0\u05d4 \u05d0\u05de\u05e8\u05d9\u05e7\u05d0\u05d9\u05ea \u05dc\u05d9\u05d3 \u05e2\u05d9\u05e8 \u05d4\u05e0\u05de\u05dc \u05d0\u05dc\u05de\u05db\u05dc\u05d0 (\u05ea\u05d9\u05de\u05df - \u05d0\"\u05e2).\n"],["\u05d7\u05de\"\u05dc \u05d4\u05de\u05d5\u05e8\u05d3\u05d9\u05dd \u05de\u05db\u05e8\u05d9\u05d6 \u05e8\u05e9\u05de\u05d9\u05ea \u05dc\u05e4\u05e0\u05d9 \u05d6\u05de\u05df \u05e7\u05e6\u05e8 : \u05d4\u05d7\u05dc\u05d4 \u05d4\u05e4\u05e2\u05d5\u05dc\u05d4 \u05d4\u05e7\u05e8\u05e7\u05e2\u05d9\u05ea \u05dc\u05e2\u05d1\u05e8 \u05d4\u05e2\u05d9\u05e8 \u05d7\u05de\u05d0\u05d4.  \u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df\t\u05d7\u05de\"\u05dc \u05d4\u05de\u05d5\u05e8\u05d3\u05d9\u05dd \u05d1\u05e2\u05d3\u05db\u05d5\u05df:\u05dc\u05d5\u05d7\u05de\u05d9\u05e0\u05d5 \u05de\u05e0\u05d4\u05dc\u05d9\u05dd \u05e7\u05e8\u05d1\u05d5\u05ea \u05e2\u05d6\u05d9\u05dd \u05e0\u05d2\u05d3 \u05db\u05d5\u05d7\u05d5\u05ea \u05d0\u05e1\u05d3\u05d1\u05ea\u05d5\u05da \u05e9\u05db\u05d5\u05e0\u05d5\u05ea \u05d1\u05e2\u05d9\u05e8 \u05d7\u05de\u05d0\u05d4.2 \u05ea\u05d2\u05d5\u05d1\u05d5\u05ea",false,859,"\u05d7\u05de\"\u05dc \u05d4\u05de\u05d5\u05e8\u05d3\u05d9\u05dd \u05de\u05db\u05e8\u05d9\u05d6 \u05e8\u05e9\u05de\u05d9\u05ea \u05dc\u05e4\u05e0\u05d9 \u05d6\u05de\u05df \u05e7\u05e6\u05e8 : \u05d4\u05d7\u05dc\u05d4 \u05d4\u05e4\u05e2\u05d5\u05dc\u05d4 \u05d4\u05e7\u05e8\u05e7\u05e2\u05d9\u05ea \u05dc\u05e2\u05d1\u05e8 \u05d4\u05e2\u05d9\u05e8 \u05d7\u05de\u05d0\u05d4.  \u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df\t\u05d7\u05de\"\u05dc \u05d4\u05de\u05d5\u05e8\u05d3\u05d9\u05dd \u05d1\u05e2\u05d3\u05db\u05d5\u05df:\u05dc\u05d5\u05d7\u05de\u05d9\u05e0\u05d5 \u05de\u05e0\u05d4\u05dc\u05d9\u05dd \u05e7\u05e8\u05d1\u05d5\u05ea \u05e2\u05d6\u05d9\u05dd \u05e0\u05d2\u05d3 \u05db\u05d5\u05d7\u05d5\u05ea \u05d0\u05e1\u05d3\u05d1\u05ea\u05d5\u05da \u05e9\u05db\u05d5\u05e0\u05d5\u05ea \u05d1\u05e2\u05d9\u05e8 \u05d7\u05de\u05d0\u05d4.2 \u05ea\u05d2\u05d5\u05d1\u05d5\u05ea"],["\u05d9\u05d5\u05e0\u05d4 \u05dc\u05d9\u05d9\u05d1\u05d6\u05d5\u05df\u05dc\u05e4\u05d9 \u05e2\u05d3\u05db\u05d5\u05df \u05e8\u05e9\u05de\u05d9 \u05de\u05de\u05e9\u05d8\u05e8\u05ea \u05d0\u05d8\u05dc\u05e0\u05d8\u05d4, \u05d0\u05d9\u05e9\u05d4 \u05e9\u05d4\u05d7\u05d6\u05d9\u05e7\u05d4 \u05d3\u05d2\u05dc \u05e4\u05dc\u05e1\u05d8\u05d9\u05df \u05d4\u05e6\u05d9\u05ea\u05d4 \u05d0\u05ea \u05e2\u05e6\u05de\u05d4 \u05de\u05d7\u05d5\u05e5 \u05dc\u05e7\u05d5\u05e0\u05e1\u05d5\u05dc\u05d9\u05d4, \u05d4\u05d9\u05d0 \u05e0\u05e4\u05e6\u05e2\u05d4 \u05e2\u05dd \u05db\u05d5\u05d5\u05d9\u05d5\u05ea \u05d7\u05de\u05d5\u05e8\u05d5\u05ea \u05d5\u05e4\u05d5\u05e0\u05ea\u05d4 \u05dc\u05d1\u05d9\u05ea \u05d4\u05d7\u05d5\u05dc\u05d9\u05dd \u05d1\u05de\u05e6\u05d1 \u05e7\u05e9\u05d4. \u05d4\u05de\u05d0\u05d1\u05d8\u05d7 \u05d1\u05de\u05e7\u05d5\u05dd \u05e9\u05db\u05d9\u05d1\u05d4 \u05d0\u05ea \u05d4\u05d0\u05e9 \u05e0\u05e4\u05e6\u05e2 \u05d2\u05dd \u05d4\u05d5\u05d0 \u05d1\u05d9\u05d3\u05d5 \u05d5\u05e8\u05d2\u05dc\u05d5 \u05d5\u05e7\u05d9\u05d1\u05dc \u05d2\u05dd \u05db\u05df \u05d8\u05d9\u05e4\u05d5\u05dc \u05e8\u05e4\u05d5\u05d0\u05d9. \u05d1\u05de\u05e9\u05d8\u05e8\u05d4 \u05de\u05d2\u05d3\u05d9\u05e8\u05d9\u05dd \u05d0\u05ea \u05d4\u05de\u05e7\u05e8\u05d4 \u05db\"\u05de\u05e7\u05e8\u05d4 \u05e7\u05d9\u05e6\u05d5\u05e0\u05d9 \u05e9\u05dc \u05de\u05d7\u05d0\u05d4 \u05e4\u05d5\u05dc\u05d9\u05d8\u05d9\u05ea\"@N12chat",false,860,"\u05d9\u05d5\u05e0\u05d4 \u05dc\u05d9\u05d9\u05d1\u05d6\u05d5\u05df\u05dc\u05e4\u05d9 \u05e2\u05d3\u05db\u05d5\u05df \u05e8\u05e9\u05de\u05d9 \u05de\u05de\u05e9\u05d8\u05e8\u05ea \u05d0\u05d8\u05dc\u05e0\u05d8\u05d4, \u05d0\u05d9\u05e9\u05d4 \u05e9\u05d4\u05d7\u05d6\u05d9\u05e7\u05d4 \u05d3\u05d2\u05dc \u05e4\u05dc\u05e1\u05d8\u05d9\u05df \u05d4\u05e6\u05d9\u05ea\u05d4 \u05d0\u05ea \u05e2\u05e6\u05de\u05d4 \u05de\u05d7\u05d5\u05e5 \u05dc\u05e7\u05d5\u05e0\u05e1\u05d5\u05dc\u05d9\u05d4, \u05d4\u05d9\u05d0 \u05e0\u05e4\u05e6\u05e2\u05d4 \u05e2\u05dd \u05db\u05d5\u05d5\u05d9\u05d5\u05ea \u05d7\u05de\u05d5\u05e8\u05d5\u05ea \u05d5\u05e4\u05d5\u05e0\u05ea\u05d4 \u05dc\u05d1\u05d9\u05ea \u05d4\u05d7\u05d5\u05dc\u05d9\u05dd \u05d1\u05de\u05e6\u05d1 \u05e7\u05e9\u05d4. \u05d4\u05de\u05d0\u05d1\u05d8\u05d7 \u05d1\u05de\u05e7\u05d5\u05dd \u05e9\u05db\u05d9\u05d1\u05d4 \u05d0\u05ea \u05d4\u05d0\u05e9 \u05e0\u05e4\u05e6\u05e2 \u05d2\u05dd \u05d4\u05d5\u05d0 \u05d1\u05d9\u05d3\u05d5 \u05d5\u05e8\u05d2\u05dc\u05d5 \u05d5\u05e7\u05d9\u05d1\u05dc \u05d2\u05dd \u05db\u05df \u05d8\u05d9\u05e4\u05d5\u05dc \u05e8\u05e4\u05d5\u05d0\u05d9. \u05d1\u05de\u05e9\u05d8\u05e8\u05d4 \u05de\u05d2\u05d3\u05d9\u05e8\u05d9\u05dd \u05d0\u05ea \u05d4\u05de\u05e7\u05e8\u05d4 \u05db\"\u05de\u05e7\u05e8\u05d4 \u05e7\u05d9\u05e6\u05d5\u05e0\u05d9 \u05e9\u05dc \u05de\u05d7\u05d0\u05d4 \u05e4\u05d5\u05dc\u05d9\u05d8\u05d9\u05ea\"@N12chat"],["\u05d6\u05d5\u05db\u05e8\u05d9\u05dd \u05d0\u05ea \u05d4\u05d0\u05d9\u05d9\u05d8\u05dd \u261d\ufe0f\u05e9\u05d1\u05d5 \u05e7\u05e8\u05d0\u05d5 \u05d0\u05d5\u05d4\u05d3\u05d9 \u05d7\u05d1\u05e8\u05ea \u05e4\u05e8\u05e1\u05e4\u05d5\u05dc\u05d9\u05e1 \u05d4\u05d0\u05d9\u05e8\u05d0\u05e0\u05d9\u05ea \u05dc\u05de\u05e9\u05d8\u05e8 \u05dc\u05d3\u05d7\u05d5\u05e3 \u05d0\u05ea \u05d3\u05d2\u05dc \u05e4\u05dc\u05e1\u05d8\u05d9\u05df \u05dc\u05d9\u05e9\u05d1\u05df?",false,861,"\u05d6\u05d5\u05db\u05e8\u05d9\u05dd \u05d0\u05ea \u05d4\u05d0\u05d9\u05d9\u05d8\u05dd \u261d\ufe0f\u05e9\u05d1\u05d5 \u05e7\u05e8\u05d0\u05d5 \u05d0\u05d5\u05d4\u05d3\u05d9 \u05d7\u05d1\u05e8\u05ea \u05e4\u05e8\u05e1\u05e4\u05d5\u05dc\u05d9\u05e1 \u05d4\u05d0\u05d9\u05e8\u05d0\u05e0\u05d9\u05ea \u05dc\u05de\u05e9\u05d8\u05e8 \u05dc\u05d3\u05d7\u05d5\u05e3 \u05d0\u05ea \u05d3\u05d2\u05dc \u05e4\u05dc\u05e1\u05d8\u05d9\u05df \u05dc\u05d9\u05e9\u05d1\u05df?"],["\u05e9\u05dc\u05d5\u05e9\u05ea \u05d4\u05d4\u05e8\u05d5\u05d2\u05d9\u05dd \"\u05d4\u05e1\u05d5\u05e8\u05d9\u05dd\" \u05d1\u05ea\u05e7\u05d9\u05e4\u05d4 \u05d1\u05d3\u05de\u05e9\u05e7 \u05d4\u05d1\u05d5\u05e7\u05e8 :\u05e2\u05d1\u05d3 \u05d0\u05dc\u05db\u05e8\u05d9\u05dd \u05e9\u05de\u05e1\u05d7\u05e1\u05d0\u05dd \u05d0\u05dc\u05d7'\u05dc\u05e4\u05d4\u05e2\u05e7\u05d9\u05dc \u05d1\u05d4\u05d6\u05d3\u05d9\u05d0\u05df (\u05dc\u05d0 \u05d4\u05e9\u05dd \u05d4\u05e1\u05d5\u05e8\u05d9 \"\u05d4\u05e7\u05dc\u05d0\u05e1\u05d9\", \u05d0\u05d5\u05de\u05e8 \u05d6\u05d0\u05ea \u05db\u05da...)",false,862,"\u05e9\u05dc\u05d5\u05e9\u05ea \u05d4\u05d4\u05e8\u05d5\u05d2\u05d9\u05dd \"\u05d4\u05e1\u05d5\u05e8\u05d9\u05dd\" \u05d1\u05ea\u05e7\u05d9\u05e4\u05d4 \u05d1\u05d3\u05de\u05e9\u05e7 \u05d4\u05d1\u05d5\u05e7\u05e8 :\u05e2\u05d1\u05d3 \u05d0\u05dc\u05db\u05e8\u05d9\u05dd \u05e9\u05de\u05e1\u05d7\u05e1\u05d0\u05dd \u05d0\u05dc\u05d7'\u05dc\u05e4\u05d4\u05e2\u05e7\u05d9\u05dc \u05d1\u05d4\u05d6\u05d3\u05d9\u05d0\u05df (\u05dc\u05d0 \u05d4\u05e9\u05dd \u05d4\u05e1\u05d5\u05e8\u05d9 \"\u05d4\u05e7\u05dc\u05d0\u05e1\u05d9\", \u05d0\u05d5\u05de\u05e8 \u05d6\u05d0\u05ea \u05db\u05da...)"],["\u05d0\u05d3\u05e8 \u05d2\u05d9\u05e6\u05d9\u05e1\u05d0\u05d6\u05e2\u05e7\u05d5\u05ea \u05d1\u05e0\u05d8\u05d5\u05e2\u05d4@N12chat",false,863,"\u05d0\u05d3\u05e8 \u05d2\u05d9\u05e6\u05d9\u05e1\u05d0\u05d6\u05e2\u05e7\u05d5\u05ea \u05d1\u05e0\u05d8\u05d5\u05e2\u05d4@N12chat"],["\u05e2\u05e0\u05d1\u05e8 \u05d8\u05d5\u05d9\u05d6\u05e8\u05d7\u05d5\u05d1\u05e9 \u05de\u05d3\"\u05d0 \u05d9\u05d5\u05e1\u05e3 \u05d7\u05d9\u05d9\u05dd \u05d9\u05e9\u05e8\u05d0\u05dc\u05d9 \u05e9\u05d4\u05d2\u05d9\u05e2 \u05dc\u05d6\u05d9\u05e8\u05ea \u05d4\u05e4\u05d9\u05d2\u05d5\u05e2 \u05e1\u05d9\u05e4\u05e8: \"\u05db\u05e9\u05d4\u05d2\u05e2\u05e0\u05d5 \u05dc\u05de\u05e7\u05d5\u05dd \u05e8\u05d0\u05d9\u05e0\u05d5 \u05d0\u05ea \u05e9\u05e0\u05d9 \u05d4\u05e4\u05e6\u05d5\u05e2\u05d9\u05dd \u05db\u05e9\u05d4\u05dd \u05d1\u05d4\u05db\u05e8\u05d4. \u05d4\u05e2\u05e0\u05e7\u05e0\u05d5 \u05dc\u05d4\u05dd \u05d8\u05d9\u05e4\u05d5\u05dc \u05e8\u05e4\u05d5\u05d0\u05d9 \u05e8\u05d0\u05e9\u05d5\u05e0\u05d9 \u05e9\u05db\u05dc\u05dc \u05e2\u05e6\u05d9\u05e8\u05ea \u05d3\u05d9\u05de\u05d5\u05de\u05d9\u05dd, \u05d7\u05d1\u05d9\u05e9\u05d5\u05ea \u05d5\u05de\u05ea\u05df \u05 \u05e2\u05d6\u05d4. \u05d0\u05e0\u05d7\u05e0\u05d5 \u05e7\u05d5\u05e8\u05d0\u05d9\u05dd \u05dc\u05d3\u05d9\u05d0\u05dc\u05d5\u05d2 \u05e4\u05ea\u05d5\u05d7 \u05e2\u05dd \u05d4\u05ea\u05d9\u05de\u05e0\u05d9\u05dd \u05d5\u05dc\u05db\u05d1\u05d3 \u05d0\u05ea \u05d4\u05d7\u05d5\u05e7 \u05d4\u05d1\u05d9\u05df-\u05dc\u05d0\u05d5\u05de\u05d9\"@N12chat"],["\u05d1\u05df \u05d2\u05d5\u05dc\u05d3\u05e4\u05e8\u05d9\u05d9\u05e0\u05d3\u05e8\u05e4\u05d0\u05dc \u05e0\u05d3\u05d0\u05dc \u05de\u05db\u05e8\u05d9\u05d6: \"\u05e1\u05d9\u05db\u05d5\u05d9 \u05d8\u05d5\u05d1 \u05de\u05d0\u05d5\u05d3 \u05e9\u05d6\u05d5 \u05d4\u05e9\u05e0\u05d4 \u05d4\u05d0\u05d7\u05e8\u05d5\u05e0\u05d4 \u05e9\u05dc\u05d9 \u05db\u05e9\u05d7\u05e7\u05df. \u05d7\u05e9\u05d1\u05ea\u05d9 \u05e9\u05db\u05d1\u05e8 \u05dc\u05d0 \u05d4\u05d2\u05d9\u05d5\u05e0\u05d9 \u05e9\u05d0\u05d7\u05d6\u05d5\u05e8\". \u05d1\u05e2\u05d5\u05d3 \u05e9\u05dc\u05d5\u05e9\u05d4 \u05e9\u05d1\u05d5\u05e2\u05d5\u05ea \u05d9\u05d7\u05d6\u05d5\u05e8 \u05dc\u05e9\u05d7\u05e7 \u05dc\u05e8\u05d0\u05e9\u05d5\u05e0\u05d4 \u05d6\u05d4 \u05e9\u05e0\u05d4 \u05d1\u05d0\u05d5\u05e1\u05d8\u05e8\u05dc\u05d9\u05d4@N12chat",false,904,"\u05d1\u05df \u05d2\u05d5\u05dc\u05d3\u05e4\u05e8\u05d9\u05d9\u05e0\u05d3\u05e8\u05e4\u05d0\u05dc \u05e0\u05d3\u05d0\u05dc \u05de\u05db\u05e8\u05d9\u05d6: \"\u05e1\u05d9\u05db\u05d5\u05d9 \u05d8\u05d5\u05d1 \u05de\u05d0\u05d5\u05d3 \u05e9\u05d6\u05d5 \u05d4\u05e9\u05e0\u05d4 \u05d4\u05d0\u05d7\u05e8\u05d5\u05e0\u05d4 \u05e9\u05dc\u05d9 \u05db\u05e9\u05d7\u05e7\u05df. \u05d7\u05e9\u05d1\u05ea\u05d9 \u05e9\u05db\u05d1\u05e8 \u05dc\u05d0 \u05d4\u05d2\u05d9\u05d5\u05e0\u05d9 \u05e9\u05d0\u05d7\u05d6\u05d5\u05e8\". \u05d1\u05e2\u05d5\u05d3 \u05e9\u05dc\u05d5\u05e9\u05d4 \u05e9\u05d1\u05d5\u05e2\u05d5\u05ea \u05d9\u05d7\u05d6\u05d5\u05e8 \u05dc\u05e9\u05d7\u05e7 \u05dc\u05e8\u05d0\u05e9\u05d5\u05e0\u05d4 \u05d6\u05d4 \u05e9\u05e0\u05d4 \u05d1\u05d0\u05d5\u05e1\u05d8\u05e8\u05dc\u05d9\u05d4@N12chat"],["\u05d9\u05d5\u05e0\u05d4 \u 2\u05d4... \u05dc\u05d7\u05d5\u05d1\u05d1\u05d9 \u05d4\u05d6'\u05d0\u05e0\u05e8.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd \u05de\u05d3\u05d5\u05d5\u05d7\u05d9\u05dd \u05e2\u05dc \u05ea\u05e7\u05d9\u05e4\u05d5\u05ea \"\u05d7\u05d2\u05d5\u05e8\u05ea \u05d0\u05e9\" \u05db\u05e8\u05d2\u05e2 \u05d1\u05e7\u05e8\u05d1\u05ea \u05d1\u05d9\u05ea \u05d4\u05d7\u05d5\u05dc\u05d9\u05dd \u05d4\u05d0\u05d9\u05e0\u05d3\u05d5\u05e0\u05d6\u05d9 \u05d1\u05e6\u05e4\u05d5\u05df \u05d4\u05e8\u05e6\u05d5\u05e2\u05d4.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,909,"\u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd \u05de\u05d3\u05d5\u05d5\u05d7\u05d9\u05dd \u05e2\u05dc \u05ea\u05e7\u05d9\u05e4\u05d5\u05ea \"\u05d7\u05d2\u05d5\u05e8\u05ea \u05d0\u05e9\" \u05db\u05e8\u05d2\u05e2 \u05d1\u05e7\u05e8\u05d1\u05ea \u05d1\u05d9\u05ea \u05d4\u05d7\u05d5\u05dc\u05d9\u05dd \u05d4\u05d0\u05d9\u05e0\u05d3\u05d5\u05e0\u05d6\u05d9 \u05d1\u05e6\u05e4\u05d5\u05df \u05d4\u05e8\u05e6\u05d5\u05e2\u05d4.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05de\u05d1\u05d6\u05e7\u05df 12\u05d9\u05dc\u05d3\u05d4 \u05d1\u05ea 8 \u05e0\u05e4\u05e6\u05e2\u05d4 \u05d1\u05d9\u05e0\u05d5\u05e0\u05d9 \u05db\u05ea\u05d5\u05e6\u05d0\u05d4 \u05de\u05e4\u05d2\u05d9\u05e2\u05ea \u05e8\u05db\u05d1 \u05d1\u05e8\u05d7\u05d5\u05d1 \u05d0\u05d4\u05e8\u05d5\u05e0\u05d5\u05d1\u05d9\u05e5' \u05d1\u05d1\u05e0\u05d9 \u05d1\u05e8\u05e7. \u05e6\u05d5\u05d5\u05ea \u05de\u05d3\"\u05d0 \u05e4\u05d9\u05e0\u05d4 \u05d0\u05d5\u05ea\u05d4 \u05dc\u05d1\u05d9\u05ea \u05d4\u05d7\u05d5\u05dc\u05d9\u05dd \u05e1\u05e4\u05e8\u05d0 \u05d1\u05e9\u05d9\u05d1\u05d0 \u05ea\u05dc \u05d4\u05e9\u05d5\u05de\u05e8 \u05e2\u05dd \u05d7\u05d1\u05dc\u05d5\u05ea \u05d1\u05e8\u05d0\u05e9 \u05d5\u05d1\u05d2\u05e4\u05d9\u05d9\u05dd@N12chat",false,910,"\u05de\u05d1\u05d6\u05e7\u05df 12\u05d9\u05dc\u05d3\u05d4 \u05d1\u05ea 8 \u05e0\u05e4\u05e6\u05e2\u05d4 \u05d1\u05d9\u05e0\u05d5\u05e0\u05d9 \u05db\u05ea\u05d5\u05e6\u05d0\u05d4 \u05de\u05e4\u05d2\u05d9\u05e2\u05ea \u05e8\u05db\u05d1 \u05d1\u05e8\u05d7\u05d5\u05d1 \u05d0\u05d4\u05e8\u05d5\u05e0\u05d5\u05d1\u05d9\u05e5' \u05d1\u05d1\u05e0\u05d9 \u05d1\u05e8\u05e7. \u05e6\u05d5\u05d5\u05ea \u05de\u05d3\"\u05d0 \u05e4\u05d9\u05e0\u05d4 \u05d0\u05d5\u05ea\u05d4 \u05dc\u05d1\u05d9\u05ea \u05d4\u05d7\u05d5\u05dc\u05d9\u05dd \u05e1\u05e4\u05e8\u05d0 \u05d1\u05e9\u05d9\u05d1\u05d0 \u05ea\u05dc \u05d4\u05e9\u05d5\u05de\u05e8 \u05e2\u05dd \u05d7\u05d1\u05dc\u05d5\u05ea \u05d1\u05e8\u05d0\u05e9 \u05d5\u05d1\u05d2\u05e4\u05d9\u05d9\u05dd@N12chat"],["\u05d3\u05d5\u05d1\u05e8 \u05e6\u05d4\u05f4\u05dc:\u05e6\u05d4\u05f4\u05dc \u05ea\u05e7\u05e3 \u05dc\u05e4\u05e0\u05d9 \u05d6\u05de\u05df \u05e7\u05e6\u05e8 \u05de\u05d7\u05d1\u05dc\u05d9\u05dd \u05d5\u05e2\u05e9\u05e8\u05d5\u05ea \u05de\u05e9\u05d2\u05e8\u05d9\u05dd \u05d5\u05ea\u05e9\u05ea\u05d9\u05d5\u05ea \u05e9\u05dc \u05d0\u05e8\u05d2\u05d5\u05df \u05d4\u05d8\u05e8\u05d5\u05e8 \u05d7\u05d9\u05d6\u05d1\u05d0\u05dc\u05dc\u05d4 \u05d1\u05e8\u05d7\u05d1\u05d9 \u05dc\u05d1\u05e0\u05d5\u05df\u05de\u05d8\u05d5\u05e1\u05d9 \u05e7\u05e8\u05d1 \u05e9\u05dc \u05d7\u05d9\u05dc \u05d4\u05d0\u05d5\u05d5\u05d9\u05e8 \u05ea\u05e7\u05e4\u05d5 \u05dc\u05e4\u05e0\u05d9 \u05d6\u05de\u05df \u05e7\u05e6\u05e8 \u05de\u05d7\u05d1\u05dc\u05d9\u05dd, \u05e2\u05e9\u05e8\u05d5\u05ea \u05de\u05e9\u05d2\u05e8\u05d9\u05dd \u05d5\u05ea\u05e9\u05ea\u05d9\u05d5\u05ea \u05e9\u05dc \u05d0\u05e8\u05d2\u05d5\u05df \u05d4\u05d8\u05e8\u05d5\u05e8 \u05d7\u05d9\u05d6\u05d1\u05d0\u05dc\u05dc\u05d4 \u05d1\u05e8\u05d7\u05d1\u05d9 \u05dc\u05d1\u05e0\u05d5\u05df. \u05d1\u05e0\u05d5\u05e1\u05e3, \u05de\u05d8\u05d5\u05e1\u05d9 \u05e7\u05e8\u05d1 \u05ea\u05e7\u05e4\u05d5 \u05d1\u05de\u05e8\u05d7\u05d1 \u05d1\u05e8\u05e2\u05f3\u05d6 \u05e9\u05d1\u05d3\u05e8\u05d5\u05dd \u05dc\u05d1\u05e0\u05d5\u05df \u05d0\u05ea \u05d4\u05de\u05e9\u05d2\u05e8 \u05de\u05de\u05e0\u05d5 \u05d1\u05d5\u05e6\u05e2\u05d5 \u05e9\u05e0\u05d9 \u05d4\u05e9\u05d9\u05d2\u05d5\u05e8\u05d9\u05dd \u05dc\u05e2\u05d1\u05e8 \u05d4\u05e8 \u05d3\u05d1, \u05d6\u05de\u05df \u05e7\u05e6\u05e8 \u05dc\u05d0\u05d7\u05e8 \u05d4\u05d9\u05e8\u05d9.3 \u05ea\u05d2\u05d5\u05d1\u05d5\u05ea",false,911,"\u05d3\u05d5\u05d1\u05e8 \u05e6\u05d4\u05f4\u05dc:\u05e6\u05d4\u05f4\u05dc \u05ea\u05e7\u05e3 \u05dc\u05e4\u05e0\u05d9 \u05d6\u05de\u05df \u05e7\u05e6\u05e8 \u05de\u05d7\u05d1\u05dc\u05d9\u05dd \u05d5\u05e2\u05e9\u05e8\u05d5\u05ea \u05de\u05e9\u05d2\u05e8\u05d9\u05dd \u05d5\u05ea\u05e9\u05ea\u05d9\u05d5\u05ea \u05e9\u05dc \u05d0\u05e8\u05d2\u05d5\u05df \u05d4\u05d8\u05e8\u05d5\u05e8 \u05d7\u05d9\u05d6\u05d1\u05d0\u05dc\u05dc\u05d4 \u05d1\u05e8\u05d7\u05d1\u05d9 \u05dc\u05d1\u05e0\u05d5\u05df\u05de\u05d8\u05d5\u05e1\u05d9 \u05e7\u05e8\u05d1 \u05e9\u05dc \u05d7\u05d9\u05dc \u05d4\u05d0\u05d5\u05d5\u05d9\u05e8 \u05ea\u05e7\u05e4\u05d5 \u05dc\u05e4\u05e0\u05d9 \u05d6\u05de\u05df \u05e7\u05e6\u05e8 \u05de\u05d7\u05d1\u05dc\u05d9\u05dd, \u05e2\u05e9\u05e8\u05d5\u05ea \u05de\u05e9\u05d2\u05e8\u05d9\u05dd \u05d5\u05ea\u05e9\u05ea\u05d9\u05d5\u05ea \u05e9\u05dc \u05d0\u05e8\u05d2\u05d5\u05df \u05d4\u05d8\u05e8\u05d5\u05e8 \u05d7\u05d9\u05d6\u05d1\u05d0\u05dc\u05dc\u05d4 \u05d1\u05e8\u05d7\u05d1\u05d9 \u05dc\u05d1\u05e0\u05d5\u05df. \u05d1\u05e0\u05d5\u05e1\u05e3, \u05de\u05d8\u05d5\u05e1\u05d9 \u05e7\u05e8\u05d1 \u05ea\u05e7\u05e4\u05d5 \u05d1\u05de\u05e8\u05d7\u05d1 \u05d1\u05e8\u05e2\u05f3\u05d6 \u05e9\u05d1\u05d3\u05e8\u05d5\u05dd \u05dc\u05d1\u05e0\u05d5\u05df \u05d0\u05ea \u05d4\u05de\u05e9\u05d2\u05e8 \u05de\u05de\u05e0\u05d5 \u05d1\u05d5\u05e6\u05e2\u05d5 \u05e9\u05e0\u05d9 \u05d4\u05e9\u05d9\u05d2\u05d5\u05e8\u05d9\u05dd \u05dc\u05e2\u05d1\u05e8 \u05d4\u05e8 \u05d3\u05d1, \u05d6\u05de\u05df \u05e7\u05e6\u05e8 \u05dc\u05d0\u05d7\u05e8 \u05d4\u05d9\u05e8\u05d9.3 \u05ea\u05d2\u05d5\u05d1\u05d5\u05ea"],["\u05e1\u05e4\u05d9\u05e8 \u05dc\u05d9\u05e4\u05e7\u05d9\u05df\u05de\u05ea\u05d7\u05d9\u05dc\u05ea \u05d4\u05de\u05dc\u05d7\u05de\u05d4: \u05e0\u05db\u05e0\u05e1\u05d5 \u05dc\u05e8\u05e6\u05d5\u05e2\u05ea \u05e2\u05d6\u05d4 9,514 \u05de\u05e9\u05d0\u05d9\u05d5\u05ea \u05e9\u05dc \u05e1\u05d9\u05d5\u05e2 \u05d4\u05d5\u05de\u05e0\u05d9\u05d8\u05e8\u05d9 - \u05db-175 \u05d0\u05dc\u05e3 \u05d8\u05d5\u05e0\u05d5\u05ea \u05e9\u05dc \u05de\u05d6\u05d5\u05df, \u05de\u05d9\u05dd, \u05e6\u05d9\u05d5\u05d3 \u05e8\u05e4\u05d5\u05d0\u05d9, \u05ea\u05e8\u05d5\u05e4\u05d5\u05ea \u05d5\u05e6\u05d9\u05d5\u05d3 \u05de\u05d7\u05e1\u05d4@N12chat",false,912,"\u05e1\u05e4\u05d9\u05e8 \u05dc\u05d9\u05e4\u05e7\u05d9\u05df\u05de\u05ea\u05d7\u05d9\u05dc\u05ea \u05d4\u05de\u05dc\u05d7\u05de\u05d4: \u05e0\u05db\u05e0\u05e1\u05d5 \u05dc\u05e8\u05e6\u05d5\u05e2\u05ea \u05e2\u05d6\u05d4 9,514 \u05de\u05e9\u05d0\u05d9\u05d5\u05ea \u05e9\u05dc \u05e1\u05d9\u05d5\u05e2 \u05d4\u05d5\u05de\u05e0\u05d9\u05d8\u05e8\u05d9 - \u05db-175 \u05d0\u05dc\u05e3 \u05d8\u05d5\u05e0\u05d5\u05ea \u05e9\u05dc \u05de\u05d6\u05d5\u05df, \u05de\u05d9\u05dd, \u05e6\u05d9\u05d5\u05d3 \u05e8\u05e4\u05d5\u05d0\u05d9, \u05ea\u05e8\u05d5\u05e4\u05d5\u05ea \u05d5\u05e6\u05d9\u05d5\u05d3 \u05de\u05d7\u05e1\u05d4@N12chat"],["\u05d3\u05e1\u05e7 \u05d4\u05d7\u05d5\u05e5\u05de\u05e4\u05d9\u05e7\u05d5\u05d3 \u05d4\u05de\u05e8\u05db\u05d6 \u05e9\u05dc \u05e6\u05d1\u05d0 \u05d0\u05e8\u05d4\"\u05d1 \u05e0\u05de\u05e1\u05e8 \u05db\u05d9 \u05d4\u05de\u05d5\u05e8\u05d3\u05d9\u05dd \u05de\u05ea\u05d9\u05de\u05df \u05e9\u05d9\u05d2\u05e8\u05d5 \u05d8\u05d9\u05dc \u05d1\u05dc\u05d9\u05e1\u05d8\u05d9 \u05e0\u05d2\u05d3 \u05e1\u05e4\u05d9\u05e0\u05d5\u05ea \u05d1\u05de\u05e4\u05e8\u05e5 \u05e2\u05d3\u05df. \u05d4\u05d8\u05d9\u05dc \u05db\u05db\u05dc \u05d4\u05e0\u05e8\u05d0\u05d4 \u05db\u05d5\u05d5\u05df \u05d0\u05dc \u05d4-Torm Thor, \u05de\u05db\u05dc\u05d9\u05ea \u05db\u05d9\u05de\u05d9\u05e7\u05dc\u05d9\u05dd \u05d1\u05d1\u05e2\u05dc\u05d5\u05ea \u05d0\u05e8\u05d4\"\u05d1 \u05e9\u05d0\u05e3 \u05e0\u05d5\u05e9\u05d0\u05ea \u05d0\u05ea \u05d3\u05d2\u05dc\u05d4. \u05d4\u05d8\u05d9\u05dc \u05e0\u05d7\u05ea \u05d1\u05de\u05d9\u05dd - \u05dc\u05d0 \u05d4\u05d9\u05d5 \u05e0\u05e4\u05d2\u05e2\u05d9\u05dd \u05d5\u05dc\u05d0 \u05e0\u05d2\u05e8\u05dd \u05e0\u05d6\u05e7 \u05dc\u05de\u05db\u05dc\u05d9\u05ea. \u05d1\u05e0\u05d5\u05e1\u05e3, \u05db\u05d5\u05d7\u05d5\u05ea \u05d0\u05de\u05e8\u05d9\u05e7\u05e0\u05d9\u05d9\u05dd \u05d4\u05e4\u05d9\u05dc\u05d5 \u05de\u05d5\u05e7\u05d3\u05dd \u05d9\u05d5\u05ea\u05e8 \u05e9\u05e0\u05d9 \u05db\u05d8\u05d1\"\u05de\u05d9\u05dd \u05d1\u05d3\u05e8\u05d5\u05dd \u05d4\u05d9\u05dd \u05d4\u05d0\u05d3\u05d5\u05dd. \u05db\u05d8\u05d1\"\u05dd \u05e9\u05dc\u05d9\u05e9\u05d9 \u05e9\u05e9\u05d5\u05d2\u05e8 \u05d2\u05dd \u05d4\u05d5\u05d0 - \u05d4\u05ea\u05e8\u05e1\u05e7@N12chat",false,913,"\u05d3\u05e1\u05e7 \u05d4\u05d7\u05d5\u05e5\u05de\u05e4\u05d9\u05e7\u05d5\u05d3 \u05d4\u05de\u05e8\u05db\u05d6 \u05e9\u05dc \u05e6\u05d1\u05d0 \u05d0\u05e8\u05d4\"\u05d1 \u05e0\u05de\u05e1\u05e8 \u05db\u05d9 \u05d4\u05de\u05d5\u05e8\u05d3\u05d9\u05dd \u05de\u05ea\u05d9\u05de\u05df \u05e9\u05d9\u05d2\u05e8\u05d5 \u05d8\u05d9\u05dc \u05d1\u05dc\u05d9\u05e1\u05d8\u05d9 \u05e0\u05d2\u05d3 \u05e1\u05e4\u05d9\u05e0\u05d5\u05ea \u05d1\u05de\u05e4\u05e8\u05e5 \u05e2\u05d3\u05df. \u05d4\u05d8\u05d9\u05dc \u05db\u05db\u05dc \u05d4\u05e0\u05e8\u05d0\u05d4 \u05db\u05d5\u05d5\u05df \u05d0\u05dc \u05d4-Torm Thor, \u05de\u05db\u05dc\u05d9\u05ea \u05db\u05d9\u05de\u05d9\u05e7\u05dc\u05d9\u05dd \u05d1\u05d1\u05e2\u05dc\u05d5\u05ea \u05d0\u05e8\u05d4\"\u05d1 \u05e9\u05d0\u05e3 \u05e0\u05d5\u05e9\u05d0\u05ea \u05d0\u05ea \u05d3\u05d2\u05dc\u05d4. \u05d4\u05d8\u05d9\u05dc \u05e0\u05d7\u05ea \u05d1\u05de\u05d9\u05dd - \u05dc\u05d0 \u05d4\u05d9\u05d5 \u05e0\u05e4\u05d2\u05e2\u05d9\u05dd \u05d5\u05dc\u05d0 \u05e0\u05d2\u05e8\u05dd \u05e0\u05d6\u05e7 \u05dc\u05de\u05db\u05dc\u05d9\u05ea. \u05d1\u05e0\u05d5\u05e1\u05e3, \u05db\u05d5\u05d7\u05d5\u05ea \u05d0\u05de\u05e8\u05d9\u05e7\u05e0\u05d9\u05d9\u05dd \u05d4\u05e4\u05d9\u05dc\u05d5 \u05de\u05d5\u05e7\u05d3\u05dd \u05d9\u05d5\u05ea\u05e8 \u05e9\u05e0\u05d9 \u05db\u05d8\u05d1\"\u05de\u05d9\u05dd \u05d1\u05d3\u05e8\u05d5\u05dd \u05d4\u05d9\u05dd \u05d4\u05d0\u05d3\u05d5\u05dd. \u05db\u05d8\u05d1\"\u05dd \u05e9\u05dc\u05d9\u05e9\u05d9 \u05e9\u05e9\u05d5\u05d2\u05e8 \u05d2\u05dd \u05d4\u05d5\u05d0 - \u05d4\u05ea\u05e8\u05e1\u05e7@N12chat"],["\u05d0\u05d5\u05e8 \u05e8\u05d1\u05d9\u05d3\u05ea\u05d5\u05e9\u05d1 \u05e4\u05ea\u05d7 \u05ea\u05e7\u05d5\u05d5\u05d4 \u05db\u05d1\u05df 40 \u05d4\u05de\u05d5\u05e2\u05e1\u05e7 \u05db\u05de\u05d5\u05e8\u05d4 \u05d1\u05d1\u05d9\u05ea \u05e1\u05e4\u05e8 \u05ea\u05d9\u05db\u05d5\u05df \u05d1\u05e2\u05d9\u05e8 \u05e0\u05e2\u05e6\u05e8 \u05d1\u05d7\u05e9\u05d3 \u05e9\u05d1\u05d9\u05e6\u05e2 \u05de\u05e2\u05e9\u05d4 \u05de\u05d2\u05d5\u05e0\u05d4 \u05d1\u05ea\u05dc\u05de\u05d9\u05d3\u05d4 \u05e9\u05dc\u05d5 \u05d1\u05e2\u05ea \u05e9\u05d9\u05e2\u05d5\u05e8 \u05e4\u05e8\u05d8\u05e0\u05d9 \u05d1\u05db\u05d9\u05ea\u05d4 \u05dc\u05e4\u05e0\u05d9 \u05db\u05e9\u05e0\u05d4. \u05de\u05e2\u05e6\u05e8\u05d5 \u05d4\u05d5\u05d0\u05e8\u05da \u05d1\u05e1\u05d5\u05e3 \u05d4\u05e9\u05d1\u05d5\u05e2 \u05e2\u05d3 \u05dc\u05de\u05d7\u05e8 - \u05d4\u05de\u05e9\u05d8\u05e8\u05d4 \u05e7\u05d5\u05e8\u05d0\u05ea \u05dc\u05db\u05dc \u05de\u05d9 \u05e9\u05e0\u05e4\u05d2\u05e2\u05d4 \u05de\u05d4\u05de\u05d5\u05e8\u05d4 \u05dc\u05d4\u05d2\u05d9\u05e2 \u05dc\u05ea\u05d7\u05e0\u05ea \u05d4\u05de\u05e9\u05d8\u05e8\u05d4 \u05d5\u05dc\u05d4\u05ea\u05dc\u05d5\u05e0\u05df \u05e0\u05d2\u05d3\u05d5@N12chat",false,914,"\u05d0\u05d5\u05e8 \u05e8\u05d1\u05d9\u05d3\u05ea\u05d5\u05e9\u05d1 \u05e4\u05ea\u05d7 \u05ea\u05e7\u05d5\u05d5\u05d4 \u05db\u05d1\u05df 40 \u05d4\u05de\u05d5\u05e2\u05e1\u05e7 \u05db\u05de\u05d5\u05e8\u05d4 \u05d1\u05d1\u05d9\u05ea \u05e1\u05e4\u05e8 \u05ea\u05d9\u05db\u05d5\u05df \u05d1\u05e2\u05d9\u05e8 \u05e0\u05e2\u05e6\u05e8 \u05d1\u05d7\u05e9\u05d3 \u05e9\u05d1\u05d9\u05e6\u05e2 \u05de\u05e2\u05e9\u05d4 \u05de\u05d2\u05d5\u05e0\u05d4 \u05d1\u05ea\u05dc\u05de\u05d9\u05d3\u05d4 \u05e9\u05dc\u05d5 \u05d1\u05e2\u05ea \u05e9\u05d9\u05e2\u05d5\u05e8 \u05e4\u05e8\u05d8\u05e0\u05d9 \u05d1\u05db\u05d9\u05ea\u05d4 \u05dc\u05e4\u05e0\u05d9 \u05db\u05e9\u05e0\u05d4. \u05de\u05e2\u05e6\u05e8\u05d5 \u05d4\u05d5\u05d0\u05e8\u05da \u05d1\u05e1\u05d5\u05e3 \u05d4\u05e9\u05d1\u05d5\u05e2 \u05e2\u05d3 \u05dc\u05de\u05d7\u05e8 - \u05d4\u05de\u05e9\u05d8\u05e8\u05d4 \u05e7\u05d5\u05e8\u05d0\u05ea \u05dc\u05db\u05dc \u05de\u05d9 \u05e9\u05e0\u05e4\u05d2\u05e2\u05d4 \u05de\u05d4\u05de\u05d5\u05e8\u05d4 \u05dc\u05d4\u05d2\u05d9\u05e2 \u05dc\u05ea\u05d7\u05e0\u05ea \u05d4\u05de\u05e9\u05d8\u05e8\u05d4 \u05d5\u05dc\u05d4\u05ea\u05dc\u05d5\u05e0\u05df \u05e0\u05d2\u05d3\u05d5@N12chat"],["\u05de\u05d1\u05d6\u05e7\u05df 12\ud83d\udcdd\u05de\u05e9\u05d0\u05d9\u05ea \u05d4\u05ea\u05d4\u05e4\u05db\u05d4 \u05d1\u05e8\u05d7\u05d5\u05d1 \u05d4\u05d0\u05d9\u05d9\u05dc\u05d5\u05ea \u05d1\u05d2\u05d1\u05e2\u05ea \u05d6\u05d0\u05d1 - \u05d2\u05d1\u05e8 \u05db\u05d1\u05df 40 \u05e0\u05e4\u05e6\u05e2 \u05d1\u05d9\u05e0\u05d5\u05e0\u05d9 \u05d5\u05e1\u05d5\u05d1\u05dc \u05de\u05d7\u05d1\u05dc\u05ea \u05e8\u05d0\u05e9 \u05d5\u05d0\u05d3\u05dd \u05d0\u05d7\u05e8 \u05e0\u05e4\u05e6\u05e2 \u05e7\u05dc. \u05e6\u05d5\u05d5\u05ea\u05d9 \u05de\u05d3\"\u05d0 \u05e9\u05d4\u05d2\u05d9\u05e2\u05d5 \u05dc\u05de\u05e7\u05d5\u05dd \u05d8\u05d9\u05e4\u05dc\u05d5 \u05d1\u05d4\u05dd \u05d5\u05e4\u05d9\u05e0\u05d5 \u05d0\u05d5\u05ea\u05dd \u05dc\u05d1\u05d9\u05ea \u05d4\u05d7\u05d5\u05dc\u05d9\u05dd \u05e9\u05e2\u05e8\u05d9 \u05e6\u05d3\u05e7@N12chat",false,915,"\u05de\u05d1\u05d6\u05e7\u05df 12\ud83d\udcdd\u05de\u05e9\u05d0\u05d9\u05ea \u05d4\u05ea\u05d4\u05e4\u05db\u05d4 \u05d1\u05e8\u05d7\u05d5\u05d1 \u05d4\u05d0\u05d9\u05d9\u05dc\u05d5\u05ea \u05d1\u05d2\u05d1\u05e2\u05ea \u05d6\u05d0\u05d1 - \u05d2\u05d1\u05e8 \u05db\u05d1\u05df 40 \u05e0\u05e4\u05e6\u05e2 \u05d1\u05d9\u05e0\u05d5\u05e0\u05d9 \u05d5\u05e1\u05d5\u05d1\u05dc \u05de\u05d7\u05d1\u05dc\u05ea \u05e8\u05d0\u05e9 \u05d5\u05d0\u05d3\u05dd \u05d0\u05d7\u05e8 \u05e0\u05e4\u05e6\u05e2 \u05e7\u05dc. \u05e6\u05d5\u05d5\u05ea\u05d9 \u05de\u05d3\"\u05d0 \u05e9\u05d4\u05d2\u05d9\u05e2\u05d5 \u05dc\u05de\u05e7\u05d5\u05dd \u05d8\u05d9\u05e4\u05dc\u05d5 \u05d1\u05d4\u05dd \u05d5\u05e4\u05d9\u05e0\u05d5 \u05d0\u05d5\u05ea\u05dd \u05dc\u05d1\u05d9\u05ea \u05d4\u05d7\u05d5\u05dc\u05d9\u05dd \u05e9\u05e2\u05e8\u05d9 \u05e6\u05d3\u05e7@N12chat"],["\u05de\u05d1\u05d6\u05e7\u05df 12\u05d4\u05de\u05e9\u05d8\u05e8\u05d4 \u05e4\u05e2\u05e0\u05d7\u05d4 \u05d4\u05e6\u05ea\u05ea \u05d7\u05e0\u05d5\u05ea \u05e1\u05dc\u05d5\u05dc\u05e8 \u05d1\u05d1\u05d9\u05ea \u05e9\u05de\u05e9: \u05de\u05d4\u05d7\u05e7\u05d9\u05e8\u05d4 \u05e2\u05d5\u05dc\u05d4 \u05db\u05d9 \u05d4\u05d7\u05e9\u05d5\u05d3\u05d9\u05dd \u05d4\u05d2\u05d9\u05e2\u05d5 \u05d1\u05de\u05d5\u05e0\u05d9\u05ea \u05dc\u05d1\u05d9\u05ea \u05e9\u05de\u05e9 \u05db\u05e9\u05d1\u05e8\u05e9\u05d5\u05ea\u05dd \u05d1\u05e7\u05d1\u05d5\u05e7\u05d9 \u05d1\u05e0\u05d6\u05d9\u05df, \u05d4\u05e6\u05d9\u05ea\u05d5 \u05d0\u05ea \u05d7\u05e0\u05d5\u05ea \u05d4\u05e1\u05dc\u05d5\u05dc\u05e8 \u05d5\u05e0\u05de\u05dc\u05d8\u05d5 \u05d7\u05d6\u05e8\u05d4 \u05dc\u05d9\u05e8\u05d5\u05e9\u05dc\u05d9\u05dd. \u05d4\u05dd \u05e0\u05e2\u05e6\u05e8\u05d5 \u05d1\u05d3\u05d9\u05e8\u05ea\u05dd, \u05e9\u05dd \u05d0\u05d9\u05ea\u05e8\u05d5 \u05d4\u05d1\u05dc\u05e9\u05d9\u05dd \u05db\u05de\u05d4 \u05d1\u05e7\u05d1\u05d5\u05e7\u05d9 \u05ea\u05d1\u05e2\u05e8\u05d4 \u05d5\u05e8\u05d9\u05de\u05d5\u05e0\u05d9\u05dd@N12chat",false,916,"\u05de\u05d1\u05d6\u05e7\u05df 12\u05d4\u05de\u05e9\u05d8\u05e8\u05d4 \u05e4\u05e2\u05e0\u05d7\u05d4 \u05d4\u05e6\u05ea\u05ea \u05d7\u05e0\u05d5\u05ea \u05e1\u05dc\u05d5\u05dc\u05e8 \u05d1\u05d1\u05d9\u05ea \u05e9\u05de\u05e9: \u05de\u05d4\u05d7\u05e7\u05d9\u05e8\u05d4 \u05e2\u05d5\u05dc\u05d4 \u05db\u05d9 \u05d4\u05d7\u05e9\u05d5\u05d3\u05d9\u05dd \u05d4\u05d2\u05d9\u05e2\u05d5 \u05d1\u05de\u05d5\u05e0\u05d9\u05ea \u05dc\u05d1\u05d9\u05ea \u05e9\u05de\u05e9 \u05db\u05e9\u05d1\u05e8\u05e9\u05d5\u05ea\u05dd \u05d1\u05e7\u05d1\u05d5\u05e7\u05d9 \u05d1\u05e0\u05d6\u05d9\u05df, \u05d4\u05e6\u05d9\u05ea\u05d5 \u05d0\u05ea \u05d7\u05e0\u05d5\u05ea \u05d4\u05e1\u05dc\u05d5\u05dc\u05e8 \u05d5\u05e0\u05de\u05dc\u05d8\u05d5 \u05d7\u05d6\u05e8\u05d4 \u05dc\u05d9\u05e8\u05d5\u05e9\u05dc\u05d9\u05dd. \u05d4\u05dd \u05e0\u05e2\u05e6\u05e8\u05d5 \u05d1\u05d3\u05d9\u05e8\u05ea\u05dd, \u05e9\u05dd \u05d0\u05d9\u05ea\u05e8\u05d5 \u05d4\u05d1\u05dc\u05e9\u05d9\u05dd \u05db\u05de\u05d4 \u05d1\u05e7\u05d1\u05d5\u05e7\u05d9 \u05ea\u05d1\u05e2\u05e8\u05d4 \u05d5\u05e8\u05d9\u05de\u05d5\u05e0\u05d9\u05dd@N12chat"],["\u05d0\u05d5\u05e8 \u05e8\u05d1\u05d9\u05d3\u05d0\u05d7\u05e8\u05d9 \u05db\u05ea\u05d1 \u05d4\u05d0\u05d9\u05e9\u05d5\u05dd \u05e9\u05d4\u05d5\u05d2\u05e9 \u05e0\u05d2\u05d3 \u05d9\u05e8\u05d3\u05df \u05de\u05df, \u05d1\u05e9\u05e2\u05d4 \u05d6\u05d5 \u05de\u05ea\u05e7\u05d9\u05d9\u05de\u05ea \u05d4\u05e4\u05d2\u05e0\u05d4 \u05de\u05d5\u05dc \u05d1\u05d9\u05ea\u05d4 \u05e9\u05dc \u05d4\u05e9\u05e8\u05d4 \u05e1\u05d9\u05dc\u05de\u05df \u05d1\u05e8\u05d7\u05d5\u05d1\u05d5\u05ea. \u05e7\u05e8\u05d3\u05d9\u05d8: \u05e6\u05d5\u05e4\u05d9\u05ea \u05e4\u05d9\u05e8\u05e1\u05d8@N12chat",false,917,"\u05d0\u05d5\u05e8 \u05e8\u05d1\u05d9\u05d3\u05d0\u05d7\u05e8\u05d9 \u05db\u05ea\u05d1 \u05d4\u05d0\u05d9\u05e9\u05d5\u05dd \u05e9\u05d4\u05d5\u05d2\u05e9 \u05e0\u05d2\u05d3 \u05d9\u05e8\u05d3\u05df \u05de\u05df, \u05d1\u05e9\u05e2\u05d4 \u05d6\u05d5 \u05de\u05ea\u05e7\u05d9\u05d9\u05de\u05ea \u05d4\u05e4\u05d2\u05e0\u05d4 \u05de\u05d5\u05dc \u05d1\u05d9\u05ea\u05d4 \u05e9\u05dc \u05d4\u05e9\u05e8\u05d4 \u05e1\u05d9\u05dc\u05de\u05df \u05d1\u05e8\u05d7\u05d5\u05d1\u05d5\u05ea. \u05e7\u05e8\u05d3\u05d9\u05d8: \u05e6\u05d5\u05e4\u05d9\u05ea \u05e4\u05d9\u05e8\u05e1\u05d8@N12chat"],["\u05e0\u05d9\u05e8 \u05d3\u05d1\u05d5\u05e8\u05d9\u05dc\u05d5\u05d7\u05de\u05d9 \u05e6\u05d4\"\u05dc, \u05e9\u05d1\"\u05db \u05d5\u05de\u05d2\"\u05d1 \u05e2\u05e6\u05e8\u05d5 \u05d1\u05de\u05d4\u05dc\u05da \u05d4\u05dc\u05d9\u05dc\u05d4 \u05e2\u05e9\u05e8\u05d4 \u05de\u05d1\u05d5\u05e7\u05e9\u05d9\u05dd \u05d1\u05e8\u05d7\u05d1\u05d9 \u05d9\u05d4\u05d5\u05d3\u05d4 \u05d5\u05e9\u05d5\u05de\u05e8\u05d5\u05df, \u05ea\u05d7\u05e7\u05e8\u05d5 \u05d7\u05e9\u05d5\u05d3\u05d9\u05dd \u05d5\u05d4\u05d7\u05e8\u05d9\u05de\u05d5 \u05d0\u05de\u05e6\u05e2\u05d9 \u05dc\u05d7\u05d9\u05de\u05d4. \u05d1\u05de\u05d4\u05dc\u05da \u05d4\u05e4\u05e2\u05d9\u05dc\u05d5\u05ea, \u05db\u05dc\u05d9 \u05d8\u05d9\u05e1 \u05ea\u05e7\u05e3 \u05de\u05d7\u05d1\u05dc \u05d7\u05de\u05d5\u05e9 \u05d1\u05d2'\u05e0\u05d9\u05df@N12chat",false,918,"\u05e0\u05d9\u05e8 \u05d3\u05d1\u05d5\u05e8\u05d9\u05dc\u05d5\u05d7\u05de\u05d9 \u05e6\u05d4\"\u05dc, \u05e9\u05d1\"\u05db \u05d5\u05de\u05d2\"\u05d1 \u05e2\u05e6\u05e8\u05d5 \u05d1\u05de\u05d4\u05dc\u05da \u05d4\u05dc\u05d9\u05dc\u05d4 \u05e2\u05e9\u05e8\u05d4 \u05de\u05d1\u05d5\u05e7\u05e9\u05d9\u05dd \u05d1\u05e8\u05d7\u05d1\u05d9 \u05d9\u05d4\u05d5\u05d3\u05d4 \u05d5\u05e9\u05d5\u05de\u05e8\u05d5\u05df, \u05ea\u05d7\u05e7\u05e8\u05d5 \u05d7\u05e9\u05d5\u05d3\u05d9\u05dd \u05d5\u05d4\u05d7\u05e8\u05d9\u05de\u05d5 \u05d0\u05de\u05e6\u05e2\u05d9 \u05dc\u05d7\u05d9\u05de\u05d4. \u05d1\u05de\u05d4\u05dc\u05da \u05d4\u05e4\u05e2\u05d9\u05dc\u05d5\u05ea, \u05db\u05dc\u05d9 \u05d8\u05d9\u05e1 \u05ea\u05e7\u05e3 \u05de\u05d7\u05d1\u05dc \u05d7\u05de\u05d5\u05e9 \u05d1\u05d2'\u05e0\u05d9\u05df@N12chat"],["\u05d0\u05d6\u05d4\u05e8\u05ea \u05e6\u05e4\u05d9\u05d4\u05d0\u05d7\u05d3 \u05d4\u05e6\u05dc\u05e4\u05d9\u05dd \u05e9\u05dc \u05d4\u05de\u05d5\u05e8\u05d3\u05d9\u05dd \u05d4\u05e1\u05d5\u05e8\u05d9\u05dd \u05de\u05d5\u05e8\u05d9\u05d3 \u05d7\u05d9\u05d9\u05dc \u05e9\u05dc \u05e6\u05d1\u05d0 \u05d0\u05e1\u05d3 \u05d1\u05d0\u05d6\u05d5\u05e8 \u05e9\u05d9\u05d7' \u05e2\u05e7\u05d9\u05dc \u05d1\u05de\u05e2\u05e8\u05d1 \u05d7\u05dc\u05d1.User sent a document",false,919,"\u05d0\u05d6\u05d4\u05e8\u05ea \u05e6\u05e4\u05d9\u05d4\u05d0\u05d7\u05d3 \u05d4\u05e6\u05dc\u05e4\u05d9\u05dd \u05e9\u05dc \u05d4\u05de\u05d5\u05e8\u05d3\u05d9\u05dd \u05d4\u05e1\u05d5\u05e8\u05d9\u05dd \u05de\u05d5\u05e8\u05d9\u05d3 \u05d7\u05d9\u05d9\u05dc \u05e9\u05dc \u05e6\u05d1\u05d0 \u05d0\u05e1\u05d3 \u05d1\u05d0\u05d6\u05d5\u05e8 \u05e9\u05d9\u05d7' \u05e2\u05e7\u05d9\u05dc \u05d1\u05de\u05e2\u05e8\u05d1 \u05d7\u05dc\u05d1.User sent a document"],["\u05d3\u05e1\u05e7 \u05d4\u05d7\u05d5\u05e5\u05e8\u05e9\u05ea \u05d4\u05ea\u05e7\u05e9\u05d5\u05e8\u05ea KCNA \u05d4\u05e6\u05e4\u05d5\u05df-\u05e7\u05d5\u05e8\u05d9\u05d0\u05e0\u05d9\u05ea \u05e6\u05d9\u05d8\u05d8\u05d4 \u05d0\u05ea \u05de\u05e0\u05d4\u05d9\u05d2 \u05d4\u05de\u05d3\u05d9\u05e0\u05d4 \u05e7\u05d9\u05dd \u05d2'\u05d5\u05e0\u05d2 \u05d0\u05d5\u05df, \u05e9\u05d4\u05db\u05e8\u05d9\u05d6 \u05db\u05d9 \u05d9\u05e2\u05d3\u05d9 \u05de\u05d3\u05d9\u05e0\u05d9\u05d5\u05ea\u05d5 \u05dc\u05e9\u05e0\u05d4 \u05d4\u05d1\u05d0\u05d4 \u05db\u05d5\u05dc\u05dc\u05d9\u05dd \u05e9\u05d9\u05d2\u05d5\u05e8 \u05e9\u05dc\u05d5\u05e9\u05d4 \u05dc\u05d5\u05d5\u05d9\u05d9\u05e0\u05d9 \u05e1\u05d9\u05d5\u05e8 \u05e6\u05d1\u05d0\u05d9\u05d9\u05dd \u05e0\u05d5\u05e1\u05e4\u05d9\u05dd \u05d5\u05d1\u05e0\u05d9\u05d9\u05ea \u05db\u05dc\u05d9 \u05d8\u05d9\u05e1 \u05d1\u05dc\u05ea\u05d9 \u05de\u05d0\u05d5\u05d9\u05e9\u05d9\u05dd. \u05d1\u05d4\u05e6\u05d4\u05e8\u05ea\u05d5, \u05d0\u05de\u05e8 \u05db\u05d9 \u05dc\u05e2\u05d5\u05dc\u05dd \u05dc\u05d0 \u05d9\u05d4\u05d9\u05d4 \u05e0\u05d9\u05ea\u05df \u05dc\u05d4\u05e9\u05d9\u05d2 \u05d0\u05d9\u05d7\u05d5\u05d3 \u05e2\u05dd \u05d3\u05e8\u05d5\u05dd \u05e7\u05d5\u05e8\u05d9\u05d0\u05d4 \u05d5\u05d4\u05d5\u05d3\u05d9\u05e2: \"\u05d0\u05e0\u05d7\u05e0\u05d5 \u05de\u05db\u05e8\u05d9\u05d6\u05d9\u05dd \u05d7\u05d2
