0\u05dd \u05d0\u05e8\u05d4\"\u05d1 \u05d5\u05d3\u05e8\u05d5\u05dd \u05e7\u05d5\u05e8\u05d9\u05d0\u05d4 \u05d9\u05e0\u05e1\u05d5 \u05dc\u05d4\u05ea\u05e2\u05de\u05ea \u05d0\u05d9\u05ea\u05e0\u05d5 \u05e6\u05d1\u05d0\u05d9\u05ea, \u05d2\u05d5\u05e8\u05dd \u05d4\u05d4\u05e8\u05ea\u05e2\u05d4 \u05e9\u05dc\u05e0\u05d5 \u05d1\u05de\u05dc\u05d7\u05de\u05d4 \u05d4\u05d2\u05e8\u05e2\u05d9\u05e0\u05d9\u05ea \u05d9\u05e2\u05d1\u05d5\u05e8 \u05dc\u05e0\u05e7\u05d5\u05d8 \u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05de\u05e9\u05de\u05e2\u05d5\u05ea\u05d9\u05d5\u05ea\"@N12chat"],["\u05e2\"\u05e4 \u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd \u05e4\u05e2\u05d9\u05dc\u05d5\u05ea \u05d3\u05d7\u05e4\u05d5\u05e8\u05d9 \u05e6\u05d4\"\u05dc \u05e0\u05de\u05e9\u05db\u05ea \u05db\u05e2\u05ea \u05d1\u05e9\u05db\u05d5\u05e0\u05ea \u05d0-\u05e9\u05d4\u05d3\u05d0\u05d0' \u05d1\u05de\u05d7\u05e0\u05d4 \u05d4\u05e4\u05dc\u05d9\u05d8\u05d9\u05dd \u05d8\u05d5\u05dc\u05db\u05e8\u05dd.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,921,"\u05e2\"\u05e4 \u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd \u05e4\u05e2\u05d9\u05dc\u05d5\u05ea \u05d3\u05d7\u05e4\u05d5\u05e8\u05d9 \u05e6\u05d4\"\u05dc \u05e0\u05de\u05e9\u05db\u05ea \u05db\u05e2\u05ea \u05d1\u05e9\u05db\u05d5\u05e0\u05ea \u05d0-\u05e9\u05d4\u05d3\u05d0\u05d0' \u05d1\u05de\u05d7\u05e0\u05d4 \u05d4\u05e4\u05dc\u05d9\u05d8\u05d9\u05dd \u05d8\u05d5\u05dc\u05db\u05e8\u05dd.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05d4\u05de\u05ea\u05d9\u05d7\u05d5\u05ea \u05d1\u05de\u05d6\u05e8\u05d7 \u05d4\u05ea\u05d9\u05db\u05d5\u05df \u05de\u05de\u05e9\u05d9\u05db\u05d4 \u05dc\u05d4\u05e2\u05e1\u05d9\u05e7 \u05d0\u05ea \u05d4\u05e2\u05d5\u05dc\u05dd, \u05e2\u05dd \u05e2\u05d3\u05db\u05d5\u05e0\u05d9\u05dd \u05e8\u05d1\u05d9\u05dd \u05dc\u05d2\u05d1\u05d9 \u05d4\u05de\u05e6\u05d1 \u05d4\u05d1\u05d9\u05d8\u05d7\u05d5\u05e0\u05d9 \u05d5\u05d4\u05d3\u05d9\u05e4\u05dc\u05d5\u05de\u05d8\u05d9 \u05d1\u05d0\u05d6\u05d5\u05e8. \u05d3\u05d5\u05d1\u05e8 \u05e6\u05d4\"\u05dc \u05e4\u05e8\u05e1\u05dd \u05ea\u05d9\u05e2\u05d5\u05d3 \u05e9\u05dc \u05ea\u05e7\u05d9\u05e4\u05d4 \u05d1\u05d0\u05de\u05e6\u05e2\u05d5\u05ea \u05db\u05d8\u05d1\"\u05de \u05d1\u05d8\u05d5\u05dc\u05db\u05e8\u05dd, \u05de\u05d4 \u05e9\u05de\u05d3\u05d2\u05d9\u05e9 \u05d0\u05ea \u05d4\u05de\u05ea\u05d7\u05d9\u05dd \u05d4\u05de\u05ea\u05de\u05e9\u05db\u05d9\u05dd \u05d1\u05d9\u05d4\u05d5\u05d3\u05d4 \u05d5\u05e9\u05d5\u05de\u05e8\u05d5\u05df. \u05d1\u05de\u05e7\u05d1\u05d9\u05dc, \u05d3\u05d9\u05d5\u05d5\u05d7\u05d9\u05dd \u05e2\u05dc \u05e9\u05d9\u05d1\u05d5\u05e9\u05d9 GPS \u05d1\u05d0\u05d6\u05d5\u05e8 \u05d2\u05d1\u05d5\u05dc \u05dc\u05d1\u05e0\u05d5\u05df \u05d5\u05e2\u05dc \u05ea\u05e7\u05d9\u05e4\u05d5\u05ea \u05d9\u05e9\u05e8\u05d0\u05dc\u05d9\u05d5\u05ea \u05d1\u05dc\u05d1\u05e0\u05d5\u05df \u05de\u05d3\u05d2\u05d9\u05e9\u05d9\u05dd \u05d0\u05ea \u05d4\u05de\u05d5\u05e8\u05db\u05d1\u05d5\u05ea \u05d4\u05d1\u05d9\u05d8\u05d7\u05d5\u05e0\u05d9\u05ea \u05d1\u05d0\u05d6\u05d5\u05e8. \u05e2\u05d9\u05de\u05d5\u05ea\u05d9\u05dd \u05d1\u05d9\u05df \u05d9\u05e9\u05e8\u05d0\u05dc \u05dc\u05d7\u05de\u05d0\u05e1 \u05de\u05de\u05e9\u05d9\u05db\u05d9\u05dd, \u05db\u05d0\u05e9\u05e8 \u05d3\u05d9\u05d5\u05d5\u05d7\u05d9\u05dd \u05e2\u05dc \u05d7\u05d9\u05e1\u05d5\u05dc\u05d9\u05dd \u05e9\u05dc \u05d1\u05db\u05d9\u05e8\u05d9\u05dd \u05d1\u05d0\u05e8\u05d2\u05d5\u05e0\u05d9 \u05d8\u05e8\u05d5\u05e8, \u05db\u05de\u05d5 \u05d0\u05d7\u05de\u05d3 \u05d3\u05e8\u05d0\u05d2\u05de\u05d4, \u05d5\u05de\u05e2\u05e6\u05e8\u05d9\u05dd \u05e9\u05dc \u05de\u05d1\u05d5\u05e7\u05e9\u05d9\u05dd \u05de\u05d3\u05d2\u05d9\u05e9\u05d9\u05dd \u05d0\u05ea \u05d4\u05de\u05d0\u05de\u05e6\u05d9\u05dd \u05d4\u05de\u05ea\u05de\u05e9\u05db\u05d9\u05dd \u05e9\u05dc \u05d9\u05e9\u05e8\u05d0\u05dc \u05dc\u05d4\u05d9\u05dc\u05d7\u05dd \u05d1\u05d8\u05e8\u05d5\u05e8. \u05d4\u05e0\u05e9\u05d9\u05d0 \u05d1\u05d9\u05d9\u05d3\u05df \u05d4\u05d3\u05d2\u05d9\u05e9 \u05d0\u05ea \u05d4\u05e6\u05d5\u05e8\u05da \u05d1\u05d9\u05e9\u05e8\u05d0\u05dc \u05dc\u05d4\u05d1\u05d7\u05d9\u05df \u05d1\u05d9\u05df \u05dc\u05d5\u05d7\u05de\u05d9 \u05d7\u05de\u05d0\u05e1 \u05dc\u05d0\u05d6\u05e8\u05d7\u05d9\u05dd, \u05de\u05d4 \u05e9\u05de\u05d3\u05d2\u05d9\u05e9 \u05d0\u05ea \u05d4\u05de\u05d5\u05e8\u05db\u05d1\u05d5\u05ea \u05e9\u05dc \u05d4\u05de\u05e6\u05d1. \u05d3\u05d5\u05d5\u05d7 \u05e2\u05dc \u05e9\u05d9\u05d1\u05d5\u05e9\u05d9\u05dd \u05d1\u05ea\u05e7\u05e9\u05d5\u05e8\u05ea \u05d1\u05e2\u05d6\u05d4, \u05d5\u05e2\u05dc \u05e9\u05d7\u05e8\u05d5\u05e8\u05d5 \u05e9\u05dc \u05d0\u05d6\u05e8\u05d7 \u05d9\u05e9\u05e8\u05d0\u05dc\u05d9-\u05e2\u05e8\u05d1\u05d9 \u05dc\u05d0\u05d7\u05e8 42 \u05e9\u05e0\u05d4 \u05de\u05d4\u05db\u05dc\u05d0 \u05d4\u05e1\u05d5\u05e8\u05d9, \u05de\u05d4 \u05e9\u05de\u05d3\u05d2\u05d9\u05e9 \u05d0\u05ea \u05d4\u05d4\u05e9\u05e4\u05e2\u05d4 \u05d4\u05e8\u05d7\u05d1\u05d4 \u05e9\u05dc \u05d4\u05e1\u05db\u05e1\u05d5\u05da \u05e2\u05dc \u05d7\u05d9\u05d9\u05d4\u05dd \u05e9\u05dc \u05d0\u05e0\u05e9\u05d9\u05dd. \u05d1\u05de\u05e7\u05d1\u05d9\u05dc, \u05d3\u05d9\u05d5\u05d5\u05d7\u05d9\u05dd \u05e2\u05dc \u05ea\u05e7\u05d9\u05e4\u05d5\u05ea \u05e1\u05d9\u05d9\u05d1\u05e8 \u05d1\u05d0\u05d9\u05e8\u05d0\u05df \u05de\u05d3\u05d2\u05d9\u05e9\u05d9\u05dd \u05d0\u05ea \u05d4\u05d4\u05e9\u05dc\u05db\u05d5\u05ea \u05d4\u05d2\u05dc\u05d5\u05d1\u05dc\u05d9\u05d5\u05ea \u05e9\u05dc \u05d4\u05de\u05e6\u05d1. \u05d4\u05de\u05e6\u05d1 \u05e0\u05d5\u05ea\u05e8 \u05d3\u05d9\u05e0\u05de\u05d9, \u05e2\u05dd \u05e2\u05d3\u05db\u05d5\u05e0\u05d9\u05dd \u05de\u05ea\u05de\u05e9\u05db\u05d9\u05dd \u05dc\u05d2\u05d1\u05d9 \u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05e6\u05d1\u05d0\u05d9\u05d5\u05ea, \u05d3\u05d9\u05e4\u05dc\u05d5\u05de\u05d8\u05d9\u05d4, \u05d5\u05de\u05e6\u05d1 \u05d4\u05d0\u05d6\u05e8\u05d7\u05d9\u05dd \u05d1\u05d0\u05d6\u05d5\u05e8.\n",true,"Cluster 52","\u05d4\u05de\u05ea\u05d9\u05d7\u05d5\u05ea \u05d1\u05de\u05d6\u05e8\u05d7 \u05d4\u05ea\u05d9\u05db\u05d5\u05df \u05de\u05de\u05e9\u05d9\u05db\u05d4 \u05dc\u05d4\u05e2\u05e1\u05d9\u05e7 \u05d0\u05ea \u05d4\u05e2\u05d5\u05dc\u05dd, \u05e2\u05dd \u05e2\u05d3\u05db\u05d5\u05e0\u05d9\u05dd \u05e8\u05d1\u05d9\u05dd \u05dc\u05d2\u05d1\u05d9 \u05d4\u05de\u05e6\u05d1 \u05d4\u05d1\u05d9\u05d8\u05d7\u05d5\u05e0\u05d9 \u05d5\u05d4\u05d3\u05d9\u05e4\u05dc\u05d5\u05de\u05d8\u05d9 \u05d1\u05d0\u05d6\u05d5\u05e8. \u05d3\u05d5\u05d1\u05e8 \u05e6\u05d4\"\u05dc \u05e4\u05e8\u05e1\u05dd \u05ea\u05d9\u05e2\u05d5\u05d3 \u05e9\u05dc \u05ea\u05e7\u05d9\u05e4\u05d4 \u05d1\u05d0\u05de\u05e6\u05e2\u05d5\u05ea \u05db\u05d8\u05d1\"\u05de \u05d1\u05d8\u05d5\u05dc\u05db\u05e8\u05dd, \u05de\u05d4 \u05e9\u05de\u05d3\u05d2\u05d9\u05e9 \u05d0\u05ea \u05d4\u05de\u05ea\u05d7\u05d9\u05dd \u05d4\u05de\u05ea\u05de\u05e9\u05db\u05d9\u05dd \u05d1\u05d9\u05d4\u05d5\u05d3\u05d4 \u05d5\u05e9\u05d5\u05de\u05e8\u05d5\u05df. \u05d1\u05de\u05e7\u05d1\u05d9\u05dc, \u05d3\u05d9\u05d5\u05d5\u05d7\u05d9\u05dd \u05e2\u05dc \u05e9\u05d9\u05d1\u05d5\u05e9\u05d9 GPS \u05d1\u05d0\u05d6\u05d5\u05e8 \u05d2\u05d1\u05d5\u05dc \u05dc\u05d1\u05e0\u05d5\u05df \u05d5\u05e2\u05dc \u05ea\u05e7\u05d9\u05e4\u05d5\u05ea \u05d9\u05e9\u05e8\u05d0\u05dc\u05d9\u05d5\u05ea \u05d1\u05dc\u05d1\u05e0\u05d5\u05df \u05de\u05d3\u05d2\u05d9\u05e9\u05d9\u05dd \u05d0\u05ea \u05d4\u05de\u05d5\u05e8\u05db\u05d1\u05d5\u05ea \u05d4\u05d1\u05d9\u05d8\u05d7\u05d5\u05e0\u05d9\u05ea \u05d1\u05d0\u05d6\u05d5\u05e8. \u05e2\u05d9\u05de\u05d5\u05ea\u05d9\u05dd \u05d1\u05d9\u05df \u05d9\u05e9\u05e8\u05d0\u05dc \u05dc\u05d7\u05de\u05d0\u05e1 \u05de\u05de\u05e9\u05d9\u05db\u05d9\u05dd, \u05db\u05d0\u05e9\u05e8 \u05d3\u05d9\u05d5\u05d5\u05d7\u05d9\u05dd \u05e2\u05dc \u05d7\u05d9\u05e1\u05d5\u05dc\u05d9\u05dd \u05e9\u05dc \u05d1\u05db\u05d9\u05e8\u05d9\u05dd \u05d1\u05d0\u05e8\u05d2\u05d5\u05e0\u05d9 \u05d8\u05e8\u05d5\u05e8, \u05db\u05de\u05d5 \u05d0\u05d7\u05de\u05d3 \u05d3\u05e8\u05d0\u05d2\u05de\u05d4, \u05d5\u05de\u05e2\u05e6\u05e8\u05d9\u05dd \u05e9\u05dc \u05de\u05d1\u05d5\u05e7\u05e9\u05d9\u05dd \u05de\u05d3\u05d2\u05d9\u05e9\u05d9\u05dd \u05d0\u05ea \u05d4\u05de\u05d0\u05de\u05e6\u05d9\u05dd \u05d4\u05de\u05ea\u05de\u05e9\u05db\u05d9\u05dd \u05e9\u05dc \u05d9\u05e9\u05e8\u05d0\u05dc \u05dc\u05d4\u05d9\u05dc\u05d7\u05dd \u05d1\u05d8\u05e8\u05d5\u05e8. \u05d4\u05e0\u05e9\u05d9\u05d0 \u05d1\u05d9\u05d9\u05d3\u05df \u05d4\u05d3\u05d2\u05d9\u05e9 \u05d0\u05ea \u05d4\u05e6\u05d5\u05e8\u05da \u05d1\u05d9\u05e9\u05e8\u05d0\u05dc \u05dc\u05d4\u05d1\u05d7\u05d9\u05df \u05d1\u05d9\u05df \u05dc\u05d5\u05d7\u05de\u05d9 \u05d7\u05de\u05d0\u05e1 \u05dc\u05d0\u05d6\u05e8\u05d7\u05d9\u05dd, \u05de\u05d4 \u05e9\u05de\u05d3\u05d2\u05d9\u05e9 \u05d0\u05ea \u05d4\u05de\u05d5\u05e8\u05db\u05d1\u05d5\u05ea \u05e9\u05dc \u05d4\u05de\u05e6\u05d1. \u05d3\u05d5\u05d5\u05d7 \u05e2\u05dc \u05e9\u05d9\u05d1\u05d5\u05e9\u05d9\u05dd \u05d1\u05ea\u05e7\u05e9\u05d5\u05e8\u05ea \u05d1\u05e2\u05d6\u05d4, \u05d5\u05e2\u05dc \u05e9\u05d7\u05e8\u05d5\u05e8\u05d5 \u05e9\u05dc \u05d0\u05d6\u05e8\u05d7 \u05d9\u05e9\u05e8\u05d0\u05dc\u05d9-\u05e2\u05e8\u05d1\u05d9 \u05dc\u05d0\u05d7\u05e8 42 \u05e9\u05e0\u05d4 \u05de\u05d4\u05db\u05dc\u05d0 \u05d4\u05e1\u05d5\u05e8\u05d9, \u05de\u05d4 \u05e9\u05de\u05d3\u05d2\u05d9\u05e9 \u05d0\u05ea \u05d4\u05d4\u05e9\u05e4\u05e2\u05d4 \u05d4\u05e8\u05d7\u05d1\u05d4 \u05e9\u05dc \u05d4\u05e1\u05db\u05e1\u05d5\u05da \u05e2\u05dc \u05d7\u05d9\u05d9\u05d4\u05dd \u05e9\u05dc \u05d0\u05e0\u05e9\u05d9\u05dd. \u05d1\u05de\u05e7\u05d1\u05d9\u05dc, \u05d3\u05d9\u05d5\u05d5\u05d7\u05d9\u05dd \u05e2\u05dc \u05ea\u05e7\u05d9\u05e4\u05d5\u05ea \u05e1\u05d9\u05d9\u05d1\u05e8 \u05d1\u05d0\u05d9\u05e8\u05d0\u05df \u05de\u05d3\u05d2\u05d9\u05e9\u05d9\u05dd \u05d0\u05ea \u05d4\u05d4\u05e9\u05dc\u05db\u05d5\u05ea \u05d4\u05d2\u05dc\u05d5\u05d1\u05dc\u05d9\u05d5\u05ea \u05e9\u05dc \u05d4\u05de\u05e6\u05d1. \u05d4\u05de\u05e6\u05d1 \u05e0\u05d5\u05ea\u05e8 \u05d3\u05d9\u05e0\u05de\u05d9, \u05e2\u05dd \u05e2\u05d3\u05db\u05d5\u05e0\u05d9\u05dd \u05de\u05ea\u05de\u05e9\u05db\u05d9\u05dd \u05dc\u05d2\u05d1\u05d9 \u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05e6\u05d1\u05d0\u05d9\u05d5\u05ea, \u05d3\u05d9\u05e4\u05dc\u05d5\u05de\u05d8\u05d9\u05d4, \u05d5\u05de\u05e6\u05d1 \u05d4\u05d0\u05d6\u05e8\u05d7\u05d9\u05dd \u05d1\u05d0\u05d6\u05d5\u05e8.\n"],["\u05d3\u05d5\u05d1\u05e8 \u05e6\u05d4\"\u05dc \u05de\u05e4\u05e8\u05e1\u05dd \u05ea\u05d9\u05e2\u05d5\u05d3 \u05e9\u05dc \u05ea\u05e7\u05d9\u05e4\u05ea \u05d7\u05d5\u05dc\u05d9\u05d9\u05ea \u05d4\u05de\u05d7\u05d1\u05dc\u05d9\u05dd \u05d1\u05d8\u05d5\u05dc\u05db\u05e8\u05dd \u05d1\u05d0\u05de\u05e6\u05e2\u05d5\u05ea \u05db\u05d8\u05d1\"\u05de.\u05d6\u05d4 \u05d0\u05d5\u05dc\u05d9 \u05e9\u05d9\u05d2\u05e8\u05ea\u05d9 \u05d1\u05e2\u05d6\u05d4 \u05d0\u05d1\u05dc \u05d1\u05d0\u05d9\u05d5\"\u05e9 \u05d6\u05d4 \u05d0\u05d9\u05e8\u05d5\u05e2 \u05e0\u05d3\u05d9\u05e8 \u05d1\u05de\u05d9\u05d5\u05d7\u05d3\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,922,"\u05d3\u05d5\u05d1\u05e8 \u05e6\u05d4\"\u05dc \u05de\u05e4\u05e8\u05e1\u05dd \u05ea\u05d9\u05e2\u05d5\u05d3 \u05e9\u05dc \u05ea\u05e7\u05d9\u05e4\u05ea \u05d7\u05d5\u05dc\u05d9\u05d9\u05ea \u05d4\u05de\u05d7\u05d1\u05dc\u05d9\u05dd \u05d1\u05d8\u05d5\u05dc\u05db\u05e8\u05dd \u05d1\u05d0\u05de\u05e6\u05e2\u05d5\u05ea \u05db\u05d8\u05d1\"\u05de.\u05d6\u05d4 \u05d0\u05d5\u05dc\u05d9 \u05e9\u05d9\u05d2\u05e8\u05ea\u05d9 \u05d1\u05e2\u05d6\u05d4 \u05d0\u05d1\u05dc \u05d1\u05d0\u05d9\u05d5\"\u05e9 \u05d6\u05d4 \u05d0\u05d9\u05e8\u05d5\u05e2 \u05e0\u05d3\u05d9\u05e8 \u05d1\u05de\u05d9\u05d5\u05d7\u05d3\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05e1\u05e4\u05d9\u05e8 \u05dc\u05d9\u05e4\u05e7\u05d9\u05df\"\u05d7\u05d9\u05d6\u05d1\u05d0\u05dc\u05dc\u05d4 \u05de\u05e4\u05e8 \u05d0\u05ea \u05d4\u05d7\u05dc\u05d8\u05d4 1701 \u05d5\u05de\u05de\u05e9\u05d9\u05da \u05dc\u05d4\u05e9\u05ea\u05de\u05e9 \u05d1\u05dc\u05d1\u05e0\u05d5\u05e0\u05d9\u05dd \u05db\u05d1\u05e0\u05d9 \u05e2\u05e8\u05d5\u05d1\u05d4 \u05d1\u05d4\u05d7\u05dc\u05d8\u05d5\u05ea\u05d9\u05d5 \u05dc\u05ea\u05de\u05d5\u05da \u05d1\u05d7\u05de\u05d0\u05e1. \u05d0\u05e0\u05d7\u05e0\u05d5 \u05de\u05de\u05e9\u05d9\u05db\u05d9\u05dd \u05dc\u05e4\u05d2\u05d5\u05e2 \u05d1\u05e2\u05de\u05d3\u05d5\u05ea \u05e9\u05dc \u05d7\u05d9\u05d6\u05d1\u05d0\u05dc\u05dc\u05d4 \u05d1\u05d3\u05e8\u05d5\u05dd \u05dc\u05d1\u05e0\u05d5\u05df, \u05de\u05d4 \u05e9\u05d4\u05d9\u05d4 \u05dc\u05e4\u05e0\u05d9 \u05d4-7 \u05d1\u05d0\u05d5\u05e7\u05d8\u05d5\u05d1\u05e8 - \u05d4\u05d5\u05d0 \u05dc\u05d0 \u05de\u05d4 \u05e9\u05d9\u05d4\u05d9\u05d4\", \u05db\u05ea\u05d1 \u05d0\u05d3\u05e8\u05e2\u05d9@N12chat",false,923,"\u05e1\u05e4\u05d9\u05e8 \u05dc\u05d9\u05e4\u05e7\u05d9\u05df\"\u05d7\u05d9\u05d6\u05d1\u05d0\u05dc\u05dc\u05d4 \u05de\u05e4\u05e8 \u05d0\u05ea \u05d4\u05d7\u05dc\u05d8\u05d4 1701 \u05d5\u05de\u05de\u05e9\u05d9\u05da \u05dc\u05d4\u05e9\u05ea\u05de\u05e9 \u05d1\u05dc\u05d1\u05e0\u05d5\u05e0\u05d9\u05dd \u05db\u05d1\u05e0\u05d9 \u05e2\u05e8\u05d5\u05d1\u05d4 \u05d1\u05d4\u05d7\u05dc\u05d8\u05d5\u05ea\u05d9\u05d5 \u05dc\u05ea\u05de\u05d5\u05da \u05d1\u05d7\u05de\u05d0\u05e1. \u05d0\u05e0\u05d7\u05e0\u05d5 \u05de\u05de\u05e9\u05d9\u05db\u05d9\u05dd \u05dc\u05e4\u05d2\u05d5\u05e2 \u05d1\u05e2\u05de\u05d3\u05d5\u05ea \u05e9\u05dc \u05d7\u05d9\u05d6\u05d1\u05d0\u05dc\u05dc\u05d4 \u05d1\u05d3\u05e8\u05d5\u05dd \u05dc\u05d1\u05e0\u05d5\u05df, \u05de\u05d4 \u05e9\u05d4\u05d9\u05d4 \u05dc\u05e4\u05e0\u05d9 \u05d4-7 \u05d1\u05d0\u05d5\u05e7\u05d8\u05d5\u05d1\u05e8 - \u05d4\u05d5\u05d0 \u05dc\u05d0 \u05de\u05d4 \u05e9\u05d9\u05d4\u05d9\u05d4\", \u05db\u05ea\u05d1 \u05d0\u05d3\u05e8\u05e2\u05d9@N12chat"],["\u05e0\u05e1\u05e8\u05d0\u05dc\u05dc\u05d4 \u05dc\u05e2\u05d6\u05ea\u05d9\u05d9\u05dd :\u05e2\u05dc\u05d9\u05e0\u05d5 \u05dc\u05d4\u05d9\u05d5\u05ea \u05de\u05e6\u05d9\u05d0\u05d5\u05ea\u05d9\u05d9\u05dd \u05d0\u05e0\u05d5 \u05e6\u05e8\u05d9\u05db\u05d9\u05dd \u05e2\u05d5\u05d3 \u05d6\u05de\u05df \u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05e2 \u05dc\u05e0\u05d9\u05e6\u05d7\u05d5\u05df.\n",false,924,"\u05e0\u05e1\u05e8\u05d0\u05dc\u05dc\u05d4 \u05dc\u05e2\u05d6\u05ea\u05d9\u05d9\u05dd :\u05e2\u05dc\u05d9\u05e0\u05d5 \u05dc\u05d4\u05d9\u05d5\u05ea \u05de\u05e6\u05d9\u05d0\u05d5\u05ea\u05d9\u05d9\u05dd \u05d0\u05e0\u05d5 \u05e6\u05e8\u05d9\u05db\u05d9\u05dd \u05e2\u05d5\u05d3 \u05d6\u05de\u05df \u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05e2 \u05dc\u05e0\u05d9\u05e6\u05d7\u05d5\u05df.\n"],["\u05d9\u05d5\u05dc\u05df \u05db\u05d4\u05df\u05de\u05d7\u05d0\u05d4 \u05e9\u05dc \u05de\u05e9\u05e4\u05d7\u05d5\u05ea \u05de\u05d7\u05d5\u05e5 \u05dc\u05e7\u05e8\u05d9\u05d4. \u05d4\u05de\u05e9\u05e4\u05d7\u05d5\u05ea \u05d7\u05d5\u05e1\u05de\u05d5\u05ea \u05d0\u05ea \u05d4\u05db\u05d1\u05d9\u05e9@N12chat",false,925,"\u05d9\u05d5\u05dc\u05df \u05db\u05d4\u05df\u05de\u05d7\u05d0\u05d4 \u05e9\u05dc \u05de\u05e9\u05e4\u05d7\u05d5\u05ea \u05de\u05d7\u05d5\u05e5 \u05dc\u05e7\u05e8\u05d9\u05d4. \u05d4\u05de\u05e9\u05e4\u05d7\u05d5\u05ea \u05d7\u05d5\u05e1\u05de\u05d5\u05ea \u05d0\u05ea \u05d4\u05db\u05d1\u05d9\u05e9@N12chat"],["\u05e1\u05e4\u05d9\u05e8 \u05dc\u05d9\u05e4\u05e7\u05d9\u05df\u05d4\u05d2\u05d5\u05e8\u05dd \u05d1\u05d7\u05de\u05d0\u05e1 \u05d8\u05e2\u05df: \"\u05de\u05e9\u05dc\u05d7\u05ea \u05de\u05d8\u05e2\u05de\u05e0\u05d5 \u05ea\u05d2\u05d9\u05e2 \u05dc\u05de\u05d5\u05e1\u05e7\u05d5\u05d5\u05d4 \u05db\u05d3\u05d9 \u05dc\u05d3\u05d5\u05df \u05d1\u05d4\u05e8\u05db\u05d1\u05ea \u05de\u05de\u05e9\u05dc\u05d4 \u05dc\u05d0\u05d5\u05de\u05d9\u05ea \u05dc\u05ea\u05e7\u05d5\u05e4\u05d4 \u05de\u05d5\u05d2\u05d3\u05e8\u05ea \u05d5\u05e2\u05dd \u05de\u05e9\u05d9\u05de\u05d5\u05ea \u05d1\u05e8\u05d5\u05e8\u05d5\u05ea. \u05e8\u05d5\u05e6\u05d9\u05dd \u05e9\u05d4\u05d9\u05d0 \u05ea\u05e7\u05d5\u05dd \u05d1\u05d4\u05e1\u05db\u05de\u05ea \u05d4\u05e4\u05dc\u05d2\u05d9\u05dd\"@N12chat",false,926,"\u05e1\u05e4\u05d9\u05e8 \u05dc\u05d9\u05e4\u05e7\u05d9\u05df\u05d4\u05d2\u05d5\u05e8\u05dd \u05d1\u05d7\u05de\u05d0\u05e1 \u05d8\u05e2\u05df: \"\u05de\u05e9\u05dc\u05d7\u05ea \u05de\u05d8\u05e2\u05de\u05e0\u05d5 \u05ea\u05d2\u05d9\u05e2 \u05dc\u05de\u05d5\u05e1\u05e7\u05d5\u05d5\u05d4 \u05db\u05d3\u05d9 \u05dc\u05d3\u05d5\u05df \u05d1\u05d4\u05e8\u05db\u05d1\u05ea \u05de\u05de\u05e9\u05dc\u05d4 \u05dc\u05d0\u05d5\u05de\u05d9\u05ea \u05dc\u05ea\u05e7\u05d5\u05e4\u05d4 \u05de\u05d5\u05d2\u05d3\u05e8\u05ea \u05d5\u05e2\u05dd \u05de\u05e9\u05d9\u05de\u05d5\u05ea \u05d1\u05e8\u05d5\u05e8\u05d5\u05ea. \u05e8\u05d5\u05e6\u05d9\u05dd \u05e9\u05d4\u05d9\u05d0 \u05ea\u05e7\u05d5\u05dd \u05d1\u05d4\u05e1\u05db\u05de\u05ea \u05d4\u05e4\u05dc\u05d2\u05d9\u05dd\"@N12chat"],["\u00b0\u05ea\u05d5\u05db\u05df \u05e9\u05d9\u05d5\u05d5\u05e7\u05d9",false,927,"\u00b0\u05ea\u05d5\u05db\u05df \u05e9\u05d9\u05d5\u05d5\u05e7\u05d9"],["\u05e0\u05d9\u05e8 \u05d3\u05d1\u05d5\u05e8\u05d9\u05e6\u05d4\"\u05dc: \u05db\u05d5\u05d7\u05d5\u05ea \u05d4\u05d1\u05d9\u05d8\u05d7\u05d5\u05df \u05e2\u05e6\u05e8\u05d5 14 \u05de\u05d1\u05d5\u05e7\u05e9\u05d9\u05dd \u05d1\u05e8\u05d7\u05d1\u05d9 \u05d9\u05d4\u05d5\u05d3\u05d4 \u05d5\u05e9\u05d5\u05de\u05e8\u05d5\u05df. \u05d1\u05d4\u05db\u05d5\u05d5\u05e0\u05d4 \u05de\u05d5\u05d3\u05d9\u05e2\u05d9\u05e0\u05d9\u05ea \u05e9\u05dc \u05e9\u05d1\"\u05db \u05d1\u05de\u05e8\u05d7\u05d1\u05d9\u05dd \u05d8\u05d5\u05d1\u05d0\u05e1 \u05d5\u05d1\u05e4\u05e8\u05e2\u05d4, \u05e9\u05d1\u05d7\u05d8\u05d9\u05d1\u05ea \u05d4\u05d1\u05e7\u05e2\u05d4 \u05d5\u05d4\u05e2\u05de\u05e7\u05d9\u05dd, \u05d7\u05d9\u05e1\u05dc\u05d5 \u05db\u05d5\u05d7\u05d5\u05ea \u05de\u05d9\u05d7\u05d9\u05d3\u05ea \u05d3\u05d5\u05d1\u05d3\u05d1\u05df \u05d0\u05ea \u05d0\u05d7\u05de\u05d3 \u05d3\u05e8\u05d0\u05d2\u05de\u05d4, \u05d1\u05db\u05d9\u05e8 \u05d1\u05d2'\u05d9\u05d4\u05d0\u05d3 \u05d4\u05d0\u05d9\u05e1\u05dc\u05d0\u05de\u05d9. \u05d1\u05e2\u05d1\u05e8\u05d5 \u05d3\u05e8\u05d0\u05d2\u05de\u05d4 \u05d1\u05d9\u05e6\u05e2 \u05e4\u05d9\u05d2\u05d5\u05e2\u05d9 \u05d9\u05e8\u05d9 \u05d5\u05de\u05d8\u05e2\u05e0\u05d9\u05dd \u05dc\u05e2\u05d1\u05e8 \u05db\u05d5\u05d7\u05d5\u05ea \u05e6\u05d4\"\u05dc. \u05d4\u05db\u05d5\u05d7\u05d5\u05ea \u05d2\u05dd \u05d7\u05d9\u05e1\u05dc\u05d5 \u05e9\u05e0\u05d9 \u05de\u05d7\u05d1\u05dc\u05d9\u05dd \u05d7\u05de\u05d5\u05e9\u05d9\u05dd \u05e0\u05d5\u05e1\u05e4\u05d9\u05dd \u05d5\u05d0\u05d9\u05ea\u05e8\u05d5 \u05d7\u05de\"\u05dc \u05ea\u05e6\u05e4\u05d9\u05d5\u05ea@N12chat",false,928,"\u05e0\u05d9\u05e8 \u05d3\u05d1\u05d5\u05e8\u05d9\u05e6\u05d4\"\u05dc: \u05db\u05d5\u05d7\u05d5\u05ea \u05d4\u05d1\u05d9\u05d8\u05d7\u05d5\u05df \u05e2\u05e6\u05e8\u05d5 14 \u05de\u05d1\u05d5\u05e7\u05e9\u05d9\u05dd \u05d1\u05e8\u05d7\u05d1\u05d9 \u05d9\u05d4\u05d5\u05d3\u05d4 \u05d5\u05e9\u05d5\u05de\u05e8\u05d5\u05df. \u05d1\u05d4\u05db\u05d5\u05d5\u05e0\u05d4 \u05de\u05d5\u05d3\u05d9\u05e2\u05d9\u05e0\u05d9\u05ea \u05e9\u05dc \u05e9\u05d1\"\u05db \u05d1\u05de\u05e8\u05d7\u05d1\u05d9\u05dd \u05d8\u05d5\u05d1\u05d0\u05e1 \u05d5\u05d1\u05e4\u05e8\u05e2\u05d4, \u05e9\u05d1\u05d7\u05d8\u05d9\u05d1\u05ea \u05d4\u05d1\u05e7\u05e2\u05d4 \u05d5\u05d4\u05e2\u05de\u05e7\u05d9\u05dd, \u05d7\u05d9\u05e1\u05dc\u05d5 \u05db\u05d5\u05d7\u05d5\u05ea \u05de\u05d9\u05d7\u05d9\u05d3\u05ea \u05d3\u05d5\u05d1\u05d3\u05d1\u05df \u05d0\u05ea \u05d0\u05d7\u05de\u05d3 \u05d3\u05e8\u05d0\u05d2\u05de\u05d4, \u05d1\u05db\u05d9\u05e8 \u05d1\u05d2'\u05d9\u05d4\u05d0\u05d3 \u05d4\u05d0\u05d9\u05e1\u05dc\u05d0\u05de\u05d9. \u05d1\u05e2\u05d1\u05e8\u05d5 \u05d3\u05e8\u05d0\u05d2\u05de\u05d4 \u05d1\u05d9\u05e6\u05e2 \u05e4\u05d9\u05d2\u05d5\u05e2\u05d9 \u05d9\u05e8\u05d9 \u05d5\u05de\u05d8\u05e2\u05e0\u05d9\u05dd \u05dc\u05e2\u05d1\u05e8 \u05db\u05d5\u05d7\u05d5\u05ea \u05e6\u05d4\"\u05dc. \u05d4\u05db\u05d5\u05d7\u05d5\u05ea \u05d2\u05dd \u05d7\u05d9\u05e1\u05dc\u05d5 \u05e9\u05e0\u05d9 \u05de\u05d7\u05d1\u05dc\u05d9\u05dd \u05d7\u05de\u05d5\u05e9\u05d9\u05dd \u05e0\u05d5\u05e1\u05e4\u05d9\u05dd \u05d5\u05d0\u05d9\u05ea\u05e8\u05d5 \u05d7\u05de\"\u05dc \u05ea\u05e6\u05e4\u05d9\u05d5\u05ea@N12chat"],["\u05d3\u05e1\u05e7 \u05d4\u05d7\u05d5\u05e5\u05de\u05d6\u05db\"\u05dc \u05d4\u05d0\u05d5\"\u05dd \u05d2\u05d5\u05d8\u05e8\u05e9 \u05e2\u05dc \u05e2\u05e1\u05e7\u05ea \u05d4\u05d7\u05d8\u05d5\u05e4\u05d9\u05dd: \"\u05e6\u05e2\u05d3 \u05d7\u05e9\u05d5\u05d1 \u05d1\u05db\u05d9\u05d5\u05d5\u05df \u05d4\u05e0\u05db\u05d5\u05df, \u05d0\u05d1\u05dc \u05e6\u05e8\u05d9\u05da \u05dc\u05e2\u05e9\u05d5\u05ea \u05d4\u05e8\u05d1\u05d4 \u05d9\u05d5\u05ea\u05e8\"@N12chat",false,929,"\u05d3\u05e1\u05e7 \u05d4\u05d7\u05d5\u05e5\u05de\u05d6\u05db\"\u05dc \u05d4\u05d0\u05d5\"\u05dd \u05d2\u05d5\u05d8\u05e8\u05e9 \u05e2\u05dc \u05e2\u05e1\u05e7\u05ea \u05d4\u05d7\u05d8\u05d5\u05e4\u05d9\u05dd: \"\u05e6\u05e2\u05d3 \u05d7\u05e9\u05d5\u05d1 \u05d1\u05db\u05d9\u05d5\u05d5\u05df \u05d4\u05e0\u05db\u05d5\u05df, \u05d0\u05d1\u05dc \u05e6\u05e8\u05d9\u05da \u05dc\u05e2\u05e9\u05d5\u05ea \u05d4\u05e8\u05d1\u05d4 \u05d9\u05d5\u05ea\u05e8\"@N12chat"],["\u05d9\u05d5\u05e0\u05d4 \u05dc\u05d9\u05d9\u05d1\u05d6\u05d5\u05df\u05d4\u05e0\u05e9\u05d9\u05d0 \u05d1\u05d9\u05d9\u05d3\u05df \u05d4\u05e9\u05ea\u05ea\u05e3 \u05d1\u05db\u05e0\u05e1 \u05e4\u05d5\u05dc\u05d9\u05d8\u05d9 \u05d5\u05d4\u05ea\u05d9\u05d9\u05d7\u05e1 \u05dc\u05de\u05e6\u05d1 \u05d1\u05de\u05d6\u05e8\u05d7 \u05d4\u05ea\u05d9\u05db\u05d5\u05df. \u05d4\u05d5\u05d0 \u05d3\u05d9\u05d1\u05e8 \u05e2\u05dc \"\u05d4\u05d0\u05d7\u05e8\u05d9\u05d5\u05ea \u05e9\u05dc \u05d9\u05e9\u05e8\u05d0\u05dc \u05dc\u05d4\u05d1\u05d7\u05d9\u05df \u05d1\u05d9\u05df \u05dc\u05d5\u05d7\u05de\u05d9 \u05d7\u05de\u05d0\u05e1 \u05dc\u05d1\u05d9\u05df \u05d0\u05d6\u05e8\u05d7\u05d9\u05dd, \u05d5\u05dc\u05de\u05d6\u05e2\u05e8 \u05d0\u05ea \u05d4\u05e8\u05d2 \u05d4\u05d0\u05d6\u05e8\u05d7\u05d9\u05dd\". \u05d4\u05d5\u05d0 \u05d4\u05d1\u05d9\u05e2 \u05e9\u05d5\u05d1 \u05d0\u05ea \u05ea\u05de\u05d9\u05db\u05ea\u05d5 \u05d1\u05e4\u05ea\u05e8\u05d5\u05df \u05e9\u05ea\u05d9 \u05d4\u05de\u05d3\u05d9\u05e0\u05d5\u05ea@N12chat",false,930,"\u05d9\u05d5\u05e0\u05d4 \u05dc\u05d9\u05d9\u05d1\u05d6\u05d5\u05df\u05d4\u05e0\u05e9\u05d9\u05d0 \u05d1\u05d9\u05d9\u05d3\u05df \u05d4\u05e9\u05ea\u05ea\u05e3 \u05d1\u05db\u05e0\u05e1 \u05e4\u05d5\u05dc\u05d9\u05d8\u05d9 \u05d5\u05d4\u05ea\u05d9\u05d9\u05d7\u05e1 \u05dc\u05de\u05e6\u05d1 \u05d1\u05de\u05d6\u05e8\u05d7 \u05d4\u05ea\u05d9\u05db\u05d5\u05df. \u05d4\u05d5\u05d0 \u05d3\u05d9\u05d1\u05e8 \u05e2\u05dc \"\u05d4\u05d0\u05d7\u05e8\u05d9\u05d5\u05ea \u05e9\u05dc \u05d9\u05e9\u05e8\u05d0\u05dc \u05dc\u05d4\u05d1\u05d7\u05d9\u05df \u05d1\u05d9\u05df \u05dc\u05d5\u05d7\u05de\u05d9 \u05d7\u05de\u05d0\u05e1 \u05dc\u05d1\u05d9\u05df \u05d0\u05d6\u05e8\u05d7\u05d9\u05dd, \u05d5\u05dc\u05de\u05d6\u05e2\u05e8 \u05d0\u05ea \u05d4\u05e8\u05d2 \u05d4\u05d0\u05d6\u05e8\u05d7\u05d9\u05dd\". \u05d4\u05d5\u05d0 \u05d4\u05d1\u05d9\u05e2 \u05e9\u05d5\u05d1 \u05d0\u05ea \u05ea\u05de\u05d9\u05db\u05ea\u05d5 \u05d1\u05e4\u05ea\u05e8\u05d5\u05df \u05e9\u05ea\u05d9 \u05d4\u05de\u05d3\u05d9\u05e0\u05d5\u05ea@N12chat"],["\u05d3\u05d5\u05d1\u05e8 \u05e6\u05d4\"\u05dc: \u05d4\u05d0\u05d6\u05d5\u05e8 \u05d4\u05e0\u05de\u05e6\u05d0 4 \u05e7\"\u05de \u05d3\u05e8\u05d5\u05de\u05d9\u05ea \u05dc\u05d2\u05d1\u05d5\u05dc \u05dc\u05d1\u05e0\u05d5\u05df \u05d4\u05d5\u05d0 \u05e9\u05d8\u05d7 \u05e6\u05d1\u05d0\u05d9 \u05e1\u05d2\u05d5\u05e8. \u05de\u05d5\u05e4\u05e2\u05dc\u05d9\u05dd \u05d1\u05de\u05e7\u05d5\u05dd \u05e9\u05d9\u05d1\u05d5\u05e9\u05d9 GPS",false,931,"\u05d3\u05d5\u05d1\u05e8 \u05e6\u05d4\"\u05dc: \u05d4\u05d0\u05d6\u05d5\u05e8 \u05d4\u05e0\u05de\u05e6\u05d0 4 \u05e7\"\u05de \u05d3\u05e8\u05d5\u05de\u05d9\u05ea \u05dc\u05d2\u05d1\u05d5\u05dc \u05dc\u05d1\u05e0\u05d5\u05df \u05d4\u05d5\u05d0 \u05e9\u05d8\u05d7 \u05e6\u05d1\u05d0\u05d9 \u05e1\u05d2\u05d5\u05e8. \u05de\u05d5\u05e4\u05e2\u05dc\u05d9\u05dd \u05d1\u05de\u05e7\u05d5\u05dd \u05e9\u05d9\u05d1\u05d5\u05e9\u05d9 GPS"],["\u05db\u05dc\u05d9 \u05ea\u05e7\u05e9\u05d5\u05e8\u05ea \u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd: \u05d5\u05dc\u05d9\u05d3 \u05d1\u05e8\u05db\u05d0\u05ea, \u05e2\u05e8\u05d1\u05d9 \u05de\u05d6\u05e8\u05d7 \u05d9\u05e8\u05d5\u05e9\u05dc\u05de\u05d9, \u05e9\u05d5\u05d7\u05e8\u05e8 \u05d1\u05e2\u05e7\u05d1\u05d5\u05ea \u05e0\u05e4\u05d9\u05dc\u05ea \u05de\u05e9\u05d8\u05e8 \u05d0\u05e1\u05d3, \u05de\u05d4\u05db\u05dc\u05d0 \u05d4\u05e1\u05d5\u05e8\u05d9 \u05dc\u05d0\u05d7\u05e8 42 \u05e9\u05e0\u05d4.\u05d4\u05d5\u05d0 \u05e0\u05de\u05e6\u05d0 \u05db\u05e2\u05ea \u05d1\u05d9\u05e8\u05d3\u05df.4 \u05ea\u05d2\u05d5\u05d1\u05d5\u05ea",false,932,"\u05db\u05dc\u05d9 \u05ea\u05e7\u05e9\u05d5\u05e8\u05ea \u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd: \u05d5\u05dc\u05d9\u05d3 \u05d1\u05e8\u05db\u05d0\u05ea, \u05e2\u05e8\u05d1\u05d9 \u05de\u05d6\u05e8\u05d7 \u05d9\u05e8\u05d5\u05e9\u05dc\u05de\u05d9, \u05e9\u05d5\u05d7\u05e8\u05e8 \u05d1\u05e2\u05e7\u05d1\u05d5\u05ea \u05e0\u05e4\u05d9\u05dc\u05ea \u05de\u05e9\u05d8\u05e8 \u05d0\u05e1\u05d3, \u05de\u05d4\u05db\u05dc\u05d0 \u05d4\u05e1\u05d5\u05e8\u05d9 \u05dc\u05d0\u05d7\u05e8 42 \u05e9\u05e0\u05d4.\u05d4\u05d5\u05d0 \u05e0\u05de\u05e6\u05d0 \u05db\u05e2\u05ea \u05d1\u05d9\u05e8\u05d3\u05df.4 \u05ea\u05d2\u05d5\u05d1\u05d5\u05ea"],["\u05e2\u05e8\u05d5\u05e6\u05d9\u05dd \u05dc\u05d1\u05e0\u05d5\u05e0\u05d9\u05d9\u05dd \u05dc\u05d1\u05e0\u05d5\u05df: \u05de\u05e1\u05d5\u05e7 \u05d0\u05e4\u05d0\u05e6'\u05d9 \u05d9\u05e9\u05e8\u05d0\u05dc\u05d9 \u05e9\u05d9\u05d2\u05e8 \u05dc\u05e4\u05e0\u05d9 \u05d6\u05de\u05df \u05e7\u05e6\u05e8 \u05d8\u05d9\u05dc \u05dc\u05e2\u05d1\u05e8 \u05de\u05d8\u05e8\u05d4 \u05d1\u05e2\u05d9\u05ea\u05e8\u05d5\u05df.  \u05e2\"\u05e4 \u05d3\u05d9\u05d5\u05d5\u05d7 \u05e0\u05d5\u05e1\u05e3 \u05d9\u05e9\u05e0\u05dd \u05d4\u05e8\u05d5\u05d2\u05d9\u05dd \u05d1\u05ea\u05e7\u05d9\u05e4\u05d5\u05ea \u05e6\u05d4\"\u05dc \u05d1\u05e2\u05d9\u05ea\u05d0 \u05d0-\u05e9\u05e2\u05d1, \u05de\u05d5\u05e7\u05d3\u05dd \u05d9\u05d5\u05ea\u05e8.\n",false,933,"\u05e2\u05e8\u05d5\u05e6\u05d9\u05dd \u05dc\u05d1\u05e0\u05d5\u05e0\u05d9\u05d9\u05dd \u05dc\u05d1\u05e0\u05d5\u05df: \u05de\u05e1\u05d5\u05e7 \u05d0\u05e4\u05d0\u05e6'\u05d9 \u05d9\u05e9\u05e8\u05d0\u05dc\u05d9 \u05e9\u05d9\u05d2\u05e8 \u05dc\u05e4\u05e0\u05d9 \u05d6\u05de\u05df \u05e7\u05e6\u05e8 \u05d8\u05d9\u05dc \u05dc\u05e2\u05d1\u05e8 \u05de\u05d8\u05e8\u05d4 \u05d1\u05e2\u05d9\u05ea\u05e8\u05d5\u05df.  \u05e2\"\u05e4 \u05d3\u05d9\u05d5\u05d5\u05d7 \u05e0\u05d5\u05e1\u05e3 \u05d9\u05e9\u05e0\u05dd \u05d4\u05e8\u05d5\u05d2\u05d9\u05dd \u05d1\u05ea\u05e7\u05d9\u05e4\u05d5\u05ea \u05e6\u05d4\"\u05dc \u05d1\u05e2\u05d9\u05ea\u05d0 \u05d0-\u05e9\u05e2\u05d1, \u05de\u05d5\u05e7\u05d3\u05dd \u05d9\u05d5\u05ea\u05e8.\n"],["\u05d2\u05d5\u05dc\u05e9\u05d9\u05dd \u05e2\u05d6\u05ea\u05d9\u05d9\u05dd \u05de\u05d3\u05d5\u05d5\u05d7\u05d9\u05dd \u05e2\u05dc \u05d7\u05d6\u05e8\u05d4 \u05e9\u05dc \u05e9\u05d9\u05e8\u05d5\u05ea\u05d9 \u05d4\u05ea\u05e7\u05e9\u05d5\u05e8\u05ea \u05d1\u05de\u05e8\u05db\u05d6 \u05d4\u05e8\u05e6\u05d5\u05e2\u05d4\u05d0\u05d7\u05e8\u05d9 \u05e9\u05d4\u05d9\u05d5 \u05de\u05d5\u05e9\u05d1\u05ea\u05d9\u05dd \u05d1\u05d9\u05d5\u05de\u05d9\u05d9\u05dd \u05d4\u05d0\u05d7\u05e8\u05d5\u05e0\u05d9\u05dd.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,934,"\u05d2\u05d5\u05dc\u05e9\u05d9\u05dd \u05e2\u05d6\u05ea\u05d9\u05d9\u05dd \u05de\u05d3\u05d5\u05d5\u05d7\u05d9\u05dd \u05e2\u05dc \u05d7\u05d6\u05e8\u05d4 \u05e9\u05dc \u05e9\u05d9\u05e8\u05d5\u05ea\u05d9 \u05d4\u05ea\u05e7\u05e9\u05d5\u05e8\u05ea \u05d1\u05de\u05e8\u05db\u05d6 \u05d4\u05e8\u05e6\u05d5\u05e2\u05d4\u05d0\u05d7\u05e8\u05d9 \u05e9\u05d4\u05d9\u05d5 \u05de\u05d5\u05e9\u05d1\u05ea\u05d9\u05dd \u05d1\u05d9\u05d5\u05de\u05d9\u05d9\u05dd \u05d4\u05d0\u05d7\u05e8\u05d5\u05e0\u05d9\u05dd.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05d9\u05e6\u05d9\u05d0\u05ea \u05d7'\u05d0\u05df \u05d9\u05d5\u05e0\u05e1...\u05e2\u05d5\u05de\u05e1\u05d9\u05dd \u05d1\u05d3\u05e8\u05da \u05d4\u05d7\u05d5\u05e3 \u05d3\u05e8\u05d5\u05de\u05d4.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,935,"\u05d9\u05e6\u05d9\u05d0\u05ea \u05d7'\u05d0\u05df \u05d9\u05d5\u05e0\u05e1...\u05e2\u05d5\u05de\u05e1\u05d9\u05dd \u05d1\u05d3\u05e8\u05da \u05d4\u05d7\u05d5\u05e3 \u05d3\u05e8\u05d5\u05de\u05d4.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05d9\u05e8\u05d5\u05df \u05e9\u05e0\u05d9\u05d9\u05d3\u05e8\u05d3\u05d9\u05d5\u05d5\u05d7\u05d9\u05dd \u05d1\u05ea\u05e7\u05e9\u05d5\u05e8\u05ea \u05d4\u05d0\u05d9\u05e8\u05d0\u05e0\u05d9\u05ea: \u05ea\u05d7\u05e0\u05d5\u05ea \u05d3\u05dc\u05e7 \u05d1\u05e8\u05d7\u05d1\u05d9 \u05d4\u05de\u05d3\u05d9\u05e0\u05d4 \u05d4\u05d5\u05e9\u05d1\u05ea\u05d5. \u05de\u05d5\u05e7\u05d3\u05dd \u05d9\u05d5\u05ea\u05e8 \u05d4\u05d5\u05d3\u05d9\u05e2\u05d4 \u05e7\u05d1\u05d5\u05e6\u05ea \u05d4\u05d0\u05e7\u05e8\u05d9\u05dd \u05e2\u05dc \u05de\u05ea\u05e7\u05e4\u05ea \u05e1\u05d9\u05d9\u05d1\u05e8 \u05e9\u05db\u05d5\u05d5\u05e0\u05d4 \u05e0\u05d2\u05d3 \u05ea\u05d7\u05e0\u05d5\u05ea \u05d3\u05dc\u05e7 \u05d1\u05d0\u05d9\u05e8\u05d0\u05df@N12chat",false,936,"\u05d9\u05e8\u05d5\u05df \u05e9\u05e0\u05d9\u05d9\u05d3\u05e8\u05d3\u05d9\u05d5\u05d5\u05d7\u05d9\u05dd \u05d1\u05ea\u05e7\u05e9\u05d5\u05e8\u05ea \u05d4\u05d0\u05d9\u05e8\u05d0\u05e0\u05d9\u05ea: \u05ea\u05d7\u05e0\u05d5\u05ea \u05d3\u05dc\u05e7 \u05d1\u05e8\u05d7\u05d1\u05d9 \u05d4\u05de\u05d3\u05d9\u05e0\u05d4 \u05d4\u05d5\u05e9\u05d1\u05ea\u05d5. \u05de\u05d5\u05e7\u05d3\u05dd \u05d9\u05d ,667. \u05de\u05e1\u05e4\u05e8 \u05d4\u05e4\u05e6\u05d5\u05e2\u05d9\u05dd \u05e2\u05dc\u05d4 \u05dc 52,586.\n",false,944,"\u05de\u05e9\u05e8\u05d3 \u05d4\u05d1\u05e8\u05d9\u05d0\u05d5\u05ea \u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9:27 \u05d4\u05e8\u05d5\u05d2\u05d9\u05dd \u05d5\u05e2\u05e9\u05e8\u05d4 \u05e4\u05e6\u05d5\u05e2\u05d9\u05dd \u05d1\u05ea\u05e7\u05d9\u05e4\u05d5\u05ea \u05d1\u05d2'\u05d1\u05d0\u05dc\u05d9\u05d0 \u05d1\u05e6\u05e4\u05d5\u05df \u05d4\u05e8\u05e6\u05d5\u05e2\u05d4 \u05d4\u05d1\u05d5\u05e7\u05e8.\u05de\u05e1\u05e4\u05e8 \u05d4\u05d4\u05e8\u05d5\u05d2\u05d9\u05dd \u05d4\u05e4\u05dc\u05e1\u05d8\u05d9\u05e0\u05d9\u05dd \u05d1\u05e8\u05e6\u05d5\u05e2\u05d4 \u05e2\u05dc\u05d4 \u05dc 19,667. \u05de\u05e1\u05e4\u05e8 \u05d4\u05e4\u05e6\u05d5\u05e2\u05d9\u05dd \u05e2\u05dc\u05d4 \u05dc 52,586.\n"],["\u05de\u05e7\u05d5\u05e8\u05d5\u05ea \u05d0\u05d5\u05e4\u05d5\u05d6\u05d9\u05e6\u05d9\u05d4 \u05e1\u05d5\u05e8\u05d9\u05dd: \u05de\u05d8\u05d5\u05e1\u05d9 \u05e7\u05e8\u05d1 \u05d9\u05e9\u05e8\u05d0\u05dc\u05d9\u05dd \u05ea\u05e7\u05e4\u05d5 \u05dc\u05e4\u05e0\u05d9 \u05d6\u05de\u05df \u05e7\u05e6\u05e8 \u05de\u05d7\u05e1\u05e0\u05d9 \u05d0\u05de\u05dc\"\u05d7 \u05d1\u05d0\u05d6\u05d5\u05e8 \u05ea\u05dc \u05d0-\u05ea'\u05e2\u05d0\u05dc\u05d1 \u05d1\u05d9\u05df \u05d4\u05db\u05e4\u05e8 \u05e7\u05d9\u05d8\u05d4 \u05dc\u05db\u05e4\u05e8 \u05d0\u05e0\u05d7'\u05dc \u05d1\u05d3\u05e8\u05d5\u05dd \u05e1\u05d5\u05e8\u05d9\u05d4.2 \u05ea\u05d2\u05d5\u05d1\u05d5\u05ea",false,945,"\u05de\u05e7\u05d5\u05e8\u05d5\u05ea \u05d0\u05d5\u05e4\u05d5\u05d6\u05d9\u05e6\u05d9\u05d4 \u05e1\u05d5\u05e8\u05d9\u05dd: \u05de\u05d8\u05d5\u05e1\u05d9 \u05e7\u05e8\u05d1 \u05d9\u05e9\u05e8\u05d0\u05dc\u05d9\u05dd \u05ea\u05e7\u05e4\u05d5 \u05dc\u05e4\u05e0\u05d9 \u05d6\u05de\u05df \u05e7\u05e6\u05e8 \u05de\u05d7\u05e1\u05e0\u05d9 \u05d0\u05de\u05dc\"\u05d7 \u05d1\u05d0\u05d6\u05d5\u05e8 \u05ea\u05dc \u05d0-\u05ea'\u05e2\u05d0\u05dc\u05d1 \u05d1\u05d9\u05df \u05d4\u05db\u05e4\u0 4\u05dd \u05d4\u05ea\u05d1\u05dc\u05d1\u05dc\u05d5 \u05d1\u05de\u05e7\u05dc\u05d3\u05ea \u05d5\u05d4\u05d5\u05e1\u05d9\u05e4\u05d5 \u05d1\u05e1\u05d5\u05e3 \u05e1\u05d9\u05de\u05df \u05e9\u05d0\u05dc\u05d4 \u05d4\u05e4\u05d5\u05da - \u05db\u05de\u05d5 \u05d1\u05de\u05e7\u05dc\u05d3\u05ea \u05d1\u05e2\u05e8\u05d1\u05d9\u05ea) \u05d4\u05e0\u05d4:  \u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4\u2026"],["\u05d3\u05e1\u05e7 \u05d4\u05d7\u05d5\u05e5\u05e6\u05d1\u05d0 \u05e1\u05d9\u05df: \u05e1\u05e4\u05d9\u05e0\u05ea \u05e7\u05e8\u05d1 \u05e9\u05dc \u05d0\u05e8\u05d4\"\u05d1 \u05e0\u05db\u05e0\u05e1\u05d4 \u05d1\u05d0\u05d5\u05e4\u05df \u05dc\u05d0 \u05d7\u05d5\u05e7\u05d9 \u05dc\"\u05e9\u05e8\u05d8\u05d5\u05df \u05ea\u05d5\u05de\u05d0\u05e1 \u05d4\u05e9\u05e0\u05d9\" \u05e9\u05d1\u05d9\u05dd \u05e1\u05d9\u05df \u05d4\u05d3\u05e8\u05d5\u05de\u05d9 - \u05de\u05d3\u05d5\u05d1\u05e8 \u05d1\"\u05d4\u05e4\u05e8\u05d4 \u05e8\u05e6\u05d9\u05e0\u05d9\u05ea \u05e9\u05dc \u05d4\u05e8\u05d9\u05d1\u05d5\u05e0\u05d5\u05ea \u05d4\u05e1\u05d9\u05e0\u05d9\u05ea \u05d5\u05e2\u05e8\u05e2\u05d5\u05e8 \u05d4\u05e9\u05dc\u05d5\u05dd \u05d5\u05d4\u05d9\u05e6\u05d9\u05d1\u05d5\u05ea \u05d4\u05d0\u05d6\u05d5\u05e8\u05d9\u05d9\u05dd\". \u05e2\u05d5\u05d3 \u05e0\u05de\u05e1\u05e8 \u05de\u05d4\u05e6\u05d1\u05d0 \u05d4\u05e1\u05d9\u05e0\u05d9 \u05db\u05d9 \u05db\u05d5\u05d7\u05d5\u05ea \u05d9\u05de\u05d9\u05d9\u05dd \u05e2\u05d5\u05e7\u05d1\u05d9\u05dd \u05d5\u05de\u05e4\u05e7\u05d7\u05d9\u05dd \u05d0\u05d7\u05e8 \u05d4\u05d0\u05d9\u05e8\u05d5\u05e2@N12chat",false,963,"\u05d3\u05e1\u05e7 \u05d4\u05d7\u05d5\u05e5\u05e6\u05d1\u05d0 \u05e1\u05d9\u05df: \u05e1\u05e4\u05d9\u05e0\u05ea \u05e7\u05e8\u05d1 \u05e9\u05dc \u05d0\u05e8\u05d4\"\u05d1 \u05e0\u05db\u05e0\u05e1\u05d4 \u05d1\u05d0\u05d5\u05e4\u05df \u05dc\u05d0 \u05d7\u05d5\u05e7\u05d9 \u05dc\"\u05e9\u05e8\u05d8\u05d5\u05df \u05ea\u05d5\u05de\u05d0\u05e1 \u05d4\u05e9\u05e0\u05d9\" \u05e9\u05d1\u05d9\u05dd \u05e1\u05d9\u05df \u05d4\u05d3\u05e8\u05d5\u05de\u05d9 - \u05de\u05d3\u05d5\u05d1\u05e8 \u05d1\"\u05d4\u05e4\u05e8\u05d4 \u05e8\u05e6\u05d9\u05e0\u05d9\u05ea \u05e9\u05dc \u05d4\u05e8\u05d9\u05d1\u05d5\u05e0\u05d5\u05ea \u05d4\u05e1\u05d9\u05e0\u05d9\u05ea \u05d5\u05e2\u05e8\u05e2\u05d5\u05e8 \u05d4\u05e9\u05dc\u05d5\u05dd \u05d5\u05d4\u05d9\u05e6\u05d9\u05d1\u05d5\u05ea \u05d4\u05d0\u05d6\u05d5\u05e8\u05d9\u05d9\u05dd\". \u05e2\u05d5\u05d3 \u05e0\u05de\u05e1\u05e8 \u05de\u05d4\u05e6\u05d1\u05d0 \u05d4\u05e1\u05d9\u05e0\u05d9 \u05db\u05d9 \u05db\u05d5\u05d7\u05d5\u05ea \u05d9\u05de\u05d9\u05d9\u05dd \u05e2\u05d5\u05e7\u05d1\u05d9\u05dd \u05d5\u05de\u05e4\u05e7\u05d7\u05d9\u05dd \u05d0\u05d7\u05e8 \u05d4\u05d0\u05d9\u05e8\u05d5\u05e2@N12chat"],["\u05d9\u05e9 \u05dc\u05d5 149 \u05d0\u05d6\u05db\u05d5\u05e8\u05d9\u05dd \u05db\u05d0\u05df \u05d1\u05e2\u05e8\u05d5\u05e5",false,964,"\u05d9\u05e9 \u05dc\u05d5 149 \u05d0\u05d6\u05db\u05d5\u05e8\u05d9\u05dd \u05db\u05d0\u05df \u05d1\u05e2\u05e8\u05d5\u05e5"],["\u05e2\u05db\u05d0\u05e8, \u05e6\u05e4\u05d5\u05df \u05dc\u05d1\u05e0\u05d5\u05df, \u05d4\u05dc\u05d9\u05dc\u05d4: \u05e4\u05e8\u05d9\u05e6\u05d4 \u05dc\u05de\u05e9\u05e8\u05d3\u05d9 \u05de\u05e4\u05dc\u05d2\u05ea \u05d4\u05d1\u05e2\u05ea' (\u05de\u05e4\u05dc\u05d2\u05ea \u05d4\u05e9\u05dc\u05d8\u05d5\u05df \u05e9\u05dc  \u05d0\u05e1\u05d3 \u05d1\u05e1\u05d5\u05e8\u05d9\u05d4) \u05d5\u05d4\u05e9\u05d7\u05ea\u05ea\u05dd.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,965,"\u05e2\u05db\u05d0\u05e8, \u05e6\u05e4\u05d5\u05df \u05dc\u05d1\u05e0\u05d5\u05df, \u05d4\u05dc\u05d9\u05dc\u05d4: \u05e4\u05e8\u05d9\u05e6\u05d4 \u05dc\u05de\u05e9\u05e8\u05d3\u05d9 \u05de\u05e4\u05dc\u05d2\u05ea \u05d4\u05d1\u05e2\u05ea' (\u05de\u05e4\u05dc\u05d2\u05ea \u05d4\u05e9\u05dc\u05d8\u05d5\u05df \u05e9\u05dc  \u05d0\u05e1\u05d3 \u05d1\u05e1\u05d5\u05e8\u05d9\u05d4) \u05d5\u05d4\u05e9\u05d7\u05ea\u05ea\u05dd.\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05d1\u05db\u05d9\u05e8 \u05d4\u05d7\u05de\u05d0\u05e1 \u05d0\u05e1\u05d0\u05de\u05d4 \u05d7\u05de\u05d3\u05d0\u05df \u05de\u05d2\u05d9\u05d1 \u05dc\u05d3\u05d9\u05d5\u05d5\u05d7\u05d9\u05dd \u05e9\u05d9\u05e9\u05e8\u05d0\u05dc \u05de\u05ea\u05db\u05d5\u05d5\u05e0\u05ea \u05dc\u05d4\u05e6\u05d9\u05e3 \u05d0\u05ea \u05de\u05e0\u05d4\u05e8\u05d5\u05ea \u05d7\u05de\u05d0\u05e1 \u05d1\u05de\u05d9 \u05d9\u05dd:\"\u05d4\u05de\u05e0\u05d4\u05e8\u05d5\u05ea \u05e0\u05d1\u05e0\u05d5 \u05d1\u05d9\u05d3\u05d9 \u05de\u05d4\u05e0\u05d3\u05e1\u05d9\u05dd \u05d1\u05e2\u05dc\u05d9 \u05d9\u05d3\u05e2. \u05d4\u05df \u05ea\u05d5\u05db\u05e0\u05e0\u05d5 \u05d1\u05d0\u05d5\u05e4\u05df \u05e9\u05d9\u05d5\u05db\u05dc\u05d5 \u05dc\u05d4\u05ea\u05de\u05d5\u05d3\u05d3 \u05e2\u05dd \u05e1\u05db\u05e0\u05d5\u05ea \u05d0\u05e4\u05e9\u05e8\u05d9\u05d5\u05ea...\"###\u05d1\u05d8\u05d7 \u05e9\u05de\u05d5 \u05dc\u05d4\u05df \u05d0\u05ea \u05d4\u05e6\u05d9\u05e4\u05d5\u05d9 \u05d4\u05de\u05d9\u05d5\u05d7\u05d3 \u05e0\u05d2\u05d3 \u05de\u05d9\u05dd(:",false,966,"\u05d1\u05db\u05d9\u05e8 \u05d4\u05d7\u05de\u05d0\u05e1 \u05d0\u05e1\u05d0\u05de\u05d4 \u05d7\u05de\u05d3\u05d0\u05df \u05de\u05d2\u05d9\u05d1 \u05dc\u05d3\u05d9\u05d5\u05d5\u05d7\u05d9\u05dd \u05e9\u05d9\u05e9\u05e8\u05d0\u05dc \u05de\u05ea\u05db\u05d5\u05d5\u05e0\u05ea \u05dc\u05d4\u05e6\u05d9\u05e3 \u05d0\u05ea \u05de\u05e0\u05d4\u05e8\u05d5\u05ea \u05d7\u05de\u05d0\u05e1 \u05d1\u05de\u05d9 \u05d9\u05dd:\"\u05d4\u05de\u05e0\u05d4\u05e8\u05d5\u05ea \u05e0\u05d1\u05e0\u05d5 \u05d1\u05d9\u05d3\u05d9 \u05de\u05d4\u05e0\u05d3\u05e1\u05d9\u05dd \u05d1\u05e2\u05dc\u05d9 \u05d9\u05d3\u05e2. \u05d4\u05df \u05ea\u05d5\u05db\u05e0\u05e0\u05d5 \u05d1\u05d0\u05d5\u05e4\u05df \u05e9\u05d9\u05d5\u05db\u05dc\u05d5 \u05dc\u05d4\u05ea\u05de\u05d5\u05d3\u05d3 \u05e2\u05dd \u05e1\u05db\u05e0\u05d5\u05ea \u05d0\u05e4\u05e9\u05e8\u05d9\u05d5\u05ea...\"###\u05d1\u05d8\u05d7 \u05e9\u05de\u05d5 \u05dc\u05d4\u05df \u05d0\u05ea \u05d4\u05e6\u05d9\u05e4\u05d5\u05d9 \u05d4\u05de\u05d9\u05d5\u05d7\u05d3 \u05e0\u05d2\u05d3 \u05de\u05d9\u05dd(:"],["\u05de\u05d4\u05ea\u05e7\u05d9\u05e4\u05d5\u05ea \u05d1\u05d7'\u05d0\u05df \u05d9\u05d5\u05e0\u05e1, \u05de\u05d5\u05e7\u05d3\u05dd \u05d9\u05d5\u05ea\u05e8 \u05d4\u05d9\u05d5\u05dd\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df",false,967,"\u05de\u05d4\u05ea\u05e7\u05d9\u05e4\u05d5\u05ea \u05d1\u05d7'\u05d0\u05df \u05d9\u05d5\u05e0\u05e1, \u05de\u05d5\u05e7\u05d3\u05dd \u05d9\u05d5\u05ea\u05e8 \u05d4\u05d9\u05d5\u05dd\u05db\u05d3\u05d9 \u05dc\u05d4\u05d2\u05d9\u05d1 \u05dc\u05db\u05ea\u05d1\u05d4 \u05dc\u05d7\u05e6\u05d5 \u05db\u05d0\u05df"],["\u05de\u05e9\u05dc\u05d7\u05ea \u05e8\u05e9\u05de\u05d9\u05ea \u05e8\u05d0\u05e9\u05d5\u05e0\u05d4 \u05d1\u05e2\u05d6\u05d4 \u05de\u05d0\u05d6 \u05e4\u05e8\u05d5\u05e5 \u05d4\u05de\u05dc\u05d7\u05de\u05d4\u05d4\u05d9\u05d5\u05dd \u05e0\u05db\u05e0\u05e1\u05d4 \u05dc\u05e8\u05e6\u05d5\u05e2\u05d4 \u05d3\u05e8\u05da \u05de\u05e2\u05d1\u05e8 \u05e8\u05e4\u05d9\u05d7 \u05de\u05e9\u05dc\u05d7\u05ea \u05e8\u05e9\u05de\u05d9\u05ea \u05e8\u05d0\u05e9\u05d5\u05e0\u05d4: \u05de\u05e9\u05dc\u05d7\u05ea \u05e7\u05d8\u05e8\u05d9\u05ea \u05e9\u05db\u05dc\u05dc\u05d4 \u05d0\u05ea \u05dc\u05d5\u05dc\u05d5\u05d4 \u05d0\u05dc\u05d7'\u05d0\u05d8\u05e8 \u05e1\u05d2\u05e0\u05d9\u05ea \u05e9\u05e8 \u05d4\u05d7\u05d5\u05e5 \u05d4\u05e7\u05d8\u05e8\u05d9 \u05d5\u05d0\u05ea \u05d7'\u05d0\u05dc\u05d3 \u05d7\u05e8\u05d3\u05d0\u05df \u05e1\u05d2\u05e0\u05d5 \u05e9\u05dc \u05d4\u05e9\u05d2\u05e8\u05d9\u05e8 \u05d4\u05e7\u05d8\u05e8\u05d9 (\u05e9\u05e8\u05d2\u05d9\u05dc \u05dc\u05d4\u05db\u05e0\u05e1 \u05dc\u05e8\u05e6\u05d5\u05e2\u05d4 \u05de\u05d9\u05e9\u05e8\u05d0\u05dc \u05d3\u05e8\u05da \u05de\u05e2\u05d1\u05e8 \u05d0\u05e8\u05d6 \u05d1\u05d3\"\u05db) .\u05db\u05d3\u05d9 \u05dc     <style>
    /* The Modal (background) */
    .modal {
        display: none; /* Hidden by default */
        position: fixed; /* Stay in place */
        z-index: 1000; /* Sit on top */
        padding-top: 50px; /* Location of the box */
        left: 0;
        top: 0;
        width: 100%; /* Full width */
        height: 100%; /* Full height */
        overflow: auto; /* Enable scroll if needed */
        background-color: rgba(0, 0, 0, 0.9); /* Black w/ opacity */
    }

    /* Modal Content */
    .modal-content {
        background-color: #000; /* Black background */
        margin: auto;
        padding: 20px;
        border: 1px solid #888;
        color: #fff; /* White text */
        white-space: pre-wrap; /* Preserve whitespace and line breaks */
        font-size: 16px; /* Increased font size for better readability */
        max-width: 90%; /* Maximum width relative to viewport */
        max-height: 80vh; /* Maximum height relative to viewport */
        overflow: auto; /* Enable scrolling if content exceeds max-height */
        box-sizing: border-box; /* Include padding and border in element's total width and height */
    }

    /* The Close Button */
    .close {
        color: #aaa;
        float: right;
        font-size: 28px;
        font-weight: bold;
    }

    .close:hover,
    .close:focus {
        color: #fff;
        text-decoration: none;
        cursor: pointer;
    }
    </style>

    <div id="summaryModal" class="modal">
      <div class="modal-content">
        <span class="close">&times;</span>
        <p id="summaryText" tabindex="-1"></p> <!-- Make it focusable -->
      </div>
    </div>

    <script>
    document.addEventListener('DOMContentLoaded', function() {
        var modal = document.getElementById("summaryModal");
        var span = document.getElementsByClassName("close")[0];
        var summaryText = document.getElementById("summaryText");

        var plot = document.getElementsByClassName('plotly-graph-div')[0];
        plot.on('plotly_click', function(data) {
            var point = data.points[0];
            var customdata = point.customdata;
            var text = customdata[3]; // Summary or abstract is the 4th element

            if (text && text !== "") {
                // Display the text in the modal
                summaryText.textContent = text;
                modal.style.display = "block";
                summaryText.focus();  // Set focus to the summary text
            }
        });

        // When the user clicks on <span> (x), close the modal
        span.onclick = function() {
            modal.style.display = "none";
        }

        // When the user clicks anywhere outside of the modal, close it
        window.onclick = function(event) {
            if (event.target == modal) {
                modal.style.display = "none";
            }
        }

        // Allow closing the modal with the Esc key
        document.addEventListener('keydown', function(event) {
            if (event.key === "Escape") {
                modal.style.display = "none";
            }
        });
    });
    </script>
